INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(1, 'Little Spider\'s Shapes', 'Little-Spider\'s-Shapes', 'http://books.google.com/books/content?id=kF_CzAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kF_CzAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789474886', 'Learn shapes with Little Spider, as she tries to decide what shape she wants her web to be! Follow the finger trail paths and recite the rhymes as you find circles, stars, squares and more! With flaps on every page and sweet illustrations, Little Spider\'s Shapes is sure to be a family favourite!', NULL, 414, 1, NULL, 100.00, NULL, '2021-03-05 23:27:56', '2021-03-05 23:27:56'),
(2, 'Five Sparkly Mermaids', 'Five-Sparkly-Mermaids', 'http://books.google.com/books/content?id=h7hMzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=h7hMzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789472646', 'Count down from five with the sparkly mermaids in this magical board book! Read the playful rhyme and watch as the glitter-filled mermaid tails disappear one by one with the turn of the page. This tactile book offers plenty for young children to look at and explore.', NULL, 429, 1, NULL, 100.00, NULL, '2021-03-05 23:27:57', '2021-03-05 23:27:57'),
(3, 'Squishy Squashy Puppy', 'Squishy-Squashy-Puppy', 'http://books.google.com/books/content?id=Jwm7yQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Jwm7yQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789581560', '', NULL, 430, 1, NULL, 100.00, NULL, '2021-03-05 23:28:01', '2021-03-05 23:28:01'),
(4, 'Do You Believe in Groovicorns?', 'Do-You-Believe-in-Groovicorns?', 'http://books.google.com/books/content?id=HLYRtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HLYRtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786929648', 'Everyone loves unicorns, but the groovicorns are even more fun! This unique touch-and-feel book is perfect for young children, with a funny rhyme that explains why groovicorns are better than unicorns.', NULL, 379, 1, NULL, 100.00, NULL, '2021-03-05 23:28:10', '2021-03-05 23:28:10'),
(5, 'Never Touch a Shark!', 'Never-Touch-a-Shark!', 'http://books.google.com/books/content?id=vdvougEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vdvougEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788436809', 'You must never touch a shark... except in this book! This ocean-themed touch-and-feel book is perfect for young children. They will love reading the funny rhyme that warns of the dangers of touching a sharkand then ignoring the advice! Innovative silicone touches feature throughout the book, with a different texture for children to explore on every spread.', NULL, 414, 1, NULL, 100.00, NULL, '2021-03-05 23:28:10', '2021-03-05 23:28:10'),
(6, 'Magic Scribbles Unicorn Mysteries', 'Magic-Scribbles-Unicorn-Mysteries', 'http://books.google.com/books/content?id=vDm_zAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vDm_zAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789474138', 'The Silver Squad are called in to help find the missing Sparkle Stone in this innovative activity book. Use the magic pen to reveal hidden ink on the pages. Solve the clues, search for hidden symbols and crack the codes to help the unicorn squad solve the mystery. With surprising twists and turns, this activity book is perfect for junior detectives and unicorn lovers alike! Innovative magic ink activity book, including a magic pen and card press outs. This book includes a magic ink pen to use throughout. With card press outs to assemble and use to complete the activities. The pages are packed with puzzles, codes, word games and more! Kids will love following the story as they solve the mystery.', NULL, 431, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(7, 'Jungle Sounds', 'Jungle-Sounds', 'http://books.google.com/books/content?id=Z3vPjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Z3vPjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409597704', 'Fingertrails and half-cuts in addition to sounds embedded in the page, make this an exciting experience. The bright, colourful artwork enhanced with cut-outs to peep through. Best of all, press the pages and bring the jungle to life with a croaking frogs, a shower of rain, screeching parrots, roaring lions and other creatures. A delightful gift for a young child.', NULL, 3, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(8, 'Baby\'s Very First Lift-The-Flap Peek-a-Boo BB', 'Baby\'s-Very-First-Lift-The-Flap-Peek-a-Boo-BB', 'http://books.google.com/books/content?id=oeHXxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oeHXxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474967860', 'This delightful addition to the Baby\'s Very First series has sturdy, shaped gatefold flaps, perfect for little fingers to open and close. Babies will love playing peek-a-book with familiar animals from the series. This is part of the award winning series of brightly coloured, high contrast books for babies. A perfect book for sharing with babies at all stages of their development. It includes flaps, shaped pages and holes that reveal little surprises to spot and talk about.', NULL, 14, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(9, 'Colours', 'Colours', 'http://books.google.com/books/content?id=138hnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=138hnQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409540571', 'This is a book about colours for preschool children. It has flaps to lift and lots of colour vocabulary.', NULL, 1, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(10, 'Baby\'s Very First Touchy-Feely Colours Play Book', 'Baby\'s-Very-First-Touchy-Feely-Colours-Play-Book', 'http://books.google.com/books/content?id=wRZ7ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wRZ7ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409565116', 'Babies will love looking at the bright pictures and exploring the textures as they learn their colours in this vibrant board book. Each page is specially designed to be visually stimulating with bright, eye-catching illustrations and lots to look at. A fun aid to developing language and sensory skills for the very young, this book includes die-cut trails to run little fingers along and holes to peep through.', NULL, 14, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(11, 'Squishy Taylor in Zero Gravity', 'Squishy-Taylor-in-Zero-Gravity', 'http://books.google.com/books/content?id=zep3DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=zep3DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781474767163', 'How long would it take to cycle to a space station? Why does red cordial make everyone more fun? How come you can\'t hug over the internet? Why is there a renegade astronaut on the roof? With her bravery and enthusiasm, these mysteries should be no problem for super-sleuth Squishy Taylor!', NULL, 432, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(12, 'Squishy Taylor and the Tunnel of Doom', 'Squishy-Taylor-and-the-Tunnel-of-Doom', 'http://books.google.com/books/content?id=4-p3DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4-p3DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781474767156', 'Why are tunnels both exciting and scary? How do dogs always know who the bad guys are? Why are pinkie-swears so important? Who\'s storing toxic waste under the park? It will take a sleuth like Squishy Taylor to investigate these mysteries!', NULL, 432, 1, NULL, 100.00, NULL, '2021-03-05 23:28:13', '2021-03-05 23:28:13'),
(13, 'Squishy Taylor and the Vase that Wasn\'t', 'Squishy-Taylor-and-the-Vase-that-Wasn\'t', 'http://books.google.com/books/content?id=G_o9DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=G_o9DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781782027713', '', NULL, 432, 1, NULL, 100.00, NULL, '2021-03-05 23:28:14', '2021-03-05 23:28:14'),
(14, 'Squishy Taylor and the Bonus Sisters', 'Squishy-Taylor-and-the-Bonus-Sisters', 'http://books.google.com/books/content?id=F_o9DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=F_o9DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781782027690', '', NULL, 432, 1, NULL, 100.00, NULL, '2021-03-05 23:28:14', '2021-03-05 23:28:14'),
(15, 'Squishy Taylor and a Question of Trust', 'Squishy-Taylor-and-a-Question-of-Trust', 'http://books.google.com/books/content?id=Gfo9DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Gfo9DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781782027683', '', NULL, 432, 1, NULL, 100.00, NULL, '2021-03-05 23:28:14', '2021-03-05 23:28:14'),
(16, 'Match! Football Puzzles', 'Match!-Football-Puzzles', 'http://books.google.com/books/content?id=ElVnswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ElVnswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509880089', 'The only soccer puzzle book you will ever need, from the makers of Match! the UK\'s best football magazine.Packed with brilliant footy puzzles, including spot the difference, wordsearches, crosswords, hidden-ball puzzles, wordfits, player quizzes, anagrams, odd one out and loads more!', NULL, 434, 1, NULL, 100.00, NULL, '2021-03-05 23:28:14', '2021-03-05 23:28:14'),
(17, 'Match! Football Joke Book', 'Match!-Football-Joke-Book', 'http://books.google.com/books/content?id=t_WdwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=t_WdwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529026672', 'Match! Football Joke Book is filled with loads of hilarious, silly jokes about football that will keep you laughing for days!Why did the chicken run on to the pitch? Because the referee blew for a foul.When is a footballer like a baby? When he dribbles.With funny illustrations, young footie fanatics will be laughing through those all-important World Cup games, Premier League matches and European Cup finals - this football shaped book is the perfect gift for any footy fan!', NULL, 434, 1, NULL, 100.00, NULL, '2021-03-05 23:28:14', '2021-03-05 23:28:14'),
