(51, 'Caterpillar Butterfly', 'Caterpillar-Butterfly', 'http://books.google.com/books/content?id=y3RprgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=y3RprgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406365436', 'Synopsis coming soon.......', NULL, 439, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(52, 'Mr Creep the Crook', 'Mr-Creep-the-Crook', 'http://books.google.com/books/content?id=2VPArQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2VPArQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780723297703', '', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(53, 'Super Pants!', 'Super-Pants!', 'http://books.google.com/books/content?id=9WyDtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9WyDtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848698406', 'When little Lola gets a pair of SUPER PANTS for Christmas she is so excited! When her daddy gets a matching costume, he knows he\'s in for a long day. \"I\'m a pretty good superhero!\" cries Lola. \"But... my daddy is the best of all!\" A brilliant book for all budding superheroes (and their super dads of course!).', NULL, 385, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(54, 'Time for Bed, Little One', 'Time-for-Bed,-Little-One', '', '', '9781848694583', '\"The sun is rising and Little Fox should be settling down to bed. But he doesn\'t want to sleep all through the day, when everyone else is having fun! ...\" --back cover.', NULL, 420, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(55, 'Penny and Pup', 'Penny-and-Pup', '', '', '9781848697799', 'Penny the puppy has a floppy toy pup which she chews and loves to bits. With Pup for company, Penny doesn\'t need friends like Henry the cat, Betsy the rabbit, or Matt the fox cub. Then one day Penny loses Pup and she doesn\'t know who to turn to for help.', NULL, 421, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(56, 'Frozen', 'Frozen', 'http://books.google.com/books/content?id=3DgGjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3DgGjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474821605', '', NULL, 419, 1, 2, 100.00, NULL, '2021-03-05 23:28:26', '2021-03-05 23:28:26'),
(57, 'Wanted!', 'Wanted!', 'http://books.google.com/books/content?id=wh7vBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wh7vBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408843130', 'Ralfy the rabbit wants to read books all the time even if it means he has to steal them, and soon his obsession sends him spiraling into a life of crime.', NULL, 449, 1, 2, 100.00, NULL, '2021-03-05 23:28:30', '2021-03-05 23:28:30'),
(58, 'The Noisy Foxes', 'The-Noisy-Foxes', 'http://books.google.com/books/content?id=bX4_nwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bX4_nwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782444770', 'A family of noisy foxes find out that the grass isn\'t always greener in this storybook, written and illustrated by award-winning artist, Amy Husband.', NULL, 450, 1, 2, 100.00, NULL, '2021-03-05 23:28:30', '2021-03-05 23:28:30'),
(59, 'What a Mess!', 'What-a-Mess!', 'http://books.google.com/books/content?id=yfSbuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yfSbuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848954762', 'Bear and Mouse are fedup being stuck inside on a rainy day until they find things to do...', NULL, 451, 1, 2, 100.00, NULL, '2021-03-05 23:28:30', '2021-03-05 23:28:30'),
(60, 'Say Goodnight To The Sleepy Animals! - S', 'Say-Goodnight-To-The-Sleepy-Animals!---S', '', '', '9780230749900', '', NULL, 452, 1, 2, 100.00, NULL, '2021-03-05 23:28:30', '2021-03-05 23:28:30'),
(61, 'Say Hello to the Jungle Animals!', 'Say-Hello-to-the-Jungle-Animals!', '', '', '9781509801374', '', NULL, 452, 1, 2, 100.00, NULL, '2021-03-05 23:28:31', '2021-03-05 23:28:31'),
(62, 'Say Hello To The Snowy Animals! - Specia', 'Say-Hello-To-The-Snowy-Animals!---Specia', '', '', '9780230749894', '', NULL, 453, 1, 2, 100.00, NULL, '2021-03-05 23:28:31', '2021-03-05 23:28:31'),
(63, 'William\'s Winter Wish', 'William\'s-Winter-Wish', 'http://books.google.com/books/content?id=WxCZpwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=WxCZpwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780230758179', 'Let it SNOW! William longs for it to snow. Maybe if he makes a wish on Grandpa\'s snow globe it will really happen. But disaster strikes when William drops the globe and breaks it! How can he say sorry to Grandpa, and will his wish ever come true? A sparkling story of magical winter wishes.', NULL, 380, 1, 2, 100.00, NULL, '2021-03-05 23:28:31', '2021-03-05 23:28:31'),
(64, 'The Best Christmas Present Ever!', 'The-Best-Christmas-Present-Ever!', 'http://books.google.com/books/content?id=IrqVCwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IrqVCwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447284000', 'It\'s Christmas and Bear wants to give his best friend Squirrel an extra special present. So he decides to make him a gift. Except Bear isn\'t very good at making things. Everything he tries is a disaster. He can\'t give Squirrel a badly knitted jumper, a terrible painting or a broken rocking chair. But maybe if he puts them together they might turn out to be the best Christmas present ever...A funny, charming sequel to THE BEST BIRTHDAY PRESENT EVER! The perfect gift for Christmas - not just for squirrels!', NULL, 381, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(65, 'The Christmas Show', 'The-Christmas-Show', 'http://books.google.com/books/content?id=TNjRmgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TNjRmgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447220190', 'It\'s Christmas and the children have been practising very hard for their nativity play. The narrators are word-perfect, the Important Angel has brushed her hair and the audience are in their seats. But when the curtain rises, no one\'s expecting a spare shepherd to steal the show ...A bright, bold, brilliantly observed book that\'s full of festive fun - with a gorgeously glittery cover that makes it the perfect stocking filler!', NULL, 382, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(66, 'SQUISH SQUASH SQUEEZE', 'SQUISH-SQUASH-SQUEEZE', '', '', '9781788810418', '', NULL, 383, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(67, 'Goodnight Tiger', 'Goodnight-Tiger', 'http://books.google.com/books/content?id=-EVZjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-EVZjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848691865', 'Goodnight Tiger is a quirky, funny bedtime story book, full of jungle animals and surprises. With vibrant, characterful illustrations, this charming picture book by best-selling author Timothy Knapman is sure to delight children at bedtime - and it\'s great for reinforcing bath and bedtime routines too. The animals in Emily\'s jungle wallpaper can\'t sleep, and they are bellowing and stomping and growling and keeping her awake! So Emily climbs into the wallpaper and shows the animals how to get ready for bed. Only baths and lullabies aren\'t quite the same in the jungle...!', NULL, 384, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(68, 'Hippobottymus', 'Hippobottymus', 'http://books.google.com/books/content?id=itrmoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=itrmoQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848690516', 'Plinkety-plonk! Tweetily-tweet! The jungle animals are making music to the sound of the bubbling creek! But – goodness me! – what is that naughty hippo up to? A bonkers, musical rhyming story with a laugh-out-loud, farting surprise! Dance and sing along to the musical noises – and bottoms - of the animals in this funny book by the award-winning author, Steve Smallman (Big Bear’s Bottom, Dragon Stew). Kids will love the bright and lively illustrations from Ada Grey (Shhh! Don’t Wake the Royal Baby). Packed with laughs and rhymes, Hippobottymus is the perfect picture book for parents and children to read aloud.', NULL, 385, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(69, 'Little Why', 'Little-Why', 'http://books.google.com/books/content?id=a3AdswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=a3AdswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848691834', 'Little Why just can\'t stay in line. There is so much to see - like Giraffe\'s long-lofty leggy legs and Wildebeest\'s spiny-spiky horns. Why can\'t he have legs and horns like them? And then Little Why spots Crocodile\'s snippy-snappy teeth... Look out! With stylish and striking art from Jonny Lambert, Little Why is a visually stunning picture book with a heart-warming message at its core. Children will love Little Why\'s adorable, excitable character and discovering the different animals in the African savannah. A perfect story book for gently introducing themes of positive body image and the dangers of toddlers and little children running away from their parents.', NULL, 386, 1, 2, 100.00, NULL, '2021-03-05 23:28:32', '2021-03-05 23:28:32'),
(70, 'What Do You Do If Your House is a Zoo?', 'What-Do-You-Do-If-Your-House-is-a-Zoo?', 'http://books.google.com/books/content?id=V7PiwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=V7PiwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848699502', 'Oscar\'s getting a pet! But which pet should he pick? And what on earth will he do when they all move in? His house is like a zoo! A book for animal lovers BIG and small.', NULL, 387, 1, 2, 100.00, NULL, '2021-03-05 23:28:33', '2021-03-05 23:28:33'),
(71, 'Poo in the Zoo', 'Poo-in-the-Zoo', 'http://books.google.com/books/content?id=2gUHrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2gUHrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848691384', '“There was tiger poo, lion poo, prickly porcupine poo, Plummeting giraffe poop that landed with a splat. Dollops of gnu poo, bouncy kangaroo poo, A trail of drippy droppings from a fat wombat!” Zoo Keeper Bob is exhausted. There’s too much poo in the zoo – and he’s the one who has to scoop it up. Then one day, a mysterious glowing poo appears! Could it be alien poop from outer space? And what on EARTH will Bob do with it? Perfect for fans of The Dinosaur who Pooped the Planet, children will laugh out loud at this gloriously funny, poopy picture book! Packed with humour, the romping rhyme and deliciously cheeky wordplay is a joy to read aloud. From the author of Dragon Stew, Steve Smallman and illustrator, Ada Grey (Shh! Don\'t Wake the Royal Baby).', NULL, 385, 1, 2, 100.00, NULL, '2021-03-05 23:28:33', '2021-03-05 23:28:33'),
(72, 'The Christmas Extravaganza Hotel', 'The-Christmas-Extravaganza-Hotel', 'http://books.google.com/books/content?id=pAIoxAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pAIoxAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848699380', 'Bear is ready for a calm, cosy Christmas. Frog is ready for a tinsel-tastic Christmas at the Extravaganza Hotel! Neither is ready for what happens next . . . ! A fabulously festive tale about the joys of the unexpected.', NULL, 388, 1, 2, 100.00, NULL, '2021-03-05 23:28:33', '2021-03-05 23:28:33'),
(73, 'Miss Brick the Builders\' Baby', 'Miss-Brick-the-Builders\'-Baby', 'http://books.google.com/books/content?id=3ZYEMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3ZYEMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141377476', 'Mr and Mrs Brick are builders, just like their mothers and fathers and grandmothers and grandfathers. But their new baby doesn\'t seem to be following in their footsteps. Instead of building things up, she keeps knocking things down! Based on the classic \'Happy Families\' card game, this highly entertaining series is ideal for reading and sharing at home or at school. It is guided by the Education Adviser, Brian Thompson, and written by the award-winning author, Allan Ahlberg. \'The best thing to happen to beginner readers since Dr Seuss\' Children\'s Rights Workshop.', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(74, 'Mr Tick the Teacher', 'Mr-Tick-the-Teacher', 'http://books.google.com/books/content?id=Nx0ljwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Nx0ljwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141369969', 'One of the classic Happy Families stories written by Allan Ahlberg and illustrated by Faith Jaques. Mr Tick loves teaching his six children at their little school. But then they hear news that all small schools must close, so Mr Tick starts teaching some rather unusual lessons - in how to trick stern school inspectors. Based on the classic \'Happy Families\' card game, this highly entertaining series is ideal for reading and sharing at home or at school. It is guided by the Education Adviser, Brian Thompson, and written by the award-winning author, Allan Ahlberg. \'The best thing to happen to beginner readers since Dr Seuss\' Children\'s Rights Workshop.', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(75, 'Mrs Lather\'s Laundry', 'Mrs-Lather\'s-Laundry', 'http://books.google.com/books/content?id=uzBkjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uzBkjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141369952', 'A classic Happy Families story written by Allan Ahlberg and illustrated by Andre Amstutz Mrs Lather is getting quite worked up in her laundry. She hates washing socks, she hates washing vests, she really doesn\'t much like washing trousers or dresses either. But her job gets rather more difficult when her customers start bringing in more unusual washing loads ... The \'Happy Families\' series is designed for use at home or at school. It is guided by the Education Adviser, Brian Thompson, and written by the award-winning author, Allan Ahlberg. \'The best thing to happen to beginner readers since Dr Seuss\' Children\'s Rights Workshop.', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(76, 'Miss Jump the Jockey', 'Miss-Jump-the-Jockey', 'http://books.google.com/books/content?id=Ug6LngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ug6LngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141352398', '', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(77, 'Master Track\'s Train', 'Master-Track\'s-Train', 'http://books.google.com/books/content?id=9z4yngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9z4yngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780723293934', 'Annotation. Here is an announcement! The train approaching platform two is full of stolen goods . . . Mr Track is the train driver, and Mrs Track is the driver\'s wife. Toby Track is their little boy and he is exceptionally good at jumping onto stolen trains and rescuing them from crooks!A hilarious Happy Families picture book from master storyteller, Allan Ahlberg.', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(78, 'Mrs Wobble the Waitress', 'Mrs-Wobble-the-Waitress', 'http://books.google.com/books/content?id=mLLLkQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mLLLkQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780723275596', 'Mrs Wobble loves her job as a waitress but, oh dear, there\'s one big problem - she wobbles!! And when she wibbles and wobbles and drops jelly everywhere, it\'s time for a new job! Luckily, Mr Wobble, and all the Wobble children have a cunning plan.', NULL, 389, 1, 2, 100.00, NULL, '2021-03-05 23:28:37', '2021-03-05 23:28:37'),
(79, 'Cars', 'Cars', 'http://books.google.com/books/content?id=sL9txwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sL9txwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241244432', 'Learn about lots of different cars big cars, little cars, fast cars, and special cars. See what they look like and who drives them. For more than 35 years, the best-selling Read it yourself with Ladybird has helped children learn to read. All books feature essential key words. Title-specific words are repeated to practice throughout. Designed to be read independently at home or used in a guided reading session at school. All titles include comprehension puzzles, guidance notes, and book band information for schools. This Level 1 title is suitable for very early readers who are ready to take their first steps in reading real stories. Each simple story uses a small number of frequently repeated words.\"', NULL, 390, 1, 2, 100.00, NULL, '2021-03-05 23:28:41', '2021-03-05 23:28:41');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(80, 'Dinosaurs', 'Dinosaurs', '', '', '9780723295068', 'This book helps you to find out all about the dinosaurs that lived a long, long time ago - big ones, small ones, scary meat-eaters and peaceful plant-eaters. For over thirty-five years, the best-selling Read it yourself with Ladybird has helped children learn to read. All titles feature essential key words. Title-specific words are repeated to practise throughout. It is designed to be read independently at home or used in a guided reading session at school. All titles include comprehension questions or puzzles, guidance notes and book band information for schools. This Level 1 title is suitable for very early readers who are ready to take their first steps in reading. It offers a small number of frequently repeated words, simple facts, clearly labelled images and captions to fully engage the reader. It includes contents, index and a picture glossary.', NULL, 391, 1, 2, 100.00, NULL, '2021-03-05 23:28:43', '2021-03-05 23:28:43'),
(81, 'Goldilocks and the Three Bears', 'Goldilocks-and-the-Three-Bears', 'http://books.google.com/books/content?id=PKWylwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PKWylwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780723272656', 'Based on the classic fairy tale. While the three bears are out for a walk, naughty little Goldilocks comes calling and tries out their porridge, chairs and beds to see which are just right. But then the three bears come home... Read it yourself with Ladybird is one of Ladybird\'s best-selling series. For over thirty-five years it has helped young children who are learning to read develop and improve their reading skills. Each Read it yourself book is very carefully written to include many key, high-frequency words that are vital for learning to read, as well as a limited number of story words that are introduced and practised throughout. Simple sentences and frequently repeated words help to build the confidence of beginner readers and the four different levels of books support children all the way from very first reading practice through to independent, fluent reading. Each book has been carefully checked by educational consultants and can be read independently at home or used in a guided reading session at school. Further content includes comprehension puzzles, helpful notes for parents, carers and teachers, and book band information for use in schools. Goldilocks and the Three Bears is a Level 1 Read it yourself title, suitable for very early readers who have had some initial reading instruction and are ready to take their first steps in reading real stories. Each story is told very simply, using a small number of frequently repeated words.', NULL, 392, 1, 2, 100.00, NULL, '2021-03-05 23:28:44', '2021-03-05 23:28:44'),
(82, 'Favourite Pets', 'Favourite-Pets', 'http://books.google.com/books/content?id=1QlJyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1QlJyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241237328', '\"Rabbits, gerbils, cats and dogs! Learn all about your favourite pets in this delightful non-fiction reader perfect for very early readers taking their first steps in reading.a For over thirty-five years, the best-selling Read it yourself with Ladybird has helped children learn to read. All stories feature essential key words. Story-specific words are repeated to practise throughout.a Designed to be read independently at home or used in a guided reading session at school. All titles include comprehension puzzles, guidance notes and book band information for schools. This Level 1 title is suitable for very early readers who are ready to take their first steps in reading real stories. Each simple story uses a small number of frequently repeated words. \"', NULL, 390, 1, 2, 100.00, NULL, '2021-03-05 23:28:44', '2021-03-05 23:28:44'),
(83, 'Rex the Big Dinosaur', 'Rex-the-Big-Dinosaur', 'http://books.google.com/books/content?id=uvxglwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uvxglwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780718194635', 'Rex the big dinosaur wants to play with the other little dinosaurs in the jungle, but they find him far too loud and scary! Is there any way that Rex can convince the little dinosaurs that he\'s a good friend to have around? Read it yourself with Ladybird is one of Ladybird\'s best-selling series. For over thirty-five years it has helped young children who are learning to read develop and improve their reading skills. Each Read it yourself book is very carefully written to include many key, high-frequency words that are vital for learning to read, as well as a limited number of story words that are introduced and practised throughout. Simple sentences and frequently repeated words help to build the confidence of beginner readers and the four different levels of books support children all the way from very first reading practice through to independent, fluent reading. The wide range of classic fairy tales, favourite characters and exciting modern stories in the Read it yourself series appeal to all children, whatever their interests, and have bright, detailed pictures to help support the text. Each book has been carefully checked by educational consultants and can be read independently at home or used in a guided reading session at school. Further content includes comprehension puzzles, helpful notes for parents, carers and teachers, and book band information for use in schools. Rex the Big Dinosaur is a Level 1 Read it yourself title, suitable for very early readers who have had some initial reading instruction and are ready to take their first steps in reading real stories. Each story is told very simply, using a small number of frequently repeated words.', NULL, 393, 1, 2, 100.00, NULL, '