(84, 'Jon\'s Football Team - Read it Yourself with Ladybird', 'Jon\'s-Football-Team---Read-it-Yourself-with-Ladybird', 'http://books.google.com/books/content?id=6MHarQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6MHarQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780723295174', 'Jon and his friends are big fans of famous footballer Ben Wills. Can they learn to play like him and win? For over thirty-five years, the best-selling Read it yourself with Ladybird has helped children learn to read. All titles feature essential key words. Title-specific words are repeated to practise throughout. Titles are designed to be read independently at home or used in a guided reading session at school. All titles include comprehension questions or puzzles, guidance notes and book band information for schools. This Level 1 title is suitable for very early readers who are ready to take their first steps in reading. A small number of frequently repeated words, simple facts, clearly labelled images and captions fully engage the reader. Includes contents, index and a picture glossary.', NULL, 390, 1, 2, 100.00, NULL, '2021-03-05 23:28:45', '2021-03-05 23:28:45'),
