(138, 'Meet the Farmers', 'Meet-the-Farmers', '', '', '9781338567779', '', NULL, 412, 1, 2, 100.00, NULL, '2021-03-05 23:29:09', '2021-03-05 23:29:09'),
(139, 'Who Lives Here?', 'Who-Lives-Here?', '', '', '9781338568004', '', NULL, 411, 1, 2, 100.00, NULL, '2021-03-05 23:29:09', '2021-03-05 23:29:09'),
