(146, 'Animals Phonics Set', 'Animals-Phonics-Set', 'http://books.google.com/books/content?id=eAzTtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=eAzTtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338261912', '', NULL, 415, 1, 2, 100.00, NULL, '2021-03-05 23:29:10', '2021-03-05 23:29:10');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(147, 'Apes Great Escape', 'Apes-Great-Escape', 'http://books.google.com/books/content?id=Gk7ntAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Gk7ntAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474922111', 'A fun story, specially written to develop phonemic awareness, with wonderful illustrations by David Semple. This book is ideal both for reading aloud and for children who are beginning to read for themselves. Helps young children learn to recognise the basic sounds that make up the English language - vital for learning to read. Part of a series of funny phonics readers that children will love. Guidance notes for parents are included at the back of the book.', NULL, 416, 1, 2, 100.00, NULL, '2021-03-05 23:29:10', '2021-03-05 23:29:10'),
(148, 'Kangaroo at the Zoo', 'Kangaroo-at-the-Zoo', 'http://books.google.com/books/content?id=PUNNjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PUNNjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409580447', 'This is a hilarious new addition to the \'Phonic Readers\' series. With simple rhyming text and phonic repetition specially designed to develop essential language and early reading skills. Guidance notes for parents are included at the back of the book.', NULL, 417, 1, 2, 100.00, NULL, '2021-03-05 23:29:10', '2021-03-05 23:29:10'),
(149, 'Lizard in a Blizzard', 'Lizard-in-a-Blizzard', 'http://books.google.com/books/content?id=3UAItgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3UAItgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474946582', 'A cloud is blocking the sun and Lizard is determined to move it... But lizards are not wizards whatever Lizard thinks. This fun rhyming story, specially written to develop phonemic awareness, has wonderful illustrations by David Semple. The book is ideal both for reading aloud and for children who are beginning to read for themselves. Helps young children learn to recognise the basic sounds that make up the English language - vital for learning to read. Part of a series of funny phonics readers that children will love. Guidance notes for parents are included at the back of the book.', NULL, 417, 1, 2, 100.00, NULL, '2021-03-05 23:29:11', '2021-03-05 23:29:11'),
(150, 'Flamingo Plays Bingo', 'Flamingo-Plays-Bingo', 'http://books.google.com/books/content?id=XYFDtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=XYFDtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474946575', 'Flamingo can\'t wait to join in the jungle bingo game. One, by one, she crosses off the numbers on her card - she needs just one more to win the surprise prize. But when a sneeze from Elephant sees the last ball go flying, the chase for the winning number is on... A fun addition to the popular Phonics Readers series, featuring \'on trend\' animal, the colourful flamingo. As well as the usual emphasis on language, this title also helps encourage number recognition. David Semple\'s fresh, modern illustrations are packed with hilarious detail that make reading fun.', NULL, 416, 1, 2, 100.00, NULL, '2021-03-05 23:29:11', '2021-03-05 23:29:11'),
(151, 'Phonics Readers: Raccoon on the Moon', 'Phonics-Readers:-Raccoon-on-the-Moon', 'http://books.google.com/books/content?id=w2nqrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=w2nqrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409580409', 'A lively story with humorous illustrations, ideal for children who are beginning to read for themselves, or for reading aloud together. With simple rhyming text and phonic repetition, specially designed to develop essential language and early reading skills. Guidance notes for parents are included at the back of the book. Helps young children learn to recognise the basic sounds that make up the English language âe\" vital for learning to read. Part of a series of funny phonics readers that children will love.', NULL, 416, 1, 2, 100.00, NULL, '2021-03-05 23:29:11', '2021-03-05 23:29:11'),
(152, 'Cow Takes a Bow', 'Cow-Takes-a-Bow', 'http://books.google.com/books/content?id=z8eXMQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=z8eXMQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409550518', 'Billedbog. When Brown Cow visits the circus, she puts on a surprise performance. She slips, trips, drops things and loses her hat - but the ringmaster is thrilled!', NULL, 416, 1, 2, 100.00, NULL, '2021-03-05 23:29:11', '2021-03-05 23:29:11'),
(153, 'Snail Brings the Mail', 'Snail-Brings-the-Mail', 'http://books.google.com/books/content?id=DL2-MQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DL2-MQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409550549', 'Billedbog. Reliable snail never fails to deliver the mail, but can he make it on time?', NULL, 416, 1, 2, 100.00, NULL, '2021-03-05 23:29:11', '2021-03-05 23:29:11'),
(154, 'Bee Makes Tea', 'Bee-Makes-Tea', 'http://books.google.com/books/content?id=Ij0FngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ij0FngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409550501', 'With simple rhyming text and phonic repetition, this book is specially designed to develop essential language and early reading skills.', NULL, 417, 1, 2, 100.00, NULL, '2021-03-05 23:29:12', '2021-03-05 23:29:12'),
