(164, 'Lift-the-Flap First Questions and Answers How Do I See?', 'Lift-the-Flap-First-Questions-and-Answers-How-Do-I-See?', 'http://books.google.com/books/content?id=0ndbDQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0ndbDQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474917926', 'A brilliant introduction to not only how we see but all the senses; how we see, hear, smell, taste and feel things, based on lots of of the sorts of questions raised by inquisitive young minds. The colourful illustrations, large and simple text and chunky flaps reveal the answers to questions, exploring not only vision but other senses such as smell and hearing.', NULL, 18, 1, 2, 100.00, NULL, '2021-03-05 23:29:15', '2021-03-05 23:29:15'),
(165, 'Garden Sounds', 'Garden-Sounds', 'http://books.google.com/books/content?id=tnyMjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tnyMjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409597698', 'A delightful and enjoyable sound book filled with gentle sounds of the garden. A great book to entertain young children, while allowing them to exploring the world around them. Illustrations: Full colour throughout', NULL, 1, 1, 3, 100.00, NULL, '2021-03-05 23:29:15', '2021-03-05 23:29:15'),
(166, 'First Encyclopedia of Seas and Oceans', 'First-Encyclopedia-of-Seas-and-Oceans', 'http://books.google.com/books/content?id=CDUicAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CDUicAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409525073', 'This enclyclopedia introduces young readers to the wonders of the sea. Filled with information on waves, currents, marine life and ocean exploration, this book answers such questions as \'How deep is the ocean?\' \'Which fish can blow itself up like a balloon?\' and \'How do dolphins use sound to hunt?\'', NULL, 2, 1, 3, 100.00, NULL, '2021-03-05 23:29:15', '2021-03-05 23:29:15'),
