(170, 'Go, Cub!', 'Go,-Cub!', 'http://books.google.com/books/content?id=cNuHswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cNuHswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008266554', 'National Geographic Primary Readers is a high-interest series of beginning reading books that have been developed in consultation with education experts. The books pair magnificent National Geographic photographs with lively text by skilled children\'s book authors across four reading levels. Level 1: Early readerThese books contain simple sentences and are just right for kids who can decode with ease and are beginning to read fluently. They are ideal for readers of Yellow and Blue banded books. Join the little lion cub on his day of adventures on the African savanna. Watch him run, jump, play, eat, and sleep, cuddle with Mum, and roll around with his brother and sister. Told in simple yet lively text, Go, Cub! will enchant kids who are just beginning their reading journey.', NULL, 6, 1, 3, 100.00, NULL, '2021-03-05 23:29:16', '2021-03-05 23:29:16'),
