(174, 'Sidekick Showdown!', 'Sidekick-Showdown!', 'http://books.google.com/books/content?id=3JRMjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3JRMjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338047424', 'When Harley Quinn(TM) and her friends capture Superman(TM), Batman(TM) and Wonder Woman(TM), it\'s up to their sidekicks to save the day! Robin(TM), Batgirl(TM), and Supergirl(TM) willl have to use teamwork and friendship to get the job done-but will it be enough?!', NULL, 11, 1, 3, 100.00, NULL, '2021-03-05 23:29:17', '2021-03-05 23:29:17'),
