(177, 'Lego Ninjago: The Rescue Mission (Reader #11)', 'Lego-Ninjago:-The-Rescue-Mission-(Reader-#11)', 'http://books.google.com/books/content?id=pZG_oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pZG_oAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545746397', 'Ninjago: Rebooted! The wisecracking ninja are back with all-new adventures. An all-new adventure based on the latest season of the hit LEGO Ninjago TV show!', NULL, 422, 1, 3, 100.00, NULL, '2021-03-05 23:29:17', '2021-03-05 23:29:17'),
