(179, 'Rise of the Snakes', 'Rise-of-the-Snakes', '', '', '9780545435925', 'Lord Gardamon\'s son, Lloyd, attempts to seize power in the land of Ninjago after his father\'s retreat, and although the ninjas do not take him seriously at first, Lloyd becomes a real threat when he awakens a race of snake-headed beasts.', NULL, 9, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(180, 'Secrets of Spinjitzu', 'Secrets-of-Spinjitzu', '', '', '9780545607988', 'Attack of the Nindroids: The Ninjago battle the evil ninja robots known as the Nindroids.', NULL, 9, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(181, 'Pop-Up Jungle', 'Pop-Up-Jungle', 'http://books.google.com/books/content?id=L6U8rgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=L6U8rgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409550310', 'Creep through the dense undergrowth of the jungle to discover a whole menagerie of exotic animals, just waiting to leap off the pages of this busy pop-up book. Illustrations are brought to life in a riot of colour and detail as you turn each page to see a 3-dimensional scene emerge.', NULL, 14, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(182, 'Nursery Rhymes Keyboard Book', 'Nursery-Rhymes-Keyboard-Book', 'http://books.google.com/books/content?id=9StExAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9StExAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474967570', 'This new title in our range of keyboard books has ten well-loved nursery rhymes for children to learn on the electronic keyboard in the book. Beautifully illustrated animal scenes bring each rhyme to life, and the words are given alongside the notes so you can sing along as you play. Part of a growing range of Usborne music books, including Famous Classical Tunes Keyboard Book, Big Keyboard Book and Drum Kit Book. A perfect way for little children to take their first steps towards learning the piano. Coloured dots for each note and step-by-step instructions make it very simple to follow.', NULL, 3, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(183, 'My First Xylophone Book', 'My-First-Xylophone-Book', 'http://books.google.com/books/content?id=g2mQtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=g2mQtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474932370', 'Young children can discover the magic of making music with the real xylophone attached to the front of this charming book. Using the high-quality xylophone and clear, simple instructions, they can learn to play a selection of well-known tunes, including Hey Diddle Diddle, Old MacDonald and Twinkle Twinkle Little Star. Delightful illustrations help to bring each tune to life. A perfect introduction to music-making for little children.', NULL, 3, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(184, 'Drumming for Beginners', 'Drumming-for-Beginners', 'http://books.google.com/books/content?id=tHwmtgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tHwmtgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474948531', 'With seven different drum buttons arranged in the shape of a drum kit, and several tunes to play along to, this fun book will provide hours of entertainment for budding drummers. Simple instructions help children to get the hang of it, and lively animal illustrations add to the fun. This is a perfect way to introduce children to the joys of making music. It builds on the success of First Drumming Book by adding more drums, different tunes, and new activities. An excellent and unusual gift.', NULL, 15, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(185, 'Twas the Night Before Christmas', 'Twas-the-Night-Before-Christmas', 'http://books.google.com/books/content?id=74vTtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=74vTtQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474952866', 'This classic Christmas poem is brought wonderfully to life with gorgeous artwork and stunning pops. Peek inside a cosy house, all ready for Chrstimas, marvel at Santa and his reindeer, flying across the sky and revel in the magic of Christmas. The latest in the Usborne pop-up series following on from the success of Usborne\'s Pop-Up Fairy Tales. A winning combination of classic Christmas poem and pop-up book, making it the perfect Chrstimas gift. Stunning pop-ups to bring the poem to life and an abbreivated version of the poem makes it accessible to young children.', NULL, 16, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(186, 'Snow White', 'Snow-White', 'http://books.google.com/books/content?id=Zbo8tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Zbo8tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474940955', 'See the classic fairy tale spring to life in this beautiful pop-up book. Scenes include the Wicked Queen and her mirror, the seven dwarfs emerging from their cottage, Snow White taking a bite of the apple and the prince\'s rescue. Ingenious pops combine movement with detailed scenes. A beautiful book to give and to treasure. This is the second title in an exciting new fairy tale pop-up series to complement the hugely successful peep-inside series. Each title is beautifully illustrated with lively accompanying text detailed pop ups to bring the stories to life.', NULL, 16, 1, 3, 100.00, NULL, '2021-03-05 23:29:18', '2021-03-05 23:29:18'),
(187, 'What\'s Happening to Me? (Boy)', 'What\'s-Happening-to-Me?-(Boy)', 'http://books.google.com/books/content?id=0h0SswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0h0SswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409599609', 'Library Friendly Edition of original- A sensitive, detailed and informative guide to male puberty, this book will prove invaluable for both young boys and their parents alike, tackling key subjects from the physical changes that occur at this time to the emotional upheaval this can cause.', NULL, 5, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(188, 'Artificial Intelligence', 'Artificial-Intelligence', 'http://books.google.com/books/content?id=XDbZjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=XDbZjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409598640', 'An exciting look into the fascinating world of artificial intelligence; what it is, how it\'s used in industry and war, how it will affect our future. Written in an engaging way with plenty of facts, comic strip sections, dramatic photographic illustrations this book is bound to grip the attention of even reluctant readers.', NULL, 17, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(189, 'Lift-the-Flap First Questions and Answers What Makes it Rain?', 'Lift-the-Flap-First-Questions-and-Answers-What-Makes-it-Rain?', 'http://books.google.com/books/content?id=gBnVsgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gBnVsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409598817', 'Flap book tackling some of the difficult questions small children ask.', NULL, 18, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(190, 'See Inside First World War', 'See-Inside-First-World-War', 'http://books.google.com/books/content?id=9cyRMQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9cyRMQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409531708', 'This is a fascinating flap book packed with essential information about the First World War, from the start of the conflict in 1914, to its resolution in 1918.', NULL, 19, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(191, 'The Complete Book of Riding and Pony Care', 'The-Complete-Book-of-Riding-and-Pony-Care', 'http://books.google.com/books/content?id=VUOStAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VUOStAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474948562', 'This informative guide to riding and pony care is suitable for all horse enthusiasts, from complete beginners to experienced riders. Filled with photographs, detailed illustrations and simple, informative text, this book provides an inspirational guide to the world of horse riding. Covers everything from the basics, such as how to clean a saddle, right up to what to do if a horse bolts, preparing for a country ride and facing the challenge of a three-day event. New edition of 9781409555490.', NULL, 20, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(192, 'Big Picture Atlas', 'Big-Picture-Atlas', 'http://books.google.com/books/content?id=mbOwjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mbOwjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409598701', 'A wonderfully big Picture Atlas for children to learn the basis of world geography. Lots of busy maps with fun illustrations to learn about the food and culture of other countries as well as capital cities. Putting pictures onto facts helps with memory and this big, satisfying book will help children memorize geography facts with ease.', NULL, 21, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(193, 'I Wonder why I Sleep and Other Questions about My Body', 'I-Wonder-why-I-Sleep-and-Other-Questions-about-My-Body', '', '', '9780753440742', 'Favorite questions such as, Why do I get hiccups? ; What makes me sneeze? ; What is sleepwalking? are answered in this lively look at the human body.', NULL, 22, 1, 3, 100.00, NULL, '2021-03-05 23:29:19', '2021-03-05 23:29:19'),
(194, 'Tadpoles and Frogs', 'Tadpoles-and-Frogs', 'http://books.google.com/books/content?id=9lFkAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9lFkAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746074558', 'How do tadpoles turn into frogs? What is the biggest frog in the world? How do frogs catch flies? In this book, youll find the answers and lots more about the wonderful world of frogs. Tadpoles and Frogs is part of an exciting series of books for children who are beginning to read on their own. The easy-to-read text has been specially written with the help of a reading expert.', NULL, 23, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(195, 'Rainforests', 'Rainforests', 'http://books.google.com/books/content?id=ExXeNQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ExXeNQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746090077', 'An illustrated presentation of the rainforest and its creatures and plants, and covers its products, such as soap, chocolate, bananas, and kawakawa, and the destruction of the lush habitat that results in extinction of animals such as the Bali tiger.', NULL, 24, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(196, 'Trees', 'Trees', 'http://books.google.com/books/content?id=5TvjPQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5TvjPQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746090220', 'Explore the wonderful world of trees from the deepest roots to the highest treetops. Find out how trees can make their own food and grow in unlikely places.', NULL, 25, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(197, 'Caterpillars and Butterflies', 'Caterpillars-and-Butterflies', 'http://books.google.com/books/content?id=BrAQAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BrAQAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746074473', 'Describes how a caterpillar develops into a butterfly, and discusses moths and the feeding habits and defenses of butterflies.', NULL, 26, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(198, 'Spiders', 'Spiders', 'http://books.google.com/books/content?id=_IpOAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_IpOAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746074794', 'What do spiders eat? How many eyes does a spider have? Which kind of spider lives underwater? In this book you\'ll find the answers and lots more about the fascinating world of spiders.', NULL, 27, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(199, 'Bugs', 'Bugs', 'http://books.google.com/books/content?id=TOpJPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TOpJPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746080375', 'Open this book and enter the amazing world of creepy-crawlies, from beautiful beetles to menacing mantids. Discover how bugs live, hunt and defend themselves; come face to face with the deadliest species, and find out why we cant live without bugs.', NULL, 28, 1, 3, 100.00, NULL, '2021-03-05 23:29:20', '2021-03-05 23:29:20'),
(200, 'Bees and Wasps', 'Bees-and-Wasps', 'http://books.google.com/books/content?id=zEmyNAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zEmyNAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409544876', '\"What do bees and wasps eat? What type of nests do they make? How do bees make honey? In this book you\';; find the answers and lots more about the fascinating lives of bees and wasps\"--Page 2 of cover.', NULL, 29, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(201, 'Ants', 'Ants', 'http://books.google.com/books/content?id=cmOCjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cmOCjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409581604', 'A simple introduction to the lives of ants, this colourful book describes where they live, what they eat, how they behave and how much weight they can carry. Children can dip into this informative book and learn lots of facts for school research or general interest.', NULL, 28, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(202, 'USBORNE BEGINNERS NATURE', 'USBORNE-BEGINNERS-NATURE', '', '', '9781474974028', '', NULL, 30, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(203, 'Bears', 'Bears', 'http://books.google.com/books/content?id=FFckuQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FFckuQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746080467', 'In this book you\'ll find the answers and learn lots more about the fascinating world of bears.Bears is part of an exciting series of books for children who are beginning to read on their own. The easy to read text has been specifically written with the help of a reading expert.Ages 4+', NULL, 31, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(204, 'Dangerous Animals', 'Dangerous-Animals', 'http://books.google.com/books/content?id=2KyYKAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2KyYKAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746088630', 'A fantastic brand new addition to the Beginners series, which is designed to provide an informative introduction to non-fiction subjects for young readers. Ages 4+', NULL, 27, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(205, 'Elephants', 'Elephants', 'http://books.google.com/books/content?id=LukBtwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LukBtwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409530497', 'This is a lively introduction to the fascinating world of elephants, complete with amazing photographs, step-by-step illustrations, and weird and wonderful facts.', NULL, 29, 1, 3, 100.00, NULL, '2021-03-05 23:29:21', '2021-03-05 23:29:21'),
(206, 'BEGINNERS FARM ANIMALS', 'BEGINNERS-FARM-ANIMALS', '', '', '9780746074763', 'From hens and chickens to crocodiles and geese, this book provides information about farm animals for children who are just beginning to read. With photographs and interesting and amusing facts such as did you know that one ostrich egg could make an omelette big enough to feed twelve people?', NULL, 32, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(207, 'Monkeys', 'Monkeys', 'http://books.google.com/books/content?id=7c7DbwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7c7DbwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409523079', 'Usborne Beginners are colourful information books for children beginning to read on their own. Vivid, full colour illustrations and photographs on every page, accompanied by short, informative text. Developed with reading experts at the University of Roehampton.', NULL, 28, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(208, 'Penguins', 'Penguins', 'http://books.google.com/books/content?id=wU5XPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wU5XPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746099667', 'Examines the physical characteristics, behavior, habitat, nutritional needs, and life cycle of penguins and lists websites where readers can find more information.', NULL, 21, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(209, 'Sharks', 'Sharks', 'http://books.google.com/books/content?id=thNwPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=thNwPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780746074756', '\'Usborne Beginners\' are information books for children beginning to read on their own. Full colour illustrations and photographs on every page, accompanied by short, informative text. Developed with reading experts at the University of Roehampton. Carefully selected Internet links to exciting websites to find out more.', NULL, 24, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(210, 'Tigers', 'Tigers', 'http://books.google.com/books/content?id=CMyipwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CMyipwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409530671', 'Simple text and photographs provide an introduction to tigers, covering physical characteristics, behaviors, diet, life cycle, and conservation.', NULL, 29, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(211, 'Wolves', 'Wolves', 'http://books.google.com/books/content?id=NCwkmgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NCwkmgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409530695', 'The association of wolves with superstition and folklore has led to an uneasy and fearful relationship between man and wolf. Here readers can find out the real facts about wolves and how they live.', NULL, 29, 1, 3, 100.00, NULL, '2021-03-05 23:29:22', '2021-03-05 23:29:22'),
(212, 'The Naughty Kitten', 'The-Naughty-Kitten', 'http://books.google.com/books/content?id=w33AvwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=w33AvwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788004657', 'Ruby Palace is no place for pets! But Princess Bea won\'t let royal rules stop her from helping animals in need... When Bea rescues a lost kitten, she promises to keep it safe until she can find its owner. But the adventurous kitten keeps getting into trouble! And when it goes exploring in the dark of night, Bea will need to be very brave... Look out for more of Princess Bea\'s adventures! The Lost Puppy The Lonely Pony The Snowy Rabbit.', NULL, 369, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(213, 'Princess of Pets', 'Princess-of-Pets', 'http://books.google.com/books/content?id=uyBFvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uyBFvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788004374', 'Animal-mad Princess Bea is ready to help any animal in need, no matter what the royal rules say!', NULL, 369, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(214, 'The Twits', 'The-Twits', '', '', '9780141371474', '', NULL, 370, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(215, 'The Witches', 'The-Witches', '', '', '9780141371481', '', NULL, 370, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(216, 'Danny, the Champion of the World', 'Danny,-the-Champion-of-the-World', 'http://books.google.com/books/content?id=qnOFAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=qnOFAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141371375', 'CLASSIC FICTION (CHILDREN\'S / TEENAGE). Phizz-whizzing new branding for the world\'s No.1 storyteller, Roald Dahl! Exciting, bold and instantly recognisable with Quentin Blake\'s inimitable artwork. Danny lives in a gipsy caravan with his father, the most marvellous and exciting father any boy ever had. All the land around them belongs to Mr Victor Hazell, a rich snob with a great glistening beery face and tiny piggy eyes. Nobody likes him, not one-little bit. So one day, Danny and his father concoct a daring plot that will give the old blue-faced baboon Victor Hazell the greatest shock of his life - so long as they don\'t get caught... Ages 9+', NULL, 370, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(217, 'George\'s Marvellous Medicine', 'George\'s-Marvellous-Medicine', '', '', '9780141371405', 'George decides that his grumpy, selfish old grandmother must be a witch and concocts some marvelous medicine to take care of her.', NULL, 370, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(218, 'Dork Diaries: Crush Catastrophe', 'Dork-Diaries:-Crush-Catastrophe', 'http://books.google.com/books/content?id=Riz2swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Riz2swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471167775', 'Nikki Maxwell\'s adventures continue in the twelfth instalment in the bestselling DORK DIARIES series! Now with over 45 million copies in print worldwide! Nikki Maxwell and her BFFs are all counting down to the end of the school year. Nikki thinks she has her summer all figured out, with lots of fun plans to hang out with her friends and her crush, Brandon. It\'s going to be perfect! Squeee! But then a new boy turns up at school and shows an interest in Nikki and things become confusing super-quickly! The last thing Nikki wants to do is hurt Brandon...What do you do when you accidentally crush your crush!?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:24', '2021-03-05 23:29:24'),
(219, 'Dork Diaries', 'Dork-Diaries', 'http://books.google.com/books/content?id=SGfXrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SGfXrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144028', 'Nikki is finally starting to adjust to life at her new school and things are looking up. She\'s made some real friends and her major crush, Brandon, even asks her to be his lab partner in science, Hello! Seriously awesome developments! But, when Nikki overhears mean girl Mackenzie bragging that Brandon\'s going to take her to the Halloween dance, a bummed Nikki agrees to spend Halloween at a kids\' party for her little sister Brianna. It\'s only after she makes the commitment that she finds out Mackenzie was lying and that her dream of going to the party with Brandon could be a reality. Now she\'s got two parties to juggle, what\'s a girl to do?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:25', '2021-03-05 23:29:25'),
(220, 'Dork Diaries 13: Birthday Drama!', 'Dork-Diaries-13:-Birthday-Drama!', 'http://books.google.com/books/content?id=spjetgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=spjetgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471172779', 'The thirteenth instalment in the bestselling DORK DIARIES series, now with over 45 million books in print worldwide! OMG! Nikki\'s birthday party is going to be beyond awesome! Her BFFs are planning a SUPERcool pool party, with a cake, a DJ, and the perfect invitations. Organizing a big party for one hundred people is easy, right? UMMM wrong! When Mom says it\'s too expensive, soon it\'s looking like Nikki\'s dream party will be a total dorky disaster - cringe! Can Nikki and her BFFs come up with a plan to save the day, or will there be major birthday drama?!', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:25', '2021-03-05 23:29:25'),
(221, 'Dork Diaries', 'Dork-Diaries-9781471144011', 'http://books.google.com/books/content?id=O-LirQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=O-LirQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144011', 'Nikki Maxwell is not popular, in fact Nikki Maxwell is the opposite of popular; she\'s a total dork! But Nikki\'s hoping that by moving to a new school she might just stand a chance of making some friends and leaving her old lame-ways in the past. But life is never that simple! Follow Nikki\'s life through sketches, doodles and diary entries as she starts her new school, battles with her mum for an iPhone and meets her arch-nemisis, the school\'s queen bee, Mackenzie. Enter Nikki\'s world through her sketches, doodles and daydreams. Perfect for fans of Diary of a Wimpy Kid, Tom Gates and Jacqueline Wilson.', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:25', '2021-03-05 23:29:25'),
(222, 'Dork Diaries', 'Dork-Diaries-9781471143830', 'http://books.google.com/books/content?id=L1jWrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=L1jWrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471143830', 'The Queen of the Dorks is back in a brand new instalment of the internationally bestselling series, now with 13 million copies in print worldwide! After a bump on the head, Nikki has a wild dream in which she, her BFF\'s Chloe and Zoey, her crush Brandon, and mean girl Mackenzie all end up playing the roles of some familiar classic fairy tale characters. Will Nikki\'s dream turn into a nightmare?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:25', '2021-03-05 23:29:25'),
(223, 'The Misadventures of Max Crumbly', 'The-Misadventures-of-Max-Crumbly', 'http://books.google.com/books/content?id=sncbjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sncbjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144622', 'A brand-new series from #1 bestselling Dork Diaries author Rachel Renee Russell! Introducing Max Crumbly, the new Dork on the block... Max is about to face the scariest place he\'s ever been - South Ridge Middle School! He has been home-schooled by his grandmother until now, and he\'s begged his parents to finally let him start attending a real school. He\'s starting to question that choice, though, with the Doug aka Thug Thurston Problem. As in, Thug keeps stuffing Max in his locker. If only Max could be like the hero in all the comics he likes to read - or the ones he draws - and magically escape the locker and defeat Thug. Unfortunately, Max\'s uncanny, almost superhuman ability to smell pizza from a block away won\'t exactly save any lives or foil bad guys. But that doesn\'t mean Max won\'t do his best to be the hero his school needs!', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:25', '2021-03-05 23:29:25'),
(224, 'Dork Diaries 10: Puppy Love', 'Dork-Diaries-10:-Puppy-Love', 'http://books.google.com/books/content?id=nIIajgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nIIajgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144585', '', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(225, 'Double Dork Diaries', 'Double-Dork-Diaries', 'http://books.google.com/books/content?id=jJedAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jJedAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471165870', 'From TV Star to the dorkiest princess around, life is anything but dull for Nikki Maxwell! This dork-tastic bind-up features TV STAR and ONCE UPON A DORK as Nikki goes from being the star of her own reality TV show to living out a fairy tale with some familiar faces... Leap into Nikki\'s world and let your inner dork shine through!', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26'),
(226, 'Double Dork Diaries 2', 'Double-Dork-Diaries-2', 'http://books.google.com/books/content?id=H9gnMgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=H9gnMgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471116735', 'A special bumper edition of dorkiness featuring books three and four in the bestselling DORK DIARIES series! It\'s time to embrace your inner dork! DORK DIARIES has millions of fans worldwide who all love the hilarious super-private diaries of the not-so-perfect Nikki Maxwell. Through sketches, doodles and diary entries Nikki spills the beans on everything from first crushes to BFF dramas, mean girls to bratty little sisters and, of course, all the mega-cringe moments that make her a dork-extraordinaire! In Pop Star Nikki\'s school is holding a talent competition and she can\'t wait to enter with her BFFs Chloe and Zoey, to have some fun and hopefully impress her super-crush Brandon too. But then Nikki finds out tht her arch-nemesis MacKenzie is entering the contest... Can a dork take on the most popular girl in school and win? In Skating Sensation Nikki tries to help her local animal shelter by raising money at an ice-skating fundraiser, the only problem? Nikki can\'t skate! Will she be able to transform from dork-on-ice to an ice-princess in time to save the shelter from closing for good?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26'),
(227, 'Skating Sensation', 'Skating-Sensation', 'http://books.google.com/books/content?id=1I0orgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1I0orgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144752', 'Enter the adorkable world of Nikki Maxwell as she tells all about her not-so-fabulous life in the international bestselling series Dork Diaries! Nikki Maxwell\'s tips for a perfect skate-a-thon: 1) Find a worthy cause to skate for (major points if Brandon loves it too!); 2) Have fun by teaming up with BFFs Chloe and Zoey; 3) Make sure you actually know how to skate... Can Nikki transform from a dork-on-ice to an ice-princess? Squeee! Get ready to embrace your inner dork in the fourth title of the phenomenally successful Dork Diaries series! Perfect for fans of Jeff Kinney, Liz Pichon and Jacqueline Wilson', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26'),
(228, 'Frenemies Forever', 'Frenemies-Forever', 'http://books.google.com/books/content?id=iNTZAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iNTZAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471158049', 'Nikki Maxwell, Queen of the Dorks, is back in the eleventh instalment of the NYT bestselling series! Nikki is spending a week at North Hampton Hills as part of the school transfer programme. The good news is that NHH is super-cool and preppy. The bad news is that Nikki\'s nemesis MacKenzie started there two weeks ago! But, faced with NHH queen bee Tiffany, who takes meanness to a whole new level, Nikki might need to work WITH Mackenzie if she\'s going to survive the week! Can Nikki and MacKenzie overcome their differences and become BFFs ... Best Frenemies Forever?! Praise for DORK DIARIES: \'Dork Diaries is so laugh-out-loud funny and original I stayed up late reading it, just to see what would happen next - and to get that next laugh!\' Kate Brian, author of the Private series \'Spot on for the tween market\' The Bookseller \'The Dork Diaries series is fast becoming my favourite for younger readers, and I really hope there are more dorky stories living in Rachel Renee Russell\'s head. I\'m sure Nikki has many more embarrassing moments just waiting to happen, as well as lots of gossip to share about her crush on Brandon. More please!\' Wondrous Reads Blog Perfect for fans of Wimpy Kid, Tom Gates, Jacqueline Wilson and James Patterson.​', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26'),
(229, 'Dork Diaries', 'Dork-Diaries-9781471143953', 'http://books.google.com/books/content?id=jhHqrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jhHqrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471143953', 'Nikki Maxwell, Queen of the Dorks, is back in the seventh book of the blockbuster Dork Diaries series - now with over 13 million copies in print! Nikki and her friends are about to have their five minutes of fame! A reality TV crew is going to follow them for the whole month as they record their hit song together. But will the excitement also cause unexpected problems, now that cameras are everywhere Nikki and her friends go? Is life in the spotlight really going to be all they think it is or will it be a Dork Disaster? Full of Nikki\'s doodles, diary entries and dorkish disasters, get ready to embrace your inner dork with his brand new novel frm the hit series! Perfect for fans of Diary of a Wimpy Kid, Tom Gates and Jacqueline Wilson.', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:26', '2021-03-05 23:29:26'),
(230, 'Double Dork Diaries #3', 'Double-Dork-Diaries-#3', 'http://books.google.com/books/content?id=7jn0oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7jn0oAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471122767', 'Two dork-alicous tales from the hilarious Nikki Maxwell in one brilliant bind-up! In DEAR DORK, Nikki is enlisted to write the school agony aunt coloumn. But when her own life is a disaster zone, how is she expcted to dish out good advice to the rest of the school? In HOLIDAY HEARTBREAK, everyone is excited about the biggest dance of the year and Nikki\'s hoping her crush, Brandon, wants to be her date. But time is running out. What if he doesn\'t want to go with her? Or worse - what if he ends up going with Mackenzie?!!', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:27', '2021-03-05 23:29:27'),
(231, 'Double Dork Diaries', 'Double-Dork-Diaries-9780857072184', 'http://books.google.com/books/content?id=_-8ckgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_-8ckgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857072184', 'Having just started a new school, Nikki Maxwell is determined to make a fresh start, by leaving her dorky past behind. By spilling spaghetti on herself during lunch, dressing as a giant rat for Halloween and having a dad who drives around in a van with a giant cockroach on top, it\'s hard to change from loser to queen-bee overnight.', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:27', '2021-03-05 23:29:27'),
(232, 'Double Dork #5', 'Double-Dork-#5', 'http://books.google.com/books/content?id=CkPLvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CkPLvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471182341', 'A special bumper edition of dorkiness featuring Drama Queen and Puppy Love from the bestselling DORK DIARIES series! From a missing-diary disaster (leading to a mean-girl takeover!) to a puppy problem of epic proportions, Nikki Maxwell\'s life if never dull and always dorky! Get ready to dive into Nikki\'s dork-tastic life with this fabulous two-in-one bind-up. It\'s time to embrace your inner dork!', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:27', '2021-03-05 23:29:27'),
(233, 'Big Box of Big Nate', 'Big-Box-of-Big-Nate', 'http://books.google.com/books/content?id=nUNDtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nUNDtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781449493264', 'What\'s better than a Big Nate book? How about FOUR Big Nate books in one box! Boxed set for Big Nate (Vol. 1-4)', NULL, 372, 1, 4, 100.00, NULL, '2021-03-05 23:29:27', '2021-03-05 23:29:27'),
(234, 'Dog man: For whom the ball rolls, from the creator of Captain Underpants (dog Man #7).', 'Dog-man:-For-whom-the-ball-rolls,-from-the-creator-of-Captain-Underpants-(dog-Man-#7).', '', '', '9781338236590', 'The Supa Buddies have been working hard to help Dog Man overcome his bad habits. But when his obsessions turn to fears, Dog Man finds himself the target of an all-new supervillain in his seventh adventure from the creator of Captain Underpants.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:29', '2021-03-05 23:29:29'),
(235, 'Dog Man: Grime and Punishment: From the Creator of Captain Underpants (Dog Man #9)', 'Dog-Man:-Grime-and-Punishment:-From-the-Creator-of-Captain-Underpants-(Dog-Man-#9)', 'http://books.google.com/books/content?id=Mgk-zAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Mgk-zAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338535624', 'The next great Dog Man adventure from the worldwide bestselling author and artist Dav Pilkey. You\'ll howl with laughter! The Supa Buddies bamboozled the baddies, but all\'s not right in the world. Dog Man has a new problem to pound, and he\'s going to need his entire pack to help him. Will he go barking up the wrong tree? Dav Pilkey\'s wildly popular Dog Man series appeals to readers of all ages and explores universally positive themes, including empathy, kindness, persistence, and the importance of doing good.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:29', '2021-03-05 23:29:29'),
(236, 'The Adventures of Ook and Gluk', 'The-Adventures-of-Ook-and-Gluk', '', '', '9780545175302', 'Friends Ook and Gluk are always getting into trouble with their village chief until they pass through a portal into a future run by the chief\'s descendant, where they learn kung fu so they can return to the past and free their people.', NULL, 373, 1, 4, 100.00, NULL, '2021-03-05 23:29:29', '2021-03-05 23:29:29'),
(237, 'The Adventures of Captain Underpants', 'The-Adventures-of-Captain-Underpants', 'http://books.google.com/books/content?id=k9yPc450wKsC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=k9yPc450wKsC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780590846288', 'Captain Underpants, the former school principal turned crime-fighting, wedgie-dodging superhero, uses his wacky talents to outwit the evil Dr. Diaper. By the author of the Dumb Bunnies series. Simultaneous.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:30', '2021-03-05 23:29:30'),
(238, 'Captain Underpants and the Wrath of the Wicked Wedgie Woman', 'Captain-Underpants-and-the-Wrath-of-the-Wicked-Wedgie-Woman', 'http://books.google.com/books/content?id=85sSHpix4_wC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=85sSHpix4_wC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439050005', 'When Harold and George turn fourth-grade teacher Ms. Ribble into an evil monster called the Wedgie Woman, she wreaks havoc on the world, giving the wedgie of doom to unsuspecting people who stand in her way--including principal-turned-superhero Captain Un', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:30', '2021-03-05 23:29:30'),
(239, 'Captain Underpants and the Invasion of the Incredibly Naughty Cafeteria Ladies from Outer Space ...', 'Captain-Underpants-and-the-Invasion-of-the-Incredibly-Naughty-Cafeteria-Ladies-from-Outer-Space-...', 'http://books.google.com/books/content?id=7GpQmKe58lwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7GpQmKe58lwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439049962', 'Only Captain Underpants can stop the three evil space aliens who have invaded Jerome Horwitz Elementary School and turned everyone into lunchroom zombie nerds.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:30', '2021-03-05 23:29:30'),
(240, 'Captain Underpants and the Perilous Plot of Professor Poopypants', 'Captain-Underpants-and-the-Perilous-Plot-of-Professor-Poopypants', 'http://books.google.com/books/content?id=I0IKxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=I0IKxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439049986', 'When Professor Pippy P. Poopypantsthe world\'s greatest scientific geniusdecides he\'s been made fun of long enough, he plans revenge, and it is up to Captain Underpants to save the world from this dirty villain! Simultaneous.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:30', '2021-03-05 23:29:30'),
(241, 'Captain Underpants and the Invasion of the Incredibly Naughty Cafeteria Ladies from Outer Space (and the Subsequent Assault of the Equally Evil Lunchroom Zombie Nerds)', 'Captain-Underpants-and-the-Invasion-of-the-Incredibly-Naughty-Cafeteria-Ladies-from-Outer-Space-(and-the-Subsequent-Assault-of-the-Equally-Evil-Lunchroom-Zombie-Nerds)', 'http://books.google.com/books/content?id=tW12wgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tW12wgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545694704', 'Only Captain Underpants can stop the three evil space aliens who have invaded Jerome Horwitz Elementary School and turned everyone into lunchroom zombie nerds.', NULL, 374, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(242, 'Captain Underpants and the Perilous Plot of Professor Poopypants', 'Captain-Underpants-and-the-Perilous-Plot-of-Professor-Poopypants-9780545871877', 'http://books.google.com/books/content?id=OMfNsgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OMfNsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545871877', 'New York Times bestselling author Dav Pilkey\'s Captain Underpants soars to greater heights with the breakthrough fourth book--now in full color! George and Harold are fourth-grade buddies with a penchant for practical jokes. When the boys\' latest prank drives their science teacher over the edge, their clueless principal, Mr. Krupp, quickly hires a replacement: Professor Pippy P. Poopypants. Of course, George and Harold can\'t resist making fun of the Professor\'s silly name. But then the Professor retaliates by forcing everyone in town to change their own names to be equally silly, with colossal consequences!', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(243, 'Captain Underpants and the Wrath of the Wicked Wedgie Woman', 'Captain-Underpants-and-the-Wrath-of-the-Wicked-Wedgie-Woman-9781338216233', '', '', '9781338216233', 'When Harold and George turn fourth-grade teacher Ms. Ribble into the evil Wedgie Woman, she gives the wedgie of doom to unsuspecting people who stand in her way--including principal-turned-superhero Captain Underpants.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(244, 'Captain Underpants and the Attack of the Talking Toilets', 'Captain-Underpants-and-the-Attack-of-the-Talking-Toilets', 'http://books.google.com/books/content?id=adpNnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=adpNnQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545599320', 'Principal Krupp once again turns into the superhero Captain Underpants in order to save the world, and Jerome Horwitz Elementary School, from the evil talking toilets and the Turbo Toilet 2000.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(245, 'The Invasion of the Potty Snatchers', 'The-Invasion-of-the-Potty-Snatchers', 'http://books.google.com/books/content?id=8gok5lxhu9IC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=8gok5lxhu9IC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9780545175326', 'In trouble with their principal because of their comic books, George and Harold decide to create a new epic novel.', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(246, 'Captain Underpants and the Revolting Revenge of the Radioactive Robo-Boxers: Color Edition (Captain Underpants #10)', 'Captain-Underpants-and-the-Revolting-Revenge-of-the-Radioactive-Robo-Boxers:-Color-Edition-(Captain-Underpants-#10)', 'http://books.google.com/books/content?id=cFkmyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cFkmyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338347234', 'When we last saw our heroes, George and Harold, they had been turned into evil zombie nerds doomed to roam a devastated, post-apocalyptic planet for all eternity. But why, you might ask, didn\'t the amazing Captain Underpants save the boys from this frightening fate? Because Tippy Tinkletrousers and his time-traveling hijinks prevented George and Harold from creating Captain Underpants in the first place! Now, having changed the course of human history forever, they\'ll have to figure out a way to CHANGE IT BACK!', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(247, 'The Horrifyingly Haunted Hack-A-Ween (the Epic Tales of Captain Underpants TV: Comic Reader)', 'The-Horrifyingly-Haunted-Hack-A-Ween-(the-Epic-Tales-of-Captain-Underpants-TV:-Comic-Reader)', 'http://books.google.com/books/content?id=ZvlAywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZvlAywEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338630213', 'Captain Underpants\'s spookiest - and stretchiest - adventure yet! George Beard and Harold Hutchins are back in a new Halloween adventure! Piqua\'s biggest pranksters are getting ready for the best holiday ever - Halloween, of course. But their dreams of costumes, candy, and haunted houses go down the drain when Mr. Krupp and Melvin start a campaign to make Halloween illegal! That\'s when George and Harold come up with HACK-A-WEEN, a totally legal spin-off of Halloween. But will disguises, hack-o\'-lanterns, and sneak or snacking fill the pumpkin-shaped holes in their lives? Find out in this young graphic novel based on the Hack-A-Ween episode of the hit Netflix show.', NULL, 454, 1, 4, 100.00, NULL, '2021-03-05 23:29:31', '2021-03-05 23:29:31'),
(248, 'Sink Or Swim', 'Sink-Or-Swim', 'http://books.google.com/books/content?id=oer-wAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oer-wAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545415705', 'Once again Abby and her brother Jonah go through the magic mirror in their basement, and this time they find themselves interfering in the Little Mermaid story--and needing to set things right and make sure everyone has a happy ending.', NULL, 375, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(249, 'Fairest of All', 'Fairest-of-All', 'http://books.google.com/books/content?id=yXOxMgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yXOxMgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545485715', 'After moving to a new house, ten-year-old Abby and her younger brother Jonah discover an antique mirror that transports them into the Snow White fairy tale.', NULL, 375, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(250, 'Beauty Queen', 'Beauty-Queen', 'http://books.google.com/books/content?id=PwxBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PwxBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545746571', 'Journey through the magic mirror and into the fairy tale of Beauty and the Beast -Now in paperback! Ever since the magic mirror erased his memory, my brother, Jonah, doesn\'t believe that we really visit different fairy tales. So it\'s a relief when the mirror sucks us into a story-and this time, it\'s \"Beauty and the Beast\"! Hoorah! Or, maybe not. When Jonah picks a rose from the Beast\'s garden, he messes up the story. The Beast is so angry he takes my brother prisoner...instead of Beauty! But if the Beast doesn\'t meet and fall in love with Beauty, then his curse will never be lifted and Jonah will be trapped in the palace forever! If I don\'t fix this mess in time, the situation could get pretty ugly...', NULL, 375, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(251, 'Genie in a Bottle (Whatever After #9)', 'Genie-in-a-Bottle-(Whatever-After-#9)', 'http://books.google.com/books/content?id=fnjcnAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fnjcnAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545851039', 'Be careful what you wish for... When my brother, Jonah, and I travel through our mirror into the story of Aladdin, we\'re excited. There will be magic lamps and genies granting wishes. Right? Wrong. The genie we meet isn\'t QUITE as helpful as we expected. And if Aladdin\'s wishes don\'t come true, he won\'t get to marry the princess and live happily ever after! Now we have to: - Escape an enchanted cave - Find forty buckets of jewels - Plan a parade - Learn to fly a magic carpet Otherwise we\'ll run out of wishes... and never get home!', NULL, 375, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(252, 'Aurora Plays the Part', 'Aurora-Plays-the-Part', '', '', '9781789055320', '', NULL, 376, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(253, 'Tiana\'s Best Surprise', 'Tiana\'s-Best-Surprise', '', '', '9781789055313', '', NULL, 376, 1, 4, 100.00, NULL, '2021-03-05 23:29:32', '2021-03-05 23:29:32'),
(254, 'Rosa and Crystal', 'Rosa-and-Crystal', 'http://books.google.com/books/content?id=9sI_vQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9sI_vQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788004350', 'Imagine a school where you meet your own unicorn and have amazing adventures together! That\'s what happens for the girls at Unicorn Academy on beautiful Unicorn Island. Rosa is over the moon to be starting school at Unicorn Academy. She can\'t wait to go on a big adventure with her amazing unicorn, Crystal. When the magical map stops working, Rosa is sure a secret trip to the glittering cavern holds the answer. But to find out, she and Crystal must learn how to work as a team - fast!', NULL, 378, 1, 4, 100.00, NULL, '2021-03-05 23:29:33', '2021-03-05 23:29:33'),
(255, 'Olivia and Snowflake', 'Olivia-and-Snowflake', 'http://books.google.com/books/content?id=NALbswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NALbswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788001687', '', NULL, 378, 1, 4, 100.00, NULL, '2021-03-05 23:29:33', '2021-03-05 23:29:33'),
