(259, 'Spooky Poems', 'Spooky-Poems', 'http://books.google.com/books/content?id=2K2VCwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2K2VCwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447272588', 'Spooky Poems is a collection of scary poems about ghosts, ghouls, bats, witches, vampires and all things creepy - by bestselling children\'s poets Brian Moses and James Carter. Spooky Poems is a collection of scary poems about ghosts, ghouls, bats, witches, vampires and all things creepy - by bestselling children\'s poets Brian Moses and James Carter.', NULL, 456, 1, 4, 100.00, NULL, '2021-03-05 23:29:34', '2021-03-05 23:29:34'),
(260, 'Greetings, Earthlings!', 'Greetings,-Earthlings!', 'http://books.google.com/books/content?id=cJTqhlOlSvoC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cJTqhlOlSvoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330471749', 'TAKE ME TO YOUR LEADER!I, the moon, would like it known - I never follow people home. I simply do not have the time. And neither do I ever shine. For what you often see at night is me reflecting solar light. And I\'m not cheese! No, none of these: no mozzarellas, cheddars, bries, all you\'ll find here - if you please - are my dusty, empty seas. And cows do not jump over me. Now that is simply lunacy! You used to come and visit me. Oh do return, I\'m lonely, see. James Carter', NULL, 457, 1, 4, 100.00, NULL, '2021-03-05 23:29:34', '2021-03-05 23:29:34'),
(261, 'A Cat Called Elvis', 'A-Cat-Called-Elvis', 'http://books.google.com/books/content?id=hvzDA8yLv98C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hvzDA8yLv98C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780230751972', 'Poetry.', NULL, 457, 1, 4, 100.00, NULL, '2021-03-05 23:29:35', '2021-03-05 23:29:35'),
