(263, 'Pants on Fire', 'Pants-on-Fire', 'http://books.google.com/books/content?id=JPb2HAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=JPb2HAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330417983', 'A fantastic new collection from our best-selling poet. Paul\'s new collection contains a wonderful range of poetry - mostly very funny but there are thoughtful pieces too. He plays beautifully with language and has included a number of different poetic forms.', NULL, 459, 1, 4, 100.00, NULL, '2021-03-05 23:29:35', '2021-03-05 23:29:35'),
