(268, 'The Crystal Rose', 'The-Crystal-Rose', 'http://books.google.com/books/content?id=8XY_ugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8XY_ugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788000154', 'The evil Shadow Witch wants to steal the Everchanging Lights right out of the sky! The Snow Sisters will need all their magic to stop her turning their world dark for ever ... In their first adventure, the girls sneak away from their castle for a night-time quest through the frozen forest. Can they find the pink Everchanging Light before the Shadow Witch snatches it for herself? Beautifully illustrated throughout by Monique Dong, this sparkly fantasy series will have young readers hooked until the final page. Look out for the Snow Sisters\' next adventures ... The Crystal Rose The Frozen Rainbow The Enchanted Waterfall.', NULL, 460, 1, 4, 100.00, NULL, '2021-03-05 23:29:36', '2021-03-05 23:29:36'),
(269, 'The Frozen Rainbow', 'The-Frozen-Rainbow', 'http://books.google.com/books/content?id=QB3MuwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QB3MuwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788000178', 'The Snow Sisters\' magic is growing stronger, but every day the evil Shadow Witch grows stronger too. It\'s a race against time to find the magic of the Everchanging Lights... In their third adventure, the girls rush to the mysterious Rainbow Pools. But the Shadow Witch is one step ahead of them! Faced with bubbling lava, can the girls reach the purple Everchanging Light before it\'s too late? Beautifully illustrated throughout by Monique Dong, this sparkly fantasy series will have young readers hooked until the final page. Have you read \'The Silver Secret\' and \'The Crystal Rose\'? Look out for the Snow Sisters\' next adventure, \'The Enchanted Waterfall\'!', NULL, 460, 1, 4, 100.00, NULL, '2021-03-05 23:29:36', '2021-03-05 23:29:36'),
