(274, 'Romeo and Juliet', 'Romeo-and-Juliet', 'http://books.google.com/books/content?id=XPqWPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=XPqWPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781841213361', 'But soft, what light through yonder window breaks? It is the east, and Juliet is the sun... A beautiful retelling of Shakespeare\'s most famous love story. With Notes on Shakespeare and the Globe Theatre and Love and Hate in Romeo and Juliet.', NULL, 461, 1, 4, 100.00, NULL, '2021-03-05 23:29:37', '2021-03-05 23:29:37'),
