(276, 'Much Ado About Nothing', 'Much-Ado-About-Nothing', 'http://books.google.com/books/content?id=QcYZAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QcYZAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781846161834', 'A lively retelling of Shakespeare\'s famous work about the foolish ways people behave when they\'re in love. With Notes on Shakespeare and the Globe Theatre and Love and Lies in Much Ado About Nothing.', NULL, 461, 1, 4, 100.00, NULL, '2021-03-05 23:29:37', '2021-03-05 23:29:37'),
(277, 'Othello', 'Othello', 'http://books.google.com/books/content?id=gmygPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gmygPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781846161841', 'I will wear my heart upon my sleeve for daws to peck at... A great retelling of this tragic tale of jealousy and human frailty. With Notes on Shakespeare and the Globe Theatre, and Jealousy in Othello.', NULL, 461, 1, 4, 100.00, NULL, '2021-03-05 23:29:37', '2021-03-05 23:29:37'),
