(280, 'The Taming of the Shrew', 'The-Taming-of-the-Shrew', 'http://books.google.com/books/content?id=wmaEwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wmaEwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408305058', 'An adaptation for young readers of Shakespeare\'s play in which a gentleman from Verona tries to tame the fiery older sister Katharina with his outrageous behaviour.', NULL, 461, 1, 4, 100.00, NULL, '2021-03-05 23:29:37', '2021-03-05 23:29:37'),
(281, 'More of Milly-Molly-Mandy', 'More-of-Milly-Molly-Mandy', 'http://books.google.com/books/content?id=E188vAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=E188vAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529010695', 'Milly-Molly-Mandy lives in a tiny village in the heart of the countryside, where life is full of everyday adventures! Join the little girl in the candy-striped dress as she goes to a concert, has a picnic and goes to the seaside - whatever Milly-Molly-Mandy and her friends are up to, you\'re sure to have fun when they\'re around.More of Milly-Molly-Mandy contains thirteen short stories that are wonderful to read aloud and are the perfect way to introduce younger readers to the enduringly popular heroine, not forgetting her friends little-friend-Susan and Billy Blunt!This second book in Joyce Lankester Brisley\'s Milly-Molly-Mandy series, which have charmed generations of children since their first publication in 1928, brings the characters to life with the author\'s original line drawings.', NULL, 462, 1, 4, 100.00, NULL, '2021-03-05 23:29:38', '2021-03-05 23:29:38'),
