(283, 'Milly-Molly-Mandy Again', 'Milly-Molly-Mandy-Again', 'http://books.google.com/books/content?id=WkJQvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=WkJQvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529010664', 'Milly-Molly-Mandy lives in a tiny village in the heart of the countryside, where life is full of everyday adventures! Join the little girl in the candy-striped dress as she celebrates the blacksmith\'s wedding, finds a train and goes sledging - whatever Milly-Molly-Mandy and her friends are up to, you\'re sure to have fun when they\'re around. Milly-Molly-Mandy Again contains seven short stories that are wonderful to read aloud and are the perfect way to introduce younger readers to the enduringly popular heroine, not forgetting her friends little-friend-Susan and Billy Blunt! This fourth book in Joyce Lankester Brisley\'s Milly-Molly-Mandy series, which have charmed generations of children since their first publication in 1928, brings the characters to life with the author\'s original line drawings.', NULL, 462, 1, 4, 100.00, NULL, '2021-03-05 23:29:38', '2021-03-05 23:29:38'),
