(287, 'Jade and the Enchanted Wood', 'Jade-and-the-Enchanted-Wood', 'http://books.google.com/books/content?id=4Jc-CK_0uZ8C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4Jc-CK_0uZ8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007348756', 'A mysterious package arrives for Jade, and it\'s a pair of red ballet shoes. Jade\'s curious, so she heads to Madame Za-Za\'s ballet school—and is suddenly whisked away to the magical world of Enchantia! King Rat wants to build a fun fair in the Enchanted Wood and throw out all the people who live there. Can Jade protect them from his evil plans?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:39', '2021-03-05 23:29:39'),
(288, 'Holly and the Land of Sweets', 'Holly-and-the-Land-of-Sweets', 'http://books.google.com/books/content?id=f07Yg4ox5TIC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=f07Yg4ox5TIC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323241', '\"It\'s carnival time in Enchantia! But when Holly and the White Cat go to the Land of Sweets they find that everything is topsy-turvy! Can they put things right before the Lollipop Carnival begins?\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:39', '2021-03-05 23:29:39'),
(289, 'Holly and the Ice Palace', 'Holly-and-the-Ice-Palace', 'http://books.google.com/books/content?id=ALThYSnIp94C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ALThYSnIp94C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323234', '\"A frosty chill hangs over Enchantia because King Rat has turned his castle into an ice palace! Can Holly and th White Cat unfreeze his spells or will summer be banished forever?\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:39', '2021-03-05 23:29:39'),
(290, 'Holly and the Rose Garden', 'Holly-and-the-Rose-Garden', 'http://books.google.com/books/content?id=eF0CVUoR8_YC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=eF0CVUoR8_YC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323227', '\"Holly is in the middle of a ballet class when she is whisked away to Enchantia. She lands in a beautiful garden where a man is picking a white rose. The story of Beauty and the Beast is being played out before her eyes! But something seems to be going horribly wrong...\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:39', '2021-03-05 23:29:39'),
(291, 'Holly and the Magic Tiara', 'Holly-and-the-Magic-Tiara', 'http://books.google.com/books/content?id=YaxE4nORA74C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YaxE4nORA74C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323210', '\"Holly arrives in Enchantia just in time for the christening of Cinderella\'s baby. But one of the gifts isn\'t all that it seems. The Royal Family are so busy looking out for a cursed spinning wheel, that they haven\'t seen the danger right in front of them...\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:39', '2021-03-05 23:29:39'),
(292, 'Holly and the Silver Unicorn', 'Holly-and-the-Silver-Unicorn', 'http://books.google.com/books/content?id=rR3zADTC_5gC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rR3zADTC_5gC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323203', '\"In Enchantia, Holly discovers a carousel of magic creatures trapped on the ride by the Wicked Fairy. There\'s just one more she wants to capture. Can Holly and the White Cat warn the Silver Unicorn, before it\'s too late?\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:40', '2021-03-05 23:29:40'),
(293, 'Holly and the Dancing Cat', 'Holly-and-the-Dancing-Cat', 'http://books.google.com/books/content?id=tKnl2hD93BUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tKnl2hD93BUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007323197', '\"Holly is given a pair of red ballet shoes that whisk her away to the magical world of Enchantia. She meets the beautiful White Cat, but only realises how special her new friend is when he goes missing...\"--Cover.', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:40', '2021-03-05 23:29:40'),
(294, 'Rosa and the Three Wishes', 'Rosa-and-the-Three-Wishes', 'http://books.google.com/books/content?id=txcoNF4buh8C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=txcoNF4buh8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300341', 'Rosa knows that it is time to hand over the magic red ballet shoes to another special girl—but before she does; her friends in Enchantia need Rosa\'s help one last time!', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:40', '2021-03-05 23:29:40');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(295, 'Rosa and the Magic Dream', 'Rosa-and-the-Magic-Dream', 'http://books.google.com/books/content?id=AqgcGpO9IFwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=AqgcGpO9IFwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300334', 'The Wicked Fairy has always wanted to rule Enchantia and has come up with an evil plan to take over, by casting a spell on Rosa and holding her captive! Can Rosa escape from her castle, or will the Wicked Fairy get her wish?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:41', '2021-03-05 23:29:41'),
(296, 'Rosa and the Special Prize', 'Rosa-and-the-Special-Prize', 'http://books.google.com/books/content?id=-g3LJhGqzxYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-g3LJhGqzxYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300327', 'King Neptune, ruler of the underwater kingdom, has accused King Tristan of taking his special scepter and as a punishment he\'s cast a storm spell over Enchantia! Can Rosa and Nutmeg find out who really has the scepter, or will Enchantia be gloomy forever?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:41', '2021-03-05 23:29:41'),
(297, 'Rosa and the Magic Moonstone', 'Rosa-and-the-Magic-Moonstone', 'http://books.google.com/books/content?id=kQuOR5y-NH4C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kQuOR5y-NH4C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300310', 'Rosa is confident about passing her first ballet exam, but right in the middle of her test she is whisked away to Enchantia. The King\'s magic moonstone has broken and all of the ballets are muddled up! Will Rosa be able to put things right?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:41', '2021-03-05 23:29:41'),
(298, 'Rosa and the Golden Bird', 'Rosa-and-the-Golden-Bird', 'http://books.google.com/books/content?id=J1e4gQarnEMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=J1e4gQarnEMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300303', 'The Wicked Fairy has captured the magical Firebird and now all the music has disappeared from Enchantia! Can Rosa free the Firebird and help her friends to dance again?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:41', '2021-03-05 23:29:41'),
(299, 'Rosa and the Secret Princess', 'Rosa-and-the-Secret-Princess', 'http://books.google.com/books/content?id=IiLqaJNLJ3QC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IiLqaJNLJ3QC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007300297', 'Rosa knows that her new red ballet shoes are special, but she soon discovers that they are magical when she is whirled away to Enchantia! On her very first adventure, can Rosa free the swan princess from King Rat\'s curse?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:41', '2021-03-05 23:29:41'),
(300, 'Delphie and the Birthday Show', 'Delphie-and-the-Birthday-Show', 'http://books.google.com/books/content?id=hvjP5M_Z9x4C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hvjP5M_Z9x4C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286126', 'Delphie has been asked to perform in the Queen of Enchantia\'s special birthday show! She\'s really excited and just can\'t wait to take part, so why then are her magic red shoes suddenly so tight?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:42', '2021-03-05 23:29:42'),
(301, 'Delphie and the Fairy Godmother', 'Delphie-and-the-Fairy-Godmother', 'http://books.google.com/books/content?id=ZpLkQmenOIYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZpLkQmenOIYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286119', 'Delphie has always wondered what it would be like to have your own fairy godmother, and when she is whirled away to Enchantia, she discovers just how special it can be...', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:42', '2021-03-05 23:29:42'),
(302, 'Delphie and the Glass Slippers', 'Delphie-and-the-Glass-Slippers', 'http://books.google.com/books/content?id=AHEphm9P6bwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=AHEphm9P6bwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286171', 'Prima Ballerina Darcey Bussell takes you on a captivating journey to a faraway land of ballet and magic, the wonderful world of Enchantia! The fourth of sparkly new series for all young girls who dream of being a ballerina, or simply love to dance! King Rat is causing havoc in Enchantia again, by playing around with the Big Clock and making time whizz by. Cinderella finds herself always going to the ball, but never meeting her Prince! Can Delphie help?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:42', '2021-03-05 23:29:42'),
(303, 'Delphie and the Magic Spell', 'Delphie-and-the-Magic-Spell', 'http://books.google.com/books/content?id=R6_QJ7EEfXkC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=R6_QJ7EEfXkC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286089', 'Delphie is preparing for the end of term ballet show but before she can even take part, her help is needed in Enchantia. Does Delphie hold the key to break the magic spell and unlock the secrets of the magical world?', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:43', '2021-03-05 23:29:43'),
(304, 'Delphie and the Magic Ballet Shoes', 'Delphie-and-the-Magic-Ballet-Shoes', 'http://books.google.com/books/content?id=2l11fTfYKgUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2l11fTfYKgUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286072', 'Delphie\'s greatest dream is to become a ballerina, and she can\'t quite believe it when she is invited to join the new ballet school. But there\'s more to Madame Zarakova\'s than it at first seems and with the help of some very special ballet shoes, Delphie finds herself spinning into a whole new world...', NULL, 463, 1, 4, 100.00, NULL, '2021-03-05 23:29:43', '2021-03-05 23:29:43'),
(305, 'Dog Man: Lord of the Fleas: from the Creator of Captain Underpants (Dog Man #5)', 'Dog-Man:-Lord-of-the-Fleas:-from-the-Creator-of-Captain-Underpants-(Dog-Man-#5)', 'http://books.google.com/books/content?id=OlKttAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OlKttAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545935173', 'Howl with laughter with Dog Man, the #1 New York Times bestselling series from Dav Pilkey!', NULL, 345, 1, 4, 100.00, NULL, '2021-03-05 23:29:43', '2021-03-05 23:29:43'),
(306, 'The Epic Tales of Captain Underpants', 'The-Epic-Tales-of-Captain-Underpants', 'http://books.google.com/books/content?id=5gYZwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5gYZwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338262469', '\"More than 20 comics from the epic Netflix show\"--Back cover.', NULL, 454, 1, 4, 100.00, NULL, '2021-03-05 23:29:45', '2021-03-05 23:29:45'),
(307, 'The World\'s Worst Children 3', 'The-World\'s-Worst-Children-3', 'http://books.google.com/books/content?id=fReHtgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fReHtgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008304607', 'From the phenomenal number-one bestseller David Walliams comes another collection of more hilariously horrible children! Illustrated in glorious and gruesome colour by artist genius, Tony Ross, these stories will appal and delight young readers. Just when you thought it was safe to go back to your bookshelf, 10 more horrendously hilarious stories about the absolute worst children ever! From ten-year old Hank and his endless pranks on his poor, long-suffering family, to Tandy and her titanic tantrums - this brand new collection is the perfect companion to World\'s Worst Children books 1 and 2 and an ideal gift for the worst children in your life! This compendium of catastrophically horrid boys and girls is brought to you by the phenomenal number-one bestseller David Walliams, and every story is illustrated in glorious and gruesome colour by the artistic genius Tony Ross. 2018 marks the 10th anniversary of the publication of David Walliams\' first novel, The Boy in the Dress.', NULL, 464, 1, 4, 100.00, NULL, '2021-03-05 23:29:45', '2021-03-05 23:29:45'),
(308, 'The World\'s Worst Children 2', 'The-World\'s-Worst-Children-2', 'http://books.google.com/books/content?id=YbJhswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YbJhswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008259679', 'The brilliant follow-up to David Walliams\' bestseller The World\'s Worst Children! Ten more stories about a brand new gang of hilariously horrible kids from everyone\'s favourite children\'s author, illustrated in glorious full colour by Tony Ross. If you thought you had read about the World\'s Worst Children already, you\'re in for a rather nasty shock. The beastly boys and gruesome girls in this book are even ruder, even more disgusting and WORSE than you could ever imagine! This gorgeous collection of ten stories from the master himself, David Walliams, will make you snort with laughter and thank your lucky stars that you don\'t know anyone like Gruesome Griselda or Fussy Frankie in real life. It also features a special appearance from fan-favourite Raj! Gloriously illustrated in full colour throughout by artistic genius Tony Ross, The World\'s Worst Children 2 is a side-splitting companion to David\'s blockbuster hit, The World\'s Worst Children, and the perfect gift for kids aged 9 and up.', NULL, 464, 1, 4, 100.00, NULL, '2021-03-05 23:29:45', '2021-03-05 23:29:45'),
(309, 'Saskia the Salsa Fairy', 'Saskia-the-Salsa-Fairy', '', '', '9781408358917', 'Jack Frost has taken the Dance Fairies\' magic ribbons, Rachel and Kirsty have to get them back, so Serena can salsa.', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:45', '2021-03-05 23:29:45'),
(310, 'Imogen the Ice Dance Fairy', 'Imogen-the-Ice-Dance-Fairy', '', '', '9781408358924', '', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(311, 'Darcey the Dance Diva Fairy', 'Darcey-the-Dance-Diva-Fairy', '', '', '9781408359006', '\"Strange things are afoot at the Funky Feet Dance studio - everybody has forgotten their dance moves! Can Rachel and Kirsty outsmart the naughty goblins, and return Darcey\'s magic star to her?\"--Cover.', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(312, 'Amelia the Singing Fairy', 'Amelia-the-Singing-Fairy', '', '', '9781408359013', 'Rachel and Kirsty must find Amelia\'s magic star. Without it, nobody can sing in tune and the auditions for the variety show will be a disaster! Could the green-footed band Thrillz and Chillz have something to do with the missing star?--P. 4 of cover.', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(313, 'Isla the Ice Star Fairy', 'Isla-the-Ice-Star-Fairy', '', '', '9781408356760', '\"The naughty goblins are going to use Isla\'s magic star to reach the finals of the Tippington Variety Show! Rachel and Kirsty must go to Jack Frost\'s scary Ice Castle and find the star so that the goblins can\'t cheat any more...\"--P. [4] of cover.', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(314, 'Taylor the Talent Show Fairy', 'Taylor-the-Talent-Show-Fairy', '', '', '9781408359020', 'It\'s time for the Tippington Variety Show! Rachel and Kirsty have helped the Showtime Fairies find six magic stars, but one is still missing. Can they find it before mean Jack Frost and his goblins ruin the show?', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(315, 'Grace the Glitter Fairy', 'Grace-the-Glitter-Fairy', '', '', '9781408348673', '', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(316, 'Honey the Sweet Fairy', 'Honey-the-Sweet-Fairy', '', '', '9781408348680', '', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:46', '2021-03-05 23:29:46'),
(317, 'Madeline the Cookie Fairy', 'Madeline-the-Cookie-Fairy', '', '', '9781408359174', 'Sugar and Spice make everything nice! The Sugar and Spice Fairies\' magic protects sweet treats in both Fairyland and the human world. When mean Jack Frost steals the fairies\' delicious magical items, dessert everywhere takes a sour turn. When Madeline the Cookie Fairy\'s charm goes missing, cookies everywhere start to crumble. Will Rachel and Kirsty find Madeline\'s magic?', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:47', '2021-03-05 23:29:47'),
(318, 'Francesca the Football Fairy', 'Francesca-the-Football-Fairy', '', '', '9781408353226', 'Everyone in Fairyland is preparing for the Fairy Olympics, but Jack Frost and his goblins have stolen the magic sporty items so they can win by cheating! Francesca needs the girls\' help to get her Magic Football back.', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:48', '2021-03-05 23:29:48'),
(319, 'Naomi the Netball Fairy', 'Naomi-the-Netball-Fairy', '', '', '9781408353240', '', NULL, 465, 1, 4, 100.00, NULL, '2021-03-05 23:29:48', '2021-03-05 23:29:48'),
(320, 'Dork Diaries', 'Dork-Diaries-9781471144035', 'http://books.google.com/books/content?id=CbfUrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CbfUrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144035', 'Let the spotlight showdown commence... Nikki Maxwell\'s school is holding a talent competition and Nikki can\'t wait to start practising dance moves with her BFFs, Chloe and Zoey, and impressing Brandon, her crush, with her singing skills! But then Nikki finds out that her arch-nemesis, MacKenzie, is entering the contest too, and she\'s determined to steal the limelight from Nikki and her friends. Can a dork like Nikki take on the most popular girl in school and win?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:48', '2021-03-05 23:29:48'),
(321, 'Dear Dork', 'Dear-Dork', 'http://books.google.com/books/content?id=33YtrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=33YtrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144769', 'More diary entries and doodles from Nikki\'s not-so-fabulous life, in the fifth instalment of the phenomenally successful Dork Diaries series.', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:48', '2021-03-05 23:29:48'),
(322, 'Dork Diaries', 'Dork-Diaries-9781471122514', 'http://books.google.com/books/content?id=eRFvrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=eRFvrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471122514', 'Nikki Maxwell\'s love life is looking up. Her crush, Brandon, has asked her on an almost-date! Nikki wants to ask Brandon to the upcoming school dance, but he\'s suddenly acting as if he doesn\'t like her after all. Will Nikki be able to to pluck up the courage to ask him anyway?', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:48', '2021-03-05 23:29:48'),
(323, 'Holiday Heartbreak', 'Holiday-Heartbreak', 'http://books.google.com/books/content?id=ATzzrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ATzzrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471144776', 'More diary entries and doodles from Nikki\'s not-so-fabulous life...', NULL, 371, 1, 4, 100.00, NULL, '2021-03-05 23:29:49', '2021-03-05 23:29:49'),
(324, 'William Tell and the Apple for Freedom', 'William-Tell-and-the-Apple-for-Freedom', 'http://books.google.com/books/content?id=heO0GwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=heO0GwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781843624769', 'William Tell is the best shot in Switzerland. One day, the local governor demands that he prove his skill with a crossbow or be punished. William must hit an apple at a hundred paces...and the apple will be resting on his young son\'s head!', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:49', '2021-03-05 23:29:49'),
(325, 'Robinson Crusoe, Shipwrecked!', 'Robinson-Crusoe,-Shipwrecked!', 'http://books.google.com/books/content?id=P20bcAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=P20bcAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408305720', 'Young Robinson Crusoe has the chance to leave behind his boring life by joining a trading ship in the Caribbean. But when he is shipwrecked and left stranded alone on an island, how will he survive?', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:49', '2021-03-05 23:29:49'),
(326, 'Authors and Stories', 'Authors-and-Stories', '', '', '9781843624745', '', NULL, 467, 1, 4, 100.00, NULL, '2021-03-05 23:29:50', '2021-03-05 23:29:50'),
(327, 'Gulliver in Lilliput', 'Gulliver-in-Lilliput', 'http://books.google.com/books/content?id=elZ2cgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=elZ2cgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408305768', 'One of the best-known classic travel adventures Gulliver loves to travel. But when he is swept overboard from a ship, and finds himself tied up in a land populated by tiny people, he realizes some adventures aren\'t quite as much fun as they should be. Can Gulliver escape the clutches of the tiny Lilliputians?', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:50', '2021-03-05 23:29:50'),
(328, 'Beowulf', 'Beowulf', 'http://books.google.com/books/content?id=VOUicAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VOUicAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408305744', 'A retelling of the exploits of the Anglo-Saxon warrior, Beowulf, and how he came to defeat the monster Grendel and Grendel\'s mother. Suggested level: primary.', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:50', '2021-03-05 23:29:50'),
(329, 'Arthur and the King\'s Sword', 'Arthur-and-the-King\'s-Sword', 'http://books.google.com/books/content?id=NI_SHAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NI_SHAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781843624752', 'Arthur is only a squire, but he longs to be a knight like his older brother, Kay. When Kay\'s sword goes missing, Arthur must get him a new one quickly. But the special sword that Arthur finds will change his own life for ever!', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:50', '2021-03-05 23:29:50'),
(330, 'Aladdin and the Fabulous Genie', 'Aladdin-and-the-Fabulous-Genie', 'http://books.google.com/books/content?id=5d-ELwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5d-ELwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781843624776', 'Aladdin is surprised when his long-lost uncle Hasan appears at his door one day. He needs Aladdin to help him find a magic lamp, hidden deep in a dark cave. But Aladdin is afraid that once he is in there, Hasan will never let him out again!', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:51', '2021-03-05 23:29:51'),
(331, 'Ali Baba and the Stolen Treasure', 'Ali-Baba-and-the-Stolen-Treasure', 'http://books.google.com/books/content?id=IZAJGwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IZAJGwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781843624738', 'Three fantastic, fun-filled, dynamic and dramatic stories, to follow on from the story of Jason and the Argonauts and Ali Baba, published in February. These are tales that every aspiring boy-adventurer will want to read, from Robin outwitting the evil sheriff and William Tell\'s astounding shot that pierced an apple at one hundred yards, to Aladdin\'s discovery of his very own magic lamp complete with genie. Illustrated throughout with Tony Ross\'s energetic, bold and brilliant line drawings.', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:51', '2021-03-05 23:29:51'),
(332, 'Jason and the Voyage to the Edge of the World', 'Jason-and-the-Voyage-to-the-Edge-of-the-World', 'http://books.google.com/books/content?id=6dXyNwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6dXyNwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781843624721', 'To win back his father\'s kingdom, Jason must find the fabled Golden Fleece. Many have attempted the perilous journey in search of it and never returned. But Jason and his band of Argonauts set sail determined to succeed! Part of a collection of fun-filled, dynamic and dramatic stories, tales that every aspiring boy-adventurer wants to read.', NULL, 466, 1, 4, 100.00, NULL, '2021-03-05 23:29:51', '2021-03-05 23:29:51'),
