(342, 'Geronimo Stilton #04 Following The Trail Of Marco Polo', 'Geronimo-Stilton-#04-Following-The-Trail-Of-Marco-Polo', 'http://books.google.com/books/content?id=KbVyswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=KbVyswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781597072052', 'Enter the world of Geronimo Stilton, where another funny adventure is always right around the corner. Each book is a fast-paced adventure with lively art and a unique format kids 7-10 will love. Who Is Geronimo Stilton? That\'s me! I run a newspaper, but my true passion is writing tales of adventure. Here on Mouse Island, my books are all best-sellers! What\'s that? You\'ve never read one? Well, my books are full of fun. They are whisker-licking good stories, and that\'s a promise! I\'m Too Fond of My Fur! I was on my way \'round the world to Mouse Everest! The trip was long and dangerous. I almost froze my tail off on the way. And then I was kidnapped by the Abominable Snowman! Yes, it was truly an amazing adventure....', NULL, 468, 1, 4, 100.00, NULL, '2021-03-05 23:29:53', '2021-03-05 23:29:53'),
