(361, 'Fairy Unicorns Star Spell', 'Fairy-Unicorns-Star-Spell', 'http://books.google.com/books/content?id=tqGLtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tqGLtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474926942', 'Original stories, full of magic and adventure, about a group of fairy unicorns. Huge girl appeal with the irresistible combination of fairy unicorns and a magical secret world. With stylish, two-colour illustrations. The Usborne Reading Programme is a collection of over 300 reading books, graded in seven levels. Developed with reading experts, this series now features original fiction to provide readers with even more choice. Series Three books are for fully confident readers who still need to gain the stamina needed for standard length books. They use advanced sentence structure and vocabulary and have more complex plots with subplots.', NULL, 473, 1, 4, 100.00, NULL, '2021-03-05 23:29:56', '2021-03-05 23:29:56'),
(362, 'Diary of a Wimpy Kid Book 15', 'Diary-of-a-Wimpy-Kid-Book-15', 'http://books.google.com/books/content?id=bj5jzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bj5jzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241396643', 'Is Greg Heffley in over his head? Find out in Diary of a Wimpy Kid: Book 15, the newest book by #1 international bestselling author Jeff Kinney!', NULL, 474, 1, 4, 100.00, NULL, '2021-03-05 23:29:57', '2021-03-05 23:29:57'),
(363, 'Smile', 'Smile', 'http://books.google.com/books/content?id=gx5YPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gx5YPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545132060', 'An autobiography in graphic novel format describes how the author lost two of her front teeth in an accident when she was twelve, and her subsequent struggles with various corrective dental techniques throughout adolescence.', NULL, 475, 1, 5, 100.00, NULL, '2021-03-05 23:29:57', '2021-03-05 23:29:57'),
(364, 'Sisters', 'Sisters', 'http://books.google.com/books/content?id=qXpTmwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=qXpTmwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545540605', 'In a semi-autobiographical graphic novel, Raina\'s disappointing bond with a cranky, independent younger sister is further challenged by the arrival of a baby brother and an estrangement in their parents\' marriage.', NULL, 475, 1, 5, 100.00, NULL, '2021-03-05 23:29:57', '2021-03-05 23:29:57'),
(365, 'Drama', 'Drama', 'http://books.google.com/books/content?id=FcqEtgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FcqEtgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545326995', 'Callie rides an emotional roller coaster while serving on the stage crew for a middle school production of Moon over Mississippi as various relationships start and end, and others never quite get going.', NULL, 475, 1, 5, 100.00, NULL, '2021-03-05 23:29:57', '2021-03-05 23:29:57'),
(366, 'Can Doctor Proctor Save Christmas?', 'Can-Doctor-Proctor-Save-Christmas?', 'http://books.google.com/books/content?id=0No9swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0No9swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471167447', 'Can Doctor Proctor, Nilly, and Lisa save Christmas in this new fart-tastically funny adventure from worldwide bestselling author Jo Nesb�? When the king of Norway sells the rights to Christmas to Mr Thrane, it looks like the holidays aren\'t going to be very merry. Mr Thrane says that the only people who can celebrate are those who buy 10,000 crowns worth of presents from his department store. For anyone who doesn\'t - or can\'t - spend that much, it\'s no tree, no presents, no carols, and no Christmas pudding. ​Doctor Proctor, Nilly, and Lisa aren\'t going to take this sitting down! They\'re going to find Santa and save Christmas. All they need is a sleigh, flying reindeer, some time travel soap, and, of course, some fart powder! PRAISE for the Doctor Proctor\'s Fart Powder series: \'This terrific book will make you laugh, and cherish your friends\' - James Patterson \'plenty of toilet humour, and general silliness that kids love\' - The Bookseller \'wickedly entertaining\' - The Big Issue \'Lashings of silliness, quirkiness, self-deprecating humour, and a rollicking plot...\' - TheBookbag.co.uk \'Fuelled by farts, this is fast-paced and a delightfully ridiculous adventure\' - Julia Eccleshare on lovereading4kids.co.uk \'A superb mix of bizarre and wacky with a little bit of off-beat thrown in. Reminiscent of Roald Dahl it has all the elements to keep children hooked...\' - Waterstones', NULL, 476, 1, 5, 100.00, NULL, '2021-03-05 23:29:58', '2021-03-05 23:29:58'),
(367, 'Boy Called Hope', 'Boy-Called-Hope', 'http://books.google.com/books/content?id=sBWMDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sBWMDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474922920', '', NULL, 477, 1, 5, 100.00, NULL, '2021-03-05 23:29:58', '2021-03-05 23:29:58'),
(368, 'The Boy Who Sailed the Ocean in an Armchair', 'The-Boy-Who-Sailed-the-Ocean-in-an-Armchair', 'http://books.google.com/books/content?id=tmB6rgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tmB6rgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409576327', 'All Becket wants is for his family to be whole again. But standing in his way are two things: 1) his dad, his brother and he seem to have run away from home in the middle of the night and 2) Becket\'s mum died before he got the chance to say goodbye to her. Arming himself with an armchair of stories, a snail named Brian and 1000 paper cranes, Becket ploughs on, determined to make his wish come true.', NULL, 477, 1, 5, 100.00, NULL, '2021-03-05 23:29:58', '2021-03-05 23:29:58'),
(369, 'Cirque Du Freak', 'Cirque-Du-Freak', 'http://books.google.com/books/content?id=5xAitAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5xAitAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007938933', '', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:29:58', '2021-03-05 23:29:58'),
(370, 'The Vampire\'s Assistant', 'The-Vampire\'s-Assistant', '', '', '9780007938940', '\"Darren Shan was just an ordinary schoolboy, until his visit to the Cirque du Freak. Now as he struggles with his new life as a vampire\'s assistant, he tries desperately to resist the one temptation that sickens him, and the one thing that can keep him alive. But destiny is calling, the Wolf Man is waiting\"--Back cover. Suggested level: secondary.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:29:59', '2021-03-05 23:29:59'),
(371, 'Missing Pieces', 'Missing-Pieces', 'http://books.google.com/books/content?id=l515tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=l515tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338280074', 'Lock your doors! From the creators of the blockbuster horror video game Hello Neighbor comes the story that started it all. Unravel the mystery in this gripping prequel novel! Nicky Roth has always been a lonely kid. But that all changes when he and his family move to Raven Brooks and meet their eccentric neighbors, the Petersons. Nicky befriends the Petersons\' son, Aaron, bonding over their talents for tinkering. Soon the boys are inseparable and using their skills to pull pranks on the townspeople. But something about Aaron bothers Nicky--people seem almost afraid of him and his family. Through snippets from Aaron and a lot of sleuthing in the town\'s archives, Nicky discovers a dark past haunting his neighbors, a streak of bad luck they can\'t seem to shake. Aaron thinks that\'s all behind them now, but Nicky has a feeling the Petersons are fated for another tragedy. . . . This pulse-pounding prequel novel to the hit video game Hello Neighbor includes two-color illustrations throughout, to help readers unwind the mystery at the heart of the game.', NULL, 354, 1, 5, 100.00, NULL, '2021-03-05 23:29:59', '2021-03-05 23:29:59'),
(372, 'Waking Nightmare (Hello Neighbor #2)', 'Waking-Nightmare-(Hello-Neighbor-#2)', 'http://books.google.com/books/content?id=PvmgswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PvmgswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338289091', 'Don\'t miss this pulse-pounding original story, the sequel to Hello Neighbor: Missing Pieces, based on the hit video game from tinyBuild!', NULL, 354, 1, 5, 100.00, NULL, '2021-03-05 23:29:59', '2021-03-05 23:29:59'),
(373, 'Word of Mouse', 'Word-of-Mouse', 'http://books.google.com/books/content?id=3g1hAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3g1hAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784754228', 'What makes Isaiah so unique? First, his fur is as blue as the sky - which until recently was something he\'d never seen, but had read all about. That\'s right - Isaiah can read, and write. He can also talk to humans... if any of them are willing to listen! After a dramatic escape from a mysterious laboratory, Isaiah is separated from his \'mischief\' (which is the word for a mouse family) and has to use his special skills to survive in the dangerous outdoors, and hopefully find his missing family. But in a world of cruel cats, hungry owls and terrified people, it\'s hard for a young, lone mouse to make it alone. When he meets an equally unusual and lonely human girl named Hailey, the two soon learn that true friendship can transcend all barriers.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(374, 'Doctor Proctor\'s Fart Powder: Time-Travel Bath Bomb', 'Doctor-Proctor\'s-Fart-Powder:-Time-Travel-Bath-Bomb', 'http://books.google.com/books/content?id=NEx0swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NEx0swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471171338', 'The second laugh-out-loud adventure in the Doctor Proctor\'s Fart Powder series from Jo Nesbo, the most successful Norwegian author of all time! The Fart Powder was such a successful invention that Doctor Proctor couldn\'t stop there. Next up: a Time-travel Bath Bomb. Throw the Bath Bomb in the tub, lather up and imagine where you\'d like to visit. The battle of Waterloo? No problem. The French Revolution? Let\'s go! Doctor Proctor has plans for this new invention. Years ago he lost his true love, Juliette Margarine, and now he wants to change the past and win her back. But when his plan goes awry, it\'s up to Nilly and LIsa to travel in time and save the day. In the spirit of Roald Dahl and Lemony Snicket, Doctor Proctor offers a winning combination of humor, adventure, and absurdity that kids (of all ages) will love! PRAISEfor the Doctor Proctor\'s Fart Powder series: \'This terrific book will make you laugh, and cherish your friends\' - James Patterson \'plenty of toilet humour, and general silliness that kids love\' - The Bookseller \'wickedly entertaining\' - The Big Issue \'Lashings of silliness, quirkiness, self-deprecating humour, and a rollicking plot...\' - TheBookbag.co.uk \'Fuelled by farts, this is fast-paced and a delightfully ridiculous adventure\' - Julia Eccleshare review on lovereading4kids.co.uk \'A superb mix of bizarre and wacky with a little bit of off-beat thrown in. Reminiscent of Roald Dahl it has all the elements to keep children hooked...\' - Waterstones', NULL, 478, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(375, 'Doctor Proctor\'s Fart Powder: the Great Gold Robbery', 'Doctor-Proctor\'s-Fart-Powder:-the-Great-Gold-Robbery', 'http://books.google.com/books/content?id=OKpyswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OKpyswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471174612', 'The fourth and final laugh-out loud adventure in the Doctor Proctor\'s Fart Powder series from Jo Nesbo, the most successful Norwegian author of all time. When a Russian billionaire robs the Norwegian Gold Reserve and melts the last remaining gold bar into the Premier Soccer League trophy, it\'s up to Doctor Proctor, Nilly and Lisa to get the trophy and save Norway. But with a failed break-in attempt into the billionaire\'s subterranean gold-melting lab and the Norwegian Gold Reserve Inspection only three days away, the only way to retrieve the trophy is to win it back. Hoping to prevent national panic and uproar, Nilly and Lisa join the Rotten Ham soccer team and use the Fartonaut Powder, along with a handful of Doctor Proctor\'s other wacky inventions, to try and lead the hopeless underdog team to victory before time runs out. In the spirit of Roald Dahl and Lemony Snicket, Doctor Proctor offers a winning combination of humour, adventure, and absurdity that kids (of all ages) will love! PRAISE for the Doctor Proctor\'s Fart Powder series: \'This terrific book will make you laugh, and cherish your friends\' - James Patterson \'plenty of toilet humour, and general silliness that kids love\' - The Bookseller \'wickedly entertaining\' - The Big Issue \'Lashings of silliness, quirkiness, self-deprecating humour, and a rollicking plot...\' - TheBookbag.co.uk \'Fuelled by farts, this is fast-paced and a delightfully ridiculous adventure\' - Julia Eccleshare review on lovereading4kids.co.uk \'A superb mix of bizarre and wacky with a little bit of off-beat thrown in. Reminiscent of Roald Dahl it has all the elements to keep children hooked...\' - Waterstones', NULL, 476, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(376, 'Tiara Friends 4: The Hunt for Hidden Treasure', 'Tiara-Friends-4:-The-Hunt-for-Hidden-Treasure', 'http://books.google.com/books/content?id=cFbTwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cFbTwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407170800', 'Best friends Millie and Jess look just like twins! Millie is a princess and Jess is a maid so they have lots of fun swapping dresses and going on adventures around Peveril Palace. When a priceless painting is stolen, can the girls work out why and who is responsible? Don\'t miss the girls\' first, second and third adventures - THE CASE OF THE STOLEN CROWN, THE SECRET OF THE SILK DRESS, THE MYSTERY OF THE LAKE MONSTER.', NULL, 369, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(377, 'The Mystery of the Lake Monster', 'The-Mystery-of-the-Lake-Monster', 'http://books.google.com/books/content?id=vA_1swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vA_1swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407170794', 'Best friends Millie and Jess look just like twins! Millie is a princess and Jess is a maid so they have lots of fun swapping dresses and going on adventures around Peveril Palace. When a mysterious monster appears in the lake in the dead of night, can the girls uncover some clues and work out where it\'s come from? Don\'t miss the girls\' first, second and fourth adventures - THE CASE OF THE STOLEN CROWN, THE SECRET OF THE SILK DRESS, THE HUNT FOR HIDDEN TREASURE.', NULL, 369, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(378, 'Tiara Friends: the Secret of the Silk Dress', 'Tiara-Friends:-the-Secret-of-the-Silk-Dress', 'http://books.google.com/books/content?id=QAqIvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QAqIvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407174303', 'Best friends Millie and Jess look just like twins! Millie is a princess and Jess is a maid so they have lots of fun swapping dresses and going on adventures around Peveril Palace. When Millie\'s snooty cousins come to stay, a silk dress goes missing. Can Millie and Jess work out who took it, before the wrong person gets the blame?', NULL, 369, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(379, 'Tiara Friends: the Case of the Stolen Crown', 'Tiara-Friends:-the-Case-of-the-Stolen-Crown', 'http://books.google.com/books/content?id=bsmIvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bsmIvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407174297', 'Best friends Millie and Jess look just like twins! Millie is a princess and Jess is a maid so they have lots of fun swapping dresses and going on adventures around Peveril Palace. When a diamond crown is stolen before a royal birthday party, can the girls uncover some clues and work out where it\'s hidden?', NULL, 369, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(380, 'Five Nights at Freddy\'s: The Silver Eyes', 'Five-Nights-at-Freddy\'s:-The-Silver-Eyes', 'http://books.google.com/books/content?id=XXaKDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=XXaKDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338134377', 'Ten years after the horrific murders at Freddy Fazbear\'s Pizza that ripped their town apart, Charlie, whose father owned the restaurant, and her childhood friends reunite on the anniversary of the tragedy and find themselves at the old pizza place which had been locked up and abandoned for years. After they discover a way inside, they realize that things are not as they used to be. The four adult-sized animatronic mascots that once entertained patrons have changed. They now have a dark secret . . . and a murderous agenda.', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:00', '2021-03-05 23:30:00'),
(381, 'The Twisted Ones', 'The-Twisted-Ones', 'http://books.google.com/books/content?id=VLVPMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VLVPMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338139303', 'The highly anticipated sequel to the bestselling Five Nights at Freddy\'s: The Silver Eyes. It\'s been a year since the horrific events at Freddy Fazbear\'s Pizza, and Charlie is just trying to move on. Even with the excitement of a new school and a fresh start, she\'s still haunted by nightmares of a masked murderer and four gruesome animatronic puppets. Charlie thinks her ordeal is over, but when a series of bodies are discovered near her school-bearing wounds that are disturbingly familiar-she finds herself drawn back into the world of her father\'s frightening creations. Something twisted is hunting Charlie, and this time if it finds her, it\'s not letting her go.', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:01', '2021-03-05 23:30:01'),
(382, 'Five Nights at Freddy\'s', 'Five-Nights-at-Freddy\'s', 'http://books.google.com/books/content?id=7sZ_swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7sZ_swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338139327', 'From the creator of the horror video game sensation Five Nights at Freddy\'s comes the pulse-pounding conclusion to the bestselling trilogy!', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:01', '2021-03-05 23:30:01'),
(383, 'Death Bringer', 'Death-Bringer', 'http://books.google.com/books/content?id=g8x1tQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=g8x1tQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007326037', 'The Necromancers no longer need Valkyrie to be their Death Bringer, and that\'s a good thing. The catch? They don\'t need her any more because they\'ve found their Death Bringer already, the person who will dissolve the doors between life and death. And that\'s a very, very bad thing ...', NULL, 479, 1, 5, 100.00, NULL, '2021-03-05 23:30:01', '2021-03-05 23:30:01'),
(384, 'Jennie', 'Jennie', 'http://books.google.com/books/content?id=idQMMlUMK44C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=idQMMlUMK44C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007395194', '\"If in doubt, wash!\" What is it like to be a cat? Find out in this classic animal story from the renowned writer Paul Gallico.', NULL, 480, 1, 5, 100.00, NULL, '2021-03-05 23:30:01', '2021-03-05 23:30:01'),
(385, 'The Sword in the Stone', 'The-Sword-in-the-Stone', 'http://books.google.com/books/content?id=DT-UQL4Q648C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DT-UQL4Q648C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007263493', 'When Merlyn the magician comes to tutor Sir Ector\'s sons Kay and the Wart, schoolwork suddenly becomes much more fun. After all, who wouldn\'t enjoy being turned into a fish, or a badger, or a snake? But Merlyn has very particular plans for the Wart...', NULL, 481, 1, 5, 100.00, NULL, '2021-03-05 23:30:01', '2021-03-05 23:30:01'),
(386, 'Mary Poppins', 'Mary-Poppins', 'http://books.google.com/books/content?id=_hgaWmiztvQC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_hgaWmiztvQC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007286416', 'THE ORIGINAL AND CLASSIC STORIES AVAILABLE NOW IN ALL-NEW LUXURIOUS LIVERY IN TIME FOR THE RELEASE OF THE 2018 MOVIE When the East Wind blows Mary Poppins into the home of the banks children, their lives go topsy-turvy and are changed forever. More than eighty years since we first met Mary Poppins, this original, classic story is still charming readers and transporting new fans into the mysterious world of everyone\'s favourite magical nanny.', NULL, 482, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(387, 'Harry Potter and the Half-Blood Prince (Book 6)', 'Harry-Potter-and-the-Half-Blood-Prince-(Book-6)', 'http://books.google.com/books/content?id=9pB5BgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9pB5BgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439785969', 'When Harry Potter and the Half-Blood Prince opens, the war against Voldemort has begun. The Wizarding world has split down the middle, and as the casualties mount, the effects even spill over onto the Muggles. Dumbledore is away from Hogwarts for long periods, and the Order of the Phoenix has suffered grievous losses. And yet, as in all wars, life goes on. Harry, Ron, and Hermione, having passed their O.W.L. level exams, start on their specialist N.E.W.T. courses. Sixth-year students learn to Apparate, losing a few eyebrows in the process. Teenagers flirt and fight and fall in love. Harry becomes captain of the Gryffindor Quidditch team, while Draco Malfoy pursues his own dark ends. And classes are as fascinating and confounding as ever, as Harry receives some extraordinary help in Potions from the mysterious Half-Blood Prince. Most importantly, Dumbledore and Harry work together to uncover the full and complex story of a boy once named Tom Riddle—the boy who became Lord Voldemort. Like Harry, he was the son of one Muggle-born and one Wizarding parent, raised unloved, and a speaker of Parseltongue. But the similarities end there, as the teenaged Riddle became deeply interested in the Dark objects known as Horcruxes: objects in which a wizard can hide part of his soul, if he dares splinter that soul through murder. Harry must use all the tools at his disposal to draw a final secret out of one of Riddle’s teachers, the sly Potions professor Horace Slughorn. Finally Harry and Dumbledore hold the key to the Dark Lord’s weaknesses... until a shocking reversal exposes Dumbledore’s own vulnerabilities, and casts Harry’s—and Hogwarts’s—future in shadow.', NULL, 483, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(388, 'Harry Potter and the Sorcerer\'s Stone', 'Harry-Potter-and-the-Sorcerer\'s-Stone', 'http://books.google.com/books/content?id=fo4rzdaHDAwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fo4rzdaHDAwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780590353427', 'Rescued from the outrageous neglect of his aunt and uncle, a young boy with a great destiny proves his worth while attending Hogwarts School for Witchcraft and Wizardry.', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(389, 'Harry Potter and the Prisoner of Azkaban', 'Harry-Potter-and-the-Prisoner-of-Azkaban', 'http://books.google.com/books/content?id=p-W7qWMJUasC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=p-W7qWMJUasC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439136365', 'During his third year at Hogwarts School for Witchcraft and Wizardry, Harry Potter must confront the devious and dangerous wizard responsible for his parents\' deaths. Reprint. 2,500,000 first printing.', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(390, 'Harry Potter and the Goblet of Fire (Book 4)', 'Harry-Potter-and-the-Goblet-of-Fire-(Book-4)', 'http://books.google.com/books/content?id=-TE0BgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-TE0BgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439139601', 'In Harry Potter and the Goblet of Fire, Harry is midway through both his training as a wizard and his coming of age. He wants to get away from the malicious Dursleys and go to the Quidditch World Cup with Hermione, Ron, and the Weasleys. He wants to dream about his crush, Cho Chang (and maybe do more than dream). And now that he’s gotten the hang of things at Hogwarts—he hopes—he just wants to be a normal fourteen-year-old wizard. But even by his standards, Harry\'s year is anything but normal. First Dumbledore announces the revival of a grand competition that hasn\'t taken place for one hundred years: the Triwizard Tournament, where a Hogwarts champion will compete against rivals from two other schools of magic in three highly dangerous tasks. Then someone frames Harry to participate in the tournament—which really means someone wants him dead. Harry is guided through the competition by Professor Alastor Moody, this year\'s Defense Against the Dark Arts teacher, but he must also contend with a nasty reporter named Rita Skeeter, who digs up some highly unflattering secrets about Hagrid; a terrible fight with Ron, who is deeply jealous of Harry\'s fame; Hermione\'s newfound activism on behalf of house-elves; and the terrifying prospect of asking a date to the Yule Ball. Worst of all, Lord Voldemort may finally have gathered the materials necessary for his rejuvenation... and he has a faithful servant at Hogwarts waiting only for a sign. No, nothing is ever normal for Harry Potter. And in his case, different can be deadly.', NULL, 483, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(391, 'Harry Potter and the Order of the Phoenix (Book 5)', 'Harry-Potter-and-the-Order-of-the-Phoenix-(Book-5)', 'http://books.google.com/books/content?id=HjI0BgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HjI0BgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439358071', 'In Harry Potter and the Order of the Phoenix, Lord Voldemort has returned to the Wizarding world, presenting a threat that neither the magical government nor the authorities at Hogwarts can stop. In response to his reappearance, Dumbledore reactivates the Order of the Phoenix, a secret society which works to defeat the Dark Lord\'s minions and protect his targets—especially Harry Potter. But Harry doesn’t want to be protected. Even as the Ministry of Magic denies his claims, The Daily Prophet discredits him, and even Dumbledore won’t look him in the eye, Harry grows more and more determined to fight his lifelong enemy Voldemort—if only he had the “weapon” the Order is guarding. In the meantime, he visits his godfather at his ghoulish London home, Grimmauld Place, and learns more about Voldemort’s deep reach into Wizarding history and the Wizarding world. Back at Hogwarts, Harry must deal with a Defense Against the Dark Arts teacher with a personality like poisoned honey; a surprising new member of the Gryffindor Quidditch team; the possibility of his first real romance; and the looming nightmare of the Ordinary Wizarding Level exams. He’s haunted by dreams of a heavy door at the end of a silent corridor, and a vision of his father and the young Severus Snape that changes everything he thought he knew about them. Even the joy of working with \"Dumbledore\'s Army\" -a group of Hogwart\'s students dedicated to defeating Voldemort- can\'t dispel the gathering darkness. Soon Harry will discover the true depth and strength of his friends; their boundless loyalty and unbearable sacrifices. His fate depends on them all.', NULL, 483, 1, 5, 100.00, NULL, '2021-03-05 23:30:02', '2021-03-05 23:30:02'),
(392, 'Peril at the Top of the World', 'Peril-at-the-Top-of-the-World', '', '', '9781529119848', 'When a set of priceless paintings by Leonardo da Vinci and Rembrandt go missing in Moscow, the Kidd siblings head to Russia and the wild Arctic tundra to find the thieves and the treasure.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:03', '2021-03-05 23:30:03'),
(393, 'Quest for the City of Gold', 'Quest-for-the-City-of-Gold', '', '', '9781529119855', 'Twins Bick and Beck Kidd and their family of professional treasure hunters race against mercenaries, rival treasure hunters, and a lumber baron through the jungles and mountains of Peru in search of Paititi, the legendary lost Inca city of gold, in hope of conserving the archaeological treasure and preventing deforestation of the rain forest.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:03', '2021-03-05 23:30:03'),
(394, 'Danger Down the Nile', 'Danger-Down-the-Nile', '', '', '9781529119824', '\"Twelve-year-old twins Bickford and Rebecca Kidd and their two older siblings travel to Africa to track down priceless artifacts that will keep the family\'s treasure hunting business afloat long enough to rescue their kidnapped mother--and possibly find their missing father\"--', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:04', '2021-03-05 23:30:04'),
(395, 'Treasure Hunters', 'Treasure-Hunters', '', '', '9781529119831', 'Bick and Beck Kidd are desperately trying to secure the ancient Chinese artefact that will buy their mother\'s freedom from renegade pirates. But when the kidnappers force them to locate an even greater treasure - priceless paintings stolen by Nazis, the Kidds must rely on their own cunning and experience to outwit the criminals, all while their mom\'s life is on the line.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:04', '2021-03-05 23:30:04'),
(396, 'Treasure Hunters', 'Treasure-Hunters-9781529119817', '', '', '9781529119817', 'Treasure hunting is no laughing matter. Unless you\'re treasure hunting with these kids. Bick Kidd\'s parents were world-famous treasure hunters - until they mysteriously disappeared. Now he and the rest of the Kidds - Beck, Tommy and Storm - have to finish their mom and dad\'s last major mission... before it finishes them.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:04', '2021-03-05 23:30:04'),
(397, 'Charlie Bone and the Blue Boa', 'Charlie-Bone-and-the-Blue-Boa', 'http://books.google.com/books/content?id=kBL9jwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kBL9jwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781405280945', 'Classic magic and mystery from one of Britain\'s best-loved authors of fantasy adventure. Perfect for fans of Harry Potter, Eva Ibbotson, Cornelia Funke\'s Inkheart and Shane Hegarty\'s Darkmouth. An Academy for magic and special talents. A destiny unfulfilled. A secret legacy. The third instalment of the international best-selling series from Jenny Nimmo starring Charlie Bone. Charlie\'s Uncle Paton has dashed off to try to stop the Yewbeam aunts\' latest plan, but when Grandma Bone greets the arrival of Belle with delight, could this be what Paton left hoping to prevent? At Bloor\'s, Emma finds art teacher Mr Boldova is the brother of the mysterious Ollie Sparks, made invisible by the blue boa. Have you collected all of the Charlie Bone series? Midnight for Charlie Bone Charlie Bone and the Time Twister Charlie Bone and the Blue Boa Charlie Bone and Castle of Mirrors Charlie Bone and the Hidden King Charlie Bone and the Wilderness Wolf Charlie Bone and the Shadow of Badlock Charlie Bone and the Red Knight Also look out for The Snow Spider trilogy. \'Dark, funny, crackling with magic\' - author Artemis Cooper on Midnight for Charlie Bone \'A fast moving, dialogue driven romp with plenty of cliff-hangers for those first hooked into reading by Harry Potter\' - Bookseller on Midnight for Charlie Bone Jenny Nimmo is the acclaimed author of the Charlie Bone series. She has won several significant awards for her children\'s fiction, including the Nestle Smarties Book Prize and the Tir na n-Og Welsh Arts Council award for The Snow Spider. She lives in Wales with her husband, David.', NULL, 360, 1, 5, 100.00, NULL, '2021-03-05 23:30:04', '2021-03-05 23:30:04'),
(398, 'Charlie Bone and the Time Twister', 'Charlie-Bone-and-the-Time-Twister', 'http://books.google.com/books/content?id=7H8NDQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7H8NDQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781405280938', 'Classic magic and mystery from one of Britain\'s best-loved authors of fantasy adventure. Perfect for fans of Harry Potter, Eva Ibbotson, Cornelia Funke\'s Inkheart and Shane Hegarty\'s Darkmouth. An Academy for magic and special talents. A destiny unfulfilled. A secret legacy. The second instalment of the international best-selling series from Jenny Nimmo starring Charlie Bone. January 1916. On the coldest night in memory, Henry Yewbeam\'s cousin Zeke tricks him into using the Time Twister, a beautiful marble full of shining colours that draws him into the future. And when he emerges, he meets Charlie Bone . . . Have you collected all of the Charlie Bone series? Midnight for Charlie Bone Charlie Bone and the Time Twister Charlie Bone and the Blue Boa Charlie Bone and the Castle of Mirrors Charlie Bone and the Hidden King Charlie Bone and the Wilderness Wolf Charlie Bone and the Shadow of Badlock Charlie Bone and the Red Knight Also look out for The Snow Spider trilogy. \'Dark, funny, crackling with magic\' - author Artemis Cooper on Midnight for Charlie Bone \'A fast moving, dialogue driven romp with plenty of cliff-hangers for those first hooked into reading by Harry Potter\' - Bookseller on Midnight for Charlie Bone Jenny Nimmo is the acclaimed author of the Charlie Bone series. She has won several significant awards for her children\'s fiction, including the Nestle Smarties Book Prize and the Tir na n-Og Welsh Arts Council award for The Snow Spider. She lives in Wales with her husband, David.', NULL, 360, 1, 5, 100.00, NULL, '2021-03-05 23:30:05', '2021-03-05 23:30:05'),
(399, 'Against the Tide', 'Against-the-Tide', 'http://books.google.com/books/content?id=iB0MngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iB0MngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545522472', 'Conor, Abeke, Meilin and Rollan\'s perilous quest for talismans in a blue-water tropical paradise becomes more dangerous when they realize that one of their number is a traitor who has been revealing their locations to their enemies. By the best-selling author of the Menagerie trilogy. Simultaneous eBook.', NULL, 361, 1, 5, 100.00, NULL, '2021-03-05 23:30:05', '2021-03-05 23:30:05'),
(400, 'Blood Ties', 'Blood-Ties', 'http://books.google.com/books/content?id=MHEdnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=MHEdnwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545522458', 'A latest entry in the role-playing series returns readers to the world of Erdas, where four youths on the brink of adulthood tap the powers of their animal familiars and embark on a dangerous mission to stop a dark force that threatens their survival.', NULL, 362, 1, 5, 100.00, NULL, '2021-03-05 23:30:05', '2021-03-05 23:30:05'),
(401, 'My Head Teacher Is a Vampire Rat!', 'My-Head-Teacher-Is-a-Vampire-Rat!', 'http://books.google.com/books/content?id=SEnCoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SEnCoQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857632890', 'This tale sees Izzy and her friends plunged into more primary-school craziness. This time, they decide that their new head teacher is a vampire rat, based on his being slightly scary, having the blinds drawn in his office during the day and the fact he\'s banned garlic bread at lunchtimes. Now they just have to come up with a plan to vanquish him.', NULL, 363, 1, 5, 100.00, NULL, '2021-03-05 23:30:05', '2021-03-05 23:30:05'),
(402, 'H.I.V.E. (Higher Institute of Villainous Education)', 'H.I.V.E.-(Higher-Institute-of-Villainous-Education)', 'http://books.google.com/books/content?id=dQ_hFQk8H5gC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=dQ_hFQk8H5gC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781408815908', 'H.I.V.E. (Higher Institute of Villainous Education) is a top-secret school of applied villainy where children with a precocious gift for wrongdoing are sent to develop their talents into criminal mastermind. After all, \'villains have the best lines and wear the best costumes\'. One small catch is that the children cannot leave until training is complete, six years later. With villainy comes a certain freedom of thought, and every year one student in particular will show exceptional talent - after all, it takes the best to produce the worst. This year there are two students: Otto Malpense and his new friend Wing Fanchu are both exceptionally bad, and they are definitely not keen on being held against their will for six long years . . .', NULL, 364, 1, 5, 100.00, NULL, '2021-03-05 23:30:06', '2021-03-05 23:30:06'),
(403, 'H.I.V.E. 5: Rogue', 'H.I.V.E.-5:-Rogue', 'http://books.google.com/books/content?id=tyk54urLstcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=tyk54urLstcC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781408815946', 'Key members of G.L.O.V.E. are being assassinated and Otto, gone rogue, is behind the killings. Raven and Wing must find him before the order to eliminate him can be carried out . . .', NULL, 364, 1, 5, 100.00, NULL, '2021-03-05 23:30:06', '2021-03-05 23:30:06'),
(404, 'H.I.V.E. 4: Dreadnought', 'H.I.V.E.-4:-Dreadnought', 'http://books.google.com/books/content?id=A4YopkIihJYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=A4YopkIihJYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408815939', 'A renegade faction of the world\'s most powerful villains is intent on destroying G.L.O.V.E. (Global League Of Villainous Enterprises) and showing the world the true face of evil. The Disciples begin by hijacking Diabolus Darkdoom\'s Airborne command post, then they kidnap his son and his son\'s best friend. Unfortunately for them, Nigel Darkdoom (and Franz) also happen to be Otto\'s friends. Heading out to America, Otto, Wing et al embark on a perilous and highly unauthorised rescue operation. Cut off from the support of H.I.V.E. and on the run from American security forces the hunt for their friends leads to one of the US military\'s most secret facilities. It becomes clear that the Disciples are not all they appear and in a desperate race against time Otto must work out who his real friends are to prevent the Disciples from completing their true objective. Only Otto can save the world from domination by a sinister new world order but it might be that the price he has to pay is just too high. When it comes to the crunch will he be prepared to sacrifice himself?', NULL, 364, 1, 5, 100.00, NULL, '2021-03-05 23:30:06', '2021-03-05 23:30:06'),
(405, 'To Wee Or Not to Wee', 'To-Wee-Or-Not-to-Wee', 'http://books.google.com/books/content?id=SZCVjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SZCVjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857637727', '', NULL, 363, 1, 5, 100.00, NULL, '2021-03-05 23:30:06', '2021-03-05 23:30:06'),
(406, 'The Donkey on the Sands', 'The-Donkey-on-the-Sands', 'http://books.google.com/books/content?id=kwULswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kwULswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753730546', 'A collection of stories by the best-selling author of the \'Famous Five\' series, Enid Blyton.', NULL, 365, 1, 5, 100.00, NULL, '2021-03-05 23:30:07', '2021-03-05 23:30:07'),
(407, 'The Cat with the Feathery Tail', 'The-Cat-with-the-Feathery-Tail', 'http://books.google.com/books/content?id=yzj_rQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yzj_rQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753729540', 'This magical story collection will have children laughing out loud at the silly characters and cute storylines. This volume includes the stories of The Broken Gate, Sulky Susan and The Girl Who Had Hiccups. Find out what\'s going on in toyland and beyond in this lovely set of tales from Enid Blyton.', NULL, 365, 1, 5, 100.00, NULL, '2021-03-05 23:30:08', '2021-03-05 23:30:08'),
(408, 'The Fairy Kitten', 'The-Fairy-Kitten', 'http://books.google.com/books/content?id=M9csnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=M9csnwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753726426', 'A selection of short stories by Enid Blyton suitable for readers aged 5-8 years.', NULL, 365, 1, 5, 100.00, NULL, '2021-03-05 23:30:08', '2021-03-05 23:30:08'),
(409, 'Trapped in a Video Game (Book 2)', 'Trapped-in-a-Video-Game-(Book-2)', 'http://books.google.com/books/content?id=KFU-tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=KFU-tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781449494896', 'When Mark is sucked into the game \"Go Wild\", he becomes invisible which makes it that much harder for Jesse to find him.', NULL, 366, 1, 5, 100.00, NULL, '2021-03-05 23:30:08', '2021-03-05 23:30:08'),
(410, 'Catwad', 'Catwad', 'http://books.google.com/books/content?id=tlJ3tgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tlJ3tgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338326024', 'An all-new series from New York Times bestselling author, Jim Benton!', NULL, 367, 1, 5, 100.00, NULL, '2021-03-05 23:30:09', '2021-03-05 23:30:09'),
(411, 'Trapped in a Video Game (Book 3)', 'Trapped-in-a-Video-Game-(Book-3)', 'http://books.google.com/books/content?id=mVU1tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mVU1tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781449495152', 'Kids who love video games will love this third installment of the new 5-book series about 12-year old Jesse Rigsby and the wild adventures he encounters inside different video games. Age Level: 8-12 Grade Level: 3rd and up The robots are here and they\'re not happy, at all. After accidentally releasing the robot villains from Super Bot World 3 into the real world, Jesse Rigsby\'s got to figure out a way to make everything right before anyone gets hurt. He\'s usually rely on his friend Eric to help him with this sort of thing, but he\'s gone missing. To find Eric, Jesse will have to survive rickety minecarts, sewer piranhas, mysterious men in suits and a 100-foot tall robot named Goliatron. This is Jesse\'s most dangerous adventure yet because this time the video game is real. And in the real world, there are no extra lives.', NULL, 366, 1, 5, 100.00, NULL, '2021-03-05 23:30:09', '2021-03-05 23:30:09'),
(412, 'Hunted', 'Hunted', 'http://books.google.com/books/content?id=Sz_InQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Sz_InQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545522441', 'Journeying to the forests of Eura to confront another hidden Great Beast, four young heroes whose rare spirit animal bonds have shaped their quest to save the world are shatteringly betrayed by a familiar face. By the award-winning author of The Scorpio Races.', NULL, 79, 1, 5, 100.00, NULL, '2021-03-05 23:30:09', '2021-03-05 23:30:09'),
(413, 'Earth-Shattering Earthquakes', 'Earth-Shattering-Earthquakes', 'http://books.google.com/books/content?id=JBS1QQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=JBS1QQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439944571', 'It\'s Horrible Geography\'s turn to get a revamp. With a brand-new cover design, updated text and now including a horrible index, it\'s geography with even more gritty bits left in!', NULL, 368, 1, 5, 100.00, NULL, '2021-03-05 23:30:10', '2021-03-05 23:30:10'),
(414, 'The Incredible Incas', 'The-Incredible-Incas', 'http://books.google.com/books/content?id=DXONJwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DXONJwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407104270', 'It\'s history with the nasty bits left in! Want to know: Why llamas wore earrings and drank beer? How a bucket of stewed pee can make you beautiful? Why servants ate the emperor\'s hair? Discover all the foul facts about the Incredible Incas - all the gore and more!', NULL, 359, 1, 5, 100.00, NULL, '2021-03-05 23:30:10', '2021-03-05 23:30:10'),
(415, 'Freaky Peaks', 'Freaky-Peaks', 'http://books.google.com/books/content?id=1WsxPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1WsxPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439944595', 'Freaky Peaks takes the intrepid young explorer on a thrilling tour of the tallest mountains, from Everest to Kilimanjaro, encountering many dangers along the way, including glaciers, yetis and avalanches. With a brand-new cover design, text updates and an added extra-horrible index, it\'s geography with even more gritty bits left in!', NULL, 368, 1, 5, 100.00, NULL, '2021-03-05 23:30:10', '2021-03-05 23:30:10'),
(416, 'Desperate Deserts', 'Desperate-Deserts', 'http://books.google.com/books/content?id=S7QbLQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=S7QbLQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780439944557', 'Where in the world can you spot sand dunes that bury whole villages? Discover some deadly desert wildlife? Follow in the footsteps of daring desert explorers? Get the earth-shattering facts in Desperate Deserts.', NULL, 368, 1, 5, 100.00, NULL, '2021-03-05 23:30:10', '2021-03-05 23:30:10'),
(417, 'Welcome to Camp Slither', 'Welcome-to-Camp-Slither', 'http://books.google.com/books/content?id=8RGFPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8RGFPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407107738', 'Twelve-year-old Boone and his sister Heather love animals of every kind. That\'s why they wanted to come to Camp Slither. The wild legends of man-eating snakes and disappearing campers are hisss-terical! But Camp Slither has a cold-blooded secret ... somebody has unleashed a hungry horde of slithery snakes! Can Boone and Heather survive long enough to accept their invitation to HorrorLand? Yesssssss! But only if they figure out why Camp Slither is crawling with trouble.', NULL, 356, 1, 5, 100.00, NULL, '2021-03-05 23:30:11', '2021-03-05 23:30:11'),
(418, 'The Wizard of Ooze', 'The-Wizard-of-Ooze', 'http://books.google.com/books/content?id=r8k2SwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=r8k2SwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407116389', 'While visiting HorrorLand\'s gift shop, Marco and his friend Gabriella find a rare edition of a comic book called THE WIZARD OF OOZE. Hidden in the back of this book are secret instructions on how to gain super powers. Marco is so excited that he starts talking about this special book at a comic convention. Big mistake. A couple of shady characters are after the comic, and will do anything to get their hands on it...', NULL, 356, 1, 5, 100.00, NULL, '2021-03-05 23:30:11', '2021-03-05 23:30:11'),
(419, 'Lord Loss', 'Lord-Loss', 'http://books.google.com/books/content?id=efIufDZth2cC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=efIufDZth2cC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007193202', 'The first book in the Demonata, the demonic symphony in ten parts by multimillion-copy bestselling horror writer Darren Shan… When Grubbs Grady first encounters Lord Loss and his evil minions, he learns three things: the world is vicious, magic is possible, demons are real. He thinks that he will never again witness such a terrible night of death and darkness.…He is wrong.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:11', '2021-03-05 23:30:11'),
(420, 'Demon Thief', 'Demon-Thief', 'http://books.google.com/books/content?id=TqMHb6U0C68C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TqMHb6U0C68C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007193233', 'A hellish nightmare for only the bravest of readers… Darren Shan’s horrifying series, The Demonata, continues with Demon Thief. When Kernel Fleck\'s brother is stolen by demons, he must enter their universe in search of him. It is a place of magic, chaos and incredible danger. Kernel has three aims: learn to use magic, find his brother, stay alive. But a heartless demon awaits him, and death has been foretold…', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:11', '2021-03-05 23:30:11'),
(421, 'Slawter', 'Slawter', 'http://books.google.com/books/content?id=zRCISxY0oDwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zRCISxY0oDwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007231386', 'While on a horror movie set with his Uncle Dervish, Grubbs Grady realizes that his battle with the evil demon master Lord Loss may be about to resume.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:12', '2021-03-05 23:30:12'),
(422, 'Bec', 'Bec', 'http://books.google.com/books/content?id=3x5K75_lPc0C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3x5K75_lPc0C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007231393', 'As the demonic Fomorii ravage their land, Bec and her warrior companions leave the devastated area not only to answer a call for help but also to find information that will enable Bec to unlock the secrets of her past.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:12', '2021-03-05 23:30:12'),
(423, 'Blood Beast', 'Blood-Beast', 'http://books.google.com/books/content?id=yLEDHkusTJQC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yLEDHkusTJQC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007231409', 'When he begins to experience alarming symptoms at the onset of the full moon, Grubbs Grady fears that he won\'t be able to fight off the beast he has inside.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:12', '2021-03-05 23:30:12'),
(424, 'Demon Apocalypse', 'Demon-Apocalypse', 'http://books.google.com/books/content?id=PHg_A1mYfOEC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PHg_A1mYfOEC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007231416', 'Fire! It\'s all around me, fierce, intense, out of control. I feel the hair on my arms singe and know I have only seconds before I burst into flames. Total panic. There\'s a horrible shrieking sound, piercing and destructive. My eardrums and eyeballs should burst. \"It\'s hell!\" I moan.,*One boy\'s life ripped to shreds before his eyes...,*One wrathful demon master hellbent on revenge...,*An army of grisly Demonata on the rampage...It\'s the end of the world as we know it.', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:13', '2021-03-05 23:30:13'),
(425, 'Dark Calling', 'Dark-Calling', 'http://books.google.com/books/content?id=u78glV8RPCwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=u78glV8RPCwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007260454', 'Events take an unexpected turn in this ninth awesome foray into the worlds of the Demonata... The Disciples are being manipulated by beings older than time. Only Kernel Fleck knows that something is wrong. But he is in the grip of a creature who cares nothing for the fate of humanity. Voices are calling to him from the darkness and he\'s powerless to resist. Kernel has already been to hell and back. Now he\'s about to go further...', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:13', '2021-03-05 23:30:13'),
(426, 'Hell\'s Heroes', 'Hell\'s-Heroes', 'http://books.google.com/books/content?id=ujfQK2PvUrUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ujfQK2PvUrUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007260362', 'Events take an unexpected turn in this ninth awesome foray into the worlds of the Demonata... The Disciples are being manipulated by beings older than time. Only Kernel Fleck knows that something is wrong. But he is in the grip of a creature who cares nothing for the fate of humanity. Voices are calling to him from the darkness and he\'s powerless to resist. Kernel has already been to hell and back. Now he\'s about to go further...', NULL, 342, 1, 5, 100.00, NULL, '2021-03-05 23:30:13', '2021-03-05 23:30:13'),
(427, 'The Hitchhiker\'s Guide to the Galaxy', 'The-Hitchhiker\'s-Guide-to-the-Galaxy', 'http://books.google.com/books/content?id=S062QgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=S062QgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330491198', 'Adams\'s beloved and enduring sci-fi/comedy classic is now available in this beautiful, clothbound, elegantly presented book, filled with never-before-published material, original scripts from the BBC radio series, and much more to please any fan.', NULL, 343, 1, 5, 100.00, NULL, '2021-03-05 23:30:14', '2021-03-05 23:30:14'),
(428, 'Amulet', 'Amulet-9780545208857', 'http://books.google.com/books/content?id=0JETyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0JETyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545208857', 'A latest entry in the best-selling series finds Emily, Navin and the gang traveling by airship in search of the mythical cloud city of Cielis, a quest that is joined by the dubiously trustworthy son of the Elf King. Original.', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(429, 'The Last Council', 'The-Last-Council', 'http://books.google.com/books/content?id=4TmEUQXPwa8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4TmEUQXPwa8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9780545208871', 'After chasing the monster that kidnapped their mother, Emily and Navin find themselves in a magical world of man-eating demons and shadowy enemies, where they must learn to control an amulet given to them by their grandfather.', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(430, 'Prince of the Elves', 'Prince-of-the-Elves', '', '', '9780545208895', 'After chasing the monster that kidnapped their mother, Emily and Navin find themselves in a magical world of man-eating demons and shadowy enemies, where they must learn to control an amulet given to them by their grandfather.', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(431, 'Escape from Lucien', 'Escape-from-Lucien', 'http://books.google.com/books/content?id=3dXnnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3dXnnQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545433150', 'Navin journeys to the city of Lucien where he searches for a beacon essential to his fight against the Elf King; while Emily heads back into the Void with Max, one of the Elf King\'s followers, where she learns his darkest secrets.', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(432, 'Firelight (Amulet #7)', 'Firelight-(Amulet-#7)', 'http://books.google.com/books/content?id=vbQLswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vbQLswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545433167', 'The unforgettable seventh installment of Kazu Kibuishi\'s #1 New York Times bestselling series! Emily, Trellis, and Vigo visit Algos Island, where they can access and enter lost memories. They\'re hoping to uncover the events of Trellis\'s mysterious childhood--knowledge they can use against the Elf King. What they discover is a dark secret that changes everything. Meanwhile, the Voice of Emily\'s Amulet is getting stronger, and threatens to overtake her completely.', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(433, 'Supernova', 'Supernova', 'http://books.google.com/books/content?id=_L1tswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_L1tswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545828604', 'Kazu Kibuishi\'s thrilling #1 New York Times bestselling series continues!', NULL, 344, 1, 5, 100.00, NULL, '2021-03-05 23:30:16', '2021-03-05 23:30:16'),
(434, 'Captain Underpants and the Tyrannical Retaliation of the Turbo Toilet 2000', 'Captain-Underpants-and-the-Tyrannical-Retaliation-of-the-Turbo-Toilet-2000', 'http://books.google.com/books/content?id=B5fSngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=B5fSngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545504904', 'The monstrous Turbo Toilet 2000 is determined to take revenge on George, Harold, and Captain Underpants.', NULL, 345, 1, 5, 100.00, NULL, '2021-03-05 23:30:17', '2021-03-05 23:30:17'),
(435, 'Captain Underpants and the Sensational Saga of Sir Stinks-A-Lot (Captain Underpants #12)', 'Captain-Underpants-and-the-Sensational-Saga-of-Sir-Stinks-A-Lot-(Captain-Underpants-#12)', 'http://books.google.com/books/content?id=aKT7rQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aKT7rQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545504928', 'George and Harold and their doubles, Yesterday George and Yesterday Harold, have been taking turns going to school, but when the doubles fall prey to their gym teacher, Mr. Meaner, and his method of mind control that turns students into attentive, obedient, perfect children, it is up to original George and Harold to strike back.', NULL, 345, 1, 5, 100.00, NULL, '2021-03-05 23:30:17', '2021-03-05 23:30:17'),
(436, 'The Ballad of Songbirds and Snakes (a Hunger Games Novel)', 'The-Ballad-of-Songbirds-and-Snakes-(a-Hunger-Games-Novel)', 'http://books.google.com/books/content?id=j9xTxwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=j9xTxwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338635171', 'Untitled Panem Novel will revisit the world of Panem sixty-four years before the events of The Hunger Games, starting on the morning of the reaping of the Tenth Hunger Games.', NULL, 346, 1, 5, 100.00, NULL, '2021-03-05 23:30:17', '2021-03-05 23:30:17');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(437, 'Claudia and Mean Janine: Full Color Edition (the Baby-Sitters Club Graphix #4)', 'Claudia-and-Mean-Janine:-Full-Color-Edition-(the-Baby-Sitters-Club-Graphix-#4)', 'http://books.google.com/books/content?id=SpZErgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SpZErgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545886222', 'Claudia and her sister, Janine, may as well be from two different planets. Claudia, who pays more attention to her artwork and The Baby-sitters Club than her homework, feels like she can\'t compete with her perfect sister. Janine studies nonstop, gets straight As, and even takes college-level courses! But when something unexpected happens to the most beloved person in their family, will the sisters be able to put aside their differences? Raina Telgemeier, using the signature style featured in her acclaimed graphic novels Smile and Sisters, perfectly captures all the drama and charm of the original novel!', NULL, 347, 1, 5, 100.00, NULL, '2021-03-05 23:30:17', '2021-03-05 23:30:17'),
(438, 'The Baby-Sitters Club 3', 'The-Baby-Sitters-Club-3', 'http://books.google.com/books/content?id=gw_ZAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gw_ZAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545886215', 'For the very first time, The Baby-sitters Club graphic novels adapted by #1 NEW YORK TIMES bestselling and Eisner Award winning creator of SMILE, Raina Telgemeier, are available in full color! Who would have guessed that when the BSC girls get in a HUGE fight, it\'s shy and quiet Mary Anne who manages to save their friendship? When a terrible fight breaks out among the four BABY-SITTERS CLUB friends, Mary Anne is left to her own devices. She has to sit by herself at lunch, make new friends, and deal with her overprotective father without advice from the BSC gang. But the worst part is when she faces a terrible baby-sitting predicament, and she can\'t find any help. Luckily, Mary Anne rises to the occasion. Not only does she handle all her problems with aplomb, she also manages to get the BSC back together again.', NULL, 348, 1, 5, 100.00, NULL, '2021-03-05 23:30:18', '2021-03-05 23:30:18'),
(439, 'Boy-Crazy Stacey (the Baby-Sitters Club Graphic Novel #7): A Graphix Book', 'Boy-Crazy-Stacey-(the-Baby-Sitters-Club-Graphic-Novel-#7):-A-Graphix-Book', 'http://books.google.com/books/content?id=_LP0vwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_LP0vwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338304510', 'A brand-new graphic novel adapted by USA Today bestselling author Gale Galligan! Stacey and Mary Anne are baby-sitting for the Pike family for two weeks at the New Jersey shore. Things are great in Sea City: There\'s a gorgeous house right on the beach, a boardwalk, plenty of sun and sand... and the cutest boy Stacey has ever seen! Mary Anne thinks that Stacey should leave Scott alone and focus on the Pike kids, but Stacey\'s in love. Looking for reasons to hang around his lifeguard stand takes up all of her time, which means Mary Anne has to do the job of two baby-sitters. Mary Anne doesn\'t like it one bit! How can she tell Stacey that Scott just isn\'t interested without ruining their friendship and breaking Stacey\'s heart?', NULL, 348, 1, 5, 100.00, NULL, '2021-03-05 23:30:18', '2021-03-05 23:30:18'),
(440, 'The Dance of the Star Fairies', 'The-Dance-of-the-Star-Fairies', 'http://books.google.com/books/content?id=Ktn6vwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ktn6vwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338547016', 'There is a crisis in the Starlight Kingdom, one of the fantasy worlds: its stars, powered by a special kind of stardust, are fading and may soon go out forever, leaving the Kingdom in darkness--so the Thea sisters and Will Mystery set out for Brightstar Castle to discover what is wrong, but first they must overcome the obstacles and challenges that the fairies are placing in their way.', NULL, 349, 1, 5, 100.00, NULL, '2021-03-05 23:30:18', '2021-03-05 23:30:18'),
(441, 'The Secret of the Crystal Fairies (Thea Stilton Special Edition #7)', 'The-Secret-of-the-Crystal-Fairies-(Thea-Stilton-Special-Edition-#7)', 'http://books.google.com/books/content?id=xmlkswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xmlkswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338268591', 'Join Thea Stilton and the Thea Sisters on an adventure packed with fantasy and friendship!', NULL, 349, 1, 5, 100.00, NULL, '2021-03-05 23:30:19', '2021-03-05 23:30:19'),
(442, 'The Treasure Seekers', 'The-Treasure-Seekers', 'http://books.google.com/books/content?id=4BNutgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4BNutgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338306170', 'Join the Thea Sisters on their search for the seven missing treasures.', NULL, 349, 1, 5, 100.00, NULL, '2021-03-05 23:30:19', '2021-03-05 23:30:19'),
(443, 'Cyber Spies and Secret Agents of Modern Times', 'Cyber-Spies-and-Secret-Agents-of-Modern-Times', 'http://books.google.com/books/content?id=9D_aDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=9D_aDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781474736213', 'Explores the lives and daring deeds of spies of moder day using photos, original sources, maps, timelines, and little known facts.', NULL, 350, 1, 5, 100.00, NULL, '2021-03-05 23:30:19', '2021-03-05 23:30:19'),
(444, 'The Girl Who Speaks Bear', 'The-Girl-Who-Speaks-Bear', 'http://books.google.com/books/content?id=0bbKwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0bbKwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474940672', '', NULL, 351, 1, 5, 100.00, NULL, '2021-03-05 23:30:19', '2021-03-05 23:30:19'),
(445, 'The Unicorns of Blossom Wood: Best Friends', 'The-Unicorns-of-Blossom-Wood:-Best-Friends', 'http://books.google.com/books/content?id=Z1KkDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Z1KkDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407171258', 'An exciting new animal series set in the magical Blossom Wood. Lei, Isabelle and Cora are back in Blossom Wood for another adventure. Their friend Loulou the squirrel is organizing a talent show for all the animals. The three cousins can\'t wait to help, but what\'s the matter with Loulou? Can the Unicorns of Blossom Wood use their special powers to make Loulou happy again?', NULL, 352, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(446, 'Unicorns of Blossom Wood - Festival Time', 'Unicorns-of-Blossom-Wood---Festival-Time', 'http://books.google.com/books/content?id=xqycjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xqycjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407171234', 'An exciting new animal series set in the magical Blossom Wood. Isabelle, Lei and Cora are back in Blossom Wood - just in time for a magical festival. All of the animals are there, except for one. Lizzie the bunny is lost in Echo Mountains! Can the Unicorns of Blossom Wood use their magic to find her?', NULL, 352, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(447, 'A Friend in Need', 'A-Friend-in-Need', 'http://books.google.com/books/content?id=zdtctAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zdtctAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788000277', 'Alice is so excited to finally join the pony club with her gorgeous pony, Secret! Things get off to a great start when Alice is invited to super-popular Hannah\'s birthday party. But on the night of the party the snow starts to fall and a pony escapes into the night. Alice and Finn must go to the rescue but will their friendship survive the storm?', NULL, 353, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(448, 'A Ride to Freedom', 'A-Ride-to-Freedom', 'http://books.google.com/books/content?id=USFStgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=USFStgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788000437', 'It\'s summer time and Alice and Secret are going on a Pony Club trip to France. Alice is over the moon to be show-jumping at an international festival! She soon makes new friends, including the gorgeous Seb. But when Finn gets into trouble, Alice has to work out who her real friends are, and prove just how far she and Secret have come together.', NULL, 353, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(449, 'Buried Secrets', 'Buried-Secrets', 'http://books.google.com/books/content?id=cobZvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cobZvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338348590', 'Don\'t miss the thrilling finale to the Hello Neighbor prequel trilogy, based on the hit video game from tinyBuild! Nicky Roth should be happy--he\'s finally proven that his best friend, Aaron, and Aaron\'s younger sister, Mya, are missing. Better yet, the police are actually doing something: they\'ve plastered the town with missing posters, and have organized weekend search parties for the kids. But Nicky can\'t seem to pry his eyes from the house across the street, especially after he sees a frantic SOS coming from Aaron\'s room in the Peterson house. After what happened in the winter, and the warnings they got from their parents, Nicky\'s friends insist they can\'t help him investigate his neighbor anymore. If Nicky wants to find out what\'s going on in the Peterson house, he\'s going to have to do it alone. Don\'t miss the electrifying conclusion to the Hello Neighbor official prequel trilogy, which includes two-color illustrations throughout to help readers unwind the mystery at the heart of the game.', NULL, 354, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(450, 'Bad Blood', 'Bad-Blood', 'http://books.google.com/books/content?id=o1yfwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=o1yfwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338594287', 'A prequel to the video game Hello neighbor.', NULL, 354, 1, 5, 100.00, NULL, '2021-03-05 23:30:20', '2021-03-05 23:30:20'),
(451, 'Bunny Call (Five Nights at Freddy\'s: Fazbear Frights #5), Volume 5', 'Bunny-Call-(Five-Nights-at-Freddy\'s:-Fazbear-Frights-#5),-Volume-5', 'http://books.google.com/books/content?id=uCJrzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uCJrzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338576047', '', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:21', '2021-03-05 23:30:21'),
(452, 'Step Closer (Five Nights at Freddy\'s: Fazbear Frights #4)', 'Step-Closer-(Five-Nights-at-Freddy\'s:-Fazbear-Frights-#4)', 'http://books.google.com/books/content?id=_XIgyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_XIgyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338576054', 'Five Nights at Freddy\'s fans won\'t want to miss this pulse-pounding collection of three novella-length tales that will keep even the bravest FNAF player up at night... From twisted toys to gut-wrenching games, this collection of terrifying tales is unsettling enough to mess with even the most hardened Five Nights at Freddy\'s fans. In this volume, horror master Scott Cawthon spins three sinister novella-length stories from different corners of FNAF\'s canon. Each story comes complete with accompanying artwork from a fan-favorite game artist to bring the horror to life in a whole new way. Readers beware: In this startling world, desperate wishes have an unexpected cost, beautiful trinkets reveal appalling powers, and harmless pranks can go awry in ghastly ways.', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:21', '2021-03-05 23:30:21'),
(453, '1:35AM (Five Nights at Freddy\'s: Fazbear Frights #3)', '1:35AM-(Five-Nights-at-Freddy\'s:-Fazbear-Frights-#3)', 'http://books.google.com/books/content?id=BwTxxwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BwTxxwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338576030', 'Five Nights at Freddy\'s fans won\'t want to miss this pulse-pounding collection of three novella-length tales that will keep even the bravest FNAF player up at night... For Delilah, Stanley, and Devon, being left behind is practically a way of life. Orphaned from a young age and recently divorced, Delilah escapes deeper into her dreams each night, in desperate need of a wake-up call. Stanley is newly dumped, stuck in a dead-end job for a mysterious employer, and unable to connect with anyone. And Devon, abandoned by his dad and ignored by his mom, can\'t understand why love and friendship come so easily to everyone except him. Unfortunately, in the callous world of Five Nights at Freddy\'s, it\'s always in the depths of loneliness when evil creeps in. In this third volume, Five Nights at Freddy\'s creator Scott Cawthon spins three sinister novella-length stories from different corners of his series\' canon, featuring cover art from fan-favorite artist LadyFiszi. Readers beware: This collection of terrifying tales is enough to unsettle even the most hardened Five Nights at Freddy\'s fans.', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:21', '2021-03-05 23:30:21'),
(454, 'The Silver Eyes (Five Nights at Freddy\'s Graphic Novel #1)', 'The-Silver-Eyes-(Five-Nights-at-Freddy\'s-Graphic-Novel-#1)', 'http://books.google.com/books/content?id=-nNfwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-nNfwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338298482', 'Don\'t miss the first-ever graphic novel for Five Nights at Freddy\'s, an adaptation of the #1 New York Times bestselling novel The Silver Eyes illustrated by fan-favorite game artist Claudia Schröder! Ten years after the horrific murders at Freddy Fazbear\'s Pizza that ripped their town apart, Charlie -- whose father owned the restaurant -- and her childhood friends reunite on the anniversary of the tragedy and find themselves at the old pizza place which had been locked up and abandoned for years. After they discover a way inside, they realize that things are not as they used to be. The four adult-sized animatronic mascots that once entertained patrons have changed. They now have a dark secret... and a murderous agenda. Complete with new information and tense, terrifying illustrations, fans won\'t want to miss this graphic novel adaptation by Scott Cawthon, Kira Breed-Wrisley, and Claudia Schröder, whose stunning artwork has been featured in the games.', NULL, 355, 1, 5, 100.00, NULL, '2021-03-05 23:30:21', '2021-03-05 23:30:21'),
(455, 'Catching Fire', 'Catching-Fire', '', '', '9780545586177', 'By winning the Hunger Games, Katniss and Peeta have secured a life of safety and plenty for themselves and their families, but because they won by defying the rules, they unwittingly become the faces of an impending rebellion.', NULL, 346, 1, 5, 100.00, NULL, '2021-03-05 23:30:22', '2021-03-05 23:30:22'),
(456, 'Get Me Out of Here!', 'Get-Me-Out-of-Here!', 'http://books.google.com/books/content?id=c-PxoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=c-PxoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784750114', 'After sixth grade, the very worst year of his life, Rafe Khatchadorian thinks he has it made in seventh grade. He\'s been accepted to art school in the big city and imagines a math-and-history-free fun zone. Wrong! It\'s more competitive than Rafe ever expected, and to score big in class, he needs to find a way to turn his boring life into the inspiration for a work of art. His method? Operation: Get a Life! Anything he\'s never done before, he\'s going to do it, from learning to play poker to going to a modern art museum. But when his newest mission uncovers secrets about the family Rafe\'s never known, he has to decide if he\'s ready to have his world turned upside down. James Patterson\'s winning follow-up to Middle School: The Worst Years of My Life is another riotous and heart-warming story about living large.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:22', '2021-03-05 23:30:22'),
(457, 'Harry Potter and the Prisoner of Azkaban', 'Harry-Potter-and-the-Prisoner-of-Azkaban-9781408855676', 'http://books.google.com/books/content?id=tJjHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tJjHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855676', 'When the Knight Bus crashes through the darkness and screeches to a halt in front of him, it\'s the start of another far from ordinary year at Hogwarts for Harry Potter. Sirius Black, escaped mass-murderer and follower of Lord Voldemort, is on the run - and they say he is coming after Harry. In his first ever Divination class, Professor Trelawney sees an omen of death in Harry\'s tea leaves . But perhaps most terrifying of all are the Dementors patrolling the school grounds, with their soul-sucking kiss. These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON .', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:22', '2021-03-05 23:30:22'),
(458, 'Harry Potter and the Chamber of Secrets', 'Harry-Potter-and-the-Chamber-of-Secrets', 'http://books.google.com/books/content?id=SJnHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SJnHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855669', 'Celebrate 20 years of Harry Potter magic! Harry Potter\'s summer has included the worst birthday ever, doomy warnings from a house-elf called Dobby, and rescue from the Dursleys by his friend Ron Weasley in a magical flying car! Back at Hogwarts School of Witchcraft and Wizardry for his second year, Harry hears strange whispers echo through empty corridors - and then the attacks start. Students are found as though turned to stone ... Dobby\'s sinister predictions seem to be coming true.These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON ...', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:22', '2021-03-05 23:30:22'),
(459, 'Harry Potter and the Philosopher\'s Stone', 'Harry-Potter-and-the-Philosopher\'s-Stone', 'http://books.google.com/books/content?id=2ZjHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2ZjHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855652', 'Harry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry\'s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin!These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON .', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(460, 'Harry Potter and the Half-Blood Prince', 'Harry-Potter-and-the-Half-Blood-Prince', 'http://books.google.com/books/content?id=bZnHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bZnHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855706', 'Fantasy. Endnu en gang skal Harry Potter tilbage til troldmandsskolen Hogwart efter at have tilbragt nogle kedelige uger hos sin plejefamilie. Han glæder sig, men han ved heller ikke, hvilke uhyggelige oplevelser han har i vente', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(461, 'Crackin\' Castles', 'Crackin\'-Castles', 'http://books.google.com/books/content?id=bLUQkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bLUQkAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407166339', 'From Tintagel Castle in Cornwall to Skibo Castle in the Scottish highlands, Horrible Histories: Crackin\' Castles covers the history of Britain from the time of the Romans to the London Blitz. Filled with adventure, danger, magic, sieges, treachery, spies, revenge and much more besides - all in the classic Horrible Histories style! It\'s a seriously horrible read.', NULL, 359, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(462, 'School of Laughs', 'School-of-Laughs', '', '', '9781784754020', 'Teaching other kids how to be funny is the toughest gig that Jamie Grimm has ever had, and with the highest stakes. If he fails, his school library will be shut down for good!Even though he has a national contest trophy and a TV show under his belt, Jamie Grimm isn\'t one to sit back and relax. When his school has a major funding crisis, Jamie hits on a bright idea to save the day - a comedy class for the other students. Little does he know that making jokes and teaching jokes are two very different things... and he\'s only good at one of them.With the fate of his school\'s library on his shoulders, Jamie has to dig deep to see if he has what it takes to succeed at his most difficult challenge yet.', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(463, 'Laugh Out Loud', 'Laugh-Out-Loud', 'http://books.google.com/books/content?id=BU6KtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BU6KtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784758493', 'Jimmy loves reading so much that he\'s inspired to start a book company for kids - run by kids. It\'s a big dream for a twelve-year-old boy - some would even say it\'s laugh-out-loud ridiculous! But that doesn\'t stop Jimmy from dreaming even bigger! His company will be as imaginative and fun as Willy Wonka\'s chocolate factory... with a Ferris wheel instead of an elevator, a bowling alley in the break room, and a river filled with floating books! He just has to believe in himself and his idea. And maybe win the Lottery. In this hilarious story filled with clever references to children\'s book favourites, James Patterson shows young readers that anything can be achieved if you believe in yourself no matter what!', NULL, 357, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(464, 'Harry Potter and the Deathly Hallows', 'Harry-Potter-and-the-Deathly-Hallows', 'http://books.google.com/books/content?id=I5nHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=I5nHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855713', 'Burdened with the dark, dangerous, and seemingly impossible task of locating and destroying Voldemort\'s remaining Horcruxes, Harry, feeling alone and uncertain about his future, struggles to find the inner strength he needs to follow the path set out before him.', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:23', '2021-03-05 23:30:23'),
(465, 'Harry Potter and the Order of the Phoenix', 'Harry-Potter-and-the-Order-of-the-Phoenix', 'http://books.google.com/books/content?id=kpnHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kpnHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855690', 'Celebrate 20 years of Harry Potter magic! Dark times have come to Hogwarts. After the Dementors\' attack on his cousin Dudley, Harry Potter knows that Voldemort will stop at nothing to find him. There are many who deny the Dark Lord\'s return, but Harry is not alone: a secret order gathers at Grimmauld Place to fight against the Dark forces. Harry must allow Professor Snape to teach him how to protect himself from Voldemort\'s savage assaults on his mind. But they are growing stronger by the day and Harry is running out of time.These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON ...', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:24', '2021-03-05 23:30:24'),
(466, 'Harry Potter and the Goblet of Fire', 'Harry-Potter-and-the-Goblet-of-Fire', 'http://books.google.com/books/content?id=_pjHBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_pjHBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408855683', 'Celebrate 20 years of Harry Potter magic! The Triwizard Tournament is to be held at Hogwarts. Only wizards who are over seventeen are allowed to enter - but that doesn\'t stop Harry dreaming that he will win the competition. Then at Hallowe\'en, when the Goblet of Fire makes its selection, Harry is amazed to find his name is one of those that the magical cup picks out. He will face death-defying tasks, dragons and Dark wizards, but with the help of his best friends, Ron and Hermione, he might just make it through - alive!These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON ...', NULL, 358, 1, 5, 100.00, NULL, '2021-03-05 23:30:24', '2021-03-05 23:30:24'),
