(479, 'قلوب من ورق', 'قلوب-من-ورق', 'http://books.google.com/books/content?id=eg_cDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=eg_cDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952774', 'خمسةٌ من الأصدقاء كأصابع اليد الواحدة، في المدرسة وفي الشارع أيضًا، كلٌّ منهم يشبه اسمَه في معناه، دخل الهاتفُ حيا مَهت ففرَّقهم وكثُرت بينهم المشكلات، حتى جاءت مسابقة الطائرات، فشارك فيها الأصدقاء، كلُّ واحدٍ بطائرته... وفي السماء تجمَّعت الطائرات فأعادت ما كان من حُبٍّ بين الأصدقاء. هذه الحكاية حكاية قلوب فرَّقتها صفحة الفيسبوك الزرقاء واجتمعت في حُبٍّ على صفحة السماء', NULL, 491, 2, NULL, 100.00, NULL, '2021-03-05 23:30:45', '2021-03-05 23:30:45'),
(480, 'Music and Media in the Arab World', 'Music-and-Media-in-the-Arab-World', 'http://books.google.com/books/content?id=KANOAYzkhA8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=KANOAYzkhA8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774162930', 'Since the turn of the twentieth century the dramatic rise of mass media has profoundly transformed music practices in the Arab world. Music has adapted to successive forms of media disseminationfrom phonograph cylinders to MP3seach subjected to the political and economic forces of its particular era and region. Carried by mass media, the broader culture of Arab music has been thoroughly transformed as well. Simultaneously, mass mediated music has become a powerful social force. While parallel processes have unfolded worldwide, their implications in the Arabic-speaking world have thus far received little scholarly attention. This provocative volume features sixteen new essays examining these issues, especially televised music and the controversial new genre of the music video. Perceptive voicesboth emerging and establishedrepresent a wide variety of academic disciplines. Incisive essays by Egyptian critics display the textures of public Arabic discourse to an English readership. Authors address the key issues of contemporary Arab societygender and sexuality, Islam, class, economy, power, and nationas refracted through the culture of mediated music. Interconnected by a web of recurrent concepts, this collection transcends music to become an important resource for the study of contemporary Arab society and culture. Contributors: Wael Abdel Fattah, Yasser Abdel-Latif, Moataz Abdel Aziz, Tamim Al-Barghouti, Mounir Al Wassimi, Walter Armbrust, Elisabeth Cestor, Hani Darwish, Walid El Khachab, Abdel-Wahab Elmessiri, James Grippo, Patricia Kubala, Katherine Meizel, Zein Nassar, Ibrahim Saleh, Laith Ulaby.', NULL, 33, 1, NULL, 100.00, NULL, '2021-03-05 23:30:45', '2021-03-05 23:30:45'),
(481, 'Quichotte', 'Quichotte', 'http://books.google.com/books/content?id=DlnqwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DlnqwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781787331914', '***SHORTLISTED FOR THE BOOKER PRIZE 2019*** In a tour-de-force that is both an homage to an immortal work of literature and a modern masterpiece about the quest for love and family, Booker Prize-winning, internationally bestselling author Salman Rushdie has created a dazzling Don Quixote for the modern age. Inspired by the Cervantes classic, Sam DuChamp, mediocre writer of spy thrillers, creates Quichotte, a courtly, addled salesman obsessed with television, who falls in impossible love with the TV star Salman R. Together with his (imaginary) son Sancho, Quichotte sets off on a picaresque quest across America to prove worthy of her hand, gallantly braving the tragicomic perils of an age where \'Anything-Can-Happen\'. Meanwhile his creator, in a midlife crisis, has equally urgent challenges of his own. Just as Cervantes wrote Don Quixote to satirise the culture of his time, Rushdie takes the reader on a wild ride through a country on the verge of moral and spiritual collapse, with the kind of storytelling magic that is the hallmark of his work. The fully realised lives of DuChamp and Quichotte intertwine in a profoundly human quest for love and a wickedly entertaining portrait of an age in which fact is so often indiscernible from fiction. **A DAILY TELEGRAPH BOOK OF THE YEAR**', NULL, 34, 1, NULL, 100.00, NULL, '2021-03-05 23:30:45', '2021-03-05 23:30:45'),
(482, 'The Hunting Party', 'The-Hunting-Party', 'http://books.google.com/books/content?id=3VQCtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3VQCtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008297114', '*The Sunday Times Top 5 bestseller* EVERYONE\'S INVITED. EVERYONE\'S A SUSPECT. AND EVERYONE\'S TALKING ABOUT IT. \'Ripping, riveting\' A. J. Finn\'Clever, twisty and sleek\' Daily Mail\'Unputdownable\' John Boyne\'Foley is superb\' The Times\'Chilling\' Adele Parks\'Terrific, riveting\' Dinah Jefferies In a remote hunting lodge, deep in the Scottish wilderness, old friends gather. The beautiful oneThe golden coupleThe volatile oneThe new parentsThe quiet oneThe city boyThe outsider The victim. Not an accident - a murder among friends.', NULL, 35, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(483, 'Everything Under', 'Everything-Under', 'http://books.google.com/books/content?id=mZ7vswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mZ7vswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781910702345', '**SHORTLISTED FOR THE MAN BOOKER PRIZE 2018** \'Daisy Johnson is a new goddamn swaggering monster of fiction.\' Lauren Groff Words are important to Gretel, always have been. As a child, she lived on a canal boat with her mother, and together they invented a language that was just their own. She hasn\'t seen her mother since the age of sixteen, though - almost a lifetime ago - and those memories have faded. Now Gretel works as a lexicographer, updating dictionary entries, which suits her solitary nature. A phone call from the hospital interrupts Gretel\'s isolation and throws up questions from long ago. She begins to remember the private vocabulary of her childhood. She remembers other things, too: the wild years spent on the river; the strange, lonely boy who came to stay on the boat one winter; and the creature in the water - a canal thief? - swimming upstream, getting ever closer. In the end there will be nothing for Gretel to do but go back. Daisy Johnson\'s debut novel turns classical myth on its head and takes readers to a modern-day England unfamiliar to most. As daring as it is moving, Everything Under is a story of family and identity, of fate, language, love and belonging that leaves you unsettled and unstrung.', NULL, 36, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(484, 'Blink', 'Blink', 'http://books.google.com/books/content?id=z7G13xBtfkQC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=z7G13xBtfkQC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141014593', 'Intuition is not some magical property that arises unbidden from the depths of our mind. It is a product of long hours and intelligent design, of meaningful work environments and particular rules and principles. This book shows us how we can hone our instinctive ability to know in an instant, helping us to bring out the best in our thinking and become better decision-makers in our homes, offices and in everyday life. Just as he did with his revolutionary theory of the tipping point, Gladwell reveals how the power of ‘blink’ could fundamentally transform our relationships, the way we consume, create and communicate, how we run our businesses and even our societies.You’ll never think about thinking in the same way again.', NULL, 37, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(485, 'Girl, Woman, Other', 'Girl,-Woman,-Other', 'http://books.google.com/books/content?id=bmctugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bmctugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241364901', 'With her historic Booker win, Bernardine Evaristo is the author everyone is talking about. The standout book of 2019, Girl, Woman, Other is the number book you need to read this year. ***WINNER OF THE BOOKER PRIZE 2019*** SUNDAY TIMES BESTSELLER This is Britain as you\'ve never read it. This is Britain as it has never been told. From Newcastle to Cornwall, from the birth of the twentieth century to the teens of the twenty-first, Girl Woman Other follows a cast of twelve characters on their personal journeys through this country and the last hundred years. They\'re each looking for something - a shared past, an unexpected future, a place to call home, somewhere to fit in, a lover, a missed mother, a lost father, even just a touch of hope . . . \'Masterful . . . A choral love song to black womanhood in modern Great Britain\' Elle \'Exceptional. Ambitious, flowing and all-encompassing, an offbeat narrative that\'ll leave your mind in an invigorated whirl... [It] unites poetry, social history, women\'s voices and beyond. You have to order it right now\' Stylist \'Bernardine Evaristo can take any story from any time and turn it into something vibrating with life\' Ali Smith, author of How to be both \'Sparkling, inventive\' Sunday Times \'Funny, sad, tender and true, deserves to win awards\' Red \'Brims with vitality\' Financial Times SHORTLISTED FOR THE GORDON BURN PRIZE 2019', NULL, 38, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(486, 'Heroes of Olympus, The , Book Three: The Mark of Athena', 'Heroes-of-Olympus,-The-,-Book-Three:-The-Mark-of-Athena', '', '', '9781423140603', '\"The Greek and Roman demigods will have to cooperate in order to defeat the giants released by the Earth Mother, Gaea. Then they will have to sail together to the ancient land--Greece itself--to find the Doors of Death\"--', NULL, 39, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(487, 'The Thank You Economy', 'The-Thank-You-Economy', 'http://books.google.com/books/content?id=Z1AJB-S8RK4C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Z1AJB-S8RK4C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780061914188', 'If this were 1923, this book would have been called \"Why Radio Is Going to Change the Game\" . . . If it were 1995, it would be \"Why Amazon Is Going to Take Over the Retailing World\" . . . The Thank You Economy is about something big, something greater than any single revolutionary platform. It isn\'t some abstract concept or wacky business strategy—it\'s real, and every one of us is doing business in it every day, whether we choose to recognize it or not. It\'s the way we communicate, the way we buy and sell, the way businesses and consumers interact online and offline. The Internet, where the Thank You Economy was born, has given consumers back their voice, and the tremendous power of their opinions via social media means that companies and brands have to compete on a whole different level than they used to. Gone are the days when a blizzard of marketing dollars could be used to overwhelm the airwaves, shut out the competition, and grab customer awareness. Now customers\' demands for authenticity, originality, creativity, honesty, and good intent have made it necessary for companies and brands to revert to a level of customer service rarely seen since our great-grandparents\' day, when business owners often knew their customers personally, and gave them individual attention. Here renowned entrepreneur Gary Vaynerchuk reveals how companies big and small can scale that kind of personal, one-on-one attention to their entire customer base, no matter how large, using the same social media platforms that carry consumer word of mouth. The Thank You Economy offers compelling, data-driven evidence that we have entered into an entirely new business era, one in which the companies that see the biggest returns won\'t be the ones that can throw the most money at an advertising campaign, but will be those that can prove they care about their customers more than anyone else. The businesses and brands that harness the word-of-mouth power from social media, those that can shift their culture to be more customer-aware and fan-friendly, will pull away from the pack and profit in today\'s markets. Filled with Vaynerchuk\'s irrepressible candor and wit, as well as real-world examples of companies that are profiting by putting Thank You Economy principles into practice, The Thank You Economy reveals how businesses can harness all the changes and challenges inherent in social media and turn them into tremendous opportunities for profit and growth.', NULL, 40, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(488, 'Without a Country', 'Without-a-Country', 'http://books.google.com/books/content?id=ZxGrswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZxGrswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781503900974', 'From the international bestselling author of Last Train to Istanbul comes a novel based on true events that explores the depths of pride, devotion, and persistence as four generations of a family struggle to forge their destinies. As Hitler\'s reign of terror begins to loom large over Germany, Gerhard and Elsa Schliemann--like other German Jews--must flee with their children in search of sanctuary. But life elsewhere in Europe offers few opportunities for medical professor Gerhard and his fellow scientists. Then they discover an unexpected haven in Turkey, where universities and hospitals welcome them as valuable assets. But despite embracing their adopted land, personal and political troubles persist. Military coups bring unrest and uncertainty to the country, intermarriage challenges the cultural identity of Gerhard and Elsa\'s descendants, and anti-Semitism once again threatens their future in the place they call home. From World War II to the age of social media, one family\'s generations find their way through love and loss, sacrifice and salvation, tragedy and triumph--with knowledge hard won and passion heartfelt.', NULL, 41, 1, NULL, 100.00, NULL, '2021-03-05 23:30:46', '2021-03-05 23:30:46'),
(489, 'Cilka\'s Journey', 'Cilka\'s-Journey', 'http://books.google.com/books/content?id=q97swQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=q97swQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785769047', 'In 1942 Cilka is just sixteen years old when she is taken to Auschwitz-Birkenau Concentration Camp. The Commandant at Birkenau, Schwarzhuber, notices her long beautiful hair, and forces her separation from the other women prisoners. Cilka learns quickly that power, even unwillingly given, equals survival. After liberation, Cilka is charged as a collaborator for sleeping with the enemy and sent to a desolate, brutal prison camp in Siberia known as Vorkuta, inside the Arctic Circle. Innocent and imprisoned once again, Cilka faces challenges both new and horribly familiar. When she makes an impression on a female doctor, Cilka is taken under her wing and begins to tend to the ill in the camp, struggling to care for them under unimaginable conditions. Cilka finds endless resources within herself as she confronts death and faces terror, each day a battle for survival. And when she nurses a man called Aleksandr, Cilka finds that despite everything that has happened to her, there is room in her heart for love. Based on what is known of Cilka\'s time in Auschwitz, and on the experience of women in Siberian prison camps, Cilka\'s Journey is the breathtaking sequel to The Tattooist of Auschwitz. A powerful testament to the triumph of the human will in adversity, Cilka\'s Journey will make you weep, but it will also leave you with the remarkable story of one woman\'s fierce determination to survive, against all odds.', NULL, 42, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47'),
(490, 'It\'s the Manager', 'It\'s-the-Manager', 'http://books.google.com/books/content?id=UJc1vgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=UJc1vgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781595622242', 'Packed with 52 discoveries from Gallup’s largest study on the future of work, It’s the Manager shows leaders how to adapt their organizations to rapid change, ranging from new workplace demands to managing remote employees, a diverse workforce, the rise of artificial intelligence, gig workers, and attracting – and keeping – today’s best employees. Who is the most important person in your organization to lead your teams through these changes? Gallup research reveals: It’s your managers. While the world’s workplace has been going through extraordinary historical change, the practice of management has been stuck in time for more than 30 years. The new workforce – especially younger generations – wants their work to have deep mission and purpose, and they don’t want old-style command-and-control bosses. They want coaches who inspire them, communicate with them frequently, and develop their strengths. Packed with 52 discoveries from Gallup’s largest study on the future of work, It’s the Manager shows leaders how to adapt their organizations to rapid change, ranging from new workplace demands to the challenges of managing remote employees, a diverse workforce, the rise of artificial intelligence, gig workers, and attracting – and keeping – today’s best employees. Who is the most important person in your organization to lead your teams through these changes? Decades of global Gallup research reveal: It’s your managers. They are the ones who make or break your organization’s success. When you build great managers -- ones who can maximize the potential of every team member -- you will see organic revenue and profit growth, and you will deliver to a every one of your employees what they most want today: a great job and a great life. This is the future of work. It’s the Manager includes exclusive content from Gallup Access -- Gallup’s new workplace platform, chock full of additional content, tools, and solutions for business. Your book comes with a code for the CliftonStrengths assessment, which will reveal users’ Top 5 strengths.', NULL, 43, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47'),
(491, 'The Wild Remedy', 'The-Wild-Remedy', 'http://books.google.com/books/content?id=cqlluQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cqlluQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789290424', 'Emma Mitchell has suffered with depression for 25 years. In 2003, she left the city and began to take walks in the countryside around her new home, photographing, collecting and drawing as she went. Each walk was as medicinal as any talking therapy or pharmaceutical. Emma\'s moving and candid account of her year is a powerful testament to how reconnecting with nature may offer some answers to today\'s mental health epidemic. While charting her own seasonal highs and lows, she also explains the science behind such changes, calling on new research into such areas as forest bathing and the ways in which our bodies and minds respond to wildlife. Filled with Emma\'s beautiful drawings, paintings and photography, this is a truly unique book for anyone who has ever felt drawn to nature and wondered about its influence over us.', NULL, 44, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(492, 'Tiny Castles', 'Tiny-Castles', 'http://books.google.com/books/content?id=VnGxxwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VnGxxwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749581978', 'The very first compendium of Britain\'s most interesting diminutive castles, written in an amusing, accessible style. Praised by BBC Countryfile Magazine for writing \'intelligently and amusingly, with evident excitement and imagination\', Dixe Wills unleashes his trademark style on the tiniest castles in Britain. Beautifully presented in full colour throughout, the book uncovers over 60 of the country\'s loveliest and most compelling castles. No crumbling ruins are included here - only only relatively complete castles with enough features intact to explore and enjoy are listed, although all are delightfully diminutive. From Henry VIII\'s beautifully preserved St Mawes Castle in Cornwall to Scalloway Castle in Shetland, where it is said the blood and hair of the cruel Earl Patrick\'s tenants were used in the mortar., many of these tiny fortresses occupy a unique place in history.', NULL, 45, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47'),
(493, 'The President Is Missing', 'The-President-Is-Missing', 'http://books.google.com/books/content?id=BvDsswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BvDsswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781780898391', '\'The dream team delivers big time ... Clinton\'s insider secrets and Patterson\'s storytelling genius make this the political thriller of the decade.\' - Lee Child ________________________________ The President is Missing. The world is in shock. But the reason he\'s missing is much worse than anyone can imagine. With details only a President could know, and the kind of suspense only James Patterson can deliver. ________________________________ \'A bullet train of a thriller. The Day of the Jackal for the twenty-first century.\' - A.J. Finn, author of The Woman in the Window \'This book moves like Air Force One. Big and fast.\' - Michael Connelly, author of the Harry Bosch series \'The President Is Missing is a big, splashy juggernaut of a novel, combining thrills with a truly authentic look at the inner happenings in Washington. I read it in one gulp. You will too.\' - Harlan Coben, #1 bestselling author of Don\'t Let Go \'Yes, The President is Missing is fiction - it\'s a thriller - but James Patterson and I have come up with three of the most frightening days in the history of the presidency. And it could really happen... These days, the seemingly impossible can happen. And it happens so fast. I believe that readers will not soon forget President Jonathan Duncan and his story.\' - Bill Clinton \'Needless to say, we had some great conversations about the presidency, what life in Washington is really like, and about the state of America and the rest of the world.\' - James Patterson \'I felt like I was right along with the characters for the shocking twists and turns you\'ll never guess are coming. Patterson and Clinton have created a truly unique character in their \'missing\' President. The President is Missing puts the listener inside the White House and inside the mind of a President grappling with extraordinary circumstances.\' - Dennis Quaid on the audiobook of The President is Missing \'Relentless in its plotting and honest in its examination of issues that strike close to our hearts.\' - Jeffery Deaver \'A first-rate collaboration from a couple of real pros! Engrossing from page one.\' - David Baldacci \'vivid, engrossing - and authentically frightening.\' - Carl Hiaasen, author of Razor Girl \'The President is Missing is more than a thriller - it\'s a skeleton key that lets you inside the head of a U.S. president.\' - Brad Meltzer, author of The Escape Artist \'From the pens of two American icons comes a political thriller that rocks... a helluva story.\' - Nelson DeMille, author of The Cuban Affair \'The President Is Missing is heart-pounding, gripping, terrifying... a genuinely masterful thriller. My knuckles are still white!\' - Louise Penny, #1 bestselling author of Glass Houses \'Marry the political savvy of Bill Clinton with the craftsmanship of James Patterson and you get a fabulously entertaining thriller that is meticulous in its portrayal of Washington politics, gripping in its pacing, and harrowing in its depiction of the perils of cyberwarfare.\' - Ron Chernow, #1 bestselling and Pulitzer Prize-winning author of Alexander Hamilton and Grant \'Compelling from page one. A fantastic read!\' - Mary Higgins Clark, #1 bestselling author of I\'ve Got My Eyes on You', NULL, 46, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47'),
(494, 'Admissions', 'Admissions', 'http://books.google.com/books/content?id=NK7mnAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NK7mnAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474603867', 'Henry Marsh has spent a lifetime operating on the surgical frontline. There have been exhilarating highs and devastating lows, but his love for the practice of neurosurgery has never wavered. Prompted by his retirement from his full-time job in the NHS, and through his continuing work in Nepal and Ukraine, Henry has been forced to reflect more deeply about what forty years spent handling the human brain has taught him. Moving between encounters with patients in his London hospital, to those he treats in the more extreme circumstances of his work abroad, Henry faces up to the burden of responsibility that can come with trying to reduce human suffering. Unearthing memories of his early days as a medical student, and the experiences that shaped him as a young surgeon, he explores the difficulties of a profession that deals in probabilities rather than certainties, and where the overwhelming urge to prolong life can come at a tragic cost for both patients and for those who love them. In this searing, provocative and deeply personal memoir, the bestselling author of Do No Harm finds new purpose in his own life as he approaches the end of his professional career, and a fresh understanding of what matters to us all in the end.', NULL, 47, 1, NULL, 100.00, NULL, '2021-03-05 23:30:47', '2021-03-05 23:30:47'),
(495, 'Washington Black', 'Washington-Black', 'http://books.google.com/books/content?id=D7aUngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=D7aUngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781846689598', 'FROM THE MAN BOOKER AND ORANGE PRIZE SHORTLISTED AUTHOR OF HALF BLOOD BLUES\'A masterpiece\' Attica Locke\'High adventure fraught with cliffhanger twists mark this runaway-slave narrative, which leaps, sails, and soars ... broadens inventive possibilities for the antebellum novel\' Kirkus starred review When two English brothers take the helm of a Barbados sugar plantation, Washington Black - an eleven year-old field slave - finds himself selected as personal servant to one of these men. The eccentric Christopher \'Titch\' Wilde is a naturalist, explorer, scientist, inventor and abolitionist, whose single-minded pursuit of the perfect aerial machine mystifies all around him. Titch\'s idealistic plans are soon shattered and Washington finds himself in mortal danger. They escape the island together, but then then Titch disappears and Washington must make his way alone, following the promise of freedom further than he ever dreamed possible. From the blistering cane fields of Barbados to the icy wastes of the Canadian Arctic, from the mud-drowned streets of London to the eerie deserts of Morocco, Washington Black teems with all the strangeness and mystery of life. Inspired by a true story, Washington Black is the extraordinary tale of a world destroyed and made whole again.', NULL, 48, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(496, 'The Overstory', 'The-Overstory', 'http://books.google.com/books/content?id=jO7FwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jO7FwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785151637', 'SHORTLISTED FOR THE MAN BOOKER PRIZE 2018\'Autumn makes me think of leaves, which makes me think of trees, which makes me think of The Overstory,the best novel ever written about trees, and really, just one of the best novels, period.? - Ann Patchett\'It\'s a masterpiece.\' - Tim Winton\'It?s not possible for Powers to write an uninteresting book.\' - Margaret AtwoodA monumental novel about trees and people by one of our most \'prodigiously talented\' (The New York Times Book Review) novelists.The Overstoryunfolds in concentric rings of interlocking fables that range from antebellum New York to the late twentieth-century Timber Wars of the Pacific Northwest and beyond-An Air Force loadmaster in the Vietnam War is shot out of the sky, then saved by falling into a banyan.An artist inherits a hundred years of photographic portraits, all of the same doomed American chestnut.A hard-partying undergraduate in the late 1980s electrocutes herself, dies and is sent back into life by creatures of air and light.A hearing- and speech-impaired scientist discovers that trees are communicating with one another.These four, and five other strangers - each summoned in different ways by trees - are brought together in a last and violent stand to save the continent?s few remaining acres of virgin forest.There is a world alongside ours - vast, slow, interconnected, resourceful, magnificently inventive and almost invisible to us. This is the story of a handful of people who learn how to see that world and who are drawn up into its unfolding catastrophe.', NULL, 49, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(497, 'The Flower Girls', 'The-Flower-Girls', 'http://books.google.com/books/content?id=YCCFDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YCCFDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781526602145', '\'Tense, intriguing and memorable. I couldn\'t put it down\' Sophie HannahTHREE CHILDREN WENT OUT TO PLAY. ONLY TWO CAME BACK. The Flower Girls. Laurel and Primrose. One convicted of murder, the other given a new identity.Now, nineteen years later, another child has gone missing.And the Flower Girls are about to hit the headlines all over again...', NULL, 50, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(498, 'The Caldera', 'The-Caldera', 'http://books.google.com/books/content?id=TTA7DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TTA7DwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780399163586', 'On a mission to rescue Empress Justina\'s son from his pirate kidnappers, Hal and the brotherband crew set sail amid stormy seas to the island of Santorillos where they encounter a formidable obstacle, a caldera.', NULL, 51, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(499, 'Yaqui Delgado Wants to Kick Your Ass', 'Yaqui-Delgado-Wants-to-Kick-Your-Ass', 'http://books.google.com/books/content?id=1DMS_CTfmwkC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1DMS_CTfmwkC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780763658595', 'Informed that a bully she does not know is determined to beat her up Latin American teen Piddy Sanchez struggles to learn more about the father she has never met, until the bully\'s gang forces her to confront more difficult challenges.', NULL, 52, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(500, 'I See You', 'I-See-You', 'http://books.google.com/books/content?id=b1wRswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=b1wRswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751554144', 'The twisty, gripping number one bestseller from Richard and Judy Book Club winner Clare Mackintosh, author of I Let You Go. When Zoe Walker sees her photo in the classifieds section of a London newspaper, she is determined to find out why it\'s there. There\'s no explanation: just a grainy image, a website address and a phone number. She takes it home to her family, who are convinced it\'s just someone who looks like Zoe. But the next day the advert shows a photo of a different woman, and another the day after that. Is it a mistake? A coincidence? Or is someone keeping track of every move they make . . . If you like Shari Lapena, Paula Hawkins, Rachel Abbott, B A Paris, Fiona Barton, Ruth Ware and CL Taylor, you\'ll love this gripping psychological thriller. **Let Me Lie, the sensational third thriller by Clare Mackintosh is available for pre-order now** Praise for I See You: \'[Clare Mackintosh] hits the jackpot again with a breathless thriller based on a brilliant idea . . . This is an excellent race-against-time thriller with shoals of red herrings to tease and taunt readers all the way. It\'s a must-finish-at-all-costs job\' Daily Mail \'A chilling and original story that should make everybody reconsider the predictability of their behaviour - kept me reading until dawn\', Rachel Abbott, author of The Sixth Window \'Accomplished, Addictive and Thought-Provoking - you\'ll never feel the same about taking the tube again\' B A Paris, author of The Breakdown and Behind Closed Doors \'I See You stands out from the crowd with flawless plotting and an eye for detail which will send a satisfying chill through its readers. I loved it!\' Renee Knight, author of Disclaimer \'Wonderfully sinister. Had me looking over my shoulder every time I travelled on the tube\' Fiona Barton, author of The Widow \'Compelling and suffused with menace\' Sunday Mirror \'Heart-stoppingly excellent\' CL Taylor, author of The Lie \'I See You is both a compelling portrayal of modern family life and a superbly twisty thriller that keeps you guessing until the very last page. An edge of the seat read\' Kate Hamer, author of The Girl in the Red Coat \'Anyone who\'s ever looked over their shoulder when they heard footsteps behind them, or quickened their pace in a deserted underpass, will shudder with recognition at Clare Mackintosh\'s deliciously creepy tale of urban paranoia\' Ruth Ware, author of In a Dark, Dark Wood \'I was gripped from the very first page. Creepy and compelling with a twist I didn\'t see coming. I loved it\' Claire Douglas, author of The Sisters \'As creepy as they come . . . We raced through this deeply unsettling thriller in two days . . . and looked over our shoulder the whole time\' Heat \'Another edge-of-your-seat thriller . . . a terrifyingly plausible plot and gasp-inducing ending\' Good Housekeeping \'With I See You, Clare Mackintosh has achieved something not every author can and produced a book superior to her phenomenal debut. I had chills the entire way through and I can\'t wait to read whatever she comes up with next\' Jenny Blackhurst, author of How I Lost You', NULL, 53, 1, NULL, 100.00, NULL, '2021-03-05 23:30:48', '2021-03-05 23:30:48'),
(501, 'Stone Mothers', 'Stone-Mothers', 'http://books.google.com/books/content?id=LbuXwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LbuXwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444797305', '\'The Victorians used to call their mental hospitals stone mothers,\' I say. \'They thought the design of the building could literally nurse the sick back to health.\' Marianne grew up in the shadow of the old asylum, a place that still haunts her dreams. She was seventeen when she fled the town, her family, her boyfriend Jesse and the body they buried. Now, forced to return, she can feel the past closing around her. And Jesse, who never forgave her for leaving, is finally threatening to expose the truth. Marianne will do anything to protect the life she\'s built; the husband and daughter who must never know. Even if it means turning to her worst enemy... But Marianne may not know the whole story - and she isn\'t the only one with secrets they\'d kill to keep. A lifetime ago, a patient escaped Nazareth mental asylum. They covered their tracks carefully. Or so they thought. Thirty years ago, Marianne Smy committed a crime then fled from her home to leave the past behind. Or so she thought. Now, Marianne has been forced to return. Nazareth asylum has been converted to luxury flats, but its terrible hold on her is still strong. A successful academic, a loving mother and a loyal wife, she fears her secret being revealed and her world shattering. She is right to be scared.', NULL, 54, 1, NULL, 100.00, NULL, '2021-03-05 23:30:49', '2021-03-05 23:30:49'),
(502, 'Tidelands', 'Tidelands', 'http://books.google.com/books/content?id=r1WnxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=r1WnxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471172755', '\'Gregory is an experienced storyteller and doesn\'t let you down. Tidelands is a gripping and intelligent portrait of a woman fighting to survive in a hostile world\' THE TIMES THE BRAND NEW SERIES FROM THE SUNDAY TIMES NUMBER ONE BESTSELLING AUTHOR England 1648. A dangerous time for a woman to be different . . . Midsummer\'s Eve, 1648, and England is in the grip of civil war between renegade King and rebellious Parliament. The struggle reaches every corner of the kingdom, even to the remote Tidelands - the marshy landscape of the south coast. Alinor, a descendant of wise women, crushed by poverty and superstition, waits in the graveyard under the full moon for a ghost who will declare her free from her abusive husband. Instead she meets James, a young man on the run, and shows him the secret ways across the treacherous marsh, not knowing that she is leading disaster into the heart of her life. Suspected of possessing dark secrets in superstitious times, Alinor\'s ambition and determination mark her out from her neighbours. This is the time of witch-mania, and Alinor, a woman without a husband, skilled with herbs, suddenly enriched, arouses envy in her rivals and fear among the villagers, who are ready to take lethal action into their own hands. \'The first in a planned series . . . The author crafts her material with effortless ease. Her grasp of social mores is brilliant, the love story rings true and the research is, as ever, of the highest calibre\' Elizabeth Buchan, Daily Mail \'Vivid and beguiling - Philippa Gregory at her best\' woman&home \'A compelling novel that shines a light on the struggles of 17th century women\' Daily Mirror \'The novel\'s power lies in Gregory\'s evocative portrayal of the tidelands and the everyday lives of those who are bound to them\' Sunday Express \'Philippa Gregory returns with an English Civil War novel that excels in everything she does best. Historical events are written with breathless immediacy, keeping the reader enthralled even if they know the outcome. She pays close attention to the plight of women in the past, so often unchanged despite men\'s wars, and gives them a voice . . . Fans will not be disappointed\' Alys Key, The i \'Shines a light on the struggles of 17th century women . . . If this novel is the first sign of what\'s to come then readers are in for a treat\' Emma Lee-Potter, Daily Express \'Tidelands evokes a world of suspense and superstition. Its fascinating fictional heroine, Alinor, is caught in a net of in-between spaces . . . I was completely swept up in this wonderful, immersive story set in the English Civil War when women who lived unconventional lives risked being accused of witchcraft\' Tina Jackson, Writing Magazine', NULL, 55, 1, NULL, 100.00, NULL, '2021-03-05 23:30:49', '2021-03-05 23:30:49'),
(503, 'Phaedra Patrick Book 4', 'Phaedra-Patrick-Book-4', 'http://books.google.com/books/content?id=wnWQwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wnWQwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008237677', '\'A wonderfully hope-filled story\' Sarah Haywood, bestselling author \'This charming novel will warm your heart\' The People\'s Friend \'The perfect summer read!\' Suzy K Quinn, bestselling author ***', NULL, 56, 1, NULL, 100.00, NULL, '2021-03-05 23:30:49', '2021-03-05 23:30:49'),
(504, 'No Fear Shakespeare Much Ado about Nothing', 'No-Fear-Shakespeare-Much-Ado-about-Nothing', '', '', '9781411401013', 'Presents the original text of Shakespeare\'s play side by side with a modern version, with marginal notes and explanations and full descriptions of each character.', NULL, 492, 1, NULL, 100.00, NULL, '2021-03-05 23:30:49', '2021-03-05 23:30:49'),
(505, 'A Place Called Perfect', 'A-Place-Called-Perfect', 'http://books.google.com/books/content?id=g3W9tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=g3W9tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474924160', 'Violet never wanted to move to Perfect. Who wants to live in a town where everyone has to wear glasses to stop them going blind? And who wants to be neat and tidy and perfectly behaved all the time? Violet quickly discovers there\'s something weird going on in the town - she keeps hearing voices, her mam is acting strange and her dad has disappeared. When she meets Boy she realizes that her dad is not the only person to have vanished ... and that the mysterious Watchers are guarding a perfectly creepy secret!', NULL, 58, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(506, 'The Prison Doctor', 'The-Prison-Doctor', 'http://books.google.com/books/content?id=QO_7uQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QO_7uQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008311445', 'SUNDAY TIMES TOP TEN BESTSELLER As seen on BBC Breakfast Horrifying, heartbreaking and eye-opening, these are the stories, the patients and the cases that have characterised a career spent being a doctor behind bars. Violence. Drugs. Suicide. Welcome to the world of a Prison Doctor. Dr Amanda Brown has treated inmates in the UK\'s most infamous prisons - first in young offenders\' institutions, then at the notorious Wormwood Scrubs and finally at Europe\'s largest women-only prison in Europe, Bronzefield. From miraculous pregnancies to dirty protests, and from violent attacks on prisoners to heartbreaking acts of self-harm, she has witnessed it all. In this eye-opening, inspirational memoir, Amanda reveals the stories, the patients and the cases that have shaped a career helping those most of us would rather forget. Despite their crimes, she is still their doctor. p> Despite their crimes, she is still their doctor.', NULL, 59, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(507, 'Where the Crawdads Sing', 'Where-the-Crawdads-Sing', 'http://books.google.com/books/content?id=v3nZvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=v3nZvQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472154668', '*The multi-million copy bestseller* Soon to be a major film A Number One New York Times Bestseller \'Painfully beautiful\' New York Times \'Unforgettable . . . as engrossing as it is moving\' Daily Mail \'A rare achievement\' The Times \'I can\'t even express how much I love this book!\' Reese Witherspoon ------------------------------------------------- For years, rumors of the \'Marsh Girl\' have haunted Barkley Cove, a quiet town on the North Carolina coast. So in late 1969, when handsome Chase Andrews is found dead, the locals immediately suspect Kya Clark, the so-called Marsh Girl. But Kya is not what they say. Sensitive and intelligent, she has survived for years alone in the marsh that she calls home, finding friends in the gulls and lessons in the sand. Then the time comes when she yearns to be touched and loved. When two young men from town become intrigued by her wild beauty, Kya opens herself to a new life - until the unthinkable happens. ------------------------------------------------- \'[It] will reach a huge audience though the writer\'s old-fashioned talents for compelling character, plotting and landscape description\' The Guardian \'For sheer escapism pick up Where The Crawdads Sing . . . there is writing that takes your breath away\' The Times \'All is not as it seems in this heartbreaking coming-of-age bestseller\' The i newspaper', NULL, 60, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(508, 'I Let You Go', 'I-Let-You-Go', 'http://books.google.com/books/content?id=p0KxoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=p0KxoQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751554151', 'THE SENSATIONAL SUNDAY TIMES BESTSELLER A tragic accident. It all happened so quickly. She couldn\'t have prevented it. Could she? In a split second, Jenna Gray\'s world descends into a nightmare. Her only hope of moving on is to walk away from everything she knows to start afresh. Desperate to escape, Jenna moves to a remote cottage on the Welsh coast, but she is haunted by her fears, her grief and her memories of a cruel November night that changed her life forever. Slowly, Jenna begins to glimpse the potential for happiness in her future. But her past is about to catch up with her, and the consequences will be devastating . . .', NULL, 53, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(509, 'The Words That Fly Between Us', 'The-Words-That-Fly-Between-Us', 'http://books.google.com/books/content?id=2UF2tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2UF2tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471160646', 'A beautiful, powerful story about finding the strength and words to face your fears, from the author of The Girl in Between From the outside, it looks like Lucy has the perfect life. She has everything. Everything that money can buy. But money can\'t buy Lucy the words she needs to stand up to her bully of a father, the words to escape her suffocating family life, the words to become the person she wants to be. Then Lucy finds an escape route. Every attic on her street is connected, and as she starts to explore the secret lives of her neighbours, Lucy realizes that she is not the only one to suffer in silence. But can she find the strength to climb down and face her fears? \"A wonderful, thought-provoking family drama about finding the power to stand up for yourself\" - Katherine Webber \'Written with a startling observance and bright-hearted clarity, this quietly uplifting book depicts the unspoken tensions, and fears in Lucy\'s seemingly perfect, affluent home\' - Cerrie Burnell​ Praise for The Girl in Between: \'Perfect for fans of David Almond and Katherine Rundell\' - The Guardian \'A compelling and heart-breaking debut with an unexpecting twist, reminiscent of A Monster Calls\' - Glamour magazine \'Pitch-perfect Dublin voice\' - Irish Times \'The Girl in Between\'grabbed me from the start and held on so tight it left bruises\' - Geraldine McCaughrean \'In turns beautiful, devastating and ultimately uplifting, The Girl in Between demands re-reading\' - Zana Fraillon, author of The Bone Sparrow \'Dark, sometimes profound, this is the kind of book that envelops readers in its world, sending them blinking into the light with the voice and images still ringing in their heads\' LoveReading4Kids.co.uk \'A descriptive story that\'s intriguing, emotionally engaging ... with a twist at the end.\' The Book Bag', NULL, 61, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(510, 'The Duchess', 'The-Duchess', 'http://books.google.com/books/content?id=wVXgswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wVXgswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509800278', 'Orphaned. Betrayed. Determined. Angélique Latham grew up at the magnificent Belgrave Castle with her father, the Duke of Westerfield, after the death of her mother. But when he dies, her half-brothers brutally deny her very existence and send her out into the world alone. At eighteen, Angélique has a keen mind, remarkable beauty and an envelope of money her late father pressed upon her. Unable to secure employment, Angélique desperately makes her way to Paris. To survive, she will need all her resources - and one bold stroke of fortune. Angélique takes an unfamiliar and unimaginable path in setting up what becomes a highly successful business. But she lives on the edge of scandal; can she ever make a life for herself? From England to Paris and New York, Danielle Steel paints a captivating portrait of a woman of unquenchable spirit in The Duchess.', NULL, 62, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(511, 'Our Stop', 'Our-Stop', 'http://books.google.com/books/content?id=OQz0uQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OQz0uQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008320522', '\'Joyful, romantic and life-affirming.\' Red Magazine \'It had me totally gripped.\' Beth O\'Leary, author of The Flatshare \'A love story that is guaranteed to make you smile.\' Closer What if you almost missed the love of your life? Nadia gets the 7.30 train every morning without fail. Well, except if she oversleeps or wakes up at her friend Emma\'s after too much wine. Daniel really does get the 7.30 train every morning, which is easy because he hasn\'t been able to sleep properly since his dad died. One morning, Nadia\'s eye catches sight of a post in the daily paper: To the cute girl with the coffee stains on her dress. I\'m the guy who\'s always standing near the doors... Drink sometime? So begins a not-quite-romance of near-misses, true love, and the power of the written word. A #1 ebook bestseller, this wonderful will-they-won\'t-they romance is perfect for those who loved Beth O\'Leary\'s The Flatshare and Mhairi McFarlane\'s Don\'t You Forget About Me. ****** What readers are saying about Our Stop... \'What a gorgeous, quirky and heart-warming story. It\'s a Sliding Doors for our modern generation and I greedily devoured every page.\' \'Honest, refreshing, brave, progressive, insightful, warm, uplifting and, above all, inspirational. A book that has genuinely had a positive impact on my life. A must-read!\' \'This book delivered in bucket loads - and then some! It is funny, thoughtful, witty, charming and respectful, and was a thoroughly entertaining read that I would really love to see adapted into a film someday!\' \'This is not your stereotypical boy-meets-girl chick lit ... This is an innovative, modern day Sliding Doors style chick lit where you follow the #OurStop journey with Daniel and Nadia.\' \'This book is an ode to You\'ve Got Mail!! It was funny, romantic, simple, yet filled with so much emotion.\'', NULL, 63, 1, NULL, 100.00, NULL, '2021-03-05 23:30:50', '2021-03-05 23:30:50'),
(512, 'The Red Scrolls of Magic', 'The-Red-Scrolls-of-Magic', 'http://books.google.com/books/content?id=DdPEwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DdPEwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471162169', 'From #1 New York Times bestseller Cassandra Clare and award-winner Wesley Chu comes the first book in a new series that follows High Warlock Magnus Bane and Alec Lightwood as they tour the world after the Mortal War. The Red Scrolls of Magic is a Shadowhunters novel. All Magnus Bane wanted was a vacation--a lavish trip across Europe with Alec Lightwood, the Shadowhunter who against all odds is finally his boyfriend. But as soon as the pair settles in Paris, an old friend arrives with news about a demon-worshipping cult called the Crimson Hand that is bent on causing chaos around the world. A cult that was apparently founded by Magnus himself. Years ago. As a joke. Now Magnus and Alec must race across Europe to track down the Crimson Hand and its elusive new leader before the cult can cause any more damage. As if it wasn\'t bad enough that their romantic getaway has been sidetracked, demons are now dogging their every step, and it is becoming harder to tell friend from foe. As their quest for answers becomes increasingly dire, Magnus and Alec will have to trust each other more than ever--even if it means revealing the secrets they\'ve both been keeping.', NULL, 64, 1, NULL, 100.00, NULL, '2021-03-05 23:30:51', '2021-03-05 23:30:51'),
(513, 'The Other Alice', 'The-Other-Alice', 'http://books.google.com/books/content?id=TW_8rQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TW_8rQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471124273', 'What happens when a tale with real magic, that was supposed to be finished, never was? This is a story about one of those stories . . . Midge loves riddles, his cat, Twitch, and - most of all - stories. Especially because he\'s grown up being read to by his sister Alice, a brilliant writer. When Alice goes missing and a talking cat turns up in her bedroom, Midge searches Alice\'s stories for a clue. Soon he discovers that her secret book, The Museum of Unfinished Stories, is much more than just a story. In fact, he finds two of its characters wandering around town. But every tale has its villains - and with them leaping off the page, Midge, Gypsy and Piper must use all their wits and cunning to work out how the story ends and find Alice. If they fail, a more sinister finale threatens them all . . . A rich and twisting tale of magic, riddles and the power of imagination, from a classic author. \'An exciting, original, gripping adventure, embroidered with riddles and curses, laced with dry wit, and which gallops along at a terrific pace\'Daily Mail \'Beautifully written... a true testament to the power of storytelling\' Guardian \'A story brimming with magic, riddles and extremely mischievous ink. Wonderful storytelling\' Abi Elphinstone, author of the Dreamsnatcher series', NULL, 65, 1, NULL, 100.00, NULL, '2021-03-05 23:30:51', '2021-03-05 23:30:51'),
(514, '100 Ways to Be As Happy As Your Dog', '100-Ways-to-Be-As-Happy-As-Your-Dog', 'http://books.google.com/books/content?id=TQsXtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TQsXtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473689190', '\"Animal behaviour expert and bestselling author Celia Haddon shows you 100 ways in which you, too, can master the art of being happy by learning from your favourite canine companions.\"--Provided by publisher.', NULL, 66, 1, NULL, 100.00, NULL, '2021-03-05 23:30:51', '2021-03-05 23:30:51'),
(515, 'The Idiot Brain', 'The-Idiot-Brain', 'http://books.google.com/books/content?id=C5o_vgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=C5o_vgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781783350827', 'SHORTLISTED FOR THE GOODREADS BEST SCIENCE & TECHNOLOGY BOOK AWARD Motion sickness. Nightmares. Forgetting people\'s names. Why did I walk into this room? For something supposedly so brilliant and evolutionarily advanced, the human brain is pretty messy, fallible and disorganised. In The Idiot Brain neuroscientist Dean Burnett celebrates the imperfections of the human brain in all their glory, and the impact of these quirks on our daily lives. Expertly researched and entertainingly written, this book is for anyone who has wondered why their brain seems to be sabotaging their life, and what on earth it is really up to.', NULL, 67, 1, NULL, 100.00, NULL, '2021-03-05 23:30:51', '2021-03-05 23:30:51'),
(516, 'The Perfect Wife', 'The-Perfect-Wife', 'http://books.google.com/books/content?id=aFV8wgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aFV8wgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786488558', 'THE ENTHRALLING NEW PSYCHOLOGICAL THRILLER FROM THE BESTSELLING AUTHOR OF THE GIRL BEFORE \"There\'s something I have to explain, my love,\" he says, taking your hand in his. \"That wasn\'t a dream. It was an upload.\" Abbie wakes in a hospital bed with no memory of how she got there. The man by her side explains that he\'s her husband. He\'s a titan of the tech world, the founder of one of Silicon Valley\'s most innovative startups. He tells Abbie she\'s a gifted artist, a doting mother to their young son, and the perfect wife. Five years ago, she suffered a terrible accident. Her return from the abyss is a miracle of science, a breakthrough in artificial intelligence that has taken him half a decade to achieve. But as Abbie pieces together memories of her marriage, she begins questioning her husband\'s motives - and his version of events. Can she trust him when he says he wants them to be together for ever? And what really happened to her, half a decade ago? ********** See what everyone is saying about JP Delaney, the hottest new name in psychological thrillers: \'DAZZLING\' - Lee Child \'ADDICTIVE\' - Daily Express \'DEVASTATING\' - Daily Mail \'INGENIOUS\' - New York Times \'COMPULSIVE\' - Glamour Magazine \'ELEGANT\' - Peter James \'SEXY\' - Mail on Sunday \'ENTHRALLING\' - Woman and Home \'ORIGINAL\' - The Times \'RIVETING\' - Lisa Gardner \'CREEPY\' - Heat \'SATISFYING\' - Reader\'s Digest \'SUPERIOR\' - The Bookseller \'MORE THAN A MATCH FOR PAULA HAWKINS\' - Sunday Times', NULL, 68, 1, NULL, 100.00, NULL, '2021-03-05 23:30:51', '2021-03-05 23:30:51'),
(517, 'Transcription', 'Transcription', 'http://books.google.com/books/content?id=kwxwuQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kwxwuQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552776653', '\"In 1940, eighteen-year old Juliet Armstrong is reluctantly recruited into the world of espionage. Sent to an obscure department of MI5 tasked with monitoring the comings and goings of British Fascist sympathisers, she discovers the work to be by turns both tedious and terrifying. But after the war has ended, she presumes the events of those years have been relegated to the past forever. Ten years later, now a radio producer at the BBC, Juliet is unexpectedly confronted by figures from her past. A different war is being fought now, on a different battleground, but Juliet finds herself once more under threat. A bill of reckoning is due, and she finally begins to realise that there is no action without consequence.\" --Cover.', NULL, 69, 1, NULL, 100.00, NULL, '2021-03-05 23:30:52', '2021-03-05 23:30:52'),
(518, 'Butterfly in Frost', 'Butterfly-in-Frost', 'http://books.google.com/books/content?id=RskoxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=RskoxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781542016735', 'From #1 New York Times bestselling phenomenon Sylvia Day comes a hotly anticipated and passionate new love story. Once, I would never have imagined myself here. But I\'m settled now. In a place I love, in a home I renovated, spending time with new friends I adore, and working a job that fulfills me. I am reconciling the past and laying the groundwork for the future. Then Garrett Frost moves in next door. He\'s obstinate and too bold, a raging force of nature that disrupts the careful order of my life. I recognize the ghosts that haunt him, the torment driving him. Garrett would be risky in any form, but wounded, he\'s far more dangerous. I fear I\'m too fragile for the storm raging inside him, too delicate to withstand the pain that buffets him. But he\'s too determined...and too tempting. And sometimes hope soars above even the iciest desolation. Emotional and heartrending, Butterfly in Frost marks a brilliant return by global sensation Sylvia Day, the #1 international multimillion bestselling author of the Crossfire saga.', NULL, 70, 1, NULL, 100.00, NULL, '2021-03-05 23:30:52', '2021-03-05 23:30:52'),
(519, 'The Marshmallow Test', 'The-Marshmallow-Test', 'http://books.google.com/books/content?id=oaiGCgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oaiGCgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552168861', 'A child is presented with a marshmallow and given a choice: Eat this one now, or wait and enjoy two later. What will she do? And what are the implications for her behaviour later in life? Walter Mischel\'s now iconic \'marshmallow test,\' one of the most famous experiments in the history of psychology, proved that the ability to delay gratification is critical to living a successful and fulfilling life: self-control not only predicts higher marks in school, better social and cognitive functioning, and a greater sense of self-worth; it also helps us manage stress, pursue goals more effectively, and cope with painful emotions. But is willpower prewired, or can it be taught? In his groundbreaking new book, Dr. Mischel draws on decades of compelling research and life examples to explore the nature of willpower, identifying the cognitive skills and mental mechanisms that enable it and showing how these can be applied to challenges in everyday life--from weight control to quitting smoking, overcoming heartbreak, making major decisions, and planning for retirement. With profound implications for the choices we make in parenting, education, public policy and self-care, The Marshmallow Test will change the way we think about who we are and what we can be. And since, as Mischel argues, a life with too much self-control can be as unfulfilling as one with too little, this book will also teach you when it\'s time to ring the bell and enjoy that marshmallow.', NULL, 71, 1, NULL, 100.00, NULL, '2021-03-05 23:30:52', '2021-03-05 23:30:52'),
(520, 'The Guest List', 'The-Guest-List', 'http://books.google.com/books/content?id=S3w4zQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=S3w4zQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008297190', '', NULL, 35, 1, NULL, 100.00, NULL, '2021-03-05 23:30:52', '2021-03-05 23:30:52'),
(521, 'Me Before You', 'Me-Before-You', 'http://books.google.com/books/content?id=8GNA-OzYFuwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8GNA-OzYFuwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780718157838', 'Lou Clark knows lots of things. She knows how many footsteps there are between the bus stop and home. She knows she likes working in The Buttered Bun tea shop and she knows she might not love her boyfriend Patrick. Will Traynor knows his motorcycle accident took away his desire to live. He knows everything feels very small and rather joyless now and he knows exactly how he\'s going to put a stop to that. What Will doesn\'t know is that Lou is about to burst into his world in a riot of colour. And neither of them knows they\'re going to change the other for all time.', NULL, 72, 1, NULL, 100.00, NULL, '2021-03-05 23:30:52', '2021-03-05 23:30:52'),
(522, 'Two Can Keep a Secret', 'Two-Can-Keep-a-Secret', 'http://books.google.com/books/content?id=zrdKuQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zrdKuQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141375656', '_____ A perfect town is hiding secrets. Two teenagers are dead. Two murders unsolved. And a killer who claims to be coming back. _____ Ellery\'s never been to Echo Ridge, but she\'s heard all about it. It\'s where her aunt went missing at age sixteen, never to return. Where a Homecoming Queen\'s murder five years ago made national news. And where Ellery now has to live with a grandmother she barely knows, after her failed-actress mother lands in rehab. _____ Malcolm grew up in the shadow of the Homecoming Queen\'s death. His older brother was the prime suspect and left Echo Ridge in disgrace. His mother\'s remarriage vaulted them to Echo Ridge\'s upper crust, but it could all change when mysterious threats around town hint that a killer plans to strike again. And the return of Malcolm\'s brother doesn\'t help matters. But his return is just a coincidence... isn\'t it? Ellery and Malcolm both know it\'s hard to let go when you don\'t have closure. Then another girl disappears. As they race to unravel what happened, they realise every secret has layers in Echo Ridge. The truth might be closer to home than either of them want to believe. And somebody would kill to keep it hidden.', NULL, 73, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53'),
(523, 'The Seven Endless Forests', 'The-Seven-Endless-Forests', 'http://books.google.com/books/content?id=Y9wDyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Y9wDyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471170027', 'The gorgeous standalone companion to the critically acclaimed fantasy, The Boneless Mercies.', NULL, 74, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53'),
(524, 'Do the Birds Still Sing in Hell?', 'Do-the-Birds-Still-Sing-in-Hell?', 'http://books.google.com/books/content?id=zs7lxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zs7lxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789461619', 'The incredible true story of how of one British soldier escaped a prisoner war camp 200 times to see the girl he loved.', NULL, 75, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53'),
(525, 'The Forgotten Letters of Esther Durrant', 'The-Forgotten-Letters-of-Esther-Durrant', 'http://books.google.com/books/content?id=Om-8wQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Om-8wQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409190561', '\'I loved this exquisitely written novel and drank in every word. The Forgotten Letters of Esther Durrant is a reminder of the redemptive nature of love, and that it can be found in the most unexpected places.\' Fiona Valpy, bestselling author of The Dressmaker\'s Gift and The Beekeeper\'s Promise An abandoned woman... 1951. Esther Durrant, a young mother, is committed to an asylum by her husband. Run by a pioneering psychiatrist, the hospital is at first Esther\'s prison - but can captivity lead to freedom? A forbidden love... 2018. When free-spirited marine scientist Rachel Parker is forced to take shelter on an isolated island off the Cornish Coast during a research posting, she discovers a collection of hidden love letters. Captivated by their passion and tenderness, Rachel is determined to find the intended recipient. A dangerous secret... Meanwhile, in London, Eve is helping her grandmother write her memoirs. When she is contacted by Rachel, it sets in motion a chain of events that threatens to reveal secrets kept buried for more than sixty years. Three women bound together by a heartbreaking secret. A love story that needs to be told. This beautifully haunting and atmospheric novel, will sweep fans of Kate Morton, Elizabeth Gilbert and Emily Gunnis away this summer. \'If you enjoyed \"City of Girls,\" by Elizabeth Gilbert, read \"The Forgotten Letters of Esther Durrant,\" by Kayte Nunn\' Washington Post NetGalley reviewers are falling in love with The Forgotten Letters of Esther Durrant: \'Loved, loved this book. The multi layers wove an intriguing tale, and this was a well researched engaging and heart rending story.\' \'Beautifully written\' \'An absorbing tale set mainly in the Channel Islands. I wanted to know what the resolution would be, so stayed up to read to the end!\' Praise for Katye Nunn\'s The Botanist\'s Daughter: \'A sweeping and exotic read. I was completely swept away. Perfect for readers of Kate Morton.\' Lorna Cook, bestselling author of \'The Forgotten Village\' \'The whole book is a delight... Perfect reading whilst sipping a g & t in a beautiful garden somewhere in the sun!\' Rosanna Ley, bestselling author of \'The Lemon Tree Hotel\' \'I loved this book and really look forward to reading the next book by Kayte Nunn; perfect for reading in the garden with a glass of something cold.\' Bookliterat \'Fast-moving and full of surprises...while delivering a poignant and heart-warming story of romance and new beginnings \' Kate Forsyth \'The Botanist\'s Daughter is a quick paced but mysterious read, which transports you across time and place and is filled with an abundance of flowers.\' Foreword Books \'The Botanist\'s Daughter is an intriguing story about the strength of women who, for their own reasons, are willing to travel halfway across the world and end up with the same goal. It\'s also a family mystery that slowly reveals its secrets, just like a blooming flower.\' The Bookish Gurl 5/5 stars', NULL, 76, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(526, 'One Good Deed', 'One-Good-Deed', 'http://books.google.com/books/content?id=iahfyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iahfyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529027501', 'Murder and family secrets, a touch of romance and deeply-felt revenge - with the twist of all twists - make up the perfect page-turning thriller, One Good Deed, from one of the world\'s bestselling thriller writers, David Baldacci. \'One of his finest books. Great character, great story, great portrait of an era\' Bill Clinton In 1949, Aloysius Archer arrives in the dusty Southern town of Poca City. He has nothing but a handful of dollars, the clothes he\'s wearing and an appointment with his new parole officer. After his wartime experiences in Italy and a prison sentence for a crime he didn\'t commit, Archer is looking for a fresh start and a peaceful life. On his first night of freedom, Archer meets local business tycoon Hank Pittleman, who promises Archer handsome compensation to work as his debt collector. Yet Archer takes on more than he bargains for, as he becomes embroiled in a long-running feud between the drought-struck town\'s most dangerous residents. When one of them dies, the authorities label Archer as their number one suspect. A bloody game is being played above and below the law. Everybody playing has a deeply buried secret, and Archer must uncover them all - if he\'s to avoid going back behind bars.', NULL, 77, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53'),
(527, 'The Geography of Friendship: Women\'s Weekly Book of the Month', 'The-Geography-of-Friendship:-Women\'s-Weekly-Book-of-the-Month', 'http://books.google.com/books/content?id=CbARugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CbARugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789550184', 'Women\'s Weekly Book Club Great Read When three women set off on a hike through the wilderness they are anticipating the adventure of a lifetime. Over the next five days, as they face up to the challenging terrain, it soon becomes clear they are not alone. Lisa, Samantha and Nicole have known each other since school. Lisa is a fighter, Samantha a peacekeeper and Nicole a rule follower. United they bring out the best in one another. Only once it is too late for them to turn back do they appreciate the danger they are in. Their friendship is tested, and each of them must make a choice that will change their lives forever. What Reviewers and Readers Say: \'The atmosphere is so charged, I often found myself clenching my jaw and getting goosebumps as I read. The descriptions of the Australian bush are so vibrant and evocative... The bush feels alive in this book - vast, daunting and full of lurking dangers... Heartbreakingly honest and fiercely emotional... a remarkable book that is bound to appeal to fans of Jane Harper and Liane Moriarty\' Honey \'Piper gloriously demonstrates how to hook your readers and make them desperate to know the ending... Piper\'s novel is an exploration of how the past can come to define ourselves, and a testament to the bonds of complicated friendship and to the relentless, isolating and utterly terrifying nature of the Australian bush\' Books + Publishing Review \'There\'s a little bit of Big Little Lies about this deft and powerful study of female friendships under pressure... this lyrical Queensland-based author has a style and tone all of her own which sucks you in and holds you in its seductive embrace, almost unable to breathe... a page-turner... a book dripping in the raw beauty of the Australian landscape\' Women\'s Weekly Australia \'Piper has achieved that glorious, decisive moment in any great novel where the reader becomes desperate to know the ending. If you loved Jane Harper\'s Force of Nature, prepare yourself for another page-turning adventure\' Readings Monthly \'An ambitiousnovel\' Weekend Australian', NULL, 78, 1, NULL, 100.00, NULL, '2021-03-05 23:30:53', '2021-03-05 23:30:53'),
(528, 'The Raven Boys', 'The-Raven-Boys', 'http://books.google.com/books/content?id=81i1LgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=81i1LgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407134611', 'This is the first book in a brand new series from bestselling author, Maggie Stiefvater. Fans of SHIVER (9781407115009), LINGER (9781407121086) and FOREVER (9781407121116) will love this new quartet! Blue has spent the majority of her sixteen years being told that if she kisses her true love, he will die. When Blue meets Gansey\'s spirit on the corpse road she knows there is only one reason why - either he is her true love or she has killed him. Determined to find out the truth, Blue becomes involved with the Raven Boys, four boys from the local private school (lead by Gansey) who are on a quest to discover Glendower - a lost ancient Welsh King who is buried somewhere along the Virginia ley line. Whoever finds him will be granted a supernatural favour. Never before has Blue felt such magic around her. But is Gansey her true love? She can\'t imagine a time she would feel like that, and she is adamant not to be the reason for his death. Where will fate lead them? Look out for the next book, THE DREAM THIEVES, out 18th September 2013!', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:30:54', '2021-03-05 23:30:54'),
(529, 'If You Were Here', 'If-You-Were-Here', 'http://books.google.com/books/content?id=50DisgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=50DisgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471153525', '\'\'If You Were Here is a moving and emotional story about facing a life-altering dilemma head-on and summoning the courage to cope with it\'\' JILL MANSELL \'\'A beautiful story about living life to the fullest and having the courage to overcome adversity\'\' PAIGE TOON When her daughter Beth dies suddenly, Peggy Andrews is left to pick up the pieces and take care of her granddaughter Flo. But sorting through Beth\'\'s things reveals a secret never told: Beth was sick, with the same genetic condition that claimed her father\'\'s life, and now Peggy must decide whether to keep the secret or risk destroying her granddaughter\'\'s world. Five years later, Flo is engaged and moving to New York with her fiancé. Peggy never told her what she discovered, but with Flo looking towards her future, Peggy realises it\'\'s time to come clean and reveal that her granddaughter\'\'s life might also be at risk. As Flo struggles to decide her own path, she is faced with the same life-altering questions her mother asked herself years before: if a test could decide your future, would you take it? An emotional, inspiring and uplifting novel, IF YOU WERE HERE will break your heart and put it back together again. The brand new novel from the acclaimed author of A Song for Tomorrow, perfect for fans of Hannah Beckerman, Dani Atkins and Jill Mansell EVERYONE is talking about If You Were Here: \'\'A moving, beautifully written emotional roller coaster of a book that is utterly absorbing\'\' Heat \'\'If You Were Here is a powerful, moving and well researched multi-generational tale filled with characters you really care about and who will stay with you long after you read the final page. A must read!\'\' MIKE GAYLE, bestselling author of The Man I Think I Know \'\'The decision to live in blissful ignorance or face reality head-on is at the emotional core of this beautifully written tale\'\' WOMAN \'\'A compelling story about family love at its most complicated. Alice has created characters with real warmth and heart, who take on a life of their own and will go on existing in readers\'\' heads long after the last page has been turned\'\' DAISY BUCHANAN \'\'A courageous story, beautifully told, full of hope and heart. I was invested from the very first page\'\' HEIDI SWAIN \'\'An emotional, thought-provoking romance told with compassion and hope\'\' My Weekly \'\'A gorgeous book. Life-affirming, clever and packed full of emotion\'\' ANSTEY HARRIS, bestselling author of The Truths and Triumphs of Grace Atherton \'\'A thought-provoking, beautiful book\'\' Fabulous \'\'Alice demonstrates yet again a remarkable ability to open up her readers\'\' hearts and draw us into her story as if it were our own. I loved it\'\' KATE FURNIVALL \'\'Full of heart-warming characters, it\'\'ll make you think about how much you want to know about your future\'\' Prima \'\'A beautiful story about making difficult choices, but ultimately - about choosing to live\'\' RACHEL CULLEN, author of Running for my Life \'\'An unforgettable rollercoaster of a book\'\' AMANDA BROOKE \'\'Stunning and captivating\'\' KATIE MARSH, bestselling author of This Beautiful Life \'\'A beautifully structured, big-hearted novel which ultimately explores how true love - be that romantic, familial and everything in between - conquers all. I looked forward to going to bed every night to read it. Utterly life-affirming and just gorgeous\'\' KATY REGAN', NULL, 80, 1, NULL, 100.00, NULL, '2021-03-05 23:30:55', '2021-03-05 23:30:55'),
(530, 'One Wish', 'One-Wish', 'http://books.google.com/books/content?id=rGB0ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rGB0ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471121654', 'Having the ability to see fairies means that Tanya Fairchild\'s life has never been easy. After all, real fairies are nothing like the ones in books; ones that grant wishes or leave money for teeth. Real fairies don\'t like to be talked about, and they cast spells if Tanya steps out of line. The most she\'s ever received in exchange for one of her teeth is a chewed up toffee. Of course, it would help if Tanya knew someone - anyone - else who could see them, too . . . When Tanya meets Ratty, she finds not only that can he see fairies, but that he has a fairy friend, Turpin. Turpin is rude and spiteful, but funny and loyal too. When Ratty goes missing, Tanya discovers her new friend has another extraordinary ability; an ability that has the potential to destroy them both . . .', NULL, 65, 1, NULL, 100.00, NULL, '2021-03-05 23:30:55', '2021-03-05 23:30:55'),
(531, 'Permission Marketing', 'Permission-Marketing', 'http://books.google.com/books/content?id=W7ITAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=W7ITAQAAIAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781416526667', 'Whether it is the TV commercial that breaks into our favourite programme or the telemarketing phone call that disrupts a family meal, traditional advertising is based on the hope of snaring our attention away from whatever we are doing. Seth Godin calls this Interruption Marketing, and, as companies are discovering, it no longer works. Instead of annoying potential customers by interrupting their most coveted commodity, time, Permission Marketing offers consumers incentives to voluntarily accept advertising. Now the Internet pioneer who has dramatically improved marketing effectiveness in media introduces a fundamentally different way of thinking about advertising products and services. By reaching out to only those individuals who have expressed an interest in learning more about a product, Permission Marketing enables companies to develop long-term relationships with customers, create trust, build brand awareness, and greatly improve the chances of making a sale.', NULL, 81, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(532, 'My Husband\'s Lies', 'My-Husband\'s-Lies', 'http://books.google.com/books/content?id=8fHaswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8fHaswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008260255', '\"On the afternoon of Nick and Lisa\'s wedding, their close friend is found poised on a hotel window ledge, ready to jump. As the shock hits their friendship group, they soon realise that none of them are being as honest with themselves - or with each other - as they think. And there are secrets lurking that could destroy everything.\"--Provided by publisher.', NULL, 82, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(533, 'Sapiens', 'Sapiens', 'http://books.google.com/books/content?id=uJ_CoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uJ_CoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099590088', 'THE SUNDAY TIMES BESTSELLER Planet Earth is 4.5 billion years old. In just a fraction of that time, one species among countless others has conquered it. Us. We are the most advanced and most destructive animals ever to have lived. What makes us brilliant? What makes us deadly? What makes us Sapiens? In this bold and provocative book, Yuval Noah Harari explores who we are, how we got here and where weâe(tm)re going. Sapiens is a thrilling account of humankindâe(tm)s extraordinary history âe\" from the Stone Age to the Silicon Age âe\" and our journey from insignificant apes to rulers of the world âe~It tackles the biggest questions of history and of the modern world, and it is written in unforgettably vivid language. You will love it!âe(tm) Jared Diamond, author of Guns, Germs and Steel For more, visit www.ynharari.com', NULL, 83, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(534, 'The Defence', 'The-Defence', 'http://books.google.com/books/content?id=FBu9ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FBu9ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409152316', '\'Everything a great thriller should be and I can\'t wait to see more of Eddie Flynn.\' Mark Billingham \'So Hollywood, punchy and cool and pacy as hell.\' Eva Dolan Eddie Flynn has 48 hours to save his daughter... Eddie Flynn used to be a con artist. Then he became a lawyer. Turned out the two weren\'t that different. It\'s been over a year since Eddie vowed never to set foot in a courtroom again. But now he doesn\'t have a choice. Olek Volchek, the infamous head of the Russian mafia in New York, has strapped a bomb to Eddie\'s back and kidnapped his ten-year-old daughter, Amy. Eddie only has forty-eight hours to defend Volchek in an impossible murder trial - and win - if he wants to save his daughter. Under the scrutiny of the media and the FBI, Eddie must use his razor-sharp wit and every con-artist trick in the book to defend his \'client\' and ensure Amy\'s safety. With the timer on his back ticking away, can Eddie convince the jury of the impossible? Praise for race-against-time legal thriller writer, Steve Cavanagh: \'A gripping, twisty thriller\' Ian Rankin, number 1 bestselling author of Rather Be The Devil \'Legal thrillers are my blind spot, but I\'ll always make an exception for Steve Cavanagh. Quite simply, THE PLEA is one of the most purely entertaining books you\'ll read this year. It\'s a blast.\' John Connolly, bestselling author of the Charlie Parker series \'In the crowded field of legal thrillers, Steve Cavanagh stands head and shoulders above the competition, with his skilfully plotted, action-packed and big-hearted Eddie Flynn novels . . . highly intelligent, twist-laden and absolutely unputdownable\' Eva Dolan, author of the critically acclaimed Tell No Tales \'A cleverly constructed legal thriller combined with a classic locked-room mystery. Eddie Flynn is fast becoming one of my favourite fictional heroes and Cavanagh one of my favourite thriller writers.\' S.J.I. Holliday, author of Black Wood \'Raymond Chandler could have created Eddie Flynn. THE PLEA is Phillip Marlowe and Michael Connolly\'s Mickey Haller combined, with a bit of Jim Thompson\'s THE GRIFTERS thrown in. A superb read with a main character destined to be one of the most talked about in crime fiction.\' Howard Linskey, author of The Search If you like John Grisham, Lee Child and Michael Connelly, you will LOVE the gripping and twisty Eddie Flynn series: 1. The Defence 2. The Plea 3. The Liar * Each Eddie Flynn thriller can be read as a standalone or in series order *', NULL, 84, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(535, 'The Liar', 'The-Liar', 'http://books.google.com/books/content?id=hRczswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hRczswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409152392', '***WINNER OF THE CWA GOLD DAGGER AWARD 2018*** A MISSING GIRL. A DESPERATE FATHER. A CASE WHICH WILL TEAR THEM APART. \'Plotting that takes the breath away\' Ian Rankin \'A fantastic thriller writer\' Mark Billingham * * * * * WHO IS DEADLIER ... Leonard Howell\'s worst nightmare has come true: his daughter Caroline has been kidnapped. He can\'t rely on the cops, so Howell calls the only man he trusts to get her back. THE MAN WHO KNOWS THE TRUTH Eddie Flynn knows what it\'s like to lose a daughter and vows to bring Caroline home safe. Once a con artist, now a hotshot criminal attorney, Flynn is no stranger to the shady New York underworld. ... OR THE ONE WHO BELIEVES A LIE? However, as he steps back into his old life, Flynn realizes that the rules of the game have changed - and that he is being played. But who is pulling the strings? And is anyone in this twisted case telling the truth...? * * * * * An ingenious plot, gripping action and characters who leap off the page: discover why readers love Steve Cavanagh: \'Cavanagh stands head and shoulders above the competition, with his skilfully plotted, action-packed and big-hearted Eddie Flynn novels . . . highly intelligent, twist-laden and absolutely unputdownable\' Eva Dolan, author of the critically acclaimed Tell No Tales \'What a thriller! Breathlessly brilliant and fiendishly clever\' Miranda Dickinson \'A cleverly constructed legal thriller combined with a classic locked-room mystery. Eddie Flynn is fast becoming one of my favourite fictional heroes and Cavanagh one of my favourite thriller writers.\' S.J.I. Holliday, author of Black Wood \'Raymond Chandler could have created Eddie Flynn. THE PLEA is Phillip Marlowe and Michael Connolly\'s Mickey Haller combined, with a bit of Jim Thompson\'s THE GRIFTERS thrown in. A superb read with a main character destined to be one of the most talked about in crime fiction.\' Howard Linskey, author of The Search * If you like John Grisham, Lee Child and Michael Connelly, you will LOVE the gripping and twisty Eddie Flynn series: 1. The Defence 2. The Plea 3. The Liar * Each Eddie Flynn thriller can be read as a standalone or in series order *', NULL, 84, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(536, 'The Plea', 'The-Plea', 'http://books.google.com/books/content?id=HXiIDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HXiIDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409152354', 'Your client is innocent. Your wife is guilty. Who would you fight for? * \'Quite simply, THE PLEA is one of the most purely entertaining books you\'ll read this year\' John Connolly \'A gripping thriller\' Ian Rankin * When David Child, a major client of a corrupt New York law firm, is arrested for murder, the FBI ask con artist-turned-lawyer Eddie Flynn to persuade him to testify against the firm. Eddie is not someone who is easily coerced, but when the FBI reveal that they have incriminating files on his wife, he knows he has no choice. But Eddie is convinced the man is innocent, despite overwhelming evidence to the contrary. With the FBI putting pressure on him to secure the deal, Eddie must find a way to prove his client\'s innocence. But the stakes are high - his wife is in danger. And not just from the FBI . . . * Praise for race-against-time legal thriller writer, Steve Cavanagh: \'A fantastic thriller writer\' Mark Billingham \'Cavanagh stands head and shoulders above the competition, with his skilfully plotted, action-packed and big-hearted Eddie Flynn novels . . . highly intelligent, twist-laden and absolutely unputdownable\' Eva Dolan, author of the critically acclaimed Tell No Tales \'What a thriller! Breathlessly brilliant and fiendishly clever\' Miranda Dickinson \'A cleverly constructed legal thriller combined with a classic locked-room mystery. Eddie Flynn is fast becoming one of my favourite fictional heroes and Cavanagh one of my favourite thriller writers.\' S.J.I. Holliday, author of Black Wood \'Raymond Chandler could have created Eddie Flynn. THE PLEA is Phillip Marlowe and Michael Connolly\'s Mickey Haller combined, with a bit of Jim Thompson\'s THE GRIFTERS thrown in. A superb read with a main character destined to be one of the most talked about in crime fiction.\' Howard Linskey, author of The Search * If you like John Grisham, Lee Child and Michael Connelly, you will LOVE the gripping and twisty Eddie Flynn series: 1. The Defence 2. The Plea 3. The Liar 4. Thirteen * Each Eddie Flynn thriller can be read as a standalone or in series order *', NULL, 84, 1, NULL, 100.00, NULL, '2021-03-05 23:30:56', '2021-03-05 23:30:56'),
(537, 'Man\'s Search for Meaning', 'Man\'s-Search-for-Meaning', 'http://books.google.com/books/content?id=VsoliwGIMZUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VsoliwGIMZUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781844132393', '16 MILLION COPIES SOLD \'A book to read, to cherish, to debate, and one that will ultimately keep the memories of the victims alive\' John Boyne, author of The Boy in the Striped Pyjamas A prominent Viennese psychiatrist before the war, Viktor Frankl was uniquely able to observe the way that both he and others in Auschwitz coped (or didn\'t) with the experience. He noticed that it was the men who comforted others and who gave away their last piece of bread who survived the longest - and who offered proof that everything can be taken away from us except the ability to choose our attitude in any given set of circumstances. The sort of person the concentration camp prisoner became was the result of an inner decision and not of camp influences alone. Frankl came to believe man\'s deepest desire is to search for meaning and purpose. This outstanding work offers us all a way to transcend suffering and find significance in the art of living.', NULL, 85, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(538, 'Keep Her Close', 'Keep-Her-Close', 'http://books.google.com/books/content?id=3XiYtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3XiYtQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008293772', '', NULL, 86, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(539, 'The Snake Trap', 'The-Snake-Trap', 'http://books.google.com/books/content?id=aIAbrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aIAbrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447238980', 'Following a death-defying escape from the hands of a criminal overlord, young PI Travis Delaney thinks he might finally be getting closer to finding out who killed his parents, and why. But things are about to get a whole lot more deadly. One moment Travis is trapped in an armed face-off in the offices of Delaney & Co, private investigators. The next, terrorists have stormed the building and he\'s been abducted. As the truth begins to emerge, Travis is faced with the ultimate dilemma: How do you choose between saving your own life or saving the life of someone you love? Following a death-defying escape from the hands of a criminal overlord, young PI Travis Delaney thinks he might finally be getting closer to finding out who killed his parents, and why. But things are about to get a whole lot more deadly. One moment Travis is trapped in an armed face-off in the offices of Delaney & Co, private investigators. The next, terrorists have stormed the building and he\'s been abducted. Kept captive alongside Winston, the rogue security officer who Travis believes is responsible for his parents\' death, Travis is quickly plagued by more questions than answers. As the truth begins to emerge, Travis is faced with the ultimate dilemma: how do you choose between saving your own life or saving the life of someone you love?', NULL, 87, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(540, 'The Good Mother', 'The-Good-Mother', 'http://books.google.com/books/content?id=nzNDjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nzNDjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751565300', 'One ordinary afternoon, Fairlie Winter receives a devastating phone call - her best friend is dead. Jenna Rudolph was a devoted mother and wife and has left behind her young son, Henry, and her grief-stricken husband, Ark. The circumstances surrounding Jenna\'s death, while tragic, seem to be clear-cut yet Fairlie can\'t shake the feeling that Jenna was hiding something. And then Fairlie receives a letter. From Jenna. Posted before she died. The contents of that letter force Fairlie on a journey to discover the truth - a truth that she may not be ready for. Driven by her need for answers, she uncovers a horrifying past of two desperate mothers and the tragic choices they made for their children and she must ask herself, is there such a thing as loving your child too much? Heart-breaking, tender and dramatic, The Good Mother is a story about the price of motherhood and the unthinkable things we do in the name of love.', NULL, 88, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(541, 'Sharp Objects', 'Sharp-Objects', 'http://books.google.com/books/content?id=YdJ9AAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YdJ9AAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753822210', 'Some scars never heal . . . An addictive thriller from the author of the mega bestseller GONE GIRL. When two girls are abducted and killed in Missouri, journalist Camille Preaker is sent back to her home town to report on the crimes. Long-haunted by a childhood tragedy and estranged from her mother for years, Camille suddenly finds herself installed once again in her family\'s mansion, reacquainting herself with her distant mother and the half-sister she barely knows - a precocious 13-year-old who holds a disquieting grip on the town. As Camille works to uncover the truth about these violent crimes, she finds herself identifying with the young victims - a bit too strongly. Clues keep leading to dead ends, forcing Camille to unravel the psychological puzzle of her own past to get at the story. Dogged by her own demons, Camille will have to confront what happened to her years before if she wants to survive this homecoming.', NULL, 89, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(542, 'The Fire Child', 'The-Fire-Child', 'http://books.google.com/books/content?id=vw2LDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vw2LDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008105860', 'The chilling new psychological thriller by S. K. Tremayne, author of the Sunday Times No. 1 bestseller, THE ICE TWINS. IT TOOK ONLY SIX WORDS TO SHATTER HER DREAMS... When Rachel marries handsome David and moves to a beautiful house in Cornwall, she gains wealth, love, and an affectionate stepson, Jamie. But then Jamie\'s behaviour changes, and her perfect life begins to unravel. He makes disturbing predictions, claiming to be haunted by the spectre of his late mother. As September slips away and December looms, Rachel grows increasingly suspicious of her husband - and begins to suspect there might be truth in Jamie\'s words: \'YOU WILL BE DEAD BY CHRISTMAS\'', NULL, 90, 1, NULL, 100.00, NULL, '2021-03-05 23:30:57', '2021-03-05 23:30:57'),
(543, 'The Night Stalker', 'The-Night-Stalker', 'http://books.google.com/books/content?id=w_HpswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=w_HpswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751571295', '\'Absolutely brilliant ...impossible to put this book down! ... A must read\' The Quiet Knitter If the Night Stalker is watching, you\'re already dead... In the dead of a swelteringly hot summer\'s night, Detective Erika Foster is called to a murder scene. The victim, a doctor, is found suffocated in bed. His wrists are bound and his eyes bulging through a clear plastic bag tied tight over his head. A few days later, another victim is found dead, in exactly the same circumstances. As Erika and her team start digging deeper, they discover a calculated serial killer - stalking their victims before choosing the right moment to strike. The victims are all single men, with very private lives. Why are their pasts shrouded in secrecy? And what links them to the killer? As a heat wave descends upon London, Erika will do everything to stop the Night Stalker before the body count rises, even if it means risking her job. But the victims might not be the only ones being watched... Erika\'s own life could be on the line. The global bestselling author of The Girl in the Ice is back with a heart-racing, electrifying thriller. If you love Angela Marsons, Rachel Abbott and Peter James, you\'ll be hooked on Robert Bryndza. Read what people are saying about The Night Stalker \'The Night Stalker is dark, fast-paced and shot through with wit and psychological insight. I couldn\'t put it down.\' Mark Edwards \'Erika is fast becoming one of my favourite detectives...I absolutely loved this heart-pounding, fast-paced, chilling crime thriller.\' The Book Review Caf� \'Just when I thought it couldn\'t get any better...From the first page, we\'re sucked in with tension that had me holding my breath.\' The Suspense is Thrilling Me \'A truly brilliant crime series...The Night Stalker made me feel like I had been swept up in a whirlwind and had me clinging on for dear life, only letting me go right at the very end.\' By The Letter Book Reviews \'Intense, suspenseful, and clever??...a gripping page turner that is disturbingly real, and I highly recommend it.\' What\'s Better Than Books? \'A truly fantastic and exciting serial killer chiller!\' Booklover Catlady \'The Night Stalker is a very gripping, engaging read full of nail-biting tension. Once I started reading it, I couldn\'t stop!...an amazing work of fiction no reader of the crime genre should miss.\' Relax and Read Reviews \'I think any fans of a good police procedural will become completely engaged in this series featuring a gritty and determined strong female lead.\' Carrie\'s Book Reviews \'This book grabbed me by the throat and didn\'t let go till I got to the end.\' Sincerely Book Angels The Night Stalker now a Wall Street Journal #1 best seller', NULL, 91, 1, NULL, 100.00, NULL, '2021-03-05 23:30:58', '2021-03-05 23:30:58'),
(544, 'The Giver of Stars', 'The-Giver-of-Stars', 'http://books.google.com/books/content?id=X-_nwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=X-_nwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780718183202', 'THE SPELLBINDING SUNDAY TIMES BESTSELLER & REESE WITHERSPOON BOOK CLUB PICK - FROM THE AUTHOR OF ME BEFORE YOU \'Inspiring and wildly romantic\' DAILY MAIL BOOKS OF THE YEAR \'Her best novel yet. The most appealing thing is Moyes\' wonderful way with romance\' THE TIMES ___________ The greatest love story is the one you least expect . . . Alice is stifled, bored, and misunderstood. So when she meets wealthy and handsome American, Bennett Van Cleve, she is quickly swept off her feet. Marrying him and moving to America seems like a great adventure - but life as a newlywed in stuffy Baileyville, Kentucky, is not at all what she hoped for. Until, that is, she responds to a call for volunteers to start a travelling library, surprising herself by saying yes, before her husband can say no . . . Led by feisty and rebellious Margery O\'Hare, this unlikely group of women travel far and wide on their mission to bring books and reading to those that need it, and Alice finally finds the freedom, friendship and love that she\'s been looking for. But not everyone approves of what they are doing, especially her new father-in-law. And when the town turns against them, will their belief in each other and their work be enough? The Giver of Stars is a mesmerising tale of female friendship, romance, and the wonder of books and reading, inspired by a remarkable true story. __________ GOOD HOUSEKEEPING BOOKS OF THE YEAR \'So amazing and transportive. I\'m the biggest Jojo Moyes fan. It is so beautifully written\' REESE WITHERSPOON \'Extraordinary. The best thing she has written since Me Before You\' METRO \'An entertaining, immersive and moving read\' THE SUNDAY TIMES \'Intensely moving and crammed with romance and emotion\' SUN \'Packed full of romance, tension and brilliantly drawn characters\' SUNDAY POST \'A beautiful, special novel. I loved it and didn\'t want it to end!\' LIANE MORIARTY, author of Big Little Lies \'Moyes\' best yet\' SUNDAY POST \'My favourite of 2019\' 5***** READER REVIEW \'Epic\' DAVID NICHOLLS, bestselling author of One Day \'I laughed and I cried. Could not put it down\' 5***** READER REVIEW \'The most sweeping, dramatic, richly evocative book, full of brilliantly feisty women\' SOPHIE KINSELLA, bestselling author of The Confessions of a Shopaholic', NULL, 72, 1, NULL, 100.00, NULL, '2021-03-05 23:30:58', '2021-03-05 23:30:58'),
(545, 'The Stranger Diaries', 'The-Stranger-Diaries', 'http://books.google.com/books/content?id=QVPBtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QVPBtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786487391', 'THE TIMES CRIME BOOK OF THE YEAR THE RADIO 2 BOOK CLUB PICK \'Utterly bewitching ... a pitch-perfect modern Gothic\' AJ FINN, author of THE WOMAN IN THE WINDOW \'Compelling, intelligent and increasingly mesmerising\' PETER JAMES \'At once a homage to the Gothic thriller, and a re-imagining, it is goose-bump spooky, smart, and haunting, in every sense. I loved this book! And you will too\' LOUISE PENNY A dark story has been brought to terrifying life. Can the ending be rewritten in time? Clare Cassidy is no stranger to tales of murder. As a literature teacher specialising in the Gothic writer R.M. Holland, she teaches a short course on them every year. Then Clare\'s life and work collide tragically when one of her colleagues is found dead, a line from an R.M. Holland story by her body. The investigating police detective is convinced the writer\'s works somehow hold the key to the case. Not knowing who to trust, and afraid that the killer is someone she knows, Clare confides her darkest suspicions and fears about the case to her journal. Then one day she notices some other writing in the diary. Writing that isn\'t hers...', NULL, 92, 1, NULL, 100.00, NULL, '2021-03-05 23:30:58', '2021-03-05 23:30:58'),
(546, 'Competitive Advantage', 'Competitive-Advantage', 'http://books.google.com/books/content?id=PpZxQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PpZxQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780743260879', 'Now beyond its eleventh printing and translated into twelve languages, Michael Porter’s The Competitive Advantage of Nations has changed completely our conception of how prosperity is created and sustained in the modern global economy. Porter’s groundbreaking study of international competitiveness has shaped national policy in countries around the world. It has also transformed thinking and action in states, cities, companies, and even entire regions such as Central America. Based on research in ten leading trading nations, The Competitive Advantage of Nations offers the first theory of competitiveness based on the causes of the productivity with which companies compete. Porter shows how traditional comparative advantages such as natural resources and pools of labor have been superseded as sources of prosperity, and how broad macroeconomic accounts of competitiveness are insufficient. The book introduces Porter’s “diamond,” a whole new way to understand the competitive position of a nation (or other locations) in global competition that is now an integral part of international business thinking. Porter\'s concept of “clusters,” or groups of interconnected firms, suppliers, related industries, and institutions that arise in particular locations, has become a new way for companies and governments to think about economies, assess the competitive advantage of locations, and set public policy. Even before publication of the book, Porter’s theory had guided national reassessments in New Zealand and elsewhere. His ideas and personal involvement have shaped strategy in countries as diverse as the Netherlands, Portugal, Taiwan, Costa Rica, and India, and regions such as Massachusetts, California, and the Basque country. Hundreds of cluster initiatives have flourished throughout the world. In an era of intensifying global competition, this pathbreaking book on the new wealth of nations has become the standard by which all future work must be measured.', NULL, 93, 1, NULL, 100.00, NULL, '2021-03-05 23:30:58', '2021-03-05 23:30:58'),
(547, 'How to Win Friends and Influence People in the Digital Age', 'How-to-Win-Friends-and-Influence-People-in-the-Digital-Age', 'http://books.google.com/books/content?id=4AKsuQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4AKsuQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857207289', 'Since its initial publication, How to Win Friends and Influence People has sold a total of 15 million copies. The book continues to sell briskly today, but Carnegie never anticipated the ways in which the digital age would provide new tools and challenges for winning friends and influencing people. The advent of social networking sites, the dominance of email, and the ways in which the Internet has supplanted face-to-face interactions have made Carnegie\'s precepts all the more immediate and vital. Brent Cole, working in tandem with Dale Carnegie & Associates, Inc., has reimagined the original book for the digital age, updating and reframing Carnegie\'s insights about communication, self expression, and leadership.', NULL, 94, 1, NULL, 100.00, NULL, '2021-03-05 23:30:58', '2021-03-05 23:30:58'),
(548, 'The Death of Her', 'The-Death-of-Her', 'http://books.google.com/books/content?id=xYjTswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xYjTswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509834662', 'The Death of Her is a haunting psychological thriller from Debbie Howells, author of the bestselling Richard and Judy Book Club success The Bones of You. A woman\'s body is discovered on a Cornish farm, battered and left for dead in a maize field. Airlifted to hospital, her life hanging in the balance, no one\'s sure who she is. Three days later she comes round, but her memory is damaged. She knows her name - Evie - but no more, until she remembers another name. Angel - her three-year-old daughter. As the police circulate Evie\'s photo, someone recognizes her. Charlotte knew her years ago, at school, when another child went missing. Leah Danning, who vanished whilst in Evie\'s care. When the police search Evie\'s home, there\'s no sign of Angel. More disturbingly, there\'s no evidence that she ever lived there, forcing the police to question whether Evie\'s having some kind of breakdown. But even from the darkest place she\'s ever known, Evie believes her daughter is alive. The police remain unconvinced - unaware that on the fringes of Evie\'s life, there\'s someone else. Someone hidden, watching her every move, with their own agenda and their own twisted version of reality.', NULL, 96, 1, NULL, 100.00, NULL, '2021-03-05 23:30:59', '2021-03-05 23:30:59'),
(549, 'No Escape', 'No-Escape', 'http://books.google.com/books/content?id=UUSZswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=UUSZswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008293406', '*Previously published as The Blue* \'A thrilling page turner . . . a beautifully written, compelling mystery that you won\'t want to put down\' C.L. Taylor When there\'s danger in paradise, will you be the one to stay alive? With a quick spin of the globe, Kitty and Lana escape their grey reality and journey to the Philippines. There they discover The Blue - a beautiful yacht, with a wandering crew. They spend day after languorous day exploring the pristine white beaches and swimming beneath the stars, and Lanadrifts further away from the long-buried secrets of home. But the tide turns when death creeps quietly on deck. A dangerous swell of mistrust and lies threatens to bring the crew\'s adventures to an end - but some won\'t let paradise go...whatever the price.', NULL, 97, 1, NULL, 100.00, NULL, '2021-03-05 23:30:59', '2021-03-05 23:30:59'),
(550, 'Her Name Was Rose', 'Her-Name-Was-Rose', 'http://books.google.com/books/content?id=c_kStAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=c_kStAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008275051', '\'AMAZING. I read it in one go. I was totally hooked.\' MARIAN KEYES \'Utterly addictive. Compulsive, twisty, tense.\' CLAIRE DOUGLAS, author of Local Girl Missing Her name was Rose. You watched her die. And her death has created a vacancy. When Emily lets a stranger step out in front of her, she never imagines that split second will change her life. But after Emily watches a car plough into the young mother - killing her instantly - she finds herself unable to move on. And then she makes a decision she can never take back. Because Rose had everything Emily had ever dreamed of. A beautiful, loving family, a great job and a stunning home. And now Rose\'s husband misses his wife, and their son needs a mother. Why couldn\'t Emily fill that space? But as Emily is about to discover, no one\'s life is perfect ... and not everything is as it seems.', NULL, 98, 1, NULL, 100.00, NULL, '2021-03-05 23:30:59', '2021-03-05 23:30:59'),
(551, 'One Little Lie', 'One-Little-Lie', 'http://books.google.com/books/content?id=6Z4DtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6Z4DtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008300814', '\'I\'m Alice. And my son is a murderer.\' Deborah\'s son was killed four years ago.Alice\'s son is in prison for committing that crime. Deborah would give anything to have her boy back, and Alice would do anything to right her son\'s wrongs. Driven by guilt and the need for redemption, Alice has started a support group for parents with troubled children. But as the network begins to grow, she soon finds out just how easy it is for one little lie to spiral out of control... They call it mother\'s intuition, but can you ever really know your own child? A twisty and unnerving thriller about the price of motherhood and the unthinkable things we do to protect our children. Perfect for fans of B A Paris and Clare Mackintosh.', NULL, 99, 1, NULL, 100.00, NULL, '2021-03-05 23:31:00', '2021-03-05 23:31:00'),
(552, 'The Doll House', 'The-Doll-House', 'http://books.google.com/books/content?id=YPaNuQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YPaNuQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008320669', 'You never know who\'s watching... Corinne\'s life might look perfect on the outside, but after three failed IVF attempts it\'s her last chance to have a baby. And when she finds a tiny part of a doll house outside her flat, it feels as if it\'s a sign. But as more pieces begin to turn up, Corinne realises that they are far too familiar. Someone knows about the miniature rocking horse and the little doll with its red velvet dress. Someone has been inside her house... How does the stranger know so much about her life? How long have they been watching? And what are they waiting for...?', NULL, 100, 1, NULL, 100.00, NULL, '2021-03-05 23:31:00', '2021-03-05 23:31:00'),
(553, 'Nothing More', 'Nothing-More', 'http://books.google.com/books/content?id=vK-oDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vK-oDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781501152870', '', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:31:00', '2021-03-05 23:31:00'),
(554, 'Origin', 'Origin', 'http://books.google.com/books/content?id=pNGnswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pNGnswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552174169', 'The spellbinding new Robert Langdon novelfrom the author of The Da Vinci Code. Robert Langdon, Harvard professor of symbology and religious iconology, arrives at the Guggenheim Museum Bilbao to attend the unveiling of a discovery that owill change the face of science forevero. The evening\'s host is his friend and former student, Edmond Kirsch, a forty-year-old tech magnate whose dazzling inventions and audacious predictions have made him a controversial figure around the world. This evening is to be no exception- he claims he will reveal an astonishing scientific breakthrough to challenge the fundamentals of human existence. But Langdon and several hundred other guests are left reeling when the meticulously orchestrated evening is blown apart before Kirsch\'s precious discovery can be revealed. With his life under threat, Langdon is forced into a desperate bid to escape, along with the museum\'s director, Ambra Vidal. Together they flee to Barcelona on a perilous quest to locate a cryptic password that will unlock Kirsch\'s secret. In their path lie dark forces which will do anything to stop them. To evade a tormented enemy who is one step ahead of them at every turn, Langdon and Vidal must navigate labyrinthine passageways of hidden history and ancient religion. On a trail marked only by enigmatic symbols and elusive modern art, Langdon and Vidal uncover the clues that will bring them face-to-face with a world-shaking truth that has remained buried - until now. \'Dan Brown is the master of the intellectual cliffhanger\' Wall Street Journal \'As engaging a hero as you could wish for\' Mail on Sunday \'For anyone who wants more brain-food than thrillers normally provide\' Sunday Times', NULL, 102, 1, NULL, 100.00, NULL, '2021-03-05 23:31:00', '2021-03-05 23:31:00'),
(555, 'Shell', 'Shell', 'http://books.google.com/books/content?id=J2t1swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=J2t1swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407180250', 'What if you thought you had died, only to wake up in someone else\'s body? When Lucy, a teen diagnosed with terminal cancer wakes up cancer-free, it should be a dream come true. But faced with a life she didn\'t choose and trapped in a new body, Lucy must face the biggest question of all . . . How far would you go to save the one you love?', NULL, 103, 1, NULL, 100.00, NULL, '2021-03-05 23:31:01', '2021-03-05 23:31:01'),
(556, 'The God of Small Things', 'The-God-of-Small-Things', 'http://books.google.com/books/content?id=TivPHPkYx_EC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TivPHPkYx_EC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780006550686', 'A banquet for all the senses, said Newsweek of this bestselling and Booker Prize-winning literary novel--a richly textured first book about the tragic decline of one family whose members suffer the terrible consequences of forbidden love.', NULL, 104, 1, NULL, 100.00, NULL, '2021-03-05 23:31:01', '2021-03-05 23:31:01');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(557, 'Fly Away', 'Fly-Away', 'http://books.google.com/books/content?id=vHr8AgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vHr8AgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447229544', 'How do you hold yourself together when your world has fallen apart . . . Celebrity news reporter and presenter, Tully Hart, has hit rock bottom. Kate Ryan had been her best friend for more than thirty years. They’d lived, laughed, danced and cried together. Kate had been her anchor, and now Tully was cast adrift – not knowing how she was going to survive. Kate’s daughter, Marah, was only sixteen years old when her mother died. Consumed with guilt over the fights they’d had during the last months of Kate’s life, Marah runs away and becomes a drop-out in society, maintaining no contact with her family. Tully’s mother, Cloud, a child of the Sixties, has lived a world of her own dependent on drugs for most of her adult life. She now wants to prove that she can help her daughter. But what will it take for Tully to forgive? And then something momentous happens which causes each one of them to realise what they’ve done, and what they have become. FLY AWAY is the story of three women who have lost their way and need each other – plus a miracle – to transform their lives.', NULL, 105, 1, NULL, 100.00, NULL, '2021-03-05 23:31:02', '2021-03-05 23:31:02'),
(558, 'A Little Piece of Ground', 'A-Little-Piece-of-Ground', 'http://books.google.com/books/content?id=6BGlswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6BGlswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509887637', 'In Elizabeth Laird\'s A Little Piece of Ground, twelve-year-old Karim Aboudi and his family are trapped in their Ramallah home by a strict curfew. Israeli tanks control the city in response to a Palestinian suicide bombing. Karim longs to play football with his mates - being stuck inside with his teenage brother and fearful parents is driving him crazy. When the curfew ends, he and his friend discover an unused patch of ground that\'s the perfect site for a football pitch. Nearby, an old car hidden intact under bulldozed buildings makes a brilliant den. But in this city there\'s constant danger, even for schoolboys. And when Israeli soldiers find Karim outside during the next curfew, it seems impossible that he will survive . . .\'A fine book, and a daring book\' Michael Morpurgo', NULL, 106, 1, NULL, 100.00, NULL, '2021-03-05 23:31:02', '2021-03-05 23:31:02'),
(559, 'Oranges in No Man\'s Land', 'Oranges-in-No-Man\'s-Land', 'http://books.google.com/books/content?id=S3HFDAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=S3HFDAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509802920', 'Since her father left Lebanon to find work and her mother tragically died in a shell attack, ten-year-old Ayesha has been living in the bomb-ravaged city of Beirut with her granny and her two younger brothers. The city has been torn in half by civil war and a desolate, dangerous no man\'s land divides the two sides. Only militiamen and tanks dare enter this deadly zone, but when Granny falls desperately ill Ayesha sets off on a terrifying journey to reach a doctor living in enemy territory.', NULL, 106, 1, NULL, 100.00, NULL, '2021-03-05 23:31:02', '2021-03-05 23:31:02'),
(560, 'Entanglement', 'Entanglement', 'http://books.google.com/books/content?id=4Ms5swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4Ms5swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008245689', 'A wise debut\' Observer \'A hugely impressive debut\' Stella Duffy \'Beautifully written\' Hannah Beckerman \'A really accomplished debut\' Red Magazine On a hot October day in a London park, Stella sits in her red wedding dress opposite John. Pregnant and lost in thoughts of the future, she has no idea that lying in the grass, a stone\'s throw away, is a man called Charlie. From this moment, Stella and Charlie\'s lives are bound together in ways they could never imagine. But all they have is a shared glance and a feeling: have we met before? Entanglement is a bewitching novel of love and sacrifice which explores how our choices can reverberate across the generations, and the sparks of hope they can ignite.', NULL, 107, 1, NULL, 100.00, NULL, '2021-03-05 23:31:02', '2021-03-05 23:31:02'),
(561, 'Restart', 'Restart', 'http://books.google.com/books/content?id=_F7IAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_F7IAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781338053807', 'When Chase returns to middle school after falling off the roof and losing his memory, he learns that the person he was before the amnesia is not someone he likes.', NULL, 108, 1, NULL, 100.00, NULL, '2021-03-05 23:31:03', '2021-03-05 23:31:03'),
(562, 'Smells Like Treasure', 'Smells-Like-Treasure', '', '', '9780316044028', 'Homer Pudding and his treasure-sniffing best friend, Dog, are about to go on an all-new adventure! When Homer receives a mysterious note emblazoned with the letters L.O.S.T., he knows the moment he has been waiting for has finally arrived. It is time to meet the Society of Legends, Objects, Secrets, and Treasures and become a true adventurer. With Dog at his side, everything seems to be going as planned...until an unexpected opponent challenges Homer\'s spot. They are tasked with a dangerous quest, and only the one who solves the clues and reaches the treasure first will be given membership. Their hunt for treasure takes them on an unforgettable journey full of hazards, mysteries, and surprises!', NULL, 109, 1, NULL, 100.00, NULL, '2021-03-05 23:31:03', '2021-03-05 23:31:03'),
(563, 'Ruins', 'Ruins', 'http://books.google.com/books/content?id=RhJ4ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=RhJ4ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007465248', 'As a war between the humans and the Partials looms, Samm finds himself trapped beyond a toxic wasteland, and Kira finds herself under the control of Dr. Morgan who is desperate to save the Partials.', NULL, 110, 1, NULL, 100.00, NULL, '2021-03-05 23:31:03', '2021-03-05 23:31:03'),
(564, 'The Silent Companions', 'The-Silent-Companions', 'http://books.google.com/books/content?id=Vl9LDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Vl9LDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408888032', 'As featured on the Radio 2 Book Club. Some doors are locked for a reason...Newly married, newly widowed Elsie is sent to see out her pregnancy at her late husband\'s crumbling country estate, The Bridge.With her new servants resentful and the local villagers actively hostile, Elsie only has her husband\'s awkward cousin for company. Or so she thinks. For inside her new home lies a locked room, and beyond that door lies a two-hundred-year-old diary and a deeply unsettling painted wooden figure - a Silent Companion - that bears a striking resemblance to Elsie herself...', NULL, 111, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(565, 'A Long Way Gone', 'A-Long-Way-Gone', 'http://books.google.com/books/content?id=FgtoPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FgtoPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007247097', 'This is how wars are fought now by children, hopped up on drugs, and wielding AK-47s. In the more than fifty violent conflicts going on worldwide, it is estimated that there are some 300,000 child soldiers. Ishmael Beah used to be one of them. How does one become a killer? How does one stop? Child soldiers have been profiled by journalists, and novelists have struggled to imagine their lives. But it is rare to find a first-person account from someone who endured this hell and survived. In\" A Long Way Gone Beah,\" now twenty-six years old, tells a riveting story in his own words: how, at the age of twelve, he fled attacking rebels and wandered a land rendered unrecognizable by violence. By thirteen, he\'d been picked up by the government army, and Beah, at heart a gentle boy, found that he was capable of truly terrible acts. This is a rare and mesmerizing account, told with real literary force and heartbreaking honesty.', NULL, 112, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(566, 'Don\'t Let Go', 'Don\'t-Let-Go', 'http://books.google.com/books/content?id=rRzUwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rRzUwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784751159', '***THE GLOBAL #1 BESTSELLER*** __________________________ A SMALL TOWN IS HIDING BIG SECRETS ... Fifteen years ago in New Jersey, a teenage boy and girl were found dead. Most people concluded it was a tragic suicide pact. The dead boy\'s brother, Nap Dumas, did not. Now Nap is a cop - but he\'s a cop who plays by his own rules, and who has never made peace with his past. And when the past comes back to haunt him, Nap discovers secrets can kill... __________________________ From the international bestselling author of Homeand Fool Me Once, and the creator of the Netflix hit Safe. __________________________ \'The modern master of the hook and twist, luring you in on the first page only to shock you on the last\' - Dan Brown \'Coben is a phenomenon- the most reliable of American thriller-writers, the least likely to disappoint ... the true mystery is Coben\'s extraordinary capacity to keep writing such wonderful thrillers\' - The Times \'As moreishas ever\' - Sunday Times \'Simply one of the all-time greats - pick up any one of his thrillers and you\'ll find a riveting, twisty, surprising story with a big, beating heart at its core.\' - Gillian Flynn \'Harlan Coben is a folk poet of the suburbsand his well-tuned new mystery, Don\'t Let Go shows why ... This kind of writing is what we call poetry.\' - New York Times', NULL, 113, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(567, 'Diversify', 'Diversify', 'http://books.google.com/books/content?id=HIzKtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HIzKtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008242084', 'Could inclusivity be the key to success? The truth is, inclusion is better for everyone. In this empowering call to arms, updated for 2019, June Sarpong MBE proves why. Putting the spotlight on groups who are often marginalised in our society, including women, ethnic minorities, those living with disabilities, and the LGBTQ+ community, Diversify uncovers the hidden cost of exclusion and shows how a new approach to how we learn, live and do business can solve some of the most stubborn challenges we face. With unshakeable case studies, brand-new research from Oxford University, and six revolutionary steps to help you overcome unconscious bias, this book will help you become part of a better society. The old way isn\'t working. This is a case for change. [Taken from Blackwell\'s website].', NULL, 114, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(568, 'Ash Princess', 'Ash-Princess', 'http://books.google.com/books/content?id=gENUswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gENUswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509855209', 'Theodosia was six when her country was invaded and her mother, the Queen of Flame and Fury, was murdered before her eyes. Ten years later, Theo has learned to survive under the relentless abuse of the Kaiser and his court as the ridiculed Ash Princess. When the Kaiser forces her to execute her last hope of rescue, Theo can\'t ignore her feelings and memories any longer. She vows revenge, throwing herself into a plot to seduce and murder the Kaiser\'s warrior son with the help of a group of magically gifted and volatile rebels. But Theo doesn\'t expect to develop feelings for the Prinz. Forced to make impossible choices and unable to trust even those who are on her side, Theo will have to decide how far she\'s willing to go to save her people and how much of herself she\'s willing to sacrifice to become Queen.From author Laura Sebastian comes Ash Princess, a nail-biting YA fantasy debut full of daring and vengeance.', NULL, 115, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(569, 'The Binding', 'The-Binding', 'http://books.google.com/books/content?id=ipvOwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ipvOwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008272142', 'LOSE YOURSELF IN THE BREAKOUT SENSATION OF THE YEAR SHORTLISTED FOR WATERSTONES BOOK OF THE YEAR 2019 \'Brilliant\' Joanna Cannon \'Spellbinding\' Guardian \'Magic\' Erin Kelly \'Immersive\' Sunday Times \'Gorgeous\' Stella Duffy \'Astounding\' Anna Mazzola Emmett Farmer is a binder\'s apprentice. His job is to hand-craft beautiful books and, within each, to capture something unique and extraordinary: a memory. If you have something you want to forget, or a secret to hide, he can bind it - and you will never have to remember the pain it caused. In a vault under his mentor\'s workshop, row upon row of books - and secrets - are meticulously stored and recorded. Then one day Emmett makes an astonishing discovery: one of the volumes has his name on it.', NULL, 116, 1, NULL, 100.00, NULL, '2021-03-05 23:31:04', '2021-03-05 23:31:04'),
(570, 'Simple Acts of Kindness', 'Simple-Acts-of-Kindness', 'http://books.google.com/books/content?id=0EA5DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=0EA5DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781507205679', 'Practice kindness every day with these easy, accessible activities that range from helping the elderly to supporting animal welfare to protecting the local environment. In Simple Acts of Kindness, you’ll discover many ways to bring help and happiness to those around you, including: -Calling your elderly relatives just to say hello -Bringing a box of doughnuts to the office to share with your coworkers -Thanking your driver as you get off the bus These simple activities make it easy to be kinder every day and provide support to those who need it most. With this book in hand, you can easily make a positive difference in today’s society.', NULL, 117, 1, NULL, 100.00, NULL, '2021-03-05 23:31:05', '2021-03-05 23:31:05'),
(571, 'Maybe One Day', 'Maybe-One-Day', 'http://books.google.com/books/content?id=uONyyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uONyyQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409187981', '\'A laugh-cry lovely book from first page to last.\' Milly Johnson For years, Jess has been told that the only man she ever loved abandoned her when she needed him most. But when she discovers a hidden box of cards and letters, she realises her life has been built on a foundation of lies. Fuelled by the words of the man she thought she\'d lost, she follows in his footsteps, tracing his path in the hope she might find him again. Though years have passed and people change, in her heart Jess hopes that, maybe one day, they will be whole again. A tender and moving novel that will break your heart and put it back together again. Praise for Maybe One Day: \'Clever and wise, brimming with warmth and poignancy. For all of us who have ever harboured a \'what might have been\' regret, this is a must-read.\' Carmel Harrington \'A heart-warming story... There\'s humour, tears and above all, hope.\' Catherine Isaac', NULL, 118, 1, NULL, 100.00, NULL, '2021-03-05 23:31:06', '2021-03-05 23:31:06'),
(572, 'Broken Throne', 'Broken-Throne', 'http://books.google.com/books/content?id=PZ7lwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PZ7lwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409178811', 'The perfect addition to the #1 New York Times bestselling Red Queen series,Broken Throne features three brand-new novellas, alongside two previously published novellas, Steel Scars and Queen Song- as well as never-before-seen maps, flags, bonus scenes, journal entries, and much more exclusive content.Fans will be delighted to catch up with beloved characters after the drama of War Storm and be excited to hear from brand-new voices as well. This stunning collection is not to be missed.', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:31:06', '2021-03-05 23:31:06'),
(573, 'Mr Salary', 'Mr-Salary', 'http://books.google.com/books/content?id=YRw4ugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YRw4ugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780571351954', 'My love for him felt so total and so annihilating that it was often impossible for me to see him clearly at all. Years ago, Sukie moved in with Nathan because her mother was dead and her father was difficult, and she had nowhere else to go. Now they are on the brink of the inevitable. Sally Rooney is one of the most acclaimed young talents of recent years. With her minute attention to the power dynamics in everyday speech, she builds up sexual tension and throws a deceptively low-key glance at love and death.', NULL, 120, 1, NULL, 100.00, NULL, '2021-03-05 23:31:06', '2021-03-05 23:31:06'),
(574, 'A Man Called Ove', 'A-Man-Called-Ove', 'http://books.google.com/books/content?id=_Ii2oQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_Ii2oQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444775815', 'The million-copy bestselling phenomenon, Fredrik Backman\'s heartwarming debut is a funny, moving, uplifting tale of love and community that will leave you with a spring in your step. Perfect for fans of Rachel Joyce\'s The Unlikely Pilgrimage of Harold Fry, Graeme Simsion\'s The Rosie Project and David Nicholl\'s US. New York Times bestseller \'Warm, funny, and almost unbearably moving\' Daily Mail \'Rescued all those men who constantly mean to read novels but never get round to it\' Spectator Books of the Year At first sight, Ove is almost certainly the grumpiest man you will ever meet. He thinks himself surrounded by idiots - neighbours who can\'t reverse a trailer properly, joggers, shop assistants who talk in code, and the perpetrators of the vicious coup d\'etat that ousted him as Chairman of the Residents\' Association. He will persist in making his daily inspection rounds of the local streets. But isn\'t it rare, these days, to find such old-fashioned clarity of belief and deed? Such unswerving conviction about what the world should be, and a lifelong dedication to making it just so? In the end, you will see, there is something about Ove that is quite irresistible...', NULL, 121, 1, NULL, 100.00, NULL, '2021-03-05 23:31:06', '2021-03-05 23:31:06'),
(575, 'Britt-Marie Was Here', 'Britt-Marie-Was-Here', 'http://books.google.com/books/content?id=c2GoDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=c2GoDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473617230', 'The number 1 European bestseller by the author of New York Times bestseller and international phenomenon A Man Called Ove, Britt-Marie was Here is a funny, poignant and uplifting tale of love, community, and second chances. For as long as anyone can remember, Britt-Marie has been an acquired taste. It\'s not that she\'s judgemental, or fussy, or difficult - she just expects things to be done in a certain way. A cutlery drawer should be arranged in the right order, for example (forks, knives, then spoons). We\'re not animals, are we? But behind the passive-aggressive, socially awkward, absurdly pedantic busybody is a woman who has more imagination, bigger dreams and a warmer heart than anyone around her realizes. So when Britt-Marie finds herself unemployed, separated from her husband of 20 years, left to fend for herself in the miserable provincial backwater that is Borg - of which the kindest thing one can say is that it has a road going through it - and somehow tasked with running the local football team, she is a little unprepared. But she will learn that life may have more to offer her that she\'s ever realised, and love might be found in the most unexpected of places.', NULL, 121, 1, NULL, 100.00, NULL, '2021-03-05 23:31:06', '2021-03-05 23:31:06'),
(576, 'The Angel', 'The-Angel', 'http://books.google.com/books/content?id=JyRFvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=JyRFvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008209131', 'The Queen of Grip-lit is back... \'A terrific story, originally told. All hail the new Queen of Crime!\' HEAT \'A web of a plot that twists and turns and keeps the reader on the edge of their seat. This formidable debut is a page-turner, but don\'t read it before bed if you\'re easily spooked!\' SUN THE TRUTH WON\'T STAY LOCKED UP FOREVER', NULL, 122, 1, NULL, 100.00, NULL, '2021-03-05 23:31:07', '2021-03-05 23:31:07'),
(577, 'The Confession', 'The-Confession', 'http://books.google.com/books/content?id=3-PzywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3-PzywEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509886197', 'The sensational Sunday Times bestseller from Jessie Burton, the million-copy bestselling author of The Miniaturist and The Muse. When Elise Morceau meets the writer Constance Holden, she quickly falls under her spell. Connie is sophisticated, bold and alluring - everything Elise feels she is not. She follows Connie to LA, but in this city of strange dreams and razzle-dazzle, Elise feels even more out of her depth and makes an impulsive decision that will change her life forever. Three decades later, Rose Simmons is trying to uncover the story of her mother, who disappeared when she was a baby. Having learned that the last person to see her was a now reclusive novelist, Rose finds herself at the door of Constance Holden\'s house in search of a confession . . . \'Without doubt one of the best novels of recent years\' - Elizabeth Day', NULL, 123, 1, NULL, 100.00, NULL, '2021-03-05 23:31:07', '2021-03-05 23:31:07'),
(578, 'The Child', 'The-Child', 'http://books.google.com/books/content?id=IvMltAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IvMltAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552172455', 'THE SUNDAY TIMES BESTSELLER, NOW A RICHARD AND JUDY BOOK CLUB PICK \'Clever and compelling. You\'ll love THE CHILD\' Clare Mackintosh, author of LET ME LIE \'An engrossing, irresistible story about the coming to light of a long-buried secret. An absolutely fabulous read - I loved it!\' Shari Lapena, author of THE COUPLE NEXT DOOR \'Tense, tantalising and ultimately very satisfying . . . definitely one of the year\'s must-reads\' Lee Child ******** When a paragraph in an evening newspaper reveals a decades-old tragedy, most readers barely give it a glance. But for three strangers it\'s impossible to ignore. For one woman, it\'s a reminder of the worst thing that ever happened to her. For another, it reveals the dangerous possibility that her darkest secret is about to be discovered. And for the third, a journalist, it\'s the first clue in a hunt to uncover the truth. The Child\'s story will be told. ******** \'I loved this gripping story that kept me guessing to the end\' Liz Nugent \'Fiona Barton is a major new talent\' M J Arlidge', NULL, 124, 1, NULL, 100.00, NULL, '2021-03-05 23:31:07', '2021-03-05 23:31:07'),
(579, 'UNTITLED COLE 3 OF 3', 'UNTITLED-COLE-3-OF-3', '', '', '9781409168867', '', NULL, 125, 1, NULL, 100.00, NULL, '2021-03-05 23:31:07', '2021-03-05 23:31:07'),
(580, 'The Bookshop', 'The-Bookshop', 'http://books.google.com/books/content?id=LzrzEIM6B7YC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LzrzEIM6B7YC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780006543541', '\"A gem, a vintage narrative...a classic whose force as a piece of physical and moral map-making has not merely lasted but has actually improved in the passage of years.\" \'New York Times\' In the small East Anglian coastal town of Hardborough, Florence Green decides, against polite but ruthless local opposition, to open a bookshop. Hardborough quickly becomes a battleground - for Florence has tried to change the way things have always been done. As a result, she has to take on not only the people who have made themselves important, but natural and even supernatural forces too. Her fate will strike a chord with anyone who knows that life has treated them with less than justice. \"Penelope Fitzgerald\'s resources of odd people are impressively rich. And this is not just a gallery of quirky still lives; these people appear in vignettes, wryly, even comically animated...A marvellously piercing fiction.\" \'TLS\' \"Solid and satisfying. Every action in it matters, however small.\" \'Spectator\'', NULL, 126, 1, NULL, 100.00, NULL, '2021-03-05 23:31:08', '2021-03-05 23:31:08'),
(581, 'The Wife\'s Shadow', 'The-Wife\'s-Shadow', 'http://books.google.com/books/content?id=pN9eswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pN9eswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780349418698', '\'If you enjoyed BBC\'s Doctor Foster, then you will happily devour this novel about a woman hiding a dark past\' Woman and Home Every woman has a secret... From one of Elle magazine\'s \'authors to watch\' comes a suspenseful and emotionally fraught novel about how little we really know the person we marry. For fans of The Affair and Dr Foster. Everyone admires Suzy and her doll\'s house life. She has a gorgeous family, a beautiful home and a successful business. But Suzy hasn\'t always been in control. In her past lies a shadowy tale of fear and instability - a life that she once ran away from, and has hidden from ever since. When Suzy starts being followed, she fears that her past may finally be catching up with her. And when she finds herself unable to do what to her is the most important thing - keep her loved ones safe - she has to decide how far she\'d be willing to go to win everything back. Even if it means sacrificing everything she knows and loves... \'A very involving story\' Morning Star What readers are saying about The Wife\'s Shadow: \'I couldn\'t put it down\' ***** \'Gripping from beginning to end\' ***** \'Beautifully written... darkly twisted... loved every minute\' ***** \'What an addictive read!\' ***** \'A gripping page turner\' *****', NULL, 127, 1, NULL, 100.00, NULL, '2021-03-05 23:31:08', '2021-03-05 23:31:08'),
(582, 'War Storm', 'War-Storm', 'http://books.google.com/books/content?id=49m_ugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=49m_ugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409175995', 'The #1 bestselling Red Queen series by Victoria Aveyard comes to a stunning conclusion in this fourth and final book. VICTORY COMES AT A PRICE. Mare Barrow learned this all too well when Cal\'s betrayal nearly destroyed her. Now determined to protect her heart-and secure freedom for Reds and newbloods like her-Mare resolves to overthrow the kingdom of Norta once and for all . . . starting with the crown on Maven\'s head. But no battle is won alone, and before the Reds may rise as one, Mare must side with the boy who broke her heart in order to defeat the boy who almost broke her. Cal\'s powerful Silver allies, alongside Mare and the Scarlet Guard, prove a formidable force. But Maven is driven by an obsession so deep, he will stop at nothing to have Mare as his own again, even if it means demolish everything - and everyone - in his path. War is coming, and all Mare has fought for hangs in the balance. Will victory be enough to topple the Silver kingdoms? Or will the little lightning girl be forever silenced? In the epic conclusion to Victoria Aveyard\'s stunning series, Mare must embrace her fate and summon all her power . . . For all will be tested, but not all will survive. Read the international bestselling RED QUEEN series in full: Book 1: RED QUEEN Book 2: GLASS SWORD Book 3: KING\'S CAGE Book 4: WAR STORM *********', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:31:08', '2021-03-05 23:31:08'),
(583, 'All the Rage', 'All-the-Rage', 'http://books.google.com/books/content?id=sJ_XwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sJ_XwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241985113', 'A teenage girl is found wandering the outskirts of Oxford, dazed and distressed. The story she tells is terrifying. Yet she refuses to press charges. DI Fawley investigates, but there\'s little he can do without the girl\'s co-operation. Is she hiding something, and if so, what?', NULL, 128, 1, NULL, 100.00, NULL, '2021-03-05 23:31:08', '2021-03-05 23:31:08'),
(584, 'Girl, Missing', 'Girl,-Missing', 'http://books.google.com/books/content?id=PFEOkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PFEOkAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471147999', 'Lauren has always known she was adopted but when a little research turns up the possibility that she was snatched from an American family as a baby, suddenly Lauren\'s life seems like a sham. How can she find her biological parents? And are her adoptive parents really responsible for kidnapping her? She manages to persuade her family to takea trip across the Atlantic where she runs away to try and find the truth. But the circumstances of her disappearance are murky and Lauren\'s kidnappers are still at large and willing to do anything to keep her silent...Ten years on from its first publication, Girl, Missing has sold over 150,000 copies in the UK alone and won countless awards and prizes. This new edition of the bestseller includes exclusive extra content from Sophie and is a must for fans and readers that are yet to discover this modern classic.', NULL, 129, 1, NULL, 100.00, NULL, '2021-03-05 23:31:08', '2021-03-05 23:31:08'),
(585, 'To Kill a Mockingbird', 'To-Kill-a-Mockingbird', 'http://books.google.com/books/content?id=VnHDCQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VnHDCQAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784752637', '\'Shoot all the Bluejays you want, if you can hit \'em, but remember it\'s a sin to kill a Mockingbird.\'A lawyer\'s advice to his children as he defends the real mockingbird of Harper Lee\'s classic novel - a black man charged with the rape of a white girl. Through the young eyes of Scout and Jem Finch, Harper Lee explores with exuberant humour the irrationality of adult attitudes to race and class in the Deep South of the thirties. The conscience of a town steeped in prejudice, violence and hypocrisy is pricked by the stamina of one man\'s struggle for justice. But the weight of history will only tolerate so much-', NULL, 130, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(586, 'Little White Lies', 'Little-White-Lies', 'http://books.google.com/books/content?id=wkE2wwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wkE2wwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008344016', '\'Breathtaking suspense. A phenomenal talent\' HOLLY SEDDON \'Terrifically engaging\' JO SPAIN \'Addictive. I couldn\'t put it down\' PHOEBE MORGAN \'With manipulations and secrets, nothing becomes clear until the very end\' CANDIS MAGAZINE She only looked away for a second... Anne White only looked away for a second, but that\'s all it took to lose sight of her young daughter. But seven years later, Abigail is found. And as Anne struggles to connect with her teenage daughter, she begins to question how much Abigail remembers about the day she disappeared... Addictive, edge-of-your-seat dark women\'s fiction perfect for fans of Heidi Perks, Sophie Hannah and Lisa Jewell What readers are saying about LITTLE WHITE LIES \'Worth far more than five stars and definitely one of my favourite books of this year\' \'Hooked me in from the opening paragraph, and never let go, I loved everything about it \' \'I was desperate to find out the truth about what happened to Abigail and just when I thought it was over another twist took me completely by surprise\' \'This was a \'heart in your mouth\' read from page one. . . . 5 stars.\' \'The ending is so tense and exciting I hardly dared breathe!\'', NULL, 131, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(587, 'Happiness for Humans', 'Happiness-for-Humans', 'http://books.google.com/books/content?id=e9B9tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=e9B9tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751566727', '\'Loved this book. Funny, quirky, unexpected\' Jojo Moyes \'Very clever and great fun\' Kate Eberlen \'Bridget Jones\' diary for the digital age\' Daily Record Happiness for Humans is a joyful, romantic and very funny story, perfect for readers who loved The Rosie Project and Eleanor Oliphant is Completely Fine. Do you believe in soulmates? Aiden does. So when his colleague, Jen, is dumped unceremoniously by her dreadful boyfriend, Aiden decides to take matters - and Jen\'s life - into his own hands. Scouring the internet for a suitable partner for Jen, Aiden finds Tom. He\'d be perfect for Jen apart from one minor detail: Tom lives in New York. Luckily for Jen and Tom, Aiden\'s not just an interfering colleague. In fact, Aiden isn\'t exactly human - he\'s a very complicated artificial intelligence. As Jen and Tom\'s romance grows, Aiden begins to take more and more risks to make sure that they can be together. But what will happen if they realise how they met...and that somebody else is pulling the strings? \'This is Jane Austen\'s Emma for the digital age\' - Keith Stuart, bestselling author of A Boy Made of Blocks \'So funny, clever and timely. I loved it\' - Martha Kearney \'This clever novel will appeal to David Nicholls fans. It\'s witty and great fun\' - Daily Mail \'This funny, madcap romp for the digital-age, featuring believably flawed characters (not all human), deserves to be a hit... like David Nicholls\' One Day or Graeme Simsion\'s The Rosie Project, it should appeal to male and female readers.\' - Sunday Times \'The most charming book I\'ve read in ages\' - Image magazine \'You\'ll love this quirky, brilliantly funny love story... If you use Siri, Alexa or Google Assistant, prepare to have your heart warmed - and be a little bit scared!\' - Fabulous magazine \'This screwball comedy is touching and hilarious\' - Sunday Mirror \'One of the most uplifting and romantic novels I\'ve read in a long time\' - Sarra Manning, Red magazine \'Funny and clever\' - Good Housekeeping Humans meets The Rosie Project . . . A real smiler of a book - Nina Pottell, Prima', NULL, 132, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(588, 'The King Tides', 'The-King-Tides', 'http://books.google.com/books/content?id=rFkduwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rFkduwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781503901681', 'Reality and illusion blur in this Washington Post bestseller that Michael Connelly calls \"a hundred percent adrenaline rush disguised as a detective novel.\" Nicki Pearl is the perfect daughter--every parent\'s dream. And that of strangers, too. Wherever she goes, she\'s being watched. Each stalker is different from the last, except for one thing--their alarming obsession with Nicki. Desperate times call for desperate measures, and Nicki\'s father is turning to someone who can protect her: retired private detective and ex-Navy SEAL Jon Lancaster. Teaming up with FBI agent and former abduction victim Beth Daniels, Lancaster can help--his way. He\'s spent most of his career dispatching creeps who get off on terrorizing the vulnerable. Unlicensed, and unrestricted, he plays dirty...But this case is unusual. Why so many men? Why this one girl? Does Nicki have something to hide? Or do her parents? Trawling the darkest depths of southern Florida, Lancaster faces a growing tide of secrets and deception. And the deeper he digs, the more he realizes that finding the truth won\'t be easy. Because there\'s more to this case than meets the eye.', NULL, 133, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(589, 'Noughts and Crosses', 'Noughts-and-Crosses', 'http://books.google.com/books/content?id=If0SvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=If0SvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141378640', 'Sephy is a Cross - a member of the dark-skinned ruling class. Callum is a nought - a \'colourless\' member of the underclass who were once slaves to the Crosses. The two have been friends since early childhood. But that\'s as far as it can go. Against a background of prejudice, distrust and mounting terrorist violence, a romance builds between Sephy and Callum - a romance that is to lead both of them into terrible danger . . .', NULL, 425, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(590, 'King\'s Cage', 'King\'s-Cage', 'http://books.google.com/books/content?id=HQlctAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HQlctAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409150763', '*** PRE-ORDER WAR STORM NOW - THE FOURTH & FINAL BOOK IN THE RED QUEEN SERIES! *** The third novel in the #1 bestselling RED QUEEN series by Victoria Aveyard ALL WILL BURN. Mare Barrow is a prisoner, powerless without her lightning, tormented by her mistakes. She lives at the mercy of a boy she once loved, a boy made of lies and betrayal. Now a king, Maven continues weaving his web in an attempt to maintain control over his country - and his prisoner. As Mare remains trapped in the palace, the remnants of the Red Rebellion continue organizing and expanding. As they prepare for war, no longer able to linger in the shadows, Cal - the exiled prince with his own claim on Mare\'s heart - will stop at nothing to bring her back. Blood will turn on blood and allegiances will be tested on every side. If the Lightning Girl\'s spark is gone, who will light the way for the rebellion? ********* Read the bestselling RED QUEEN series in full: Book 1: RED QUEEN Book 2: GLASS SWORD Book 3: KING\'S CAGE Book 4: WAR STORM *********', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:31:09', '2021-03-05 23:31:09'),
(591, 'Glass Sword', 'Glass-Sword', 'http://books.google.com/books/content?id=2xFVjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2xFVjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409150749', 'From the NEW YORK TIMES number one bestselling author of RED QUEEN. If there\'s one thing Mare Barrow knows, it\'s that she\'s different. Mare\'s blood is red - the colour of common folk - but her Silver ability, the power to control lightning, has turned her into a weapon that the royal court wants to control. Pursued by the vengeful Silver king, Mare sets out to find and recruit other Red-and-Silver fighters to join the rebellion. But Mare finds herself on a deadly path, at risk of becoming exactly the kind of monster she is trying to defeat. Will she shatter under the weight of the lives that are the cost of rebellion? Or have treachery and betrayal hardened her forever?', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:31:10', '2021-03-05 23:31:10'),
(592, 'Look What You Made Me Do', 'Look-What-You-Made-Me-Do', 'http://books.google.com/books/content?id=FlQyswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FlQyswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509848737', 'Not all abuse leaves a mark - a powerful memoir of coercive control Helen\'s first husband controlled her life, from the people she saw to what was in her bank account. He alienated her from friends and family and even from their three daughters. Eventually, he threw her out and she painfully began to rebuild her life.Then, divorced and in her early forties, she met Franc. Kind, charming, considerate Franc. For ten years she would be in his thrall, even when he too was telling her what to wear, what to eat, even what to think. Look What You Made Me Do is her candid and utterly gripping memoir of how she was trapped by a smiling abuser, not once but twice. It is a vital guide to recognising, understanding and surviving this sinister form of abuse and its often terrible legacy. It is also an inspirational account of how one woman found the courage to walk away.', NULL, 134, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(593, 'Red Queen', 'Red-Queen', 'http://books.google.com/books/content?id=2GUSngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2GUSngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409150725', 'This is a world divided by blood - red or silver. The Reds are commoners, ruled by a Silver elite in possession of god-like superpowers. And to Mare Barrow, a seventeen-year-old Red girl from the poverty-stricken Stilts, it seems like nothing will ever change. That is, until she finds herself working in the Silver Palace. Here, surrounded by the people she hates the most, Mare discovers that, despite her red blood, she possesses a deadly power of her own. One that threatens to destroy the balance of power. Fearful of Mare\'s potential, the Silvers hide her in plain view, declaring her a long-lost Silver princess, now engaged to a Silver prince. Despite knowing that one misstep would mean her death, Mare works silently to help the Red Guard, a militant resistance group, and bring down the Silver regime. But this is a world of betrayal and lies, and Mare has entered a dangerous dance - Reds against Silvers, prince against prince, and Mare against her own heart . . .', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(594, '12 Rules for Life', '12-Rules-for-Life', 'http://books.google.com/books/content?id=Iqq4tQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Iqq4tQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141988511', 'What\'s refreshing about Peterson is his brutal common sense\' Tim Stanley, Daily Telegraph `Everyone must read 12 Rules For Life, by Jordan B. Peterson. It is the most enlightening book I have read in ages. Google him if you like, if it makes you feel better. It will, by the way. His YouTube lectures are amazing for all sorts of reasons. But get the book, that is the most important thing. And then read it. And then pass it on to a friend, or even better, an enemy\' Chris Evans', NULL, 135, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(595, 'Black Water Lilies', 'Black-Water-Lilies', 'http://books.google.com/books/content?id=BwtSvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BwtSvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474601764', '\'Ends with one of the most reverberating shocks in modern crime fiction\' Sunday Times This is the story of a mystery, of thirteen days that begin with one murder and end with another. Jérôme Morval, a man whose passion for art was matched only by his passion for women, has been found dead in the stream that runs through the gardens at Giverny, where Monet did his famous paintings. In Jérôme\'s pocket is a postcard of Monet\'s Water Lilies with the words: Eleven years old. Happy Birthday. Entangled in the mystery are three women: a young painting prodigy, the seductive village schoolteacher and an old widow who watches over the village from a mill by the stream. All three of them share a secret. But what do they know about the discovery of Jérôme Morval\'s corpse? And what is the connection to the mysterious Black Water Lilies, a rumoured masterpiece by Monet that has never been found... \'This elegant crime mystery shimmers as delicately as the paintings of Claude Monet that lie at its heart . . . A bestseller in France, it is a dazzling, unexpected and haunting masterpiece\' Daily Mail \'An enchanting tale that kept me absolutely hooked as Bussi cleverly breaks all the perceived rules of plotting in a story containing riddles within riddles . . . stunning\' Daily Express', NULL, 136, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(596, 'The Ex', 'The-Ex', 'http://books.google.com/books/content?id=awmXjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=awmXjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780571328161', '', NULL, 137, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(597, 'The Choice', 'The-Choice', 'http://books.google.com/books/content?id=LQXqnAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LQXqnAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780349414683', '***THE TOP-TEN EBOOK BESTSELLER*** \'Beautifully written, taunt, tense and very clever. Definitely one to watch out for in 2017\' Claire Douglas, Sunday Times bestselling author of Last Seen Alive. For fans of The Couple Next Door, I See You and He Said/She Said, The Choice is a hypnotic suspense debut from a remarkable new talent and explores the terrifying Sophie\'s Choice scenario: What if you had to choose between your children? Then: Madeleine lived for her children. She\'d always believed she\'d die for them too. But on the morning of her twins\' tenth birthday her love was put to the test when a killer knocked on their door and forced her to make a devastating choice: which child should live, and which should die - her son, or her daughter? Now: Madeleine stands silent on the periphery of her fractured family, trying desperately to unravel why her world was so suddenly blown apart. But as memories of everything leading up to that tragic day return in agonising flashes, she begins to realise her family\'s life still hangs terrifyingly in the balance... \'Astonishing\' Karen Dionne \'Nail-biting\' Saskia Sarginson \'Brilliant\' Lisa Hall \'Mind-twisting\' Alex Caan \'Exceptional\' Claire Allan \'Enthralling\' Liz Loves Books \'Devastating\' Eleanor Moran \'Addictive\' Netgalley reviewer', NULL, 138, 1, NULL, 100.00, NULL, '2021-03-05 23:31:11', '2021-03-05 23:31:11'),
(598, 'Man vs Maths', 'Man-vs-Maths', 'http://books.google.com/books/content?id=JbhTMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=JbhTMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781781316900', 'What is the mathematics behind a twitter trend? Does my food really have an equation? And, is there really an algorithm for Love? Mathematics is inescapable. Wherever you go, whatever you do, however you live your life, mathematics plays a role. From searching for love to donating a kidney, the mathematics governing our world is fascinating, and far reaching. Using interesting anecdotes, simple analogies, and easy explanations, Man vs Maths will distill the complexities of some of the most absorbing mathematics of modern life. Along the way we will look at why Netflix offered a $1 million prize for help with their mathematics, why the universe has a favourite number, and how knowing a little mathematics can improve your life.', NULL, 139, 1, NULL, 100.00, NULL, '2021-03-05 23:31:12', '2021-03-05 23:31:12');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(599, 'The Confession', 'The-Confession-9781509886142', 'http://books.google.com/books/content?id=srlpwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=srlpwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509886142', 'The sensational new novel from the million-copy bestselling author of The Miniaturist and The Muse.One winter\'s afternoon on Hampstead Heath in 1980, Elise Morceau meets Constance Holden and quickly falls under her spell. Connie is bold and alluring, a successful writer whose novel is being turned into a major Hollywood film. Elise follows Connie to LA, a city of strange dreams and swimming pools and late-night gatherings of glamorous people. But whilst Connie thrives on the heat and electricity of this new world where everyone is reaching for the stars and no one is telling the truth, Elise finds herself floundering. When she overhears a conversation at a party that turns everything on its head, Elise makes an impulsive decision that will change her life forever.Three decades later, Rose Simmons is seeking answers about her mother, who disappeared when she was a baby. Having learned that the last person to see her was Constance Holden, a reclusive novelist who withdrew from public life at the peak of her fame, Rose is drawn to the door of Connie\'s imposing house in search of a confession ... From the million-copy bestselling author of The Miniaturist and The Muse, this is a luminous, powerful and deeply moving novel about secrets and storytelling, motherhood and friendship, and how we lose and find ourselves.PRAISE FOR THE CONFESSION \'Dazzlingly good. The Confession is that rare thing: an utterly engrossing novel which asks big questions without ever once losing sight of the storyteller\'s need to entertain and move. I turned the final pages in tears and I know already I shall return to it again and again. Without doubt one of the best novels of recent years.\' Elizabeth Day, author of The Party and How To Fail\'I haven\'t enjoyed a book so much in a long time . . . I lost myself in the story, not wanting to come up for air. A bold, intelligent, wonderful novel\' Sarah Winman, author of Tin Man\'Burton is asking important questions in The Confession - questions about motherhood, art and creativity, love, friendship - and in doing this, she has created three utterly fascinating characters. Connie, Elise, and Rose are complicated; complex in ways that women are so rarely allowed to be in literature, demanding that their stories be heard. This is a beautiful novel and one that will stay with me for a very long time\' Louise O\'Neill, author of Only Ever Yours\'an absorbing, intelligent piece of storytelling\' Guardian', NULL, 123, 1, NULL, 100.00, NULL, '2021-03-05 23:31:12', '2021-03-05 23:31:12'),
(600, 'Kingfishers Catch Fire', 'Kingfishers-Catch-Fire', 'http://books.google.com/books/content?id=o23XLwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=o23XLwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781844088423', 'Sophie, an English ingénue with two children, arrives in Himalayan Kashmir to set up home in a tumbledown cottage surrounded by flowers and herbs. Settling down to live quietly, frugally and peacefully with her new neighbours, she is unaware of the turmoil her arrival provokes as the villagers compete fiercely for her patronage. Sophie\'s cook makes a drastic bid to secure his position, and the unwanted consequences are catastrophic . ..', NULL, 140, 1, NULL, 100.00, NULL, '2021-03-05 23:31:12', '2021-03-05 23:31:12'),
(601, 'Earth to Earth', 'Earth-to-Earth', 'http://books.google.com/books/content?id=KRIjtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=KRIjtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781910787748', 'From the earliest pagan sites to modern urban cemeteries, burial grounds have alwaysenjoyed a sacred, protected status in the history of society. Consequently they have becometranquil oases in which wildlife can flourish - a microcosm of the natural habitat long sincedisappeared from the surrounding area. In Earth to Earth, Professor Stefan Buczacki uncovers the wild animals and plants that thriveamongst the headstones, from the graveyard beetle to the mighty yew. He also explores thehistory of churchyards and the landscape, as well as what can be done to conserve themfor future generations. Accompanied by specially commissioned illustrations by Felicity Price-Smith and selectedquotations, this beautiful gift book reveals the natural secrets to be found in God\'s Acre.', NULL, 141, 1, NULL, 100.00, NULL, '2021-03-05 23:31:12', '2021-03-05 23:31:12'),
(602, 'Infinity in the Palm of Your Hand', 'Infinity-in-the-Palm-of-Your-Hand', 'http://books.google.com/books/content?id=yNXOswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yNXOswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782439493', 'Did you know that you could fit the whole human race in the volume of a sugar cube? Or that the electrical energy in a single mosquito is enough to cause a global mass extinction? Or that we are all, in fact, living in a giant hologram? Or perhaps, most importantly of all, out there in the universe there are an infinite number of copies of you reading an infinite number of copies of this? Using these impossible-sounding truths, Marcus Chown reveals some of the most significant scientific discoveries in human history about who we are, where we came from and the complexities and wonders of our universe. Witty, engaging and accessible, Infinity in the Palm of Your Hand brings to life the forces that rule our universe and reveals the intriguing details of our existence.', NULL, 142, 1, NULL, 100.00, NULL, '2021-03-05 23:31:12', '2021-03-05 23:31:12'),
(603, 'All That Glisters ...', 'All-That-Glisters-...', 'http://books.google.com/books/content?id=6WoqtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6WoqtQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782439974', 'Quotations - or snippets from them - are commonly used in everyday speech, most often without the speaker knowing where they came from. From words of comfort to advice for the lovelorn, you can bet that someone, somewhere has come up with phraseology that perfectly sums up whatever situation you find yourself in and put it more succinctly than you could ever dream of.In All That Glisters . Caroline Taggart presents some of the pithiest, wisest and most fascinating quotations we should all know, detailing where the quotation has come from and why it may be useful when searching for an elegant or informed line to illustrate a point, spice up conversation or impress one\'s friends.Part of the pleasure of this book is to reveal the provenance of the well-worn quote (or misquote) - my cup runneth over, ay, there\'s the rub, to err is human, the spice of life - but also to introduce some less familiar ones. Most of the quotations included are from classic sources - from the Bible, the works of Shakespeare, other poets, classical authors, Dickens (God bless us everyone, waiting for something to turn up, very humble), Charlotte Bronte (Reader, I married him) and George Bernard Shaw (who didn\'t actually say Youth is wasted on the young, but may have said something like it. Somewhere. No one seems to know for sure).This entertaining and informed - but not too serious - take on the wit and wisdom of the last 2000 years is ideal for modern readers who like their knowledge in tweet-sized chunks.', NULL, 143, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(604, 'Edith\'s Diary', 'Edith\'s-Diary', 'http://books.google.com/books/content?id=hydzngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hydzngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780349004556', 'Edith Howland\'s diary is her most precious possession, and as she is moving house she is making sure it\'s safe. A suburban housewife in fifties America, she is moving to Brunswick with her husband Brett and her beloved son, Cliffie, to start a new life for them all. She is optimistic, but most of all she has high hopes for her new venture with Brett, a local newspaper, the Brunswick Corner Bugle. Life seems full of promise, and indeed, to read her diary, filled with her most intimate feelings and revelations, you would never think otherwise. Strange, then, that reality is so dangerously different . . .', NULL, 144, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(605, 'I Made a Mistake', 'I-Made-a-Mistake', 'http://books.google.com/books/content?id=PETTxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PETTxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241984659', 'IT STARTED WITH A KISS... AND ENDED WITH MURDER. The darkly addictive new novel from the Sunday Times bestselling author of I Looked Away, Blood Sisters and My Husband\'s Wife. -------------------------------------------------------- In Poppy Page\'s mind, there are two types of women in this world: those who are faithful to their husbands, and those who are not. Until now, Poppy has never questioned which she was. But when handsome, charming Matthew Gordon walks back into her life after almost two decades, that changes. Poppy makes a single mistake - and that mistake will be far more dangerous than she could imagine. Someone is going to pay for it with their life . . . -------------------------------------------------------- WHAT PEOPLE ARE SAYING ABOUT I MADE A MISTAKE \'Absolutely brilliant...full of twists and turns that left me positively breathless\' Angela Marsons \'A python of a book; it draws you in gently at first and then the coils of tension begin to tighten and refuse to let you go...\' Jane Shemilt \'A chilling maze of twists and turns, bestseller Jane Corry\'s latest thriller will have you hooked from page one\' OK \'Readers you are in for a tremendous treat - a roller-coaster of a ride that will leave you screaming, \'No!\' on more than one occasion\' Carol Wyer \'What an addictive read! Extremely clever storytelling with terrific pace and real emotional depth too. I loved it\' Teresa Driscoll \'Corry often explores darker themes, and those living on the fringes of society and this book is no exception: gritty, real, interesting and clever. Highly recommended\' Gillian McAllister \'Jane Corry\'s psychological thrillers have sold more than a million copies so far, and this is the most gripping yet\' Sunday Express \'I Made a Mistake is an absorbing and gripping masterpiece, skilfully plotted with superbly drawn characters who will stay with you long after you\'ve finished reading\' Kathryn Croft \'I love all Jane Corry\'s books but this is her best yet. So clever, compulsive and twisty with a reveal I never saw coming. Superb\' Claire Douglas \'Fans of Louise Doughty and Clare Mackintosh will love I Made a Mistake. Exhilarating and heartbreaking in equal measure, this story will stay with me for a long time\' Nuala Ellwood', NULL, 146, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(606, 'November 9', 'November-9', 'http://books.google.com/books/content?id=7CHdsgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7CHdsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471154621', 'Fallon meets Ben, an aspiring novelist, the day before her scheduled cross-country move. Their untimely attraction leads them to spend Fallon\'s last day in L.A. together, and her eventful life becomes the creative inspiration Ben has always sought for his novel. Over time and amidst the various relationships and tribulations of their own separate lives, they continue to meet on the same date every year. Until one day Fallon becomes unsure if Ben has been telling her the truth or fabricating a perfect reality for the sake of the ultimate plot twist. Can Ben\'s relationship with Fallon - and simultaneously his novel - be considered a love story if it ends in heartbreak?', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(607, 'This is Going to Hurt', 'This-is-Going-to-Hurt', 'http://books.google.com/books/content?id=ps1CswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ps1CswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509858637', 'THE MILLION COPY BESTSELLER BOOK OF THE YEAR AT THE NATIONAL BOOK AWARDS \'Painfully funny. The pain and the funniness somehow add up to something entirely good, entirely noble and entirely loveable.\' - Stephen Fry Welcome to the life of a junior doctor: 97-hour weeks, life and death decisions, a constant tsunami of bodily fluids, and the hospital parking meter earns more than you. Scribbled in secret after endless days, sleepless nights and missed weekends, Adam Kay\'s This is Going to Hurt provides a no-holds-barred account of his time on the NHS front line. Hilarious, horrifying and heartbreaking, this diary is everything you wanted to know - and more than a few things you didn\'t - about life on and off the hospital ward. Sunday Times Number One Bestseller for over eight months and winner of a record FOUR National Book Awards: Book of the Year, Non-Fiction Book of the Year, New Writer of the Year and Zoe Ball Book Club Book of the Year. This edition includes extra diary entries and a new afterword by the author.', NULL, 148, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(608, 'We Own the Sky', 'We-Own-the-Sky', 'http://books.google.com/books/content?id=QdRTswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QdRTswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409172284', '\'Prepare to weep - I defy anyone to read this and not have a tear in their eye.\' reviewer, 5 stars \"Anyone who wishes David Nicholls would write faster needs to grab this with both hands.\" Jill Mansell An emotional page-turner with a heart-pounding dilemma. Fans of Jodi Picoult, David Nicholls and Jojo Moyes will love We Own The Sky. Anna and Rob were the perfect couple with their whole lives in front of them. When beautiful baby boy Jack came along, their world seemed complete. But when tragedy strikes they are faced with an impossible choice. They have one chance to save their child, but at what cost? \"...a touching narrative of first love and fatherhood\" The Sunday Times **** Praise for We Own The Sky \'A beautiful, hugely emotional story.\' - The Sun \'A heartbreaking read about love and loss.\' - Bella Magazine \'Prepare to have your heart wrenched by this emotion-drenched story.\' - Sunday Mirror \'This tender depiction of a father\'s love for his son is utterly heartbreaking and will stay with you long after the book has finished.\' - The Express \'Deeply affecting. A beautiful, remarkable book.\' - Lucy Diamond, author of The Secrets of Happiness Utterly beautiful, heartbreaking and ultimately uplifting. - Rachael Lucas, author of The State of Grace What an incredible book this is - such gut-wrenching honesty and depth of emotion. Anyone who wishes David Nicholls would write faster needs to grab this with both hands. It\'s a truly stunning achievement. - Jill Mansell Beautifully rendered and profoundly moving, We Own the Sky illustrates the lengths we\'ll go to for those we love. Luke Allnutt is a major new talent in fiction and his debut is not to be missed. - Camille Pagán, bestselling author of Life and Other Near-Death Experiences ***** What readers are saying about We Own The Sky: Emotional and moving. - 5* review, Amazon This is a truly beautiful story told from the heart and written with such great feeling. - 5* review, Amazon I loved this book for its honesty, it\'s rawness and for its abundance of pure love. It made me laugh, it made me cry, and it will, I know, stay with me for a very long time. - 5* review, Amazon We Own The Sky by Luke Allnutt is a story about despair and fear, but it is also sprinkled throughout with hope and love - the love one has for their child and how far you would go for them. A stunning debut and should be on everyone\'s to-read list this year. - 5* review, Amazon', NULL, 149, 1, NULL, 100.00, NULL, '2021-03-05 23:31:13', '2021-03-05 23:31:13'),
(609, 'Syren', 'Syren', 'http://books.google.com/books/content?id=aA6IIavq7rQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=aA6IIavq7rQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781408814895', 'The Magykal bestselling series relaunched with a fabulous new jacket design across the series. Enter the world of Septimus Heap, Wizard Apprentice. Magyk is his destiny.', NULL, 150, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(610, 'Physik', 'Physik', 'http://books.google.com/books/content?id=6hwc8qXemx8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6hwc8qXemx8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781408814918', 'The Magykal bestselling series relaunched with a fabulous new jacket design across the series. Enter the world of Septimus Heap, Wizard Apprentice. Magyk is his destiny.', NULL, 150, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(611, 'Queste', 'Queste', 'http://books.google.com/books/content?id=gk7Uwp7Dtk4C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gk7Uwp7Dtk4C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408814901', 'The Magykal bestselling series relaunched with a fabulous new jacket design across the series. Enter the world of Septimus Heap, Wizard Apprentice. Magyk is his destiny.', NULL, 150, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(612, 'The Hate U Give', 'The-Hate-U-Give', 'http://books.google.com/books/content?id=MHAJMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=MHAJMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406372151', 'A powerful and brave YA novel about what prejudice looks like in the 21st century. Sixteen-year-old Starr lives in two worlds: the poor neighbourhood where she was born and raised and her posh high school in the suburbs. The uneasy balance between them is shattered when Starr is the only witness to the fatal shooting of her unarmed best friend, Khalil, by a police officer. Now what Starr says could destroy her community. It could also get her killed. Inspired by the Black Lives Matter movement, this is a powerful and gripping YA novel about one girl\'s struggle for justice. Movie rights have been sold to Fox, with Amandla Stenberg (The Hunger Games) to star. Inspired by the Black Lives Matter movement. Movie rights sold to Fox 2000 after a heated bidding war. George Tillman Jr is to direct (Men of Honor) and Amandla Stenberg (The Hunger Games) to star. To date rights have sold in 12 territories, with multiple-way auctions in the UK and the US.', NULL, 151, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(613, 'On the Come Up', 'On-the-Come-Up', 'http://books.google.com/books/content?id=RJP2swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=RJP2swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406372168', 'From the visionary Angie Thomas comes a story about hip-hop, prejudice, and fighting for your dreams. Sixteen-year-old Bri wants to be one of the greatest rappers of all time. It\'s hard to get your come up, though, when you\'re labeled \"trouble\" at school and your fridge at home is empty after your mom loses her job. But Bri\'s success is all that stands between her family and homelessness, so she doesn\'t just want to make it - she has to. Even if it means becoming exactly what the public expects her to be.', NULL, 151, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(614, 'The Fault in Our Stars', 'The-Fault-in-Our-Stars', 'http://books.google.com/books/content?id=4JEnMQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4JEnMQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141345659', 'John Green\'s witty yet heart-breaking tour de force. The multi-million #1 bestseller, now a major motion picture starring Shailene Woodley and Ansel Elgort. \"I fell in love the way you fall asleep: slowly, then all at once.\"Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a gorgeous plot twist named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel\'s story is about to be completely rewritten.Insightful, bold, irreverent, and raw, The Fault in Our Stars is award-winning author John Green\'s most ambitious and heartbreaking work yet, brilliantly exploring the funny, thrilling, and tragic business of being alive and in love.Sunday Times (Culture)\'A touching, often fiercely funny novel\'The Sun on Sunday (Fabulous Magazine)\'So good I think it should be compulsory reading for everyone!\'Daily Express\'John Green brilliantly captures the voices of a young generation while instilling it with the wisdom of a life that has lived too much yet will never live enough.Rather than depressing, the book is filled with dark humour and is written with a beautiful simplicity that draws the reader in so deeply that it\'s not just the twist and turns but the gently bends and curves that you feel tugging at your emotions... No doubt in the end you will cry but you will also feel that you have discovered a little something about living\'Daily Telegraph\'The novel, written for teenagers, but proving even more popular with adults\'The Metro - 2013 Best FictionThe YA crossover hit of the year. The love affair of two terminally ill teenagers could be mawkish. In fact, it\'s funny, clever, irreverent and life-affirming.The Guardian\'A Smart Book\'Grazia\'So good!\'Good Housekeeping\'John Green may write for young adults, but his intelligent sensitive style means The Fault in Our Starsdefies categorisation... as funny as it is heartbreaking... we defy you not to fall in love with its main characters, Hazel and Augustus.\'The Tablet\'A humourous and poignant love story... It\'s terrifically funny... as well as a moving exploration of loss and grief. And no, it\'s so much not just for teenage cancer sufferers... it\'s for everyone.\'Bliss\'If you need inspiration when it comes to making the most of a moment, this one is for you\'Mizz\'Exploring the funny, thrilling and tragic business of being alive and in love, this is a life-affirming tale of two teenagers who are terminally ill. Insightful, bold, irreverent and raw, if this doesn\'t make you cry, it\'ll definitely make you think, laugh and maybe even fall in love yourself!\'** A thought-provoking love story from the New York Times bestselling author of Looking for Alaska, An Abundance of Katherines, Paper Towns and - with David Levithan - Will Grayson, Will Grayson.** John Green has over 2.3 million Twitter followers, and more than 2.1 million subscribers to Vlogbrothers, the YouTube channel he created with his brother, Hank. ** The Fault in Our Stars will capture a crossover audience in the same vein as Zadie Smith, David Nicholls\' One Day and Before I Die by Jenny Downham. ** \'Electric . . . Filled with staccato bursts of humor and tragedy\' - Jodi Picoult** \'A novel of life and death and the people caught in between, The Fault in Our Stars is John Green at his best. You laugh, you cry, and then you come back for more\' - Markus Zusak, author of The Book ThiefJohn Green is an award-winning, New York Times bestselling author whose many accolades include the Printz Medal, a Printz Honor, and the Edgar Award. With his brother, Hank, John is one half of the Vlogbrothers (youtube.com/vlogbrothers), one of the most popular online video projects in the world. John lives with his wife and children in Indianapolis, Indiana.', NULL, 152, 1, NULL, 100.00, NULL, '2021-03-05 23:31:14', '2021-03-05 23:31:14'),
(615, 'Chosen', 'Chosen', 'http://books.google.com/books/content?id=W5WhxAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=W5WhxAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471183270', 'Nina continues to learn how to use her slayer powers against enemies old and new in this second novel in the New York Times bestselling series from Kiersten White, set in the world of Buffy the Vampire Slayer. Now that Nina has turned the Watcher\'s Castle into a utopia for hurt and lonely demons, she\'s still waiting for the utopia part to kick in. With her sister Artemis gone and only a few people remaining at the castle--including her still-distant mother--Nina has her hands full. Plus, though she gained back her Slayer powers from Leo, they\'re not feeling quite right after being held by the seriously evil succubus Eve, a.k.a. fake Watcher\'s Council member and Leo\'s mom. And while Nina is dealing with the darkness inside, there\'s also a new threat on the outside, portended by an odd triangle symbol that seems to be popping up everywhere, in connection with Sean\'s demon drug ring as well as someone a bit closer to home. Because one near-apocalypse just isn\'t enough, right? The darkness always finds you. And once again, it\'s coming for the Slayer. \"Will get Buffy fans up in their feels.\" --Entertainment Weekly on Slayer', NULL, 153, 1, NULL, 100.00, NULL, '2021-03-05 23:31:15', '2021-03-05 23:31:15'),
(616, 'The Perks of Being a Wallflower', 'The-Perks-of-Being-a-Wallflower', 'http://books.google.com/books/content?id=apKEMAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=apKEMAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471116148', 'Shy, introspective, intelligent beyond his years, caught between trying to live his life and trying to run from it, Charlie is attempting to navigate through the uncharted territory of high school. The world of first dates and mixed tapes, family dramas and new friends. The world of sex, drugs, and music - when all one requires to feel infinite is that perfect song on that perfect drive. Standing on the fringes of life Charlie has a unique perspective of the world around him, but there comes a time to stop being a wallflower and see what it looks like from the dance floor. This haunting novel about the dilemma of passivity vs. passion has become a modern classic. Charlie\'s letters are singular and unique, hilarious and devastating and through Charlie, Stephen Chbosky has created a deeply affecting story that will spirit you back to those wild and poignant roller coaster days known as growing up.', NULL, 155, 1, NULL, 100.00, NULL, '2021-03-05 23:31:15', '2021-03-05 23:31:15'),
(617, 'The Next Person You Meet in Heaven', 'The-Next-Person-You-Meet-in-Heaven', 'http://books.google.com/books/content?id=PIyfvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PIyfvgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751571905', 'Fifteen years ago, in Mitch Albom\'s beloved novel, The Five People You Meet in Heaven, the world fell in love with Eddie, a grizzled war veteran- turned-amusement park mechanic who died saving the life of a young girl named Annie. Eddie\'s journey to heaven taught him that every life matters. Now, in this magical sequel, Mitch Albom reveals Annie\'s story. The accident that killed Eddie left an indelible mark on Annie. It took her left hand, which needed to be surgically reattached. Injured, scarred, and unable to remember why, Annie\'s life is forever changed by a guilt-ravaged mother who whisks her away from the world she knew. Bullied by her peers and haunted by something she cannot recall, Annie struggles to find acceptance as she grows. When, as a young woman, she reconnects with Paulo, her childhood love, she believes she has finally found happiness. As the novel opens, Annie is marrying Paulo. But when her wedding night day ends in an unimaginable accident, Annie finds herself on her own heavenly journey - and an inevitable reunion with Eddie, one of the five people who will show her how her life mattered in ways she could not have fathomed. Poignant and beautiful, filled with unexpected twists, The Next Person You Meet in Heaven reminds us that not only does every life matter, but that every ending is also a beginning - we only need to open our eyes to see it.', NULL, 156, 1, NULL, 100.00, NULL, '2021-03-05 23:31:15', '2021-03-05 23:31:15'),
(618, 'Everything, Everything', 'Everything,-Everything', 'http://books.google.com/books/content?id=2sdlCgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2sdlCgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552574235', 'You\'ve seen the amazing trailer for Everything, Everything starring Amandla Stenberg and Nick Robinson . . . Now read the incredible #1 New York Times bestselling story before you see the movie, in cinemas soon. \'Can\'t wait to see this! Absolutely loved the book\' - Zoella Maddy is allergic to the world; stepping outside the sterile sanctuary of her home could kill her. But then Olly moves in next door. And just like that, Maddy realizes there\'s more to life than just being alive. You only get one chance at first love. And Maddy is ready to risk everything, everything to see where it leads. \'Powerful, lovely, heart-wrenching, and so absorbing I devoured it in one sitting\' - Jennifer Niven, author of All the Bright Places And don\'t miss Nicola Yoon\'s #1 New York Times bestseller The Sun Is Also a Star, in which two teens are brought together just when the universe is sending them in opposite directions.', NULL, 157, 1, NULL, 100.00, NULL, '2021-03-05 23:31:15', '2021-03-05 23:31:15'),
(619, 'Out of My Mind', 'Out-of-My-Mind', 'http://books.google.com/books/content?id=KGhGmiAG5MsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=KGhGmiAG5MsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781416971719', 'Considered by many to be mentally retarded, a brilliant, impatient fifth-grader with cerebral palsy discovers a technological device that will allow her to speak for the first time.', NULL, 158, 1, NULL, 100.00, NULL, '2021-03-05 23:31:16', '2021-03-05 23:31:16'),
(620, 'Dear Mr Murray', 'Dear-Mr-Murray', 'http://books.google.com/books/content?id=CtsvswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CtsvswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473662698', 'The publishing house of John Murray was founded in Fleet Street in 1768 and remained a family firm over seven generations. Published to coincide with this \'remarkable achievement\' and in the anniversary year, Dear Mr Murray is a collection of some of the best letters from the hundreds of thousands held in the John Murray Archive. They reveal not only the story of some of the most interesting and influential books in history but also the remarkable friendships - as well as occasional animosities - between author and publisher, as well as readers, editors, printers and illustrators. Despite the incredible number of letters that were retained by the Murray family, some failed to arrive, others were delayed and some barely survived, but longevity added to the reputation and fame of John Murray and a correspondent in Canada who addressed his letter merely to \'John Murray, The World-wide famous Book & Publishing House, London, England\' as early as 1932 could be confident that his letter would arrive. Intended to entertain and inspire, and spanning more than two hundred years, Dear Mr Murray is full of literary history and curiosities: from Charles Darwin\'s response to the negative reviews of On the Origin of Species to Adrian Conan Doyle challenging Harold Nicolson to a duel for insulting his father in the press; from David Livingstone\'s displeasure at the proposed drawing of a lion to represent his near-death encounter in Missionary Travels to William Makepeace Thackeray apologising for his drunken behaviour; from Byron berating John Murray for being fooled by his girlfriend\'s forgery of his signature to the poet James Hogg so desperate for money that he claims he won\'t be able to afford a Christmas goose; and from Jane Austen expressing concern about printing delays to Patrick Leigh Fermor beseeching Jock Murray not to visit him until he\'d completed A Time of Gifts. Complemented by illustrations and reproductions of letters and envelopes, this is the perfect gift for book lovers everywhere.', NULL, 159, 1, NULL, 100.00, NULL, '2021-03-05 23:31:16', '2021-03-05 23:31:16'),
(621, 'Beautiful Bad', 'Beautiful-Bad', 'http://books.google.com/books/content?id=Oj-EtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Oj-EtQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781787472761', '\'Ward writes with the same compelling energy as you get in a blockbuster Netflix series\' Daily Mail \'Compelling. Filled with unexpected twists... a riveting read\' Sarah Pekkanen, author of The Wife Between Us Maddie and Ian\'s romance began when he was serving in the British Army and she was a travel writer visiting her best friend Jo in Europe. Now sixteen years later, married with a beautiful son, Charlie, they are living the perfect suburban life in Middle America. But when an accident leaves Maddie badly scarred, she begins attending therapy, where she gradually reveals her fears about Ian\'s PTSD; her concerns for the safety of their young son Charlie; and the couple\'s tangled and tumultuous past with Jo. From the Balkans to England, Iraq to Manhattan, and finally to an ordinary family home in Kansas, the years of love and fear, adventure and suspicion culminate in The Day of the Killing, when a frantic 911 call summons the police to the scene of shocking crime. But what in this beautiful home has gone so terribly bad? Perfect for fans of The Woman in the Window and The Wife Between Us.', NULL, 160, 1, NULL, 100.00, NULL, '2021-03-05 23:31:16', '2021-03-05 23:31:16'),
(622, 'Lady Midnight', 'Lady-Midnight', 'http://books.google.com/books/content?id=ysjgjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ysjgjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471116636', 'The Shadowhunters of Los Angeles star in the first novel in Cassandra Clare\'s newest series, The Dark Artifices, a sequel to the internationally bestselling Mortal Instruments series. Lady Midnight is a Shadowhunters novel. It\'s been five years since the events of City of Heavenly Fire that brought the Shadowhunters to the brink of oblivion. Emma Carstairs is no longer a child in mourning, but a young woman bent on discovering what killed her parents and avenging her losses. Together with her parabatai Julian Blackthorn, Emma must learn to trust her head and her heart as she investigates a demonic plot that stretches across Los Angeles, from the Sunset Strip to the enchanted sea that pounds the beaches of Santa Monica. If only her heart didn\'t lead her in treacherous directions... Making things even more complicated, Julian\'s brother Mark-who was captured by the faeries five years ago-has been returned as a bargaining chip. The faeries are desperate to find out who is murdering their kind-and they need the Shadowhunters\' help to do it. But time works differently in faerie, so Mark has barely aged and doesn\'t recognize his family. Can he ever truly return to them? Will the faeries really allow it? Glitz, glamours, and Shadowhunters abound in this heartrending opening to Cassandra Clare\'s Dark Artifices series.', NULL, 64, 1, NULL, 100.00, NULL, '2021-03-05 23:31:16', '2021-03-05 23:31:16'),
(623, 'The Librarian of Auschwitz', 'The-Librarian-of-Auschwitz', 'http://books.google.com/books/content?id=r5s3vwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=r5s3vwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529104776', 'For readers of The Tattooist of Auschwitz and The Choice: this is the story of the smallest library in the world - and the most dangerous. \'It wasn\'t an extensive library. In fact, it consisted of eight books and some of them were in poor condition. But they were books. In this incredibly dark place, they were a reminder of less sombre times, when words rang out more loudly than machine guns...\' Fourteen-year-old Dita is one of the many imprisoned by the Nazis at Auschwitz. Taken, along with her mother and father, from the Terezín ghetto in Prague, Dita is adjusting to the constant terror that is life in the camp. When Jewish leader Freddy Hirsch asks Dita to take charge of the eight precious books the prisoners have managed to smuggle past the guards, she agrees. And so Dita becomes the secret librarian of Auschwitz, responsible for the safekeeping of the small collection of titles, as well as the \'living books\' - prisoners of Auschwitz who know certain books so well, they too can be \'borrowed\' to educate the children in the camp. But books are extremely dangerous. They make people think. And nowhere are they more dangerous than in Block 31 of Auschwitz, the children\'s block, where the slightest transgression can result in execution, no matter how young the transgressor... The Sunday Times bestseller for readers of The Boy in the Striped Pyjamas, The Tattooist of Auschwitz and The Choice. Based on the incredible and moving true story of Dita Kraus, holocaust survivor and secret librarian for the children\'s block in Auschwitz.', NULL, 161, 1, NULL, 100.00, NULL, '2021-03-05 23:31:17', '2021-03-05 23:31:17'),
(624, 'How Not to Fall in Love, Actually', 'How-Not-to-Fall-in-Love,-Actually', 'http://books.google.com/books/content?id=SmLbjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SmLbjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471160004', 'Emma has a job in television which is distinctly less glamourous and exciting than it sounds. She\'s managed to claw her way up the ranks from Tea-Maker and Rubbish-Collector to 2nd Assistant Director (heavy on the \'assistant\'. Even heavier on the \'2nd\'). So when she finds she\'s accidentally very pregnant and at the same time accidentally very sacked (well, less accidentally: she did tell her boss to stick his job up his bum), she knows things are going to have to change. Luckily she\'s also accidentally the heir to a lovely cottage in Wimbledon, with a crazy Doberman-owning octogenarian as a neighbour and a rather sexy guy as an accidental tenant. But this baby is coming whether she likes it or not, and she needs to become the sort of person who can look after herself let alone another human being - and quickly.', NULL, 162, 1, NULL, 100.00, NULL, '2021-03-05 23:31:17', '2021-03-05 23:31:17'),
(625, 'Run Away', 'Run-Away', 'http://books.google.com/books/content?id=lDLyvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=lDLyvQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784751173', '\"Run Away confirms one of the world\'s finest thriller writers is at the very top of his game.\" PETER JAMES \"Coben never, ever lets you down - but this one is really special.\" LEE CHILD ______________________ YOUR DAUGHTER IS MISSING. YOU\'LL RISK ANYTHING TO FIND HER. And then you see her, frightened and clearly in trouble. You approach her, beg her to come home. SHE RUNS. You follow her into a dark, dangerous world where no-one is safe and murder is commonplace. NOW IT\'S YOUR LIFE ON THE LINE... ______________________ \"The modern master of the hook and twist\" DAN BROWN \"A twisty thriller that\'ll keep you up way past any sensible lights out time\" HEAT \"Wonderful ... yet another winner\" RICHARD OSMAN \"The king of twisty thrillers returns. This is worth turning off your phone for!\" CLOSER \" Coben\'s writing and storytelling are firing on all cylinders and the seemingly straightforward tale takes a sharp turn when it\'s least expected\" DAILY MAIL \"Run Away is Harlan Coben at the height of his narrative mastery... as a thriller it\'s a narcotic... unmissable.\" SHOTS MAGAZINE \"The award-winning Coben once again gets his hook into you and twists to keep you snared.\" RTE GUIDE \"Few of Harlan Coben\'s thrillers are anything less than gripping, but every now and again he writes one that exceeds his own high standards. Run Away is one.\" THE TIMES ONLINE \"A twisty, disturbing and poignant thriller\" WOMAN', NULL, 113, 1, NULL, 100.00, NULL, '2021-03-05 23:31:17', '2021-03-05 23:31:17'),
(626, 'Start with why', 'Start-with-why', 'http://books.google.com/books/content?id=n00dkgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=n00dkgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241958223', 'Why are some people and organisations more inventive, pioneering and successful than others?And why are they able to repeat their success again and again? Because in business, it doesn\'t matter what you do, it matters why you do it. Steve Jobs, the Wright Brothers, and Martin Luther King have one thing in common - they started with why. This book is for anyone who wants to inspire others, or to be inspired. www.startwithwhy.com Jacket design: Base Art Co.', NULL, 95, 1, NULL, 100.00, NULL, '2021-03-05 23:31:17', '2021-03-05 23:31:17'),
(627, 'Finding Cinderella', 'Finding-Cinderella', 'http://books.google.com/books/content?id=8QPnngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8QPnngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471137150', 'A chance encounter in the dark leads eighteen-year-old Daniel and the girl who stumbles across him to profess their love for each other. But this love has conditions: they agree it will last only one hour, and it will be only make-believe. When their hour is up and the girl rushes off like Cinderella, Daniel tries to convince himself that what happened between them seemed perfect only because they were pretending it was. Moments like that happen only in fairy tales. One year and one bad relationship later, his disbelief in love-at-first-sight is stripped away the day he meets Six: a girl with a strange name and an even stranger personality. Unfortunately for Daniel, finding true love doesn\'t guarantee a happily ever after . . . it only further threatens it. Will an unbearable secret from the past jeopardize Daniel and Six\'s only chance at saving each other?', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:31:18', '2021-03-05 23:31:18'),
(628, 'Sweetpea', 'Sweetpea', 'http://books.google.com/books/content?id=RqXwAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=RqXwAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008216719', '\'If you like your thrillers darkly comic and outrageous this ticks all the boxes\' The SunThe last person who called me \'Sweetpea\' ended up dead... I haven\'t killed anyone for three years and I thought that when it happened again I\'d feel bad. Like an alcoholic taking a sip of whisky. But no. Nothing. I had a blissful night\'s sleep. Didn\'t wake up at all. And for once, no bad dream either. This morning I feel balanced. Almost sane, for once. Rhiannon is your average girl next door, settled with her boyfriend and little dog...but she\'s got a killer secret. Although her childhood was haunted by a famous crime, Rhinannon\'s life is normal now that her celebrity has dwindled. By day her job as an editorial assistant is demeaning and unsatisfying. By evening she dutifully listens to her friend\'s plans for marriage and babies whilst secretly making a list. A kill list. From the man on the Lidl checkout who always mishandles her apples, to the driver who cuts her off on her way to work, to the people who have got it coming, Rhiannon\'s ready to get her revenge. Because the girl everyone overlooks might be able to get away with murder...', NULL, 163, 1, NULL, 100.00, NULL, '2021-03-05 23:31:18', '2021-03-05 23:31:18'),
(629, 'The Choice', 'The-Choice-9781846045127', 'http://books.google.com/books/content?id=viHZtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=viHZtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781846045127', 'THE AWARDWINNING INTERNATIONAL BESTSELLER \'Eger\'s remarkable spirit shines through in every word\' Stylist In 1944, sixteen-year-old Edith Eger was sent to Auschwitz. There she endured unimaginable experiences, including being made to dance for the infamous Josef Mengele. Over the coming months, her bravery helped her sister to survive and led to her bunkmates rescuing her during a death march. When their camp was finally liberated, Edith was pulled from a pile of bodies, barely alive. In The Choice, Edith Eger shares her life, remarkable because her years in the concentration camp encouraged her to find a hope and resilience that most of us would never think was possible. It wasn\'t easy but, as she tried to find a future for herself after the Second World War, partly by helping many others through their own versions of trauma, she discovered an honesty, strength and empowerment within herself that makes for a memorable and inspiring read. Compelling, truly remarkable, and ultimately triumphant, The Choice is the unforgettable memoir of a woman who has seen the worst and lived the best.', NULL, 164, 1, NULL, 100.00, NULL, '2021-03-05 23:31:18', '2021-03-05 23:31:18'),
(630, 'The Lost Child', 'The-Lost-Child', 'http://books.google.com/books/content?id=VT4-wwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VT4-wwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472255051', 'A tragic death. A missing baby. A long-kept secret... 1960. Thirteen-year-old Rebecca lives in fear of her father\'s temper. As a storm batters Seaview Cottage one night, she hears a visitor at the door and a violent argument ensues. By the time the police arrive, Rebecca\'s parents are dead and the visitor has fled. No one believes Rebecca heard a stranger downstairs... 2014. Iris, a journalist, is sent to cover the story of a new mother on the run with her desperately ill baby. But fatefully the trail leads to the childhood home of Iris\'s own mother, Rebecca...Seaview Cottage. As Iris races to unravel what happened the night Rebecca\'s parents were killed, it\'s time for Seaview Cottage to give up its secrets. Read The Lost Child, the heart-wrenching new novel from the author of The Girl in the Letter. If you love the novels of Kate Morton and Lucinda Riley, you will love this.', NULL, 165, 1, NULL, 100.00, NULL, '2021-03-05 23:31:18', '2021-03-05 23:31:18'),
(631, 'Taking a Chance on Love', 'Taking-a-Chance-on-Love', 'http://books.google.com/books/content?id=HHrjxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HHrjxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472263575', 'A warm, uplifting novel from the author of New Beginnings at Rose Cottage. Perfect for fans of Lucy Diamond, Sarah Morgan and Holly Martin. One question can change everything. Meet Carmen, Polly and Dana - all happy and successful women, with very different views on relationships. Carmen has made a life with Elliot for the past eight years. She\'s ready for the next step but a proposal seems to be as far away as ever. Polly is devoted to her family. But after her parents\' bitter divorce, she\'s wary of marriage - even after sharing twenty years and one son with Fraser. Single mother Dana longs for companionship, despite her dedication to raising her son Luke. Finding the right person to bring into their lives feels impossible - until a unique way to select a potential Mr Right comes along. With 29th February fast approaching, will they each take the chance this Leap Year to take control of their fates? Don\'t miss New Beginnings at Rose Cottage from Erin Green in which three women who discover that it\'s never too late for a fresh start - or to change your life story.', NULL, 167, 1, NULL, 100.00, NULL, '2021-03-05 23:31:18', '2021-03-05 23:31:18');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(632, 'The Saboteur of Auschwitz', 'The-Saboteur-of-Auschwitz', 'http://books.google.com/books/content?id=Ys6-xQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ys6-xQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781787833296', 'Forced to do hard labour, starved and savagely beaten, British soldier Arthur Dodd thought his life would end in Auschwitz. Determined to go down fighting, he risked his life to sabotage Nazi industrial work and alleviate the suffering of Jewish prisoners. This shocking true story presents the largely unknown story of the military POWs held there.', NULL, 168, 1, NULL, 100.00, NULL, '2021-03-05 23:31:19', '2021-03-05 23:31:19'),
(633, '4 Disciplines of Execution', '4-Disciplines-of-Execution', 'http://books.google.com/books/content?id=3jeCngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3jeCngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857205834', 'The Four Disciplines of Execution is about a simple, proven formula for reaching the goals you want to reach as a business or individual. In Covey\'s experience, the thing that most undermines the ability to execute goals is what he calls the Whirlwind: those urgent tasks that must be done simply to keep an organization alive. As Covey shows, the only way to execute new, important goals is to separate those goals from the Whirlwind. The Four Disciplines allow leaders to create a strategy that requires a change in behaviour, since only by ensuring that everyone on the team understands the goal, knows what to do to reach it and knows whether progress is being made, will a leader produce consistent breakthrough results while sustaining the urgent work of the Whirlwind. The Four Disciplines of Execution are:1. Focus on the Wildly Important; 2. Act on the Lead Measures; 3. Keep a Compelling Scoreboard; 4. Create a Cadence of Accountability. For more than a decade FranklinCovey has been studying what it takes to achieve important goals, and in this book they share success stories from a wide range of companies that have implemented the Four Disciplines to result in greater profits, increased market share and improved customer satisfaction. This way of thinking is essential to any company that wants to not only weather, but thrive in this economy.', NULL, 169, 1, NULL, 100.00, NULL, '2021-03-05 23:31:19', '2021-03-05 23:31:19'),
(634, 'Peaky Blinders', 'Peaky-Blinders', 'http://books.google.com/books/content?id=3miGxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3miGxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781789461725', '', NULL, 170, 1, NULL, 100.00, NULL, '2021-03-05 23:31:19', '2021-03-05 23:31:19'),
(635, 'The Eyes of Darkness', 'The-Eyes-of-Darkness', 'http://books.google.com/books/content?id=6mezjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6mezjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472240293', 'If you delight in the suspense of Stephen King and The Stranger by Harlan Coben chilled you to the bone (in the best possible way), you\'ll love The Eyes of Darkness - the classic thriller by Sunday Times and New York Times bestselling author Dean Koontz. \'Not just a master of our darkest dreams but also a literary juggler\' - The Times. Tina Evans can think of no better time for a fresh start. It\'s been a year of unbelievable heartache since her son Danny\'s death. Now the Vegas show that she directed is about to premiere, so she vows to out her grief behind her. Only there is a message for Tina, scrawled on the chalkboard in Danny\'s room. Two words that will send Tina on a terrifying journey... NOT DEAD. This book was originally published under the pseudonym Leigh Nichols.', NULL, 171, 1, NULL, 100.00, NULL, '2021-03-05 23:31:19', '2021-03-05 23:31:19'),
(636, 'Cruel Heart Broken', 'Cruel-Heart-Broken', 'http://books.google.com/books/content?id=vLGMjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vLGMjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474906494', 'Laurie is a good girl - so everyone thinks. But seven months ago she did something that she can\'t undo and it\'s tearing her apart. Charlie used to be her best friend. He\'s done something he regrets too...and now someone has died. Two impulsive decisions. Two toxic secrets. Too many hearts broken. Partly inspired by a true story, this is a heart-wrenching novel about impulsive mistakes, and their devastating consequences', NULL, 172, 1, NULL, 100.00, NULL, '2021-03-05 23:31:20', '2021-03-05 23:31:20'),
(637, 'Quiet Storm', 'Quiet-Storm', 'http://books.google.com/books/content?id=3lciw_b8etMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3lciw_b8etMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781585712267', 'This powerful novel of redemption and love follows an award-winning musician who, devoting her life to humanitarian causes after an accident leaves her blind, impacts the lives of those around her as she heals herself, and is told through the eyes of the three men who love her. Original.', NULL, 173, 1, NULL, 100.00, NULL, '2021-03-05 23:31:20', '2021-03-05 23:31:20'),
(638, 'Pop Girl', 'Pop-Girl', 'http://books.google.com/books/content?id=uCLejwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uCLejwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407159393', 'After an I-still-can\'t-believe-it brush with fame, teen singing sensation Storm Hall is determined to keep her star on the rise. She records a demo, and soon her all-time favourite label wants to sign her. And is mega-hottie rock god Jase Mahone flirting with her? A hotel suite in London, fancy cars, parties - Storm\'s finally living the dream! But life as a pop star means letting go of her old life, even the people she loves most. Is this really the dream she wants?', NULL, 174, 1, NULL, 100.00, NULL, '2021-03-05 23:31:20', '2021-03-05 23:31:20'),
(639, 'In Bloom', 'In-Bloom', 'http://books.google.com/books/content?id=qgnmswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=qgnmswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008216726', 'Darkly comic crime sequel to Sweetpea, following girl-next-door serial killer Rhiannon as she\'s now caught between the urge to kill and her unborn baby stopping her. If only they knew the real truth. It should be my face on those front pages. My headlines. I did those things, not him. I just want to stand on that doorstep and scream it: IT WAS ME. ME. ME. ME. ME! Rhiannon Lewis has successfully fooled the world and framed her cheating fianc� Craig for the depraved and bloody killing spree she committed. She should be ecstatic that she\'s free. Except for one small problem. She\'s pregnant with her ex lover\'s child. The ex-lover she only recently chopped up and buried in her in-laws garden. And as much as Rhiannon wants to continue making her way through her kill lists, a small voice inside is trying to make her stop. But can a killer\'s urges ever really be curbed?', NULL, 163, 1, NULL, 100.00, NULL, '2021-03-05 23:31:20', '2021-03-05 23:31:20'),
(640, 'Forever', 'Forever', 'http://books.google.com/books/content?id=KnXqngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=KnXqngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545682800', 'A human girl and her werewolf boyfriend must fight for their love as death comes closing in.', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:20', '2021-03-05 23:31:20'),
(641, 'King of Ashes', 'King-of-Ashes', 'http://books.google.com/books/content?id=bcgrvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bcgrvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007264865', 'A new novel from internationally bestselling author Raymond E. Feist. The world of Garn once boasted five great kingdoms, until the King of Ithrace was defeated and every member of his family executed by Lodavico, the ruthless King of Sandura, a man with ambitions to rule the world. Ithrace\'s ruling family were the legendary Firemanes, and represented a great danger to the other kings. Now four great kingdoms remain, on the brink of war. But rumour has it that the newborn son of the last king of Ithrace survived, carried off during battle and sequestered by the Quelli Nacosti, a secret society whose members are trained to infiltrate and spy upon the rich and powerful throughout Garn. Terrified that this may be true, and that the child will grow to maturity with bloody revenge in his heart, the four kings have placed a huge bounty on the child\'s head. In the small village of Oncon, Declan is apprenticed to a master blacksmith, learning the secrets of producing the mythical king\'s steel. Oncon is situated in the Covenant, a neutral region lying between two warring kingdoms. Since the Covenant was declared, the region has existed in peace, until violence explodes as slavers descend upon the village to capture young men to press as soldiers for Sandura. Declan must escape, to take his priceless knowledge to Baron Daylon Dumarch, ruler of Marquensas, perhaps the only man who can defeat Lodavico of Sandura, who has now allied himself with the fanatical Church of the One, which is marching across the continent, imposing its extreme form of religion upon the population and burning unbelievers as they go. Meanwhile, on the island of Coaltachin, the secret domain of the Quelli Nacosti, three friends are being schooled in the deadly arts of espionage and assassination: Donte, son of one of the most powerful masters of the order; Hava, a serious girl with fighting abilities that can set any opponent on their back; and Hatu, a strange, conflicted lad in whom fury and calm war constantly, whose hair is a bright and fiery shade of red...', NULL, 175, 1, NULL, 100.00, NULL, '2021-03-05 23:31:22', '2021-03-05 23:31:22'),
(642, 'Linger', 'Linger', 'http://books.google.com/books/content?id=VUcgnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VUcgnwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407145778', 'The #1 bestselling SHIVER, LINGER and FOREVER trilogy rejacketed for a new generation of fans. In SHIVER, Grace and Sam found each other. Now, in LINGER, they must fight to be together. For Grace, this means defying her parents and keeping dangerous secrets. For Sam, it means grappling with his werewolf past ... and figuring out a way to survive the future. But just when they manage to find happiness, Grace finds herself changing in ways she could never have expected...', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:22', '2021-03-05 23:31:22'),
(643, 'Forever', 'Forever-9781407145785', 'http://books.google.com/books/content?id=Slk0ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Slk0ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407145785', 'The #1 bestselling SHIVER, LINGER and FOREVER trilogy rejacketed for a new generation of fans. In SHIVER, Grace and Sam found each other. In LINGER, they fought to be together. Now, in FOREVER, the stakes are even higher than before. Wolves are being hunted. Lives are being threatened. And love is harder and harder to hold on to as death comes closing in.', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:22', '2021-03-05 23:31:22'),
(644, 'Sinner', 'Sinner', 'http://books.google.com/books/content?id=-roUrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-roUrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407145730', 'You thought it ended with FOREVER, but there\'s another story to tell - the one of Cole and Isabel. SINNER follows Cole St. Clair, a pivotal character from the #1 bestselling Shiver Trilogy. found. Cole St. Clair has come to California for one reason: to get back Isabel Culpeper. She fled from his damaged, drained life, and damaged and drained it even more. He doesn\'t just want her. He needs her. lost. Isabel is trying to build herself a life in Los Angeles. It\'s not really working. She can play the game as well as all the other fakes. But what\'s the point? What is there to win? sinner. Cole and Isabel share a past that never seemed to have a future. They have the power to love each other and the power to tear each other apart. The only thing for certain is that they cannot let go.', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:22', '2021-03-05 23:31:22'),
(645, 'Putting the One Minute Manager to Work', 'Putting-the-One-Minute-Manager-to-Work', 'http://books.google.com/books/content?id=ypaMRBrDHpMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ypaMRBrDHpMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007109623', 'How to applu the key techniques learnt in One-Minute Manager. This is the companion to the original blockbuster bestseller which has transformed business around the world.', NULL, 176, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(646, 'Hold Your Breath', 'Hold-Your-Breath', 'http://books.google.com/books/content?id=tM50xQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tM50xQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008309640', 'If you go down to the woods today, you\'re in for a big surprise... \'Exceptional\' A.J. Finn \'A smart thriller\' Gillian McAllister \'Creepy, absorbing and unnerving\' T.M. Logan Kitty Marchland has always known that her family aren\'t like others. But when her father uproots them to a remote cottage in the woods, she realises that her parents are keeping secrets from her - secrets that could unravel everything. Years later, Kitty starts to question what really happened out in the forest. When the police revisit a suspicious death, she must examine her most painful memories - and this time, there\'s nowhere to hide... A gripping and suspenseful thriller that will captivate you from first to last page. Perfect for fans of Ruth Ware and Cass Green.', NULL, 177, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(647, 'Girl, Woman, Other', 'Girl,-Woman,-Other-9780241984994', 'http://books.google.com/books/content?id=75dKyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=75dKyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241984994', 'BRITISH BOOK AWARDS AUTHOR & FICTION BOOK OF THE YEAR 2020 WINNER OF THE BOOKER PRIZE 2019 THE SUNDAY TIMES 1# BESTSELLER \'The most absorbing book I read all year.\' Roxane Gay ____________________________ This is Britain as you\'ve never read it. This is Britain as it has never been told. From Newcastle to Cornwall, from the birth of the twentieth century to the teens of the twenty-first, Girl, Woman, Other follows a cast of twelve characters on their personal journeys through this country and the last hundred years. They\'re each looking for something - a shared past, an unexpected future, a place to call home, somewhere to fit in, a lover, a missed mother, a lost father, even just a touch of hope . . . ____________________________ \'[Bernardine Evaristo] is one of the very best that we have\' Nikesh Shukla on Twitter \'A choral love song to black womanhood in modern Great Britain\' Elle \'Beautifully interwoven stories of identity, race, womanhood, and the realities of modern Britain. The characters are so vivid, the writing is beautiful and it brims with humanity\' Nicola Sturgeon on Twitter \'Bernardine Evaristo can take any story from any time and turn it into something vibrating with life\' Ali Smith, author of How to be both \'Exceptional. You have to order it right now\' Stylist \'Sparkling, inventive\' Sunday Times', NULL, 38, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(648, 'Five Steps to Happy', 'Five-Steps-to-Happy', 'http://books.google.com/books/content?id=wG4PwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wG4PwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409184584', '\'An up-lit treasure\' Red magazine Life can change in a heartbeat... When struggling actress Heidi has a life-changing accident aged 32, her world falls apart. Stuck in hospital and unable to walk, her only companion is Maud, the elderly lady in the bed next to hers. Heidi misses her flatmate, her life, her freedom - surely 32 is too young to be an amputee? But when Maud\'s aloof but attractive grandson Jack pays a visit to the ward, Heidi realises that her life isn\'t over just because it\'s different. It might not look like the life she dreamed of, but it\'s the one she\'s got - and there\'s a lot she still wants to tick off her bucket list. With Jack at her side, will Heidi take the first step back to happiness? Or is there one more surprise still in store...? A feel-good read based on the inspiring true story of journalist Ella Dove. Sometimes all it takes is one small step...', NULL, 178, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(649, 'Girls Who Rocked the World', 'Girls-Who-Rocked-the-World', 'http://books.google.com/books/content?id=hr14swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hr14swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471171017', '\"The future belongs to those who believe in the beauty of their dreams\" Eleanor Roosevelt Get ready to meet some incredible young women who made their mark on the world before turning twenty and prove that when it comes to having an impact, there\'s no such thing as too young! Whether designing famous monuments, fighting for their countries\' freedom or being political pioneers these gutsy girls have changed the way we view the world and ourselves. From Florence Nightingale to Anna Pavlova, Coco Chanel to Eva Per�n, The Bront� Sisters to Indira Gandhi, this book features women from across history and around the globe, who have all achieved remarkable things. Interspersed with the amazing accounts of girls throughout history are stories of powerful young women who are changing the world right now - girls like Winter Vinecki, the creator of the non-profit organization Team Winter, and Jazmin Whitley, the youngest designer to show at L.A. Fashion Week. It\'s never too soon to start making a difference - be inspired and empowered by this fun collection that shows girls really can rock the world!', NULL, 179, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(650, 'The Art of the Good Life', 'The-Art-of-the-Good-Life', 'http://books.google.com/books/content?id=3Zl_tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3Zl_tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473667525', 'The indispensable new work from the author of the international and Sunday Times bestseller The Art of Thinking Clearly Have you ever... · Spent too long on a powerpoint presentation? · Lost sight of what makes you happy? · Failed to reach a long-term goal? · Become infuriated by queuing, tax or parking tickets? · Broken a promise you knew you\'d keep? Since the dawn of civilization, we\'ve been asking ourselves what it means to live a good life: how should I live, what will truly make be happy, how much should I earn, how should I spend my time? In the absence of a single simple answer, what we need is a toolkit of mental models, a guide to practical living. In The Art of the Good Life, you\'ll find fifty-two intellectual shortcuts for wiser thinking and better decisions, at home and at work. They may not guarantee you a good life, but they\'ll give you a better chance.', NULL, 180, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(651, 'Linger', 'Linger-9780545682794', 'http://books.google.com/books/content?id=op8RnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=op8RnwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545682794', 'As Grace hides her deep love for Sam from her parents and Sam struggles to release his werewolf past and claim a human future, a new wolf named Cole wins Isabel\'s heart, but his own past threatens to destroy the whole pack.', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:23', '2021-03-05 23:31:23'),
(652, 'Norse Mythology', 'Norse-Mythology', 'http://books.google.com/books/content?id=dVoJtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=dVoJtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408891957', 'THE NO. 1 SUNDAY TIMES AND NEW YORK TIMES BESTSELLER \'With the deftest of touches, the characters are once again brought to life\' JOANNE HARRIS\'The halls of Valhalla have been crying out for Gaiman to tell their stories\' OBSERVERThe great Norse myths, which have inspired so much of modern fiction, are dazzlingly retold by Neil Gaiman. Tales of dwarfs and frost giants, of treasure and magic, and of Asgard, home to the gods: Odin the all-father, highest and oldest of the Aesir; his mighty son Thor, whose hammer Mjollnir makes the mountain giants tremble; Loki, wily and handsome, reliably unreliable in his lusts; and Freya, more beautiful than the sun or the moon, who spurns those who seek to control her. From the dawn of the world to the twilight of the gods, this is a thrilling, vivid retelling of the Norse myths from the award-winning, bestselling Neil Gaiman.*This book has been printed with two different cover designs. We are unable to accept requests for a specific cover. The different covers will be assigned to orders at random*', NULL, 181, 1, NULL, 100.00, NULL, '2021-03-05 23:31:24', '2021-03-05 23:31:24'),
(653, 'Big Sky', 'Big-Sky', 'http://books.google.com/books/content?id=Xs5lyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Xs5lyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552776660', 'THE NUMBER ONE SUNDAY TIMES BESTSELLER: THE RETURN OF JACKSON BRODIE, \'LIKE ALL GOOD DETECTIVES, A HERO FOR MEN AND WOMEN ALIKE\' (The Times) \'Big Sky is laced with Atkinson\'s sharp, dry humour, and one of the joys of the Brodie novels has always been that they are so funny\' (Observer) Jackson Brodie has relocated to a quiet seaside village in North Yorkshire, in the occasional company of his recalcitrant teenage son Nathan and ageing Labrador Dido, both at the discretion of his former partner Julia. It\'s a picturesque setting, but there\'s something darker lurking behind the scenes. Jackson\'s current job, gathering proof of an unfaithful husband for his suspicious wife, seems straightforward, but a chance encounter with a desperate man on a crumbling cliff leads him into a sinister network--and back into the path of someone from his past. Old secrets and new lies intersect in this breathtaking new literary crime novel, both sharply funny and achingly sad, by one of the most dazzling and surprising writers at work today.', NULL, 69, 1, NULL, 100.00, NULL, '2021-03-05 23:31:24', '2021-03-05 23:31:24'),
(654, 'Hatchet', 'Hatchet', 'http://books.google.com/books/content?id=FgZLMfXGO8EC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FgZLMfXGO8EC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330439725', 'After a plane crash, thirteen-year-old Brian spends fifty-four days in the wilderness, learning to survive initially with only the aid of a hatchet given him by his mother, and learning also to survive his parents\' divorce.', NULL, 182, 1, NULL, 100.00, NULL, '2021-03-05 23:31:24', '2021-03-05 23:31:24'),
(655, 'The Giver of Stars', 'The-Giver-of-Stars-9780718183219', 'http://books.google.com/books/content?id=jgg-zQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jgg-zQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780718183219', 'Als het huwelijk van een vrouw vanaf het begin inhoudsloos is, sluit ze zich aan bij de \'paardenbibliotheek\' van Kentucky en leert ware vriendschap en liefde kennen.', NULL, 72, 1, NULL, 100.00, NULL, '2021-03-05 23:31:24', '2021-03-05 23:31:24'),
(656, 'The Shrunken Head', 'The-Shrunken-Head', 'http://books.google.com/books/content?id=MLo7jwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=MLo7jwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444777215', 'The book is about, among other things: the strongest boy in the world, a talking cockatoo, a faulty mind reader, a beautiful bearded lady and a nervous magician, an old museum, and a shrunken head. Blessed with extraordinary abilities, orphans Philippa, Sam, and Thomas have grown up happily in Dumfrey\'s Dime Museum of Freaks, Oddities, and Wonders. Philippa is a powerful mentalist, Sam is the world\'s strongest boy, and Thomas can squeeze himself into a space no bigger than a bread box. The children live happily with museum owner Mr. Dumfrey, alongside other misfits. But when a fourth child, Max, a knife-thrower, joins the group, it sets off an unforgettable chain of events. When the museum\'s Amazonian shrunken head is stolen, the four are determined to get it back. But their search leads them to a series of murders and an explosive secret about their pasts.', NULL, 183, 1, NULL, 100.00, NULL, '2021-03-05 23:31:25', '2021-03-05 23:31:25'),
(657, 'Shiver', 'Shiver', 'http://books.google.com/books/content?id=53ysngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=53ysngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407145761', 'The #1 bestselling SHIVER, LINGER and FOREVER trilogy rejacketed for a new generation of fans. This chilling love story will have you hooked from the very first page. When a local boy is killed by wolves, Grace\'s small town becomes a place of fear. But Grace is fascinated by the pack, and finds herself drawn to a yellow-eyed wolf. There\'s something about him - something almost human. Then Grace meets a yellow-eyed boy whose familiarity takes her breath away...', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:25', '2021-03-05 23:31:25'),
(658, 'The Craftsman', 'The-Craftsman', 'http://books.google.com/books/content?id=FegHtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FegHtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409174134', 'He makes his living from death. But is he capable of murder? Florence Lovelady\'s career was made when she convicted coffin-maker Larry Grassbrook of a series of child murders 30 years ago. Like something from our worst nightmares, the victims were buried, but while they were still alive. Larry confessed the crimes; it was an open and shut case. But now he\'s dead, and events from the past start to repeat themselves. Did she get it wrong all those years ago? Or is there something much darker at play?', NULL, 184, 1, NULL, 100.00, NULL, '2021-03-05 23:31:25', '2021-03-05 23:31:25'),
(659, 'The Thunder Girls', 'The-Thunder-Girls', 'http://books.google.com/books/content?id=2sqOwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2sqOwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529017434', 'Jackie Collins for a new generation. The Thunder Girls is a blockbuster novel, filled with obsession, addiction, betrayal and revenge, that charts the rise and fall of an 80s girl band from Melanie Blake, a true insider of the music business. Perfect for fans of Tasmina Perry and Daisy Jones and The Six. Soon to be a nationwide play with an all star cast.THEChrissie, Roxanne, Carly and Anita, an eighties pop sensation outselling and out-classing their competition. Until it all comes to an abrupt end and three of their careers are over, and so is their friendship. THUNDERThirty years later, their old record label wants the band back together for a huge money-making concert. But the wounds are deep and some need this gig more than others.In those decades apart life was far from the dream they were living as members of The Thunder Girls. Breakdowns, bankruptcy, addiction and divorce have been a constant part of their lives. They\'ve been to hell and back, and some are still there. GIRLSCan the past be laid to rest for a price, or is there more to this reunion than any of them could possibly know? Whilst they all hunger for a taste of success a second time around, someone is plotting their downfall in the deadliest way possible . . .', NULL, 185, 1, NULL, 100.00, NULL, '2021-03-05 23:31:25', '2021-03-05 23:31:25'),
(660, 'Thin Air', 'Thin-Air', 'http://books.google.com/books/content?id=ZbM1DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZbM1DwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447202103', 'Thin Air is the sixth book in Ann Cleeves\' Shetland series - now a major BBC One drama starring Douglas Henshall as detective Jimmy Perez, Shetland. A group of old university friends leave the bright lights of London and travel to Unst, Shetland\'s most northerly island, to celebrate the marriage of one of their friends to a Shetlander. But late on the night of the wedding party, one of them, Eleanor, disappears - apparently into thin air. It\'s mid-summer, a time of light nights and unexpected mists. The following day, Eleanor\'s friend Polly receives an email. It appears to be a suicide note, saying she\'ll never be found alive. And then Eleanor\'s body is discovered, lying in a small loch close to the cliff edge. Detectives Jimmy Perez and Willow Reeves are dispatched to Unst to investigate. Before she went missing, Eleanor claimed to have seen the ghost of a local child who drowned in the 1920s. Her interest in the ghost had seemed unhealthy - obsessive, even - to her friends: an indication of a troubled mind. But Jimmy and Willow are convinced that there is more to Eleanor\'s death than they first thought. Is there a secret that lies behind the myth? One so shocking that someone would kill - many years later - to protect? Ann Cleeves\' striking Shetland novel explores the tensions between tradition and modernity that lie deep at the heart of a community, and how events from the past can have devastating effects on the present.Also available in the Shetland series are Raven Black, White Nights, Red Bones, Blue Lightning and Dead Water.', NULL, 186, 1, NULL, 100.00, NULL, '2021-03-05 23:31:25', '2021-03-05 23:31:25'),
(661, 'Bring Me Back', 'Bring-Me-Back', 'http://books.google.com/books/content?id=TJCHswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TJCHswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008244873', 'The million-copy bestselling author returns with a breathtaking thriller. \'We\'re in a new Golden Age of suspense writing now, because of amazing books like Bring Me Back\' Lee Child \'An addictive new voice in suspense fiction\' Sophie Hannah \'Made me stay up way beyond my bedtime!\' Jane Corry Finn and Layla: young and in love, their whole lives ahead of them. Driving back from a holiday in France one night, Finn pulls in to a service station, leaving Layla alone in the car. When he returns, minutes later, Layla has vanished, never to be seen again. That\'s the story Finn tells the police. It\'s the truth - but not the whole truth. Twelve years later, Finn has built a new life with Ellen, Layla\'s sister, when he receives a phone call. Someone has seen Layla. But is it her - or someone pretending to be her? If it is her, what does she want? And what does she know about the night she disappeared? Bring Me Back is the utterly compelling, white-knuckle thriller from Sunday Times bestseller B A Paris. \'An addictive new voice in suspense fiction\' Sophie Hannah \'Just finished this BRILLIANT book...Clever, addictive and twisty, I couldn\'t sleep until I found out the truth...The twist floored me! Utterly compelling from beginning to end\' Claire Douglas \'Made me stay up way beyond my bedtime! BA Paris has a knack for getting into your head.\' Jane Corry \'A page-turning masterpiece\' Amanda Prowse \'A tale of dark secrets, with mystery and intrigue building up and up to an ending with a fabulous twist. I devoured it - I couldn\'t turn the pages quick enough.\' Mel Sherratt \'This book is compulsive reading from start to finish. A perfectly crafted work of art, seamless and mesmerising. I envy those yet to read it for the pleasure they have in store.\' Amanda Robson \'A cracking page turner with a killer twist.\' Camilla Way \'An incredibly pacy, heart-pounding thriller - the twist at the end left me reeling. B A Paris does it again in this exhilarating exploration of love, jealousy and betrayal. A must read for 2018!\' Phoebe Morgan \'Bring Me Back will not leave your hands until you have turned the last page!\' Wendy Walker \'Bring Me Back is AWESOME. That final twist!\' Lisa Hall \'Great read and OMG that ending\' Annabel Kantaria', NULL, 187, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(662, 'Cold Earth', 'Cold-Earth', 'http://books.google.com/books/content?id=YKkWDgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YKkWDgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447278221', 'Cold Earth is the seventh book in Ann Cleeves\' Shetland series - a major BBC One drama starring Douglas Henshall.In the dark days of a Shetland winter, torrential rain triggers a landslide that crosses the main Lerwick-Sumburgh road and sweeps down to the sea. At the burial of his old friend Magnus Tait, Jimmy Perez watches the flood of mud and peaty water smash through a croft house in its path. Everyone thinks the croft is uninhabited, but in the wreckage he finds the body of a dark-haired woman wearing a red silk dress. In his mind, she shares his Mediterranean ancestry and soon he becomes obsessed with tracing her identity. Then it emerges that she was already dead before the landslide hit the house. Perez knows he must find out who she was, and how she died.Also available in the Shetland series are Raven Black, White Nights, Red Bones, Blue Lightning, Dead Water and Thin Air.', NULL, 186, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(663, 'Jerūsallama hāle dūra hai', 'Jerūsallama-hāle-dūra-hai', '', '', '9788175993488', 'Travelogue, covering different places of the world.', NULL, 188, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(664, 'Harbour Street', 'Harbour-Street', 'http://books.google.com/books/content?id=Y7M1DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Y7M1DwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447202097', 'WINNER OF THE CRIME WRITERS\' ASSOCIATION DIAMOND DAGGER AWARD 2017\"One of the best natural writers of detective fiction\" Sunday ExpressHarbour Street is the sixth book in Ann Cleeves\' crime novel series Vera - which is a major TV detective drama starring Brenda Blethyn on ITV. A KILLING. In Newcastle, Detective Joe Ashworth and his daughter Jessie travel home on the busy Metro. The train is stopped unexpectedly, and Jessie sees that one woman doesn\'t leave with the other passengers: Margaret Krukowski has been fatally stabbed. A WITNESS. No one saw the murder take place. How can this be, when the train was packed? Searching for a lead, DI Vera Stanhope heads to the quiet Northumberland town of Mardle to investigate. She can feel in her bones that the local residents know more than they are letting on: a killer is among them.A SECRET.Just days later, a second woman is murdered. Retracing the victims\' final steps, Vera finds herself searching deep into the hidden past of this seemingly innocent neighbourhood, led by clues that keep revolving around one street: why are the residents of Harbour Street so reluctant to speak? DI Vera Stanhope is back. And she wants answers.', NULL, 186, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(665, 'Those Who Walk Away', 'Those-Who-Walk-Away', 'http://books.google.com/books/content?id=fF1dngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fF1dngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780349004860', 'The honeymoon is over; the bride dead by her own hand. Ray Garrett, the grieving husband, convinces the police in Rome of his innocence, but not his father-in-law, Ed Coleman, who shoots him at point-blank range and leaves him for dead. Ray survives and follows Coleman to Venice, where the two fall into an eerie game of cat-and-mouse - Coleman obsessed with vengeance and Ray determined to save his reputation, and himself. Each is at once the hunter and the hunted in a tense duel that, as each manages to walk away, draws them nearer to death.', NULL, 144, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(666, 'Hag-Seed', 'Hag-Seed', 'http://books.google.com/books/content?id=6biDvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6biDvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099594024', 'Selected as a Book of the Year -- Observer, Sunday Times, Times, Guardian, i magazine \'It\'s got a thunderstorm in it. And revenge. Definitely revenge.\' Felix is at the top of his game as Artistic Director of the Makeshiweg Theatre Festival. His productions have amazed and confounded. Now he\'s staging a Tempest like no other: not only will it boost his reputation, it will heal emotional wounds. Or that was the plan. Instead, after an act of unforeseen treachery, Felix is living in exile in a backwoods hovel, haunted by memories of his beloved lost daughter, Miranda. And also brewing revenge. After twelve years, revenge finally arrives in the shape of a theatre course at a nearby prison. Here, Felix and his inmate actors will put on his Tempest and snare the traitors who destroyed him. It\'s magic! But will it remake Felix as his enemies fall? Margaret Atwood\'s novel take on Shakespeare\'s play of enchantment, revenge and second chances leads us on an interactive, illusion-ridden journey filled with new surprises and wonders of its own.', NULL, 189, 1, NULL, 100.00, NULL, '2021-03-05 23:31:26', '2021-03-05 23:31:26'),
(667, 'In the Heart of the Country', 'In-the-Heart-of-the-Country', 'http://books.google.com/books/content?id=AXJMnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=AXJMnwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781906509835', 'A beautifully written and wonderfully evocative volume offering descriptive imagery of rural England; the countryside and its people.', NULL, 190, 1, NULL, 100.00, NULL, '2021-03-05 23:31:27', '2021-03-05 23:31:27'),
(668, 'Stop Doing That Sh*t', 'Stop-Doing-That-Sh*t', 'http://books.google.com/books/content?id=l_sjwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=l_sjwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008344412', 'From the author of the New York Times and international bestseller Unfu*k Yourself Gary John Bishop presents a no-holds-barred guide to breaking through our cycles of self-sabotage to get what we want out of life. In Unfu*k Yourself, Gary John Bishop told us it was time to stop making excuses- to recognize and take responsibility for the negative self-talk holding us back. In Stop Doing That Sh*t, he builds on that message, teaching us how to stop self-sabotaging behavior. Bishop explains how our destructive cycles come down to the way that we\'re wired. He then identifies different types of people and the ways we fu*k ourselves over: We can\'t save money. We land in the same type of toxic relationship. We\'re stuck in a rut at work. Analysing why we act the way we do, including what our common grenades are that blow up our lives, Bishop then shows how we can interrupt the cycle and stop self-sabotaging our lives. Written in the same in your face style as Unfu*k Yourself, Stop Doing that Sh*t will help us get in touch with our psychological machinery so we learn to interrupt negative thoughts and behaviour before they start, allowing us to give our attention to something else, and start to find success in the areas we thought we never could. We can take back our lives. We may have fu*ked up in the past, but Stop Doing That Sh*t will show us how to break the patterns in order to live the lives we yearn to have.', NULL, 191, 1, NULL, 100.00, NULL, '2021-03-05 23:31:27', '2021-03-05 23:31:27'),
(669, 'FURIES.', 'FURIES.', '', '', '9780008288983', '', NULL, 192, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(670, 'A Little Princess', 'A-Little-Princess', 'http://books.google.com/books/content?id=rrBMMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rrBMMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407172699', 'Sent to an English boarding school from her home in India, privileged Sara Crewe becomes a show pupil - a \"little princess\" with luxuries bestowed upon her because of her father\'s wealth. But when her father dies, Sara\'s whole life is turned upside down as she is transformed from princess to pauper. Abused by Miss Minchin, the spiteful headmistress who treats her like a slave, Sara finds protection in her imagination and sisterly love in her friend Becky. As she struggles to hold on to the memory of her beloved father, Sara learns that strength doesn\'t come from wealth - it comes from love. After all, real little princesses are made with kindness.', NULL, 193, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(671, 'Bloodline Rising', 'Bloodline-Rising', 'http://books.google.com/books/content?id=cafDPQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cafDPQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406310238', 'This is the breath-taking second title in Katy Moran\'s \"Bloodline\" series. The Ghost is the fastest, most cunning young criminal in Constantinople. Skilled at lying and deceit, he has the power to twist the minds of men, bending them to his will. He is both invisible and invincible. Or at least he thinks so - till the day his father returns from the desert. A ruthless barbarian assassin, Essa is not pleased to discover that his wild son Cai has become the city\'s most notorious thief. But sinister forces are moving against Cai and he finds himself captive on a trading ship.The Ghost no longer, he is now a slave. But luck has not deserted him completely - the ship is bound for Britain, the home his barbarian parents fled, long ago. When he becomes a slave to Wulfhere, prince of Mercia, Cai soon discovers that his Anglish masters know more about his family than he does - what secrets have his mother and father been keeping from him? As Cai sharpens his skills of subterfuge and persuasion, war threatens, and he must choose: will he use his phenomenal talents for good, or evil?', NULL, 194, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(672, 'The Forgotten Art of Happiness', 'The-Forgotten-Art-of-Happiness', 'http://books.google.com/books/content?id=bnmIuwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bnmIuwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781724560629', '\"Ali Zakaria provides advice that is both simple and wise, both rigorous and practical. Read the book, apply its lessons, and enjoy higher levels of fulfillment and happiness\"Tal Ben-ShaharThe best-selling author of Happier: Learn the Secrets to Daily Joy and Lasting Fulfillment and lecturer on positive psychology at Harvard University.\"This book is not some lightweight personal development book about happiness, it is a down-to-earth and practical guide to happiness that includes specific tactics and strategies to help you improve your overall happiness\"Eric EdmeadesSerial Entrepreneur, International Business Speaker, and Author.\"Great, authentic book that\'s full of practical ideas. The fact that all ideas are tested by the author means that you too can do it to enjoy a happier life.\" Mohamed Tohami,Chief Dreamer and Founder, the Passion PointThey say there is scientific proof that happiness is simply a choice you can make. That, however, couldn\'t be further from the truth.As you will discover throughout the course of this book, happiness is more than a mere decision. It\'s taking life one step a time, adjusting your mindset and your choices as you travel through life\'s journey.More than that, you can never really be happy if you don\'t answer those questions that you constantly avoid. Why should I be happy? How can I forgive myself? What about the negative influences that surround me?Judge, author and founder of \"A Space To Be\" Ali Zakaria, has organized innumerable workshops and group discussions that have helped countless people discover who they really are...and now it\'s YOUR turn.Why Are You Still Postponing Happiness?Click \'Add To Cart\', Give This Book A Thorough Read & Become Your Own Beacon Of Happiness!', NULL, 195, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(673, 'The Happy Countryman', 'The-Happy-Countryman', 'http://books.google.com/books/content?id=iVnTnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iVnTnQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781906509828', 'An enchanting tribute to English country life.', NULL, 190, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(674, 'English Country Houses', 'English-Country-Houses', 'http://books.google.com/books/content?id=gfUBoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gfUBoQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781910065112', '\"There is nothing quite like the English country house anywhere else in the world.\" So pronounces Vita Sackville-West in the beautiful essay that opens English Country Houses, a brief history of the English country house from the Middle Ages to the twentieth century. People may know of Sackville West\'s novels, or her passion for gardening, or her relationship with Virginia Woolf, but few know of her efforts to boost the morale of her beloved England during World War II. Sackville-West spent her childhood years at Knole House, a stately country home that deeply influenced her life and work. In entertaining and accessible prose she brings a deep affection to the task of boosting the morale of a country beset by war. This volume in the Britain in Pictures series is a love letter to the elegant homes of the English countryside and served as a balm to a besieged country. Writing at the height of the Blitz, as cities lay in smoldering ruins after relentless bombing, Sackville-West demonstrates a yearning for the safety provided by these exceptional buildings. We discover the architecture of the stately houses, with details conveyed in such entertaining and vivid prose that the buildings and surrounding areas come to life. The story is not just about the buildings, however, but also about the people who built and lived in them, from the most common of squires to the highest-born kings and queens. Equal parts architectural history and cultural history, this insider\'s view is quintessentially British. Its elegant package, with a ribbon for bookmarking, makes it the perfect gift for any Anglophile.', NULL, 196, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28'),
(675, 'I Know My Name', 'I-Know-My-Name', 'http://books.google.com/books/content?id=uYRwvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uYRwvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008237530', '...But what if that\'s the only thing you can remember? What would you do? If you woke up on a deserted island, with no recollection of who you are and no idea how you got there, surrounded by four strangers? Your only clue to your identity is an unspeakable yearning to have a baby back in your arms. What would you do? If you were a devoted husband and father with a beautiful, successful wife, and one day you arrived home to find your wife gone, and your children alone in the house? A nationwide hunt begins for Eloise Shelley. A sweep of the family home reveals that the baby cameras were bugged - someone was spying on the Shelleys. Can we ever really know what goes on behind closed doors? Who was Eloise? Finding out might just cost her her life...', NULL, 197, 1, NULL, 100.00, NULL, '2021-03-05 23:31:28', '2021-03-05 23:31:28');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(676, 'The Ingo Chronicles: the Deep', 'The-Ingo-Chronicles:-the-Deep', 'http://books.google.com/books/content?id=7u67uAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7u67uAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007464128', 'In the depths of the ocean, a monster is stirring. Only one girl - half Mer, half human - has travelled to the bottom of the sea and returned alive. With the help of her friend the whale, Sapphy must return to the Deep to fight this terrifying creature - and her brother Conor and Mer friend Faro will not let her go alone.', NULL, 198, 1, NULL, 100.00, NULL, '2021-03-05 23:31:29', '2021-03-05 23:31:29'),
(677, 'Ingo Chronicles', 'Ingo-Chronicles', 'http://books.google.com/books/content?id=lCKyuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=lCKyuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007464111', '\"I can\'t go back in the house. I\'m restless, prickling all over. The wind hits me like slaps from huge invisible hands. But it\'s not the wind that worries me. It\'s something else, beyond the storm...\" Sapphire and Conor can\'t forget their adventures in Ingo, the mysterious world beneath the sea. They long to see their Mer friends Faro and Elvira, and swim with the dolphins once more. But a crisis is brewing far below the ocean\'s surface, where the wisest of the Mer guards the Tide Knot. And soon both Sapphire and Conor will be drawn into Ingo\'s troubled waters...', NULL, 198, 1, NULL, 100.00, NULL, '2021-03-05 23:31:29', '2021-03-05 23:31:29'),
(678, 'The Crossing of Ingo', 'The-Crossing-of-Ingo', 'http://books.google.com/books/content?id=9cnCuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9cnCuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007464135', '\"No human has ever made the Crossing of Ingo - the most dangerous journey young Mer have to face. Sappphy and Conor have been chosen for this epic challenge, and the future of both Air and Ingo depends on their success. But Ervys, his followers and new recruits, the sharks, are deteremined to stop them - dead or alive ...\" Back cover.', NULL, 198, 1, NULL, 100.00, NULL, '2021-03-05 23:31:29', '2021-03-05 23:31:29'),
(679, 'The Drowning Man', 'The-Drowning-Man', 'http://books.google.com/books/content?id=x1wKQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=x1wKQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751544220', 'A lost child. A shattered past. A life going under . . . Vincent Ruiz is lucky to be alive. A bullet in the leg, another through the hand, he is discovered clinging to a buoy in the River Thames, losing blood and consciousness fast. It takes six days for him to come out of his coma, and when he does, his nightmare is only just beginning. Because Vincent has no recollection of what happened, and nobody believes him. A mile away from his body, a boat was found covered in blood -- Vincent\'s and that of three others. Forensics say at least one of them must be dead. Vincent, a police detective, had signed his service pistol out of the station armoury, despite being on leave. Many murder suspects fake amnesia, and the investigating team are not sure this case is any different . . . The only clue is a picture in his pocket, a photograph of a young girl, Mickey Carlyle, who disappeared three years ago. And though Mickey is presumed dead, Vincent has the nagging doubt that she is alive and in terrible danger . . .', NULL, 199, 1, NULL, 100.00, NULL, '2021-03-05 23:31:29', '2021-03-05 23:31:29'),
(680, 'The Dream Keepers', 'The-Dream-Keepers', 'http://books.google.com/books/content?id=QOMLDQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QOMLDQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781612967127', 'Mona has the ability to lucid dream and astral travel. This remarkable gift gives way to a mission that she cannot complete on her own, leading her to discover just how powerful dreams can be. Mona dreams of The Dream Keepers Theme Park which is so ethereal and mystical that it doesn\'t belong in the waking world. There is so much truth to what Mona sees in her dreams that logic ceases to exist, leaving only signs and symbols for her conscious mind to try and comprehend in her waking life. The emotions that Mona goes through leaves her doubtful on who she can trust in this realm and also the astral realm. There is a darker influence at play which poses a potential threat to society, yet society remains oblivious. What Mona discovers may make her stronger, or it may destroy her. It\'s her choice.', NULL, 200, 1, NULL, 100.00, NULL, '2021-03-05 23:31:29', '2021-03-05 23:31:29'),
(681, 'The Racketeer', 'The-Racketeer', 'http://books.google.com/books/content?id=Gv8_NAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Gv8_NAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444729764', 'Number One bestseller John Grisham returns with his most suspenseful thriller yet. Given the importance of what they do, and the controversies that often surround them, and the violent people they sometimes confront, it is remarkable that in the history of the USA only four active federal judges have been murdered. Judge Raymond Fawcett just became number five. His body was found in the small basement of a lakeside cabin he had built himself and frequently used on weekends. When he did not show up for a trial on Monday morning, his law clerks panicked, called the FBI, and in due course the agents found the crime scene. There was no forced entry, no struggle, just two dead bodies - Judge Fawcett and his young secretary. I did not know Judge Fawcett, but I know who killed him, and why. I am a lawyer, and I am in prison. It\'s a long story.', NULL, 201, 1, NULL, 100.00, NULL, '2021-03-05 23:31:30', '2021-03-05 23:31:30'),
(682, 'The Litigators', 'The-Litigators', 'http://books.google.com/books/content?id=QQZupwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QQZupwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444729726', 'Law firm partners Oscar Finley and Wally Figg see a chance for huge financial gain when they learn of a pending class action lawsuit against the makers of Krayoxx, a popular cholesterol-reducing drug suspected of causing heart attacks.', NULL, 201, 1, NULL, 100.00, NULL, '2021-03-05 23:31:30', '2021-03-05 23:31:30'),
(683, 'Calico Joe', 'Calico-Joe', 'http://books.google.com/books/content?id=8ktSMAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8ktSMAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444744668', 'Thirty years have passed since eleven-year-old Paul Tracy watched his troubled father, Warren, a pitcher for the New York Mets, clash with his childhood hero, the Cubs\' golden-boy Joe Castle, in a contest from which no winners emerged. Now the news that his father is dying brings the memory of that day flooding back. Deciding that it\'s time to face up to what really happened on that baseball field in 1973, father and son make their way to Calico Rock, Arkansas, where either redemption or rejection awaits them.', NULL, 201, 1, NULL, 100.00, NULL, '2021-03-05 23:31:30', '2021-03-05 23:31:30'),
(684, 'Nineteen Eighty-Four', 'Nineteen-Eighty-Four', 'http://books.google.com/books/content?id=BjSbO-pY5t8C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BjSbO-pY5t8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141187761', 'One of Britain\'s most popular novels, George Orwell\'s dystopian tale \'Nineteen Eighty-Four\' is set in a society terrorised by a totalitarian ideology propagated by The Party. Winston Smith works for the Ministry of Truth in London, chief city of Airstrip One. Big Brother stares out from every poster, the Thought Police uncover every act of betrayal. When Winston finds love with Julia, he discovers that life does not have to be dull and deadening, and awakens to new possibilities. Despite the police helicopters that hover and circle overhead, Winston and Julia begin to question the Party; they are drawn towards conspiracy. Yet Big Brother will not tolerate dissent - even in the mind. For those with original thoughts they invented Room 101... \'Nineteen Eighty-Four\' is George Orwell\'s terrifying vision of a totalitarian future in which everything and everyone is slave to a tyrannical regime. The novel also coined many new words and phrases which regularly appear in popular culture, such as \'Big Brother\', \'thoughtcrime\', \'doublethink\' and \'Newspeak\'.', NULL, 426, 1, NULL, 100.00, NULL, '2021-03-05 23:31:30', '2021-03-05 23:31:30'),
(685, 'One Hundred Names', 'One-Hundred-Names', 'http://books.google.com/books/content?id=gmwfMgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gmwfMgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007477203', 'The uplifting and thoughtful novel from the uniquely talented author. Everyone has a story to tell... Journalist Kitty Logan\'s career has been destroyed by scandal, and she now faces losing the woman who guided her and taught her everything she knew. At her mentor\'s bedside, Kitty asks her - what is the one story she always wanted to write? The answer lies in a file buried in Constance\'s office: a list of one hundred names. There is no synopsis, no explanation, nothing else to explain what the story is or who these people are. The list is simply a mystery. But before Kitty can talk to her friend, it is too late. With everything to prove, Kitty is assigned the most important task of her life - to write the story her mentor never had the opportunity to. Kitty has to not only track down and meet the people on the list, but find out what connects them. And, in the process of hearing ordinary people\'s stories, she uncovers Constance\'s - and starts to understand her own...', NULL, 202, 1, NULL, 100.00, NULL, '2021-03-05 23:31:31', '2021-03-05 23:31:31'),
(686, 'Captain Phillips', 'Captain-Phillips', 'http://books.google.com/books/content?id=beHxAQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=beHxAQAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857502469', '8th April 2009 was just an ordinary day for 53 -year-old Richard Phillips, captain of the United States-registered cargo vessel, the Maersk Alabama, as it headed towards the port of Mombasa. Ordinary that is until, two hundred or so miles off the east coast of Africa, armed Somali pirates attacked and boarded the freighter.', NULL, 203, 1, NULL, 100.00, NULL, '2021-03-05 23:31:31', '2021-03-05 23:31:31'),
(687, 'Half a Crown', 'Half-a-Crown', 'http://books.google.com/books/content?id=fLO7ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fLO7ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472112996', 'In 1941 the European war ended in the Farthing Peace, a rapprochement between Britain and Nazi Germany. The balls and banquets of Britain\'s upper class never faltered, while British ships ferried \"undesirables\" across the Channel to board the cattle cars headed east. Peter Carmichael is commander of the Watch, Britain\'s distinctly British secret police. It\'s his job to warn the Prime Minister of treason, to arrest plotters, and to discover Jews. The midnight knock of a Watchman is the most dreaded sound in the realm. Now, in 1960, a global peace conference is convening in London, where Britain, Germany, and Japan will oversee the final partition of the world. Hitler is once again on British soil. So is the long exiled Duke of Windsor - and the rising gangs of \"British Power\" streetfighters, who consider the Government \"soft,\" may be the former king\'s bid to stage a coup d\'état. Amidst all this, two of the most unlikely persons in the realm will join forces to oppose the fascists: a debutante whose greatest worry until now has been where to find the right string of pearls, and the Watch Commander himself.', NULL, 204, 1, NULL, 100.00, NULL, '2021-03-05 23:31:31', '2021-03-05 23:31:31'),
(688, 'Farthing', 'Farthing', 'http://books.google.com/books/content?id=8j1QngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8j1QngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472112972', 'Dark, addictive, award-winning alt-hostory. the first in Jo Walton\'s small change trilogy.', NULL, 204, 1, NULL, 100.00, NULL, '2021-03-05 23:31:31', '2021-03-05 23:31:31'),
(689, 'Finale', 'Finale', '', '', '9781471123658', '', NULL, 205, 1, NULL, 100.00, NULL, '2021-03-05 23:31:32', '2021-03-05 23:31:32'),
(690, 'Monk Who Sold His Ferrari', 'Monk-Who-Sold-His-Ferrari', 'http://books.google.com/books/content?id=3s16PwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3s16PwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780061125898', 'Wisdom to Create a Life of Passion, Purpose, and Peace This inspiring tale provides a step-by-step approach to living with greater courage, balance, abundance, and joy. A wonderfully crafted fable, The Monk Who Sold His Ferrari tells the extraordinary story of Julian Mantle, a lawyer forced to confront the spiritual crisis of his out-of-balance life. On a life-changing odyssey to an ancient culture, he discovers powerful, wise, and practical lessons that teach us to: Develop Joyful Thoughts, Follow Our Life\'s Mission and Calling, Cultivate Self-Discipline and Act Courageously, Value Time as Our Most Important Commodity, Nourish Our Relationships, and Live Fully, One Day at a Time.', NULL, 206, 1, NULL, 100.00, NULL, '2021-03-05 23:31:32', '2021-03-05 23:31:32'),
(691, 'The Perks of Being a Wallflower', 'The-Perks-of-Being-a-Wallflower-9781847394071', 'http://books.google.com/books/content?id=7ipXPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7ipXPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781847394071', 'Charlie, an adolescent high-school freshman, who has been \"dented\" by tragedy, is introduced to love, literature, pot, and self-awareness.', NULL, 155, 1, NULL, 100.00, NULL, '2021-03-05 23:31:32', '2021-03-05 23:31:32'),
(692, 'Honour', 'Honour', 'http://books.google.com/books/content?id=W87lrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=W87lrQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241972946', 'My mother died twice. I promised myself I would not let her story be forgotten . . . Pembe and Adem Toprak leave Turkey for London. There they make new lives for their family. Yet the traditions and beliefs of their home come with them - carried in the blood of their children, Iskender and Esma. Trapped by past mistakes, the Toprak children find their lives torn apart and transformed by a brutal and chilling crime. Set in Turkey and London in the 1970s,Honourexplores pain and loss, loyalty and betrayal, the clash of tradition and modernity, as well as the love and heartbreak that can tear any family apart. \'Vivid storytelling, a gripping novel . . . scenes blaze with the force of parable.\' Sunday Telegraph \'A stunning novel. Exotic, evocative and utterly gripping.\' The Times \'Moving, subtle and ultimately hopeful, Honour is further proof that Shafak is the most exciting Turkish novelist to reach western readers in years.\' Irish Times \'Extraordinarily skilfully crafted . . . with Shakespearean twists and turns, omens and enigmas, prophecies and destinies.\' Independent', NULL, 207, 1, NULL, 100.00, NULL, '2021-03-05 23:31:33', '2021-03-05 23:31:33'),
(693, 'Virgin Widow', 'Virgin-Widow', 'http://books.google.com/books/content?id=m0_YQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=m0_YQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780778303756', 'I was a penniless, landless petitioner, my Neville blood a curse, my future dependent on the charity of those who despised me Anne Neville is the heiress and daughter of the greatest powerbroker in the land, Warwick the Kingmaker. Trapped in a deadly tangle of political intrigue, she is a pawn in an uncertain game, used by the houses of Neville, York and Lancaster alike. In England\'s glittering, treacherous court, not all wish to see the Nevilles raised high. The Earl of Warwick\'s ambition and pride lead him into an attempt to depose the Yorkist King; his treason forces his family into exile. Humiliated and powerless in a foreign land, Anne must find the courage and the wit to survive in such a dangerous man\'s world. Compulsively readable, Anne O Brien vividly evokes the story of Richard III\'s queen with a passion and vibrancy reminiscent of Phillipa Gregory and Alison Weir. Better than Philippa Gregory - The Bookseller Anne O Brien has joined the exclusive club of excellent historical novelists. - Sunday Express', NULL, 208, 1, NULL, 100.00, NULL, '2021-03-05 23:31:33', '2021-03-05 23:31:33'),
(694, 'Elevator Pitch', 'Elevator-Pitch', 'http://books.google.com/books/content?id=mPWlyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mPWlyQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008332037', 'De burgemeester van New York moet zien te achterhalen wie de liften in de stad gesaboteerd heeft.', NULL, 209, 1, NULL, 100.00, NULL, '2021-03-05 23:31:33', '2021-03-05 23:31:33'),
(695, 'The Turning', 'The-Turning', 'http://books.google.com/books/content?id=urbpQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=urbpQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780778303985', 'I am no coward. I want to make that perfectly clear. But after my life turned into a horror movie, I take fear a lot more seriously now. I finally became Dr Carrie Ames just eight months ago. Then I was attacked in the hospital morgue by a vampire. Now I m a vampire and it turns out I have a blood tie to the monster who sired me. And of course he\'s one of the most evil vampires on earth. With my sire hell-bent on turning me into a soulless killer and his sworn enemy set to exterminate me, things couldn\'t get much worse except I m attracted to them both. Drinking blood, living as an immortal demon and being a pawn between two warring vampire factions isn\'t exactly how I\'d imagined my future. But, as my father used to say, the only way to conquer fear is to face it. So that ­s what I ll do. Fangs bared. Love Sookie Stackhouse and Bella Swan? It ­s time to meet newly turned vampire Carrie Ames.', NULL, 210, 1, NULL, 100.00, NULL, '2021-03-05 23:31:33', '2021-03-05 23:31:33'),
(696, 'If You Go Down to the Woods', 'If-You-Go-Down-to-the-Woods', 'http://books.google.com/books/content?id=hljjswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hljjswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008280253', 'GET READY FOR THE MOST POWERFUL AND EMOTIONAL DEBUT THRILLER OF 2018! Perfect for fans of It by Stephen King, The Chalk Man by C. J. Tudor and the TV show Stranger Things. We were so young when it all happened. Just 13-years-old, making the most of the long, hot, lazy days of summer, thinking we had the world at our feet. That was us - me, Fat Bobby, Jim and Tara - the four members of the Outsiders\' Club. The day we found a burnt-out car in the woods was the day everything changed. Cold, hard cash in the front seat and a body in the trunk... it started out as a mystery we were desperate to solve. Then, the Collector arrived. He knew we had found his secret. And suddenly, our summer of innocence turned into the stuff of nightmares. Nothing would ever be the same again...', NULL, 211, 1, NULL, 100.00, NULL, '2021-03-05 23:31:34', '2021-03-05 23:31:34'),
(697, 'Toxic', 'Toxic', 'http://books.google.com/books/content?id=UkeDtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=UkeDtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008287283', 'Sometimes love is toxic... Bree Dwyer is desperate to escape her husband, take the children and run. But he\'s always watching. And she always gets caught. Until her first love, Alfie Jennings, returns to Essex... Gangsters Alfie and Vaughn have been out of the game for a while, but a life of crime is one you never forget. To get back on top they need serious money, because loyalty and power don\'t come for free. One dangerous job and they\'ll have the payoff they need. And Alfie isn\'t going to let anyone get in the way, least of all a pretty face like Bree. It\'s time to show Essex what they\'re made of. And this time, Alfie and Vaughn aren\'t backing down.', NULL, 212, 1, NULL, 100.00, NULL, '2021-03-05 23:31:34', '2021-03-05 23:31:34'),
(698, 'Umberland (Everland, Book 2)', 'Umberland-(Everland,-Book-2)', 'http://books.google.com/books/content?id=vLOVtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vLOVtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545953191', 'The second book in the epic Everland trilogy now in paperback! Gwen, Pete, and the others have escaped from Everland. But the safe haven they hoped to find at Alnwick Castle doesn\'t exist. With the Queen of England on her deathbed, Duchess Alyssa has stepped in, but things have gotten worse as the cure Doc created for the Horologia virus has mutated, accelerating the disease. The only possible solution he can think of is to go back to the virus\'s origin: an extinct poisonous apple. Legend has it a tree bearing the apple might be found at the center of a deadly labyrinth hidden deep within Germany. A place that no one in their right mind enters. With no other options, Alyssa sets out with only her sword, her wits, and the help of Maddox Hadder, a wild boy who oversees the castle gardens. To get to the center of the maze, she\'ll be forced to battle monsters more terrifying than her darkest nightmares. But can anyone truly survive the madness of the maze? And what if there\'s no apple to be found there?', NULL, 213, 1, NULL, 100.00, NULL, '2021-03-05 23:31:34', '2021-03-05 23:31:34'),
(699, 'The Ice Beneath Her', 'The-Ice-Beneath-Her', 'http://books.google.com/books/content?id=xBr7MAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xBr7MAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785761997', '', NULL, 214, 1, NULL, 100.00, NULL, '2021-03-05 23:31:34', '2021-03-05 23:31:34'),
(700, 'The Island at the End of Everything', 'The-Island-at-the-End-of-Everything', 'http://books.google.com/books/content?id=Qd_3MAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Qd_3MAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781910002766', 'Amihan lives on Culion Island, where some of the inhabitants - including her mother - have leprosy. Ami loves her home - with its blue seas and lush forests, Culion is all she has ever known. But the arrival of malicious government official Mr Zamora changes her world forever: islanders untouched by sickness are forced to leave. Banished across the sea, she\'s desperate to return, and finds a strange and fragile hope in a colony of butterflies. Can they lead her home before it\'s too late?', NULL, 215, 1, NULL, 100.00, NULL, '2021-03-05 23:31:35', '2021-03-05 23:31:35'),
(701, 'The Redemption of Alexander Seaton', 'The-Redemption-of-Alexander-Seaton', 'http://books.google.com/books/content?id=cJjkhByzOlMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cJjkhByzOlMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781847247919', 'Banff, Scotland in the 1620s. A young man walks unsteadily through the streets. Is he just drunk or is there something more sinister happening? When he collapses in front of two sisters on that dark, wet night, the women guess that he\'s been poisoned. His body is discovered in the house of Alexander Seaton - a fallen minister, the discovery of whose clandestine love affair has left him disgraced. Why was the body in Seaton\'s house? And why would anyone want to murder this likeable young man? Seaton sets out to find answers, embarking on a journey not only through the darkest part of other men\'s souls, but also his own.', NULL, 216, 1, NULL, 100.00, NULL, '2021-03-05 23:31:35', '2021-03-05 23:31:35'),
(702, 'Lying about Last Summer', 'Lying-about-Last-Summer', 'http://books.google.com/books/content?id=rm1zjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rm1zjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407165363', 'Skye is looking for an escape from the reality of last summer when her sister died in a tragic accident. Her parents think that a camp for troubled teenagers might help her process her grief. All of the kids at the summer camp have lost someone close, but is bringing them together such a good idea? And can everyone at camp be trusted? When Skye starts receiving text messages from someone pretending to be her dead sister, she knows it\'s time to confront the past. But what if the danger is right in front of her?', NULL, 427, 1, NULL, 100.00, NULL, '2021-03-05 23:31:35', '2021-03-05 23:31:35'),
(703, 'The Nine-Chambered Heart', 'The-Nine-Chambered-Heart', 'http://books.google.com/books/content?id=gBePtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gBePtQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008272562', '\'Superb. She had me at page one\' Chris Cleave, author of Everyone Brave is Forgiven \'It\'s the artful pleating of this subtle, psychologically astute novel that sets it apart\' DAILY MAIL The kaleidoscopic story of one woman as seen through the eyes of those she has loved or been loved by. Nine people illuminate one woman in the particular light of how they see her, each voice casting her from a new angle. Taking her from a lonely child in the classroom to a fierce woman weathering life\'s battles and triumphs, The Nine-Chambered Heart is a masterful portrait, as intimate as it is brave.', NULL, 217, 1, NULL, 100.00, NULL, '2021-03-05 23:31:35', '2021-03-05 23:31:35'),
(704, 'Angus, Thongs and Perfect Snogging', 'Angus,-Thongs-and-Perfect-Snogging', '', '', '9780007274673', 'Read the hilarious diaries of Georgia Nicolson.', NULL, 218, 1, NULL, 100.00, NULL, '2021-03-05 23:31:35', '2021-03-05 23:31:35'),
(705, 'The Darkest Day', 'The-Darkest-Day', 'http://books.google.com/books/content?id=4Zq3oQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4Zq3oQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751556025', 'He is darkness. She wants him dead. In a city starved of light, she might just succeed. She moves like a shadow; she kills silently: Raven. This elegant assassin has been on the run for years. This time though, she has picked the wrong target. The hitman known only as \'Victor\' is as paranoid as he is merciless, and is no stranger to being hunted. He tracks his would-be killer across the globe, aiming not only to neutralise the threat, but to discover who wants him dead. The trail leads to New York... And then the lights go out. Over twelve hours of unremitting darkness, Manhattan dissolves into chaos. Amid looting, conspiracy and blackout, Victor and Raven play a vicious game of cat and mouse that the city will never forget.', NULL, 219, 1, NULL, 100.00, NULL, '2021-03-05 23:31:36', '2021-03-05 23:31:36'),
(706, 'How to Say Goodbye', 'How-to-Say-Goodbye', 'http://books.google.com/books/content?id=zHNEtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zHNEtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008202224', 'A laugh-out-loud digital detox for fans of Lindsey Kelk and Mhari McFarlane. Tweet, pray, love? Like her Instagram feed, Ella\'s life comes with a filter. Especially when she\'s speaking to her mum. Her flat? Airy, bright, clean. Her job? Glamorous, worthwhile, well-paid. Her boyfriend? Definitely not fictional. The truth is, Ella\'s life is decidedly unfabulous - until she wins a holiday to a mind, body and soul retreat in Bali. Finally, she can stop ramping up the saturation on photos of avocado and actually start living the dream! Plus, mindfulness is so in trend - it\'s definitely going to bring in more likes. But in Bali, Ella\'s dreams of soaking up the sun, tweeting about spa days and Instagramming smoothie bowls disappear. Because not only is she expected to actually join in with the retreat - her phone\'s confiscated. It seems Ella\'s going to have to spend some time getting to know herself. And when the filter comes off, will she like what she sees?', NULL, 220, 1, NULL, 100.00, NULL, '2021-03-05 23:31:36', '2021-03-05 23:31:36'),
(707, 'Endless Endless', 'Endless-Endless', 'http://books.google.com/books/content?id=cvjhwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cvjhwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408332634', '', NULL, 221, 1, NULL, 100.00, NULL, '2021-03-05 23:31:36', '2021-03-05 23:31:36'),
(708, 'Immortals, V.4 - Dark Flame', 'Immortals,-V.4---Dark-Flame', 'http://books.google.com/books/content?id=19frtgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=19frtgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330520614', 'Once it seemed being immortal was a gift to Ever Bloom - now it\'s a curse. And she\'s a danger to herself. Ever has been dabbling in Magyck - seeking to explore her own powers, hoping to find a future for her relationship with Damen. But she\'s not in control - in fact, the magyck has bound her eternally to her immortal enemy, Roman. Whenever he\'s near, she feels his heartbeat, his breath, his blood racing in her veins. Ever is in deep - and the one person who might be able to help her must never find out what she\'s done . . .', NULL, 222, 1, NULL, 100.00, NULL, '2021-03-05 23:31:36', '2021-03-05 23:31:36'),
(709, 'Who Moved My Cheese?', 'Who-Moved-My-Cheese?', 'http://books.google.com/books/content?id=FoCUCDgktfMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FoCUCDgktfMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780091816971', 'Who Moved My Cheese? is an amusing and enlightening story of four characters who live in a maze and look for cheese to nourish them and make them happy. Cheese is a metaphor for what you want to have in life - whether it is a good job, a loving rel', NULL, 223, 1, NULL, 100.00, NULL, '2021-03-05 23:31:37', '2021-03-05 23:31:37'),
(710, 'Night Star', 'Night-Star', 'http://books.google.com/books/content?id=nfdejgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nfdejgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330528115', 'Love and Heartbreak belong together ... There are some secrets you\'re better off not knowing. But once Ever Bloom is given a glimpse of what Damen is keeping from her, she has to find out more-whatever the cost. Their past together is not what she thinks - and only he remembers everything. Until now, when a vengeful friend lets her in on his secret. And it may just push Ever into someone else\'s arms ...', NULL, 222, 1, NULL, 100.00, NULL, '2021-03-05 23:31:37', '2021-03-05 23:31:37'),
(711, 'Unravelling', 'Unravelling', 'http://books.google.com/books/content?id=ZYpfXwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZYpfXwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007460212', 'If Janelle Tenner wants to avenge her father\'s death and stop the end of the world, she\'s going to need to uncover Ben\'s secrets - and keep from falling in love with him in the process', NULL, 224, 1, NULL, 100.00, NULL, '2021-03-05 23:31:37', '2021-03-05 23:31:37'),
(712, 'Have a Little Faith', 'Have-a-Little-Faith', 'http://books.google.com/books/content?id=j0rKPAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=j0rKPAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751537512', 'Will you do my eulogy? With those words, Mitch Albom begins his long-awaited return to non-fiction. His journey to honour the last request of a beloved clergyman ultimately leads him to rekindle his own long-ignored faith. Albom spends years exploring churches and synagogues, the suburbs and the city, the \"us\" versus \"them\" of religion. Slowly, he gravitates to an inner-city pastor of a crumbling church that houses the homeless, and is stunned at how similar belief can be. As his own beloved cleric slowly lets go, Albom writes his final farewell, having learned that a faithful heart comes in many forms and places.', NULL, 156, 1, NULL, 100.00, NULL, '2021-03-05 23:31:38', '2021-03-05 23:31:38'),
(713, 'Places in the Darkness', 'Places-in-the-Darkness', 'http://books.google.com/books/content?id=2C_KtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2C_KtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780356506272', 'SHORTLISTED FOR THE MCILVANNEY PRIZE FOR CRIME WRITING 2018 \"This is as close to a city without crime as mankind has ever seen.\" Ciudad de Cielo is the \'city in the sky\', a space station where hundreds of scientists and engineers work in earth\'s orbit, building the colony ship that will one day take humanity to the stars. When a mutilated body is found on the CdC, the eyes of the world are watching. Top-of the-class investigator, Alice Blake, is sent from Earth to team up with CdC\'s Freeman - a jaded cop with more reason than most to distrust such planetside interference. As the death toll climbs and factions aboard the station become more and more fractious, Freeman and Blake will discover clues to a conspiracy that threatens not only their own lives, but the future of humanity itself. \'Excellent hardboiled noir . . . absolutely gripping\' SciFiNow \'An ingenious crime story\' Scotsman As smart as it is gripping, this is a terrifically engaging story from start to nerve-shredding finish Big Issue \'Places in the Darkness is another corker of a murder mystery, [Brookmyre\'s] new setting - with which he\'s clearly having a whale of a time - giving him the opportunity to wow us with an even twistier twist than usual\' Guardian', NULL, 225, 1, NULL, 100.00, NULL, '2021-03-05 23:31:38', '2021-03-05 23:31:38'),
(714, 'She\'s Not There', 'She\'s-Not-There', 'http://books.google.com/books/content?id=w7GItQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=w7GItQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008245634', '\'A wonderful, artfully addictive novel\' IAN MCEWAN When Jonah and Raff wake up on Monday, their mother Lucy isn\'t there. Although he\'s only nine, Jonah knows enough about the world to keep her absence a secret. If anyone found out she\'d left them alone, who knows what could happen to him and his little brother? As the days go on, he puzzles over the clues left behind: who sent Lucy flowers? Why is her phone in a plant pot? Why are all her shoes still there? And who in their neighbourhood might know more about Lucy than he does?', NULL, 226, 1, NULL, 100.00, NULL, '2021-03-05 23:31:38', '2021-03-05 23:31:38'),
(715, 'Four: A Divergent Collection', 'Four:-A-Divergent-Collection', 'http://books.google.com/books/content?id=x0ynngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=x0ynngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007550142', 'Readers first encountered Tobias Eaton as \"Four\" in Divergent. His voice is an integral part of Allegiant. Readers will find more of this charismatic character\'s backstory told from his own perspective in Four: A Divergent Collection. When read together, these long narrative pieces illuminate the defining moments in Tobias Eaton\'s life. The first three pieces in this volume - \"The Transfer,\" \"The Initiate,\" and \"The Son\" - follow Tobias\'s transfer from Abnegation to Dauntless, his Dauntless initiation, and the first clues that a foul plan is brewing in the leadership of two factions. The fourth story, \"The Traitor,\" runs parallel with the events of Divergent, giving readers a glimpse into the decisions of loyalty - and love - that Tobias makes in the weeks after he meets Tris Prior. Exclusive scenes included!', NULL, 227, 1, NULL, 100.00, NULL, '2021-03-05 23:31:39', '2021-03-05 23:31:39'),
(716, 'A Game of Sorrows', 'A-Game-of-Sorrows', 'http://books.google.com/books/content?id=swT_wAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=swT_wAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781849162449', 'It is 1628, and Alexander Seaton\'s happily settled life as a university teacher in Aberdeen is shattered by the arrival in town of a stranger who looks like his twin and who carries a plea for help from Alexander\'s dead mother\'s family in Ireland. The family has been placed under a poet\'s curse, threatening death to various members. Elements of the curse have already begun to play out. Reluctantly answering the call, Alexander leaves his home and his beloved Sarah and travels to Ulster, to find himself among a family torn apart by secrets and long-buried resentments. In the course of seeking out the author of the curse, Alexander becomes deeply entangled in a conflict that involves fugitive priests, displaced poets, rebellious plotters and agents of the king. Confronted by murder within his family, he finds the lines between superstition and faith, duty and loyalty are becoming increasingly blurred, while his Scottish homeland grows ever more remote.', NULL, 216, 1, NULL, 100.00, NULL, '2021-03-05 23:31:39', '2021-03-05 23:31:39'),
(717, 'He Said/She Said', 'He-Said/She-Said', 'http://books.google.com/books/content?id=5JBkDQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5JBkDQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444797145', 'SHORTLISTED FOR THE SPECSAVERS NATIONAL BOOK AWARDS 2018 RICHARD AND JUDY BOOK CLUB PICK 2018 SUNDAY TIMES BESTSELLER SIMON MAYO RADIO 2 BOOK CLUB PICK SHORTLISTED FOR CRIME AND THRILLER BOOK OF THE YEAR 2018 LONGLISTED FOR THEAKSTON OLD PECULIER CRIME NOVEL OF THE YEAR 2018 \'Haunting. Mesmerising. Unforgettable.\' Gillian Flynn, author of Gone Girl *********** Don\'t be left in the dark. In the hushed aftermath of a total eclipse, Laura witnesses a brutal attack. She and her boyfriend Kit call the police, and in that moment, four lives change forever. Fifteen years on, Laura and Kit live in fear. And while Laura knows she was right to speak out, she also knows that you can never see the whole picture: something is always hidden . . . something she never could have guessed. *********** \'I\'m calling it: THIS is the book I wish I\'d written\' Clare Mackintosh, author of Let Me Lie \'It\'s SO good . . . I was carrying it around the house I was so gripped\' Sarah Perry, author of The Essex Serpent \'A gripping, twisting, furiously clever read . . . I loved it\' Ruth Ware, author of The Lying Game \'It\'s magnificent. Stunningly twisty plot and weep-makingly brilliant writing\' Marian Keyes, author of The Break **STONE MOTHERS, the new novel by Erin Kelly, is available to buy now!**', NULL, 54, 1, NULL, 100.00, NULL, '2021-03-05 23:31:39', '2021-03-05 23:31:39'),
(718, 'Blood Ransom', 'Blood-Ransom', 'http://books.google.com/books/content?id=haUuQwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=haUuQwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781847387639', 'Clones Rachel and Theo now live thousands of miles apart. They keep in touch, but things just aren\'t the same. When Rachel discovers that evil scientist Elijah is still working in secret for a section of the government and about to murder Daniel, she sets out to rescue the little boy, but her plans backfire with disastrous consequences. Across the Atlantic, Theo becomes suspicious when Rachel misses their weekly internet chat. He discovers a report online saying she\'s killed herself and travels to Scotland to find her, certain that she has been kidnapped. A clue leads him to Elijah\'s mysterious clinic, where the sinister Aphrodite Experiment is underway. But what is Elijah really planning? Why does he need to track Rachel down so badly? And will Rachel and Theo be able to pay the ultimate ransom that he demands?', NULL, 129, 1, NULL, 100.00, NULL, '2021-03-05 23:31:39', '2021-03-05 23:31:39'),
(719, 'Bloodline', 'Bloodline', 'http://books.google.com/books/content?id=9BGSJAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9BGSJAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406309386', 'The story of Essa, whose father Cai, a travelling bard and occasional spy, leaves him behind one night at a settlement of the Wolf Clan. Essa is a survivor and forges new allegiances and even love, but never stops wondering why his father never came back. The settlement is under threat from cruel Mercian bands across the forests, and Essa is caught up in a heart-stopping journey to avert disaster. A battle is inevitable, but Essa finds he can influence its outcome in a way nobody but his father would understand.', NULL, 194, 1, NULL, 100.00, NULL, '2021-03-05 23:31:39', '2021-03-05 23:31:39'),
(720, 'Shame on You', 'Shame-on-You', 'http://books.google.com/books/content?id=aU0ZtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aU0ZtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785770944', 'A timely commercial thriller for the iGeneration, perfect for fans of The Girl Before and Friend Request.', NULL, 228, 1, NULL, 100.00, NULL, '2021-03-05 23:31:40', '2021-03-05 23:31:40'),
(721, 'Better Left Buried', 'Better-Left-Buried', 'http://books.google.com/books/content?id=bDO6rQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bDO6rQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409566700', 'Brother dead...best friend missing...house ransacked...stalked by a stranger...attacked in the street... And Sarah has no idea why. She never knew her brother was hiding a dark secret when he died. But now his actions have led the wolves to her door - and the only way out is to run. A tense, unnerving thriller that will set your heart racing.', NULL, 172, 1, NULL, 100.00, NULL, '2021-03-05 23:31:40', '2021-03-05 23:31:40'),
(722, 'In a Cottage, in a Wood', 'In-a-Cottage,-in-a-Wood', 'http://books.google.com/books/content?id=yh1VAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yh1VAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008248956', 'A dark and twisty psychological thriller from the No.1 ebook bestselling author of The Woman Next Door. Her dream home will become her worst nightmare... A strange encounter Neve comes across a troubled woman called Isabelle on Waterloo Bridge late one night. Isabelle forces a parcel into Neve\'s hands and jumps to her death in the icy Thames below. An unexpected gift Two weeks later, as Neve\'s wreck of a life in London collapses, an unexpected lifeline falls into her lap - a charming cottage in Cornwall left to her by Isabelle, the woman on the bridge. The solution to all her problems. A twisted secret But when Neve arrives, alone in the dark woods late one night, she finds a sinister-looking bungalow with bars across its windows. And her dream home quickly becomes her worst nightmare - a house hiding a twisted secret that will change her life forever...', NULL, 229, 1, NULL, 100.00, NULL, '2021-03-05 23:31:40', '2021-03-05 23:31:40'),
(723, 'The Summer That Never Was', 'The-Summer-That-Never-Was', 'http://books.google.com/books/content?id=44owDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=44owDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447225546', 'A skeleton has been unearthed. Soon the body is identified, and the horrific discovery hits the headlines . . . Fourteen-year-old Graham Marshall went missing during his paper round in 1965. The police found no trace of him. His disappearance left his family shattered, and his best friend, Alan Banks, full of guilt . . . That friend has now become Chief Inspector Alan Banks, and he is determined to bring justice for Graham. But he soon realises that in this case, the boundary between victim and perpetrator, between law-guardian and law-breaker, is becoming more and more blurred . . .', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:40', '2021-03-05 23:31:40'),
(724, 'The Hanging Valley', 'The-Hanging-Valley', 'http://books.google.com/books/content?id=oYSzDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oYSzDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447225461', 'The fourth haunting Inspector Banks novelA faceless corpse is discovered in a tranquil, hidden valley below the village of Swainshead. And when Chief Inspector Alan Banks arrives, he finds that no-one is willing to talk. Banks\' frustration only grows when the identity of the body is revealed. For it seems that his latest case may be connected with an unsolved murder in the same area five years ago.Among the silent suspects are the Collier brothers, the wealthiest and most powerful family in Swainsdale. When they start to use their influence to slow down the investigation, Inspector Alan Banks finds himself in a race against time...', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:40', '2021-03-05 23:31:40'),
(725, 'Strange Affair', 'Strange-Affair', 'http://books.google.com/books/content?id=ts3JwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ts3JwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509810796', 'When Alan Banks receives a disturbing message from his brother, Roy, he abandons the peaceful Yorkshire Dales for the bright lights of London, to seek him out. But Roy seems to have vanished into thin air. Meanwhile, DI Annie Cabbot is called to a quiet stretch of road just outside Eastvale, where a young woman has been found dead in her car. In the victim\'s pocket, scribbled on a slip of paper, police discover Banks\' name and address. Living in Roy\'s empty South Kensington house, Banks finds himself digging into the life of the brother he never really knew, nor even liked. And as he begins to uncover a few troubling surprises, the two cases become sinisterly entwined . . . \'The Banks novels are, simply put, the best series now on the market\' STEPHEN KING', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:41', '2021-03-05 23:31:41'),
(726, 'Innocent Graves', 'Innocent-Graves', 'http://books.google.com/books/content?id=3EvFDAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3EvFDAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509810741', 'One foggy night, Deborah Harrison is found lying in the churchyard behind St Mary\'s, Eastvale. She has been strangled with the strap of her own school satchel. But Deborah was no typical sixteen-year old. Her father was a powerful financier who moved in the highest echelons of industry, defence and classified information. And Deborah, it seemed, enjoyed keeping secrets of her own . . . With his colleague Detective Constable Susan Gay, Inspector Alan Banks moves along the many suspects, guilty of crimes large and small. And as he does so, plenty of sordid secrets and some deadly lies begin to emerge . . . \'If you haven\'t caught up with Peter Robinson already, now is the time to start\' Independent on Sunday', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:41', '2021-03-05 23:31:41');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(727, 'A Necessary End - Book 3 - Inspector Banks', 'A-Necessary-End---Book-3---Inspector-Banks', '', '', '9781447225454', 'Violence erupts at an anti-nuclear demonstration in Eastvale, leaving one policeman stabbed to death. At first there are over a hundred suspects, but then things narrow down to the people who live on \"Maggie\'s Farm\", an isolated house high on the daleside. Among the suspects is Dennis Osmond, a social worker involved with Jenny Fuller, Inspector Banks\'s friend. As if this isn\'t enough to cope with, Banks finds his freedom hampered by the appointment of an old enemy, Detective Superintendent Richard \'Dirty Dick\' Burgess, to head the investigation. Finally, warned off the case, the only way Banks can salvage his career is by beating Burgess to the killer ...', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:41', '2021-03-05 23:31:41'),
(728, 'Playing with Fire', 'Playing-with-Fire', 'http://books.google.com/books/content?id=Oer3wAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Oer3wAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509810789', 'In the early hours of a cold January morning, two narrow boats catch fire on the dead-end stretch of the Eastvale canal. When signs of accelerant are found at the scene, DCI Banks and DI Annie Cabbot are summoned. But by the time they arrive, only the smouldering wreckage is left, and human remains have been found on both boats. The evidence points towards a deliberate attack. But who was the intended victim? Was it Tina, the sixteen-year-old who had been living a drug-fuelled existence with her boyfriend? Or was it Tom, the mysterious, lonely artist? As Banks makes his enquiries, it appears that a number of people are acting suspiciously: the interfering \'lock-keeper\', Tina\'s cold-hearted step-father, the wily local art dealer, even Tina\'s boyfriend . . . Then the arsonist strikes again, and Banks\'s powers of investigation are tested to the limit . . .', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:42', '2021-03-05 23:31:42'),
(729, 'In a Dry Season', 'In-a-Dry-Season', 'http://books.google.com/books/content?id=miK_wAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=miK_wAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447225539', 'In A Dry Season is the tenth novel in Peter Robinson\'s Inspector Banks series, following on from Dead Right. During a blistering summer, drought has depleted Thornfield Reservoir, uncovering the remains of a small village called Hobb\'s End - hidden from view for over 40 years. For a curious young boy this resurfaced hamlet is a magical playground . . . until he unearths a human skeleton. Detective Chief Inspector Alan Banks is given the impossible task of identifying the victim - a woman who lived in a place that no longer exists, whose former residents are scattered to the winds. Anyone else might throw in the towel but DCI Banks is determined to uncover the murky past buried beneath a flood of time . . . In A Dry Season is followed by the eleventh book in this Yorkshire-based crime series, Cold is the Grave.', NULL, 230, 1, NULL, 100.00, NULL, '2021-03-05 23:31:42', '2021-03-05 23:31:42'),
(730, 'A Passage to India', 'A-Passage-to-India', 'http://books.google.com/books/content?id=6WdfQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6WdfQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141441160', 'What really happened to Miss Quested in the Marabar Caves? This tantalising question provides the intense drama of racial tension at the centre of Foster\'s last and greatest novel.', NULL, 231, 1, NULL, 100.00, NULL, '2021-03-05 23:31:42', '2021-03-05 23:31:42'),
(731, 'White Boys Don\'t Cry', 'White-Boys-Don\'t-Cry', 'http://books.google.com/books/content?id=S4cJxdKLtgkC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=S4cJxdKLtgkC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330452700', '\'I didn\'t know about the murder, I swear\' When Cris Schuter, an ex-government Minister in South Africa during the apartheid era, is found murdered, his son Josh goes missing. Sebastian Palfrey, a British newspaper correspondent, is a lifelong friend of Josh\'s, and is immediately hauled in by the local police. Sebastian regards himself as a bit of a Gallic Sancho Panza to Josh\'s Don Quixote - they go back a long, long way, and along with Zak, a political activist, have quite a history. But Sebastian genuinely doesn\'t know where Josh is, and nor does his girlfriend, Frances. Sebastian both knows and fears that his disappearance can only throw up all sorts of secrets they\'ve shared - and some they haven\'t - that have long been buried . . . Acclaim for This Green Land \'It is Fullerton\'s piece of genre fiction that gets closest to the heart of this difficult subject matter . . . a shockingly good read\' The Times \' . . . Fullerton puts the politics on hold and tells his story with heart, guts and go. A brilliant performance, with a fierce, uncosy intelligence setting off the fireworks\' Literary Review', NULL, 232, 1, NULL, 100.00, NULL, '2021-03-05 23:31:42', '2021-03-05 23:31:42'),
(732, 'Exile', 'Exile', 'http://books.google.com/books/content?id=vxd6tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vxd6tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785760457', 'A vicious Serbian gang whose profits come from fake nuclear weapons. A disgraced Russian general, with access to the real thing. A vengeful Somali warlord, with a cause for which he\'d let the world burn. A jaded government agency, without the information to stop him. Only one man sees what\'s coming. And even he might not be able to prevent it. Racing breathlessly from uncharted CIA prisons to the skyscrapers of Dubai, from stormbeaten oil rigs off the African coast to the ancient caverns beneath the city of Naples.', NULL, 233, 1, NULL, 100.00, NULL, '2021-03-05 23:31:43', '2021-03-05 23:31:43'),
(733, 'Without Fail', 'Without-Fail', 'http://books.google.com/books/content?id=nWuiZY3klAsC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nWuiZY3klAsC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857500090', '\"Featuring Jack Reacher, hero of the blockbuster movie starring Tom Cruise. This time, he\'s in the line of fire, protecting the Vice President of the United States. /b> /b>Jack Reacher walks alone. b> o job, no ID, no last known address. But he never turns down a plea for help. Now a woman tracks him down. A woman serving at the very heart of US power. A woman who needs Reacher\'s assistance in her new job. Her job? Protecting the Vice-President of the United States. b> b>Her problem? b> omeone wants the VP dead.\"', NULL, 234, 1, NULL, 100.00, NULL, '2021-03-05 23:31:43', '2021-03-05 23:31:43'),
(734, 'Before', 'Before', 'http://books.google.com/books/content?id=r9UXCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=r9UXCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781501130700', 'Recounts Hardin\'s first encounters with Tessa and their ensuing love affair that became a vortex pulling in everyone around them.', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:31:43', '2021-03-05 23:31:43'),
(735, 'Mars and Venus on a Date', 'Mars-and-Venus-on-a-Date', 'http://books.google.com/books/content?id=0Q1plSWF5WwC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0Q1plSWF5WwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780091887674', 'From first look and first date to first fight, breaking up and making up, the world of dating can be a minefield for the unprepared. International relationship guru, John Gray turns his expertise to the language and behaviour of dating couples. Asking questions such as: -How should you act on your first date? -How can you tell if your partner means what he says? -Is this love or just lust at first sight? John Gray helps new couples figure out whether they are partners for life or just enjoying a brief encounter. His approach will help both men and women play the dating game with its complex rules of etiquette and behaviour, and explains how to separate fact from fantasy in conversation, body language and future expectations. His humorous insight and practical advice will help young and old alike to reach closer understanding, love and commitment, and have fun on the way!', NULL, 235, 1, NULL, 100.00, NULL, '2021-03-05 23:31:44', '2021-03-05 23:31:44'),
(736, 'Are These My Basoomas I See Before Me?', 'Are-These-My-Basoomas-I-See-Before-Me?', 'http://books.google.com/books/content?id=A0aY_k7i2jMC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=A0aY_k7i2jMC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007277346', 'This is the final instalment of Georgia\'s hilarious diary Does Georgia escape the cakeshop of luuurve? Can there be more heartbreaknosity in store? Will the Sex God pop up again unexpectedly (oo-er) And what about the supreme accidental snogmaster Dave the Laugh? Will she finally choose her one and only?', NULL, 218, 1, NULL, 100.00, NULL, '2021-03-05 23:31:44', '2021-03-05 23:31:44'),
(737, 'After We Fell', 'After-We-Fell', 'http://books.google.com/books/content?id=T-bOoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=T-bOoQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781501104046', 'Tessa didn\'t plan on meeting H. during her freshman year of college. But now that she has, her life will never be the same.', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:31:44', '2021-03-05 23:31:44'),
(738, 'Cut Short', 'Cut-Short', 'http://books.google.com/books/content?id=Iy8tcAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Iy8tcAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781842433546', 'The park - a place where children play, friends sit and gossip and people walk their dogs. But in the shadows, a predator watches, waits - and chooses his first victim. But someone has seen the killer and come forward as a witness - someone who the killer must stop at all costs. For DS Geraldine Steel, it is a race against time to find the killer as two more bodies are found. A gripping psychological thriller introducing Geraldine Steel, a woman whose past is threatening to collide with her future.', NULL, 236, 1, NULL, 100.00, NULL, '2021-03-05 23:31:44', '2021-03-05 23:31:44'),
(739, 'Together', 'Together', 'http://books.google.com/books/content?id=N3M0tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=N3M0tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409171768', 'RICHARD AND JUDY SUMMER BOOK CLUB PICK 2018 \'This big, clever, tender and twisty love story reminded me of One Day & The Time Traveler\'s Wife\' Erin Kelly, author of He Said, She Said **** Robbie and Emily have been together for years, but their love is still fresh and fierce. They have shared a bed, a home, a bond so deep it can\'t be broken. But there are things they don\'t share, things best left unsaid. On a morning like any other, Robbie wakes, dresses, writes Emily a letter - and leaves their home for good. There is a secret they\'ve been keeping since the day they met. The sacrifices and choices that have sealed their fates could be exposed, and this is the only way to keep it all hidden... Is this a great love story or a story about great love? Whatever you decide, theirs is a story that will never leave you. **** Readers can\'t stop talking about TOGETHER: \'A bold, breathtaking and truly compelling love story, one that will stay with me for a long time\' Lisa Jewell, author of Then She Was Gone \'Julie Cohen\'s writing is powerful, moving and truly beautiful\' Joanna Cannon, author of The Trouble with Goats and Sheep \'It takes a lot to tempt me from crime, but this is one of the most beautiful and heartbreaking stories I\'ve read\' Emma Flint, author of Little Deaths \'Complex, compelling and beautiful, Together is the kind of novel that will stay with you forever\' Rowan Coleman, author of The Summer of Impossible Things \'Cleverly-plotted and stunningly written, Julie Cohen\'s Together is a page-turner with real emotional punch\' Catherine Isaac, author of You, Me, Everything Perfect for fans of Ruth Hogan, Gail Honeyman and Sarah Winman and anyone looking for a thought-provoking page-turner.', NULL, 237, 1, NULL, 100.00, NULL, '2021-03-05 23:31:45', '2021-03-05 23:31:45'),
(740, 'Killing It', 'Killing-It', 'http://books.google.com/books/content?id=3kGhswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3kGhswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785764530', '', NULL, 238, 1, NULL, 100.00, NULL, '2021-03-05 23:31:45', '2021-03-05 23:31:45'),
(741, 'No Middle Name', 'No-Middle-Name', 'http://books.google.com/books/content?id=mOdTswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mOdTswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857503770', 'Jack \'No Middle Name\' Reacher, lone wolf, knight errant, ex military cop, lover of women, scourge of the wicked and righter of wrongs, is the most iconic hero for our age. This is the first time all Lee Child\'s shorter fiction featuring Jack Reacher has been collected into one volume. Read together, these twelve stories shed new light on Reacher\'s past, illuminating how he grew up and developed into the wandering avenger who has captured the imagination of millions around the world. The twelve stories include a brand new novella, Too Much Time. The other stories in the collection are: Second Son James Penney\'s New Identity Guy Walks Into a Bar Deep Down, High Heat Not a Drill Small Wars All of which have previously been published as ebook shorts. Added to these is every other Reacher short story that Child has written: Everyone Talks Maybe They Have a Tradition No Room at the Motel The Picture of the Lonely Diner', NULL, 234, 1, NULL, 100.00, NULL, '2021-03-05 23:31:45', '2021-03-05 23:31:45'),
(742, 'The Hypnotist\'s Love Story', 'The-Hypnotist\'s-Love-Story', 'http://books.google.com/books/content?id=9kVywuXt9c0C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9kVywuXt9c0C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241955062', 'The Hypnotist\'s Love Story is a gripping exploration of love and obsession, from the bestselling author of the hit HBO series Big Little Lies. How far would you go to keep the man of your dreams? Hypnotherapist Ellen is fascinated by what makes people tick. So when she falls in love with Patrick, the fact that he has a stalker doesn\'t faze her in the slightest. If anything it intrigues her, and the more she hears about Saskia, the more she wants to meet this woman. But what Ellen doesn\'t know is that they\'ve already met . . . Saskia has been posing as one of Ellen\'s clients. Unable to let go of the life she so abruptly lost, she wants to know everything about the woman who took her place. And the further she inches her way into Ellen\'s world, the more trouble she stirs up. Ellen\'s love story is about to take an unexpected turn. But it\'s not only Saskia who doesn\'t know where to stop: Ellen also has to ask herself what lines she\'s prepared to cross to get the happy ending she\'s always wanted. Thought-provoking, sympathetic and smart, Liane Moriarty\'s The Hypnotist\'s Love Story is a novel for anyone who\'s ever loved, lost or found it hard to let go. \'A complex, nuanced look at relationships, and the nature of romantic attachment\' Telegraph Praise for Liane Moriarty \'Highly addictive\' She \'Fascinating and compassionate\' Daily Telegraph \'Gripping, acutely observed, thought-provoking and funny\' Marie Claire \'The writing is beautiful: sometimes funny, sometimes sad but always compelling\' Good Housekeeping \'Captivating\' Closer', NULL, 239, 1, NULL, 100.00, NULL, '2021-03-05 23:31:46', '2021-03-05 23:31:46'),
(743, 'After Ever Happy', 'After-Ever-Happy', 'http://books.google.com/books/content?id=Vqr1oQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Vqr1oQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781501106842', '\"Tessa and Hardin have had enough surprises. Their bond is stronger than ever, but every new challenge they face shakes their foundation--and Hardin\'s impenetrable façade--to the core. As the shocking truth about each of their families emerges, it\'s clear the two lovers are not so different from each other. Tessa is no longer the sweet, simple, good girl she was when she met Hardin--any more than he is the cruel, moody boy she fell so hard for. Tessa understands all the troubling emotions brewing within Hardin, and she knows she\'s the only one who can calm him when he erupts. He needs her. But the more layers of his past that come to light, the darker he grows, and the harder he pushes Tessa--and everyone else in his life--away. After all this time, Tessa\'s not sure if she really can save him--not without sacrificing herself. Is love worth losing her identity? She refuses to go down without a fight. But who is she really fighting for--Hardin or herself?\"--Page 4 of cover.', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:31:46', '2021-03-05 23:31:46'),
(744, 'Walking Disaster', 'Walking-Disaster', 'http://books.google.com/books/content?id=unp0MAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=unp0MAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471115141', 'Set in the same time-frame as Beautiful Disaster, now we hear the story from Travis\' point of view. Travis lost his mother at a very young age, but before she died she taught him two important rules... Love hard. Fight harder. Growing up in a family of men who like to gamble and fight, Travis Maddox is a tough guy. Known for his bad reputation with women, and feared for his incredible fighting skills, all the boys want to be him, and the girls simply want him... Abby Abernathy is the first girl to treat him the way he feels he should be treated, with dislike and disinterest. It is her lack of interest that sparks his determination to win her round. Will the invincible Travis \'Mad Dog\' Maddox be defeated by a girl?', NULL, 240, 1, NULL, 100.00, NULL, '2021-03-05 23:31:46', '2021-03-05 23:31:46'),
(745, 'Broken Angels', 'Broken-Angels', 'http://books.google.com/books/content?id=jpYcC2uVK0MC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jpYcC2uVK0MC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099499824', 'Evil preys upon the fallen. The third thriller in the Byrne and Balzano series by the Sunday Times bestselling author. When the first body is found, mutilated and strangled on the riverbanks, Philadelphia homicide detectives Kevin Byrne and Jessica Balzano suspect yet another case of random urban violence. Then it happens again. And again. Carefully dressed and posed, each victim seems to tell a story so gruesome that Byrne and Balzano struggle at first to make sense of the killer\'s dark and twisted imagination. But when they stumble upon a collection of old fairy tales, the fragile link between the murders suddenly becomes clear - and with it the terrifying conclusion of the killer\'s plan. Desperately, they try to anticipate the madman\'s next move, but as the body count rises, the killing spree spirals out of control ...', NULL, 241, 1, NULL, 100.00, NULL, '2021-03-05 23:31:47', '2021-03-05 23:31:47'),
(746, 'Milk and Honey', 'Milk-and-Honey', 'http://books.google.com/books/content?id=iN8YswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iN8YswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781449474256', '\"A collection of poetry and prose about survival, about the experience of violence, abuse, love, loss, and femininity\"--Amazon.com.', NULL, 242, 1, NULL, 100.00, NULL, '2021-03-05 23:31:47', '2021-03-05 23:31:47'),
(747, 'Are We All Lemmings and Snowflakes?', 'Are-We-All-Lemmings-and-Snowflakes?', 'http://books.google.com/books/content?id=-lcntAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-lcntAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474933612', 'Welcome to Camp Reset, a summer camp with a difference. A place offering a shot at ¿normality¿ for Olive, a girl on the edge, and for the new friends she never expected to make ¿ who each have their own reasons for being there. Luckily Olive has a plan to solve all their problems. But how do you fix the world when you can¿t fix yourself? A raw and compelling exploration of mental health, friendship and the power of compassion from the acclaimed Holly Bourne.', NULL, 243, 1, NULL, 100.00, NULL, '2021-03-05 23:31:47', '2021-03-05 23:31:47'),
(748, 'Fierce Fragile Hearts', 'Fierce-Fragile-Hearts', 'http://books.google.com/books/content?id=U-8lugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=U-8lugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509852888', 'Fierce Fragile Hearts is the stunning companion novel to Sara Barnard\'s YA bestseller Beautiful Broken Things. It is about leaving the past behind, the friends who form your future, and learning to find love, in all its forms.Two years after a downward spiral took her as low as you can possibly go, Suzanne is starting again. Again. She\'s back in Brighton, the only place she felt she belonged, back with her best friends Caddy and Rosie. But they\'re about to leave for university. When your friends have been your light in the darkness, what happens when you\'re the one left behind?', NULL, 244, 1, NULL, 100.00, NULL, '2021-03-05 23:31:47', '2021-03-05 23:31:47'),
(749, 'All the Beautiful Girls', 'All-the-Beautiful-Girls', 'http://books.google.com/books/content?id=HmouswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HmouswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008267971', 'Heart Radio x Dreams Bedtime Bookclub April Book of the Month The dazzling, powerful story of a gutsy showgirl who tries to conquer her past amongst the glamour of 1960s Las Vegas - finding unexpected fortune, friendship and love. In the summer of 1968, Ruby Wilde is the toast of Las Vegas. Showgirl of the Year, in her feathers and rhinestones, five-inch heels and sky-high headdresses, she mesmerises audiences from the Tropicana to the Stardust. Ratpackers and movie stars, gamblers and astronauts vie for her attention and shower her with gifts. But not so long ago Ruby Wilde was Lily Decker from Kansas: an orphaned girl determined to dance her way out of her troubled past. When she was eight years old, Lily survived the car crash that killed her parents and sister. Raised by an aunt who took too little interest in her and an uncle who took too much, dancing was her solace, and her escape. When a mysterious benefactor pays for her to attend a local dance academy, Lily\'s talent becomes her ticket to a new life. Now, as Ruby Wilde, the ultimate Sin City success story, she discovers that the glare of the spotlight cannot banish the shadows that haunt her. As the years pass and Ruby continues to search for freedom, for love and, most importantly, herself, she must learn the difference between what glitters and what is truly gold.', NULL, 245, 1, NULL, 100.00, NULL, '2021-03-05 23:31:48', '2021-03-05 23:31:48'),
(750, 'Big Little Lies. TV Tie-In', 'Big-Little-Lies.-TV-Tie-In', 'http://books.google.com/books/content?id=rrvqnAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rrvqnAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781405931564', '** The number one bestseller Big Little Lies is now a HBO series starring Nicole Kidman, Reese Witherspoon, Michael Fassbender and Shailene Woodey ** \'Let me ask you a question. Would you like a series that has everything? Good. Because it is, emphatically, HERE\' The Guardian Perfect family, perfect house, perfect life; Jane, Madeline and Celeste have it all . . . or do they? They are about to find out just how easy it is for one little lie to spiral out of control. From the author of Truly Madly Guilty and The Husband\'s Secret comes a novel about the dangerous little lies we tell ourselves just to survive. Jane hasn\'t lived anywhere for longer than six months since her son was born five years ago. She keeps moving in an attempt to escape her past. Now the idyllic coastal town of Pirriwee has pulled her to its shores and Jane feels as if she finally belongs. She finds friends in the feisty Madeline and the incredibly beautiful Celeste, two women with seemingly perfect lives - and their own secrets. But at the start of a new term, an incident involving the children of all three women occurs in the playground, causing a rift between them and other parents. Minor at first but escalating fast, until the whispers and rumours become vicious and spiteful, and the truths blur into lies. It was always going to end in tears, but no one thought it would end in murder . . . \'Brilliant, stand-out, superbly clever. Moriarty writes vividly, wittily and wickedly\' Sunday Express \'Blame and guilt, forgiveness and retribution, love and betrayal. A tense page-turning story . . . a great read\' Mail on Sunday \'Staggeringly brilliant . . . literally unputdownable\' Sophie Hannah \'Blending romance, comedy and mystery, this is a wonderful book - full of brains, guts and heart\' Sunday Mirror \'Tolls a warning bell about the big little lies we tell to survive\' Washington Post \'A fantastically nimble writer, so sure-footed that the book leaps between dark and light seamlessly\' Entertainment Weekly', NULL, 239, 1, NULL, 100.00, NULL, '2021-03-05 23:31:48', '2021-03-05 23:31:48'),
(751, 'Stronger, Faster, and More Beautiful', 'Stronger,-Faster,-and-More-Beautiful', 'http://books.google.com/books/content?id=mhcIugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mhcIugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008322403', '\'Will send shivers down your spine\'Teen Vogue \'A work of unforgettable vision and imagination. This book is everything I love about science fiction\'Jay Kristoff Are you ready for the future? Black Mirror with a touch of Westworld re-wiring, STRONGER, FASTER, AND MORE BEAUTIFUL is a novel in six interconnected parts about what it means to be human - and where those boundaries lie. Set in our world, spanning the near to distant future, the author, Arwen Elys Dayton, explores the possible consequences of advanced medical breakthroughs and how they may shape and reshape humanity. From organ donation to plastic surgery to full bodily reconstruction, these stories take you by your (for now, organic) hand and lead you into a future where the line between person and machine becomes increasingly blurred. Deeply thoughtful, poignant, horrifying, and action-packed, this novel strikes new ground while also seeming so strangely... likely. Just try to disconnect.', NULL, 246, 1, NULL, 100.00, NULL, '2021-03-05 23:31:48', '2021-03-05 23:31:48'),
(752, 'Shiver', 'Shiver-9780545682787', 'http://books.google.com/books/content?id=xh2XngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xh2XngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780545682787', 'In all the years she has watched the wolves in the woods behind her house, Grace has been particularly drawn to an unusual yellow-eyed wolf who, in his turn, has been watching her with increasing intensity.', NULL, 79, 1, NULL, 100.00, NULL, '2021-03-05 23:31:48', '2021-03-05 23:31:48'),
(753, 'Black Narcissus', 'Black-Narcissus', 'http://books.google.com/books/content?id=YhEWMAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YhEWMAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781844088393', 'High in the Himalayas near Darjeeling, the old mountaintop palace shines like a jewel. When it was the General\'s \'harem\' palace, richly dressed ladies wandered the windswept terraces; at night, music floated out over the villages and gorges. Now, the General\'s son has bestowed it on an order of nuns, the Sisters of Mary. Well-intentioned yet misguided, the nuns set about taming the gardens and opening a school and dispensary for the villagers. They are dependent on the local English agent of Empire, Mr Dean; but his charm and insolent candour are disconcerting. And the implacable emptiness of the mountain, the ceaseless winds, exact a toll on the Sisters.When Mr Dean says bluntly, \'This is no place for a nunnery,\' it is as if he foresees their destiny...', NULL, 140, 1, NULL, 100.00, NULL, '2021-03-05 23:31:49', '2021-03-05 23:31:49'),
(754, 'Copycat', 'Copycat', 'http://books.google.com/books/content?id=aa4YvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aa4YvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008199746', 'The gripping new psychological thriller from the bestselling author of After Anna and Killing Kate. Your stalker is everywhere. Your stalker knows everything. What if your stalker was you? Which Sarah Havenant is you? When an old friend gets in touch, Sarah Havenant discovers that there are two Facebook profiles in her name. One is hers. The other, she has never seen. But everything in it is accurate. Photos of her friends, her husband, her kids. Photos from the day before. Photos of her new kitchen. Photos taken inside her house. And this is just the beginning. Because whoever has set up the second profile has been waiting for Sarah to find it. And now that she has, her life will no longer be her own...', NULL, 247, 1, NULL, 100.00, NULL, '2021-03-05 23:31:49', '2021-03-05 23:31:49'),
(755, 'The Treatment', 'The-Treatment', 'http://books.google.com/books/content?id=zyjwAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zyjwAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008240561', 'Cecelia Ahern\'s Flawed meets Never Let Me Go in the pulse-pounding YA thriller from the Top Ten Sunday Times bestselling author of The Escape. \"You have to help me. We\'re not being reformed. We\'re being brainwashed.\" All sixteen year old Drew Finch wants is to be left alone. She\'s not interested in spending time with her mum and stepdad and when her disruptive fifteen year old brother Mason is expelled from school for the third time and sent to a residential reform academy she\'s almost relieved. Everything changes when she\'s followed home from school by the mysterious Dr Cobey, who claims to have a message from Mason. There is something sinister about the \'treatment\' he is undergoing. The school is changing people. Determined to help her brother, Drew must infiltrate the Academy and unearth its deepest, darkest secrets. Before it\'s too late.', NULL, 248, 1, NULL, 100.00, NULL, '2021-03-05 23:31:49', '2021-03-05 23:31:49'),
(756, 'Presumed Dead', 'Presumed-Dead', 'http://books.google.com/books/content?id=waUKtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=waUKtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409172437', '\'Mason Cross is a fast-paced, high octane thriller writer.\' Simon Kernick THEN Fifteen years ago, an unidentified killer terrorised northern Georgia, killing hikers with two shots from a pistol, before disposing of the bodies along the remote trails and in the rivers in the vicinity of Blood Mountain. The killer was never brought to justice. NOW Carter Blake has returned home for the first time in many years. The visit stirs old memories, including a girl from school who vanished without a trace. Blake runs into the mother of the girl, who mentions a case she\'s come across in Georgia, where someone is convinced their relative is still alive, fifteen years on. Adeline Connor was the Blood Mountain Killer\'s last suspected victim. She vanished without a trace. So why is her brother so convinced she\'s still alive? \'One of the best new series characters since Jack Reacher\' Lisa Gardner', NULL, 249, 1, NULL, 100.00, NULL, '2021-03-05 23:31:49', '2021-03-05 23:31:49'),
(757, 'Night Road', 'Night-Road', 'http://books.google.com/books/content?id=y_i6DAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=y_i6DAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780330534970', 'Set on Pine Island, Night Road is the story of three teenagers: Lexi, Mia and her twin brother Zach. Lexi\'s childhood was spent watching her alcoholic mother slowly poison herself to death. When she turns fourteen, Lexi\'s Aunt Eva takes her in to live with her in her caravon on a trailer park. Mia and Zach Farraday, on the other hand, had an idyllic childhood with everything they could possible want from an adoring and doting mother. The twins meet Lexi on their first day of high school. Lexi, sweet-natured and gentle, finds a soul mate in Mia and they become best friends. Lexi falls in love with Zach the moment she first sets eyes on him but she never imagines that he\'d ever look at her in any way other than as his beloved twin\'s best friend. But it turns out that Zach is absolutely crazy about Lexi, he just doesn\'t want to jeapardize her relationship with Mia.Life changes for them all on a fateful summer\'s night following their graduation party. Zach\'s the designated driver, but both he and Mia had had far too much too drink. Lexi decides that she is sober enough to drive. It turns out to be a decision that she will regret for the rest of her life...', NULL, 105, 1, NULL, 100.00, NULL, '2021-03-05 23:31:49', '2021-03-05 23:31:49'),
(758, 'Introducing Time', 'Introducing-Time', 'http://books.google.com/books/content?id=BTqqQQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BTqqQQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848311206', 'What is time? The 5th-century philosopher St Augustine famously said that he knew what time was, so long as no one asked him. Is time a fourth dimension similar to space or does it flow in some sense? And if it flows, does it make sense to say how fast? Does the future exist? Is time travel possible? Why does time seem to pass in only one direction?These questions and others are among the deepest and most subtle that one can ask, but Introducing Time\" presents them - many for the first time - in an easily accessible, lucid and engaging manner, wittily illustrated by Ralph Edney.\"', NULL, 250, 1, NULL, 100.00, NULL, '2021-03-05 23:31:50', '2021-03-05 23:31:50'),
(759, 'Leadership and the One Minute Manager', 'Leadership-and-the-One-Minute-Manager', 'http://books.google.com/books/content?id=miwefN-bAeoC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=miwefN-bAeoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007103416', 'In clear, simple terms \"Leadership and the One Minute Manager(R) \"teaches managers the art of Situational Leadership(R)--a simple system that refutes the conventional management mandate of treating all employees equally. Here, you\'ll learn why tailoring management styles to individual employees is so important; why knowing when to delegate, support, or direct is critical; how to identify the leadership style suited to a particular person; and how consistent use of the One Minute techniques will produce better management and enhanced motivation on all levels. This remarkable, easy-to-follow book is a priceless guide to creative, personalized leadership that elicits the best performance from your staff--and the best bottom line for any business. If your management motto is \"everyone should be treated equally,\" \"Leadership and the One Minute Manager.\" will show you why this style not only hinders workplace efficiency, but also frustrates your staff. In clear, simple terms, Ken Blanchard, co-author of the enormously popular \"The One Minute Manager., \" coupled with business gurus Patricia and Drea Zigarmi, teach managers the art of Situational Leadership.. You\'ll learn why tailoring management styles to individual employees is so important; when to delegate, support, or direct; how to identify the leadership style suited to a particular person; and how consistent use of the One Minute techniques will produce better management and enhanced motivation on all levels. This remarkable, easy-to-follow book is a priceless guide to creative, personalized leadership that elicits the best performance from your staff and the best bottom line for any business.', NULL, 176, 1, NULL, 100.00, NULL, '2021-03-05 23:31:50', '2021-03-05 23:31:50'),
(760, 'Reasons to Stay Alive', 'Reasons-to-Stay-Alive', 'http://books.google.com/books/content?id=rO49rgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rO49rgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782116820', 'WHAT DOES IT MEAN TO FEEL TRULY ALIVE? Aged 24, Matt Haig\'s world caved in. He could see no way to go on living. This is the true story of how he came through crisis, triumphed over an illness that almost destroyed him and learned to live again.A moving, funny and joyous exploration of how to live better, love better and feel more alive, Reasons to Stay Alive is more than a memoir. It is a book about making the most of your time on earth.\"I wrote this book because the oldest clichés remain the truest. Time heals. The bottom of the valley never provides the clearest view. The tunnel does have light at the end of it, even if we haven\'t been able to see it . . . Words, just sometimes, really can set you free.\"', NULL, 251, 1, NULL, 100.00, NULL, '2021-03-05 23:31:50', '2021-03-05 23:31:50'),
(761, 'Last Breath', 'Last-Breath', 'http://books.google.com/books/content?id=8ks2ygAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8ks2ygAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749008147', 'When college student Claire Danvers learns that three of the vampires in Morganville have disappeared without a trace, only to discover that the last person seen with one of the missing vampires is a mysterious new resident named Magnus, she begins to suspect that Magnus is not a fellow-human', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:51', '2021-03-05 23:31:51'),
(762, 'Kiss of Death', 'Kiss-of-Death', 'http://books.google.com/books/content?id=IUmmQwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IUmmQwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749007843', 'Claire Danvers has a few things on her mind. Not least the fact that she lives in a town run by vampires. Claire and her friends must find the most difficult documents for a vampire to acquire; people passes that will allow \'bad ass\' Morley and his friends to leave Morganville.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:51', '2021-03-05 23:31:51'),
(763, 'Glass Houses', 'Glass-Houses', 'http://books.google.com/books/content?id=_idwvwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_idwvwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749079512', 'In Morganville, Texas, a town where evil terrorizes the streets under the cover of darkness, Claire Danvers, who has had enough of her current dorm situation, moves off campus and discovers that her new roommates are vampires.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:51', '2021-03-05 23:31:51'),
(764, 'Feast of Fools', 'Feast-of-Fools', 'http://books.google.com/books/content?id=4SfzOwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4SfzOwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749079796', 'Fantasy-roman.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:51', '2021-03-05 23:31:51'),
(765, 'Midnight Alley', 'Midnight-Alley', 'http://books.google.com/books/content?id=np6YvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=np6YvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749079222', 'Fantasy-roman.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(766, 'Fade Out', 'Fade-Out', 'http://books.google.com/books/content?id=8afdQQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8afdQQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749007492', 'Life has changed dramatically in Morganville. The resident vampires have made major concessions to the human population and with their newfound freedoms, Claire Danvers and her friends are starting to feel comfortable again - almost.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(767, 'The Dead Girls\' Dance', 'The-Dead-Girls\'-Dance', 'http://books.google.com/books/content?id=b6b8yAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=b6b8yAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749079864', 'Fantasy-roman.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(768, 'Fall of Night', 'Fall-of-Night', 'http://books.google.com/books/content?id=ib0KkgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ib0KkgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749012663', 'With things still raw and unsettled between Claire and her boyfriend Shane, Claire has been granted the opportunity to move out of Morganville - and she\'s taking it. Escorted to the town borders by Myrnin, she is given her admission papers to MIT, along with enrollment in an advanced study program with Professor Irene Anderson, a former Morganville native. But it\'s hard to leave the town, the vamps and her friends behind and Claire can\'t help but wonder whether leaving Morganville is actually a mistake.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(769, 'Bitter Blood', 'Bitter-Blood', 'http://books.google.com/books/content?id=VnKDMQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VnKDMQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749012809', 'With the eradication of the draug, the vampires of Morganville have been freed of their usual constraints. With the vampires indulging their every whim, the town\'s human population is determined to hold on to their lives by taking up arms. But Claire Danvers isn\'t about to take sides, considering she has ties to both the humans and the vampires.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(770, 'Carpe Corpus', 'Carpe-Corpus', 'http://books.google.com/books/content?id=9MGiPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9MGiPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749007775', 'In the small town of Morganville, vampires and humans lived in relative peace - until all the rules got rewritten when the evil vampire Bishop arrived, looking for the lost book of vampire secrets. He has kept a death grip on the town ever since. But resistance is brewing, and suddenly the Bishop now finds himself on the defensive.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:52', '2021-03-05 23:31:52'),
(771, 'Lord of Misrule', 'Lord-of-Misrule', 'http://books.google.com/books/content?id=LFeIPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LFeIPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749007577', '\"In the college town of Morganville, vampires and humans have coexisted in (relatively) bloodless harmony ... until the arrival of Bishop, a master vampire who threatens to put the evil back in evil undead and smash the fragile peace. But Bishop isn\'t the only threat ... Violent black clouds promise a storm of devastating proportions. As student Claire Danvers and her friends prepare to defend Morganville against the elements--both natural and unnatural--the unexpected happens: Morganville\'s vampires begin to vanish one by one. Discovering why leads Claire to one last choice: Swear allegiance to Bishop, or die.\"--P. [4] of cover.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:53', '2021-03-05 23:31:53'),
(772, 'Thunder of the Gods', 'Thunder-of-the-Gods', 'http://books.google.com/books/content?id=R6KNrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=R6KNrgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781444732009', '\'A master of the genre\' The Times The eighth book in the Empire sequence takes Centurion Marcus Aquila and his Tungrian legion on a dangerous mission to the heart of the Parthian empire. With Rome no longer safe Marcus and the Tungrians are ordered east, to the desolate border lands where Rome and Parthia have vied for supremacy for centuries. Ordered to relieve the siege of an isolated fortress, their task is doomed to bloody failure unless they can turn the disaffected Third Legion into a fighting force capable of resisting the terrifying Parthian cataphracts. And Marcus must travel to the enemy capital Ctesiphon on a desperate mission, the only man who can persuade the King of Kings to halt a war that threatens the humiliation of the empire and the slaughter of his friends.', NULL, 253, 1, NULL, 100.00, NULL, '2021-03-05 23:31:53', '2021-03-05 23:31:53'),
(773, 'Mrs Hudson and the Lazarus Testament', 'Mrs-Hudson-and-the-Lazarus-Testament', 'http://books.google.com/books/content?id=iH7GwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=iH7GwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788631440', 'A thrilling cosy mystery for Mrs Hudson, Baker Street’s best-kept secret. A man is knocked down outside 221B Baker Street. His dying words speak of a man risen from the grave. A Viscount has gone missing and there are rumours of a dead man haunting the moors and a country hall beset by ghostly lights and spectres. Sherlock Holmes’ housekeeper, the formidable Mrs Hudson, is faced with a mystery. Joined by her assistant Flotsam, they’re once again thrown into dark adventure full of gripping twists and murderous intrigue. Together with Holmes and Dr. Watson they must race against the forces of darkness to uncover the truth behind the mysterious document known as the Lazarus Testament. Lives are on the line and the puzzle must be solved... But not before a slice of Dundee cake. The third in the bestselling Sherlock Holmes & Mrs Hudson Mysteries, this is a dark but cosy crime novel that will transport readers to a world of foggy streets and snow-covered fells and Victorian London.', NULL, 254, 1, NULL, 100.00, NULL, '2021-03-05 23:31:53', '2021-03-05 23:31:53');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(774, 'Heroes', 'Heroes', 'http://books.google.com/books/content?id=sLdFvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sLdFvgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781405940368', 'IMAGINE SANDALS ON YOUR FEET, A SWORD IN YOUR HAND, HOT SUN BEATING DOWN ON YOUR BRONZE HELMET. ENTER THE WORLD OF STEPHEN FRY\'S SUNDAY TIMES BESTSELLER, HEROES In this companion to his bestselling Mythos, Stephen Fry gloriously retells the epic myths of the Greek heroes - which will be loved by young and old alike. \'An odyssey through Greek mythology. Brilliant . . . all hail Stephen Fry\' Daily Mail ___________ Few mere mortals have ever embarked on such bold and heart-stirring adventures, overcome myriad monstrous perils, or outwitted scheming vengeful gods, quite as stylishly and triumphantly as Greek heroes. In this companion to his bestselling Mythos, Stephen Fry brilliantly retells these dramatic, funny, tragic and timeless tales. Join Jason aboard the Argo as he quests for the Golden Fleece. See Atalanta - who was raised by bears - outrun any man before being tricked with golden apples. Witness wily Oedipus solve the riddle of the Sphinx and discover how Bellerophon captures the winged horse Pegasus to help him slay the monster Chimera. Filled with white-knuckle chases and battles, impossible puzzles and riddles, acts of base cowardice and real bravery, not to mention murders and selfless sacrifices, Heroes is the story of what we mortals are truly capable of - at our worst and our very best. \'A romp through the lives of ancient Greek gods. Fry is at his story-telling best . . . the gods will be pleased\' Times \'Assured and engaging. The pace is lively, the jokes are genuinely funny\' Guardian \'An Olympian feat. The gods seem to be smiling on Fry - his myths are definitely a hit\' Evening Standard \'Just as delightful and difficult to put down as the first. Heroes makes the stories relatable without skimping on the gory details, or sacrificing the truths of the myth. It\'s rich, it\'s funny and you\'ll feel like you\'ve learned a lot\' Herald ___________ If you like the sound of Heroes, you\'ll love Mythos - Fry\'s first foray into the enthralling world of Greek mythology. Praise for Mythos: \'Ebullient and funny\' Times \'Entertaining and edifying\' Daily Telegraph \'A rollicking good read\' Independent \'The Greek gods of the past become relatable as pop culture, modern literature and music are woven throughout. Joyfully informal yet full of the literary legacy\' Guardian', NULL, 255, 1, NULL, 100.00, NULL, '2021-03-05 23:31:53', '2021-03-05 23:31:53'),
(775, 'The Time to Kill', 'The-Time-to-Kill', 'http://books.google.com/books/content?id=a5NFvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=a5NFvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409159650', '\'One of the best new series characters since Jack Reacher\' Lisa Gardner THEY TAUGHT HIM TO KILL. NOW THEY WANT HIM DEAD. It\'s been five years since Carter Blake parted ways with top-secret government operation Winterlong. They brokered a deal at the time: he\'d keep quiet about what they were doing, and in return he\'d be left alone. But news that one of Blake\'s old allies, a man who agreed the same deal, is dead means only one thing - something has changed and Winterlong is coming for him. Emma Faraday, newly appointed head of the secret unit, is determined to tie up loose ends. And Blake is a very loose end. He\'s been evading them for years, but finally they\'ve picked up his trace. Blake may be the best there is at tracking down people who don\'t want to be found, but Winterlong taught him everything he knows. If there\'s anyone who can find him - and kill him - it\'s them. It\'s time for Carter Blake to up his game. High-stakes action, blistering tension and a deadly game of cat and mouse, THE TIME TO KILL is the must-read new thriller from Mason Cross.', NULL, 249, 1, NULL, 100.00, NULL, '2021-03-05 23:31:53', '2021-03-05 23:31:53'),
(776, 'The Eagle\'s Conquest', 'The-Eagle\'s-Conquest', '', '', '9781472250810', '', NULL, 256, 1, NULL, 100.00, NULL, '2021-03-05 23:31:54', '2021-03-05 23:31:54'),
(777, 'Bite Club', 'Bite-Club', 'http://books.google.com/books/content?id=stzUYgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=stzUYgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749008093', 'Claire has come to realise that the undead of Morganville just want to live their lives. But there\'s a new extreme sport being broadcast over the Internet - bare-knuckle fights pitting captured vampires against one another - or, worse, against humans. What started as an online brawl will soon threaten everyone in Morganville.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:54', '2021-03-05 23:31:54'),
(778, 'Black Dawn', 'Black-Dawn', 'http://books.google.com/books/content?id=Fn1WuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Fn1WuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749040550', 'When the ferocious draug, the vampire\'s deadliest enemy, floods Morganville most of the locals flee. Student Claire Danvers and her friends Shane, Eve and Michael, however, choose to stay and fight. But unless they can find an antidote to the draugs\' bite, Morganville\'s future looks bleak', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:31:54', '2021-03-05 23:31:54'),
(779, 'The Ask and the Answer', 'The-Ask-and-the-Answer', '', '', '9781406384130', 'Fleeing before a relentless army, Todd and Viola once again face their worst enemy, Mayor Prentiss. Immediately imprisoned and separated from Viola, Todd is forced to learn the ways of the Mayor\'s new order. And then, one day, the bombs begin to explode ...', NULL, 257, 1, NULL, 100.00, NULL, '2021-03-05 23:31:54', '2021-03-05 23:31:54'),
(780, 'Who Killed Change?', 'Who-Killed-Change?', 'http://books.google.com/books/content?id=5a59FRj_qlgC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5a59FRj_qlgC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007317493', 'Every day organizations around the world launch change initiatives designed to improve the status quo. Yet 50 to 70 percent of these change efforts fail. So, who or what is killing change? That\'s what you\'ll find out in this witty whodunit.', NULL, 258, 1, NULL, 100.00, NULL, '2021-03-05 23:31:55', '2021-03-05 23:31:55'),
(781, 'A Dance with Dragons', 'A-Dance-with-Dragons', 'http://books.google.com/books/content?id=E5TOygAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=E5TOygAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007466061', 'In the aftermath of a colossal battle, new threats are emerging from every direction. Tyrion Lannister, having killed his father, and wrongfully accused of killing his nephew, King Joffrey, has escaped from King\'s Landing with a price on his head.', NULL, 259, 1, NULL, 100.00, NULL, '2021-03-05 23:31:55', '2021-03-05 23:31:55'),
(782, 'Last Message', 'Last-Message', 'http://books.google.com/books/content?id=uuWVFDISfpIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=uuWVFDISfpIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781554699353', 'Adam thought he knew about his grandfather, but when he is sent to France to perform three very difficult (and dangerous, possibly illegal) tasks for him, Adam discovers things about his grandfather-- and himself--that he never imagined.', NULL, 260, 1, NULL, 100.00, NULL, '2021-03-05 23:31:55', '2021-03-05 23:31:55'),
(783, 'Close to the Heel', 'Close-to-the-Heel', 'http://books.google.com/books/content?id=4BuNVctFkgQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4BuNVctFkgQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781554699506', 'At the request of his late grandfather, Rennie goes to Iceland to right an old wrong, and gets drawn into investigating a murder.', NULL, 261, 1, NULL, 100.00, NULL, '2021-03-05 23:31:56', '2021-03-05 23:31:56'),
(784, 'Devil\'s Pass', 'Devil\'s-Pass', 'http://books.google.com/books/content?id=D58e8kpuAxEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=D58e8kpuAxEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781554699384', 'Webb, a young street musician, faces grizzly bears and a madman on the Canol Trail when he tries to fulfill a request in his late grandfather\'s will.', NULL, 262, 1, NULL, 100.00, NULL, '2021-03-05 23:31:56', '2021-03-05 23:31:56'),
(785, 'Between Heaven and Earth', 'Between-Heaven-and-Earth', 'http://books.google.com/books/content?id=j6FA0iHio7YC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=j6FA0iHio7YC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781554699414', 'At the request of his late grandfather, DJ climbs Mount Kilimanjaro to scatter his ashes.', NULL, 263, 1, NULL, 100.00, NULL, '2021-03-05 23:31:56', '2021-03-05 23:31:56'),
(786, 'A Monster Calls', 'A-Monster-Calls', 'http://books.google.com/books/content?id=bxH8rQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bxH8rQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781406361803', 'Conor\'s mother has cancer and the treatment is not working. He wakes from a nightmare at seven minutes past midnight to find an elemental monster at the window, that demands the truth from Conor.', NULL, 257, 1, NULL, 100.00, NULL, '2021-03-05 23:31:57', '2021-03-05 23:31:57'),
(787, 'Why Mummy Swears', 'Why-Mummy-Swears', 'http://books.google.com/books/content?id=TBE6uwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TBE6uwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008284220', 'The hilarious second novel, and Sunday Times No 1 Bestseller, from author of the smash hit Why Mummy Drinks.Monday, 25 JulyThe first day of the holidays. I suppose it could\'ve been worse. I brightly announced that perhaps it might be a lovely idea to go to a stately home and learn about some history. As soon as we got there I remembered why I don\'t use the flipping National Trust membership - because National Trust properties are full of very precious and breakable items, and very precious and breakable items don\'t really mix with children, especially not small boys.Where I had envisaged childish faces glowing with wonder as they took in the treasures of our nation\'s illustrious past, we instead had me shouting \'Don\'t touch, DON\'T TOUCH, FFS DON\'T TOUCH!\" while stoutly shod pensioners tutted disapprovingly and drafted angry letters to the Daily Mail in their heads.How many more days of the holiday are there?Welcome to Mummy\'s world...The Boy Child Peter is connected to his iPad by an umbilical cord, The Girl Child Jane is desperate to make her fortune as an Instagram lifestyle influencer, while Daddy is constantly off on exotic business trips...Mummy\'s marriage is feeling the strain, her kids are running wild and the house is steadily developing a forest of mould. Only Judgy, the Proud and Noble Terrier, remains loyal as always.Mummy has also found herself a new challenge, working for a hot new tech start-up. But not only is she worrying if, at forty-two, she could actually get up off a bean bag with dignity, she\'s also somehow (accidentally) rebranded herself as a single party girl who works hard, plays hard and doesn\'t have to run out when the nanny calls in sick.Can Mummy keep up the facade while keeping her family afloat? Can she really get away with wearing \'comfy trousers\' to work? And, more importantly, can she find the time to pour herself a large G+T?Probably effing not.', NULL, 264, 1, NULL, 100.00, NULL, '2021-03-05 23:31:57', '2021-03-05 23:31:57'),
(788, 'People Skills', 'People-Skills', 'http://books.google.com/books/content?id=SCR83PTsOKAC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SCR83PTsOKAC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780671622480', 'Improve your personal and professional relationships instantly with this timeless guide to communication, listening skills, body language, and conflict resolution. A wall of silent resentment shuts you off from someone you love....You listen to an argument in which neither party seems to hear the other....Your mind drifts to other matters when people talk to you.... People Skills is a communication-skills handbook that can help you eliminate these and other communication problems. Author Robert Bolton describes the twelve most common communication barriers, showing how these “roadblocks” damage relationships by increasing defensiveness, aggressiveness, or dependency. He explains how to acquire the ability to listen, assert yourself, resolve conflicts, and work out problems with others. These are skills that will help you communicate calmly, even in stressful emotionally charged situations. People Skills will show you: · How to get your needs met using simple assertion techniques · How body language often speaks louder than words · How to use silence as a valuable communication tool · How to de-escalate family disputes, lovers\' quarrels, and other heated arguments Both thought-provoking and practical, People Skills is filled with workable ideas that you can use to improve your communication in meaningful ways, every day.', NULL, 265, 1, NULL, 100.00, NULL, '2021-03-05 23:31:57', '2021-03-05 23:31:57'),
(789, 'Boundaries', 'Boundaries', 'http://books.google.com/books/content?id=v5XBswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=v5XBswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008271602', '', NULL, 266, 1, NULL, 100.00, NULL, '2021-03-05 23:31:57', '2021-03-05 23:31:57'),
(790, 'Unlimited Power', 'Unlimited-Power', 'http://books.google.com/books/content?id=6COQPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6COQPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780743409391', 'If you have ever dreamed of a better life, UNLIMITED POWER will show you how to achieve the extraordinary quality of life you desire and deserve. Anthony Robbins has proven to millions through his books, tapes and seminars that by harnessing the power of your mind you can do, have, achieve and create anything you want for your life. UNLIMITED POWER is a revolutionary fitness book for the mind. It will show you, step by step, how to perform at your peak while gaining emotional and financial freedom, attaining leadership and self-confidence and winning the co-operation of others. UNLIMITED POWER is a guidebook to superior performance in an age of success.', NULL, 267, 1, NULL, 100.00, NULL, '2021-03-05 23:31:58', '2021-03-05 23:31:58'),
(791, 'A Clash of Kings', 'A-Clash-of-Kings', 'http://books.google.com/books/content?id=zlwlTfBeiSoC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zlwlTfBeiSoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007447831', 'HBO\'s hit series A GAME OF THRONES is based on George R R Martin\'s internationally bestselling series A SONG OF ICE AND FIRE, the greatest fantasy epic of the modern age. A CLASH OF KINGS is the second volume in the series. \'Nobody does fantasy quite like Martin\' Sunday Times Throughout Westeros, the cold winds are rising. From the ancient citadel of Dragonstone to the forbidding lands of Winterfell, chaos reigns as pretenders to the Iron Throne of the Seven Kingdoms stake their claims through tempest, turmoil and war. As a prophecy of doom cuts across the sky - a comet the colour of blood and flame - five factions struggle for control of a divided land. Brother plots against brother and the dead rise to walk in the night. Against a backdrop of incest, fratricide, alchemy and murder, the price of glory is measured in blood.', NULL, 259, 1, NULL, 100.00, NULL, '2021-03-05 23:31:59', '2021-03-05 23:31:59'),
(792, 'The Goldfish Boy', 'The-Goldfish-Boy', 'http://books.google.com/books/content?id=wxeLjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wxeLjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407170992', 'A story about finding friendship when you\'re lonely - and hope when all you feel is fear. Twelve-year-old Matthew is trapped in his bedroom by crippling OCD, spending most of his time staring out of his window as the inhabitants of Chestnut Close go about their business. Until the day he is the last person to see his next door neighbour\'s toddler, Teddy, before he goes missing. Matthew must turn detective and unravel the mystery of Teddy\'s disappearance - with the help of a brilliant cast of supporting characters. Page-turning, heartbreaking, but ultimately life-affirming, this story is perfect for fans of The Curious Incident of the Dog in the Night Time and Wonder. It is a book that will make you laugh and cry.', NULL, 268, 1, NULL, 100.00, NULL, '2021-03-05 23:31:59', '2021-03-05 23:31:59'),
(793, 'Into the Wild', 'Into-the-Wild', 'http://books.google.com/books/content?id=OgqJPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OgqJPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007217878', 'Rich and exciting feline fantasy world in which epic battles for territory and honour are played out.This new series will have particular appeal for fans of Brian Jacques\' Redwall series.', NULL, 269, 1, NULL, 100.00, NULL, '2021-03-05 23:31:59', '2021-03-05 23:31:59'),
(794, 'A Dance with Dragons', 'A-Dance-with-Dragons-9780007466078', 'http://books.google.com/books/content?id=icwIMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=icwIMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007466078', 'Dubbed \"the American Tolkien\" by \"TIME\" magazine, Martin has earned international acclaim for his monumental cycle of epic fantasy. Now the #1 \"New York Times\"-bestselling author delivers the fifth book in his landmark series--as both familiar faces and surprising new forces vie for a foothold in a fragmented empire.', NULL, 259, 1, NULL, 100.00, NULL, '2021-03-05 23:32:00', '2021-03-05 23:32:00'),
(795, 'Mars and Venus Starting Over', 'Mars-and-Venus-Starting-Over', 'http://books.google.com/books/content?id=0BlJNdTmY9cC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0BlJNdTmY9cC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780091816278', 'Guide to recreating a loving and lasting relationship showing newly single people how to move past the pain of being alone and start dating again.', NULL, 235, 1, NULL, 100.00, NULL, '2021-03-05 23:32:00', '2021-03-05 23:32:00'),
(796, 'Fragile Lives', 'Fragile-Lives', 'http://books.google.com/books/content?id=_VTkAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_VTkAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008196783', 'SHORTLISTED FOR THE COSTA BIOGRAPHY PRIZE THE SUNDAY TIMES NO.2 BESTSELLER WINNER OF THE BMA PRESIDENT\'S AWARD 2017 An incredible memoir from one of the world\'s most eminent heart surgeons, recalling some of the most remarkable and poignant cases he\'s worked on. Grim Reaper sits on the heart surgeon\'s shoulder. A slip of the hand and life ebbs away. The balance between life and death is so delicate, and the heart surgeon walks that rope between the two. In the operating room there is no time for doubt. It is flesh, blood, rib-retractors and pumping the vital organ with your bare hand to squeeze the life back into it. An off-day can have dire consequences - this job has a steep learning curve, and the cost is measured in human life. Cardiac surgery is not for the faint of heart. Professor Stephen Westaby took chances and pushed the boundaries of heart surgery. He saved hundreds of lives over the course of a thirty-five year career and now, in his astounding memoir, Westaby details some of his most remarkable and poignant cases - such as the baby who had suffered multiple heart attacks by six months old, a woman who lived the nightmare of locked-in syndrome, and a man whose life was powered by a battery for eight years. A powerful, important and incredibly moving book, Fragile Lives offers an exceptional insight into the exhilarating and sometimes tragic world of heart surgery, and how it feels to hold someone\'s life in your hands.', NULL, 493, 1, NULL, 100.00, NULL, '2021-03-05 23:32:00', '2021-03-05 23:32:00'),
(797, 'The Warlock', 'The-Warlock', 'http://books.google.com/books/content?id=la28OPPgRKUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=la28OPPgRKUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552562560', '\"The Newman twins have finally been divided. The end is near. In San Francisco, Josh has chosen a side - and he will not stand with his sister, Sophie, or the Alchemyst, Nicholas Flamel. He has chosen to fight along side John Dee and the mysterious Virginia Dare. Sophie will do anything she can to find her brother, but her training must continue. With Perenelle and Nicholas as weak as they are, Niten must help her to master Earth Magic. Without this, she will fail and the human race will be doomed forever... Can she save the world alone? Fans of the Secrets of the Immortal Nicholas Flamel series will be breathless in anticipation of this thrilling penultimate chapter in Sophie and Josh\'s adventures.\"', NULL, 494, 1, NULL, 100.00, NULL, '2021-03-05 23:32:00', '2021-03-05 23:32:00'),
(798, '8 Rivers of Shadow', '8-Rivers-of-Shadow', 'http://books.google.com/books/content?id=pBlpjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pBlpjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408337486', 'A thrilling supernatural adventure: dark, funny, with twists at every turn. The sequel to Thirteen Days of Midnight, shortlisted for the Waterstones Children\'s Prize 2016. Luke Manchett used to be one of the most popular boys at school. That was before his necromancer father died and left him a host of vengeful ghosts that wanted him dead. Now everyone thinks he\'s a freak. To make matters worse, the mysterious new girl at school is actually the daughter of his father\'s deadliest enemy... And she\'s out for revenge.', NULL, 495, 1, NULL, 100.00, NULL, '2021-03-05 23:32:01', '2021-03-05 23:32:01'),
(799, 'True Power', 'True-Power', 'http://books.google.com/books/content?id=PxwRswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PxwRswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782069171', 'The War. After battling their way across Werlavia, Megan and her friends have found safety in the mountain city of Hil. But the army of the True are waiting. The Threat. Megan knows they can\'t ignore the witch menace for long. Empowered by their guns and their allies, they are coming for her, for her daughter, for their world. The Power. Megan is no longer an ordinary mill girl. Mother, Apostate, Countess: it is up to Megan to protect the people of the Realm. But she will have to risk everything she loves to do so.', NULL, 496, 1, NULL, 100.00, NULL, '2021-03-05 23:32:01', '2021-03-05 23:32:01'),
(800, 'All the Missing Girls', 'All-the-Missing-Girls', 'http://books.google.com/books/content?id=Hd9YtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Hd9YtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786490834', 'Ten years after leaving Cooley Ridge, Nicolette Farrell returns to care for her ailing father. A decade ago, she, her brother Daniel, her boyfriend Tyler, and Corinne\'s boyfriend Jackson were suspects when Corinne -- Nic\'s best friend -- disappeared without a trace. Within days of Nic\'s return, they are plunged into a shocking drama when Nic\'s neighbor Annaleise, who is dating Tyler and was the group\'s alibi ten years previously, goes missing. Told backwards from the time Annaleise disappears, the book follows Nic as she works to unravel the truth and, in the process, reveals shocking realities about her friends, her family, and what really happened to Corinne that night ten years ago.', NULL, 497, 1, NULL, 100.00, NULL, '2021-03-05 23:32:01', '2021-03-05 23:32:01'),
(801, 'Undead Girl Gang', 'Undead-Girl-Gang', 'http://books.google.com/books/content?id=vsKSDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vsKSDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780451478245', '\"A fun, fast read...it will resonate with readers who dabble in any sort of arts, dark or otherwise.\" --NPR.org \"With a singular and hilariously cutting teen voice, UNDEAD GIRL GANG is sure to be one of the most talked-about YA novels of the year.\" --BookPage Veronica Mars meets The Craft when a teen girl investigates the suspicious deaths of three classmates and accidentally ends up bringing them back to life to form a hilariously unlikely--and unwilling--vigilante girl gang. Meet teenage Wiccan Mila Flores, who truly could not care less what you think about her Doc Martens, her attitude, or her weight because she knows that, no matter what, her BFF Riley is right by her side. So when Riley and Fairmont Academy mean girls June Phelan-Park and Dayton Nesseth die under suspicious circumstances, Mila refuses to believe everyone\'s explanation that her BFF was involved in a suicide pact. Instead, armed with a tube of lip gloss and an ancient grimoire, Mila does the unthinkable to uncover the truth: she brings the girls back to life. Unfortunately, Riley, June, and Dayton have no recollection of their murders. But they do have unfinished business to attend to. Now, with only seven days until the spell wears off and the girls return to their graves, Mila must wrangle the distracted group of undead teens and work fast to discover their murderer...before the killer strikes again.', NULL, 498, 1, NULL, 100.00, NULL, '2021-03-05 23:32:01', '2021-03-05 23:32:01'),
(802, 'A Monstrous Regiment of Women', 'A-Monstrous-Regiment-of-Women', 'http://books.google.com/books/content?id=VNWLngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VNWLngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749014995', 'In this sequel to \'The Beekeeper\'s Apprentice\', Mary encounters a friend from Oxford who introduces her to a charismatic sect involved in the suffrage movement. Then a series of murders claims members of the movement\'s wealthy volunteers.', NULL, 499, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(803, 'The Beekeeper\'s Apprentice, Or on the Segregation of the Queen', 'The-Beekeeper\'s-Apprentice,-Or-on-the-Segregation-of-the-Queen', 'http://books.google.com/books/content?id=etELRQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=etELRQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749008529', '\'The Beekeeper\'s Apprentice\' tells the story of Mary Russell, a young woman who in 1914, meets a retired beekeeper on the Sussex Downs. His name is Sherlock Homes, and he soon takes Mary on as his apprentice.', NULL, 499, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(804, 'The Width of the World', 'The-Width-of-the-World', 'http://books.google.com/books/content?id=dv9NDgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=dv9NDgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509844982', 'David Baldacci is back with The Width of the World, the third book in the Vega Jane series which began with his instant #1 global bestseller and award-winning YA fantasy debut The Finisher.Vega Jane continues her quest to understand her history and travel beyond her known world into a dangerous realm full of magic and mysterious beasts. Accompanied by best friend Delph, her dog, Harry Two, and new accomplice, Petra, Vega Jane must take on the evil magical race of the Maladons, who are determined to wipe them out.', NULL, 77, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(805, 'God\'s Little Book of Love', 'God\'s-Little-Book-of-Love', 'http://books.google.com/books/content?id=0Jw1mgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0Jw1mgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007528370', 'Each of us has the seeds of love that can be cultivated to grow and spread out to each other. Anyone can make a difference, even if it is with just one person at a time. This volume is designed to provide a few ideas and thoughts to help you make a positive difference in somebody\'s life.', NULL, 500, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(806, 'God\'s Little Book of Joy', 'God\'s-Little-Book-of-Joy', 'http://books.google.com/books/content?id=9OO9mgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9OO9mgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007528363', '\'God\'s Little Book of Joy\' celebrates the joys that surround us, and highlights sources of joy even in hard times.', NULL, 500, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(807, 'Nemesis', 'Nemesis', 'http://books.google.com/books/content?id=6alEQSpKYcUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6alEQSpKYcUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099546757', 'Oslo Police Detective Harry Hole is assigned to investigate a series of bank robberies of unparalleled savagery while at the same time absolving himself of the murder of his former girlfriend in a criminal investigation led by his longtime adversary Tom Waaler and Waaler\'s vigilante police force.', NULL, 476, 1, NULL, 100.00, NULL, '2021-03-05 23:32:02', '2021-03-05 23:32:02'),
(808, 'Screw It, Let\'s Do it', 'Screw-It,-Let\'s-Do-it', 'http://books.google.com/books/content?id=xEWn_U1FkycC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xEWn_U1FkycC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753510995', 'The renowned international entrepreneur shares the personal lessons and wisdom he has learned that have helped achieve success in his business and personal life, including determination, loving what one does, and trying over and over until one accomplishes one\'s goal. Original.', NULL, 501, 1, NULL, 100.00, NULL, '2021-03-05 23:32:03', '2021-03-05 23:32:03'),
(809, 'The Snowman', 'The-Snowman', '', '', '9780099587156', 'The night the first snow falls a young boy wakes to find his mother gone. He walks through the silent house, but finds only wet footprints on the stairs. In the garden looms a solitary figure: a snowman bathed in cold moonlight, its black eyes glaring up at the bedroom windows. Round its neck is his mother\'s pink scarf. Inspector Harry Hole is convinced there is a link between the disappearance and a menacing letter he received some months earlier. As Harry and his team delve into unsolved case files, they discover that an alarming number of wives and mothers have gone missing over the years. When a second woman disappears Harry\'s suspicions are confirmed: he is a pawn in a deadly game. For the first time in his career Harry finds himself confronted with a serial killer operating on his turf, a killer who will drive him to the brink of insanity. A brilliant thriller with a pace that never lets up, The Snowman confirms Jo Nesb \'s position as an international star of crime fiction.', NULL, 476, 1, NULL, 100.00, NULL, '2021-03-05 23:32:03', '2021-03-05 23:32:03'),
(810, 'Phantom', 'Phantom', 'http://books.google.com/books/content?id=Ap-_dzuWgfUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ap-_dzuWgfUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099570349', 'THE MURDER HAS BEEN SOLVED. BUT HAS JUSTICE BEEN DONE?Harry Hole is back in Oslo. He\'s been away for some time, but his ghosts have a way of catching up with him. The case that brings him back is already closed. There is no room for doubt: the young junkie was shot dead by a fellow addict. THE POLICE DON\'T WANT HIM BACK...Denied permission to reopen the investigation, Harry strikes out on his own. Beneath the city\'s eerie tranquillity, he discovers a trail of violence and mysterious disappearances seemingly unnoticed by the police. At every turn Harry is faced with a conspiracy of silence. THE CRIMINALS DON\'T WANT HIM BACK...Harry is not the only one who is interested in the case. From the moment he steps off the plane, someone is watching his every move and tracing his every call. SOMEONE WANTS HIM SILENCED.', NULL, 476, 1, NULL, 100.00, NULL, '2021-03-05 23:32:04', '2021-03-05 23:32:04'),
(811, 'The Adventures of Huckleberry Finn', 'The-Adventures-of-Huckleberry-Finn', 'http://books.google.com/books/content?id=1SLXIagHcCQC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1SLXIagHcCQC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007351039', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'We said there warn\'t no home like a raft, after all. Other places do seem so cramped up and smothery, but a raft don\'t. You feel mighty free and easy and comfortable on a raft.\' Huck Finn escapes from his alcoholic father by faking his own death and so begins his journey through the Deep South, seeking independence and freedom. On his travels, Huck meets an escaped slave, Jim, who is a wanted man, and together they journey down the Mississippi River. Raising the timeless and universal l issues of prejudice, bravery and hope, the Adventures of Huckleberry Finn was and still is considered the great American novel.', NULL, 502, 1, NULL, 100.00, NULL, '2021-03-05 23:32:04', '2021-03-05 23:32:04'),
(812, 'Heart of Darkness', 'Heart-of-Darkness', 'http://books.google.com/books/content?id=FZKTtaCO6oAC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FZKTtaCO6oAC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007368624', 'HarperCollins is proud to present its range of best-loved, essential classics. The reaches opened before us and closed behind, as if the forest had stepped leisurely across the water to bar the way for our return. We penetrated deeper and deeper into the heart of darkness. At the peak of European Imperialism, steamboat captain Charles Marlow travels deep into the African Congo on his way to relieve the elusive Mr Kurtz, an ivory trader renowned for his fearsome reputation. On his journey into the unknown Marlow takes a terrifying trip into his own subconscious, overwhelmed by his menacing, perilous and horrifying surroundings. The landscape and the people he meets force him to reflect on human nature and society, and in turn Conrad writes revealingly about the dangers of imperialism. \"', NULL, 503, 1, NULL, 100.00, NULL, '2021-03-05 23:32:04', '2021-03-05 23:32:04'),
(813, 'Robinson Crusoe', 'Robinson-Crusoe', 'http://books.google.com/books/content?id=DgaOBPtCqI0C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DgaOBPtCqI0C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350841', 'On a desolate tropical island, a shipwrecked British seaman tries to master his hostile environment and remain civilized.', NULL, 504, 1, NULL, 100.00, NULL, '2021-03-05 23:32:05', '2021-03-05 23:32:05'),
(814, 'Little Lord Fauntleroy (小主人豐特洛伊)', 'Little-Lord-Fauntleroy-(小主人豐特洛伊)', 'http://books.google.com/books/content?id=uXjKvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uXjKvgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007449927', '※ Google Play 圖書不支援多媒體播放 ※', NULL, 193, 1, NULL, 100.00, NULL, '2021-03-05 23:32:05', '2021-03-05 23:32:05'),
(815, 'The Wonderful Wizard of Oz', 'The-Wonderful-Wizard-of-Oz', 'http://books.google.com/books/content?id=E-XBiaSl6lkC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=E-XBiaSl6lkC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007368556', 'Published at the dawn of the twentieth century, The Wonderful Wizard of Oz (1900) immediately captivated children and adult readers alike. This new edition is the only one to include many of W.W. Denslow\'s original illustrations. The Introduction considers both the famous MGM film version and recent literary theory in a fascinating discussion of this timeless classic of children\'s literature. The story of Dorothy and her friends from Oz remains as popular now as when it was first published in 1899. About the Series: For over 100 years Oxford World\'s Classics has made available the broadest spectrum of literature from around the globe. Each affordable volume reflects Oxford\'s commitment to scholarship, providing the most accurate text plus a wealth of other valuable features, including expert introductions by leading authorities, voluminous notes to clarify the text, up-to-date bibliographies for further study, and much more.', NULL, 505, 1, NULL, 100.00, NULL, '2021-03-05 23:32:05', '2021-03-05 23:32:05'),
(816, 'The Last of the Mohicans', 'The-Last-of-the-Mohicans', 'http://books.google.com/books/content?id=I7tcfi3ZTzgC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=I7tcfi3ZTzgC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007368662', 'Natty Bumppo (Hawkeye) shares the wilderness with his Mohican Indian friend, Chingachgook. When the savageries of the French and Indian War force them out of exile, they agree to guide two sisters through hostile Indian country.', NULL, 506, 1, NULL, 100.00, NULL, '2021-03-05 23:32:05', '2021-03-05 23:32:05'),
(817, 'The Art of Rhetoric', 'The-Art-of-Rhetoric', 'http://books.google.com/books/content?id=lhkNLgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=lhkNLgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007920693', 'HarperCollins is proud to present its incredible range of best-loved, essential classics... Despite dating from the 4th century BC, The Art of Rhetoric continues to be regarded by many as the single most important work on the art of persuasion. As democracy began emerging in 5th-century Athens, public speaking and debate became an increasingly important tool to garner influence in the assemblies, councils, and law courts of ancient Greece. In response to this, both politicians and ordinary citizens became desperate to learn greater skills in this area, as well as the philosophy behind it. This treatise was one of the first to provide just that, establishing methods and observations of informal reasoning and style, and has continued to be hugely influential on public speaking and philosophy today. Aristotle, the grandfather of philosophy, student of Plato, and teacher of Alexander the Great, was one of the first people to create a comprehensive system of philosophy, encompassing logic, morality, aesthetics, politics, ethics, and science. Although written over 2,000 years ago, The Art of Rhetoric remains a comprehensive introduction for philosophy students into the subject of rhetoric, as well as a useful manual for anyone today looking to improve their oratory skills of persuasion.', NULL, 507, 1, NULL, 100.00, NULL, '2021-03-05 23:32:06', '2021-03-05 23:32:06'),
(818, 'The Age of Innocence', 'The-Age-of-Innocence', 'http://books.google.com/books/content?id=pXy4L4u7ZFYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pXy4L4u7ZFYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007368648', 'Tale of the manners and morals of New York society in the later 1800s. Newland Archer is a young attorney, handsome and eligible. Torn between his socially acceptable fiancee and the more earthy attractions of Countess Olenska, Archer is truly on the horns of a dilemma. The plot is unobvious, delicately developed, with a fine finale that exquisitely satisfies one\'s sense of fitness, and as always with Edith Wharton, the drama of character is greater than that of event.', NULL, 508, 1, NULL, 100.00, NULL, '2021-03-05 23:32:06', '2021-03-05 23:32:06'),
(819, 'Macbeth', 'Macbeth-9780007350988', 'http://books.google.com/books/content?id=do7Z3zrgtOEC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=do7Z3zrgtOEC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350988', 'Classic fiction. A book in the series, Collins Classics. A beautiful edition of your favourite classical stories.', NULL, 57, 1, NULL, 100.00, NULL, '2021-03-05 23:32:06', '2021-03-05 23:32:06'),
(820, 'Just So Stories', 'Just-So-Stories', 'http://books.google.com/books/content?id=fZ8KLgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fZ8KLgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007920730', 'HarperCollins is proud to present its incredible range of best-loved, essential classics. How did the leopard get its spots? Why do the tides ebb and flow? How did the elephant get its trunk? And how was the alphabet made? Rudyard Kipling\'s classic collection of fables answers the great questions of animal- and humankind in a fun, eloquent and magical way - for children and adults alike. Kipling\'s beautifully imaginative answers echo the animal fables he heard during his childhood in India, paired with the folk tales he collected throughout his life. Kipling\'s enjoyment in playing with language, as well as his own delight in fatherhood, makes these stories a joy to read aloud, and children will request these tales as bedtime stories again and again. However, adults will also revel in Kipling\'s fanciful storytelling and gift for language, as every reading uncovers a new joke, subtext or fascinating embellishment. From the author of \'The Jungle Book\' and \'Kim\', \'Just So Stories\' is the newest addition to the available canon of Kipling\'s work available in the handy format of Collins Classics!', NULL, 394, 1, NULL, 100.00, NULL, '2021-03-05 23:32:06', '2021-03-05 23:32:06'),
(821, 'Collins Classics - The Phantom of the Opera', 'Collins-Classics---The-Phantom-of-the-Opera', 'http://books.google.com/books/content?id=9gTFALeVH18C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9gTFALeVH18C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420278', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'Look! You want to see! See! Feast your eyes, glut your soul on my cursed ugliness! Look at Erik\'s face! Now you know the face of the voice!\' Living secretly beneath the Paris Opera House, \'The Phantom of the Opera\', Erik has haunted those who work there with his demands and shrouded the opera house in fear with the legend of his disfigured face. When Christine joins the company, a young woman with a beautiful voice, Erik is instantly smitten and secretly teaches her to become a great singer. He soon develops an obsessive love for his beautiful prot�g�, even though she has fallen for her childhood friend, resulting in her disappearance during a performance and sparking a tragic and terrifying chain of events. One of the most well-known and well-loved gothic horror stories, Leroux\'s suspenseful tale of unrequited love, passion and tragedy is both dark and moving in its portrayal of Erik, the anti-hero in his yearning for Christine.', NULL, 509, 1, NULL, 100.00, NULL, '2021-03-05 23:32:06', '2021-03-05 23:32:06'),
(822, 'Collins Classics - The Case-Book of Sherlock Holmes', 'Collins-Classics---The-Case-Book-of-Sherlock-Holmes', 'http://books.google.com/books/content?id=aMIQ8-BLa3UC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aMIQ8-BLa3UC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420247', 'Classic fiction. Readers will love reading their favourite classics in this new Collins Classics series.', NULL, 510, 1, NULL, 100.00, NULL, '2021-03-05 23:32:07', '2021-03-05 23:32:07'),
(823, 'Hard Times (艱難時代)', 'Hard-Times-(艱難時代)', 'http://books.google.com/books/content?id=aquPwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aquPwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007449941', '※ Google Play 圖書不支援多媒體播放 ※', NULL, 511, 1, NULL, 100.00, NULL, '2021-03-05 23:32:07', '2021-03-05 23:32:07'),
(824, 'Kidnapped', 'Kidnapped', 'http://books.google.com/books/content?id=4uD__kDp4ZkC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4uD__kDp4ZkC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420131', 'Kidnapped is Robert Louis Stevenson\'s classic adventure novel. David Balfour sets off to find his last remaining relatives, but is tricked into boarding a ship, and finds himself bound for slavery in Carolina.', NULL, 512, 1, NULL, 100.00, NULL, '2021-03-05 23:32:07', '2021-03-05 23:32:07'),
(825, 'The Picture of Dorian Gray', 'The-Picture-of-Dorian-Gray', 'http://books.google.com/books/content?id=lTk4oGbo6goC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=lTk4oGbo6goC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007351053', 'Entranced by the perfection of his recently painted portrait, the youthful Dorian Gray expresses a wish that the figure on the canvas could age and change in his place. When his wish comes true, the portrait becomes his hideous secret as he follows a downward trajectory of decadence and cruelty that leaves its traces only in the portrait\'s degraded image.', NULL, 513, 1, NULL, 100.00, NULL, '2021-03-05 23:32:07', '2021-03-05 23:32:07'),
(826, 'King Lear (李爾王)', 'King-Lear-(李爾王)', 'http://books.google.com/books/content?id=aLwquwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=aLwquwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007902330', 'King Lear is a tragedy by William Shakespeare, believed to have been written between 1603 and 1606, and is considered one of his greatest works. The play is based on the legend of King Leir of Britain. It has been widely adapted for stage and screen, with the part of Lear being played by many of the world\'s most accomplished actors.', NULL, 57, 1, NULL, 100.00, NULL, '2021-03-05 23:32:07', '2021-03-05 23:32:07'),
(827, 'The Three Musketeers', 'The-Three-Musketeers', 'http://books.google.com/books/content?id=kyaYuQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kyaYuQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007902156', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'I do not cling to life sufficiently to fear death.\' Adventurous and spirited in tone, The Three Musketeers is considered one of the greatest historical French novels. When Athos, Porthos and Aramis befriend a young and determined country boy d\'Artagnan, together they confront the scheming King\'s Minister, Cardinal Richelieu and the female spy Milady who threaten to undermine the King. Swashbuckling, romantic and often humourous, Dumas\' novel is a timeless tale of friendship and intrigue.', NULL, 514, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(828, 'Collins Classsics - Tales of Mystery and Imagination', 'Collins-Classsics---Tales-of-Mystery-and-Imagination', 'http://books.google.com/books/content?id=qUYRO6cfmzsC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=qUYRO6cfmzsC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420223', 'A scholarly edition of a work by Bernard Mandeville. The edition presents an authoritative text, together with an introduction, commentary notes, and scholarly apparatus.', NULL, 515, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(829, 'Tender is the Night', 'Tender-is-the-Night', 'http://books.google.com/books/content?id=nf3AzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nf3AzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007449484', 'From Collins Classics and the author of \'The Great Gatsby\' a marriage unravels in this autobiographical tale. \'Sometimes it is harder to deprive oneself of a pain than of a pleasure.\' Set on the French Riviera in the 1920s, American Dick Diver and his wife Nicole are the epitome of chic, living a glamorous lifestyle and entertaining friends at their villa. Young film star Rosemary Hoyt arrives in France and becomes entranced by the couple. It is not long before she is attracted to the enigmatic Dick, but he and his wife hold dark secrets and as their marriage becomes more fractured, Fitzgerald laments the failure of idealism and the carefully constructed trappings of high society in the Roaring Twenties.', NULL, 516, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(830, 'Oliver Twist', 'Oliver-Twist', 'http://books.google.com/books/content?id=Ku39E9ICAx4C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Ku39E9ICAx4C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350889', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'Oliver Twist has asked for more!\' Fleeing the workhouse, Oliver finds himself taken under the wing of the Artful Dodger and caught up with a group of pickpockets in London. As he tries to free himself from their clutches he becomes immersed in the seedy underbelly of the Capital, amongst criminals, prostitutes and the homeless. Dickens scathing attack on the cruelness of Victorian Society features some of his most memorable and enduring characters, including innocent Oliver himself, the Artful Dodger, Fagin, Bill Sikes and Nancy.', NULL, 511, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(831, 'Jane Eyre', 'Jane-Eyre', 'http://books.google.com/books/content?id=_vDrtlBYajEC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_vDrtlBYajEC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350803', 'In early nineteenth-century England, an orphaned young woman accepts employment as a governess at Thornfield Hall, a country estate owned by the mysteriously remote Mr. Rochester.', NULL, 517, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(832, 'Collins Classics - The Awakening', 'Collins-Classics---The-Awakening', 'http://books.google.com/books/content?id=eqC1POXVJRUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=eqC1POXVJRUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420056', 'A recognised classic of 19th century literature, The Awakening caused a scandal on first publication for its powerful portrayal of one woman\'s fight for independence from the stultifying norms of wifedom and motherhood.', NULL, 518, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(833, 'The Hound of the Baskervilles', 'The-Hound-of-the-Baskervilles', 'http://books.google.com/books/content?id=zHy493MRCTYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zHy493MRCTYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007368570', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'They all agreed that it was a huge creature, luminous, ghastly and spectral.\' Originally serialised in The Strand Magazine, Conan Doyle\'s The Hound of the Baskervilles follows the infamous Sherlock Holmes and Dr Watson as they investigate the mysterious death of Sir Charles Baskerville, whose dead body is found on the misty and desolate Devon moors. The locals blame his death on the legend of the fearsome phantom hound that they claim has haunted the Baskerville family for generations. When the heir to the Baskerville fortune, Sir Henry, also comes under threat Holmes\' detective skills are put to the test as he battles to discover the truth behind the legend and to solve one of the most macabre mysteries of his career.', NULL, 510, 1, NULL, 100.00, NULL, '2021-03-05 23:32:08', '2021-03-05 23:32:08'),
(834, 'A Room of One\'s Own', 'A-Room-of-One\'s-Own', 'http://books.google.com/books/content?id=OACtngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OACtngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007558063', 'This volume combines two books by Virginia Woolf which are among the greatest contributions to feminist literature this century. They consider the implications of the historical exclusion of women from education and from economic independence.', NULL, 519, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(835, 'Leaves of Grass', 'Leaves-of-Grass', 'http://books.google.com/books/content?id=r8YwjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=r8YwjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008110604', 'HarperCollins is proud to present its incredible range of best-loved, essential classics. I believe a leaf of grass is no less than the journey work of the stars First published in 1855, and edited, revised and expanded over thirty years, Leaves of Grass has become one of the most celebrated poetry collections in the history of American literature. A master of free verse, Walt Whitman captures the true spirit of his homeland and its people through his poetry. He explores a wide range of themes, encompassing American identity and cultural values, democracy, nature and the mysteries of the human spirit. Featuring the poems of the original 1855 edition, Leaves of Grass remains an influential work within the American literary tradition, studied and treasured around the world.\"', NULL, 520, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(836, 'Great Expectations', 'Great-Expectations', 'http://books.google.com/books/content?id=tfB0rPHSGWEC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tfB0rPHSGWEC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350872', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'Take nothing on its looks; take everything on evidence. There\'s no better rule.\' Living with his sister and her husband, Pip is an orphan without any expectations. It is only when he begins to visit a rich old woman, Miss Havisham and her adopted niece that he begins to hope for something better. When it is revealed that Pip has inherited a large sum of money from a mysterious benefactor on the condition that he moves to London to become a gentleman, Pip\'s adventure really begins. Epic, illuminating and memorable, Dickens mysterious tale of Pip\'s quest to find the truth about himself is one of his most enduring and popular novels to date.', NULL, 511, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(837, 'Emma', 'Emma', 'http://books.google.com/books/content?id=1fEhH_qIzPUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=1fEhH_qIzPUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007350780', 'HarperCollins is proud to present its range of best-loved, essential classics. \'The real evils, indeed, of Emma\'s situation were the power of having rather too much her own way, and a disposition to think a little too well of herself...\' Beautiful, rich, self-assured and witty, Emma Woodhouse delights in matchmaking those around her, with no apparent care for her own romantic life. Taking young Harriet Smith under her wing, Emma sets her sights on finding a suitable match for her friend. Chided for her mistakes by old friend Mr Knightley, it is only when Harriet starts to pursue her own love interests that Emma realises the true hidden depths of her own heart. Delightful, engaging and entertaining, and with a dazzling gallery of characters, Emma is arguably Austen\'s most well-loved social comedy.', NULL, 521, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(838, 'The Call of the Wild', 'The-Call-of-the-Wild', 'http://books.google.com/books/content?id=f9j7jRaXIrIC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=f9j7jRaXIrIC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420230', 'The Call of the Wild is a novel by Jack London published in 1903. The story is set in the Yukon during the 1890s Klondike Gold Rush—a period when strong sled dogs were in high demand. The novel\'s central character is a dog named Buck, a domesticated dog living at a ranch in the Santa Clara valley of California as the story opens. Stolen from his home and sold into the brutal existence of an Alaskan sled dog, he reverts to atavistic traits. Buck is forced to adjust to, and survive, cruel treatments and fight to dominate other dogs in a harsh climate. Eventually he sheds the veneer of civilization, relying on primordial instincts and lessons he learns, to emerge as a leader in the wild', NULL, 522, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(839, 'Mrs Dalloway', 'Mrs-Dalloway', 'http://books.google.com/books/content?id=kdMunAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kdMunAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007934409', 'This novel explores the hidden springs of thought and action in one day of a woman\'s life. Virginia Woolf is direct and vivid in her account of the details of Clarissa Dalloway\'s preparation for a party. The novel was first published in 1925 by the same Hogarth Press that Woolf and her husband founded.', NULL, 523, 1, NULL, 100.00, NULL, '2021-03-05 23:32:09', '2021-03-05 23:32:09'),
(840, 'Silas Marner', 'Silas-Marner', 'http://books.google.com/books/content?id=4RiWTMvYvSoC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=4RiWTMvYvSoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420148', 'HarperCollins is proud to present its new range of best-loved, essential classics. \'Our consciousness rarely registers the beginning of a growth within us any more than without us: there have been many circulations of the sap before we detect the smallest sign of the bud.\' Set in the agricultural town of Raveloe in the English countryside, Silas Marner is a tragic figure. Exiled from a religious community because of a wrongful accusation of theft, he works from day to day as a weaver, saving his money and living a lonely life as a recluse. It is only when his money is stolen and a small orphan girl, Eppie appears in his life that Silas\'s fortunes begin to change and he truly begins to learn what it means to regain his faith in life.', NULL, 524, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(841, 'Far from the Madding Crowd', 'Far-from-the-Madding-Crowd', 'http://books.google.com/books/content?id=5HY0JHuw_l8C&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5HY0JHuw_l8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007395163', 'HarperCollins is proud to present its new range of best-loved, essential classics. Here is one of Thomas Hardy\'s most popular novels, soon to be released as a major motion picture in May 2015. \'I shall do one thing in this life - one thing certain - that is, love you, and long for you, and keep wanting you till I die\' Independent and spirited, Bathsheba Everdene owns the hearts of three men. Striving to win her love in different ways, their relationships with Bathsheba complicate her life in bucolic Wessex - and cast shadows over their own. With the morals and expectations of rural society weighing heavily upon her, Bathsheba experiences the torture of unrequited love and betrayal, and discovers how random acts of chance and tragedy can dramatically alter life\'s course. The first of Hardy\'s novels to become a major literary success, Far from the Madding Crowd explores what it means to live and to love.', NULL, 525, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(842, 'Collins Classics - The Odyssey', 'Collins-Classics---The-Odyssey', 'http://books.google.com/books/content?id=cInNp63AxNYC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cInNp63AxNYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007420094', 'Literature\'s grandest evocation of life\'s journey, at once an ageless human story and an individual test of moral endurance, Homer\'s ancient Greek epic The Odyssey is translated by Robert Fagles with an introduction and notes by Bernard Knox in Penguin Classics. When Robert Fagles\' translation of The Iliad was published in 1990, critics and scholars alike hailed it as a masterpiece. Here, one of the great modern translators presents us with The Odyssey, Homer\'s best-loved poem, recounting Odysseus\' wanderings after the Trojan War. With wit and wile, the \'man of twists and turns\' meets the challenges of the sea-god Poseidon, and monsters ranging from the many-headed Scylla to the cannibalistic Cyclops Polyphemus - only to return after twenty years to a home besieged by his wife Penelope\'s suitors. In the myths and legends retold in this immortal poem, Fagles has captured the energy of Homer\'s original in a bold, contemporary idiom. Seven greek cities claim the honour of being the birthplace of Homer (c. 8th-7th century BC), the poet to whom the composition of the Iliad and Odyssey are attributed. The Iliad is the oldest surviving work of Western literature, but the identity - or even the existence - of Homer himself is a complete mystery, with no reliable biographical information having survived. If you enjoyed The Odyssey, you might like Robert Fagles\' translation of The Iliad, also available in Penguin Classics. \'Wonderfully readable ... Just the right blend of roughness and sophistication\' Ted Hughes \'A memorable achievement ... Mr Fagles has been remarkably successful in finding a style that is of our time and yet timeless\' Richard Jenkyns, The New York Times Book Review \'His translation of The Odyssey is his best work yet\' Garry Wills, New Yorker', NULL, 526, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(843, 'Think Big', 'Think-Big', 'http://books.google.com/books/content?id=Pa5ySAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Pa5ySAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780062022394', 'Donald J. Trump is an icon: the very definition of the American success story. The star of The Apprentice and developer of some of the planet\'s most prestigious real estate, he\'s been on the bottom and risen to become one of the world\'s wealthiest men. Bill Zanker started The Learning Annex with $5,000 and grew it into a $5 million a year company. That was before he met Donald Trump. Thirty months later, after Zanker learned to think BIG himself, The Learning Annex is generating over $100 million a year in sales—and still growing. Together, they\'re living examples of how thinking BIG and knowing when to back up your opinions aggressively—regardless of what your critics or opponents might say—can help you maximize your personal and professional achievements. For the first time ever, you too can learn Trump\'s secrets to thinking BIG! Learn: Momentum: the Big Mo. How to get it and how to get it back. Revenge: how and when to get it (and why it\'s so sweet). \"I love you, now sign this!\" Why contracts in business and personal life are so important. Real-life stories from people who\'ve applied the think BIG formula in their own lives.', NULL, 527, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(844, 'Redemption: an Amos Decker Novel 5', 'Redemption:-an-Amos-Decker-Novel-5', 'http://books.google.com/books/content?id=U6OnwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=U6OnwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509874415', 'Redemption is the fifth memory man thriller in David Baldacci\'s Sunday Times bestselling series.FBI consultant Amos Decker returns to the scene of a family tragedy in a grim act of commemoration, and is confronted by more than just painful memories:A felon on a mission.When Decker returns to Burlington, Ohio, he is tracked down by his first homicide arrest, Meryl Hawkins, a man who still maintains his innocence.A rookie\'s mistake.With Hawkins recently released from his life sentence, Decker finds himself questioning what had once seemed watertight evidence. Is the real killer still out there?A murderer at large.As the body count rises in a new crime spree, Decker and his former partner Mary Lancaster dig deeper and reopen the old case - and old wounds.Back in his home town and plagued by the ghosts of his past, Amos Decker is compelled to discover the confronting truth in the latest memory man thriller of David Baldacci\'s number one bestselling series.', NULL, 77, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(845, 'The Danger Game', 'The-Danger-Game', 'http://books.google.com/books/content?id=TFQ9nwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TFQ9nwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781447238973', 'Thirteen-year-old Travis is still trying to get his life back on track following the death of his parents. But he can\'t shake the feeling that the crash that killed them wasn\'t an accident. He\'s trying to stop obsessing about it by solving a petty-thieving spree at school, but the distraction isn\'t enough. Especially when he begins to suspect that there\'s a traitor at the heart of the private detective business his parents ran -- and that that traitor sold his parents out. The question is why? Once Travis starts thinking like this, he quickly starts to feel that he can\'t trust anybody, not even his closest allies.', NULL, 87, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(846, 'The Hunted', 'The-Hunted', 'http://books.google.com/books/content?id=6sjUtwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6sjUtwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008317843', '\"Having spent her life watching her father run his East London firm, Zara Ezra has learnt a thing or two about being a gangster, and she\'s ready to take over when the time comes. Mike Regan, a blast from Zara\'s past, is the head of his own firm, but when his son is kidnapped in the middle of a gangland feud, Mike has no choice but to accept help from the Ezras to get his little boy back alive. With a rival firm playing increasingly dirty, murder moves to the top of the agenda and Zara has some big choices to make. It seems that the only way to come out on top is to play them at their own game. But will she become The Hunter or The Hunted?\"--Provided by publisher.', NULL, 528, 1, NULL, 100.00, NULL, '2021-03-05 23:32:10', '2021-03-05 23:32:10'),
(847, 'Going Solo', 'Going-Solo', 'http://books.google.com/books/content?id=AgVHAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=AgVHAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141372181', 'Penny\'s life is back to normal. As Penny starts the school year she\'s ready to face the world alone. Noah has gone off the radar after ending his world tour early, and no one, including Penny, knows where he is. So when she accepts Megan\'s invitation to visit her performing arts school, it seems like an opportunity to make some new friends. Helping everyone else seems to be the right remedy - Elliot needs her friendship more than ever, and she meets Posey, who she can really help with her stage fright. But is charming Scottish boy Callum the right kind of distraction? And can Penny truly move on when Noah\'s shadow seems to haunt her around every corner?', NULL, 529, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(848, 'The Way Past Winter', 'The-Way-Past-Winter', 'http://books.google.com/books/content?id=bzkwswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bzkwswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781911077930', 'From the bestselling author of THE GIRL OF INK & STARS comes a gorgeous wintry folk tale for young and old alike - perfect for Christmas. \'This gorgeous story of bravery, sisterhood, goodbyes and beginnings is a must for everyone.\'JESSIE BURTON \'The Way Past Winter is a masterclass in exquisite storytelling.\'CATHERINE DOYLE \'Gorgeous, heartfelt and incredibly exciting. Her best yet, and that\'s saying something.\'ROBIN STEVENS Mila and her sisters live with their brother Oskar in a small forest cabin in the snow. One night, a fur-clad stranger arrives seeking shelter for himself and his men. But by the next morning, they\'ve gone - taking Oskar with them. Fearful for his safety, Mila and her sisters set out to bring Oskar back - even it means going north, crossing frozen wild-lands to find a way past an eternal winter.', NULL, 215, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(849, 'The Invitation', 'The-Invitation', 'http://books.google.com/books/content?id=nx4ejgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nx4ejgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007575398', '', NULL, 35, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(850, 'Dancing Over the Hill', 'Dancing-Over-the-Hill', 'http://books.google.com/books/content?id=ZSPhswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ZSPhswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008202095', 'The hilarious and poignant new novel from the best selling author of The Kicking the Bucket List. When a boxset of Broadchurch is more appealing than having sex with your husband, then perhaps it\'s time to hide the remote... Cait and Matt have been married for 30 years. They are rock solid. An inspiration to others. Stuck together like glue. But Cait can\'t shake off the feeling that something is missing. The whole world should be their oyster now that Matt has retired, so why does she feel shut up like a clam? Things get more complicated when Tom Lewis, the man who broke her heart at university, makes a reappearance - still as charming as ever. Her friends, widow Lorna and newly-single Debs, have their own views of what Cait should do - but she isn\'t in the mood to listen. When Tom makes Cait an unexpected offer, Cait feels the pull of a different life. Has she got the guts to take the plunge, or does it take more courage to give her marriage another chance? Funny and thoughtful, this is a book for anyone who ever wondered . . . what if?', NULL, 530, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(851, 'Anything for Her', 'Anything-for-Her', 'http://books.google.com/books/content?id=s1TatAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=s1TatAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785763885', '\"When Billy Orr returns home to spend time with his dying sister, he bumps into his ex-girlfriend Aimi, the love of his life. He might not have seen her in eleven years, but Billy\'s never forgotten her. He\'d do anything for her then, and he\'d do anything for her now. When Aimi tells him that she wants to escape her abusive husband, Billy agrees to help her fake her own death. But is she still the Aimi that Billy remembers from all those years ago? Once Aimi disappears, Billy has to face the possibility that perhaps she had different reasons for disappearing - reasons that might be more dangerous than she\'s led him to believe . . . Sometimes trusting the one you love is the wrong thing to do.\"--Provided by publisher.', NULL, 531, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(852, 'The Dressmaker\'s Gift', 'The-Dressmaker\'s-Gift', 'http://books.google.com/books/content?id=AZLRwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=AZLRwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781542005135', '', NULL, 532, 1, NULL, 100.00, NULL, '2021-03-05 23:32:11', '2021-03-05 23:32:11'),
(853, 'Team Management', 'Team-Management', 'http://books.google.com/books/content?id=c7h1IC2sFoUC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=c7h1IC2sFoUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007341122', 'Get results fast with this quick, easy guide to the fundamentals of Team ManagementIncludes how to:,*Understand how different personalities interact in a team,*Set up clear structures and goals for your team,*Implement change effectively and as painlessly as possible,*Overcome personality clashes and team difficulties,*Manage your team so that it delivers fantastic results', NULL, 533, 1, NULL, 100.00, NULL, '2021-03-05 23:32:12', '2021-03-05 23:32:12'),
(854, 'Of Mice and Men', 'Of-Mice-and-Men', 'http://books.google.com/books/content?id=-U6APwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-U6APwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141023571', 'Streetwise George and his big, childlike friend Lennie are drifters, searching for work in the fields and valleys of California. They have nothing except the clothes on their back, and a hope that one day they ll find a place of their own and live the American dream. But dreams come at a price. Gentle giant Lennie doesn t know his own strength, and when they find work at a ranch he gets into trouble with the boss s daughter-in-law. Trouble so bad that even his protector George may not be able to save him . . .', NULL, 534, 1, NULL, 100.00, NULL, '2021-03-05 23:32:12', '2021-03-05 23:32:12'),
(855, 'The Sisters', 'The-Sisters', 'http://books.google.com/books/content?id=PrwGoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PrwGoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007594412', 'One had a secret. One lost her mind. One died. After the tragic death of her twin sister and a subsequent breakdown, Abi has moved to Bath to make a fresh start. But wherever she goes, she\'s haunted by the memory of Lucy, and can\'t stop herself from searching fruitlessly for her sister\'s face in crowds. One day she meets Bea -- a girl with an uncanny resemblance to Lucy and Bea\'s twin brother, Ben, with whom she feels an irresistible attraction. Before long, Bea has invited Abi to live in their townhouse, which places Abi\'s budding relationship with Ben under strain. But Bea has a secret to hide that she\'ll do anything to protect, and as Abi falls deeper in love with Ben, things in the house take a turn for the worse. Slowly, Abi begins to unravel, and must question everything she thought she knew about her new friends -- and about herself.', NULL, 535, 1, NULL, 100.00, NULL, '2021-03-05 23:32:12', '2021-03-05 23:32:12'),
(856, 'The Warning', 'The-Warning', 'http://books.google.com/books/content?id=QbLBvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QbLBvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751576122', 'My little boy\'s room was empty, his bed neatly made. Alarm bells should have rung immediately. Then the knock on the door came. All I remember is a thick fog wrapping itself tightly around me. This couldn\'t be happening to us . . . Three years ago, nurse Zoe\'s son Ethan was found drowned in a muddy river by their home, along with his best friend Josh. With no witnesses, their deaths were ruled a tragic accident. Heartbroken, Zoe and her family move away from her home. They\'re just beginning to get back to some kind of normality, when, out of the blue, Zoe receives an anonymous email: You need to find out the truth about what happened to your son. Don\'t let this rest. Don\'t believe the lie. Shaken, Zoe starts an obsessive hunt for the truth. But why is her husband so reluctant to help? And why is Josh\'s mother so determined not to believe her? An absolutely unputdownable psychological thriller about a mother\'s desperate search for the truth. Fans of Jane Corry, Jenny Blackhurst and Rachel Abbott will be hooked from the very first page.', NULL, 536, 1, NULL, 100.00, NULL, '2021-03-05 23:32:12', '2021-03-05 23:32:12'),
(857, 'Persuasion', 'Persuasion', 'http://books.google.com/books/content?id=0PXDswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0PXDswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407184470', '\"I hate to hear you talk about all women as if they were fine ladies instead of rational creatures. None of us want to be in calm waters all our lives.\" The wealthy Elliots have lived a privileged existence, but when Anne\'s father throws the family into debt with his lavish lifestyle, they have no choice but to leave their much-loved estate and move to Bath. Intelligent and warm, Anne navigates the intricacies of love, friendship and society, all while adjusting to her new social standing. And when her path once again crosses with Captain Wentworth - with whom she had once been engaged but then pressured to leave - it seems that Anne\'s fortunates may well be changing for the better. With Jane Austen\'s razor-sharp observations and dry humour, PERSUASION is a story of family, wealth, marriage and, most importantly, life.', NULL, 521, 1, NULL, 100.00, NULL, '2021-03-05 23:32:12', '2021-03-05 23:32:12'),
(858, 'Emma', 'Emma-9781407172668', 'http://books.google.com/books/content?id=dyWEvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=dyWEvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407172668', 'Often described as Austen\'s finest work, Emma is the story of wealthy, beautiful Emma Woodhouse who, bored, matchmakes her friends - with often disastrous results. And gradually Emma starts to realise that she might not know her own heart at all...', NULL, 521, 1, NULL, 100.00, NULL, '2021-03-05 23:32:13', '2021-03-05 23:32:13'),
(859, 'Wuthering Heights', 'Wuthering-Heights', 'http://books.google.com/books/content?id=2AFTngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2AFTngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407144078', 'The heartbreaking story of the tumultuous and passionate relationship between gypsy foundling Heathcliff and the wealthy Catherine Earnshaw. Despite her love for Heathcliff, Catherine marries the well-bred Edgar Linton. This betrayal has unforeseen ramifications for generations to come.', NULL, 537, 1, NULL, 100.00, NULL, '2021-03-05 23:32:13', '2021-03-05 23:32:13'),
(860, 'Cuckoo Song', 'Cuckoo-Song', 'http://books.google.com/books/content?id=rs8_swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=rs8_swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509868155', '\'Everyone should read Frances Hardinge. Everyone. Right now\' Patrick NessCuckoo Song by Frances Hardinge, the Costa Award-winning author of The Lie Tree, is a fantastically eerie and beautifully written novel, and was shortlisted for the prestigious Carnegie Medal.The first things to shift were the doll\'s eyes, the beautiful grey-green glass eyes. Slowly they swivelled, until their gaze was resting on Triss\'s face. Then the tiny mouth moved, opened to speak. \'What are you doing here?\' It was uttered in tones of outrage and surprise, and in a voice as cold and musical as the clinking of cups. \'Who do you think you are? This is my family.\' When Triss wakes up after an accident, she knows that something is very wrong. She is insatiably hungry; her sister seems scared of her and her parents whisper behind closed doors. She looks through her diary to try to remember, but the pages have been ripped out.Soon Triss discovers that what happened to her is more strange and terrible than she could ever have imagined, and that she is quite literally not herself. In a quest to find the truth she must travel into the terrifying Underbelly of the city to meet a twisted architect who has dark designs on her family - before it\'s too late . . .', NULL, 538, 1, NULL, 100.00, NULL, '2021-03-05 23:32:13', '2021-03-05 23:32:13'),
(861, 'City of Fallen Angels', 'City-of-Fallen-Angels', '', '', '9781406354874', 'Discover more secrets about the Shadowhunters as they fight to protect the world from demons in the fourth book in the internationally bestselling series. To love is to destroy ...The Mortal War is over, and Clary Fray is home in New York, excited about all the possibilities before her. She\'s training to become a Shadowhunter and - most importantly of all - she can finally call Jace her boyfriend. But her happiness has come at a price...', NULL, 64, 1, NULL, 100.00, NULL, '2021-03-05 23:32:13', '2021-03-05 23:32:13'),
(862, 'The Creativity Challenge', 'The-Creativity-Challenge', 'http://books.google.com/books/content?id=TepwuQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=TepwuQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781440588334', 'As seen on Inc.com Discover your \"Aha\" moment--right now! What\'s the best way to become more creative? Just change how you think! This book challenges you to go against your default ways of thinking in order to write, design, and build something extraordinary. Featuring more than 100 challenges, exercises, and prompts, each page guides you as you push past the way you normally see the world and uncover all-new possibilities and ideas. The Creativity Challenge teaches you that you already have immense creative potential in you--you just need to tap into it. Whether you\'re feeling stumped or uninspired, these creativity prompts will help you ditch typical thinking patterns and finally unleash the possibilities hidden within your mind.', NULL, 539, 1, NULL, 100.00, NULL, '2021-03-05 23:32:13', '2021-03-05 23:32:13'),
(863, 'Ghost Town', 'Ghost-Town', 'http://books.google.com/books/content?id=NYipbwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NYipbwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780749008048', '\"When Claire is ordered to repair the systems that protect Morganville, it\'s not just cutting into her study time, it\'s a life-threatening problem. If there\'s one thing this vampire-infested town is serious about, it\'s security. But achieving the impossible only brings a whole new set of problems, and the upgrades have unexpected consequences: people inside the town are slowly beginning to forget who they are, even the vampires. Soon, the town\'s little memory problem has turned into a full-on epidemic. Now Claire needs to figure out a way to pull the plug on her experiment - before she forgets how to save Morganville...\"-- BOOK JACKET.', NULL, 252, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(864, 'The Testaments', 'The-Testaments', 'http://books.google.com/books/content?id=xjaAyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xjaAyQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784708214', 'THE NO.1 BESTSELLER \'Gripping\' Guardian \'Powerful\' The Times The Republic of Gilead maintains its repressive grip on power but it is beginning to rot from within. At this crucial moment, the lives of three radically different women come together, with potentially explosive results... \'The Testaments is Atwood at her best . . . To read this book is to feel the world turning\' Anne Enright \'Everything The Handmaid\'s Tale fans wanted and more. Prepare to hold your breath throughout, and to cry real tears at the end\' Stylist \'Atwood challenges us constantly and poses the question that lies like a pearl inside the shell of this frighteningly readable novel, \"Before you sit in judgement, how would you behave in Gilead?\'\'\'Sunday Telegraph', NULL, 189, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(865, 'The Liar', 'The-Liar-9781409194514', 'http://books.google.com/books/content?id=e1mCxAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=e1mCxAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409194514', '\'Plotting that takes the breath away.\' Ian Rankin WHO IS DEADLIER ... Leonard Howell\'s worst nightmare has come true: his daughter Caroline has been kidnapped. Not content with relying on the cops, Howell calls the only man he trusts to get her back. ... THE MAN WHO KNOWS THE TRUTH ... Eddie Flynn knows what it\'s like to lose a daughter and vows to bring Caroline home safe. Once a con artist, now a hotshot criminal attorney, Flynn is no stranger to the shady New York underworld. ... OR THE ONE WHO BELIEVES A LIE? However, as he steps back into his old life, Flynn realizes that the rules of game have changed - and that he is being played. But who is pulling the strings? And is anyone in this twisted case telling the truth...? A missing girl, a desperate father and a case that threatens to destroy everyone involved - Eddie Flynn\'s got his work cut out in the thrilling new novel from the author of The Defence.', NULL, 84, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(866, 'Mars and Venus in the Bedroom', 'Mars-and-Venus-in-the-Bedroom', 'http://books.google.com/books/content?id=UPLjwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=UPLjwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780091887667', 'The author of the phenomenal No. 1 \"New York Times\" bestselling \"Men Are from Mars, Women Are from Venus\" reveals the secrets of how to keep the fires of passion burning and achieve greater intimacy in long-term, monogamous relationships.', NULL, 235, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(867, 'Origins', 'Origins', 'http://books.google.com/books/content?id=9DBrxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9DBrxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784705435', 'Read the Sunday Times bestseller that reveals the Earth\'s awesome impact on the shape of human civilisations. \'Stands comparison with Sapiens... Thrilling\' Sunday Times Human evolution in East Africa was driven by geological forces. Ancient Greece developed democracy because of its mountainous terrain. Voting behaviour in the United States today follows the bed of an ancient sea. Professor Lewis Dartnell takes us on an astonishing journey into our planet\'s past to tell the ultimate origin story. Blending science and history, Origins reveals the Earth\'s awesome impact on the shape of human civilisations - and helps us to see the challenges and opportunities of the future. \'A sweeping, brilliant overview of the history not only of our species but of the world\' Peter Frankopan, author of The Silk Roads \'Absorbing... A first-class read - and an important one\' Observer', NULL, 540, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(868, 'Children of Virtue and Vengeance', 'Children-of-Virtue-and-Vengeance', 'http://books.google.com/books/content?id=ua_5tgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ua_5tgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509899456', 'Children of Virtue and Vengeance is the breathtaking sequel to Tomi Adeyemi\'s ground-breaking West African-inspired fantasy Children of Blood and Bone. After battling the impossible, Zélie and Amari have finally succeeded in bringing magic back to the land of Orïsha. But the ritual was more powerful than they could\'ve imagined, reigniting the powers of not only the maji, but of nobles with magic ancestry, too. Now, Zélie struggles to unite the maji in an Orïsha where the enemy is just as powerful as they are. But with civil war looming on the horizon, Zélie finds herself at a breaking point: she must discover a way to bring the kingdom together or watch as Orïsha tears itself apart.', NULL, 541, 1, NULL, 100.00, NULL, '2021-03-05 23:32:14', '2021-03-05 23:32:14'),
(869, 'Somewhere Close to Happy', 'Somewhere-Close-to-Happy', 'http://books.google.com/books/content?id=hRaWygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hRaWygEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409184164', '\'A wonderfully written, funny and moving debut with an intriguing mystery at its heart... Unforgettable.\' - Claire Douglas, bestselling author Lizzie James is happy. She has a steady office job (with a steady stream of snacks), has had the same best friend since school, and she sees her family every Thursday night for take-away and trashy TV. Lizzie likes her uncomplicated life. Then a letter arrives one day from her first love, Roman. A letter dated the day he disappeared, 12 years before. As Lizzie uncovers the secrets of the letter, she discovers what really happened the year her life fell apart - and all avenues lead back to Roman. Lizzie James thought she was happy, or somewhere close to happy, at least. Now she\'s not so sure. \'I LOVED Somewhere Close to Happy. It made me cry several times but was also really funny. It is incredibly good and I am sure it will be huge.\' - Laura Marshall, bestselling author of Friend Request *Perfect for fans of Giovanna Fletcher, Mhairi McFarlane and Cecelia Ahern and Kate Eberlen\'s Miss You. This is a novel you won\'t soon forget.*', NULL, 542, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(870, 'Broken Throne', 'Broken-Throne-9781409176039', 'http://books.google.com/books/content?id=G48-zQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=G48-zQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409176039', 'The perfect addition to the Red Queen series, Broken Throne features three brand-new novellas, alongside two previously published novellas, Steel Scars and Queen Song - as well as never-before-seen maps, flags, bonus scenes, journal entries, and much more exclusive content. Fans will be delighted to catch up with beloved characters after the drama of War Storm and be excited to hear from brand-new voices as well.', NULL, 119, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(871, 'The Good Fight', 'The-Good-Fight', 'http://books.google.com/books/content?id=moSXvwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=moSXvwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509800629', 'Against the electrifying backdrop of the 1960s, Danielle Steel unveils a gripping chronicle of a young woman discovering a passion for justice. The daughter and granddaughter of prominent Manhattan lawyers, Meredith McKenzie is destined for the best of everything: top schools, elite social circles, the perfect marriage. Spending her childhood in Germany as her father prosecutes war criminals at the Nuremberg trials, Meredith soaks up the conflict between good and evil. When her family returns to the United States, encouraged by her liberal grandfather, Meredith is determined to become a lawyer, despite her father\'s objections. As her grandfather rises to the Supreme Court, Meredith enlists in the most pressing causes of her time, joining a new generation of women, breaking boundaries socially, politically, and professionally. But when the violence of the era strikes too close to home, her once tightly knit family must survive a devastating loss and rethink their own values and traditions.', NULL, 62, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(872, 'After the End', 'After-the-End', 'http://books.google.com/books/content?id=fdyhxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fdyhxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751564914', 'Have you read the book that everyone\'s talking about? \'If I could give this book 10 stars I would\' (Reader review) \'This book touched my soul\' (Reader review) \'I could not put it down. What a story. What a storyteller\' (Reader review) \'This is in my top five books of all time. Absolutely incredible\' (Reader review) \'I have never felt so emotionally wrapped up in characters in a book\' (Reader review) Powerful, uplifting and full of hope, AFTER THE END is the most moving book you\'ll read this year - from number one bestseller Clare Mackintosh __________________________ Max and Pip are the strongest couple you know. Only now they\'re facing the most important decision of their lives - and they don\'t agree. With the consequences of an impossible choice threatening to devastate them both, nothing will ever be the same again. But anything can happen after the end . . . *********** \'The most moving book you\'ll read this year\' LISA JEWELL \'Life-affirming . . . richly drawn\' SUNDAY TIMES \'Compelling and clever, tender and true. I can\'t stop thinking about it\' LIANE MORIARTY \'Heart-wrenching . . . an absolute must-read\' MIKE GAYLE \'Put this on the top of your list. You won\'t regret it\' JANE CORRY \'One of the most moving stories I have ever read. It\'s perfect\' JOANNA CANNON', NULL, 53, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(873, 'The Outsider', 'The-Outsider', 'http://books.google.com/books/content?id=SYWGvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=SYWGvQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473676398', 'Soon to be an HBO limited series starring Ben Mendelsohn. \'If you read only one thriller this summer, make it this one\' Daily Mail A horrifying crime. Water-tight evidence points to a single suspect. Except he was seventy miles away, with an iron-clad alibi. Detective Anderson sets out to investigate the impossible: how can the suspect have been both at the scene of the crime and in another town?', NULL, 543, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(874, 'Me', 'Me', 'http://books.google.com/books/content?id=gGFgwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=gGFgwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509853311', 'Elton John is the most enduringly successful singer-songwriter of all time. His life is extraordinary, his seven decees (so far) packed with incredible highs and lows. Nowi in his own words and with his usual honesty, he shares his story — every hilarious, heartbreaking moment. He reveals the truth about his childhood growing up in the London suburb of Pinner, and his difficult relationship with his parents. Christened Reginald Dwight, he was a shy boy with unlikely dreams of pop stardom. By the age of twenty-three, he was performing his first gig in America, facing an astonished audience in his Bright yellow dungarees, a star-spangled T-shirt and boots with wings. Elton John had arrived and the music world would never be the same again. Me is full of drama, from the early rejection of Elton\'s work with songwriting partner Bernie Taupin to spinning out of control as a chart-topping superstar ; from friendships with John Lennon, Freddie Mercury and George Michael to disco dancing with the Queen ; from suicide attempts to a secret drug addiction that would grip him for over a decade. Elton also writes powerfully about getting clean and setting up his AIDS Foundation. He describes finding true love with David Furnish, holidaying with Versace and singing at Princess Diana\'s funeral. And he pinpoints the moment he realizes that he wants to be a father and his Iife changes once again. Joyously funny, entertaining and at times deeply moving, Me will take you on an intimate journey with a living legend.', NULL, 544, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(875, 'Unthinkable', 'Unthinkable', 'http://books.google.com/books/content?id=DSIrvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DSIrvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473611740', '\'Wonderfully clear, fluent and eye-opening\' THE TIMES \'A stirring scientific journey, a celebration of human diversity and a call to rethink the \"unthinkable\"\' NATURE \'An utterly fascinating romp around the nether regions of the human mind\' BIG ISSUE IMAGINE . . . getting lost in a one-room flat; seeing auras; never forgetting a moment; a permanent orchestra in your head; turning into a tiger; life as an out-of-body experience; feeling other people\'s pain; being convinced you are dead; becoming a different person overnight. Our brains are far stranger than we think. We take it for granted that we can remember, feel emotion, navigate, empathise and understand the world around us, but how would our lives change if these abilities were dramatically enhanced - or disappeared overnight? Award-winning science writer Helen Thomson has spent years travelling the world tracking down incredibly rare brain disorders. In Unthinkable she tells the stories of nine extraordinary people. From the man who thinks he\'s a tiger to the doctor who feels the pain of others just by looking at them, their experiences illustrate how the brain can shape our lives in unexpected and, in some cases, brilliant and alarming ways. Delving into the rich histories of these conditions, exploring the very latest research and cutting-edge medical techniques, Thomson explains the workings of our consciousness, our emotions, our creativity and even the mechanisms that allow us to understand our own existence. Story by remarkable story, Unthinkable takes us on an unforgettable journey through the human brain. Discover how to forge memories that never disappear, how to grow an alien limb and how to make better decisions. Learn how to hallucinate and how to make yourself happier in a split second. Find out how to avoid getting lost, how to see more of your reality, even how exactly you can confirm you are alive. Think the unthinkable.', NULL, 545, 1, NULL, 100.00, NULL, '2021-03-05 23:32:15', '2021-03-05 23:32:15'),
(876, 'The Vanishing Box', 'The-Vanishing-Box', 'http://books.google.com/books/content?id=yPF9vgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yPF9vgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784297008', 'What do a murdered Brighton flower seller, the death of Cleopatra and a nude tableau show have in common? Read the most dangerous case yet for Stephens and Mephisto and find out. The fourth Stephens and Mephisto mystery from the author of the bestselling Dr Ruth Galloway series - a must-read for fans of Bryant and May. \'Mixes cosiness and sharpness in a way that recalls the best of Agatha Christie\' Sunday Express (on Smoke and Mirrors) Christmas 1953. Max Mephisto and his daughter Ruby are headlining Brighton Hippodrome, an achievement only slightly marred by the less-than-savoury support act: a tableau show of naked \'living statues\'. This might appear to have nothing in common with DI Edgar Stephens\' investigation into the death of a quiet flowerseller, but if there\'s one thing the old comrades have learned it\'s that, in Brighton, the line between art and life - and death - is all too easily blurred...', NULL, 92, 1, NULL, 100.00, NULL, '2021-03-05 23:32:16', '2021-03-05 23:32:16'),
(877, 'What Happened', 'What-Happened', 'http://books.google.com/books/content?id=Fo3mAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Fo3mAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471166945', 'The Sunday Times Number One Bestseller \'A compelling read\' - Financial Times \'A sporadically absorbing, pleasingly vengeful and often darkly funny account of one woman\'s bid for presidential history.\' Sunday Times \'Her new book is more gossipy, it is meaner, more entertaining and more wrong-headed than anything she or her speechwriters have written before.\' Observer \'What Happened is highly entertaining. It is spirited, well-written and informative.\' Guardian \'In the past, for reasons I try to explain, I\'ve often felt I had to be careful in public, like I was up on a wire without a net. Now I\'m letting my guard down.\' - Hillary Rodham Clinton, from the introduction of What Happened For the first time, Hillary Rodham Clinton reveals what she was thinking and feeling during one of the most controversial and unpredictable presidential elections in history. Now free from the constraints of running, Hillary takes you inside the intense personal experience of becoming the first woman nominated for president by a major party in an election marked by rage, sexism, exhilarating highs and infuriating lows, stranger-than-fiction twists, Russian interference and an opponent who broke all the rules. This is her most personal memoir yet. In these pages, she describes what it was like to run against Donald Trump, the mistakes she made, how she has coped with a shocking and devastating loss, and how she found the strength to pick herself back up afterwards. With humour and candour, she tells readers what it took to get back on her feet - the rituals, relationships and reading that got her through, and what the experience has taught her about life. She speaks about the challenges of being a strong woman in the public eye, the criticism over her voice, age and appearance, and the double standard confronting women in politics. She lays out how the 2016 election was marked by an unprecedented assault on democracy by a foreign adversary. By analysing the evidence and connecting the dots, Hillary shows just how dangerous the forces are that shaped the outcome, and why Americans need to understand them to protect their values and democracy in the future. The election of 2016 was unprecedented and historic. What Happened is the story of that campaign and its aftermath - both a deeply intimate account and a cautionary tale.', NULL, 546, 1, NULL, 100.00, NULL, '2021-03-05 23:32:16', '2021-03-05 23:32:16'),
(878, 'An Orchestra of Minorities', 'An-Orchestra-of-Minorities', 'http://books.google.com/books/content?id=o3ACtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=o3ACtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408710807', 'LONGLISTED FOR THE BOOKER PRIZE 2019 FROM THE AUTHOR OF THE BOOKER-SHORTLISTED NOVEL, THE FISHERMEN \'Obioma is truly the heir to Chinua Achebe\' New York Times A young farmer named Chinonso prevents a woman from falling to her death. Bonded by this strange night on the bridge, he and Ndali fall in love, but it is a mismatch according to her family who reject him because of his lowly status. Is it love or madness that makes Chinonso think he can change his destiny? Set across Nigeria and Cyprus, An Orchestra of Minorities, written in the mythic style of the Igbo tradition, weaves a heart-wrenching tale about fate versus free will. ________________________________________________________________________________ \'A spectacular artistic leap\' Guardian \'Brilliantly original\' The Economist \'A remarkable talent\' Independent \'Few contemporary novels achieve the seductive panache of Obioma\'s heightened language, with its mixture of English, Igbo and colourful African-English phrases, and the startling clarity of the dialogue. The story is extreme; yet its theme is a bid for mercy for that most fragile of creatures - a human\' Eileen Battersby, Guardian', NULL, 547, 1, NULL, 100.00, NULL, '2021-03-05 23:32:16', '2021-03-05 23:32:16'),
(879, 'The Familiars', 'The-Familiars', 'http://books.google.com/books/content?id=uYs_vAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uYs_vAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785766114', '\'Assured and alluring, this beautiful tale of women and witchcraft and the fight against power was a delight from start to finish\' - Jessie Burton, bestselling author of The Miniaturist.', NULL, 548, 1, NULL, 100.00, NULL, '2021-03-05 23:32:16', '2021-03-05 23:32:16'),
(880, '21 Lessons for the 21st Century', '21-Lessons-for-the-21st-Century', 'http://books.google.com/books/content?id=nbmkswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nbmkswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781787330672', '**THE NUMBER ONE BESTSELLER** Sapiens showed us where we came from. Homo Deus looked to the future. 21 Lessons for the 21st Century explores the present. How can we protect ourselves from nuclear war, ecological cataclysms and technological disruptions? What can we do about the epidemic of fake news or the threat of terrorism? What should we teach our children? Yuval Noah Harari takes us on a thrilling journey through today\'s most urgent issues. The golden thread running through his exhilarating new book is the challenge of maintaining our collective and individual focus in the face of constant and disorienting change. Are we still capable of understanding the world we have created?', NULL, 83, 1, NULL, 100.00, NULL, '2021-03-05 23:32:17', '2021-03-05 23:32:17'),
(881, 'Wild Signs and Star Paths', 'Wild-Signs-and-Star-Paths', 'http://books.google.com/books/content?id=Lu-_swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Lu-_swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781473655904', '\'Beautifully written... I promise you will feel more in tune with the world around after reading only one chapter of Wild Signs and Star Paths, let alone the book in its entirety\' - Royal Institute of Navigation \'A beautifully written almanac of tricks and tips that we\'ve lost along the way\' - Observer Tristan Gooley, author of the internationally bestselling How To Read Water and The Walker\'s Guide to Outdoor Clues & Signs, shows how it is possible to achieve a level of outdoors awareness that will enable you to sense direction from stars and plants, forecast weather from woodland sounds and predict the next action of an animal from its body language - instantly. Although once common, this now rare awareness would be labelled by many as a \'sixth sense\'. We have become so distanced from this way of experiencing our environment that it may initially seem hard to believe that it is possible, but Tristan Gooley uses a collection of \'keys\' to show how everyone can develop this ability and enjoy the outdoors in an exciting way - one that is both new and ancient.', NULL, 549, 1, NULL, 100.00, NULL, '2021-03-05 23:32:17', '2021-03-05 23:32:17'),
(882, 'Blackberry and Wild Rose', 'Blackberry-and-Wild-Rose', 'http://books.google.com/books/content?id=QJcntAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QJcntAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781787470750', '\'Sumptuous and moving\' Laura Purcell, author of THE SILENT COMPANIONS For fans of Jessie Burton and Tracy Chevalier, a rich historical debut set among the Huguenot silk weavers of Spitalfields in the late 18th century. WHEN ESTHER THOREL, the wife of a Huguenot silk-weaver, rescues Sara Kemp from a brothel she thinks she is doing God\'s will. Sara is not convinced being a maid is better than being a whore, but the chance to escape her grasping \'madam\' is too good to refuse. INSIDE THE THORELS\' tall house in Spitalfields, where the strange cadence of the looms fills the attic, the two women forge an uneasy relationship. The physical intimacies of washing and dressing belie the reality: Sara despises her mistress\'s blindness to the hypocrisy of her household, while Esther is too wrapped up in her own secrets to see Sara as anything more than another charitable cause. IT IS SILK that has Esther so distracted. For years she has painted her own designs, dreaming that one day her husband will weave them into reality. When he laughs at her ambition, she unwittingly sets in motion events that will change the fate of the whole Thorel household and set the scene for a devastating day of reckoning between her and Sara. THE PRICE OF a piece of silk may prove more than either is able to pay.', NULL, 550, 1, NULL, 100.00, NULL, '2021-03-05 23:32:17', '2021-03-05 23:32:17'),
(883, 'Easy Peasy Puppy Squeezey', 'Easy-Peasy-Puppy-Squeezey', 'http://books.google.com/books/content?id=lz1NvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=lz1NvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781788701600', 'My name\'s Steve Mann and I\'ve been a professional dog trainer and behaviorist for more than 30 years. As founder of the Institute of Modern Dog Trainers, I\'ve helped transform the lives of over 100,000 dogs and their families--and now I want to help you, too! Whether you\'re living with a brand-new puppy, an adult dog, or a rescue dog, my methods will give you everything you need to know. Using simple, proven, science-based and ethical techniques, I\'ll show you how to have the best relationship with your pup, as well as teaching you how to get: super-fast recalls, great loose lead walking, perfect manners, and much, MUCH more. I promise, it really is easy peasy and every tip, trick, and lesson will bring you and your puppy closer together. I\'ll see you on the other side. Enjoy!', NULL, 551, 1, NULL, 100.00, NULL, '2021-03-05 23:32:17', '2021-03-05 23:32:17'),
(884, 'Ducks, Newburyport', 'Ducks,-Newburyport', '', '', '9781913111991', '', NULL, 552, 1, NULL, 100.00, NULL, '2021-03-05 23:32:17', '2021-03-05 23:32:17'),
(885, 'Milkman', 'Milkman', 'http://books.google.com/books/content?id=xqq6swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xqq6swEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780571342730', 'WINNER OF THE MAN BOOKER PRIZE 2018 \'Milkman is extraordinary. I\'ve been reading passages aloud for the pleasure of hearing it. It\'s frightening, hilarious, wily and joyous all at the same time.\' - Lisa McInerney, author of The Glorious Heresies In this unnamed city, to be interesting is dangerous. Middle sister, our protagonist, is busy attempting to keep her mother from discovering her maybe-boyfriend and to keep everyone in the dark about her encounter with Milkman. But when first brother-in-law sniffs out her struggle, and rumours start to swell, middle sister becomes \'interesting\'. The last thing she ever wanted to be. To be interesting is to be noticed and to be noticed is dangerous. Milkman is a tale of gossip and hearsay, silence and deliberate deafness. It is the story of inaction with enormous consequences.', NULL, 553, 1, NULL, 100.00, NULL, '2021-03-05 23:32:18', '2021-03-05 23:32:18'),
(886, 'Milkman', 'Milkman-9780571338757', 'http://books.google.com/books/content?id=LN6hugEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=LN6hugEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780571338757', 'SHORTLISTED FOR THE MAN BOOKER PRIZE 2018. \'Milkman is extraordinary. I\'ve been reading passages aloud for the pleasure of hearing it. It\'s frightening, hilarious, wily and joyous all at the same time.\' - Lisa McInerney, author of The Glorious Heresies In this unnamed city, to be interesting is dangerous. Middle sister, our protagonist, is busy attempting to keep her mother from discovering her maybe-boyfriend and to keep everyone in the dark about her encounter with Milkman. But when first brother-in-law sniffs out her struggle, and rumours start to swell, middle sister becomes \'interesting\'. The last thing she ever wanted to be. To be interesting is to be noticed and to be noticed is dangerous. Milkman is a tale of gossip and hearsay, silence and deliberate deafness. It is the story of inaction with enormous consequences.', NULL, 553, 1, NULL, 100.00, NULL, '2021-03-05 23:32:18', '2021-03-05 23:32:18'),
(887, 'Turtles All the Way Down', 'Turtles-All-the-Way-Down', 'http://books.google.com/books/content?id=sQwXtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sQwXtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241335437', 'Sixteen-year-old Aza never intended to pursue the mystery of fugitive billionaire Russell Pickett, but there\'s a hundred thousand dollar reward at stake and her Best and Most Fearless Friend, Daisy, is eager to investigate. So together, they navigate the short distance and broad divides that separate them from Russell Pickett\'s son, Davis. Aza is trying. She is trying to be a good daughter, a good friend, a good student, and maybe even a good detective, while also living within the ever-tightening spiral of her own thoughts. In his long-awaited return, John Green, the acclaimed, award-winning author of Looking for Alaskaand The Fault in Our Stars, shares Aza\'s story with shattering, unflinching clarity in this brilliant novel of love, resilience, and the power of lifelong friendship.', NULL, 152, 1, NULL, 100.00, NULL, '2021-03-05 23:32:18', '2021-03-05 23:32:18'),
(888, 'The Testaments', 'The-Testaments-9781784742324', 'http://books.google.com/books/content?id=CYG4vgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=CYG4vgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784742324', '** WINNER OF THE BOOKER PRIZE 2019 ** ** SUNDAY TIMES NO. 1 BESTSELLER ** BOOK OF THE YEAR: Daily Telegraph, Evening Standard, Stylist, Sunday Times, Financial Times, Guardian, The Times, Observer, Red Margaret Atwood\'s dystopian masterpiece, The Handmaid\'s Tale, is a modern classic. Now she brings the iconic story to a dramatic conclusion in this riveting sequel. More than fifteen years after the events of The Handmaid\'s Tale, the theocratic regime of the Republic of Gilead maintains its grip on power, but there are signs it is beginning to rot from within. At this crucial moment, the lives of three radically different women converge, with potentially explosive results. Two have grown up as part of the first generation to come of age in the new order. The testimonies of these two young women are joined by a third voice: a woman who wields power through the ruthless accumulation and deployment of secrets. As Atwood unfolds The Testaments, she opens up the innermost workings of Gilead as each woman is forced to come to terms with who she is, and how far she will go for what she believes. \'Dear Readers: Everything you\'ve ever asked me about Gilead and its inner workings is the inspiration for this book. Well, almost everything! The other inspiration is the world we\'ve been living in.\' Margaret Atwood', NULL, 189, 1, NULL, 100.00, NULL, '2021-03-05 23:32:18', '2021-03-05 23:32:18'),
(889, 'Hero', 'Hero', 'http://books.google.com/books/content?id=zvE3ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zvE3ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471133442', 'FROM ZERO TO HERO . . . YOUR SECRET MAP TO A RICH LIFE What is your true calling and why aren\'t you already living it? Imagine if there was a map that showed you step by step how to get from where you are now to your true calling and the life you were born to live - the most brilliant, rich, fulfilling, and dazzling life you could ever dream of. You are holding in your hands such a map. HERO is the map for your life. By following the journeys of twelve of the most successful people on the planet today, you\'ll learn how to use your inner powers to overcome obstacles and to make impossible dreams come true. You\'ll be inspired to find your own calling and start taking the steps toward making the life of your dreams an everyday reality. Be the hero you are meant to be.', NULL, 554, 1, NULL, 100.00, NULL, '2021-03-05 23:32:18', '2021-03-05 23:32:18'),
(890, 'Nine Dragons', 'Nine-Dragons', '', '', '9781407245317', 'The murder of John Li, a South L.A. liquour store owner, hits LAPD Detective Harry Bosch hard, and he promises Li\'s family that he\'ll find the killer. As he uncovers a link to a Hong Kong triad--a lethal and far-reaching crime ring that follows many immigrants to their new lives in the U.S.--his world instantly explodes and the person he holds most dear is taken from him.', NULL, 555, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(891, 'Void Moon', 'Void-Moon', '', '', '9781407250298', 'Lured back to her former profession of robbing casino gamblers of their winnings, Cassie Black suddenly finds herself caught up in a dark conspiracy, pursued by mysterious gunmen who are closing in on Cassie\'s deepest secret, one that she will do anything to protect.', NULL, 555, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(892, 'The Darkest Surrender', 'The-Darkest-Surrender', 'http://books.google.com/books/content?id=2Fs_XwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2Fs_XwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848450486', 'Strider Immortal Keeper of Defeat Nothing comes between him and victory Possessed by the demon of Defeat, Strider suffers unimaginable pain when he loses a challenge. For him, nothing stands in the way of winning. Until Kaia, an enchanting Harpy, tempts him. Kaia must bring home the gold in the Harpy Games competition or die. Strider is a distraction she can\'t afford, especially as he intends to steal first prize, an ancient magical artifact, before the true victor can be named. But as the competition heats up, only one prize will matter the dangerous, addictive passion neither had thought possible. . . .', NULL, 556, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(893, 'The Darkest Seduction', 'The-Darkest-Seduction', 'http://books.google.com/books/content?id=BT9otQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=BT9otQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781848450974', 'Paris Darkest Lord of the Underworld Immortal warrior Paris is irresistible yet this comes at a terrible price. Possessed by a depraved demon, he must seduce someone new every night, or die. But the one woman he craves has never truly been his. Sienna, possessed by the demon of Wrath, is compelled to punish everyone around her. Yet in Paris\'s arms she finds peace and insatiable desire.As Paris and Sienna\'s bond grows it reignites a blood feud between ancient enemies. With battle raging between gods, angels and demons, Paris and Sienna must fight a supernatural war that could destroy their love.', NULL, 556, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(894, 'Fifty-Fifty', 'Fifty-Fifty', 'http://books.google.com/books/content?id=n9rIyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=n9rIyQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409185864', 'Two sisters on trial for murder. They accuse each other. Who do YOU believe? \'911 what\'s your emergency?\' \'My dad\'s dead. My sister Sofia killed him. She\'s still in the house. Please send help.\' \'My dad\'s dead. My sister Alexandra killed him. She\'s still in the house. Please send help.\' One of them is a liar and a killer. But which one? ******** Your favourite authors LOVE Fifty-Fifty, the follow-up to the bestselling novel Thirteen: \'A terrific writer. He has talent to burn.\' Don Winslow \'Unpredictable, daring and completely compelling. Top notch writing.\' Alex North \'Very clever, darkly funny, moving, fast-paced.\' Jane Casey \'Steve Cavanagh writes the best hooks in the business\' Mick Herron \'Absolutely brilliant. Addictive, clever, pacy. Eddie Flynn is one of my heroes.\' Jo Spain \'Intelligent, sophisticated and tense.\' Mari Hannah', NULL, 84, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(895, 'Talking with Psychopaths', 'Talking-with-Psychopaths', 'http://books.google.com/books/content?id=J2PajwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=J2PajwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786061225', 'Criminologist Christopher Berry-Dee takes readers deep inside the dark minds of some of the most pitiless and dangerous people alive. Having spent years interviewing imprisoned criminals, including notorious serial killers, he discovered that the lack of remorse they showed was in many ways more terrifying than the crimes they had committed. Yet in the course of these conversations, the author also had the chance to interview his subjects\' psychiatrists and, in doing so, uncovered a terrible truth: a monster can be hidden behind a friendly face. Some of these experts, he found, proved to have more in common with their patients than he would ever have expected. This book examines horrific crimes committed by some of the most remorseless and merciless people ever to have lived. If it reveals a mindset wholly alien to most people, it also, shockingly, demonstrates that some of the people who treat these psychopaths have their own demons. Talking with Psychopaths will inevitably shift the reader\'s view of psychopaths, and in doing so, reveals that horror can be much closer to us than we think.', NULL, 557, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(896, 'Not a Diet Book', 'Not-a-Diet-Book', 'http://books.google.com/books/content?id=f2uMzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=f2uMzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008374297', '*The No.1 Sunday Times Bestseller James Smith has already changed thousands of lives with his international phenomenon Not A Diet Book. Are you ready to change yours? Are you sick of always wearing black and getting undressed in the dark? Are you fixated with a number on the scales? Are you afraid to step into the gym and commit to a routine? Is your confidence at an all-time low? Is all of this having a negative impact on your life, relationships and happiness? With every tool you\'ll ever need to learn to reset your current mindset and attitude towards your diet and training, chapters include: * Fat loss versus muscle gain * Metabolism and \'body types\' * Protein targets and calorie tracking * Common fitness fallacies * Female fat loss * Supplements * Training versus exercising * The importance of sleep * Forming habits This book will put you back in control. It is not a fad diet or a short-term training plan. It will empower you to adopt better habits that will allow you to take charge of your life.', NULL, 558, 1, NULL, 100.00, NULL, '2021-03-05 23:32:19', '2021-03-05 23:32:19'),
(897, 'The Institute', 'The-Institute', 'http://books.google.com/books/content?id=ba1XzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ba1XzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529355413', '\'It does everything you\'d expect of a masterpiece - and it is one\' Sunday Express \'Hums and crackles with delicious unease\' Independent \'Captivating\' The Sunday Times \'An absorbing thriller\' Mail on Sunday NO ONE HAS EVER ESCAPED FROM THE INSTITUTE. Luke Ellis, a super-smart twelve-year-old with an exceptional gift, is the latest in a long line of kids abducted and taken to a secret government facility, hidden deep in the forest in Maine. Here, kids with special talents - telekinesis and telepathy - like Luke\'s new friends Kalisha, Nick and Iris, are subjected to a series of experiments. There seems to be no hope of escape. Until Luke teams up with an even younger boy whose powers of telepathy are off the scale. Meanwhile, far away in a small town in South Carolina, former cop Tim Jamieson, looking for the quiet life, has taken a job working for the local sheriff. He doesn\'t know he\'s about to take on the biggest case of his career . . . THERE\'S ONLY ONE WAY OUT. \'An epic tale of childhood betrayal and hope regained... an immersive tale full of suspense and thrills that will keep readers up late at night racing towards a heartbreaking yet glorious finale... a dazzling achievement\' - Daily Express', NULL, 559, 1, NULL, 100.00, NULL, '2021-03-05 23:32:20', '2021-03-05 23:32:20'),
(898, 'The Forgotten', 'The-Forgotten', 'http://books.google.com/books/content?id=J67JuwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=J67JuwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529003215', 'The second title in David Baldacci\'s bestselling series, The Forgotten is a fast-paced action thriller, featuring the hero of Zero Day - John Puller. Criminal investigator John Puller is drawn closer to home when his aunt is found dead in her house in Paradise, Florida. The local police have ruled the death as an accident, but Puller finds evidence to suggest that she may well have been murdered. On the surface the town lives up to its name, but as Puller digs deeper he realizes that this town and its inhabitants are more akin to Hell than Paradise. His belief is confirmed as evidence of strange and inexplicable events come to light. And when Puller learns the truth about what is happening in this once sleepy town, he knows that his discoveries will impact far wider than Paradise.', NULL, 560, 1, NULL, 100.00, NULL, '2021-03-05 23:32:20', '2021-03-05 23:32:20'),
(899, 'Eleanor Oliphant is Completely Fine', 'Eleanor-Oliphant-is-Completely-Fine', 'http://books.google.com/books/content?id=8pyLswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8pyLswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008172145', 'Over 2.5 million copies sold \'Funny, touching and unpredictable\' Jojo Moyes \'Heartwrenching and wonderful\' Nina Stibbe Winner of Costa First Novel Award, a No.1 Sunday Times bestseller and the Book of the Year Eleanor Oliphant has learned how to survive - but not how to live Eleanor Oliphant leads a simple life. She wears the same clothes to work every day, eats the same meal deal for lunch every day and buys the same two bottles of vodka to drink every weekend. Eleanor Oliphant is happy. Nothing is missing from her carefully timetabled life. Except, sometimes, everything. One simple act of kindness is about to shatter the walls Eleanor has built around herself. Now she must learn how to navigate the world that everyone else seems to take for granted - while searching for the courage to face the dark corners she\'s avoided all her life. Change can be good. Change can be bad. But surely any change is better than... fine? \'Moving, funny and devastating\' The Herald \'Unforgettable, brilliant, funny and life-affirming\' Daily Mail \'I adored it. Skilled, perceptive, Eleanor\'s world will feel familiar to you from the very first page. An outstanding debut!\' Joanna Cannon', NULL, 561, 1, NULL, 100.00, NULL, '2021-03-05 23:32:20', '2021-03-05 23:32:20'),
(900, 'Whisper Network', 'Whisper-Network', 'http://books.google.com/books/content?id=r6kwwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=r6kwwwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751575118', '\'WOW what a read... A book for the women of today. I loved it!!!!!\' \'I am still thinking about Whisper Network weeks after reading the last page\' \'I could not put this book down\' \'Do yourself a favour ladies and read this well-paced, witty and ballsy homage to working women everywhere\' \'Furious and relevant... I loved it so much\' CLARE MACKINTOSH ***THE INSTANT NEW YORK TIMES BESTSELLER*** _____________ \'Ms. Sandberg was right about something. We had to lean in. It was the only way to hear the whispers...\' Sloane, Ardie, Grace and Rosalita have worked in the same legal office for years. The sudden death of the firm\'s CEO means their boss, Ames, will likely take over the entire company. Each of the women has a different relationship with Ames, who has always been surrounded by whispers about how he treats women. Those whispers have been ignored, swept under the rug, hidden away by those in charge. But the world has changed, and the women are watching this latest promotion for Ames differently. This time, they\'ve decided enough is enough. Sloane and her colleagues\' decision to take a stand sets in motion something catastrophic and unstoppable: lies will be uncovered, secrets will be exposed and not everyone will survive. All their lives - as women, colleagues, mothers, adversaries - will be changed for ever. \'Add another great book to your beach bag! This story has a workplace murder mystery that happens in today\'s #MeToo era. It\'s honest, timely and completely thrilling - I was so surprised to find out who the murderer was!\' REESE WITHERSPOON \'It\'s The Firm meets 9 To 5. This is a juicy air-punch of a novel\' ALEXANDRA HEMINSLEY, GRAZIA \'Slick, smart, fierce, it\'s Big Little Lies set against attorneys and recast in the light of #MeToo. Relevant, resonant and rage inducing\' SARAH VAUGHAN \'A barnstorming modern novel\' EVENING STANDARD MAGAZINE \'Smart, witty and scarily relateable... this is going to get everyone talking\' FABULOUS MAGAZINE \'Witty and timely will make you cheer for sisterhood\' LIV CONSTANTINE \'A timely and apposite #MeToo novel, but also a clever thriller, which highlights the many ways in which women are discriminated against in the workplace\' SARA MANNING RED MAGAZINE \'A primal roar of a novel. A fantastic read\' RILEY SAGER \'A thriller for the #metoo era\' LUCY MANGAN, STYLIST', NULL, 562, 1, NULL, 100.00, NULL, '2021-03-05 23:32:20', '2021-03-05 23:32:20'),
(901, 'The Spring Girls', 'The-Spring-Girls', 'http://books.google.com/books/content?id=_mRYtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_mRYtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781501130717', 'Four sisters desperately seeking the blueprints to life—the modern-day retelling of Louisa May Alcott’s Little Women like only Anna Todd (After, Imagines) could do. The Spring Girls—Meg, Jo, Beth, and Amy—are a force of nature on the New Orleans military base where they live. As different as they are, with their father on tour in Iraq and their mother hiding something, their fears are very much the same. Struggling to build lives they can be proud of and that will lift them out of their humble station in life, one year will determine all that their futures can become. The oldest, Meg, will be an officer’s wife and enter military society like so many of the women she admires. If her passion—and her reputation—don’t derail her. Beth, the workhorse of the family, is afraid to leave the house, is afraid she’ll never figure out who she really is. Jo just wants out. Wishing she could skip to graduation, she dreams of a life in New York City and a career in journalism where she can impact the world. Nothing can stop her—not even love. And Amy, the youngest, is watching all her sisters, learning from how they handle themselves. For better or worse. With plenty of sass, romance, and drama, The Spring Girls revisits Louisa May Alcott’s classic Little Women, and brings its themes of love, war, class, adolescence, and family into the language of the twenty-first century.', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:32:20', '2021-03-05 23:32:20'),
(902, 'The Selfish Gene', 'The-Selfish-Gene', 'http://books.google.com/books/content?id=ekonDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ekonDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9780198788607', 'With a new epilogue to the 40th anniversary edition.', NULL, 563, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(903, 'The Eagle\'s Prophecy', 'The-Eagle\'s-Prophecy', 'http://books.google.com/books/content?id=QpdXPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QpdXPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780755350001', 'The sixth novel in Simon Scarrow\'s bestselling Roman series. It is spring 45 AD and Centurions Macro and Cato, dismissed from the Second Legion in Britain, are trapped in Rome, waiting for their involvement in the death of a fellow officer to be investigated. It is then that the imperial secretary, the devious Narcissus, makes them an offer they can\'t refuse: to rescue an imperial agent who has been captured by pirates operating from the Illyrian coast. With him were scrolls vital to the safety of the Emperor and the future of Rome. However, Narcissus also sends Vitellius, an old enemy of the two centurions. The three officers set out from Ravenna with the imperial fleet but the pirates are forewarned and the Romans pay a heavy price. Outnumbered by the enemy, surrounded by rumours of treachery and endangered by Vitellius\' desire to redeem himself, Centurions Macro and Cato must find the pirate base to avert a disaster that could destroy the Emperor.', NULL, 256, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(904, 'The Promise', 'The-Promise', 'http://books.google.com/books/content?id=Kh6YswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Kh6YswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008209216', '\'All hail the new Queen of Crime!\' HeatWhen troubled teen Connor moves to Exeter from the US after a horrific school shooting, he finds himself embroiled in a world of popular kids and easy girls. Everyone wants to be his friend, but they don\'t know about what he did...and they don\'t know about his father. As Connor\'s life in England begins to unravel, DS Adrian Miles and his partner Imogen Grey are working up against the clock to catch a serial killer who dates his victims before he kills them. Determined to uncover the truth, Imogen is forced to act as bait - but will she take it too far and risk her own life? Katerina Diamond is back with a bang in this dark, twisted novel, perfect for fans of M.J. Arlidge and Karin Slaughter.', NULL, 122, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(905, 'Originals', 'Originals', 'http://books.google.com/books/content?id=emnDwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=emnDwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780753556993', 'The New York Times best-selling author examines how people can drive creative, moral, and organisational progress-and how leaders can encourage originality in their organisations. How can we originate new ideas, policies and practices without risking it all? Adam Grant shows how to improve the world by championing novel ideas and values that go against the grain, battling conformity, and bucking outdated traditions. Using surprising studies and stories spanning business, politics, sports, and entertainment, Grant explores how to recognise a good idea, speak up without getting silenced, build a coalition of allies, choose the right time to act, and manage fear and doubt; how parents and teachers can nurture originality in children; and how leaders can fight group think to build cultures that welcome dissent. Learn from an entrepreneur who pitches his startups by highlighting the reasons not to invest, a woman at Apple who challenged Steve Jobs from three levels below, an analyst who overturned the rule of secrecy at the CIA, a billionaire financial wizard who fires employees for failing to criticise him, and a TV executive who didn\'t even work in comedy but saved Seinfeld from the cutting room floor. Originals will give you ground breaking insights about rejecting conformity and improving the status quo.', NULL, 564, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(906, 'The Bluest Eye', 'The-Bluest-Eye', 'http://books.google.com/books/content?id=2q_l9Q4FVmIC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2q_l9Q4FVmIC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780099759911', 'Read the searing first novel from the celebrated author of Beloved, which immerses us in the tragic, torn lives of a poor black family in post-Depression 1940s Ohio. Unlovely and unloved, Pecola prays each night for blue eyes like those of her privileged white schoolfellows. At once intimate and expansive, unsparing in its truth-telling, The Bluest Eye shows how the past savagely defines the present. A powerful examination of our obsession with beauty and conformity, Toni Morrison\'s virtuosic first novel asks powerful questions about race, class, and gender with the subtlety and grace that have always characterised her writing. \'She revealed the sins of her nation, while profoundly elevating its canon. She suffused the telling of blackness with beauty, whilst steering us away from the perils of the white gaze. That\'s why she told her stories. And why we will never, ever stop reading them\' Afua Hirsch \'Discovering a writer like Toni Morrison is rarest of pleasures\' Washington Post \'When she arrived, with her first novel, The Bluest Eye, she immediately re-ordered the American literary landscape\' Ben Okri Winner of the PEN/Saul Bellow award for achievement in American fiction', NULL, 565, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(907, 'Invisible Women', 'Invisible-Women', 'http://books.google.com/books/content?id=8VxJxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8VxJxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784706289', '*THE SUNDAY TIMES BESTSELLER* \'HELL YES. This is one of those books that has the potential to change things - a monumental piece of research\' Caitlin Moran Imagine a world where... · Your phone is too big for your hand · Your doctor prescribes a drug that is wrong for your body · In a car accident you are 47% more likely to be injured. If any of that sounds familiar, chances are you\'re a woman. From government policy and medical research, to technology, workplaces, and the media. Invisible Women reveals how in a world built for and by men we are systematically ignoring half of the population, often with disastrous consequences. Caroline Criado Perez brings together for the first time an impressive range of case studies, stories and new research from across the world that illustrate the hidden ways in which women are forgotten, and the profound impact this has on us all. Discover the shocking gender bias that affects our everyday lives. \'A book that changes the way you see the world\' Sunday Times \'Revelatory, frightening, hopeful\' Jeanette Winterson **Winner of the Royal Society Insight Investment Science Book Prize 2019** **Winner of the Readers\' Choice Books Are My Bag Award 2019** **Winner of the FT & McKinsey Business Book of the Year 2019 Book of the Year Award 2019** **The Times Current Affairs Book of the Year 2019**', NULL, 566, 1, NULL, 100.00, NULL, '2021-03-05 23:32:21', '2021-03-05 23:32:21'),
(908, 'One of Us is Lying', 'One-of-Us-is-Lying', 'http://books.google.com/books/content?id=_ocSvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=_ocSvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780141375632', 'On Thursday afternoon, five students at Bayview High walk into detention. Bronwyn,the brain, is Yale-bound and never breaks a rule. Addy, the beauty, is the picture-perfect homecoming princess. Nate,the criminal,is already on probation for dealing. Cooper,the athlete,is the all-star baseball pitcher. And Simon,the outcast,is the creator of Bayview High\'s notorious gossip app. Only, Simon never makes it out of that classroom. Before the end of detention, Simon\'s dead. And according to investi-gators, his death wasn\'t an accident. On Thursday, he died. But on Friday, he\'d planned to post juicy reveals about all four of his high-profile classmates, which makes all four of them suspects in his murder. Or are they just the perfect patsies for a killer who\'s still on the loose? Everyone has secrets, right? What really matters is how far you would go to protect them.', NULL, 73, 1, NULL, 100.00, NULL, '2021-03-05 23:32:22', '2021-03-05 23:32:22'),
(909, 'Queenie', 'Queenie', 'http://books.google.com/books/content?id=vjqdygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vjqdygEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409180074', 'THE SUNDAY TIMES BESTSELLER BOOK OF THE YEAR AT THE BRITISH BOOK AWARDS SHORTLISTED FOR THE COSTA FIRST NOVEL AWARD LONGLISTED FOR THE WOMEN\'S PRIZE FOR FICTION \'A deliciously funny, characterful, topical and thrilling novel for our times\' Bernardine Evaristo, winner of the Booker Prize \'Brilliant, timely, funny, heartbreaking\' Jojo Moyes \'A must-read novel about sex, selfhood, and the best friendships that get us through it all\' Candace Bushnell, author of Sex and the City Queenie is a twenty-five-year-old Black woman living in south London, straddling Jamaican and British culture whilst slotting neatly into neither. She works at a national newspaper where she\'s constantly forced to compare herself to her white, middle-class peers, and beg to write about Black Lives Matter. After a messy break up from her long-term white boyfriend, Queenie finds herself seeking comfort in all the wrong places. As Queenie veers from one regrettable decision to another, she finds herself wondering, What are you doing? Why are you doing it? Who do you want to be? - the questions that every woman today must face in a world that keeps trying to provide the answers for them. A darkly comic and bitingly subversive take on life, love, race and family, Queenie will have you nodding in recognition, crying in solidarity and rooting for this unforgettable character every step of the way. A disarmingly honest, boldly political and truly inclusive tale that will speak to anyone who has gone looking for love and acceptance and found something very different in its place. ****** This book has been printed with two different colour designs, gold and pink. We are unable to accept requests for a specific cover. The different covers will be assigned to orders at random ****** LONGLISTED FOR THE JHALAK PRIZE SHORTLISTED FOR WATERSTONES BOOK OF THE YEAR SHORTLISTED FOR FOYLES BOOK OF THE YEAR SHORTLISTED FOR COMEDY WOMAN IN PRINT PRIZE 2020 BLACKWELL\'S DEBUT NOVEL OF THE YEAR NAMED ONE OF THE TIMES, GUARDIAN, SUNDAY TIMES, DAILY MAIL AND EVENING STANDARD\'S BEST BOOKS OF 2019', NULL, 567, 1, NULL, 100.00, NULL, '2021-03-05 23:32:22', '2021-03-05 23:32:22'),
(910, 'TED Talks', 'TED-Talks', 'http://books.google.com/books/content?id=OBn9jwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OBn9jwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472228062', 'In Ted Talks Chris Anderson, head of TED, reveals the inside secrets of how to give a first-class presentation. Where books like Talk Like TED and TED Talks Storytelling whetted the appetite, here is the official TED guide to public speaking from the man who put TED talks on the world\'s stage. \'Nobody in the world better understands the art and science of public speaking than Chris Anderson. He is absolutely the best person to have written this book\' Elizabeth Gilbert. Anderson shares his five key techniques to presentation success: Connection, Narration, Explanation, Persuasion and Revelation (plus the three to avoid). He also answers the most frequently asked questions about giving a talk, from \'What should I wear?\' to \'How do I handle my nerves?\'. Ted Talks is also full of presentation tips from such TED notable speakers as Sir Ken Robinson, Bill Gates, Mary Roach, Amy Cuddy, Elizabeth Gilbert, Dan Gilbert, Amanda Palmer, Matt Ridley and many more. This is a lively, fun read with great practical application from the man who knows what goes into a truly memorable speech. In Ted Talks Anderson pulls back the TED curtain for anyone who wants to learn how to prepare an exceptional presentation.', NULL, 568, 1, NULL, 100.00, NULL, '2021-03-05 23:32:22', '2021-03-05 23:32:22'),
(911, 'Five Little Liars', 'Five-Little-Liars', 'http://books.google.com/books/content?id=wHpzzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=wHpzzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471196386', 'I Know What You Did Last Summer meets One of Us is Lying in this fast-paced suspense thriller following five teens who must cover up the suspicious death of their teacher.', NULL, 569, 1, NULL, 100.00, NULL, '2021-03-05 23:32:22', '2021-03-05 23:32:22');
