(912, 'The Tattooist of Auschwitz', 'The-Tattooist-of-Auschwitz', 'http://books.google.com/books/content?id=JcGfswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=JcGfswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785763670', '', NULL, 42, 1, NULL, 100.00, NULL, '2021-03-05 23:32:23', '2021-03-05 23:32:23'),
(913, 'The Beekeeper of Aleppo', 'The-Beekeeper-of-Aleppo', 'http://books.google.com/books/content?id=z5i3yQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=z5i3yQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781838770013', 'The International Number One Bestseller, for readers of The Tattooist of Auschwitz and The Kite Runner.', NULL, 570, 1, NULL, 100.00, NULL, '2021-03-05 23:32:23', '2021-03-05 23:32:23'),
(914, 'Storm Red', 'Storm-Red', 'http://books.google.com/books/content?id=qghUzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=qghUzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751579932', 'Praise for the Strike series: \'The work of a master storyteller\' Daily Telegraph \'A blistering piece of crime writing\' Sunday Times \'Unputdownable\' Daily Express \'Highly inventive storytelling\' Guardian \'Superb . . . an ingenious whodunnit\' Sunday Mirror \'Come for the twists and turns and stay for the beautifully drawn central relationship\' Independent \'Outrageously entertaining\' Financial Times', NULL, 571, 1, NULL, 100.00, NULL, '2021-03-05 23:32:23', '2021-03-05 23:32:23'),
(915, 'The Midnight Library', 'The-Midnight-Library', 'http://books.google.com/books/content?id=tVdizQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tVdizQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786892706', 'When Nora Seed finds herself in the Midnight Library, she has a chance to make things right. The books in the Midnight Library enable Nora to live as if she had done things differently. But things aren\'t always what she imagined they\'d be, and soon her choices place the library and herself in extreme danger. Before time runs out, she must answer the ultimate question: what is the best way to live?', NULL, 251, 1, NULL, 100.00, NULL, '2021-03-05 23:32:23', '2021-03-05 23:32:23'),
(916, 'The Dilemma', 'The-Dilemma', 'http://books.google.com/books/content?id=s6KzyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=s6KzyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008287030', 'The million-copy bestselling author returns with another breathtaking book... \'A powerful, beautifully crafted story that ratchets up the tension with every page and packs a huge emotional punch\' TM Logan, Sunday Times bestselling author of The Holiday Knowing the truth will destroy her. Keeping it secret will destroy him. It\'s Livia\'s 40th birthday and she\'s having the party of a lifetime to make up for the wedding she never had. Everyone she loves will be there except her daughter Marnie, who\'s studying abroad. But although Livia loves Marnie, she\'s secretly glad she won\'t be at the party. She needs to tell Adam something about their daughter but she\'s waiting until the party is over so they can have this last happy time together. Adam wants everything to be perfect for Livia so he\'s secretly arranged for Marnie to come home and surprise her on her birthday. During the day, he hears some terrible news. He needs to tell Livia, because how can the party go on? But she\'s so happy, so excited - and the guests are about to arrive. The Dilemma - how far would you go to give someone you love a last few hours of happiness? One day that will change a family forever, The Dilemma is the breathtaking, heartbreaking new novel from the million-copy-selling, Sunday Times bestseller, B A Paris. Praise for The Dilemma: \'A powerful, beautifully crafted story that ratchets up the tension with every page and packs a huge emotional punch\' TM Logan \'A departure from B A Paris\'s previous psycho-thrillers, this emotional story is gripping\' The Daily Mail \'A heartbreaking page-turner that will have you up at night reading just one more chapter\' Catherine Steadman \'A dark family drama ... builds a palpable wall of tension that leaves you desperate to find out what happens next\' The Sunday Mirror \'A beautifully written story of love and loss which will stay with me\' Louise Jensen \'What a book... utterly unputdownable!\' Sam King \'A beautifully written novel that will stay with you long after you\'ve turned the final page. B A Paris has a unique ability to get inside your head and stay there!\' HC Warner', NULL, 187, 1, NULL, 100.00, NULL, '2021-03-05 23:32:23', '2021-03-05 23:32:23'),
(917, 'Cilka\'s Journey', 'Cilka\'s-Journey-9781785769054', 'http://books.google.com/books/content?id=8bROzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8bROzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781785769054', '', NULL, 42, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(918, 'Normal People', 'Normal-People', 'http://books.google.com/books/content?id=bhSougEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bhSougEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780571334650', 'Connell and Marianne grow up in the same small town in the west of Ireland, but the similarities end there. In school, Connell is popular and well-liked, while Marianne is a loner. But when the two strike up a conversation - awkward but electrifying - something life-changing begins. Normal People is a story of mutual fascination, friendship and love. It takes us from that first conversation to the years beyond, in the company of two people who try to stay apart but find they can\'t.', NULL, 120, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(919, 'The Hunting Party', 'The-Hunting-Party-9780008297152', 'http://books.google.com/books/content?id=3z7WvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3z7WvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008297152', '*The Sunday Times Top 5 bestseller* EVERYONE\'S INVITED. EVERYONE\'S A SUSPECT. In a remote hunting lodge, deep in the Scottish wilderness, old friends gather. The beautiful oneThe golden coupleThe volatile oneThe new parentsThe quiet oneThe city boyThe outsider The victim. Not an accident - a murder among friends.', NULL, 35, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(920, 'The Starless Sea', 'The-Starless-Sea', 'http://books.google.com/books/content?id=ADbRywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ADbRywEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784702861', 'Are you lost or are you exploring? When Zachary Rawlins stumbles across a strange book hidden in his university library it leads him on a quest unlike any other. Its pages entrance him with their tales of lovelorn prisoners, lost cities and nameless acolytes, but they also contain something impossible: a recollection from his own childhood. Determined to solve the puzzle of the book, Zachary follows the clues he finds on the cover - a bee, a key and a sword. They guide him to a masquerade ball, to a dangerous secret club, and finally through a magical doorway created by the fierce and mysterious Mirabel. This door leads to a subterranean labyrinth filled with stories, hidden far beneath the surface of the earth. When the labyrinth is threatened, Zachary must race with Mirabel, and Dorian, a handsome barefoot man with shifting alliances, through its twisting tunnels and crowded ballrooms, searching for the end of his story. You are invited to join Zachary on the starless sea: the home of storytellers, story-lovers and those who will protect our stories at all costs.', NULL, 572, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(921, 'The Other People', 'The-Other-People', 'http://books.google.com/books/content?id=2CT8ywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2CT8ywEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781405939621', 'She sleeps, a pale girl in a white room . . . Driving home one night, stuck behind a rusty old car, Gabe sees a little girl\'s face appear in the rear window. She mouths one word- \'Daddy.\' It\'s his five-year-old daughter, Izzy. He never sees her again. Three years later, Gabe spends his days and nights travelling up and down the motorway, searching for the car that took his daughter, refusing to give up hope, even though most people believe that Izzy is dead. Fran and her daughter, Alice, also put in a lot of miles on the motorway. Not searching. But running. Trying to keep one step ahead of the people who want to hurt them. Because Fran knows the truth. She knows what really happened to Gabe\'s daughter. She knows who is responsible. And she knows what they will do if they ever catch up with her and Alice . . .', NULL, 573, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(922, 'Finding Chika', 'Finding-Chika', 'http://books.google.com/books/content?id=e2QDwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=e2QDwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751571936', 'Chika Jeune was born three days before the devastating earthquake that decimated Haiti in 2010. She spent her infancy in extreme poverty, and when her mother died giving birth to a baby brother, Chika was brought to the Have Faith Haiti Orphanage that Mitch and his wife, Janine operate. Chika\'s arrival made a quick impression. Brave and self-assured, even as a three-year-old, she delighted the other kids and teachers. But at age five, Chika was suddenly diagnosed with a terminal disease that no doctor in Haiti could help with. Mitch and Janine took Chika to America, hoping that treatment there would enable her to go back home. Instead, Chika became a permanent part of their lives, as they embarked on a two-year, around-the-world journey to find a cure. As Chika\'s boundless optimism and humour taught Mitch the joys of caring for a child, he learnt that a relationship built on love, no matter what blows it takes, can never be lost. This is Mitch Albom at his most poignant, powerful and personal. Chika is a celebration of a girl, her adoptive guardians, and the incredible bond they formed - a devastatingly beautiful portrait of what it means to be a family, regardless of how it is made.', NULL, 156, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(923, 'Postscript', 'Postscript', 'http://books.google.com/books/content?id=pldBygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pldBygEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008194901', 'The long-awaited sequel to the international bestseller PS, I Love You. The PS, I Love You Club. These are the six words written on a card handed to Holly Kennedy. They\'re words that are engraved on her heart - because PS, I Love You is how her husband, Gerry, signed his last letters to her, letters that mark a year she will never forget. Now, the mysterious club wants something from her. And if Holly can find the courage meet them, she\'ll learn what it really means to live life to the full. Because every love story has one last thing to say...', NULL, 202, 1, NULL, 100.00, NULL, '2021-03-05 23:32:24', '2021-03-05 23:32:24'),
(924, 'What Got You Here Won\'t Get You There', 'What-Got-You-Here-Won\'t-Get-You-There', 'http://books.google.com/books/content?id=Pp_c2gh9S4QC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Pp_c2gh9S4QC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781846681370', 'Your hard work is paying off. You are doing well in your field. But there is something standing between you and the next level of achievement. That something may just be one of your own annoying habits.Perhaps one small flaw - a behaviour you barely even recognise - is the only thing that\'s keeping you from where you want to be. It may be that the very characteristic that you believe got you where you are - like the drive to win at all costs - is what\'s holding you back. As this book explains, people often do well in spite of certain habits rather than because of them-and need a \"to stop\" list rather than one listing what \"to do\".Marshall Goldsmith\'s expertise is in helping global leaders overcome their unconscious annoying habits and become more successful. His one-on-one coaching comes with a six-figure price tag - but in this book you get his great advice for much less. Recently named as one of the world\'s five most-respected executive coaches by Forbes, he has worked with over 100 major CEOs and their management teams at the world\'s top businesses. His clients include corporations such as Goldman Sachs, Glaxo SmithKline, Johnson and Johnson and GE.', NULL, 574, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(925, 'The Secret Commonwealth', 'The-Secret-Commonwealth', 'http://books.google.com/books/content?id=C9gtzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=C9gtzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780241373354', 'From the author of the phenomenal His Dark Materials trilogy comes the next chapter in the story of Lyra Silvertongue . . . Lyra Silvertongue is now studying at St Sophia\'s College, Oxford, with her daemon Pantalaimon. They are not getting on. Lyra is questioning everything she once held dear. Pan misses the impulsiveness of their youth. When an act of terrible violence breaks the peace of the Oxford night, Lyra and Pan\'s relationship reaches a crisis and they are drawn, far from home, into the dangerous factions of a world they had no idea existed. The Secret Commonwealth is truly a book for our times; a powerful adventure and a thought-provoking look at what it is to understand yourself, to grow up and make sense of the world around you. This is storytelling at its very best from one of our greatest writers. *The first book in The Book of Dust trilogy, La Belle Sauvage, is coming to the stage in the summer of this year. Performed at The Bridge Theatre from July 2020, it will be a theatrical spectacle not to be missed* _____ Reviews for The Secret Commonwealth: The Book of Dust Volume Two: \"[Pullman] has created a fantasy world, made yet more satisfying in rigour and stylistic elegance. This is a book for getting older with\" Guardian, Book of the Week \"The Secret Commonwealth is ablaze with light and life. The writing is exquisite; every sentence sings ... To read Pullman is to experience the world refreshed, aglow, in Technicolour\" i \"Pullman\'s story is still thought-provoking ... This book elegantly weaves in live issues, from Europe\'s refugee crisis to facts in the post-truth era. And Pullman\'s prose is rewarding as ever\" The Times \"A long, taxing, complex journey, laced with beauty, terror and philosophy\" Metro \"As ever, Pullman\'s story is complex and vast but home to some of the finest storytelling in the 21st century. Revel in whole new worlds and enjoy one of literature\'s most wonderful heroines before she comes to HBO and the BBC\" Stylist \"Pullman is confronting readers with the horrors of our own world reflected back at us. In The Secret Commonwealth he creates a fearful symmetry\" The Herald', NULL, 575, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(926, 'Contagion', 'Contagion', 'http://books.google.com/books/content?id=nfnKDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nfnKDAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408341728', 'Don\'t miss this startling first book in a breathtaking new trilogy from Teri Terry, queen of the YA psychological thriller and author of the bestselling Slated trilogy! URGENT! An epidemic is sweeping the country. You are among the infected. There is no cure; and you cannot be permitted to infect others. You are now under quarantine. The 5% of the infected who survive are dangerous and will be taken into the custody of the army. Young runaway Callie survived the disease, but not the so-called treatment. Her brother Kai is still looking for her. And his new friend Shay may hold the keyto uncovering what truly happened. From the author of the international sensation Slated comes the first book in a powerful new story of survival and transformation; love and power.', NULL, 576, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(927, 'The Handmaid\'s Tale', 'The-Handmaid\'s-Tale', 'http://books.google.com/books/content?id=9ok6MQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9ok6MQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781784873189', 'NOW A SMASH-HIT CHANNEL 4 TV SERIES WITH A NEW INTRODUCTION FROM MARGARET ATWOOD The Republic of Gilead offers Offred only one function- to breed. If she deviates, she will, like dissenters, be hanged at the wall or sent out to die slowly of radiation sickness. But even a repressive state cannot obliterate desire - neither Offred\'s nor that of the two men on which her future hangs. Brilliantly conceived and executed, this powerful vision of the future gives full rein to Margaret Atwood\'s irony, wit and astute perception.', NULL, 189, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(928, 'The Undercover Economist', 'The-Undercover-Economist', '', '', '9780349119854', 'Who makes most money from the demand for cappuccinos early in the morning at Waterloo Station? Why is it impossible to get a foot on the property ladder? How does the Mafia make money from laundries when street gangs pushing drugs don\'t? Who really benefits from immigration? How can China, in just fifty years, go from the world\'s worst famine to one of the greatest economic revolutions of all time, lifting a million people out of poverty a month? Looking at familiar situations in unfamiliar ways, THE UNDERCOVER ECONOMIST is a fresh explanation of the fundamental principles of the modern economy, illuminated by examples from the streets of London to the booming skyscrapers of Shanghai to the sleepy canals of Bruges. Leaving behind textbook jargon and equations, Tim Harford will reveal the games of signals and negotiations, contests of strength and battles of wit that drive not only the economy at large but the everyday choices we make.', NULL, 577, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(929, 'Me', 'Me-9781509853342', 'http://books.google.com/books/content?id=7Ie_zQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=7Ie_zQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781509853342', 'The Sunday Times bestseller with a new chapter bringing the story up to date. \'The rock memoir of the decade\' Daily Mail \'The rock star\'s gloriously entertaining and candid memoir is a gift to the reader\' Sunday Times In his first and only official autobiography, music icon Elton John reveals the truth about his extraordinary life. Me is the the joyously funny, honest and moving story of the most enduringly successful singer/songwriter of all time. ______________ Christened Reginald Dwight, he was a shy boy with Buddy Holly glasses who grew up in the London suburb of Pinner and dreamed of becoming a pop star. By the age of twenty-three, he was performing his first gig in America, facing an astonished audience in his bright yellow dungarees, a star-spangled T-shirt and boots with wings. Elton John had arrived and the music world would never be the same again. His life has been full of drama, from the early rejection of his work with songwriting partner Bernie Taupin to spinning out of control as a chart-topping superstar; from half-heartedly trying to drown himself in his LA swimming pool to disco-dancing with the Queen; from friendships with John Lennon, Freddie Mercury and George Michael to setting up his AIDS Foundation. All the while, Elton was hiding a drug addiction that would grip him for over a decade. In Me Elton also writes powerfully about getting clean and changing his life, about finding love with David Furnish and becoming a father. In a voice that is warm, humble and open, this is Elton on his music and his relationships, his passions and his mistakes. This is a story that will stay with you, by a living legend. ______________ \'Self-deprecating, funny . . . You cannot help but enjoy his company throughout, temper tantrums and all\' The Times \'Racy, pacy and crammed with scurrilous anecdotes - what more could you ask from the rocket man\' Guardian (Book of the Week) \'Chatty, gossipy, amusing and at times brutally candid\' Telegraph', NULL, 544, 1, NULL, 100.00, NULL, '2021-03-05 23:32:25', '2021-03-05 23:32:25'),
(930, 'Making a Psychopath', 'Making-a-Psychopath', 'http://books.google.com/books/content?id=cqlJyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=cqlJyQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529106541', 'The closest you can get to the most dangerous minds. Find out what truly makes a psychopath, from the leading expert who helped to create Killing Eve\'s Villanelle. Dr Mark Freestone has worked on some of the most interesting, infamous and disturbing psychopath cases of recent times and is now sharing his phenomenal insight. Danny \'the Borderline\' switches from grandiosity to rage to despair within minutes and killed his defenceless friend without explanation. Tony \'the Conman\' prefers charm, intimidation and sexual abuse over physical violence and once tried to dupe someone into buying the Eiffel Tower. Jason \'the Liar\' had a fantasy life that led to vicious murders around Europe and preys on those who see the good in people. Case by fascinating case, get to know seven of the most dangerous minds that Dr Freestone has encountered over the last 15 years; these are up close accounts of some of Britain\'s most psychopathic criminals, and what can happen if you fall victim to their supreme powers of manipulation. Exploring the many factors that make a psychopath, the complexities and contradictions of their emotions and behaviour, as well as an examination of how the lives of psychopaths develop inside and outside the institutions that are supposed to contain them, this book opens up a window into the world of those who operate in a void of human emotion ... and what can be done to control them. \'The psychiatrist who created Killing Eve\'s anti-heroine\' The Telegraph', NULL, 578, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(931, 'The Boy, the Mole, the Fox and the Horse', 'The-Boy,-the-Mole,-the-Fox-and-the-Horse', 'http://books.google.com/books/content?id=fX7hwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fX7hwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781529105100', 'The Sunday Times Bestseller and New York Times Bestseller. A book of hope for uncertain times. \'Feeling a little blue? Meet the new Winnie the Pooh.\' The Daily Mail \'A wonderful work of art and a wonderful window into the human heart\' Richard Curtis Enter the world of Charlie\'s four unlikely friends, discover their story and their most important life lessons. The conversations of the boy, the mole, the fox and the horse have been shared thousands of times online, recreated in school art classes, hung on hospital walls and turned into tattoos. In Charlie\'s first book, you will find his most-loved illustrations and some new ones too.', NULL, 579, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(932, 'Blood Orange', 'Blood-Orange', 'http://books.google.com/books/content?id=tZRewAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=tZRewAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781472252746', 'The incredibly gripping, must-read Sunday Times bestseller \'Utterly compelling... I couldn\'t put it down\' Lisa Jewell, No.1 bestselling author of The Family Upstairs \'A classy thriller with complex and compelling characters\' Clare Mackintosh, bestselling author of I Let You Go \'Fans of Apple Tree Yard and The Girl on the Train will love this\' Guardian \'Twists that keep you frantically turning the pages\' Sunday Mirror FIERCE, UNFLINCHING AND PROVOCATIVE, BLOOD ORANGE WILL HOLD YOU IN ITS GRIP UNTIL ITS FINAL, HEARTSTOPPING CONCLUSION. Alison has it all. A doting husband, adorable daughter, and a career on the rise - she\'s just been given her first murder case to defend. But all is never as it seems... Just one more night. Then I\'ll end it. Alison drinks too much. She\'s neglecting her family. And she\'s having an affair with a colleague whose taste for pushing boundaries may be more than she can handle. I did it. I killed him. I should be locked up. Alison\'s client doesn\'t deny that she stabbed her husband - she wants to plead guilty. And yet something about her story is deeply amiss. Saving this woman may be the first step to Alison saving herself. I\'m watching you. I know what you\'re doing. But someone knows Alison\'s secrets. Someone who wants to make her pay for what she\'s done, and who won\'t stop until she\'s lost everything.... BLOOD ORANGE IS: \'Gripping\' Daily Mail \'Sizzlingly addictive\' Heat \'Delicious and addictive - a perfectly crafted treat!\' Louise Candlish, author of Our House \'Glittering and fierce . . . a glorious bonfire of a marriage thriller\' Irish Times', NULL, 580, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(933, 'The Explorer', 'The-Explorer', 'http://books.google.com/books/content?id=KDrpswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=KDrpswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781408882191', 'Left stranded in the Amazon jungle when their plane crashes on their way back to England from Manaus, Brazil, four children struggle to survive for days until one of them finds a map that leads them to a ruined city and a secret hidden among the vines.', NULL, 581, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(934, 'A Sprinkle of Sorcery', 'A-Sprinkle-of-Sorcery', 'http://books.google.com/books/content?id=L46dxwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=L46dxwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471183867', 'The eagerly anticipated sequel to A Pinch of Magic, the runaway bestseller from Michelle Harrison', NULL, 65, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(935, 'A Pinch of Magic', 'A-Pinch-of-Magic', 'http://books.google.com/books/content?id=I_5QawEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=I_5QawEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471124297', '\'A SPELLBINDING STORY, STEEPED IN MAGIC. I ADORED IT\' - Abi Elphinstone, author of Sky Song Three sisters trapped by an ancient curse. Three magical objects with the power to change their fate. Will they be enough to break the curse? Or will they lead the sisters even deeper into danger? ... The enchanting new story from Michelle Harrison, author of the bestselling THIRTEEN TREASURES trilogy Praise for A PINCH OF MAGIC: \'BRILLIANT\' Emma Carroll, author of Letters From The Lighthouse \'This delightful tale fizzes with magic and races along at a fantastic pace. This book completely charmed my socks off!\' Alex Bell, author of The Polar Bear Explorers\' Club \'Simply phenomenal! A breathtaking quest for survival and freedom, bursting with brave heroines, enchanted objects and deadly dangers. And at its heart is a powerful and beautiful message of sisterly love and loyalty overcoming jealousy and betrayal\' Sophie Anderson, author of The House With Chicken Legs \'What a glorious book this is! I was utterly captivated by the Widdershins sisters\' Lisa Thompson, author of The Goldfish Boy \'Take three sisters, add the cruelest of curses and a pinch of magic, and you\'ll have a tantalising tale you cannot put down\' Tamsyn Murray, author of Completely Cassidy \'Gutsy and rude, full of warts-and-all family love, Harrison\'s latest has the wry enchantment of an E Nesbit classic\'Guardian \'A fabulous magical adventure\' Sunday Express \'Fantasy and adventure appear on every page of this spellbinding tale\'The Daily Mail', NULL, 65, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(936, 'Queen of Air and Darkness', 'Queen-of-Air-and-Darkness', 'http://books.google.com/books/content?id=VVCvvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=VVCvvQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471116711', 'Dark secrets and forbidden love threaten the very survival of the Shadowhunters in Cassandra Clare\'s Queen of Air and Darkness, the final novel in the #1 New York Times and USA TODAY bestselling The Dark Artifices trilogy. Queen of Air and Darkness is a Shadowhunters novel. What if damnation is the price of true love? Innocent blood has been spilled on the steps of the Council Hall, the sacred stronghold of the Shadowhunters. In the wake of the tragic death of Livia Blackthorn, the Clave teeters on the brink of civil war. One fragment of the Blackthorn family flees to Los Angeles, seeking to discover the source of the disease that is destroying the race of warlocks. Meanwhile, Julian and Emma take desperate measures to put their forbidden love aside and undertake a perilous mission to Faerie to retrieve the Black Volume of the Dead. What they find in the Courts is a secret that may tear the Shadow World asunder and open a dark path into a future they could never have imagined. Caught in a race against time, Emma and Julian must save the world of Shadowhunters before the deadly power of the parabatai curse destroys them and everyone they love.', NULL, 64, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(937, 'Elites of Eden', 'Elites-of-Eden', 'http://books.google.com/books/content?id=5i4htQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=5i4htQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471177095', 'The thrilling sequel to Youtube superstar Joey Graceffa\'s New York Times #1 bestseller Children of Eden. Two girls, one destiny. Yarrow is an elite: rich, regal, destined for greatness. She\'s the daughter of one of the most powerful women in Eden. At the exclusive Oaks boarding school, she makes life miserable for anyone foolish enough to cross her. Her life is one wild party after another...until she meets a fascinating, lilac-haired girl named Lark. Meanwhile, there is Rowan, who has been either hiding or running all her life. As an illegal second child in a strictly regulated world, her very existence is a threat to society, punishable by death...or worse. After her father betrayed his family, and after her mother was killed by the government, Rowan discovered a whole city of people like herself. Safe in an underground sanctuary that also protected the last living tree on Earth, Rowan found friendship, and maybe more, in a fearless hero named Lachlan. But when she was captured by the government, her fate was uncertain. When these two girls discover the thread that binds them together, the collision of memories means that their lives may change drastically--and that Eden may never be the same. Perfect for fans of The Hunger Games, Divergent and Maxe Runner, you won\'t be able to put it down.', NULL, 582, 1, NULL, 100.00, NULL, '2021-03-05 23:32:26', '2021-03-05 23:32:26'),
(938, 'The Field of Swords', 'The-Field-of-Swords', 'http://books.google.com/books/content?id=2EdKuQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2EdKuQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007437146', 'The third volume in the acclaimed Emperor series, in which Conn Iggulden brilliantly interweaves history and adventure to recreate the astonishing life of Julius Caesar -- an epic tale of ambition and rivalry, bravery and betrayal, from an outstanding new voice in historical fiction.', NULL, 285, 1, NULL, 100.00, NULL, '2021-03-05 23:32:27', '2021-03-05 23:32:27'),
(939, 'The Night I Met Father Christmas', 'The-Night-I-Met-Father-Christmas', 'http://books.google.com/books/content?id=E5cAwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=E5cAwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471171543', '\'A gorgeous tale brimming with the magic of Christmas. A sheer delight for all kids both big AND small.\' Ruth Jones, award-winning writer and comedian Jackson has always wanted to meet Father Christmas. He knows all about the reindeer, he knows about the elves and the secret North Pole workshop, he knows about the magic that allows Father Christmas to deliver presents around the world in just one night, but there\'s one thing he doesn\'t know ... how did Father Christmas become Father Christmas? One Christmas Eve, Jackson\'s wish comes true and not only does he get to meet Father Christmas but he also hears his incredible story. So begins an enchanting fairy-tale journey into the world of Torvil - a mean-spirited and miserly elf who, on one magical night, discovers the true meaning of Christmas. This might not have been the story Jackson was expecting but, as Father Christmas tells him, no good story ever is... Get ready for a charming and magical story by actor and comedian Ben Miller with beautiful illustrations throughout from emerging talent Daniela Jaglenka Terrazzini, that will remind everyone of the true spirit of Christmas and prove once and for all that Father Christmas really does exist!', NULL, 583, 1, NULL, 100.00, NULL, '2021-03-05 23:32:27', '2021-03-05 23:32:27'),
(940, 'And the Stars Were Burning Brightly', 'And-the-Stars-Were-Burning-Brightly', 'http://books.google.com/books/content?id=2lejxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=2lejxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471178771', '\'An outstanding and compassionate debut\' Patrice Lawrence \'An utter page turner from a storming new talent. Passionate, committed and shines a ray of light into the darkest places - the YA novel of 2020!\' Melvin Burgess \'One of the brightest up and coming stars of the YA world\' Alex Wheatle When fifteen-year-old Nathan discovers that his older brother Al, has taken his own life, his whole world is torn apart. Al was special. Al was talented. Al had so many dreams ... so why did he do it? Convinced that his brother was in trouble, Nathan decides to retrace Al\'s footsteps. As he does, he meets Megan, Al\'s former classmate, who is as determined as Nathan to keep Al\'s memory alive. Together they start seeking answers, but will either of them be able to handle the truth about Al\'s death when they eventually discover what happened? An extraordinary novel about loss, understanding and the importance of speaking up when all you want to do is shut down, from an incredible new talent, perfect for fans of Angie Thomas, Gayle Foreman, Jennifer Niven and Nikesh Shukla. #BurnBright Warning - this novel contains themes that some readers may find upsetting, including suicide and intense bullying.', NULL, 584, 1, NULL, 100.00, NULL, '2021-03-05 23:32:27', '2021-03-05 23:32:27'),
(941, 'Yes No Maybe So', 'Yes-No-Maybe-So', 'http://books.google.com/books/content?id=mdJAxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=mdJAxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471184666', 'From New York Times bestselling authors Becky Albertalli and Aisha Saeed comes a heart-warming, hilarious story about the power of love and resistance. Jamie Goldberg is cool with volunteering for his local state candidate - as long as he\'s behind the scenes. There\'s no way he\'d ever knock on doors to ask people for their votes...until he meets Maya. Maya Rehman\'s having the worst Ramadan ever. Her best friend is too busy to hang out, her summer trip is cancelled, her parents are separating and now her mother thinks the solution to her problems is political canvassing - with some awkward guy she hardly knows ... Going door to door isn\'t exactly glamorous, but maybe it\'s not the worst thing in the world. After all, the polls are getting closer - and so are Maya and Jamie. Mastering local activism is one thing. Navigating the cross-cultural romance of the century is another thing entirely.', NULL, 585, 1, NULL, 100.00, NULL, '2021-03-05 23:32:27', '2021-03-05 23:32:27'),
(942, 'A Beautiful Wedding', 'A-Beautiful-Wedding', 'http://books.google.com/books/content?id=stpwngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=stpwngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471133565', 'Ever wished you could delve a little deeper into your favourite character\'s life? Now you can travel back in time and relive something old and something new… Our favourite bad boy, Travis Maddox, is in serious trouble… Will he be held responsible for the fire that ravaged the underground fight scene? Abby Abernathy will do whatever it takes to keep Travis safe, no matter how crazy… even if it means returning to Vegas. Will Abby and Travis get their happily ever after, or will the City of Sin suck them back in… In this spectacular novella, Jamie McGuire will whisk you off on a rollercoaster ride of emotions that will make you fall in love all over again.', NULL, 240, 1, NULL, 100.00, NULL, '2021-03-05 23:32:27', '2021-03-05 23:32:27'),
(943, 'Beautiful Stranger', 'Beautiful-Stranger', 'http://books.google.com/books/content?id=c28r6aOevhAC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=c28r6aOevhAC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781476731537', 'Financial consultant Sara Dillon moves to New York City and, hoping for a causual encounter, meets British playboy Max Stella at a dance club, as they embark on a tumultuous affair that leaves Max wondering if he has met his match.', NULL, 586, 1, NULL, 100.00, NULL, '2021-03-05 23:32:28', '2021-03-05 23:32:28'),
(944, 'Beautiful Bastard', 'Beautiful-Bastard', 'http://books.google.com/books/content?id=xYwrAQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xYwrAQAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781476730097', 'A rewritten formal publication of the popular online story, The Office, traces the love affair between exacting office manager Bennett and his hard-working MBA student assistant, Chloe, whose irresistible mutual attraction prompts them to break office dating restrictions in spite of their clashing personalities. By the authors of A Little Crazy. Original.', NULL, 586, 1, NULL, 100.00, NULL, '2021-03-05 23:32:28', '2021-03-05 23:32:28'),
(945, 'Dirty Rowdy Thing', 'Dirty-Rowdy-Thing', 'http://books.google.com/books/content?id=_DobBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=_DobBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781476777962', 'Unlike her best friends Mia and Lola, Harlow Vega has a reputation for always being up for a fling. Twelve drunk and wild hours in Sin City married to the ridiculously hot and rugged Canadian fisherman Finn Roberts, who (no surprise) is amazing with his muscular hands - and his lips and the rest of his body - was just her speed. But it was just a thing: dirty, rowdy, and easy... until Finn turns up in her hometown on business. Harlow\'s not ready to be tied down but when the whole crew is handing out together, there\'s just something about him. It may not be love (hell, it may not even be like), but their exciting, tension-filled hookups provide the perfect distraction from the scary life changes they\'re both facing - challenges neither is sure how to handle, let alone fix. One night together turns into two, and soon Finn\'s mysterious business trip has gone on for weeks. They agreed on the sex-wild, wet, kinky-but now their bordercrossing booty call is starting to feel like the real deal. And for two people used to being in control, taking the ultimate plunge by faling in love feels a lot more like flat-out falling.', NULL, 586, 1, NULL, 100.00, NULL, '2021-03-05 23:32:28', '2021-03-05 23:32:28'),
(946, 'Dark Wild Night', 'Dark-Wild-Night', 'http://books.google.com/books/content?id=iDqFCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=iDqFCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781476777948', 'Book 3 in the Wild Seasons series that began with New York Times bestseller Sweet Filthy Boy. When three besties meet three hot guys in Vegas, anything could-and does-happen. Moving from college into the real world has never been so crazy . . . or fun. Let the Wild Seasons begin. In Dark Wild Night, now that they\'re only friends, kissing Lola is all Oliver can think about. Trying to forget her with a wild, anonymous hookup, he\'s simultaneously thrilled and torn: Is this his chance to get over her? Or will this new stranger only pull him in deeper?', NULL, 586, 1, NULL, 100.00, NULL, '2021-03-05 23:32:28', '2021-03-05 23:32:28'),
(947, 'The Unexpected Everything', 'The-Unexpected-Everything', 'http://books.google.com/books/content?id=-lUvjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-lUvjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471146145', 'Andie has a plan and she always sticks to the plan. Future? A top tier medical school. Dad? Avoid as much as possible (which isn\'t that hard considering he\'s a Congressman and never around). Friends? Palmer, Bri, and Toby - pretty much the most awesome people on the planet, who needs anyone else? Relationships? No one\'s worth more than three weeks. So it\'s no surprise she\'s got her summer all planned out too. Until a political scandal cancels her summer pre-med internship, and lands both her and Dad back in the same house for the first time in years. Suddenly she\'s doing things that aren\'t Andie at all - working as a dog walker, doing an epic scavenger hunt with her dad and maybe, just maybe, letting the super cute Clark in closer than expected. Palmer, Bri and Toby tell her to embrace all the chaos, but here\'s the thing ... can she?', NULL, 587, 1, NULL, 100.00, NULL, '2021-03-05 23:32:28', '2021-03-05 23:32:28'),
(948, 'Ugly Love', 'Ugly-Love', 'http://books.google.com/books/content?id=yrX3ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yrX3ngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471136726', 'When Tate Collins meets airline pilot Miles Archer, it isn\'t love at first sight. They wouldn\'t even go so far as to consider themselves friends. The only thing Tate and Miles have in common is an undeniable mutual attraction. Once their desires are out in the open, they realize they have the perfect set-up. He doesn\'t want love, she doesn\'t have time for love, so that just leaves the sex. Their arrangement could be surprisingly seamless, as long as Tate can stick to the only two rules, Miles has for her. Never ask about the past. Don\'t expect a future. They think they can handle it, but realize almost immediately they can\'t handle it at all. Hearts get infiltrated. Promises get broken. Rules get shattered. Love gets ugly.', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:32:29', '2021-03-05 23:32:29'),
(949, 'Maybe Someday', 'Maybe-Someday', 'http://books.google.com/books/content?id=NOLqngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NOLqngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471135514', 'Contains exclusive content: songs from Griffin Peterson Sydney is living in an idyllic bubble - she\'s a dedicated student with a steady job on the side. She lives with her best friend, has a great boyfriend, and the music coming from the balcony opposite hers is fast becoming the soundtrack to her life. But when Sydney finds out her boyfriend is cheating on her, the bubble bursts. The mysterious and attractive man behind the music, Ridge, gives Sydney hope that she can move on and they begin to write songs together. But moving on is harder than she expects, Sydney can only hope…. Maybe someday… Colleen Hoover draws you in to this passionate tale of music, love and betrayal…', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:32:29', '2021-03-05 23:32:29'),
(950, 'Scars Like Wings', 'Scars-Like-Wings', 'http://books.google.com/books/content?id=NFAwwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NFAwwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471179693', 'The YA answer to WONDER - this is an unforgettable story of hope and finding light in the darkness.', NULL, 588, 1, NULL, 100.00, NULL, '2021-03-05 23:32:29', '2021-03-05 23:32:29'),
(951, 'Hex Your Ex', 'Hex-Your-Ex', 'http://books.google.com/books/content?id=jpZ5DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=jpZ5DwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781507209967', '100 edgy spells and rituals to help you get what you want—whether it’s money, love, revenge, happiness, or whatever else your heart desires. It’s time to get what you want on your own terms. From making more money, righting wrongs, getting revenge, and finding much-deserved happiness, the magick in Hex Your Ex can help you accomplish everything you want—your way. Learn how to practice magick safely and properly, and use what you’ve learned to better yourself and your life. With over 100 spells, rituals, and hexes, such as a magick balm to heal a broken heart, a spell to stop a cheating lover, a potion for quick cash, a freedom from fear ritual, and even a spell for sweet dreams—plus many more! Each spell, charm, or ritual is specially created to help you achieve your goals, no matter what they may be. With tips on when to cast each spell, what kind of props to use to make spells extra potent, and more, you’ll be living the life of your dreams faster than you can say Abracadabra!', NULL, 117, 1, NULL, 100.00, NULL, '2021-03-05 23:32:30', '2021-03-05 23:32:30'),
(952, 'It Ends with Us', 'It-Ends-with-Us', 'http://books.google.com/books/content?id=j0zpjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=j0zpjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471156267', 'SOMETIMES THE ONE WHO LOVES YOU IS THE ONE WHO HURTS YOU THE MOST. Lily hasn\'t always had it easy, but that\'s never stopped her from working hard for the life she wants. She\'s come a long way from the small town in Maine where she grew up - she graduated from college, moved to Boston, and started her own business. So when she feels a spark with a gorgeous neurosurgeon named Ryle Kincaid, everything in Lily\'s life suddenly seems almost too good to be true. Ryle is assertive, stubborn, maybe even a little arrogant. He\'s also sensitive, brilliant, and has a total soft spot for Lily, but Ryle\'s complete aversion to relationships is disturbing. As questions about her new relationship overwhelm her, so do thoughts of Atlas Corrigan - her first love and a link to the past she left behind. He was her kindred spirit, her protector. When Atlas suddenly reappears, everything Lily has built with Ryle is threatened. With this bold and deeply personal novel, Colleen Hoover delivers a heart-wrenching story that breaks exciting new ground for her as a writer. It Ends With Us is an unforgettable tale of love that comes at the ultimate price.', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:32:31', '2021-03-05 23:32:31');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(953, 'Since You\'ve Been Gone', 'Since-You\'ve-Been-Gone', 'http://books.google.com/books/content?id=thObngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=thObngEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471122668', 'A perfect summertime read for fans of John Green, Stephanie Perkins, and Sarah Dessen: It was Sloane who yanked Emily out of her shell and made life 100% interesting. But right before what should have been the most epic summer, Sloane just...disappears. All she leaves behind is a to-do list. On it, thirteen Sloane-inspired tasks that Emily would normally never try. But what if they could bring her best friend back? Apple picking at night? Okay, easy enough. Dance until dawn? Sure. Why not? Kiss a stranger? Um... Emily now has this unexpected summer, and the help of Frank Porter (totally unexpected), to check things off Sloane\'s list. Who knows what she\'ll find? \'Some books leave a very real mark on you and Since You\'ve Been Gone is one of those utterly brilliant books\' - The Guardian \'A winning blend of touching moments, memorable characters and situational humor takes readers to a surprising revelation at the story\'s end.\' - Kirkus Reviews \'Morgan Matson is the epitome of YA contemporary.\' - Ariel Bissett, Booktuber and blogger', NULL, 587, 1, NULL, 100.00, NULL, '2021-03-05 23:32:31', '2021-03-05 23:32:31'),
(954, 'Slammed', 'Slammed', 'http://books.google.com/books/content?id=Yx0UMQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Yx0UMQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471125676', 'The New York Times bestselling sensation hits the UK. Layken\'s father died suddenly, leaving her to gather every ounce of strength to be a pillar for her family, in order to prevent their world from falling apart. Now her life is taking another unexpected turn… Layken\'s mother gets a job which leads to an unwanted move across country. However, a new home means new neighbours… and Layken\'s new neighbour is the very attractive Will Cooper. Will has an intriguing passion for slam poetry, and a matching passion for life. The two feel an irresistible attraction but are rocked to the core when a shocking revelation brings their romance to a screeching halt. Layken and Will must find a way to fight the forces that threaten to tear them apart… or learn to live without each other. Praise for Colleen Hoover: \'Brilliant and entertaining\' - JAMIE MCGUIRE, New York Times bestselling author of Beautiful Disaster \'This book will consume you - rip out your heart and piece it back together. I absolutely loved it!\' - Paige Toon, author of One Perfect Summer \'Unique, unlike anything out there... Go out and read it already!\' - TAMARA WEBBER, New York Times bestselling author of Easy', NULL, 147, 1, NULL, 100.00, NULL, '2021-03-05 23:32:31', '2021-03-05 23:32:31'),
(955, 'Girls Who Changed the World', 'Girls-Who-Changed-the-World', 'http://books.google.com/books/content?id=sXintAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=sXintAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471174919', 'Going after you dream doesn\'t have to wait - be empowered by these incredible women and start changing the world now. From the inspiring author of Girls Who Rocked the World comes another comprehensive collection of true, inspiring profiles of successful young women throughout history who made their mark on the world before turning twenty. Young women today crave strong, independent role models to look to for motivation. Girls Who Changed the World offers a fun and uplifting collection of influential stories with forty-five more movers and shakers who made a difference early on in life. From Cleopatra to Mindy Kaling, and Aretha Franklin to Emma Watson - each with her own incredible story of how she created life-changing opportunities for herself and the world - you\'ll get to know these capable queens of empires and courageous icons of entertainment. Also included are profiles of gutsy teenagers who are out there rocking the world right now and personal aspirations from today\'s young women.', NULL, 179, 1, NULL, 100.00, NULL, '2021-03-05 23:32:31', '2021-03-05 23:32:31'),
(956, 'What Happened', 'What-Happened-9781471166969', 'http://books.google.com/books/content?id=42PcvAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=42PcvAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471166969', 'The Sunday Times Number One Bestseller Complete with new afterword where she discusses the past eighteen months since President Donald Trump has been serving in office. \'A compelling read\' - Financial Times \'A sporadically absorbing, pleasingly vengeful and often darkly funny account of one woman\'s bid for presidential history.\' Sunday Times \'Her new book is more gossipy, it is meaner, more entertaining and more wrong-headed than anything she or her speechwriters have written before.\' Observer \'What Happened is highly entertaining. It is spirited, well-written and informative.\' Guardian \'In the past, for reasons I try to explain, I\'ve often felt I had to be careful in public, like I was up on a wire without a net. Now I\'m letting my guard down.\' - Hillary Rodham Clinton, from the introduction of What Happened For the first time, Hillary Rodham Clinton reveals what she was thinking and feeling during one of the most controversial and unpredictable presidential elections in history. Now free from the constraints of running, Hillary takes you inside the intense personal experience of becoming the first woman nominated for president by a major party in an election marked by rage, sexism, exhilarating highs and infuriating lows, stranger-than-fiction twists, Russian interference and an opponent who broke all the rules. This is her most personal memoir yet. In these pages, she describes what it was like to run against Donald Trump, the mistakes she made, how she has coped with a shocking and devastating loss, and how she found the strength to pick herself back up afterwards. With humour and candour, she tells readers what it took to get back on her feet - the rituals, relationships and reading that got her through, and what the experience has taught her about life. She speaks about the challenges of being a strong woman in the public eye, the criticism over her voice, age and appearance, and the double standard confronting women in politics. She lays out how the 2016 election was marked by an unprecedented assault on democracy by a foreign adversary. By analysing the evidence and connecting the dots, Hillary shows just how dangerous the forces are that shaped the outcome, and why Americans need to understand them to protect their values and democracy in the future. The election of 2016 was unprecedented and historic. What Happened is the story of that campaign and its aftermath - both a deeply intimate account and a cautionary tale.', NULL, 546, 1, NULL, 100.00, NULL, '2021-03-05 23:32:32', '2021-03-05 23:32:32'),
(957, 'Beautiful Bitch', 'Beautiful-Bitch', 'http://books.google.com/books/content?id=QjQoC1ogyhcC&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QjQoC1ogyhcC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781476754147', 'Chloe Mills and Bennett Ryan continue their love-hate relationship in a French villa.', NULL, 586, 1, NULL, 100.00, NULL, '2021-03-05 23:32:32', '2021-03-05 23:32:32'),
(958, 'Unrest', 'Unrest', 'http://books.google.com/books/content?id=N-d0tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=N-d0tAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471172205', '\'SPOOKY. GRIPPING AND INTRIGUING.\' Sophie McKenzie, author of Girl, Missing Seventeen-year-old Elliott hasn\'t slept properly for six months. Not since the accident that nearly killed him. Now he is afraid to go to sleep. Sometimes he wakes to find himself paralysed, unable to move a muscle, while shadowy figures move around him. Other times he is the one moving around, while his body lies asleep on the bed. According to his doctor, sleep paralysis and out of body experiences are harmless - but to Elliot they\'re terrifying. Convinced that his brush with death has opened up connections with the spirit world, Elliott secures a live-in job at one of England\'s most haunted locations, determined to find out the truth. There he finds Sebastian, the ghost of a long-dead servant boy hanged for stealing bread. He also meets the living, breathing Ophelia, a girl with secrets of her own. She and Elliott grow closer, but things take a terrifying turn when Elliott discovers Sebastian is occupying his body when he leaves it. And the more time Sebastian spends inhabiting a living body, the more resistant he becomes to giving it back. Worse, he seems to have an unhealthy interest in Ophelia. Unless Elliott can lay Sebastian\'s spirit to rest, he risks being possessed by him for ever, and losing the girl of his dreams... The brilliant, spine-tingling YA novel by award-winning author Michelle Harrison. \'Chilling\' The Bookseller \'I devoured Unrest.Or rather, I felt it devoured me. Clever, unexpected and satisfying.\' Kate Cann \'a beautifully written, gripping, thoroughly spooky young adult novel... Unsettling, eerie, with intriguing characters and a compelling, satisfying plot full of twists and turns... I loved it.\' Sarah Singleton \'It takes great skill to create an atmosphere that creeps off the page into your veins. Harrison\'s subtlety and eye for detail lift this above any other spookfest.\' The Independent', NULL, 65, 1, NULL, 100.00, NULL, '2021-03-05 23:32:32', '2021-03-05 23:32:32'),
(959, 'After', 'After', 'http://books.google.com/books/content?id=ExiNoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ExiNoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781501100192', 'Book One of the After series—the Internet sensation with millions of readers. Tessa didn’t plan on meeting H. during her freshman year of college. But now that she has, her life will never be the same.', NULL, 101, 1, NULL, 100.00, NULL, '2021-03-05 23:32:33', '2021-03-05 23:32:33'),
(960, 'Five Feet Apart', 'Five-Feet-Apart', 'http://books.google.com/books/content?id=Kf3mwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Kf3mwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471185090', 'Soon to be a major motion picture starring Cole Sprouse (Riverdale\'sJughead) and Haley Lu Richardson (The Edge of Seventeen and Recovery Road)! In this moving story that\'s perfect for fans of John Green\'s The Fault in Our Stars, two teens fall in love with just one minor complication - they can\'t get within a few feet of each other without risking their lives. Can you love someone you can never touch? Stella Grant likes to be in control - even though her totally out of control lungs have sent her in and out of the hospital most of her life. At this point, what Stella needs to control most is keeping herself away from anyone or anything that might pass along an infection and jeopardize the possibility of a lung transplant. Six feet apart. No exceptions. The only thing Will Newman wants to be in control of is getting out of this hospital. He couldn\'t care less about his treatments, or a fancy new clinical drug trial. Soon, he\'ll turn eighteen and then he\'ll be able to unplug all these machines and actually go see the world, not just its hospitals. Will\'s exactly what Stella needs to stay away from. If he so much as breathes on Stella she could lose her spot on the transplant list. Either one of them could die. The only way to stay alive is to stay apart. But suddenly six feet doesn\'t feel like safety. It feels like punishment. What if they could steal back just a little bit of the space their broken lungs have stolen from them? Would five feet apart really be so dangerous if it stops their hearts from breaking too?', NULL, 589, 1, NULL, 100.00, NULL, '2021-03-05 23:32:33', '2021-03-05 23:32:33'),
(961, 'Ashes to Ashes', 'Ashes-to-Ashes', 'http://books.google.com/books/content?id=88b8xwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=88b8xwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471191534', 'New Year\'s Eve ended with a bang and Mary, Kat and Lillia may not be prepared for what is to come. After Rennie\'s death, Kat and Lillia try to put the pieces together of what happened to her. They both blame themselves. If Lillia hadn\'t left with Reeve... If Kat had only stayed with Rennie. . . Things could have been different. Now they will never be the same. Only Mary knows the truth about that night. About what she is. She also knows the truth about Lillia and Reeve falling in love, about Reeve being happy when all he deserves is misery, just like the misery he caused her. Now their childish attempts at revenge are a thing of the past and Mary is out for blood. Will she leave anything in her wake or will all that remain be ashes?', NULL, 590, 1, NULL, 100.00, NULL, '2021-03-05 23:32:33', '2021-03-05 23:32:33'),
(962, 'Fire with Fire', 'Fire-with-Fire', 'http://books.google.com/books/content?id=QpMbyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=QpMbyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471191527', 'After the catastrophic events at the Homecoming Dance at the end of Burn for Burn, Lillia, Kat and Mary come face to face with the consequences of their actions - Reeve in the hospital. While Lillia and Kat begin to have reservations about moving forward with their revenge, Mary becomes convinced Reeve needs to get what is coming to him, no matter what. And as they agreed, each revenge plot needs to be completed. Lillia will make Reeve fall in love with her and then break his heart, just like he broke Mary\'s. But spending so much time with Reeve, pretending to fall for him, Lillia finds she her fake feelings start feeling very real. . . And as devoted as the girls are to seeing this through, their friendship starts to sag under the weight of their secrets. Is revenge really worth all of this?', NULL, 590, 1, NULL, 100.00, NULL, '2021-03-05 23:32:33', '2021-03-05 23:32:33'),
(963, 'How to Save a Life', 'How-to-Save-a-Life', 'http://books.google.com/books/content?id=89fFuwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=89fFuwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474958677', 'Ever since her dad died, Jill has drifted away from those she loves. Now her mom wants to adopt a baby, replacing their lost family member with a new one. And what¿s worse...the teenage mother, Mandy, is moving in with them before the birth. A remarkable story of what it means to be a family, and the many roads we can take to become one.', NULL, 591, 1, NULL, 100.00, NULL, '2021-03-05 23:32:34', '2021-03-05 23:32:34'),
(964, 'It Only Happens in the Movies', 'It-Only-Happens-in-the-Movies', 'http://books.google.com/books/content?id=hEKHnQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=hEKHnQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474921329', '', NULL, 243, 1, NULL, 100.00, NULL, '2021-03-05 23:32:34', '2021-03-05 23:32:34'),
(965, 'Moonlocket', 'Moonlocket', 'http://books.google.com/books/content?id=fmtAMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=fmtAMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474915014', '', NULL, 592, 1, NULL, 100.00, NULL, '2021-03-05 23:32:34', '2021-03-05 23:32:34'),
(966, 'How Hard Can Love Be?', 'How-Hard-Can-Love-Be?', 'http://books.google.com/books/content?id=bNs5jgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bNs5jgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781409591221', 'All Amber wants is a bit of love from her estranged mum. And she\'s hoping that a summer together at Mum\'s Californian kids\' camp will help patch up her shattered heart. But then she meets Prom King Kyle - and offers her heart up for breaking all over again. Even with BFFs Evie and Lottie\'s advice, Amber\'s finding love hard. Is it worth the fight?', NULL, 243, 1, NULL, 100.00, NULL, '2021-03-05 23:32:35', '2021-03-05 23:32:35'),
(967, 'Slay', 'Slay', 'http://books.google.com/books/content?id=NG7WtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=NG7WtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474932318', 'Meet SLAY ¿ SLAY do two things and they do them well: they play killer music and they slay killer demons. When Milly, the lonely daughter of a world-famous opera singer, arrives home to discover that her mum has been taken over by something very evil, she finds herself in mortal danger. But the last people she expects to rescue her are the hottest boy band on the planet¿ Enter SLAY: playing kickass gigs in the spotlight, and saving the world from demons in the shadows¿ Suddenly, Milly¿s on the road with JD, Tom, Niv, Zek and Connor, racing against the clock to stop the demons who killed her mum¿ One thing¿s for sure, it¿s going to be a hell of a show!', NULL, 593, 1, NULL, 100.00, NULL, '2021-03-05 23:32:35', '2021-03-05 23:32:35'),
(968, 'SLAY on Tour', 'SLAY-on-Tour', 'http://books.google.com/books/content?id=IhT1uwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=IhT1uwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474932325', 'SLAY are BACK¿and this time they¿re headed to Tokyo to track down another hellraising demon. When they¿re invited on tour with a super-cool band of holographic girls, SLAY find themselves whisked off around Japan ¿ until strange things start happening on their tour train. Suddenly it seems it¿s not just SLAY¿s fans following their every move¿', NULL, 593, 1, NULL, 100.00, NULL, '2021-03-05 23:32:36', '2021-03-05 23:32:36'),
(969, 'The Extinction Trials', 'The-Extinction-Trials', 'http://books.google.com/books/content?id=kLbLAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kLbLAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474927345', 'Stormchaser wants to escape her starved, grey life. Lincoln wants to save his dying sister. Their only chance is to join an expedition to a deadly country to steal the eggs of vicious dinosaurs. If they succeed, their reward is a new life filled with riches. But in a land full of monsters - both human and reptilian - only the ruthless will survive. Jurassic Park meets The Hunger Games in this epic new series.', NULL, 594, 1, NULL, 100.00, NULL, '2021-03-05 23:32:36', '2021-03-05 23:32:36'),
(970, 'The Extinction Trials', 'The-Extinction-Trials-9781474954860', 'http://books.google.com/books/content?id=nX9ruwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=nX9ruwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781474954860', 'Betrayal. Sacrifice. Survival. Welcome to The Extinction Trials. Storm and Lincoln\'s city is burning. The people are starving. The only place left to run is Piloria, the continent of monsters. It\'s up to Storm and Lincoln to keep their people alive as they colonize this lethal paradise. But will the biggest threat to their survival be the monsters in the jungle...or the ones inside the encampment with them? The Hunger Games meets Jurassic Park in this wildly popular series filled with action, survival and betrayal.', NULL, 595, 1, NULL, 100.00, NULL, '2021-03-05 23:32:36', '2021-03-05 23:32:36'),
(971, 'Beneath a Scarlet Sky', 'Beneath-a-Scarlet-Sky', 'http://books.google.com/books/content?id=vKsbvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=vKsbvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781503943377', 'A cloth bag containing six copies of the title, that may also include a folder.', NULL, 596, 1, NULL, 100.00, NULL, '2021-03-05 23:32:37', '2021-03-05 23:32:37'),
(972, 'Trial by Fire', 'Trial-by-Fire', 'http://books.google.com/books/content?id=pTfRbwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=pTfRbwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857380784', 'At seventeen, Bryn is has the usual schoolgirl worries: a new boyfriend, a new school and a new home. But she has one major concern that her friends don\'t have: she is an alpha - a human girl in charge of her own werewolf pack. When Bryn and her closest friends, Dev and Lake, broke from the werewolf Callum\'s pack, it had all felt right. Together with Chase, Bryn\'s new love, they had rescued some newly made female werewolves from a despicable master and established their own pack, with Bryn as leader. Yet Bryn has always resented the rules of Pack life - the constant bowing to authority, the submission to the alpha. And she is determined to live differently, to run this pack openly and justly. Then one night, a badly beaten werewolf shows up on her territory. He needs help, sanctuary, care. But taking him in could violate inter-pack rules, and no one knows better than Bryn the costs of challenging those rules. Obedience is law in Pack life, but Bryn is going to break the rules, again.', NULL, 597, 1, NULL, 100.00, NULL, '2021-03-05 23:32:37', '2021-03-05 23:32:37'),
(973, 'From Sand and Ash', 'From-Sand-and-Ash', 'http://books.google.com/books/content?id=B1L-jwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=B1L-jwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781503939325', 'Italy, 1943--Germany occupies much of the country, placing the Jewish population in grave danger during World War II. As children, Eva Rosselli and Angelo Bianco were raised like family but divided by circumstance and religion. As the years go by, the two find themselves falling in love. But the church calls to Angelo and, despite his deep feelings for Eva, he chooses the priesthood. Now, more than a decade later, Angelo is a Catholic priest and Eva is a woman with nowhere to turn. With the Gestapo closing in, Angelo hides Eva within the walls of a convent, where Eva discovers she is just one of many Jews being sheltered by the Catholic Church. But Eva can\'t quietly hide, waiting for deliverance, while Angelo risks everything to keep her safe. With the world at war and so many in need, Angelo and Eva face trial after trial, choice after agonizing choice, until fate and fortune finally collide, leaving them with the most difficult decision of all.', NULL, 598, 1, NULL, 100.00, NULL, '2021-03-05 23:32:37', '2021-03-05 23:32:37'),
(974, 'How to Read a Book', 'How-to-Read-a-Book', 'http://books.google.com/books/content?id=Xg-CBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Xg-CBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9780671212094', 'Analyzes the art of reading and suggests ways to approach literary works', NULL, 599, 1, NULL, 100.00, NULL, '2021-03-05 23:32:38', '2021-03-05 23:32:38'),
(975, 'Bombproof', 'Bombproof', 'http://books.google.com/books/content?id=14-oPQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=14-oPQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780751542042', 'Sami Macbeth is not a master criminal. He\'s not even a minor one. He\'s not a jewel thief. He\'s not a safe-cracker. He\'s not an expert in explosives. Sami plays guitar and wants to be a rock god but keeps getting side-tracked by unforeseen circumstances. Fifty-four hours ago Sami was released from prison. Thirty-six hours ago he slept with the woman of his dreams at the Savoy. An hour ago his train blew up. Now he\'s carrying a rucksack through London\'s West End and has turned himself into the most wanted terrorist in the country. Fast, funny, hip and violent, Bombproof is a non-stop adventure full of unforgettable characters and a heart-warming hero - Sami Macbeth - a man with the uncanny ability to turn a desperate situation into a hopeless one.', NULL, 199, 1, NULL, 100.00, NULL, '2021-03-05 23:32:38', '2021-03-05 23:32:38'),
(976, 'Try Not to Breathe', 'Try-Not-to-Breathe', 'http://books.google.com/books/content?id=-IUOkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=-IUOkAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781782396703', '', NULL, 600, 1, NULL, 100.00, NULL, '2021-03-05 23:32:38', '2021-03-05 23:32:38'),
(977, 'Messenger', 'Messenger', 'http://books.google.com/books/content?id=ISnpoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ISnpoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780007597284', 'In this novel that unites characters from \"The Giver\" and \"Gathering Blue,\" Matty, a young member of a utopian community that values honesty, conceals an emerging healing power that he cannot explain or understand.', NULL, 601, 1, NULL, 100.00, NULL, '2021-03-05 23:32:38', '2021-03-05 23:32:38'),
(978, 'Darke', 'Darke', 'http://books.google.com/books/content?id=fQ37JYjaCAkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=fQ37JYjaCAkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781408806272', 'The Darkely brilliant, internationally bestselling, magical adventure, now in paperback with a stunning new look. Enter the world of Septimus Heap, Wizard Apprentice. Magic is his destiny', NULL, 150, 1, NULL, 100.00, NULL, '2021-03-05 23:32:38', '2021-03-05 23:32:38'),
(979, '365 Days of Wonder', '365-Days-of-Wonder', 'http://books.google.com/books/content?id=G0UcBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=G0UcBAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552572712', 'August Pullman stole the hearts of over a million readers in the bestselling, award-winning WONDER. 365 DAYS OF WONDER is a beautiful companion to the novel: a collection of quotes and wise words, one for every day of the year. It includes funny, insightful, inspiring thoughts from WONDER\'s fans, famous authors and personalities - from Roald Dahl and Paul McCartney to Anne Frank, Tolkien and Popeye - and from the novel itself. It\'s the perfect gift for anyone who loved WONDER, and it\'s a book to be treasured and enjoyed again and again.', NULL, 602, 1, NULL, 100.00, NULL, '2021-03-05 23:32:39', '2021-03-05 23:32:39'),
(980, 'The Boy at the Top of the Mountain', 'The-Boy-at-the-Top-of-the-Mountain', 'http://books.google.com/books/content?id=bedlDAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=bedlDAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780552573504', 'When Pierrot becomes an orphan, he must leave his home in Paris for a new life with his Aunt Beatrix, a servant in a wealthy household at the top of the German mountains. But this is no ordinary time, for it is 1935 and the Second World War is fast approaching; and this is no ordinary house, for this is the Berghof, the home of Adolf Hitler. Quickly, Pierrot is taken under Hitler\'s wing, and is thrown into an increasingly dangerous new world: a world of terror, secrets and betrayal, from which he may never be able to escape.', NULL, 603, 1, NULL, 100.00, NULL, '2021-03-05 23:32:39', '2021-03-05 23:32:39'),
(981, 'A Date with Fate', 'A-Date-with-Fate', 'http://books.google.com/books/content?id=F3DtnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=F3DtnQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781407140490', 'Life, love and everything in between - gripping soap opera drama that will make teen readers desperate for more... Eve seems to have the perfect life, but she has a very big secret, one that\'s tearing her apart. What\'s happening to her? Ignoring her feelings, Eve decides to distract herself by throwing a party to end all parties. Little does she know that it will end with a tragedy that will make Eve realize that she has to take the biggest risk of her life and reveal the truth she\'s denied to herself, and everyone else, for so long.', NULL, 604, 1, NULL, 100.00, NULL, '2021-03-05 23:32:40', '2021-03-05 23:32:40'),
(982, 'Crush It!', 'Crush-It!', 'http://books.google.com/books/content?id=uL8UmwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=uL8UmwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780062295026', 'Do you have a hobby you wish you could indulge in all day? An obsession that keeps you up at night? Now is the perfect time to take that passion and make a living doing what you love. In Crush It! Why NOW Is the Time to Cash In on Your Passion, Gary Vaynerchuk shows you how to use the power of the Internet to turn your real interests into real businesses. Gary spent years building his family business from a local wine shop into a national industry leader. Then one day he turned on a video camera, and by using the secrets revealed here, transformed his entire life and earning potential by building his personal brand. By the end of this book, readers will have learned how to harness the power of the Internet to make their entrepreneurial dreams come true. Step by step, Crush It! is the ultimate driver’s manual for modern business.', NULL, 40, 1, NULL, 100.00, NULL, '2021-03-05 23:32:40', '2021-03-05 23:32:40'),
(983, 'More Power', 'More-Power', 'http://books.google.com/books/content?id=xyhmAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xyhmAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008217808', 'The most successful Olympian you\'ve never heard of.... J�rgen Gr�bler\'s Olympic coaching career is one of legend, yet the man himself has remained resolutely out of the spotlight. Over the last twenty years he has masterminded British Rowing\'s incomparable success. And when the difference between gold and silver can mean mere fractions of a second, J�rgen Gr�bler, and his more power mantra, has achieved gloriously consistent victory. Arguably the greatest coach in British sporting history, Gr�bler\'s unparalleled record ranks him above national heroes such as Sir Alex Ferguson and Dave Brailsford, building champions such as Sir Steve Redgrave, Sir Matthew Pinsent and James Cracknell. This authoritative account of Gr�bler\'s career straddles the Iron Curtain, beginning in the German Democratic Republic, where systemic state-funded doping was an open secret, before crossing to Britain following the fall of the Berlin Wall. And whilst culture and sport have shifted dramatically over the last half century, Gr�bler\'s pursuit of greatness has never faltered. Written by Olympic medallist, Hugh Matheson, and rowing historian, Christopher Dodd, More Power is the unmissable story of one man\'s quest for glory, and sets out to unlock the secrets of J�rgen Gr�bler: the finest coach Olympic sport has ever seen.', NULL, 605, 1, NULL, 100.00, NULL, '2021-03-05 23:32:41', '2021-03-05 23:32:41'),
(984, 'How Full Is Your Bucket? Educator\'s Edition', 'How-Full-Is-Your-Bucket?-Educator\'s-Edition', 'http://books.google.com/books/content?id=pNpDCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=pNpDCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781595620019', 'In an inspirational handbook, the discoveries of Donald O. Clifton, the grandfather of positive psychology, show how the briefest interactions affect people\'s relationships, productivity, health, and longevity.', NULL, 606, 1, NULL, 100.00, NULL, '2021-03-05 23:32:41', '2021-03-05 23:32:41'),
(985, 'What to Expect When You\'re Expecting 5th Edition', 'What-to-Expect-When-You\'re-Expecting-5th-Edition', 'http://books.google.com/books/content?id=92DLswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=92DLswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471147531', 'With 18.5 million copies in print, What to Expect When You\'re Expecting is read by 93% of women who read a pregnancy book and was named one of the \'Most Influential Books of the Last 25 Years\' by USA Today. This cover-to-cover (including the cover!) new edition is filled with must-have information, advice, insight, and tips for a new generation of mums and dads. With What to Expect\'s trademark warmth, empathy, and humour, it answers every conceivable question expectant parents could have, including dozens of new ones based on the ever-changing pregnancy and birthing practices and choices they face. Advice for dads is fully integrated throughout the book. All medical coverage is completely updated, including the latest on prenatal screening and the safety of medications during pregnancy, as well as a brand-new section on postpartum birth control. Current lifestyle trends are incorporated, too: juice bars, raw diets, e-cigarettes, push presents, baby bump posting, the lowdown on omega-3 fatty acids, grass-fed and organic, health food fads, and GMOs. Plus expanded coverage of IVF pregnancy, multiple pregnancies, breastfeeding while pregnant, water and home births, and cesarean trends (including VBACs and \'gentle cesareans\').', NULL, 607, 1, NULL, 100.00, NULL, '2021-03-05 23:32:42', '2021-03-05 23:32:42'),
(986, 'Born to Build', 'Born-to-Build', 'http://books.google.com/books/content?id=ucodMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ucodMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781595621276', 'People will ask you throughout your life, “Where do you work?” and “What do you do?” They never ask you, “What are you building?” When conversations change to “What are you building?” the world will change. Written for anyone trying to figure out how to make the most of their lives, Born to Build seeks to inspire entrepreneurs and ambitious, self-motivated people to build something that will change the world. A builder’s venture could be a small business that grows into a mammoth enterprise, a thriving new division in an existing company, a nonprofit, a social enterprise, a church, a school — anything that creates economic growth and makes a lasting impact on society. Born to Build is written by Gallup Chairman and CEO Jim Clifton and Sangeeta Badal, Ph.D., Principal Scientist for Gallup’s Entrepreneurship and Job Creation initiative, and is grounded in years of research. This book goes beyond the conventional economics-based business training and instead offers a uniquely psychological approach to venture building. It gives readers the tools and techniques they need to understand who they are, what motivates them and what they can build — and how. By following the practical steps in Born to Build, readers will have the tools to build a sustainable and profitable venture of any size from scratch. Central to the book is a code that allows readers to take Gallup’s Builder Profile 10 (BP10) assessment, which identifies their innate talents and motivations and shows them how to make the most of their talents to build a successful enterprise.', NULL, 43, 1, NULL, 100.00, NULL, '2021-03-05 23:32:42', '2021-03-05 23:32:42'),
(987, 'Awaken the Giant Within', 'Awaken-the-Giant-Within', 'http://books.google.com/books/content?id=l5XBQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=l5XBQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780743409384', 'Are you in charge of your life? Or are you being swept away by things that are seemingly out of your control? In AWAKEN THE GIANT WITHIN, Anthony Robbins, the bestselling author of UNLIMITED POWER, shows the reader how to take immediate control of their mental, emotional, physical and financial destiny.', NULL, 267, 1, NULL, 100.00, NULL, '2021-03-05 23:32:42', '2021-03-05 23:32:42'),
(988, '7 Secrets to Investing Like Warren Buffett', '7-Secrets-to-Investing-Like-Warren-Buffett', 'http://books.google.com/books/content?id=0XVUxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=0XVUxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471188978', 'A complete guide for beginning investors who want to understand how to invest like Warren Buffett. This is one of the first books to showcase both Warren Buffett\'s Value Investing technique and his life skills and habits for beginning investors. Sustainable results often come from changes in lifestyle and habits; hence, the first section of the book discusses habits that one needs to adopt to be able to invest like Warren Buffett, and prepares readers for a lifelong journey of wealth building. The second section examines specific stock-picking techniques. The authors look at timeless principles as well as latest ideas on where to find great investment ideas, and share specific financial indicators they look for in a good investment. The authors explain valuation principles and techniques that help investors decide when to buy a stock. The techniques are inspired by investor and economist, Benjamin Graham, the \'father of value investing\', and are vastly different from the common Wall Street wisdom of trying to time the market. The final section of the book explains how the reader can build and track a portfolio of stocks. Authors encourage readers to follow Warren Buffett\'s first rule of investing \'Never Lose Money\', and explain three important steps that significantly lower risk: - Choose good stocks with low risk - Buy at a good price with margin of safety. - Diversify into a basket of stocks. Questionnaires, charts and graphs help explain techniques and habits simply.', NULL, 608, 1, NULL, 100.00, NULL, '2021-03-05 23:32:42', '2021-03-05 23:32:42'),
(989, 'The Speed of Trust', 'The-Speed-of-Trust', 'http://books.google.com/books/content?id=xZw7PgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=xZw7PgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780743295604', 'From Stephen R. Covey\'s eldest son come a revolutionary book that will guide business leaders, public figures and their organizations towards unprecedented productivity and satisfaction. Trust, says Stephen M. R. Covey, is the very basis of the 21st century\'s global economy, but its power is generally overlooked and misunderstood. Covey shows you how to inspire immediate trust in everyone you encounter - colleagues, constituents, the marketplace - allowing you to forego the time-killing and energy-draining check and balance bureaucracies that are so often relied upon in lieu of actual trust.', NULL, 609, 1, NULL, 100.00, NULL, '2021-03-05 23:32:43', '2021-03-05 23:32:43'),
(990, 'Emotional Detox for Anxiety', 'Emotional-Detox-for-Anxiety', 'http://books.google.com/books/content?id=cVTADwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=cVTADwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781507212103', 'Author and wellness expert Sherianna Boyle shows you how to C.L.E.A.N.S.E your anxieties, clearing a path for new positive habits, behaviors, and emotions. Most of us view a detox as a physical experience, but what we don’t realize is that it’s not just our physical bodies that need to be cleansed in order to return to a healthy state. When we’re unable to process our stress and worries, they can become toxic to ourselves and those around us. Wellness expert and author of Emotional Detox, Sherianna Boyle modifies the revolutionary C.L.E.A.N.S.E method to guide you through the 7 steps to a successful anxiety detox. The 7 steps include: Clear, Look Inward, Emit, Activate Joy, Nourish, Surrender, and Ease. Experiencing reactions to worries, stress, and doubt can put obstacles in our path to a happy and fulfilled life. An anxiety detox is a systematic and mindful way to purge these harmful thoughts. Once freed from this burden, an anxiety detox returns us to our joyful, carefree state. Emotional Detox for Anxiety is a reset for the soul, flushing out negative feelings, clearing a path for new habits and behaviors, and energizing you to accept peace, acceptance, and pure joy.', NULL, 610, 1, NULL, 100.00, NULL, '2021-03-05 23:32:43', '2021-03-05 23:32:43'),
(991, 'Emotional Detox', 'Emotional-Detox', 'http://books.google.com/books/content?id=kJZ5DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=kJZ5DwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781507210000', 'Flush out negativity and clear a path for new positive habits, behaviors, and emotions with certified energy healer, yoga instructor, and psychology professor Sherianna Boyle’s emotional detox program, C.L.E.A.N.S.E—as featured on YogaJournal.com. When we think of a detox, we usually think of a physical experience. But it’s not just our physical bodies that need to be cleansed of the impurities we encounter and absorb in our daily lives—it’s our minds too. When we find ourselves unable to process our negative emotions and feel them becoming toxic to ourselves and those around us, it’s time for an Emotional Detox, a mindful and systematic guide to freedom from these troublesome feelings. Wellness expert Sherianna Boyle has created the revolutionary the 7-step C.L.E.A.N.S.E. method to help you rid yourself of negativity, fear, worry, anger, and doubt, and guide you back toward a natural, energized state of pure joy and acceptance. Learn how to Clear your pathways, Look inward, Emit positivity, Activate, Nourish, Surrender, and Ease your way into your best self and a happier and healthier life. Emotional Detox “will wake you up, turn your views upside down, while providing you with life changing tools and insight” (Elizabeth Hamilton-Guarino, CEO of Best Ever You Network and author of Percolate).', NULL, 610, 1, NULL, 100.00, NULL, '2021-03-05 23:32:43', '2021-03-05 23:32:43'),
(992, 'Brain Hacks', 'Brain-Hacks', 'http://books.google.com/books/content?id=6bpJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=6bpJDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781507205723', 'Increase productivity. Boost cognitive function. Sharpen your focus. It\'s all possible with Brain Hacks! With more than 200 actionable tips and exercises you can use right away, Brain Hacks helps you achieve and maintain peak mental performance through easy hacks such as: Fight Free Radicals Flush The Toxins Notch Up The Niacin Learn A Language Count Your Breaths Get High On Endorphins …And many more! With straightforward, simple advice, Brain Hacks will teach you how to keep your brain sharp and functioning at optimal levels.', NULL, 117, 1, NULL, 100.00, NULL, '2021-03-05 23:32:44', '2021-03-05 23:32:44'),
(993, 'The Body Language of Politics', 'The-Body-Language-of-Politics', 'http://books.google.com/books/content?id=yNWTxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=yNWTxgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781510751200', 'Learn how to spot the lies and deceptions of our politicians in action. You can’t turn on the television, check your phone, or scroll through social media without being besieged with political headlines and the \"Who’s Who\" of today’s news. With so much spoon fed to us by the media, fake news, and from politicians themselves, it’s time to take the reins and control what you see, feel, and know so you can make informed political choices in our hot, political environment. In The Body Language of Politics, body language expert Dr. Donna Van Natten provides you with the tools and resources that you need to analyze movements of today\'s most notable politicians. She looks at some of the looming figures in our political landscape—Donald Trump, Hillary Clinton, Nancy Pelosi, Mitch McConnell, Chuck Schumer, and Alexandria Ocasio-Cortez, among others—and analyzes their physical behaviors, breaking down the lies and deceptions embedded in their everyday movements. Further, Dr. Van Natten challenges you to understand your own emotional biases towards certain politicians, and examine how that may skew your read of their body language. Finally, she confronts the gendered stereotypes that we often apply to our nation\'s leaders, examining how those labels play into our opinions of politicians. Clear and concise, and filled with expert knowledge, The Body Language of Politics will help you make an informed decision at the voting booth.', NULL, 611, 1, NULL, 100.00, NULL, '2021-03-05 23:32:44', '2021-03-05 23:32:44'),
(994, 'A Change Your Life One Day at a Time', 'A-Change-Your-Life-One-Day-at-a-Time', 'http://books.google.com/books/content?id=zGnFsgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zGnFsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781906761561', '\'Change Your Life One Day at a Time\' includes 365 practical and accessible pieces of advice that can be easily incorporated into everyday life. The book works on the principle that the cumulative effect of such simple changes and moments of awareness will enable noticeable, holistic improvement. Distributed evenly across four seasonal chapters, the entries cover nutrition, mind, relationships, physical environment, fitness and natural beauty - so everything from eating blueberries to watching a sunset. This book is here to help you realise how many lifestyle choices - the food you eat, the gestures you make, your pastimes, the way you think - are within your power to change for the better.', NULL, 612, 1, NULL, 100.00, NULL, '2021-03-05 23:32:44', '2021-03-05 23:32:44'),
(995, 'How to Talk So Teens Will Listen & Listen So Teens Will Talk', 'How-to-Talk-So-Teens-Will-Listen-&-Listen-So-Teens-Will-Talk', 'http://books.google.com/books/content?id=RYehAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=RYehAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781853408571', 'A guide to effective communication with teenagers. The authors share insights and suggestions on dealing with curfews, cliques, sex and drugs amongst others.', NULL, 613, 1, NULL, 100.00, NULL, '2021-03-05 23:32:44', '2021-03-05 23:32:44'),
(996, 'Building Strong Brands', 'Building-Strong-Brands', 'http://books.google.com/books/content?id=zDA6QQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zDA6QQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781849830409', 'As industries turn increasingly hostile, it is clear that strong brand-building skills are needed to survive and prosper. In David Aaker\'s pathbreaking book, MANAGING BRAND EQUITY, managers discovered the value of a brand as a strategic asset and a company\'s primary source of competitive advantage. Now, in this compelling new work, Aaker uses real brand-building cases from Saturn, General Electric, Kodak, Healthy Choice, McDonald\'s, and others to demonstrate how strong brands have been created and managed. A common pitfall of brand strategists is to focus on brand attributes. Aaker shows how to break out of the box by considering emotional and self-expressive benefits and by introducing the brand-as-person, brand-as-organisation, and brand-as-symbol perspectives. A second pitfall is to ignore the fact that individual brands are part of a larger system consisting of many intertwined and overlapping brands and subbrands. Aaker shows how to manage the \"brand system\" to achieve clarity and synergy, to adapt to a changing environment, and to leverage brand assets into new markets and products. As executives in a wide range of industries seek to prevent their products and services from becoming commodities, they are recommitting themselves to brands as a foundation of business strategy. This new work will be essential reading for the battle-ready.', NULL, 614, 1, NULL, 100.00, NULL, '2021-03-05 23:32:45', '2021-03-05 23:32:45');
INSERT INTO `products` (`id`, `title`, `slug`, `thumbnail`, `image`, `isbn`, `description`, `details`, `author_id`, `language_id`, `age_id`, `price`, `old_price`, `created_at`, `updated_at`) VALUES
(997, 'The Leader who Had No Title', 'The-Leader-who-Had-No-Title', 'http://books.google.com/books/content?id=3GEEkgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3GEEkgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781849833844', 'Robin Sharma believes there are certain skills and attitudes that allow you to rise to extraordinary success. In his powerful new parable, he offers a story designed to help people from all walks of life to achieve great things. Blake DiFranco is down on his luck, trying to make ends meet. His job is unsatisfying, and he is disenchanted with the world around him. One day, an enigmatic friend offers him a life-altering opportunity: spend a day studying with a mysterious group of teachers and learn the secrets of limitless success. The next morning, he embarks on a journey to discover the true meaning of the LWT philosophy - Lead Without a Title. He is ushered through the lessons of the four teachers: Anna, a maid who shows him that every job can be done with passion; Ty, a surfer who reminds him how important it is to rise to the riskiest challenges; Jackson, a former CEO who shows him the value of relationships; and Jet, a masseur who proves that greatness begins within. Blake\'s world changes as the teachers make him realize his own potential to achieve greater things than he\'d ever imagined. The book is packed with real-world lessons and inspiring exercises that will help any business person realize extraordinary results. Sharma distils over fifteen years of working with high-performers to deliver real-world strategies and foster a winning mindset. Here are formulas that will build success amidst times of deep change and will help readers to make positive changes both at work and at home.', NULL, 615, 1, NULL, 100.00, NULL, '2021-03-05 23:32:45', '2021-03-05 23:32:45'),
(998, 'Brand Leadership', 'Brand-Leadership', 'http://books.google.com/books/content?id=u2VfPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=u2VfPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781847398352', 'Management fads come and go in the blink of an eye, but branding is here to stay. Closely watched by the stock market and obsessed over by the biggest companies, brand identity is the one indisputable source of sustainable competitive advantage, the vital key to customer loyalty. David Aaker is widely recognised as the leading expert in this burgeoning field. Now he prepares managers for the next wave of the brand revolution. With coauthor Erich Joachimsthaler, Aaker takes brand management to the next level - strategic brand leadership. Required reading for every marketing manager is the authors\' conceptualisation of \'brand architecture\' - how multiple brands relate to each other - and their insights into the ever-changing area of Internet branding. Full of impeccable, intelligent guidance, Brand Leadership is the visionary key to business success in the future.', NULL, 614, 1, NULL, 100.00, NULL, '2021-03-05 23:32:45', '2021-03-05 23:32:45'),
(999, 'The Science of Getting Rich', 'The-Science-of-Getting-Rich', 'http://books.google.com/books/content?id=AACN1iHgoEUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=AACN1iHgoEUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781594772092', 'This is the 100-year-old book that inspired The Secret, Rhonda Byrne’s bestseller. The Science of Getting Rich shows how economic and emotional security can be achieved in a practical, imaginative, and noncompetitive way. By living in accordance with the positive principles outlined in this book we can find our rightful place in the cosmic scheme and grow in wealth, wisdom, and happiness.', NULL, 616, 1, NULL, 100.00, NULL, '2021-03-05 23:32:46', '2021-03-05 23:32:46'),
(1000, 'Think and Grow Rich', 'Think-and-Grow-Rich', 'http://books.google.com/books/content?id=iCXMDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=iCXMDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781906465599', 'The greatest motivational book of all time! Napoleon Hill\'s thirteen step programme will set you on the path to wealth and success. Think and Grow Rich reveals the money-making secrets of hundreds of America\'s most affluent people. By thinking like them, you can become like them. This powerful 1937 classic, with analysis from self-development authority Tom Butler-Bowdon, will continue to be read through the decades of economic boom and bust, proving that the magic formula for making money never changes.', NULL, 617, 1, NULL, 100.00, NULL, '2021-03-05 23:32:46', '2021-03-05 23:32:46'),
(1001, 'The Power of Your Subconscious Mind (revised)', 'The-Power-of-Your-Subconscious-Mind-(revised)', 'http://books.google.com/books/content?id=zYmxuAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=zYmxuAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471179396', 'NEW EDITION - Includes never-before-published commentary from the author The Power of Your Subconscious Mind introduces and explains the mind-focusing techniques that remove the subconscious obstacles that prevent us from achieving the success we want - and deserve. This authorised edition of Dr. Murphy\'s keystone work is the first premium mass market edition to feature additional commentary drawn from his unpublished writings. As practical as it is inspiring, Dr. Murphy\'s work demonstrates with real-life examples the way to unleash extraordinary mental powers to build self-confidence, create harmonious relationships, gain professional success, amass wealth, conquer fears and phobias, banish bad habits, and even to effect physical healing and promote overall wellbeing and happiness.', NULL, 618, 1, NULL, 100.00, NULL, '2021-03-05 23:32:46', '2021-03-05 23:32:46'),
(1002, 'Your Personal Horoscope 2021', 'Your-Personal-Horoscope-2021', 'http://books.google.com/books/content?id=XwsHzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=XwsHzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780008366308', 'Your complete one-volume guide to the year 2021. This fantastic and in-depth book includes month-by-month forecasts for every sign and all you need to know to find out what is in store for you in the year ahead. The only one-volume horoscope you\'ll ever need. Your essential guide to love, life and career success in 2021. This popular, complete one-volume guide contains all you need to know about your personal horoscope for the year 2021. Be prepared for the forthcoming year with monthly predictions for your own sign and discover how to maximise your opportunities and potential to make the most of 2021. This bestselling astrological guide contains: * A personality profile for each sign * A forecast for the year ahead - what you can expect in terms of wealth, home, health, social and love life * A month-by-month forecast of your best days and worst days - the ideal days to attract love, money or success, and when it\'s better to just stay in bed! Joseph Polansky is a leading US astrologer who has been practising astrology for over 20 years.', NULL, 619, 1, NULL, 100.00, NULL, '2021-03-05 23:32:47', '2021-03-05 23:32:47'),
(1003, 'How to Be a Psychic', 'How-to-Be-a-Psychic', 'http://books.google.com/books/content?id=c3l3DgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=c3l3DgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781507200612', 'Discover your innate psychic ability! Take control of your future with How to Be a Psychic. You\'ll start by learning how to tune in to the psychic ability you already have--but never knew how to access. After mastering these easy-to-follow instructions on how to hone the sensitivity of your senses, you\'ll move on to the more specialized skills of a psychic, such as: Channeling spirits, including talking with people who have passed away Communicating with animals Connecting telepathically with people across long distances, using the power of your mind Looking into the future There\'s no prior experience or crystal balls required. With the help of How to Be a Psychic, you\'ll soon be able to achieve clairvoyance, determine your future, and reach the Other Side.', NULL, 620, 1, NULL, 100.00, NULL, '2021-03-05 23:32:47', '2021-03-05 23:32:47'),
(1004, 'Becoming a Life Coach', 'Becoming-a-Life-Coach', 'http://books.google.com/books/content?id=MZ2nDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=MZ2nDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781501197680', 'A fascinating guide to a career as a life coach written by award-winning journalist Tom Chiarella and based on the real-life experiences of an expert in the field—essential reading for someone considering a path to this rewarding profession. Being a life coach is a unique career with the ability to change lives. Becoming a Life Coach takes us behind-the-scenes through the experiences of two top-tier life coaches who spend their days working one-on-one with clients to create new paths forward. The result is an entertaining, practical look at how one gets into and grows within this rewarding career.', NULL, 621, 1, NULL, 100.00, NULL, '2021-03-05 23:32:48', '2021-03-05 23:32:48'),
(1005, 'Giant Steps', 'Giant-Steps', 'http://books.google.com/books/content?id=OMPqAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=OMPqAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780743409360', 'Based on the finest tools, techniques, principles and strategies offered in AWAKEN THE GIANT WITHIN, bestselling author Anthony Robbins offers daily inspirations and small actions that will compel you to take giant steps forward in the quality of your life. Robbins shows you how to get maximum results with a minimum investment of time. \'Robbins\' GIANT STEPS is the ultimate game plan for life. It\'s an emotionally interactive primer for personal and professional success\' PETER GUBER, CHAIRMAN AND CEO, SONY PICTURES ENTERTAINMENT', NULL, 267, 1, NULL, 100.00, NULL, '2021-03-05 23:32:48', '2021-03-05 23:32:48'),
(1006, 'The Genius Test: Maths', 'The-Genius-Test:-Maths', 'http://books.google.com/books/content?id=ji3RAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=ji3RAQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781786483355', 'Can you explain Fermat\'s Last Theorem? What is the shape of the Universe? And how do you add up to infinity? Challenge yourself with The Genius Test: Maths and learn to think and talk like the world\'s greatest mathematical geniuses. Taking you on a journey through the mathematical ideas that underpin our world - from imaginary numbers and Turing machines to chaos theory and mathematical paradoxes; from the search for primes and game theory to relativity and the arithmetic of altruism - The Genius Test: Maths demystifies 50 key concepts and provides you with the tools to master the very biggest ideas. Includes: imaginary numbers; the riemann hypothesis; mathematical paradoxes; chaos theory; code breaking; Gödel\'s incompleteness theorem; topology; the Poincaré conjecture; game theory; the maths of symmetry; calculus; Turing machines; fractals; the prisoner\'s dilemma; primes; knot theory; probability and statistics; the Monty Hall problem . . . and many more.', NULL, 622, 1, NULL, 100.00, NULL, '2021-03-05 23:32:48', '2021-03-05 23:32:48'),
(1007, 'Married to the Brand', 'Married-to-the-Brand', 'http://books.google.com/books/content?id=ydpDCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ydpDCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781595620057', 'Using sixty years of global research from Gallup as well as many consumer stories, the author shows why most advertising fails and identifies the qualities ahat make an ad connect with consumers. 50,000 first printing.', NULL, 623, 1, NULL, 100.00, NULL, '2021-03-05 23:32:49', '2021-03-05 23:32:49'),
(1008, 'Strengths Based Leadership', 'Strengths-Based-Leadership', 'http://books.google.com/books/content?id=F9xDCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=F9xDCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781595620255', 'Two leadership consultants identify three keys to being a more effective leader: knowing your strengths and investing in others\' strengths, getting people with the right strengths on your team, and understanding and meeting the four basic needs of those who look to you for leadership.', NULL, 624, 1, NULL, 100.00, NULL, '2021-03-05 23:32:49', '2021-03-05 23:32:49'),
(1009, 'StrengthsFinder 2.0', 'StrengthsFinder-2.0', 'http://books.google.com/books/content?id=gttDCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=gttDCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9781595620156', 'An updated version of the StrengthsFinder program developed by Gallup experts to help readers discover their distinct talents and strengths and how they can be translated into personal and career successes.', NULL, 606, 1, NULL, 100.00, NULL, '2021-03-05 23:32:49', '2021-03-05 23:32:49'),
(1010, 'The 7 Habits of Highly Effective Teenagers', 'The-7-Habits-of-Highly-Effective-Teenagers', 'http://books.google.com/books/content?id=PWfnoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PWfnoAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471136870', 'Groundbreaking and universal, Stephen Covey\'s THE SEVEN HABITS OF HIGHLY EFFECTIVE PEOPLE has been one of the most popular motivational books of all time. Now Stephen\'s son, Sean, has transformed this bestselling message into a life-changing book for young people and their parents. At a time when everything from planning what to wear to a party to dealing with an alcoholic friend can seem overwhelming and complex, THE SEVEN HABITS OF HIGHLY EFFECTIVE TEENAGERS will bring a special perspective and focus to the lives of young people everywhere. Sean Covey speaks directly to teenagers in a language they can really understand and relate to, addressing the issues that concern them most: relationships, parents, peers, life choices, concerns for the future, and even larger questions about life, death, and the human condition. Just some of the wisdom readers will find in this meaningful guide.', NULL, 169, 1, NULL, 100.00, NULL, '2021-03-05 23:32:50', '2021-03-05 23:32:50'),
(1011, 'Stand and Deliver', 'Stand-and-Deliver', 'http://books.google.com/books/content?id=8Gz3tgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=8Gz3tgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780857206763', 'Stand and Deliver gives you everything you need to know to become an incredibly poised, polished, masterful communicator. Someone who can hold an audience of 1, 10, or 1000 in the palm of your hand, from the first word you speak to them until the last. You will learn... • How to identify your authentic self so that you project an original and unique style • How to win over any audience in ONE MINUTE • A 5-point checklist that will make stage fright disappear • A powerful tactic for getting your listeners to act the way you want them to (works equally well with colleagues, children...anyone you talk to!) • The renowned \"Magic Formula\" technique -- a no-fail 3-step process that ensures your listeners not only remember what you say, but make immediate and positive changes based on it • The secrets to handling hostile or potentially embarrassing questions with ease and professionalism Stand and Deliver is packed with tips, strategies, and secrets you can use immediately to begin dramatically improving all of your communications. You\'ll be surprised and thrilled by how frequently you find yourself reaching into this amazing arsenal of techniques to help you achieve your goals, and what an enormous impact they will have on every facet of your life.', NULL, 625, 1, NULL, 100.00, NULL, '2021-03-05 23:32:50', '2021-03-05 23:32:50'),
(1012, 'Getting the Love You Want Revised Edition', 'Getting-the-Love-You-Want-Revised-Edition', 'http://books.google.com/books/content?id=Gg00ywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Gg00ywEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471193521', 'Originally published in 1988, GETTING THE LOVE YOU WANT has helped thousands of couples attain more loving, supportive and deeply satisfying relationships. In this groundbreaking book, Dr Harville Hendrix shares with you what he has learned about the psychology of love during more than thirty years of working as a therapist and helps you transform your relationship into a lasting source of love and companionship. For this edition of his classic book, Dr Hendrix and his wife, Helen LaKelly Hunt, have added a new introduction describing the powerful influence this book has had on so many people over the years. With its step-by-step programme, GETTING THE LOVE YOU WANT will help you create a loving, supportive and revitalized partnership.', NULL, 626, 1, NULL, 100.00, NULL, '2021-03-05 23:32:51', '2021-03-05 23:32:51'),
(1013, 'Primary Greatness', 'Primary-Greatness', 'http://books.google.com/books/content?id=9wjSjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=9wjSjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781471155840', '', NULL, 627, 1, NULL, 100.00, NULL, '2021-03-05 23:32:51', '2021-03-05 23:32:51'),
(1014, 'The Art of Public Speaking', 'The-Art-of-Public-Speaking', 'http://books.google.com/books/content?id=3zeYswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=3zeYswEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9781945186486', 'Boost Your Skills and Confidence with This Classic Guide', NULL, 628, 1, NULL, 100.00, NULL, '2021-03-05 23:32:52', '2021-03-05 23:32:52'),
(1015, 'Principle-centred Leadership', 'Principle-centred-Leadership', 'http://books.google.com/books/content?id=HmdaAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=HmdaAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9780684858418', 'PRINCIPLE CENTRED LEADERSHIP will help solve these dilemmas - and many others: * how do we achieve a wise and renewing balance between work and family in the midst of constant pressures and crises? * how do we unleash the creativity, talent and energy of the vast majority of the work force, whose jobs neither require nor reward such resources? * how can we have a culture characterised by change, flexibility and continuous improvement and still maintain a sense of stability and security? * how do we create team spirit and harmony among people and departments that have been criticising and attacking each other for years? * how do we get people and culture aligned with strategy, so that everyone in an organisation is as committed to the strategy as those who formulated it?', NULL, 627, 1, NULL, 100.00, NULL, '2021-03-05 23:32:52', '2021-03-05 23:32:52'),
(1016, '1919 [1921].', '1919-[1921].', '', '', '9789770934265', '', NULL, 629, 2, NULL, 100.00, NULL, '2021-03-05 23:32:52', '2021-03-05 23:32:52'),
(1017, 'فردقان', 'فردقان', 'http://books.google.com/books/content?id=7QZ2DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=7QZ2DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770935156', 'يوسف زيدان؛ مفكر وروائي مصري مرموق حاصل على درجة الأستاذية في الفلسفة والتاريخ والعلوم، وصدر له حتى الآن أكثر من ستين كتاباً. نالت أعماله جوائز دولية عديدة؛ جائزة (عبد الحميد شومان) للعلماء العرب الشبان ( الاردن)، جائزة المنظمة الإسلامية للعلوم الطبية (الكويت)، جائزة مؤسسة الكويت للتقدم العلمي في مجال الفقه الطبي وأصول فن تحقيق المخطوطات.. ‏ونالت روايته الأشهر (عزازيل) عدة جوائز عالمية؛ جائزة البوكر العربية 2009 وجائزة (أنوبي)2012، وجائزة (بانيبال) 2013. أصدرت له دار الشروق عددًا من المؤلفات والأعمال الإبداعية منها رواية ظل الأفعى، عزازيل، النبطي، محال، جونتنامو، نور وتتصدر رواياته قائمة الكتب الأعلى مبيعاً منذ صدورها و حتى الآن.', NULL, 630, 2, NULL, 100.00, NULL, '2021-03-05 23:32:54', '2021-03-05 23:32:54'),
(1018, 'صليب موسى', 'صليب-موسى', 'http://books.google.com/books/content?id=8gDZDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=8gDZDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770936252', '\"ولماذا كل تلك النواهي؟ أوَلمْ تكن أغلب وصايا الرب العشر لكليمه موسى نواهي؟ ثماني تحديدا. أوَلمْ يفعلها مع آدم وحواء في شجرته المباركة؟ النهي أسبق دائمًا من الأمر وأشد أهمية، ففي فعْله يحدث الجرم أو الخلل أو المعصية، أما الأمر المنسي ففي عدم فعله ضرر أقل، وذنب يجوز تكفيره أو تداركه\". في إحدى ليالى ديسمبر الثلجية، يتم استدعاء المصور الثلاثيني «بهى» المرتبط بتاريخ طويل مع دير سانت كاترين للتحقيق في وفاة غامضة للراهب اليوناني «بافلوس» المسئول عن مكتبة الدير ومخطوطاتها النادرة، ليكتشف «بهى» بمساعدة البدوى أبى عمران ووثائق الدير النادرة العديدَ من الأسرار الخطيرة.', NULL, 631, 2, NULL, 100.00, NULL, '2021-03-05 23:32:54', '2021-03-05 23:32:54'),
(1019, 'الحرافيش', 'الحرافيش', 'http://books.google.com/books/content?id=AUkwDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=AUkwDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770915226', 'The epic story begins with the tale of Ashur al-Nagi, a man who grows from humble roots to become a great leader and a legend among his people. The name of Ashur epitomizes a time of glory for the harafish, or the common people, when they were led by one of their own. Generation after generation, however, Ashur\'s descendants stray further from his legendary example. They lose touch with their origins as they amass and then lose large fortunes, marry prostitutes when they marry at all, and develop rivalries that end in death. Finally, a Nagi appears who restores the family name to its former distinction. The Harafish is a mythic tale, a compelling portrait of human weaknesses--pride, dishonesty, lust, and greed--and of the greatness of which we are capable when we overcome them.', NULL, 632, 2, NULL, 100.00, NULL, '2021-03-05 23:32:54', '2021-03-05 23:32:54'),
(1020, 'قصر الشوق', 'قصر-الشوق', 'http://books.google.com/books/content?id=sosmDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=sosmDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770930762', 'الجزء الثاني من ثلاثية القاهرة, سلسلة مكونة من ثلاث روايات حائزة على جائزة نوبل للأدب. الثلاثية تعتبر أفضل رواية عربية في تاريخ الأدب العربي حسب اتحاد كتاب العرب', NULL, 632, 2, NULL, 100.00, NULL, '2021-03-05 23:32:54', '2021-03-05 23:32:54'),
(1021, 'السكرية', 'السكرية', 'http://books.google.com/books/content?id=wEswDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=wEswDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770930847', 'الجزء الثالث من ثلاثية القاهرة, سلسلة مكونة من ثلاث روايات حائزة على جائزة نوبل للأدب. الثلاثية تعتبر أفضل رواية عربية في تاريخ الأدب العربي حسب اتحاد كتاب العرب', NULL, 632, 2, NULL, 100.00, NULL, '2021-03-05 23:32:55', '2021-03-05 23:32:55'),
(1022, 'جونتنامو', 'جونتنامو', 'http://books.google.com/books/content?id=dXwwDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=dXwwDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770932933', 'Det siger ud til at hovedpersonen er fanger i Guantánamo. Bogen er en fortsættelse af romanen \'Muhal\'', NULL, 630, 2, NULL, 100.00, NULL, '2021-03-05 23:32:55', '2021-03-05 23:32:55'),
(1023, 'اللغـز وراء السطـور', 'اللغـز-وراء-السطـور', 'http://books.google.com/books/content?id=Z8cTDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Z8cTDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770933954', '', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:32:55', '2021-03-05 23:32:55'),
(1024, 'أطياف كاميليا', 'أطياف-كاميليا', 'http://books.google.com/books/content?id=H__YDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=H__YDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770936146', 'تتمسك كاميليا بروايتها فلا يصدقها أحد ، لقد رأت عمتها تذوب أمامها فى المرآه، بينما يتمسك الأهل بقصتهم؛ هربت العمة من المنزل لتتخلص من حياة مثقلة بالخطايا. وحين تعثر كاميليا على أوراق العمة ومذكراتها، تنكشف أمامها حقيقة ما جرى ، تتجلى جذور الأوجاع التى أدت لإختفائها الغامض، هي المرأة التى كانت تنضج بالحياة والأحلام الكبرى ، حتى وقعت فى الحب. رواية تتحرى العلاقات الإنسانية المتشابكة، دون أن تقع فى فخاخ الإدانة أو صك البراءة لأبطالها ، تستعيد فترة سنوات التسعينيات الحقيقية، لا تلك التى تطل علينا عبر انعكاسات المرآة .', NULL, 634, 2, NULL, 100.00, NULL, '2021-03-05 23:32:56', '2021-03-05 23:32:56'),
(1025, 'أولاد حارتنا', 'أولاد-حارتنا', 'http://books.google.com/books/content?id=iE88DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=iE88DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770915349', '', NULL, 632, 2, NULL, 100.00, NULL, '2021-03-05 23:32:56', '2021-03-05 23:32:56'),
(1026, 'طبيب أرياف', 'طبيب-أرياف', 'http://books.google.com/books/content?id=W5oCEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=W5oCEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770936672', 'هذه الرواية تجربة جديدة في الكتابة حول العالم الخفي للريف المصري، ومحاولة اختراق القشرة البدائية التي تحيط به والتي تراكمت على مدى آلاف السنين، من خلال قصة طبيب أرياف شاب يتعرض لتجربة قاسية في بداية حياته فيبدأ رحلة جديدة إلى قرية منعزلة بالصعيد. يعاني هناك من الوحدة قبل أن يجد نفسه متغلغلاً في تفاصيل الحياة اليومية للقرية الصغيرة الراقدة على حافة الصحراء. يقع في غرام الممرضة لكن تكون هناك مفاجأة في انتظاره. \"طبيب أرياف\" تجربة طبيب يكتشف أن القوانين البدائية ما زالت هي السائدة، وأن هناك سلطة مطلقة تعتمد عليها وتستمد قوتها من جذور بعيدة. هي رواية عن الحب والرغبة واليأس، عن قرية تختزل العالم، يتصارع فيها البشر والغجر والقوى الحاكمة، وتمتلئ ذاكرتها الخفية بطبقات الزمن المصري المتراكم.', NULL, 635, 2, NULL, 100.00, NULL, '2021-03-05 23:32:56', '2021-03-05 23:32:56'),
(1027, 'يوتوبيا', 'يوتوبيا', 'http://books.google.com/books/content?id=gwBLDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=gwBLDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770933077', 'كيف ستكون مصر عام 2023؟ لقد عزَلَ الأغنياء أنفسهم في »يوتوبيا« الساحل الشمالي تحت حراسة المارينز الأمريكيين؛ يتعاطون المخدرات ويمارسون المُتع المحرمة إلى أقصاها، بينما ينسحق الفقراء خارجها ينهش بعضهم لحم بعض من أجل العيش، دونما كهرباء أو صرف صحي أو رعاية طبية من أي نوع. ولكن حين يتسلل الراوي وصديقته »جرمينال« خارج »يوتوبيا« بدافع الملل وبحثًا عن »صيد بشري« مناسب يحدث ما يُهدد الوضع المستقر بالانفجار. فيما يُشبه هول علامات يوم القيامة، تدقُّ هذه الرواية المثيرة ناقوس الخطر، تكاد تشكُّ إذ تنهيها أهي بالفعل رواية متخيلة، أم إن كاتبها تسلل من المستقبل القريب لينقل لك هوله بحياد مُذهل؟', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:32:57', '2021-03-05 23:32:57'),
(1028, 'موسم صيد الغزلان', 'موسم-صيد-الغزلان', 'http://books.google.com/books/content?id=bIs4DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=bIs4DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770934401', 'في مُستقبل بعيد، وفي توقيت مرور الُمَذَّنب بالسماء، يستيقظ \"نديم على وميضٍ بعدسته؛ \"تم تسجيل حلم واحد\"؛ سيدة غجرية حمراء الشعر تقف في قاع البحر، ترفع رأسها لتنظر ناحيته. وبعد ساعاتٍ من حلمه، وفي أثناء إلقاء محاضرته على المسرح، يتفاجأ بالغجرية تجلس بين الحاضرين في ذلك اليوم سيتلقى \"نديم\" دعوة لزيارة غير متوقعة، تجربة يتمنى الكثيرون خوضهاما داموا لا يدركون نهايتها فبعض الحقائق من الأفضل أن تبقى في الظلام في روايته السادسة، وبدون مرور بالحاضر، ينطلق الكاتب أحمد مراد مباشرةً من التاريخ المصري القديم إلى المستقبل.. رواية تتنبأ بعالَم تُلقَى بذورە الآن، وتناقش الصراع الأبدي بين العقل، وأعظم القناعات على الإطلاق', NULL, 636, 2, NULL, 100.00, NULL, '2021-03-05 23:32:57', '2021-03-05 23:32:57'),
(1029, 'تراب الماس', 'تراب-الماس', 'http://books.google.com/books/content?id=n-5tDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=n-5tDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770931332', '', NULL, 629, 2, NULL, 100.00, NULL, '2021-03-05 23:32:57', '2021-03-05 23:32:57'),
