(1032, 'لوكاندة بير الوطاويط', 'لوكاندة-بير-الوطاويط', 'http://books.google.com/books/content?id=a8zzDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=a8zzDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770936511', 'في عام ٢٠١٩ وأثناء ترميم \"لوكاندة بير الوطاويط\" المجاورة لمسجد \"أحمد ابن طولون\" بحي \"السيدة زينب\"، تم العثور على يوميات تعود إلى سنة ١٨٦٥م، مدفونة وراء حائط الغرفة رقم سبعة بالطابق الثالث بمبنى اللوكاندة، ومحفوظة بشكل جيد. يضم هذا الكتاب اليوميات من نمرة \"34\" إلى \"53\" دون حذف أو تنقيح، وهي اليوميات الوحيدة التي تصلح للنشر، أرّخ فيها مصوّر الموتى \"سليمان أفندي السيوفي\" في سنوات ما قبل إنشاء جهاز بوليس منظم ، حين تم تكليفه بتقصي الحقيقة حول مصرع أحد الباشوات بطريقة شنيعة، وبخبرته الموروثة في تحليل مسرح الجريمة، يكتشف أن الوفاة وراءها قتل عمد، وفاعل ترك مع ضحيته تذكارّا، قبل أن يكتشف أن تلك الجريمة، ليست سوى الجريمة الأولى في سلسلة من الإغتيالات، أدرك دون مجهود، أنها ستنتهي به.', NULL, 629, 2, NULL, 100.00, NULL, '2021-03-05 23:32:58', '2021-03-05 23:32:58'),
