(1038, 'مثل إيكاروس', 'مثل-إيكاروس', 'http://books.google.com/books/content?id=2mdLDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=2mdLDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770933251', 'للحقيقة ثمن، وللمعرفة ثمن، وقد دفع \"محمود السمنودي\" مقابل معرفته نبذا وألما ومعاناة، منذ طفولته كطفل غريب الأطوار بين أقرانه وكرجل لا يرغب أحد فى الاقتراب منه. تدور أحداث الرواية عام 2020، وتمتد إلى المستقبل ثم تعود إلى الماضي لتجتمع كل الخيوط فى حجرة داخل مصحة للعلاج النفسي يمكث فيها رجل قادر على قراءة أحداث الماضى والمستقبل، قبل أن يجبر نفسه على الصمت. رواية شائقة للروائي أحمد خالد توفيق تأخذ القارىء لعالم غامض وتعود به محملاً بكثير من الأسئلة وربما ببعض الإجابات ولكن هل نحن مستعدون ومتأهبون للمعرفة؟ ... \"لقد مات محمود لأنه اقترب من الحقيقة أكثر من اللازم، فلم يتحمل واحترق وذاب جناحاه ..هوى من حالق ليغرق وسط محيط ثائر .. مثل إيكاروس\". أحمد خالد توفيق - تصدر عن دار الشروق - معرض القاهرة الدولي للكتاب 2015', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:32:59', '2021-03-05 23:32:59'),
(1039, 'انا وطفلى والطبيب', 'انا-وطفلى-والطبيب', '', '', '9789770920251', '', NULL, 640, 2, NULL, 100.00, NULL, '2021-03-05 23:32:59', '2021-03-05 23:32:59'),
(1040, 'أثقل من رضوى', 'أثقل-من-رضوى', 'http://books.google.com/books/content?id=Rs-VwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Rs-VwAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789770932636', '', NULL, 641, 2, NULL, 100.00, NULL, '2021-03-05 23:33:00', '2021-03-05 23:33:00'),
(1041, 'ثلاثية غرناطة', 'ثلاثية-غرناطة', 'http://books.google.com/books/content?id=ev1KDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ev1KDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789770907375', 'ثلاثية غرناطة هي ثلاثية روائية تتكون من ثلاث روايات للكاتبة المصرية رضوى عاشور و هم على التوالي : غرناطة - مريمة - الرحيل. و تدور الأحداث في مملكة غرناطة بعد سقوط جميع الممالك الإسلامية في الأندلس، و تبدأ أحداث الثلاثية في عام 1491 و هو العام الذي سقطت فيه غرناطة بإعلان المعاهدة التي تنازل بمقتضاها أبو عبد الله محمد الصغير آخر ملوك غرناطة عن ملكه لملكي قشتالة و أراجون .. و تحكي الرواية قصة عائلة عاصرت احداث السقوط على مدى عدة اجيال و ما واكبها من احداث و مشاعر متنوعة في ملحمة تاريخية فريدة. ...', NULL, 642, 2, NULL, 100.00, NULL, '2021-03-05 23:33:00', '2021-03-05 23:33:00'),
(1042, 'الغميضة', 'الغميضة', '', '', '9789770936696', '', NULL, 643, 2, NULL, 100.00, NULL, '2021-03-05 23:33:00', '2021-03-05 23:33:00'),
(1043, 'جرافيت', 'جرافيت', 'http://books.google.com/books/content?id=Kax_CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Kax_CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937165', 'رواية جرافيت والصادرة عن مكتبة الدار العربية للكتاب للكاتب والروائى المهندس هشام الخشن فتدور أحداث هذا الرواية بين انطلاق حركة المرأة المصرية وتأسيس جمعية الأخوان المسلمين عام 1928 والتى تمزج ببراعة بين واقع تحول الى تاريخ وخيال خلاق يسعى الى تلوين اللوحة التاريخية التى انتقلت الينا بالجرافيت حيث لامجال الا للونين الأسود والأبيض من خلال شخصية نوال، والتى تتمرد على الواقع بألوان تبعث فى لوحتها بهجة الحياة، وتتجاوز غيرتها من صديقتها درية شفيق، حين تقف الى جوارها من أجل ماتؤمنان به من حقوق حان زمن انتزاعها', NULL, 644, 2, NULL, 100.00, NULL, '2021-03-05 23:33:00', '2021-03-05 23:33:00'),
(1044, 'للقلب مرسى اخير', 'للقلب-مرسى-اخير', 'http://books.google.com/books/content?id=4VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952712', 'تقاطعت مصائرهم، وتداخلت أقدارهم ليلتقوا مرة أخيرة تحت سماء قمر بعيد.. غرباء وقرباء.. مُهاجرون وعائدون.. حملوا حقائبهم وارتحلوا يبحثون عن مرسى لقلوب سكنها الحنين تارة والعشق تارة والحزن آلاف المرات.. وتبقى معركة أخيرة، لا الفوز فيها للقوي، ولا الهزيمة من نصيب الضعفاء.. بشرٌ يبحثون عن حيواتهم الضائعة وسط أنقاض الذكريات البعيدة.. أبطال هذه الرواية أدركوا في لحظة فارقة، أن أجمل القصص هي تلك التي لم تُرو بعد.. في هذه الرواية تُبحر بنا المؤلفة في أغوار النفس البشرية، لتنسج عالما من السحر، وترسم بقلمها الرشيق خيوطًا من الواقع بمغزل الخيال.. في رحلة تصطحب فيها قلوب قرائها إلى مرساها الأخير.', NULL, 645, 2, NULL, 100.00, NULL, '2021-03-05 23:33:00', '2021-03-05 23:33:00'),
(1045, 'سألقاك هناك', 'سألقاك-هناك', 'http://books.google.com/books/content?id=sJkkDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=sJkkDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951067', '', NULL, 645, 2, NULL, 100.00, NULL, '2021-03-05 23:33:01', '2021-03-05 23:33:01'),
(1046, 'التدوينة الاخيرة', 'التدوينة-الاخيرة', 'http://books.google.com/books/content?id=iBl9CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=iBl9CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774279164', 'صدر حديثا عن الدار المصرية اللبنانية رواية التدوينة الأخيرة للكاتب والمهندس المعمارى المصرى - أحمد القرملاوى - هو من مواليد عام 1978، تخرج فى كلية هندسة الشييد فى الجامعة الأمريكية بالقاهرة، حصل على درجة الماجيستير من جامعة إدنبرا، اسكتلندا، يكتب الرواية القصيرة والشعر وصدرت له المجموعة القصصية \" اول عباس \" فى يناير 2013، اما عن الرواية فيقول القرملاوى عن التدوينة الأخيرة انها تجذبك الى عالم مواز، عالم الفردوس وسكانه، الذين يعتقدون أنهم يعيشون فى فردوس السماء حيث قصة حب لا تباركها تقاليد المعبد، والمجتمع الطبقى وكاهن تدفعه الشكوك لمواجهة حاسمة مع ما يؤمن به الناس، قد تعصف بكل شيء، اما عن علاء الديب فلقد قال عن القرملاوى فى تقديمه للرواية ان هناك نوعان من الإصرار والدأب نعرفهما فى حياتنا الادبية، الأول - إصرار ودأب على الوجود والانتشار، والآخر - إصرار ودأب على معاناة فن التعبير وتحسين نوعية الإنتاج الأدبى الفنى، والقرملاوى يتمسك بالنوع الثانى وينجح فى تحقيق بعضا منه', NULL, 646, 2, NULL, 100.00, NULL, '2021-03-05 23:33:01', '2021-03-05 23:33:01'),
(1047, 'ما يشبة القتل', 'ما-يشبة-القتل', 'http://books.google.com/books/content?id=y1rVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=y1rVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952620', 'أربعة أشخاص ينطلقون معًا في رحلة سحرية للبحث عن شجرة الحكمة. رحلة واحدة لكنها مكونة من تشابك رحلة كل منهم الخاصة للبحث عن ذاته. رحلة تطلق الكثير من التساؤلات عن الحرية والمصير والتناقضات الحادة التي تحويها النفس البشرية. رحلة تجسد المعاناة النفسية لأبطالنا، وسعيهم ـ في مرحلة محورية من حيواتهم ـ لإعادة التعرف على ذواتهم بعد روايته السابقة الفائزة بجائزة ساويرس للأدب \"الفابريكة\"، يواصل أحمد الملواني مزج الواقع بالخيال، ليصنع بناء رمزيًّا متشابكًا، ينقل الكثير من الأفكار والرؤى.', NULL, 647, 2, NULL, 100.00, NULL, '2021-03-05 23:33:02', '2021-03-05 23:33:02'),
(1048, 'آدم المصري', 'آدم-المصري', 'http://books.google.com/books/content?id=F295CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=F295CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774277399', 'آدم المصرى لم يكن لدى الطبيب الشاب اى شكوك فى اسباب الوفاة التى بدت طبيعية ومتسعة مع الحالة التى ياشرها منذ وصول سياة الاسعاف ولكن الطبيب اليافع لم يكن يدرى ان من بين من وقفوا امام حجرة الطوارى كان هناك من مد يد العون ليعجل المقدر فكل كانت لة اسبابة والجميع اوتى فرصة هكذا تتحول المعتقدات والمبادى وتتغير الثوابت فيصبح الموت عطاء والقتل رجمة والخيانة شرفا ولا عجب فتحت وطاة الطموحات والاحلام تغدو القيم هراء فاقد المعنى ويحفل المشهد بالاهتزاز والتارجح واللايقين وامكانية حدوث ما لايحمل', NULL, 644, 2, NULL, 100.00, NULL, '2021-03-05 23:33:03', '2021-03-05 23:33:03'),
(1049, 'شله ليبون _ رواية', 'شله-ليبون-_-رواية', 'http://books.google.com/books/content?id=Gr7xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=Gr7xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789777952859', '', NULL, 644, 2, NULL, 100.00, NULL, '2021-03-05 23:33:03', '2021-03-05 23:33:03'),
(1050, 'انت مني', 'انت-مني', 'http://books.google.com/books/content?id=ZumIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ZumIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952248', '“هل تظن أن الجريمة هى الشيء الوحيد الذي لا يولد كاملا؟! أحمق من يظن هذا!!! جرائم كثيرة وكبيرة كاملن لهذا لم نعرف أو نسمع عنها شيئا.. الناقص دوما هو السعادة! هو الفرحة التي تنتظرها وتعمل من أجلها كثيرا.. ناقصة ونقصانها نعمة كبرى… نحن إن اكتفينا انتهينا!!” بهاء الأشياء والمشاعر والعلاقات قد يكون أحيانا في النقصان لا الاكتمال.. حتى “البدر” إن اكتمل غاب وعاد هلالا.. قواعد ننساها وربما لجهلنا وضعفنا نتناساها!!', NULL, 648, 2, NULL, 100.00, NULL, '2021-03-05 23:33:03', '2021-03-05 23:33:03'),
(1051, 'الحرمان الكبير', 'الحرمان-الكبير', 'http://books.google.com/books/content?id=7LFrCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=7LFrCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774278976', 'نور عبد المجيد وروايتها الحرمان الكبير فى طبعتها الجديدة التى اصدرتها الدار المصرية اللبنانية تبدأ نور عبد المجيد روايتها بمقدمة تسأل فيها عن هل السعادة فى الثروة؟ ام ان السعادة فى لحظات العشق والهوى؟! وهل تكفى لحظات العشق لصنع السعادة؟! وهل تشترى الثروة أيا منهما؟! أم ان السعادة تبقى دوما هى ذاك الشيء الذى لا تملكة ايدينا ونراه يتأرجح فى ايدى الآخرين؟ قد ينقضى العمر وقد تنتهى الحياة ونحن لانعلم ان السعادة تبقى وحدها الوهم الكبير', NULL, 648, 2, NULL, 100.00, NULL, '2021-03-05 23:33:03', '2021-03-05 23:33:03'),
(1052, 'Ya\'nī iyh rājul?', 'Ya\'nī-iyh-rājul?', 'http://books.google.com/books/content?id=YIvgxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=YIvgxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789777952033', '', NULL, 649, 2, NULL, 100.00, NULL, '2021-03-05 23:33:03', '2021-03-05 23:33:03'),
(1053, 'جواري العشق', 'جواري-العشق', 'http://books.google.com/books/content?id=kcRrCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=kcRrCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937189', 'صدر حديثا عن مكتبة الدار العربية للكتاب رواية جوارى العشق للدكتورة المبدعة رشا سمير، تحكى الرواية عن اربعة نساء فى اربعة اجيال مختلفة، خلال أربعة أزمنة متباينة، تحمل كل منهم جينات من سبقتها، وتسير على طريقها بحثا عن الحرية، بداية من سلاطين المماليك، مرورا بتحولات فترة السبعينيات، ووصولا الى تغيرات المجتمع المصرى مطلع 2011، هى رواية تستحق القراءة، حيث تضع تاريخا ناعما لحرية المراة، وفى الوقت نفسه تحرر تاريخها من صورة نمطية سرعان ما تتحول الى \" كرباج \" لجلد الذات', NULL, 645, 2, NULL, 100.00, NULL, '2021-03-05 23:33:04', '2021-03-05 23:33:04'),
(1054, 'اراك فى الجنة', 'اراك-فى-الجنة', 'http://books.google.com/books/content?id=3VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=3VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952705', 'كاتب يؤمن بالإنسان، ويعتبره \"أجمل فكرة في العالم\"، يتقابل مع مُدرِّسة شابة، لها شخصية غير اعتيادية، فيحب كلٌّ منهما الآخر من اللحظة الأولى، يتزوجان خلال أسابيع، ويعيشان في بيت دَفَعا فيه معًا أكثر من نصف مالهما، لتدور بينهما أسئلة، قصص، وأفكار، عن الإيمان، الإلحاد، الحب، والصداقة، مثلما تدور بينهما مباريات البنج بونج في حديقة منزلهما، في الوقت الذي نرى جانبًا من الرواية داخل الجنة والجحيم.', NULL, 650, 2, NULL, 100.00, NULL, '2021-03-05 23:33:04', '2021-03-05 23:33:04'),
(1055, 'نادى القلق', 'نادى-القلق', 'http://books.google.com/books/content?id=vcLxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=vcLxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952446', 'هل سبق أيها القارئ أن سببت لنفسك الذعر حول شيء ما لم يحدث مطلقًا؟ أو أصبت نفسك بحالة من الهلع حول شيء ما اعتقدت أنه قد يحدث يومًا، إلا أنه لم يحدث أبدًا؟ أو أخبرت نفسك قصصًا مخيفة ستحدث لك في المستقبل البعيد؟ أو تصورت ما ستفعله إذا خسرت وظيفتك، أو أصبت بمرض عضال، أو فقدت شخصًا عزيزًا عليك؟ إذا كنت قد فعلت ذلك، أو تفعله الآن، فمرحبًا بك في نادي القلق، الذي ربما يكون النادي الأكبر على سطح كوكب الأرض، فجميع البشر تقريبًا أعضاء به ماذا بوسعنا أن نفعل لكي نتوقف عن القلق؟! هل من طريقة ناجحة للتوقف عن القلق الذي يفسد كل حياة هانئة ويعيق كل حياة سعيدة؟! .. في هذا الكتاب، قد تجد إجابة على هذا السؤال', NULL, 651, 2, NULL, 100.00, NULL, '2021-03-05 23:33:04', '2021-03-05 23:33:04'),
(1056, 'زين', 'زين', 'http://books.google.com/books/content?id=fBuIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=fBuIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952132', '', NULL, 652, 2, NULL, 100.00, NULL, '2021-03-05 23:33:04', '2021-03-05 23:33:04'),
(1057, 'غرفة المسافرين', 'غرفة-المسافرين', 'http://books.google.com/books/content?id=31rVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=31rVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952675', 'غرفة المسافرين » ليس رواية، ليس سيرة ذاتية للمؤلف، ليس كتابًا في الرحلة، ليس كتابًا في الفلسفة، ولا في العمارة، وليس كتابًا حول القراءة، لكنه كل ذلك. الحكاية هي روح النص، والأماكن حاضرة بما يكفي لكي نشعر أننا انتقلنا إليها، والكتب التي قرأناها سنراها هنا بطريقة مختلفة والتي لم نقرأها سيجعلنا هذا الكتاب نسعى إليها. يكتب عزت القمحاوي عن خفة الكائن خارج مكان عيشه الأصلي، عن السفر بوصفه موتًا لذيذًا نعود منه لنتأكد أن من نضحي بحياتنا من أجلهم يستطيعون العيش من دوننا. نص جديد مفتوح على كل فنون الكتابة، يحتفي بمتعة القراءة ومهنة العيش مع حس صوفي يسري داخل النص سريان عصارة الحياة في عروق شجرة مبتهجة.', NULL, 653, 2, NULL, 100.00, NULL, '2021-03-05 23:33:04', '2021-03-05 23:33:04'),
(1058, 'غرفة الانتظار', 'غرفة-الانتظار', 'http://books.google.com/books/content?id=IvyBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=IvyBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951654', 'تضم هذه المجموعة بين دفتيها “13” قصة. بعضها ينشر لأول مرة كـ “القاعة الكبرى” و”بدون عنوان”. تمثل هذه المجموعة أسلوب وفكر الكاتب في مراحله المختلفة، وقد كتب أسفل كل قصة تاريخ كتابتها، إذ تمثل كل منها مرحلة معينة من مراحل كتابة وأسلوب وفكر د.يوسف عز الدين عيسى. مجموعة بها أبعاد نفسية تكشف حقائق وهواجس وهموم الإنسان في العصر الحديث. تتميز بالخيال الفلسفي body,div,table,thead,tbody,tfoot,tr,th,td,p { font-family:\"Calibri\"; font-size:x-small } a.comment-indicator:hover + comment { background:#ffd; position:absolute; display:block; border:1px solid black; padding:0.5em; } a.comment-indicator { background:red; display:inline-block; border:1px solid black; width:0.5em; height:0.5em; } comment { display:none; }', NULL, 654, 2, NULL, 100.00, NULL, '2021-03-05 23:33:05', '2021-03-05 23:33:05'),
(1059, 'هنا القاهرة', 'هنا-القاهرة', 'http://books.google.com/books/content?id=9P-ACwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=9P-ACwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774278907', 'هنا القاهرة رواية ابراهيم عبد المجيد والتى صدرات عن الدار المصرية اللبنانية ذكر فيها ابراهيم عبد المجيد مررت على سينما مترو التى كانت تعرض حين ذاك فيلم \" جاتسبي العظيم \" لروبرت ريد فورت وميا فارو المأخوذ عن الرواية الشهيرة لسكوت فيتزجيرالد، وسينما ميامى والتى تعرض فيلم \" اين عقلى \" لسعاد حسنى وسينما راديو تعرض فيلم \" بذور التمر الهندى Tamarind seed \" وهو فيلم لعمر الشريف الذى وحشنى جدا بحق. مشيت انظر الى الكافتيريات والمحلات، كافتيريا \" روى \" التى تبدو متسعة من الداخل على يمينى وكافتيريا \" اكسلسيور \" بعد سينما مترو على يسارى نوفذها تطل على شارعي طلعت حرب وعدلي يكن أحد زملاء سعد زغول فى ثورة 1919 الذى انشق عنه واسس حزب الدستوريين الاحرار الاكثر تفاهما مع الانجليز، ومحلات الملابس حولى رائعة ورائحة البارفان لاتنقطع، الفتيات مرتديات الميركوجيب او الجونلات والفساتين القصيرة او الفساتين الشانيل ويعلقن على اكتافهن حقائب جميلة ويسرعن، شعر النساء هنا يحتاج الى بحرا يهب منه الهواء ليطيره لأراه يرفرف', NULL, 655, 2, NULL, 100.00, NULL, '2021-03-05 23:33:05', '2021-03-05 23:33:05'),
(1060, 'ذكريات محرمة', 'ذكريات-محرمة', 'http://books.google.com/books/content?id=iJkkDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=iJkkDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777950794', '', NULL, 648, 2, NULL, 100.00, NULL, '2021-03-05 23:33:05', '2021-03-05 23:33:05');
