(1061, 'نساء .. ولكن!', 'نساء-..-ولكن!', 'http://books.google.com/books/content?id=hrc1DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=hrc1DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951227', 'أؤمن أن المرأة تتحول فى مرحلة ما لتصبح جنسًا ثالثًا لا هو رجل ولا هو امرأة.. جنس أكثر رحمًة وصفحًا وعطاًء ... يزهد الكثير مما يلهث وراءه الجنس الأول و الثاني من البشر ... رائع حقًا أن تصبح من الجنس الثالث لكنه صعب... صعب جدّا!!', NULL, 656, 2, NULL, 100.00, NULL, '2021-03-05 23:33:05', '2021-03-05 23:33:05'),
(1062, 'القداس الأخير _ رواية', 'القداس-الأخير-_-رواية', 'http://books.google.com/books/content?id=Ig4VEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Ig4VEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952910', 'القداس الأخير «كنت مسحورًابكل ماقالته، وبهيئتها ،وميلادها الجديد.. ك لذلك جعلني أراها قديسةً أوملاكًا.. تتماهى في نظري معماري العذراء التي رأيتها آلاف المرات في اللوحات .. الآن كانت أمام يماري التي تخصني ، التي تنتمي لي.. لم أكن أدرك لحظتها بأنها لم تكن العذراء.. ولكنها كانت الأخرى.. المجدلية». بعد صدمة عنيفة يرحل الراوي إلى عدة دول أوروبية.. وفي كل مرةٍ تحط به الطائرة يحاول إعادةتركيب الماضي كقطع أحجية ٍتستعصي على الفهم، وكأنه كان يعيش في غيبوبة طوال حياته.. يجهل من هو.. ويجهل حقيقة أقرب الناس إليه. النحات الإيطالي العظيم برنيني، لوحات ديرجويس وكارافاجيو، جرائم فريتزل البشعة، رؤى القديسة تيريزا، وقطع المغناطيس الثقيلة... كلهاعناصرذات حضوراستثنائي ينبض بالحياة في هذه الرواية المؤلمة.. الشاعرية.. والصادمة كثيرًا.', NULL, 657, 2, NULL, 100.00, NULL, '2021-03-05 23:33:05', '2021-03-05 23:33:05'),
(1063, 'فندق كاليفورنيا', 'فندق-كاليفورنيا', 'http://books.google.com/books/content?id=rlOxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=rlOxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952156', '“خالد جاسم” صحفي عراقي.. عاش في العراق سنوات طفولته وصباه وشبابه تحت سطوة نظام صدام وقهره.. كان يبحث عن إجابة لسؤال ظل يرافقه عن “ما الوطن؟”.. حاول أن يعثر على الإجابة في أستراليا حين ذهب إليها لاجئًا، وعندما أخفق عاد إلى العراق، بعد سقوط صدام، عله يجد ضالته.. وجاءته الإجابة التي لا يعرف أحد منا: هل كانت إجابة شافية أم ناقصة.. هو وحده يعرف ذلك. هذه دعوة لترتحل معنا في آفاق أحداث هذه الرواية؛ علك تعرف إجابة السؤال التي أخفقنا –مع بطل روايتنا- في إدراكها', NULL, 658, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1064, 'البارمان', 'البارمان', 'http://books.google.com/books/content?id=x7FrCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=x7FrCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774278556', 'البارمان للكاتب اشرف العشماوي يقول فيها \" انا اعرف ذوق زبوني من عينيه، من حركات جسده، من توتره، من عصبيته ومن هدوئه، كل منهم له مشروبه وكل له طريقة فى صنعه، نحن نعيش فى فقاعة كبيرة الشاطر فينا هو من يخرج منها لينظر اليها من بعيد فيرى الآخرين جيدا، ويقرأ افكارهم ثم يعود ليلبي احتياجاتهم فيحقق النشوة التي جاءوا من اجلها.', NULL, 659, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1065, 'تويا', 'تويا', 'http://books.google.com/books/content?id=yrJrCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=yrJrCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774277450', 'هذه الرواية عمل إبداعى يسلط الضوء على منطقة بالغة الحساسية مخترقا صميم البيئة الإفريقية التى تتصارع فيها نوازع تجارة البشر مع أنبل الجهود الحضارية عبر سيرة طبيب مصرى أكتشف ذاته فى عينى فتاة ذات جمال أسطورى وأسم فرعونى وحضورأنثوى طاغى. ويقول الطبيب المحب انا أشعر لأول مرة أنى أحب ولن أتنازل عن هذا الشعور ما حييت.', NULL, 660, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1066, '٦ إنش، بعض الأخطاء خلقت للخلود', '٦-إنش،-بعض-الأخطاء-خلقت-للخلود', '', '', '9789774279577', 'En journalist, som er specialiseret i krimi sager, vil skrive om et mord, som selv har været vidne til', NULL, 661, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1067, 'الطمي يا انشراح', 'الطمي-يا-انشراح', 'http://books.google.com/books/content?id=7I-XDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=7I-XDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937066', 'فى الطمى يا انشراح نقرأ أحداث ما بعد الثورة بطريقة ساخرة بسيطة تعبر عما يدور بفكر كلا منا من اسئلة، تجيب عن تلك الاسئلة الست انشراح الأم والأخت والعمة. من هى انشراح، انشراح كانت دوما حالمة بحياة أفضل .. تعبر عن رأيها أحيانا بخجل .. لا تفضل الانخراط فيما قد يجلب لها المشاكل، ولكن تغير حالها تماما بعد اندلاع ثورة 25 يناير المجيدة، بدأت تشارك وتعبر عن رايها فى الحوادث المتلاحقة التى حدثت على مدار أكثر من عام من عمر الثورة، فشاركت ودخلت ميدان التحرير تلطم مما ترى حتى انسحبت من كل الفعاليات، وبدأ الشعب يسأل عنها، أين انشراح؟!', NULL, 662, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1068, 'يكفى اننا معا', 'يكفى-اننا-معا', 'http://books.google.com/books/content?id=qpkkDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qpkkDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951012', '', NULL, 663, 2, NULL, 100.00, NULL, '2021-03-05 23:33:06', '2021-03-05 23:33:06'),
(1069, 'الف لية وليلة ج 1', 'الف-لية-وليلة-ج-1', 'http://books.google.com/books/content?id=pryIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=pryIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951500', 'الف ليلة وليلة 4 جزء_كلاسيكيات «ألف ليلة وليلة» 4 جزء طبعة جديدة منقحة بواسطة الدكتور / صلاح فضل يحتل مكانة مرموقة في الآداب العالمية بقصصه الرائعة الخالدة التي تمثّل الأدب الشعبي أصدق تمثيل، وتبرز معالمه وصفاته المميَّزة التي نالت اهتمامًا عالميّا في الشرق والغرب. وقد عُني الغرب بها فترجمت هذه القصص إلى أغلب لغات العالم، وقد لاقت هذه الترجمات رواجًا منقطع النظير، بعد أن جعل الأوروبيون منها مادة غزيرة الإنتاج.', NULL, 664, 2, NULL, 100.00, NULL, '2021-03-05 23:33:07', '2021-03-05 23:33:07'),
(1070, 'كل شئ هادئ فى القاهرة', 'كل-شئ-هادئ-فى-القاهرة', 'http://books.google.com/books/content?id=qryIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qryIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952088', 'تتحدث الرواية عن رجل حائر بين أكثر من امرأة، يتأرجح بينهن كبندول الساعة، لايعرف الاستقرار أو الراحة النفسية. يقدمها الكاتب في لغة سلسة وجذابة. هل هو مجني عليه أم أنه يجني على كل من تدخل في دائرته؟!.. علاقات إنسانية مرتبكة تشبه الزمن والمدينة التي لم تعرف الهدوء في أي لحظة في تاريخها', NULL, 665, 2, NULL, 100.00, NULL, '2021-03-05 23:33:08', '2021-03-05 23:33:08'),
(1071, 'أنا الخائن - رواية', 'أنا-الخائن---رواية', 'http://books.google.com/books/content?id=D0KkyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=D0KkyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789774277887', 'فى هذه الرواية تقول الكاتبة نور عبد المجيد، كيف بدات النهاية وكيف ولدت؟ كما نموت كما يولد الطفل ونمنحه الحب والحنان ويكبر ليرسم على ملامح والديه تجاعيد العناء والخوف عليه، ثم فى لحظة يسقط ميتا مقتولا برصاصة صغيرة لايشترى ثمنها حتى زهرة او قمحة سمراء. بهذه الكلمات يملأنا الشغف والحب لكى نغوص فى اعماق الرواية ونعرف تفاصيلها لناخذ منها الحكمة والتجربة ونستمتع بالاسلوب الروائى الجميل.', NULL, 648, 2, NULL, 100.00, NULL, '2021-03-05 23:33:08', '2021-03-05 23:33:08'),
(1072, 'ورثة ال الشيخ _ رواية', 'ورثة-ال-الشيخ-_-رواية', 'http://books.google.com/books/content?id=zuH7DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=zuH7DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937646', 'أسطورةعن كنزموعود،يتناقلها أفرادعائلته جيلًابعدجيل، تستحوذعليه، فتدفعه لأن يفتِّش وراءها عبرالبيوت والأزمنة.. وكلما التأمَت الصورالقديمة،نطقَت منهاأصوات الراحلين، ونادَته كي يستكمل الرحلة التي بدأهاسعيًا وراء الكنز. في خامس أعماله الروائية،يضع أحمد القرملاوي بين أيدينا روايةأجيال لها مذاق مختلف،يصحبنا فيها عبرشوارع القاهرة القديمة وحكاياتها التي بلانهاية؛حكايات عشق وألم وفَقْد،انتصارات صغيرة وهزائم مدوِّية.. إنهاحكاية زمن يتسرَّب فلانستطيع إيقافه.', NULL, 666, 2, NULL, 100.00, NULL, '2021-03-05 23:33:08', '2021-03-05 23:33:08'),
(1073, 'لماذا يريد الرجل وترفض المرأة ؟ دليلك العملى لحياة جنسية ايجابية', 'لماذا-يريد-الرجل-وترفض-المرأة-؟-دليلك-العملى-لحياة-جنسية-ايجابية', 'http://books.google.com/books/content?id=KUnzDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=KUnzDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952866', '\"أبدع المؤلف شريف عرفة في كتابه \"لماذا يريد الرجل وترفض المرأة؟\". مرجعية الكتاب علمية مبسطة، ليدرك القارئ أن العلاقة الزوجية والجنسية غالبيتها عقلية وعاطفية أكثر منها ارتواء جنسي. وحينما يصف المؤلف كل مكونات العلاقة الجنسية فهو يستخدم كلمات حضارية ليس لها علاقة بالشائع من ألفاظ تخدش الحياء.. إن الكتاب تطبيق ثقافي معرفي لعلم النفس الإيجابي سيفيد الكثير من القراء. أهنئك يا شريف\". بروفيسور/ أحمد عكاشة الرئيس الأسبق للجمعية العالمية للطب النفسي هذا الكتاب ليس دينيًّا، ولا يهدف للوعظ أو تكرار ما تعرفه مسبقا، بل يتناول الموضوع من منظور الدراسات العلمية الحديثة، بهدف تحسين جودة الحياة وتعزيز السعادة الزوجية. يتناول الكتاب موضوعات مثل: (الفرق بين غريزة الرجل والمرأة، الأفلام الإباحية، العادة السرية، علاج الفتور الزوجي، استحضار الرغبة، أورجازم المرأة، دم البكارة، تكوين الشخصية الجنسية، التحكم في القذف، أساليب التواصل الجنسي، تدريبات تحسين الأداء….). المحتوى مناسب للجنسين، للقارئ المتزوج أو المقبل على الزواج، في سن الشباب أو منتصف العمر. فهل أنت مستعد لقراءة هذا الكتاب؟', NULL, 667, 2, NULL, 100.00, NULL, '2021-03-05 23:33:08', '2021-03-05 23:33:08'),
(1074, 'بيت القبطية', 'بيت-القبطية', 'http://books.google.com/books/content?id=_k7SDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=_k7SDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952460', 'مُحقِّق قضائي يحاول تتبُّع جرائم جنائية في قريةٍ صغيرةٍ بشمال الصعيد، فيُفاجأ بما هو أخطر: حوادث قتلٍ بغير باعثٍ منطقي، وحالات انتحار مُريبة، واحتراق زراعات وبيوت بدون سببٍ واضح، لتكبُر حالة الشَّك المصاحبة للجميع بمَن فيهم المُحقِّق، الذي يتقاطع مصيره مع سيدةٍ قبطيَّةٍ غامضةٍ. في هذه الرواية يغوص الكاتب أشرف العشماوي في نفوسٍ مُعقَّدةِ التركيب، ناسجًا أحداثه في عوالم جديدةٍ مُدهشة، ومفارقات مُضحكةٍ مُبكية، عبْر إيقاعٍ سرديٍّ جذاب، يُثري الفكر ويُثير الخيال، تاركًا مساحة رحبة من التأويل للقارئ.', NULL, 660, 2, NULL, 100.00, NULL, '2021-03-05 23:33:09', '2021-03-05 23:33:09'),
(1075, 'أبى فييودور دستو فيسكى', 'أبى-فييودور-دستو-فيسكى', 'http://books.google.com/books/content?id=6VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952750', 'منذ مائة عام، في عام 1920 ، ظهرت الطبعة الأولى من كتاب لوبوف دستويڤسكايا ) 1869 - 1926 (، لوبا أوليليا أو إيميه، كما كانت تسمي نفسها – \"أبي فيودور دستويڤسكي\"، في ميونخ بالألمانية، ليصدر بعد ذلك في طبعات أخرى بالفرنسية والروسية. لقد وضعت ابنة الكاتب الروسي الأشهر ) 1821 - 1881 ( أمام نفسها هدفًا واضحًا هو أن تقدم للقراء حياة أبيها كاملة – من الميلاد وحتى الوفاة. لم تكتف أن تكون مجرد كاتبة مذكرات تعتمد على ذاكرتها الحادة، وإنما سعت لأن تكون كاتبة سيرة، وقد نجحت في أن تبعث إلى الوجود الحكايات التي قصَّتها عليها أمها أنَّا جريجوريڤنا عن حياتها العائلية مع دستويڤسكي: لقائهما الأول، خطبتهما، علاقاتها المتوترة مع أهل زوجها، السنوات الصعبة التي قضياها معا في الخارج، الأحداث التي سبقت ميلاد لوبوف دستويڤسكايا، ما حكاه أبوها لأمها عن طفولته، المعلومات ذات الطابع الحصري التي سيتعرف عليها القارئ هنا للمرة الأولى', NULL, 668, 2, NULL, 100.00, NULL, '2021-03-05 23:33:09', '2021-03-05 23:33:09'),
(1076, 'كل يوم نبي', 'كل-يوم-نبي', '', '', '9789778542585', '', NULL, 669, 2, NULL, 100.00, NULL, '2021-03-05 23:33:09', '2021-03-05 23:33:09'),
(1077, 'دولة سلاطين المماليك في مصر', 'دولة-سلاطين-المماليك-في-مصر', '', '', '9789777952149', '', NULL, 670, 2, NULL, 100.00, NULL, '2021-03-05 23:33:10', '2021-03-05 23:33:10'),
(1078, 'إحنا مين', 'إحنا-مين', 'http://books.google.com/books/content?id=bg_cDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=bg_cDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952781', 'هذا الكتاب يبحث في أصعب ما يفكر فيه أي إنسان!.. إحنا مين جسمانيًّا.. جينيًّا.. دينيًّا.. تاريخيًّا.. نفسيًّا..!.. إحنا مين في هذا الكون اللانهائي؟.. إحنا مين بالنسبة لهويتنا؟ إلى آخره..! قالها سقراط اعرف نفسك بنفسك... وقالها وندل هولمز: كل إنسان أربعة..! كما خلقه الله، كما يراه الناس، كما يراه أقرب الناس إليه، كما يرى نفسه. هذا كتاب صادم لأن صاحبه يفكر بصوت مسموع، ذلك لأنه لا يشتته شيء، ولا يخاف شيئًا! هذا كتاب لا يهم صاحبه رضاؤك عنه أوسخطك عليه ولكن يكفي صاحبه رضاء هذه الفئة القليلة من الباحثين عن الحقيقة ويفرحون بها. أخيرًا سألوا برنارد شو: ما سر النجاح؟ قال: أنا أعرف سر الفشل! هو محاولة إرضاء كل الناس!', NULL, 671, 2, NULL, 100.00, NULL, '2021-03-05 23:33:10', '2021-03-05 23:33:10'),
(1079, 'إنسان بعد التحديث', 'إنسان-بعد-التحديث', 'http://books.google.com/books/content?id=4jUuDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4jUuDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951302', 'يطرح الكتاب تساؤلات حول أعلى مرحلة للارتقاء البشري.. ما هي وكيف يمكننا بلوغها؟ مستعرضا إجابات عديدة لشخصيات من مختلف الأيديولوجيات والعصور أمثال: بتاح حتب، أرسطو، زرادشت، ابن سينا، تشيخوف، وابن الرومي، ونيتشة، وستيفن كوفي.. إلخ ليقدم إجابته العلمية في الفصل الأول. يبدأ الفصل الأول بشرح مراحل التطور النفسي الأربع، وطريقة تفكير الشخص في كل مرحلة منها، كيف يرى نفسه وحياته والناس من حوله.. وما إذا كان من المفيد أن نتطور نفسيا أو لا. وفي باقي فصول الكتاب يشرح كيفية إحداث هذا التطور النفسي في عدة جوانب الحياة، هي: نمط التدين - العلاقات الزوجية - حس السخرية – الحكمة - الذكاء العاطفي - المشاعر الإيجابية – الهوية - وكيفية التطور بعد الصدمات النفسية. يحتوي الكتاب على تدريبات وتطبيقات عملية، وتجارب مثيرة وحكايات حقيقية، ورسوم كاريكاتورية خفيفة الظل تساعد في إيصال الفكرة، ويستخدم لغة سهلة بعيدة عن استخدام المصطلحات الصعبة، رغم اعتماده على مراجع أكاديمية متخصصة مذكورة في الهوامش كي يستطيع أي باحث الرجوع إليها. كما أنه مطعَّم بكلمات مأثورة عن بعض المفكرين وذوي التأثير بالعلوم الإنسانية.', NULL, 667, 2, NULL, 100.00, NULL, '2021-03-05 23:33:10', '2021-03-05 23:33:10'),
(1080, 'المسكوت عنه فى التاريخ', 'المسكوت-عنه-فى-التاريخ', 'http://books.google.com/books/content?id=YOmIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=YOmIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952262', 'المسكوت عنه في التاريخ لا يكتسب الحديث قيمته إلا من خلال أمرين: إما جدته غير المسبوقة أو أهميته التي يستشعرها كل من القارئ والمؤلف .. وقد جمعنا لك – في الكتاب الذي بين يديك – الأمرين معًا: أولهما، الكتاب يضم تلك الموضوعات التي لا يعرفها غير متخصصين على درجة عالية من التخصص، تعرض لك بأسلوب حميمي لا يخاطب عقلك فحسب، وإنما يتوجه كذلك إلى وجدانك؛ لأنه يكتب سيرة ذاتية لهذا الوطن العبقري الرائع الذي نحيا فوق أرضه.. في كل مجالات الحياة من دين وعقائد وعلوم واجتماع وسياسة واقتصاد..وثانيهما ليس هناك أهم من قراءة تاريخ غير انتقائي وغير مزيف وغير متحيز، يرسخ لقواعد الانتماء والعشق اللذين نستشعر الآن افتقادهما – لدى البعض – تجاه الوطن.. الكتاب دعوة لأن تسجل كل حدث رائع في تاريخ الوطن، تستلهم منه الأمل والطاقة والقدرة على أن تضيف، وفي الوقت نفسه، دعوة أيضًا لأن نقرأ بوعي أخطاء الماضي ومآخذه، فنستلهم منها، جميعًا دون استثناء، العبرة والدرس؛ كي لا نقع فيها ثانية.. وهل هناك معلم أعظم من التاريخ!!', NULL, 671, 2, NULL, 100.00, NULL, '2021-03-05 23:33:11', '2021-03-05 23:33:11'),
(1081, 'هذه هى مصر', 'هذه-هى-مصر', 'http://books.google.com/books/content?id=-gGBCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=-gGBCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774279195', 'صدر حديثا عن الدار المصرية اللبنانية كتاب هذه هى مصر للدكتور وسيم السيسى، جاء الكتاب فى مائة واثنان وخمسون صفحة، جاء فى مقمتها اهداء الى من انقذ بلادى من ثقب اسود فلكى رهيب يلتهم الكواكب والمجموعات الشمسية، الى من تصدى لمحور الشر الصهيونية العالمية وعصاباتها الخمس المعروفة لكل انسان، الى من اعطى مصر حياة بعد موت، نورا بعد ظلام، املا بعد يأس. الى جيش بلادى .. القوات المسلحة، هذه هى مصر والذى تم اختياره بعناية لان وسيم السيسى لم يجد بلدا تعرض للظلم والافتراء مثل مصر، فلقد قالوا عنها انها حضارة قامت على السخرة بما فيها من عنف وظلم، ولو بحثوا ودققوا البحث فى معنى كلمة حضارة لعرفوا ان Civilization اى حضارة، جاءت من كلمة Civility، وهذه الكلمة معناها : الأدب ورقة التعامل مع الانسان الآخر، فكيف تقوم رقة وأدب على سخرة وقلة أدب', NULL, 671, 2, NULL, 100.00, NULL, '2021-03-05 23:33:11', '2021-03-05 23:33:11'),
(1082, 'مصر علمت العالم', 'مصر-علمت-العالم', 'http://books.google.com/books/content?id=FebJDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=FebJDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774277481', 'يتحدث الكتاب عن الحضارة الفرعونية القديمة ليس بشهادة المصريين فقط ولكن بتعليق وشهادة تملؤها الانبهار والاحساس بالعظمة والقيمة لهذه الحضارة على لسان عظماء من الغرب فيقول المؤلف \" هزمناهم ليس حين غزوناهم بل حين انسيناهم تاريخهم وحضارتهم \" فنحن نمتلك اعظم تاريخ اطلق عليه جيمس هنرى فجر الضمير لان تاريخ البشرية كان مظلماُ قبل الحضارة المصرية القديمة وبنفس الانبهار قال جان فرانسوا شامبليون: يتداعى الخيال ويسقط بلا حراك تحت اقدام الحضارة المصرية القديمة', NULL, 672, 2, NULL, 100.00, NULL, '2021-03-05 23:33:11', '2021-03-05 23:33:11'),
(1083, 'في البدء كانت مصر', 'في-البدء-كانت-مصر', 'http://books.google.com/books/content?id=u8LxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=u8LxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951050', 'في البدء كانت مصر. قبل أن تُدرك الدنيا حقيقة وجودها، وقبل أن ينتبه التاريخ من غفوته الاستثنائية، كانت مصر حديقة غنَّاء، تحوي زهور الحضارة والرُّقي الإنساني، التي زرعها أبناؤها بعبقرية ما زالت تُدهش البشرية، وستظل. إنها حديقة مبهرة، زهورها: العدالة، والدين، والطب، والهندسة، والعمران، والنقاء الكامن في زهرة اللوتس المقدسة.. وما زالت ثمار هذه الحديقة يانعة، رغم مرور آلاف السنين. إلى هذه الحديقة الغنَّاء، يأخذنا د. وسيم السيسي في رحلة شيقة عَبْرَ هذا الكتاب؛ لنستنشق بديع أزهارها، ونتعرف إلى رموزها وعباقرتها؛ وقبل أن نعود معه من هذه الرحلة المدهشة، نُدرك أن مصر التي بدأت الحضارة منذ الأزل، ستبقى بأسرارها العبقرية إلى الأبد!', NULL, 673, 2, NULL, 100.00, NULL, '2021-03-05 23:33:11', '2021-03-05 23:33:11'),
(1084, 'اللوكاندة', 'اللوكاندة', 'http://books.google.com/books/content?id=1VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=1VrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952668', 'الأنفاس من الصفحة الأولى، حيث يمتزج الواقع بالخيال في حكاية عجيبة. فنتعرف على الصراع العنيف بين الوالي عباس حلمي الأول والفلاح البسيط عليوة أبو زهرة، ويذهلنا دهاء الدكتور الإنجليزي وليام براون طبيب الوالي، ونعجب من فرط حيوية أدهم بك العثمانلي المزواج، ونتأمل بسيمة أول فتاة مصرية تدرس مبادئ الأديان السماوية الثلاثة وتتعلم العزف على البيانو. في هذه الرواية يقودنا ناصر عراق بسلاسة نحو حارات القاهرة وأزقتها، فنتجول في درب قرمز بالحسين، ونزور \"اللوكاندة\" التي تتوسط هذا الدرب ونعرف ما يدور فيها من صراعات اجتماعية ونفسية حادة انعكست على مصر كلها.', NULL, 674, 2, NULL, 100.00, NULL, '2021-03-05 23:33:11', '2021-03-05 23:33:11'),
(1085, 'طعم النوم', 'طعم-النوم', 'http://books.google.com/books/content?id=rFOxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=rFOxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952316', '“أنا حلمُ شخصٍ آخر.أكتب قصتي هذه وأنا نائمة. الناس يعتقدون أننا لكي نحكي قصةً تخصنا ينبغي أن نكون مستيقظين كأن علينا أن نحمي حياتنا مرتين، حين نعيشها وحين نرويها. وأنا أقول إن أحدًا لا يستطيع أن يروي قصته الحقيقية، أو ما يظنها قصته الحقيقية، دون أن يكون مغمضًا. يكتب النومُ هذه القصة، بلغته، لغة يستحيل على يدي المستيقظة أن تمتد إلى معجمها لتصيغ عبارة.. إنها إرادته هو، وسواءً تعلمتُ بعض الكلمات أو لم أقرأ حرفًا على الإطلاق، فإنه يسرد هذه الحكاية نيابةً عني، ففي النوم يصبح الجميعُ شعراء', NULL, 675, 2, NULL, 100.00, NULL, '2021-03-05 23:33:12', '2021-03-05 23:33:12'),
(1086, 'عجائز البلدة', 'عجائز-البلدة', 'http://books.google.com/books/content?id=21rVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=21rVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952699', 'يحوي الكتاب حكايات تكشف جانبًا من تاريخنا الاجتماعي المنسي، وينجلي في سطوره كل ما يربطنا بجذورنا البعيدة، ليجعل الحنين يجرفنا نحو زمن و في غفلة منا، ولن نستعيده أبدًا إلا حين يغوص كلٌّ منا في ذاكرته، التي أضناها الشوق والأسى، بسبب غربتنا الطويلة، خلال سنين نقلتنا من طفولة عفية إلى شيخوخة واهنة. يستعيد الكاتب كل ما عرفه ولمسه عن آلات وحالات وأدوات، سادت ثم بادت، بعد أن جارت عليها الأيام. هنا نقرأ عن خمسٍ وستين آلة ريفية، ذهب أغلبها مع ريح عصرنا المتوحش، مثل: النُّورَج والطَّنبُور والسَّاقية والشَّادوف والمِحرَاث والحَصِير والخُص والطُّلمْبَة والعَصِيد والرَّحَاية والدَّمَّاسة و بَملة الجَاز والطَّاحونَة والمَاجُور والنَّامُوسِيَّة والغُرْبَال والسِّيجَة والخُلخَال والكِردَان وغيرها.', NULL, 676, 2, NULL, 100.00, NULL, '2021-03-05 23:33:12', '2021-03-05 23:33:12'),
(1087, 'أنا والسينما', 'أنا-والسينما', '', '', '9789772937424', '', NULL, 677, 2, NULL, 100.00, NULL, '2021-03-05 23:33:12', '2021-03-05 23:33:12'),
(1088, 'Dare to Be Happy', 'Dare-to-Be-Happy', '', '', '9780648791102', '', NULL, 678, 2, NULL, 100.00, NULL, '2021-03-05 23:33:12', '2021-03-05 23:33:12'),
(1089, 'أن تكون نفسك', 'أن-تكون-نفسك', 'http://books.google.com/books/content?id=lMFRCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=lMFRCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774277207', 'في هذا الكتاب قرر المؤلف أن يقول الحقيقة لتصل إلى القُراء وليس عادة كما يقال في كتب أخرى ، فيقول الحظ له تأثير كبير في نجاحنا ، الظروف تتحكم في مستوى سعادتنا ، ليس كل المتدينين سعداء ، السعادة من الممكن شراؤها بالمال . ففي هذا الكتاب سنعرف كيفية تحقيق السعادة الحقيقية طبقًا لأحدث الدراسات والأبحاث العلمية حول العالم ، والمؤلف دائم الحرص والدراسة والبحث في مجال التنمية الذاتية وتطوير الشخصية', NULL, 679, 2, NULL, 100.00, NULL, '2021-03-05 23:33:12', '2021-03-05 23:33:12'),
(1090, 'كيف تصبح انسانا؟', 'كيف-تصبح-انسانا؟', 'http://books.google.com/books/content?id=6sVRCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6sVRCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774279096', 'هل الانسان مجرد حيوان يدعى انه ليس كذلك؟ سؤال صادم وكذلك عنوان هذا الكتاب ومحتواه! .. فهو ليس ككتب التنمية الذاتية التقليدية بل هو كتاب يناقش موضوعات متنوعة كالطبيعة البشرية ومعنى الحياة والارادة والاخلاق والدين، وكيفية تنمية كل هذا طبقا لأحدث الدراسات والأبحاث العلمية، على صفحات هذا الكتاب ستتعرف على الخوذة التى تستدعي الرؤى الروحية .. على دور السكر فى تقوية الارادة وعلى تاثير تقدير الجمال فى تحقيق الاهداف وستقرأ ايضا عن عيوب العقل، انواع الزواج، المكونات الثلاث لمعادلة السعادة .. وما الى ذلك. فى هذا الكتاب تحذير لأحادي الرؤية من قراءة هذا الكتاب، لأنه يستهدف القارئ الذي يؤمن أن الوصول للحقيقة لا يكون إلا باختلاف الرؤى وتعددها. هذا الكتاب مختلف .. لقارئ مختلف', NULL, 667, 2, NULL, 100.00, NULL, '2021-03-05 23:33:13', '2021-03-05 23:33:13'),
(1091, 'تخلص من عقلك', 'تخلص-من-عقلك', 'http://books.google.com/books/content?id=5w5SCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=5w5SCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774277405', 'هذا الكتاب على عكس كل كتب التنمية الذاتية ، فهو يدعو القارئ للتخلص من عقله ؛ بحيث يفكر كل إنسان في طريقة تفكيره ومعتقداته وموروثاته الاجتماعية : هل هي من مقومات النجاح أم هي من معوقات النجاح ، فيعالج الكتاب هذه النقاط حيث إنه أول كتاب في التنمية الذاتية والبشرية . والمؤلف هو طبيب أسنان يعمل فنانًا للكاريكاتير ومحاضرًا في مجال التنمية الذاتية ، وهو حاصل على ماچستير إدارة أعمال في تخصص إدارة الموارد البشرية بتقدير امتياز', NULL, 679, 2, NULL, 100.00, NULL, '2021-03-05 23:33:13', '2021-03-05 23:33:13'),
(1092, 'لقاء إبليس', 'لقاء-إبليس', 'http://books.google.com/books/content?id=0JkkDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=0JkkDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951098', '', NULL, 680, 2, NULL, 100.00, NULL, '2021-03-05 23:33:13', '2021-03-05 23:33:13'),
(1093, 'أداجيو', 'أداجيو', 'http://books.google.com/books/content?id=PgR2CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=PgR2CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789774279232', 'صدر عن الدار المصرية اللبنانية رواية أداجيو للكاتب والروائي ابراهيم عبد المجيد وتعد هذه الرواية هى قصة حب كبيرة استثنائية فى الفراق، فيها من البهجة الكثير، لكنها مثل \" الأداجيو \" الحزين، لحن الوداع .. الأداجيو وهى المقطوعة الموسيقية، ينتقل بها الكاتب الكبير من عواله الأثيرة، المدن، والصحراء ..الى الروح الانسانى فى لحظات لا تتكرر', NULL, 655, 2, NULL, 100.00, NULL, '2021-03-05 23:33:13', '2021-03-05 23:33:13'),
(1094, 'زيارة أخيرة لأم كلثوم', 'زيارة-أخيرة-لأم-كلثوم', 'http://books.google.com/books/content?id=yVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=yVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952613', 'زرتها، بعد أيام مِن إصابتها بجلطةٍ تركَت نصفَها الأيسر مشلو .ًال كانت تنطق بصعوبةٍ. قبّلتُ جبينَها وتبادلنا كلاما معتادا في مثل تلك المواقف. اتضح لي لحظتها أنها زهدت الحياة؛ إلا قلي ،ًال فلمحتُ طيف \"عقل\" أعلى السرير وعلى وجهه ابتسامةُ رضا. كانت \"الست\" تشدو: \"كان لك معايا أجمل حكاية في العمر كله\". كان الراديو العتيق إلى جوارها فوق السرير بناءً على طلبها، فيما صورُ زوجها الراحل وأبنائها وأحفادها موزَّعة على الحوائط. كان بينها صورةٌ فوتوغرافيةٌ لها، في هيئة \"الموناليزا\". بعد أيام ستفقدُ النطقَ. سترفض تناول أي طعام، ثم سيحملونها فاقدةً الوعي إلى العناية المركزة، بمستشفى المنصورة الدولي.', NULL, 681, 2, NULL, 100.00, NULL, '2021-03-05 23:33:14', '2021-03-05 23:33:14'),
(1095, 'حكايات زواج العباقرة والمشاهير', 'حكايات-زواج-العباقرة-والمشاهير', 'http://books.google.com/books/content?id=Hg_8DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Hg_8DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777951159', 'هذا كتاب يتحدث عن الجوانب الخفية في حياة العباقرة والمشاهير، تلك الخاصة بالزواج، ومدى تأثيره على مسيرتهم وحياتهم، استعان فيه الكاتب بمخزونه الإبداعي الثري، وموهبته القصصية المتأججة؛ ليُقدِّم للقارئ مادة ثقافية مشوقة، تعرض الكثير من الأسماء المعروفة، بمنظورٍ مختلفٍ، وصورةٍ قلميةٍ مغايرةٍ للمطروح.. ومن خلال حكايات زواج العباقرة والمشاهير، أعاد الكاتب تقديم عددٍ من الأسماء المعروفة عربيًّا وعالميًّا، منهم: شجرة الدر، ومحمد علي، وملك حفني ناصف، وفاطمة رشدي، وبديعة مصابني، وتولستوي، وتشايكوفسكي، وإبراهام لنكولن، ومصطفى كمال أتاتورك، وفيفيان لي، ومارلين مونرو.', NULL, 682, 2, NULL, 100.00, NULL, '2021-03-05 23:33:14', '2021-03-05 23:33:14'),
(1096, 'دويتو', 'دويتو', 'http://books.google.com/books/content?id=FW_DwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=FW_DwgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789774278068', '', NULL, 683, 2, NULL, 100.00, NULL, '2021-03-05 23:33:14', '2021-03-05 23:33:14'),
(1097, 'انا حرة', 'انا-حرة', 'http://books.google.com/books/content?id=csJRCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=csJRCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777950053', 'قال وبين شفتية ابتسامة ساخرة وما اظنش انك حرة قالت فى حدة وكانها اهينت مش حرة ازاى انا اتحررت من كل حاجة اتحررت من العباسية وتحررت من التقاليد وتحررت من الزواج وتحررت من حاجتى لواحد سصرف على انا دلوقتى زيى زيك انت عندك شهادة وانا عندى شهادة وانت بتشتغل وانا بشتغل وانت بتكسب وانا باكسب ومؤكد انى باكسب اكتر منك يبقى ازاى انا مش حرة ناقصنى اية علشان ابقى حرة وكان صوتها قد بدا يرتفع وبدت كانها غاضبة ورد عليها فى هدوء بارد وابتسامتة الضيقة تشق شفتية : ناقصك انك تكونى حرة!!', NULL, 684, 2, NULL, 100.00, NULL, '2021-03-05 23:33:15', '2021-03-05 23:33:15'),
(1098, 'زوجات ضائعات', 'زوجات-ضائعات', 'http://books.google.com/books/content?id=3WaHDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=3WaHDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777950527', '', NULL, 685, 2, NULL, 100.00, NULL, '2021-03-05 23:33:15', '2021-03-05 23:33:15'),
(1099, 'كن عاشقا_شعر', 'كن-عاشقا_شعر', 'http://books.google.com/books/content?id=WCwDyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=WCwDyAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789777952125', 'المرأة أكثر رُقيًّا من الرجُل في مسألة الحُب ، إذ إن الحُبَّ هدفها، ومُبتغاها، وإذا ما غاب الحُبُّ عنها، تعيش حياةً يصيبها الفقد في كُلِّ شيء.وليت الرجل يعرف أنَّ المرأة تحتاجُ إلى العشق أولًا، ثم الوصل الجسدي، يأتي في مرتبةٍ تاليةٍ. وكثير منا يعيش ولا يعرف ما الحُب، ومامكانته؟ وقبل أن تعرف كيف تحب، عليك إدراك ما هو الحب؟ ولماذا نحب؛ لأنَّ الحُبَّ صار ضائعًا وغريبًا بين الناس مُمارسةً وسلوكًا أحمد الشهاوي في هذا الكتاب يؤكد أن العشق فلسفة الفطرة التي يكون عليها المُحبُّ والمحبُوب؛ وهو أساسُ الفضائل وأصلُها ؛ لأنَّ النفسَ فُطِرت على العشق، فالعشق ديانةٌ يؤمنُ بها من في جوفه قلبٌ ينطقُ. والكتاب يؤكد أن لا حُب يحيا تحت مظلة شرطٍ أو طلبٍ أو غرَضٍ؛ لأننا عندما نعشقُ، يكون اليوم الذي نحياه بألفِ يومٍ مما كُنَّا عليه قبل العشق، لأن عُمر الإنسان يُقاسُ بما (قبل الحُب) ، وبما (بعد الحُب)', NULL, 686, 2, NULL, 100.00, NULL, '2021-03-05 23:33:15', '2021-03-05 23:33:15'),
(1100, 'مسيرة فلان العلانى في برشلونة', 'مسيرة-فلان-العلانى-في-برشلونة', 'http://books.google.com/books/content?id=4k7SDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4k7SDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952286', '“لكل منا لحظتان للميلاد، لحظة الميلاد الحقيقية، وهذه تفرض علينا ولا نختارها، ولحظة الميلاد المختارة وهذه هي التي نختارها بإرادتنا، قد يكون الميلاد في وظيفة طالما تمنيتها، أو امرأة طالما اشتهيتها، أو حتى سيارة حلمت باقتنائها ولقد شاهدت وعاصرت الكثير من البشر سعوا بشتى الطرق من أجل الحصول على هذه اللحظة، لحظة الميلاد المختارة، لكنهم ماتوا قبل الوصول إليها، سبقت الوفاة لحظة الميلاد، وكان هدفي ألا أكون واحدا منهم”. *** هي رواية تُرجّع أصداء رواية البيكاريسك، من دون كيشوت وحتى خيري شلبي وبينهما الكثيرون، حيث السارد الصعلوك المتجول، السارد الرائي والذي لا يملك في رحلته سوى سيفٍ من خشب. لا فضل هنا للغة على أخرى، فالفصحى تلد العامية والعكس، عالمٌ عرضة للتهكم يردد أحيانًا صدى بعيدًا من روح ألبير قصيري الساخرة والعدمية ومن انحيازه للمدينة «المبتذلة» المختبئة تحت واجهتها المضيئة والكاذبة', NULL, 687, 2, NULL, 100.00, NULL, '2021-03-05 23:33:15', '2021-03-05 23:33:15'),
(1101, 'بالأمس كنت ميتا', 'بالأمس-كنت-ميتا', 'http://books.google.com/books/content?id=t1rVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=t1rVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952552', 'هذه الرواية هي ولائم من خيبات، ودموع، وحب مهزوم. جغرافيًّا تتوزع على أراضٍ شاسعة بحجم الآلام البشرية، تمتد من مناطق الإمبراطورية العثمانية الآفلة، وحتى مصر. تختلط الأنساب، تتجاور القوميات والهويات لتتصالح وتتناحر. زمن يمتد لأكثر من قرن وربع، تختصره هذه الملحمة على لسان شخوصها، فنقرأ عن الإبادة الجماعية للأرمن، كما عن التاريخ الكردي. تُظهِر الرواية أن السياسة تفسد حياة الشعوب والأديان، فيصبح لكل قومية أو دين أنياب ومخالب، ينشبها في لحم الآخرين المختلفين.', NULL, 688, 2, NULL, 100.00, NULL, '2021-03-05 23:33:16', '2021-03-05 23:33:16'),
(1102, 'من شرفة بيتهوفن', 'من-شرفة-بيتهوفن', 'http://books.google.com/books/content?id=wVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=wVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952583', 'حين وصل بالقهوة كان فرج ممسكًا بكفها يتحسسه، يقرأ لها الطالع، بينما ضربات القدر لبيتهوفن تعلو.شربت قهوتها في فنجان فخاري بسيط، نظرت له كثيرًا، لعلها تنتقد بداخلها بساطة المكان، الذي يخلو من الرفاهية، فقط اللوحة التي لم يستطع مقاومتها، تمثال رخامي صغير لأفروديت، غير ذلك كل المساحات مفتوحة، النباتات تنتشر في أرجاء المكان، تضيف بهجة وصفاء، الأرض تفترش بالخيش البني، معظم أدوات المائدة من الفخار والخشب .» اثنتان وعشرون قصة لا رابط بينها سوى إبداع السهل الممتنع، بين لعبة \"سكت الجميع\"، وفتاة لها \"شامة وقلبٍ قاسٍ\"، ولص تحول بعد اقتحامه شقة بها مكتبة ضخمة من صاحب عمل حر إلى \"قراءة حرة\" وعشيرة فى الأدغال اختلف أهلها في تحديد وظيفة ل\"ساحر القبيلة\".', NULL, 689, 2, NULL, 100.00, NULL, '2021-03-05 23:33:16', '2021-03-05 23:33:16'),
(1103, 'شهيا كفراق', 'شهيا-كفراق', 'http://books.google.com/books/content?id=DCbBwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=DCbBwQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9786144386255', 'Bogens tema er kærlighed. Den er inddelt i to dele. Den første del handler om at skrive, kærlighed og livet. Den anden del af bogen handler om venskabet mellem to kvinder og ulykkelig kærlighed fortalt gennem dialog i brevform', NULL, 690, 2, NULL, 100.00, NULL, '2021-03-05 23:33:16', '2021-03-05 23:33:16'),
(1104, 'رسالة من شبح', 'رسالة-من-شبح', '', '', '9789953263908', 'Eight years after his beloved wife, Elizabeth, was supposedly murdered by a serial killer, Beck receives information that suggests she may still be alive, but his search for the truth could mean setting himself up as the prime suspect in a number of crimes.', NULL, 113, 2, NULL, 100.00, NULL, '2021-03-05 23:33:16', '2021-03-05 23:33:16'),
(1105, 'يهود الإسكندرية', 'يهود-الإسكندرية', 'http://books.google.com/books/content?id=6x-fDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6x-fDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937325', 'هذه الرواية لا تؤرخ ليهود الأسكندرية، بقدر ما تصنع اسطورة فنية، ترصد كيفية تحول \" جون\" ، حلاق الصحة اليهودي الأبلة، الى \"ولي\" من اولياء الله الصالحين، بعد ان يمنحه الوالي \"أبعادية\"، تكون سببا في قتله، ثم يقيم له قاتلوه ضريحا، ويصبح له \"مولد\" يحتفل به اليهود كل عام.', NULL, 691, 2, NULL, 100.00, NULL, '2021-03-05 23:33:17', '2021-03-05 23:33:17'),
(1106, 'مطرقة الساحرات', 'مطرقة-الساحرات', 'http://books.google.com/books/content?id=dZHZDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=dZHZDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776541863', 'هذا أسود شيء كتبته يد انسان .. راحت ضحيته أكثر من ربع مليون امرأة .. سُفكت دمائهن باسم هذا الكتاب .. وحُرقن باسم هذا الكتاب .. أو هو شيطان الذي كتبه .. لبس عباءة القساوسة وسمى نفسه هنريش كريمر .. وأخرج لنا هذا الشر المغلف بغلاف الدين .. فأعمى القلوب والأبصار وغسل عقول الملايين .. كهنة .. جنود .. شعب .. حالة من الجنون اجتاحت أوروبا فأحرقوا الرجال والنساء والأطفال .. وليس يقال عن هذا الكتاب شيء إلا أنه رجس .. رجس من عمل الشيطان .', NULL, 692, 2, NULL, 100.00, NULL, '2021-03-05 23:33:17', '2021-03-05 23:33:17'),
(1107, 'قواعد جارتين', 'قواعد-جارتين', 'http://books.google.com/books/content?id=cf5kDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=cf5kDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776541603', 'ماذا لو وجدت نفسك بأرضٍ أقصى ما يمكنك بلوغه بها هو خمسون عامًا .. ليست هذه القاعدة الوحيدة فحسب، بل هناك ما هو أكثر من ذلك .', NULL, 693, 2, NULL, 100.00, NULL, '2021-03-05 23:33:17', '2021-03-05 23:33:17'),
(1108, 'قوة التفكير السلبى', 'قوة-التفكير-السلبى', 'http://books.google.com/books/content?id=FbMSEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=FbMSEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789779921259', '‏\"من بين التفاؤل والتشاؤم والواقعية، أناقش الواقعية كوسيلة فعّالة لتحقيق أهم النتائج الإيجابية\".‏ بوب نايت. يُعَد بوب نايت أحد أبرز المدربين على مرّ العصور؛ حيث أسس الطريقة الواقعية للتفكير السلبي، ‏وأثبت أن بإمكانه تحقيق نتائج إيجابية وفعّالة مقارنةً بالتفاؤل غير الواقعي. ثم استدل على موقفه ‏بالمقارنة بين طريقتين مشهورتين للتفكير، التفكير الإيجابي البحت، والتفكير الواقعي الذي يتبنّاه.‏ فمثلًا كتاب \"قوة التفكير الإيجابي\" لـ \"نورمان فينسنت بيل\" وهو أحد أفضل الكتب الكلاسيكية مبيعًا؛ ‏حيث ألهم الملايين حول العالم بمنهج تفكير متفائل، وهذه هي الطريقة الأولى، أما في هذا الكتاب؛ \"قوّة ‏التفكير السلبي\" وبطريقة مُشوّقة ومُلهمة يدحض بوب نايت هذه الفكرة، حيث يفسّر مدرّب كرة السلة ‏الأسطوري نايت لماذا يحقق \"التفكير السلبي\" نتائجه الإيجابية سواء في الرياضة أو في حياتنا اليومية.‏', NULL, 694, 2, NULL, 100.00, NULL, '2021-03-05 23:33:17', '2021-03-05 23:33:17'),
(1109, 'بيت خالتي', 'بيت-خالتي', 'http://books.google.com/books/content?id=p7ISEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=p7ISEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789779921136', 'عندما عرفت تفاصيل ما حدث، لم أستطع أن أواصل حياتي كما لو أني لم أعرف. لم أستطع أن أطوي الصفحة، وأنسى. حاولت. لكن فشلت. ألم المعرفة كان مختلفًا. يثقل الروح والجسد معًا. وشعور العجز كان أكبر من طاقتي على التحمل. لقد عرفت! فماذا بعد؟ هل تستطيع أن تفعل شيئًا؟ الشيء الوحيد الذي خفف عليَّ هو أن أكتب ما حدث. هذا كل ما أستطيعه.', NULL, 695, 2, NULL, 100.00, NULL, '2021-03-05 23:33:18', '2021-03-05 23:33:18'),
(1110, 'أولاد الناس', 'أولاد-الناس', 'http://books.google.com/books/content?id=fqbdDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=fqbdDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789771456544', 'لم تدر بنفسها وهي تطوق صدره، وتهمس في فرح طغى على كل المشاعر الأخرى: محمد! -لم تنطقي اسمي هكذا من قبل. -أنت أفضل زوج في كل البلاد. -مع أنني من المماليك؟ -مع أنك من المماليك. سلط نظره إلى عينيها وقال: \"زينب\"، اصدقيني القول، ماذا يقول العامة عن المماليك؟ وإياك أن تكذبي. قالت في خضوغ: يحمون البلاد ويضحون بأنفسهم وحياتهم. ابتسم في تهكم ثم قال: وأهل مصر يفهمون هذا؟ يعرفون الأخطار؟ طأطأت رأسها ثم قالت: ربما لا يدركون سوى أخطار الوباء والفقر يا مولاي، للإدراك يوم وميعاد، مثله مثل الموت والميلاد ... الجهل يعمي البصيرة ويخرج الضغائن، ربما لو عرف أهل مصر المماليك أكثر لتلاشى الخوف...', NULL, 696, 2, NULL, 100.00, NULL, '2021-03-05 23:33:18', '2021-03-05 23:33:18'),
(1111, 'أمانوس', 'أمانوس', 'http://books.google.com/books/content?id=xUmFDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=xUmFDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776542495', 'الجزء الثالث من سلسلة مملكة البلاغة \"إن كُنت تتابع معنا سلسلة مملكة البلاغة ووصلت للجزء الثالث فحتمًا أنت مُحارب، أكاد أنظر إلى عينيك وأنت تقرأ كلماتي، أرى الشّغف والشوق إلى مغامرة جديدة يطلّ منهما، فمرحبًا بك. ما زالت مملكة البلاغة تستدعي المحاربين للدفاع عن الكتب، وعن القيم، وعن طُهر الكلمات التي دوّنت بين دفّتي تلك الكتب، والمحاربون يتهيئون هنا وهناك، وفي لحظة فارقة، وفجأة، سيظهر لك الرّمز كما ظهر لغيرك، وستدور الكُتب حولك في الهواء، وسترى صورتك في كتاب خلت صفحاته من الكلمات، سيقشعرّ بدنك، وستتسارع دقّات قلبك، وستركض نحو أبيك أو جدّك وأنت تحمل الكتاب الذي قام باختيارك، أنت بالذّات، وسيزورك صقر مهيب يخفق بجناحيه ليحملك إلى هناك، ستفاجأ أنّه يُحدّثك بلغة البشر، فلا تقلق عندما يصعد فوق رأسك، ولا تجزع عندما يغطي عينيك بريش جناحيه، فقد حان الوقت، وسترحل إلى \"مملكة البلاغة\"، حيث الضباب يلف كلّ شيء هناك، ستشعر دائمًا بالبرودة، الطيور هناك يغطيها ريشٌ غريب الشكل واللون، ستجدها أكبر حجمًا مما هي عليه هنا، الأشخاص غريبو الأطوار والهيئة والملابس، وكأنّ كلَّ مجموعةٍ منهم أتت من حقبة زمنية مختلفة، وهناك من جمعهم فجأة من أزمنتهم أو استدعاهم لمهمة ما، كما ستنتقل أنت إلى هناك، فهل أنت مستعد؟ أطلق لخيالك العنان، وحلّق معنا في رحاب تلك المملكة العجيبة، ودعني أكشف لك أسرارًا أخرى عن عوالمها التي تضجّ بالمغامرات، ولكن قبل أن نبدأ، دعني أُحذِّرك، عندما تقتني كتابًا عتيقًا أوراقه مصفرّة وباهتة، لا تُردد الطلاسم المنقوشة بالحبر الأحمر على هوامشه أبدًا، وخاصّة إن كُنت وحدك!\"', NULL, 697, 2, NULL, 100.00, NULL, '2021-03-05 23:33:18', '2021-03-05 23:33:18'),
(1112, 'دقات الشامو', 'دقات-الشامو', 'http://books.google.com/books/content?id=ZYSFDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ZYSFDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776542389', 'صارت الفوضى تعم كل شيء من حولنا، وصرتُ أنا والسيدة غفران والطبيب والقلة القليلة التي لم تتخلَّ عن مدرسة السيدة منبوذين في وادي النسالى .. انهار كل شيء فجأة، وعاد الوادي إلى ما كان عليه قبل سنوات، بل صار أسوأ من ذلك، وبدلًا من انتصار ثالث طمعنا في تحقيقه على أشراف چارتين يوم الغفران الأخير .. أُصبنا نحن بالضربة القاضية.', NULL, 693, 2, NULL, 100.00, NULL, '2021-03-05 23:33:19', '2021-03-05 23:33:19'),
(1113, 'حكايات العمر كله', 'حكايات-العمر-كله', 'http://books.google.com/books/content?id=JA4VEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=JA4VEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952927', 'حكابات العمر كله \"خليك دايما أقوى من الصدمات اللي تقابلك.. واتعلم تقف تاني مهما كعبلوك.. وسامح أعداءك حتلاقي أن التسامح أقوى من الانتقام.\" (مصطفى أمين) \"ملك الأفراح.. برنس الشاشة الصغيرة.. سفيرالبهجة والسرورو الإيجابية في الحياة.\" (د. يوسف إدريس) \"لما تلاقي نفسك نجحت قوي.. اختفي شوية.. خلي أعداء النجاح ينسوك شوية.. ها ترتاح قوي!\". (أنيس منصور) \"أروع مافي سميرصبري رعايته لقدامى الفنانين وعشقه لفنه واحترامه لجمهوره .. إنه فارس نادرمن فرسان الزمن الجميل\". (د. زاهيحواس) \"سفيرالإسكندرية.. مواهبه المتعددة مثل بحره الاتعرف الصمت ولا الهدوء\". (مفيد فوزي) \"شكرًا لأبي وأمي.. فقدعلَّماني أن أحب ولاأكره ولاأحقد وأحببت مثلهم االقراءة ، خاصةالقرآن الكريم\". (سميرصبري)', NULL, 698, 2, NULL, 100.00, NULL, '2021-03-05 23:33:19', '2021-03-05 23:33:19'),
(1114, 'رجال غسان كنفانى', 'رجال-غسان-كنفانى', 'http://books.google.com/books/content?id=tVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=tVrVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789772937639', 'هذه رواية اقتناص؛ فهي تقتنص روح كاتب، وترتدي عباءته الشفيفة، بل وتستحضر بعض شخصيَّاته لتُعيد توظيفها من خلال شخصية «مروان » الفلسطيني الشارد، الذي يهجر وطنه من أجل أن يأتي بالمال الوفير ليفوز بحبيبته «صفية »، فتبدأ رحلة تيهه التي يضل خلالها طريقه، فبد من الذهاب إلى الكويت، يجد نفسه في طريقه إلى الأردن، ومنها إلى مصر، حيث يدخل متاهة جديدة من متاهاته المتتالية، يمر خلالها بسراديب «مريم » الحزينة، مستحضرًا طوال رحلته تجسُّدات أُمِّه التي تتهادى أمامه، وتتكثَّف في روحه، بينما يزداد انغماسًا في تيهه الأبدي!', NULL, 699, 2, NULL, 100.00, NULL, '2021-03-05 23:33:19', '2021-03-05 23:33:19'),
(1115, 'ايامى مع كايروكى وحكاية الجيل الذى اراد ان يغير العالم', 'ايامى-مع-كايروكى-وحكاية-الجيل-الذى-اراد-ان-يغير-العالم', 'http://books.google.com/books/content?id=ZOmIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ZOmIDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952163', 'أيامي مع كايروكي تحمسنا كثيراً حينما أخبرنا ولاء برغبته فى أن يكتب كتاباً عن جيلنا، وأن تكون كايروكي هى محور هذا الكتاب باعتبارها تجربة تعبر في مضمونها عن روح وأفكار كل من يشبهنا، وعلى الرغم من إدراكنا أن الكتاب سيحمل أكثر من مجرد سرد لرحلتنا الفنية والشخصية، إلا أن النتيجة فى النهاية فاجأتنا جميعاً. هذا الكتاب ليس عن كايروكي فقط، ولكنه عن الفن، الموسيقى، والإبداع. هو أيضاً كتاب عن الصداقة فى مواجهة الإحباط والتحديات، وكتاب عن الهوية والتاريخ. باختصار هذا كتاب عنا جميعاً كجيل يبحث عن صوته المتفرد وسط هذا العالم. نرجو أن تستمعوا بهذه الرحلة التي يأخذكم فيها الكاتب كما استمتعنا نحن برحلتنا معه طوال عامين كاملين.', NULL, 657, 2, NULL, 100.00, NULL, '2021-03-05 23:33:20', '2021-03-05 23:33:20'),
(1116, 'القصر الأسود', 'القصر-الأسود', 'http://books.google.com/books/content?id=05HZDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=05HZDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789779920894', 'اشتَهَتْ أن تكون سيدة القصر المَهيب المُحـاط بحديقــــة غَنَّـــــاء؛ أزهــــار وأشجــــار و أثمـــــار تســـــــر الناظريـن ، غيـــر مُدركــــة لظــــلال الماضي الأليم التي تَجثم بثقلها فوقه، ولا أطياف الحُب التي تُحاول أن تتسَوَّر مِحراب قلبها بغفلةٍ منها. فهل ستخرج مِن القصر بنفس الأحلام التي دخلتهُ بها، أم ستعجِنها التجربة بماءِ الندم؟', NULL, 700, 2, NULL, 100.00, NULL, '2021-03-05 23:33:20', '2021-03-05 23:33:20'),
(1117, 'رسائل سقطت من ساعي البريد', 'رسائل-سقطت-من-ساعي-البريد', 'http://books.google.com/books/content?id=SxHYDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=SxHYDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789779920825', 'حين تكون الحقيبةُ المكتظة بالأوراق على كتف الرجل.. أثقلَ من وزنه.. هذه ليست قصة ساعى الريد .. وإنما قصة الرسائل .', NULL, 701, 2, NULL, 100.00, NULL, '2021-03-05 23:33:20', '2021-03-05 23:33:20'),
(1118, 'أنتيخريستوس', 'أنتيخريستوس', 'http://books.google.com/books/content?id=9MhfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=9MhfDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778515671', 'لقد أصبحنا وحدنا أخيرا .. أنا وأنت .. ‏ أخيرا انفردت بك .. ‏ وصرت أملكك .. وأملك عينيك .. في كل مرة تنظر فيها إلى كلماتي .. و تقرأ فيها سطوري .. ‏ ستكون هذه هي آخر رواية ستقرأها لي في حياتك .. فأنا على شفا حفرة من الموت .. ‏ ولم يتبق لي في هذه الحياة إلا سويعات لا أدري عددها .. لكنني أعرف أنها قليلة .. وبرغم ذلك فهي كافية لأسقيك بما أريد أن أسقيك إياه من ‏الحديث.‏ قبل أن أبدأ أقول لك .. يجب أن تقرأ هذا الكتاب وتحرقه .. فسيحاولون التخلص منه ومن كل من قرأه .. كما فعلوا مع كل الكتب التي شابهته.', NULL, 692, 2, NULL, 100.00, NULL, '2021-03-05 23:33:21', '2021-03-05 23:33:21'),
(1119, 'بئر أبناء الرب', 'بئر-أبناء-الرب', '', '', '9789776541764', '', NULL, 702, 2, NULL, 100.00, NULL, '2021-03-05 23:33:21', '2021-03-05 23:33:21'),
(1120, 'أرض زيكولا', 'أرض-زيكولا', 'http://books.google.com/books/content?id=QslfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=QslfDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776382398', 'يقولون : الحب اعمى .. وهو يقول : (( اصابني العمي حين احببت ) .. و لكن ماذا يفعل ها هو قد احب و حدث ما حدث و ها هو يجلس كل يوم في حجرته ليكتب مجددا . (( أنا خالد حسني ثمانية و عشرون عاما خريج كلية تجارة القاهرة منذ ستة اعوان بلدي يسمى (( البهوفريك )) تابع لمحافظة الدقهلية و اليوم قد رفض زواجي بحبيبتي للمرة الثامنة و لنفس السبب )) ثم نظر إلى الحائط و قد قام بتعليق الورقة بجورا سبع ورقات أخرى يبدو انها علقت في اوقات سابقة .', NULL, 693, 2, NULL, 100.00, NULL, '2021-03-05 23:33:21', '2021-03-05 23:33:21'),
(1121, 'أمواج أكما', 'أمواج-أكما', 'http://books.google.com/books/content?id=prrZDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=prrZDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789779920870', 'كنت أظن أن تغيير القواعد يحتاج إلى القوة وحسب ، لكنه لم يكن بهذه السهولة قط ، لقد أثر أشراف جارتين أن يموتوا غرقى أسفل أمواج أكما على أن يتساووا معنا فى حق اكتساب الروح .', NULL, 693, 2, NULL, 100.00, NULL, '2021-03-05 23:33:22', '2021-03-05 23:33:22'),
(1122, 'عن أشياء تؤلمك', 'عن-أشياء-تؤلمك', 'http://books.google.com/books/content?id=oZHZDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oZHZDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789779920818', 'وعنها أكتب.. عن عشقها الجامح، وحنانها الدافئ.. أرسم ملامحها.. وعن مرارات خذلان وهجر وفراق.. أُكَفكِفُ بالأحرف والكلمات أدمُعًا مِن مقلتيها..', NULL, 703, 2, NULL, 100.00, NULL, '2021-03-05 23:33:22', '2021-03-05 23:33:22'),
(1123, '٧ أيام في التحرير', '٧-أيام-في-التحرير', '', '', '9789774276842', '', NULL, 683, 2, NULL, 100.00, NULL, '2021-03-05 23:33:23', '2021-03-05 23:33:23'),
(1124, 'البلدة الاخرى_رواية', 'البلدة-الاخرى_رواية', 'http://books.google.com/books/content?id=bB0DEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=bB0DEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777952002', 'تجربة الغربة، أو المنفى الاختياري، لشاب مصري هاجر للعمل مثل الملايين في السبعينيات من القرن الماضي، يصف فيها وصفا حيا أوضاع المهاجرين أمثاله من مصريين وأمريكان وكوريين وباكستانيين وعرب وغيرهم. كذلك عادات سكان المدينة، في جو من الطرافة المثيرة. وكيف تنتهي شخصيات الرواية إلى مصائر غريبة تتمازج فيها المأساة بالملهاة، وفي لغة هي بنت المكان الشاسع الاتساع الخالي إلا من الصمت!', NULL, 655, 2, NULL, 100.00, NULL, '2021-03-05 23:33:23', '2021-03-05 23:33:23'),
(1125, 'Harif al-batriyark', 'Harif-al-batriyark', '', '', '9789778280173', '', NULL, 704, 2, NULL, 100.00, NULL, '2021-03-05 23:33:24', '2021-03-05 23:33:24');
