(1127, 'المطمورة', 'المطمورة', '', '', '9789778560039', 'En ung mand har en gang imellem mærkelige drømme, blandt andet bliver han fortalt, at han skal forlade sin by', NULL, 706, 2, NULL, 100.00, NULL, '2021-03-05 23:33:24', '2021-03-05 23:33:24'),
(1128, 'كاهن الجان', 'كاهن-الجان', 'http://books.google.com/books/content?id=W4unDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=W4unDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776634213', '‏الأجساد المادية لا تعي كلَّ ما تراه حولها، العقل يغفل الكثير كي لا ‏يجن أحيانًا، رأيت هذا الآن بوضوح بعد أن مُنِحتَ البصيرة حتى إنني ‏صرت أرى الجانب الآخر بوضوحٍ أكبر من قدرتي على رؤية العالم المادي، لم ‏يعد لأيٍّ مما حولي مذاق، لون، أو مصداقية بعد أن أدركت أن هناك المزيد، بصيرة كاملة داخل بصرنا المادي المحدود.. ‏', NULL, 707, 2, NULL, 100.00, NULL, '2021-03-05 23:33:25', '2021-03-05 23:33:25'),
(1129, 'مدمن نجاح', 'مدمن-نجاح', '', '', '9789778563153', '', NULL, 708, 2, NULL, 100.00, NULL, '2021-03-05 23:33:25', '2021-03-05 23:33:25'),
(1130, 'Cocoon Book', 'Cocoon-Book', '', '', '9780578439273', '', NULL, 709, 2, NULL, 100.00, NULL, '2021-03-05 23:33:25', '2021-03-05 23:33:25'),
(1131, 'الأرقم', 'الأرقم', '', '', '9789777781640', '', NULL, 710, 2, NULL, 100.00, NULL, '2021-03-05 23:33:25', '2021-03-05 23:33:25'),
(1132, 'الزعفرانة', 'الزعفرانة', 'http://books.google.com/books/content?id=VhlfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=VhlfDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061086', 'هنا موعدُ مختلف. حبيبان التقيا صدفة.. لا هما يعرفان بعضهما ولا هما غريبان عن بعضهما! مُرتبطان رغم كل تلك الغربة. \"يحيى الطيب\" خبير الآثار المصري الذي يحاول الهرب من حكايات الحبيبات القديمات، ومن لعنة كسرة القلب ومرارة الوحدة في نهاية كل علاقة، فيهرب إلى الصحراء بحثًا عن سرٍ قديمٍ.. و\"ياسمينا\" الفتاة اليونانية التي جاءَت إلى مِصر هربًا من لعنةٍ تصيبها كلما اقتربت من الرجال. فحاولت اللجوء إلى صحراء مصر ومعها سرٌّ قديمٌ، ومفتاحٌ لكل ما يبحث عنه يحيى. يلتقيان صدفة، أو هكذا ظنَّا، لتبدأ رموز كل الشفرات تُحل وتتشابك أيضًا، هكذا الأمرين معًا.', NULL, 711, 2, NULL, 100.00, NULL, '2021-03-05 23:33:26', '2021-03-05 23:33:26'),
(1133, 'أرض شنعار ونبوءة دانيال', 'أرض-شنعار-ونبوءة-دانيال', 'http://books.google.com/books/content?id=I1zVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=I1zVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778062212', 'يقولون ان الشاة تعيش عمرها تخشى الذئب لكن الراعي هو من يذبحها في النهاية\" بهذه الجملة تبدأ الرواية الملحمية والتي ما أن تقرأ أول صفحة فيها حتى تلتهمك أحداثها وتغرق بين صراعات أبطالها التي لا تنتهي قبل أن تسرق كل ما لديك من شغفٍ فضول. تطرح الرواية تساؤل هام جدًا ألا وهو \" هل يقودنا الانتقام لطريق يخالف مبادئنا ومعتقداتنا؟\" الرواية تدور في دراما ملحمية حول أبناء \"يوسف الأمير\" بالأخص الإبن الأكبر \"يزن\" الذي قام بتحريض من عمه \" قابيل الأمير\" بظلم شديد لزوجة أبيه وطفليها.. بعد وفاة \"يوسف الأمير\" تتعقد الدراما ويكبر الأبناء ويتجلى الانتقام في الصدور.. إلا أن عددا من الأسرار الهائلة والخبايا التي حوتها تلك العائلة وعلاقة أبطالها الغريبة ببعضهم البعض تأخذ الأحداث إلى سياق جديد ومناطق مختلفة من الصراع خصيصًا بعد ظهور \"شادية\" أو \"شادو\" كما كانوا يدعونها وعلاقتها المعقدة بـ \"يزن\".. تمر السنوات سريعًا يتم خلالها التحضير للانتقام النهائي والصراع المحتدم بين الأبطال. الرواية بها الكثير من الأحداث الغامضة والمشوقة ..الكثير من المشاعر المتباينة بين حب وحزن وخوف وترقب.. فلمن تكون الغلبة في النهاية؟ وكيف تتآمر الحياة نفسها على الأبطال، ظالمين كانوا أو مظلومين ؟ ومن هو عمران هذا؟ وما هو السر الكبير الذي يوجد وراءه ؟ .', NULL, 712, 2, NULL, 100.00, NULL, '2021-03-05 23:33:26', '2021-03-05 23:33:26'),
(1134, 'ما لا نبوح به', 'ما-لا-نبوح-به', 'http://books.google.com/books/content?id=RhlfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=RhlfDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061062', 'كم مرة إنفصلنا؟ لا أعرف، كل ما أعرفه أن البعد عنه يربكني، كنت أريد أن أعود، في كل مرة نبتعد كنتُ أعود دائماً، أرجع وأنا كُلي أمل أن يتغير، أن يصبح لي، أن يتخلى عن حماقاته ويراني على حقيقتي ولو لمرة واحدة، كنت أريده أن يكون مثالياً وأن يكون لي وحدي، كنتُ أريد كل شيء وحدي! ولم يكن هو يشعر بأي شيء .. تركني هنا في المنتصف تماماً، لا أنا أكملت الطريق وحدي، ولا أنا بقيت معه، صرتُ في هذا المنتصف اللعين، لا لون لي! تسافر بطلة الحكاية بحثاً عن نفسها، تقابل حبها الحقيقي في تلك المدينة الجميلة، تتعلق به، غير أن أحلامنا عن الحب ربما تبدو باهتة إذا جاءت في غير موعدها، لذلك تعود إلى الأسكندرية بحثاً عن حب قديم لطالما أرهقها، في المنتصف .. تكتشف أنها وحدها تحتاج إلى أن تحب نفسها قبل أن يحبها الآخرين، فهل تتغير تفاصيل الحكاية ؟', NULL, 713, 2, NULL, 100.00, NULL, '2021-03-05 23:33:26', '2021-03-05 23:33:26'),
(1135, 'الى ما لا نهاية', 'الى-ما-لا-نهاية', 'http://books.google.com/books/content?id=p0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=p0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061314', 'السهل الممتنع من حيث التناول والحبكة واللغة الرصينة الغير متكلفة. استطاعت الكاتبة المبدعة ساندرا سراج في هذه الرواية أن توظف أسطورة إغريقية قديمة لتنسج منها حبكة روائية قوية وشيقة للغاية، بين الرومانسية الرقيقة الحالمة، والغموض الإغريقي ذو السحر المعروف الخاص به. بطلة هذه الرواية (رؤى العابد) فنانة تشكيلية، تبدأ في سرد معناتها مع علاقاتها الحالية، ومع العلاقات بشكل عام، إلى أن تلتقي بـ (يمان) الذي يقلب حياتها تمامًا. منذ لقائهما الأول شعرا سويًا أنه هناك شيء ما رهيب سوف يحدث لكليهما، أنهما مرتبطان بسر ما منذ قديم الأزل.. لكن ترى ما هو هذا السر؟ تأخذنا الكاتبة سريعًا إلى رحلة أسطورية عبر العصور القديمة لتحكي لنا عن أسطورة (إيروس) رمز الحب والرغبة و (آيديا).. وسر ما حدث لهما وطواه الزمان.. وتأخذ بيدك الكاتبة دون أن تشعر فصلًا بعد فصل طوال الرواية لتكتشف السؤال الذي سيسيطر على عقلك طوال قراءتك.. ما علاقة هذا كله بـ (رؤى) و (يمان)؟؟ لتكتشف المفاجأة الرهيبة في النهاية والتي مهما حاولت لن تستطيع أن تتوقعها. -Dawen Publishers', NULL, 713, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1136, 'ساعتين وداع', 'ساعتين-وداع', 'http://books.google.com/books/content?id=qBfWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qBfWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778062182', 'ماذا لو منحتك الحياة معجزة امتلاك فرص لانهائية لإنقاذ علاقتك بمن تحب؟ في هذة الرواية المؤثرة والملهمة يسافر شاب مصري لمدينة جدة بالسعودية ليلتقي بحبيبته التي جمعه بها ارتباط سابق، حيث تجبرهما الظروف على البقاء معًا لمدة ساعتين كاملتين. غير أن تدابير القدر تمنحهما فرصة لقول كل ما لم يقل سابقًا، ولاختبار كل المشاعر الكامنة مرة أخرى وكأنها المرة الأولى ، وبعدما يتورط كلاهما في جريمة تقع داخل مركز التسوق حيث يجمعهما اللقاء، يصبح إنقاذ حبهما رهنًا بإنقاذ نفسيهما وتاريخهما وسمعتهما، ورهنًا بفرص الحياة نفسها. ترى هل يقبل القلب الكسير محاولات النجاة الأخيرة؟ وهل تخفي لنا الحياة ممرًّا آمنا للهرب؟ رواية تترك أثرًا، وتسرد تفاصيل العلاقات الإنسانية، وتفتش في التاريخ، وتجدد الأمل والونس!', NULL, 714, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1137, 'انهم يأتون ليلا', 'انهم-يأتون-ليلا', 'http://books.google.com/books/content?id=lUOhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=lUOhDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778060782', 'هناك عده اسباب انسانيه قد يقتحم احدهم شقتك من أجلها ، منها السرقة مثلًا ، القتل أو الانتقام، وغيرها الكثير من التعاملات البشريه التي نحتاج كلنا اليها كل حين وآخر. لكن ان يقتحم أحدهم شقتك ويقيدك في مقعدك ليجبرك ان تستمع لحكايته .. فهذا أمر غير اعتيادي. ذات ليلة اقتحم المحقق الخاص \"صلاح\" شقه الكاتبة الشهيرة \"ناردين الصباغ\" .. وقيدها في أحد المقاعد ثم أجبرها أن تستمع لحكايته ، كان يكلمها وهو يهددها بسكين حادٍ في يديه، ويبدو علي شفا الجنون .. لكنه رغم هذا كان خائفًا بشدة، خائفًا من شيء ما .. وهو يروي حكايته المجنونه لناردين. وهنا تأتي عدة أسئلة هامة.. لماذا ناردين بالتحديد؟ ما الذي يدفع محقق ذو خبره مثل صلاح لحافه الجنون هكذا ؟ ما الذي رآه في رحله بحثه عن فتاه مراهقه اختفت وأفقده صوابه ؟ وما علاقه مذبحة مبني الإسكندريه بما يحدث ؟ وما سر هذه الجملة التي قالها كل من هلك قبل أن يموت \" الشيء قادم \" ؟ كما قلنا هناك عده اسباب كي يقتحم احدهم شقتك ليلا ، ولكن هناك سبب واحد فحسب يجيب عن الاسئله السابقة . -Dawen Publishers', NULL, 715, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1138, '12 شهر اعترافات', '12-شهر-اعترافات', 'http://books.google.com/books/content?id=s1vVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=s1vVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061703', 'تخبرك الأيام أنك منهك، لكن هل تملك الجرأة لتحكي ما يدور بداخلك؟ كثيرًا ما يفضل البشر الصمت! وأولى خطوات التعافي هى التعبير بشجاعة، لذلك ستقرأ هنا اعترافات صادقة عن أمل البدايات وسحر الحب، وكذلك أيام الخذلان الثقيلة، ثم تقفز معي خارج فقاعة الكذب إلى فن كتابة النهايات وممارسة طقوس البهجة. هنا ستجد رحلتك كاملة! تلك الاعترافات هى حلقة الوصل بين إنسان قرر البوح بما يطبق على قلبه وآخر يقرأ هذا الكتاب.', NULL, 716, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1139, 'كتاب الهيلثى', 'كتاب-الهيلثى', 'http://books.google.com/books/content?id=DVzVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=DVzVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778062069', 'الكتاب ده مش عن التخسيس لكن هيساعدك تخس لو حابب تعمل كدا، هو مش كتاب دايت لكن هياخد بإيدك ويحكيلك فلسفة الدايت وفكرته وازاي بيشتغل عشان تقدر تتعامل مع جسمك. الكتاب ده مش عن الأكل الصحي لكنه عن الحياة الصحية السليمة الجميلة، مش هتلاقي فيه نصايح، لكن بعد ما تقراه هتلاقي نفسك لوحدك بتعرف تحسب وتفهم كل حاجة بتعملها مع جسمك وكل أكل بتاكله وكل نفس بتتنفسه ازاي يكون نافع وفي صالحك. كتاب بسيط سهل فيه معرفة مهمة وحكايات ملهمة هتسهل عليك تعيش مبسوط من غير ما تتعب نفسك بوصفات وأنظمة وأدوية. كتاب مناسب لكل حد حابب يعيش حياة متوازنة ويتبسط ويبسط اللي حواليه.', NULL, 717, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1140, 'قطعة من اوروبا : رواية', 'قطعة-من-اوروبا-:-رواية', 'http://books.google.com/books/content?id=oiVjAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=oiVjAAAAMAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789770909485', 'إذا كنت سعادة الأديب تكمن في أن يصور الحقيقة بالضبط وفي قوة على حد تعبير تور جينيف. فإن رواية رضوى عاشور (قطعة من أوروبا). ربما تريد أن تقدم تقييماً كاملاً لمرحلة تاريخية أو لجيل كامل. ومن عنوان الرواية يتبين لنا أنه يجسد الموضوع الذي انعكس على صفحاتها. وربما ليس مصادفة أن يأتي الرواية في عشرين فصلاً إذ أن هذا التقسيم ربما جاء ليخدم الهداف الذي تسعى الكاتبة لإبرازه حيث ينخرط الناظر أمر الراوي في أحداث الرواية متفكراً وناقداً. وربما لجأت الكاتبة للوصف أحياناً كي تصف ملامح أبطالها الداخلية وانفعالاتها. كما يحتل وصف الأمكنة مكانة مهمة في هذه الرواية حيث يتدفق مجرى الأحداث دون توقف. وقد جاءت لغة الراوية لغة مبسطة تساعد القارىء على الإستغراق في القراءة حتى النهاية دون ملل.', NULL, 718, 2, NULL, 100.00, NULL, '2021-03-05 23:33:27', '2021-03-05 23:33:27'),
(1141, 'ليلة في جهنم - منزل أبو خطوة', 'ليلة-في-جهنم---منزل-أبو-خطوة', 'http://books.google.com/books/content?id=GqVFDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=GqVFDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778531664', 'قضيت سنوات طفولتي و مراهقتي امر على هذا البيت، و الفضول يقتلني لاعرف سر خوف الناس منه. تجرأت و عرفت... فندمت... فقررت الكتابه عنه', NULL, 719, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1142, 'تلك الليلة ستلاحقك', 'تلك-الليلة-ستلاحقك', 'http://books.google.com/books/content?id=7vauDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=7vauDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061468', 'نحن هنا أمام قضية معقدة ومتشابكة.. وفي مكتب وكيل النيابة دار السؤال الأصعب : ما الذي حدث في تلك الليلة لهذه الفتاة المسكينة وهي وحدها في شقتها بمنطقة المقطم ؟ تفاصيل القضية متشابكة وغير واضحة، لا نعرف هل نحن أمام محاولة انتحار أم جريمة قتل؟ وما علاقة هذا كله بمراحل اكتمال القمر؟ الفتاة كانت محطمة من الداخل كما عرفها طبيبها النفسي، لكن هل وصل بها الأمر فعلًا إلى محاولة الانتحار؟ الأكثر غرابة هو معرفة وكيل النيابة الذي يحقق في القضية بشخصيتها من قبل، الشيء الذي جعل القضية تبدو أكثر تعقيدًا مما بدا عليه الأمر.. مما يجعلنا أمام نتسائل، ما الذي قد يصنعه بنا الحب فيجعلنا مسلوبي الإرادة لدرجة ارتكاب الجرائم البشعة في أنفسنا وفي غيرنا؟ إنها رواية يصعب توقع نهايتها، أحداثها شديدة التشويق والإثارة، تدور بين مشاعر رومانسية وألغاز قضية أصبح من الصعب فك شفرتها.', NULL, 720, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1143, 'كيف وصل الينا هذا الدين', 'كيف-وصل-الينا-هذا-الدين', 'http://books.google.com/books/content?id=tUOhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=tUOhDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061437', 'كان المنهج الذي سلكه علماء الأمة عبر قرون، هو ثلاثية (النقل، العقل والتعارض) وكان الغرض من هذه المجموعة من الأفكار والمقالات هو تقديم رؤية علمية متماسكة للدين في جميع قضاياه، ولكي يصح الكلام كان لابد من بيان المنهج الذي سلكه علماء الأمة، الذي يمثل هذا الكتاب أول أجزائها، وهو موضوع (النقل). في هذا الكتاب يشرح لنا المؤلف في أسلوب أدبي مناهج التوثق عند علماء المسلمين، سواء من المحدثين أو من الفقهاء، ليبين لنا كيف كانوا يتوثقون من الروايات، وما موقفهم من معارضتها للعقل أو للمعارف الثابتة، فينتقل بك عبر المقالات في شرح الاحتمالات التي تؤثر سلبًا على عملية النقل، وبيان مناهجهم المختلفة التي استخدموها لمعالجة هذه الاحتمالات في لغة أدبية أضافت إلى المحتوى العلمي المطروح. -Dawen Publishers', NULL, 721, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1144, 'قبل أن يقتلني زوجي', 'قبل-أن-يقتلني-زوجي', 'http://books.google.com/books/content?id=Q-uvDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Q-uvDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061185', 'تقول المؤلفة على لسان بطلتها التي علمت بطريقتها الخاصة عن نية زوجها في التخلص منها : \" الآن أقف هنا في المنتصف، لا أعرف هل أريد الموت أم أتمسك بالحياة؟ كل الأشياء تشبه بعضها البعض؛ لم أجرب الموت لكني أعرف أن الذي أعيشه الآن ليس حياة. أنا حواء الطيبة، حواء البسيطة الحالمة، والمعقدة أحيانًا. لم أفعل لآدم أي شيء يستحق القتل، غير أن الموت يلفنا ويحوم من حولنا.. كل يوم أفكر في تفاصيل حكايتنا معًا، كيف بدأت وكيف ستنتهي؟ لا أحب أن تنتهي، غير أن زوجي يخطط لقتلي، ترى هل يفعلها؟ وهل أستسلم له؟ وماذا قد يكون مصير الحب الذي بدأناه معًا في الماضي! أين ذهبت دهشة البدايات؟ وكل تحول الحنين إلى كل هذا الغضب الرمادي؟!\". . في جو غرائبي عجيب، مليء بالشك والخوف والترقب، تنقلب المسلمات إلى عكسها، فيكون \"الحبيب\" هو مصدر الخطر، وعندما كانت حواء تصارع عقلها المريض، كان آدم يمشي باتجاه اللعنة وهو يظن أنه مُخيّر. فهل سينجح في إتمام عملية القتل بنظافة؟', NULL, 722, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1145, 'منزل التعويذة', 'منزل-التعويذة', 'http://books.google.com/books/content?id=m0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=m0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061260', 'بعد النجاح الكبير للكاتبة مروى جوهر في روايتها الأولى (يحدث ليلاً في الغرفة المغلقة) تأتي تجربتها الثانية (منزل التعويذة) ليتكشف لنا أن قلمها الناضج ما زال لديه الكثير جدًا ليقوله لنا في أدب الرعب والتشويق. تدور أحداث هذه الرواية في منزل الباسوس في نهايات صيف عام 1999 تبدأ الرواية على لسان بطليها (آدم) و (نوح) الصديقان اللذان تعرفا على بعضهما لكونهما يسكنان نفس المنطقة خاصة بعد عودة آدم من دولة الإمارات واستقراره بمصر، لكن لظروف قهرية يضطر والداه أن يعودا إلى دولة الإمارات ويتركان آدم وحده في المنزل برعاية حارس المنزل فقط.. لتبدأ بعدها سلسلة من الأحداث الرهيبة والمرعبة يرويها كلا من الصديقين عن الأحداث الخارقة التي تدور في منزل الباسوس. تأخذنا التفاصيل إلى قبو المنزل الملعون والذي يبدو من حكايات الصديقين أنه يحوي سرًا كبيرًا غامضًا له علاقة مباشرة بأحداث الرواية الرهيبة والمرعبة وشديدة الغموض والتي تدفع الصديقين والقارىء نفسه أن يشك في تورط جميع الأطراف في هذه الأحداث المرعبة.. حتى تتكشف النهاية الرهيبة في النهاية لتحل بعدها كل أسرار هذا المنزل -Dawen Publishers', NULL, 723, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1146, 'علامات الحب السبعة', 'علامات-الحب-السبعة', 'http://books.google.com/books/content?id=jdEkDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=jdEkDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776426795', '', NULL, 716, 2, NULL, 100.00, NULL, '2021-03-05 23:33:28', '2021-03-05 23:33:28'),
(1147, 'أسرار اللحظة الأخيرة', 'أسرار-اللحظة-الأخيرة', 'http://books.google.com/books/content?id=li2xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=li2xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061284', 'هناك لحظات أخيرة فارقة دوماً، تلك اللحظات تغير كل شيء\". في موعد خاص يجمع “سيلينا” و”مارك” في فندق بألمانيا، اتفقا أن يلتقيا ولم يعرف أي منهما ماذا يخطط الآخر، تمتلك سيلينا وحدها أسراراً محفوظة بعناية في بطاقة ذاكرة لا يعلم مكانها إلا هي، ومارك مكلف بالحصول على تلك البطاقة، لكن التفاصيل تتغير، والأحداث تتبدل، والنهاية المتوقعة للموقف لا تحدث، ويصعب توقع كل ما يتبع ذلك. هل يتحول إلى موعد عاطفي؟ هل سيفرقهم القدر أو يجمعهم معاً؟ من هي سيلينا؟ وكيف حصلت على تلك التفاصيل السرية؟ وماذا قد تواجه؟', NULL, 724, 2, NULL, 100.00, NULL, '2021-03-05 23:33:29', '2021-03-05 23:33:29'),
(1148, 'القاهرة الحمراء', 'القاهرة-الحمراء', '', '', '9789778060737', '', NULL, 725, 2, NULL, 100.00, NULL, '2021-03-05 23:33:29', '2021-03-05 23:33:29'),
(1149, 'ليلة في جهنم - أيام مع الباشا', 'ليلة-في-جهنم---أيام-مع-الباشا', 'http://books.google.com/books/content?id=bljPDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=bljPDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776634428', 'في تلك القصة يختلط الواقع بالخيال، فإن أردت التمييز بينهما.. عليك بتصديق ما يكذبه عقلك.', NULL, 719, 2, NULL, 100.00, NULL, '2021-03-05 23:33:29', '2021-03-05 23:33:29'),
(1150, 'سر الدرجات ال 39', 'سر-الدرجات-ال-39', 'http://books.google.com/books/content?id=N-uvDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=N-uvDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061338', 'ربما تحمل لفظة \"مغامرة\" الكثير من التفاصيل وتمتلك بعض المرادفات، وقد مرّ \"ريتشارد هاناي\" بطل هذه الرواية بهم جميعًا دون إغفال مشهدٍ وحيد، في هذه الرواية التي تبدأ بحادثة شديدة الغرابة، حيث يقابل \"ريتشارد\" رجلًا مريبًا المنظر يخبره أنه كان يراقبه، وأنه يحمل سرًا له علاقة بمكان مجهول في اسكتلندا، بعدها يجد البطل الرجل مقتولا قبل أن يخبره بأمر ذلك المكان المجهول، ثم يموت. يتحول طريق ريتشارد هاناي بطل هذه الحكاية من مصير رجل عادي لديه اهتمام ضئيل بعالم الجاسوسية لرجل يمتلك شفرة باسم \"درجات السلم التسع والثلاثين\" والتي يعثر عليها في كتيب الضحيةً بعدما كشف له مخطط مهول سوف ينتج عنه آثار عظيمة قد تهدد العالم بأسره. إذا نحن أمام جريمة قتل في بداية الصفحات الأولى من الرواية، ثم مفكرة صغيرة تحوي أرقام وخيوط مشفرة وغير مفهومة، ومشوار لإيقاف ما يسعى إليه متآمرون لا يعلم عنهم البطل شيئا، وعندما يقرر الخوض فيه تبدأ رحلة مليئة بمغامرات منفصلة من تحدٍ للنفس داخل مغامرة كبيرة، ويصاحبنا السؤال في كل منهم: هل ينجح؟ وما الذي سيضطر لفعله هذه المرة؟ وماذا إن أمسكوا به؟ لنعود نسأل :من هم من الأساس؟ وماذا يريدون؟', NULL, 726, 2, NULL, 100.00, NULL, '2021-03-05 23:33:29', '2021-03-05 23:33:29'),
(1151, 'أيام المماليك', 'أيام-المماليك', 'http://books.google.com/books/content?id=l0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=l0OhDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061239', 'أيام المماليك حكايات المذابح والعروش .. من الصعلكة الى كرسي الحكم يسرد هذا الكتاب فترة حرجة من تاريخ مصر والعرب. كيف شُيدت إمبراطورية المماليك؟ كيف قامت مجموعةٌ من العبيد البيض بعد زمن طويل من التشرد والرق اكتسبوا فيها بشكل كبير خبرة المعارك والحروب وجاءوا من الهضاب التركية ونجحوا في تولي قيادة جيوش مصر؟ إلى أن وصلوا في القرن الثالث عشر إلى مراكز الحكم نفسها، ثم صاروا الحكام، واستمروا على التخت «عرش السلطان» لـ 300 عام ترى ماذا فعلوا في هذه الدولة الكبيرة؟ حسناتهم وسيئاتهم، المذابح التي بدأت بينهم في الصراع على الحكم. يحكي الكتاب عن أحداث نادرة في مرحلة اضمحلال وانتهاء دولة المماليك بمفهومها المتعارف عليه حتى آخر مذبحة تمت لهم في القلعة على يد محمد علي باشا، لتبدأ بعدها مرحلة جديدة في تشكيل الدولة المصرية المعاصرة. -Dawen Publishers', NULL, 727, 2, NULL, 100.00, NULL, '2021-03-05 23:33:29', '2021-03-05 23:33:29'),
(1152, 'من نصيبنا', 'من-نصيبنا', 'http://books.google.com/books/content?id=BVzVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=BVzVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778062045', 'الكل فترة هتنتهي بالوقت الوقت بيعلم.. الصح م المعاناة كل اللي قالك إنه مش ماشي هتلاقي بكره ف حد تاني معاه', NULL, 728, 2, NULL, 100.00, NULL, '2021-03-05 23:33:30', '2021-03-05 23:33:30'),
(1153, 'مشخصاتية مصر', 'مشخصاتية-مصر', 'http://books.google.com/books/content?id=UUXnxQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=UUXnxQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789778061277', 'عن هؤلاء الذين وقفوا ضد الجميع وسعوا لتحقيق حلمهم فاصبحوا رموزاً للفن المصري والعربي. عن هؤلاء الذين قالوا لا في وجه مجتمع كان ينظر إلى \"المشخصاتي\" نظرة دونية فكان التحدي. في هذه الرحلة التي ستجعلك تتأثر في كل الفنانين في حياتك الذين قد تلتقي بهم .. منهم قد تعرفهم، ومنهم من لاتعرفهم من قبل .. لكن ستجعلك هذه القراءة تفكر أنك رأيتهم من قبل.. مع أبطال أثروا بك في لحظة من اللحظات التي تراهم فيها على الشاشة مع الأبطال الرئيسية للعمل. عن فردوس محمد، زوزو حمدي الحكيم، بشارة واكيم، منسي فهمي وغيرهم، \"مشخصاتية مصر\" يعرض لكم حكايتهم وأهم محطات حياتهم وتاريخ هذه المهنة التي تعرف الآن بالتمثيل. منهم من صنعوا البهجة وجمَّلوا الحياة .. ومع ذلك تلاشوا في آذهاننا .. ليفاجئنا الكاتب ويخرج لنا تراثًا فنيًا لشخوص لها الموهبة في التمثيل لم تطلب من الحياة غير التمثيل لتقابل التهميش والنهاية الحزينة لمعظمهم. هذا الكتاب هو سلسلة جديدة لمعرفة عن شخصيات قد تأثرنا بهم ولم نعد نراهم.. صنعوا لنا البهجة والسعادة وعانوا في حياتهم ليظهر لنا أن مصر والوطن العربي مليئ بفنانين حقيقين لكنهم مهمشين. هو بالفعل تاريخ نادر وحكايات منسية وجميلة جدًا من زمن الفن الجميل. -Dawen Publishers', NULL, 729, 2, NULL, 100.00, NULL, '2021-03-05 23:33:30', '2021-03-05 23:33:30'),
(1154, 'أيام الخريف العشرة', 'أيام-الخريف-العشرة', 'http://books.google.com/books/content?id=DveuDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=DveuDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778061307', 'في إشارة إلى أثر فقدان أحدهم على الروح تقص علينا رواية أيام الخريف العشرة أن \"الفقد أكثر من مجرد أزمة قد تجعلك حزينًا، الفقد لديه القدرة على جعلك مفقودًا، ولكن بلا فاقد\" ... وكأن كل شخص عزيز يرحل أو تجبره دورة الحياة على الرحيل يأخذ معه جزء من روحك فتبقى وكأنك أنت من تحتاج للعثور عليك، أنت التائه رغم ثباته في نفس المكان، وهو الشعور الذي اختبره \"كريم\" كان كريم طبيب نفسي شاب داهمته الحياة بقسوة مشاهدها كأحد البيادق المحاصرة في لعبة شطرنج، اختبر الحنين تلاه الفقد وسبقهما الخوف من الأمر برمته، اختبر الانفعالات التي انتصر الحزن في أغلبها حتى بات في فراشه مريضًا نفسيا جنبًا إلى جنب مع من يوصي لهم بالعلاج \"كريم\" هو داخل كل منا، هو أرواحنا التي تعيش لتتكيف مع الظروف دون أن تختار مساراتها، هو ليس إلا براغب في البقاء إلى جانب من يحبهم، كذلك هو ضحية النهايات التي لا تشير لبداية جديدة إلا باحتمال ضئيل عليك بتجاهله كي يأتي، هو راوي لأيام عشرة من خريف يحمل في طياته معافرة للبقاء وللحفاظ على ما تبقى من مشاعر،، حتى يعود أصحابها، فهل يعودون؟ وهل نعود معهم؟', NULL, 730, 2, NULL, 100.00, NULL, '2021-03-05 23:33:30', '2021-03-05 23:33:30'),
(1155, 'علاقات خطرة', 'علاقات-خطرة', '', '', '9789776549180', '', NULL, 731, 2, NULL, 100.00, NULL, '2021-03-05 23:33:31', '2021-03-05 23:33:31'),
(1156, 'اللا مكترث', 'اللا-مكترث', 'http://books.google.com/books/content?id=S45IDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=S45IDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776549425', 'له الكثيرُ من المسميات؛ فقد أسماه \"كولن ولسن\" \"اللا منتمي\"، \"ألبير كامو\" بـ \"المتمرد\"، \"كارل يونج\" بـ \"الانطوائي\"، حتى في الأدب \"دوستويفسكي\" أطلق عليه \"الإنسان الصرصار\".. والكثير من الفلاسفة والمفكرين حاولوا أن يطلقوا عليه اسمًا مميزًا ليُعرَف به.. ولكنهم لم يستطيعوا حصرَ ذلك الكائن تحت مجرد اسم، وها أنا أدعوه بـ\"اللا مكترث\".. فالقضية في نظري قضية \"اكتراث\" بالأساس.. ففور اتخاذ هذا الإنسان المختلف قراره بعدم الالتفات للحماقات المادية، أو الاهتمام بالرواسيب الحياتية، يتحول معها لمتمرد على الواقع السطحي أو لا منتمي لهذا العالم البالي.. فجميعهم مهتمون بفلان، حاضرون في مناسبة فلان، شغوفون بمعرفة أخبار فلان! جميعهم منخرطون في أدق التفاصيل التافهة وأعمق الزوايا غير المثمرة، وكل ذلك بسبب افتقادهم لحياة خاصة تستحق الاحترام والعناية.. فباتوا يعوثون في حيوات الآخرين تصيُّدًا وتجسُّسًا حتى أصبحوا فاقدي الجوهر والصميم؛ فجميعهم نُسَخٌ مكررة منزوعة الكيان..! على عكس هذا اللا مكترث، له اهتماماته الأكثر نُضجًا والأرقى مردودًا، له ذاته المختلفة وحُلمه المستقل.. فبموت حب التطفل والفضول الصبياني في قلبه يولد بداخله الإنسان الجديد بصفاته المتطورة.. تنقشع غيوم المادة من سماء روحه ليتحرر من خوف الجسد وغربة النفس.. فيصبح \"اللا مكترث\" ثم بعدها أي شيء آخر.. وهذا الكتاب محاولة بسيطة لاقتحام هذا العالم الجديد.. عالم اللا مكترث..', NULL, 732, 2, NULL, 100.00, NULL, '2021-03-05 23:33:31', '2021-03-05 23:33:31'),
(1157, 'قواعد العشق الأربعون', 'قواعد-العشق-الأربعون', 'http://books.google.com/books/content?id=awh_wgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=awh_wgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789953892573', 'Een proeflezer wordt door een manuscript over de 13e-eeuwse soefi Roemi aan het denken gezet over het gebrek aan liefde in haar leven.', NULL, 207, 2, NULL, 100.00, NULL, '2021-03-05 23:33:32', '2021-03-05 23:33:32'),
