(1161, 'مقتل الكومنداتور 1:فكرة تظهر', 'مقتل-الكومنداتور-1:فكرة-تظهر', '', '', '9789953896885', 'A thirty-something portrait painter in Tokyo is abandoned by his wife and finds himself holed up in the mountain home of a famous artist, Tomohiko Amada. When he discovers a previously unseen painting in the attic, he unintentionally opens a circle of mysterious circumstances. To close it, he must complete a journey that involves a mysterious ringing bell, a two-foot-high physical manifestation of an Idea, a dapper businessman who lives across the valley, a precocious thirteen-year-old girl, a Nazi assassination attempt during World War II in Vienna, a pit in the woods behind the artist\'s home, and an underworld haunted by Double Metaphors.', NULL, 736, 2, NULL, 100.00, NULL, '2021-03-05 23:33:35', '2021-03-05 23:33:35'),
(1162, 'إلى الله', 'إلى-الله', 'http://books.google.com/books/content?id=1dbMDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=1dbMDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240955', 'رحلة تبدأ مع لحظة الميلاد، مع أول نفس لك في الدنيا، أخطر رحلة في حياتك وأهمها، ولو بذلتَ بعض الجهد لصارت أمتعها أيضًا. رحلة لابد لكل حي أن يعيشها، وأن يُختبر فيها، وقد يُبتلى بشرّ أو بخير.. ليس مهمًانوع الاختبار؛ المهم أن ينجح. رحلة قطّاع الطرق فيها هم شيطانك، ونفسك التي بين جنبيك، وعليك المقاومة. رحلة يسعدك فيها ويحفظك ويحميك من أخطارها حب الله، والخوف منه، والرجاء في رحمته وجنته. رحلة لابد لك فيها من زاد يبلغك برّ الأمان، وإلا فلا نجاة ولا وصول. \"إلى الله\" كتاب يصحبك في الرحلة، يضيء لك الطريق، ويمهد لك السبيل، يرشدك إلى برّ الأمان، ويوفّر لك زاد الرحلة.. الرحلة إلى الله', NULL, 737, 2, NULL, 100.00, NULL, '2021-03-05 23:33:35', '2021-03-05 23:33:35'),
(1163, 'كتالوج سي السيد', 'كتالوج-سي-السيد', 'http://books.google.com/books/content?id=2QVWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=2QVWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240245', 'لم يتم توفير أي شيء', NULL, 738, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1164, 'شهرزاد اون فاير', 'شهرزاد-اون-فاير', 'http://books.google.com/books/content?id=WonPDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=WonPDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240856', 'بلغني أيها الملك السعيد، ذو الرأي الرشيد، إن رحلتنا في الحياة هتاخدنا في كل اتجاه! هنعدي على مراحل مختلفة في حياتنا.. في شغلنا ودراستنا. هنعدي بنجاح وفشل، بتشجيع وإحباط، بحب وكره وفرح وغضب وسهولة ومعاناة ومتعة وبؤس. القطر هيعدي بكل المحطات وهنشوف حوالينا أشكال وألوان من البشر والتجارب والتغيّرات. الحاجة الوحيدة اللي هتفضل طول الوقت معانا، هي البوصلة اللي جوانا! الجزء اللي عارف كويس إحنا مين وبنحب إيه وبنكره إيه وعايزين نعمل إيه وبنخاف من إيه. الجزء اللي فاهم مشاعرنا وعارف شغفنا ونقاط قوتنا ويقدر يساعدنا نخطط لحياتنا ونختار الناس اللي حوالينا. الجزء الوحيد اللي عنده إجابة السؤال المتكرر \"أنا مين وإيه بصمتي في الدنيا؟\" إيه الجزء ده؟ أفهمه ازاي؟ أستخدمه ازاي؟ أظبط بوصلتي ازاي؟ دي الأسئلة اللي هنجاوب عليها من خلال حكايات ألف ليلة وليلة.. مستعد؟', NULL, 739, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1165, 'EXPIRED', 'EXPIRED', 'http://books.google.com/books/content?id=8reODwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=8reODwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240603', '', NULL, 740, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1166, 'إذما', 'إذما', 'http://books.google.com/books/content?id=MonPDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=MonPDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240986', '\"سنبدأ اللعبة يا عيسى معا.. أمامك تسعة أوامر وتسعة كنوز حتى تجدني\".. في عيد ميلاد عيسى السادس والثلاثين، وبعد محاربة مستميتة مع الحياة أدت لهزيمته هزيمة نكراء؛ تصله هدية من آخر شخص يتوقعه. هدية تجبره أن يغير تفاصيل حياته كلها. ولأنه فقد شغفه في الحياة وتاه طويلا عن نفسه؛ يضطر لإتباع ذلك المسار الجديد، ويخوض تجربة تلو الأخرى، عله يعثر على ما فقد منه.. وبينما يفعل ذلك، يحاربه واقعه الحالي؛ يكتشف أن عليه مواجهة أكثر مخاوفه سوءًا! رواية عن نوع آخر من الحب، عن الشغف، وعن الخوف الذي يمنع الشعور بالحياة..', NULL, 741, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1167, 'استراحة نفسية', 'استراحة-نفسية', 'http://books.google.com/books/content?id=t9bMDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=t9bMDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240832', 'تشعر بإرهاق؟ أعلم.. لذلك أنت هنا، لأنك مرهق ولا يشعر بك أحد! إرهاقك مختلف. أنتَ لست مريضًا، ربما تمشي بين الناس بشكل طبيعي، وتذهب للعمل ولا تشكو من شيء. هذا لأن الإرهاق الذي يؤرق نومك هو إرهاق غير مرئي، إرهاق نفسي! إرهاق لا يزول بالراحة والإجازات، لا يزول حتى لو استلقيت طوال اليوم في سريرك. إرهاق يُثقل نفسك ويجعل نبض قلبك مؤلمًا، إرهاق يحتاج إلى استراحة حقيقية، استراحة نفسية، نتوقف فيها سويًا لنرى ماذا يحدث بداخلك وحولك ويؤثر في نفسك. هل كُتب علينا الشقاء والإرهاق، أم هناك في هذه الدنيا استراحة نفسية يمكننا جميعًا الوصول إليها؟ استراحة نفسية هو كتاب يمزج بين العلم والدين والفلسفة، ليصنع وعيًا جديدًا يقودنا لحياة ذات صحة نفسية أفضل. كريم إسماعيل، محاضر تعليمي ومتحدث تحفيزي وهو كوتش معتمد من الاتحاد الدولي ICF برتبة ACC. بلغت أعداد حضور محاضراته أكثر من ١٠٠ ألف متعلم، ويتابع محتواه التعليمي أكثر من ٣.٥ مليون مشاهد على شبكات التواصل الاجتماعي، ويُعتبر \"استراحة نفسية\" هو كتابه الأول.', NULL, 742, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1168, 'لن يموت', 'لن-يموت', 'http://books.google.com/books/content?id=m-uMDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=m-uMDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240443', '\"عن الكاتب الذي كان يريد أن يكتب روايته الجديدة وحيدًا في شقة معزولة، قبل أن يكتشف أنه ليس وحيدًا تمامًا!عن الفتى الأصلع، والمرآة المصنوعة من ماء. عن الكلب مقطوع الرأس، والذي يطاردك بشراسة غريبة. عن المسخ الذي تسمع صوت أنفاسه وراء ظهرك، عنك أنت عندما تلتقي بنفسك مباشرة، عن الجثة التي لم تعد جثة بعد الآن ! بعد هذا سأخبرك عن الشيء الذي جعلك تعرف أنّ الـ ......', NULL, 743, 2, NULL, 100.00, NULL, '2021-03-05 23:33:36', '2021-03-05 23:33:36'),
(1169, 'تاريخ في الظل', 'تاريخ-في-الظل', 'http://books.google.com/books/content?id=OTdwDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=OTdwDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789775153234', 'كلّما توغّلت في عالم التاريخ، وطرقاته الكثيرة المتشابكة، وجدت بعض أبوابه تستوقفني وتطلب مني أن أفتحها لأحرّر ما بها من موضوعات تعاني أسر القوالب الجامدة أو الهَجر والإهمال في زوايا معتمة.. فصرت تلقائيًا أميل للبحث في تلك الزوايا لأحرّر أسيرًا أو أكسر قالبًا يعيق إعادة النظر في \"الحقائق\". و\"تاريخ في الظل\" هو جزء من محصّلة تلك الرحلة المثيرة، التي يزداد معها يقيني أن ما نجهل من تاريخنا الإنسان أكثر بكثير مما نعرف.. وأنا أدعو القارئ أن يشاركني رحلتي لتحرير تلك المعارف والموضوعات وإعادة تَعَرُّفها من جديد..', NULL, 744, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1170, 'كيمو شهريار التجمع', 'كيمو-شهريار-التجمع', 'http://books.google.com/books/content?id=fJ_QDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=fJ_QDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240962', '\"لم يكن من اللائق أن يجلس كريم في غرفة ليست غرفته ولكنه جلس، ولم يكن من حقه أن يعبث بأوراق ليست أوراقه ولكنه فعل, لم تكن أخلاقه ولم يكن هذا ما اعتاد عليه، ولكنه الفضول.. ذلك الشيء الذي يقودنا أحيانًا إلى الهلاك. فتح الدوسيه بأصابعه المرتعشة وهو يتوقع كارثة جديدة فلم يخيِّب القدر ظنَّه. كانت صورته تتوسط الصفحة الأولى من حزمة الأوراق الكبيرة, كانت صورة غير عادية, صورة لا يعلم مَن التقطها ولا متى ولا أين. كان هو في الصورة واقفًا مزهوًا بنفسه وسط فريق الهارلى يرتدي تلك الملابس المميزة للفريق, وكان مكتوب أسفل الصورة:المرحلة الأولى من حياة الحالة\". كريم، أو كيمو، أو شهريار التجمع.. كلها ألقاب وأسماء حركية للدنجوان الكبير بطل الكتاب ده، اللى عنده كل مقومات السعادة ورغم كده كان عايش تعيس، لحد ما هتدخل حياتهنور..البنت الجميلة والكوتش العبقرية، اللي هتحاول تحل شفرته وتساعده على التغيّر. لكن السؤال هو هل فعلًا هتنجح في ده؟', NULL, 738, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1171, '‏ليل المحروسة :‏', '‏ليل-المحروسة-:‏', '', '', '9789778240580', '', NULL, 745, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1172, 'بقاء', 'بقاء', 'http://books.google.com/books/content?id=XSTXDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=XSTXDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240894', 'ما الذي ستفعله عندماتخسر الأهل والمنزل والحبوالعمل؟ هذا السؤال واجهته \"نالا\" فجأة،بعد أن أجبرتها الحياة على خسارة كل شيء دون سابق إنذار، ووسط الظلام والوحدة والارتباك يتخبط عالمها أكثر،وتكتشف أنها ستواجه أصعب سؤال في الحياة.. ما الذي يستحق البقاء؟ رواية \"بقاء\" تناقش كل ما قد تواجههمن صعاب حتى تستمر، ما بين مجتمع قاسي لا يستطيع أن يفهم، وأهل يستغلون سلطتهم وأذاهم النفسي لأولادهم. رواية تخاطب من استطاع أن ينتصر لنفسه أولًا، ولم يستسلم لضعفه وللضغط من كل الجوانب.', NULL, 746, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1173, 'Dirāsah fī al-qirmizī', 'Dirāsah-fī-al-qirmizī', '', '', '9789778240511', '', NULL, 510, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1174, '‏أحدهم :‏', '‏أحدهم-:‏', '', '', '9789778240610', '', NULL, 747, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1175, 'تصبحي على خير', 'تصبحي-على-خير', 'http://books.google.com/books/content?id=6VbRDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6VbRDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240849', 'لما توافقي هيبيع جواهرجي ف يوم خاتم هيجيب مأذون عشا لولاده هيزيد مشروب وهيبقى اتنين ونضيف للدنيا اتنين عشاق وإن موافقتيش فيه رزق هيبقى انتهى مقطوع وانتي مترضيش تقطعي أرزاق هنعمله مطوية زي كتاب احدهم اختار صورة من الصور اللي بعتهالك وهبعتلك الكلام في المطوية في رسالة تانية', NULL, 748, 2, NULL, 100.00, NULL, '2021-03-05 23:33:37', '2021-03-05 23:33:37'),
(1176, 'صبار', 'صبار', '', '', '9789778240818', '', NULL, 749, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1177, 'أبي الذي أكره', 'أبي-الذي-أكره', 'http://books.google.com/books/content?id=gp_QDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=gp_QDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240788', 'لم نكن نطلب الكثير؛ فقط أن نشعر أننا على ما يرام، وأننا جيدون بما يكفي، ونستحق الحب هكذا تمامًا كما نحن.. دون أن نحتاج أن نقتلع جلودنا كل صباحٍ ونرتدي غيرها لنرضيهم! والآن نتحسس ندوب الإساءات القديمة تلك التي نواريها ولم تزل تؤثر على سلوكنا، فتمنحنا الغربة والشك في ذواتنا. هي جراحات لم تأخذ حقها من الالتئام، فكتمنا آلامها مبكرًا وارتدينا قناع القوة مدعين أننا بخير. حتى جاء ميقات الحرية وسلكنا طريق التعافي، وارتحلنا على مسارات الشفاء، وعلمنا أن في آخر نفق الألم المظلم نورًا.', NULL, 750, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1178, 'أحببت وغدا', 'أحببت-وغدا', 'http://books.google.com/books/content?id=YLeODwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=YLeODwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240467', 'دومًا ننتظر شخصًا ما.. نظن أن بوجوده تتبدّد كافة أوجاعنا ويغمرنا السلام، ونتوهّم أننا حينها سنشعر بالاكتمال! وتصفعنا الحقيقة أن ذاك الشخص الذي رأينا فيه المنقذ.. ربما هو من يمنحنا خيبتنا الكبرى.. وبدلًا من أن نُزهِر بجواره.. قد نذبل.. وننزوي.. ونتلاشى.. ونذوب! يصبح الآخر جحيمنا حين نسعى لتخدير أوجاعنا عبره، وتصبح العلاقة المرضية تلاهيًا عن مواجهة أنفسنا، مجرد هروب وفرار! إلى أولئك الذين يظنون أنهم يداوون الظمأ.. عبر تتبّع السراب!', NULL, 750, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1179, 'ليل المحروسة', 'ليل-المحروسة', '', '', '9789778240559', '', NULL, 751, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1180, 'خطايا صغيرة', 'خطايا-صغيرة', 'http://books.google.com/books/content?id=fLeODwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=fLeODwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240597', 'رغبتها الحارقة في الاعتراف بحماقاتها أوقعتها في طريقه. لسبب لا يعرفه اختارته دونًا عن كل من حولها ليكون أمين أسرارها، الشخص الذي تعترف له بكل ما ارتكبته علّها تتحرّر من شعورها الجارف بالذنب. أما هو فوجد نفسه أمام شخصية استثنائية لم يتخيّل من قبل وجودها، فاجأته واقتحمته، واكتشف معها أن للحياة وجوهًا أخرى لم ينتبه لها، لكنّه لم يتصوّر أنها ستصارحه بكل ما صارحته به، عندها اكتشف أن هناك أسرارًا من الأفضل كتمانها في الصدر وعدم الجهر بها!', NULL, 752, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1181, 'سكن - صفاء الروح في حلو المشاعر ومرها', 'سكن---صفاء-الروح-في-حلو-المشاعر-ومرها', 'http://books.google.com/books/content?id=UkRbDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=UkRbDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240320', 'عايشين كأن قلوبنا بقت متشفرة.. وكأن الأيام قفلت قلبنا بقفل.. وخبت مننا المفتاح.. قرروا لنا إن الإحساس تفاهة.. وإن الدنيا عايزة الشديد اللي يعيشها بعملية وبس.. . الكتاب ده هيعبر عنك في أغلب حالاتك الشعورية.. كأنه صديقك.. بيتفهمك وبيريحك وبيديك نصيحة تتحرر ازاي من وجعك.. كأنه مراية لقلبك.. للي بتحس بيه مع الناس.. وكمان للي ممكن تكون سبب فيه عشان الناس تتضايق أو تتألم منك.. فنتعلم نرصد إحساسنا وازاي ندير الألم جواه.. وكمان نتعلم مفتاح التعايش حوالين الناس.. . الكتاب ده بيساعدك إنك تبدل جواك المعاني المؤلمة لمعاني تساعدك تقلل قوي الوجع في حياتك.. فيعتبر وقاية وعلاج عام لجروح الحياة.. تخلي مُرّ المشاعر يتحول لسَكَن', NULL, 740, 2, NULL, 100.00, NULL, '2021-03-05 23:33:38', '2021-03-05 23:33:38'),
(1182, 'لأ بطعم الفلامنكو', 'لأ-بطعم-الفلامنكو', 'http://books.google.com/books/content?id=4UiHDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4UiHDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240481', 'التغيير هو أكبر تحدى ممكن يواجهك فى حياتك .. والتغيير الحقيقي، بيكون معاه صعوبتين.. الصعوبة الأولى.. إنك هاتكون عامل زى الطفل المولود جديد.. بتخرج للحياة ومعاك كل المخاوف زى ما معاك كل الفرص.. بتتعرف على نفسك وعلى اللى الناس وكأنك بتشوفهم لأول مرة.. بتختار اختيارات جديدة.. و تمشى فى سكك مختلفة.. حتى لو كانت مُوحشة.. أو مهجورة.. الصعوبة التانية.. هى إن التغيير ليه تمن.. والتمن ده ممكن يكون غالى جداً.. الكتاب ده عن التغيير.. عن خطواته.. وعن تمنه.. عن احتياجاتك.. ومخاوفك.. وحقوقك النفسية.. عن قراراتك اللى أخدتها زمان.. وقراراتك اللى هاتخدها دلوقت.. الكتاب ده هاينقلك بهدوء وثقة.. من مرحلة (الحبو) خارج النص.. و (المشي) فوق أشواك العلاقات الخطرة وتجاوزها.. إلى الضرب على الأرض بشكل إيقاعى متتابع ومبهر.. وكأنك راقص فلامينكو محترف.. يرقص فوق آلامه.. ويزلزل القلوب أمام عينيه.. يعلن عن نفسه فى وجه العالم.. مع كل دبدبة عالية مدوية من قدميه.. يرفع عنقه نحو السماء.. ويغرس بذور وجوده الجديد فى أعماق الأرض.. جهز قلبك وعقلك وروحك.. لتقابل نفسك.. كما لم تعرفها من قبل..', NULL, 753, 2, NULL, 100.00, NULL, '2021-03-05 23:33:39', '2021-03-05 23:33:39'),
(1183, 'فن اللامبالاة', 'فن-اللامبالاة', 'http://books.google.com/books/content?id=J2bCDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=J2bCDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9786144720196', 'ظل يُقال لنا طيلة عشرات السنوات إن التفكير الإيجابي هو المفتاح إلى حياة سعيدة ثرية. لكن مارك مانسون يشتم تلك \"الإيجابية\" ويقول: \" فلنكن صادقين، السيء سيء وعلينا أن نتعايش مع هذا \". لا يتهرّب مانسون من الحقائق ولا يغلفها بالسكّر، بل يقولها لنا كما هي: جرعة من الحقيقة الفجِّة الصادقة المنعشة هي ما ينقصنا اليوم. هذا الكتاب ترياق للذهنية التي نهدهد أنفسنا بها، ذهنية \" فلنعمل على أن يكون لدينا كلنا شعور طيب \" التي غزت المجتمع المعاصر فأفسدت جيلًا بأسره صار ينال ميداليات ذهبية لمجرد الحضور إلى المدرسة. ينصحنا مانسون بأن نعرف حدود إمكاناتنا وأن نتقبلها. وأن ندرك مخاوفنا ونواقصنا وما لسنا واثقين منه، وأن نكفّ عن التهرب والفرار من ذلك كله ونبدأ مواجهة الحقائق الموجعة، حتى نصير قادرين على العثور على ما نبحث عنه من جرأة ومثابرة وصدق ومسؤولية وتسامح وحب للمعرفة. لا يستطيع كل شخص أن يكون متميزًا متفوقًا. ففي المجتمع ناجحين وفاشلين؛ وقسم من هذا الواقع ليس عادلًا وليس نتيجة غلطتك أنت. وصحيح أن المال شيء حسن، لكن اهتمامك بما تفعله بحياتك أحسن كثيرًا؛ فالتجربة هي الثروة الحقيقية.', NULL, 754, 2, NULL, 100.00, NULL, '2021-03-05 23:33:39', '2021-03-05 23:33:39'),
(1184, 'بابليو', 'بابليو', 'http://books.google.com/books/content?id=cp_QDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=cp_QDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778240719', 'في نظرية الفوضى، إدوارد لورنز عرّف مصطلح سماه \"تأثير الفراشة - The butterfly effect\" بإن رفرفة جناح فراشة صغيرة في مكان بعيد، وكمان من فترة، بيكون لها تأثير في إعصار بيحصل هنا ودلوقتي، تأثير في حجمه واتجاهه طبعًا بحجم النسبية اللي يربط بين الفراشة والإعصار. من يوم رفضي في أول مقابلة، وأول رفرفة طلعت مني في الاتجاه اللي كنت شايفه إيجابي، وأنا الطريق بياخدني من بلد لبلد ومن عالم لآخر عشان تطلع رفرفات من كل الاتجاهات وبكل الألوان في اتجاه الإعصار اللي بيتشكّل ليا. أنا كنت متخيل إن الواحد ممكن يختار شكل ولون الإعصار اللي بيشكّله لنفسه من وهو صغير، إلا إني اكتشفت إن الأحداث والشخصيات اللي في قصتي هم اللي بيشكّلوا شكل ولون الإعصار ده، ومع إني المحرك الرئيسي للأحداث، إلا إني برضه مكنتش في يوم من الأيام ممكن أتخيل إن إعصاري يطلع بالشكل ده.. \"بابيليو\".', NULL, 755, 2, NULL, 100.00, NULL, '2021-03-05 23:33:39', '2021-03-05 23:33:39'),
(1185, 'حكايات من قاهرة أسرة محمد علي', 'حكايات-من-قاهرة-أسرة-محمد-علي', '', '', '9789778124248', '', NULL, 756, 2, NULL, 100.00, NULL, '2021-03-05 23:33:39', '2021-03-05 23:33:39'),
(1186, 'في الليلة الأخيرة بيننا', 'في-الليلة-الأخيرة-بيننا', '', '', '9789778124477', '', NULL, 757, 2, NULL, 100.00, NULL, '2021-03-05 23:33:39', '2021-03-05 23:33:39'),
(1187, 'طقوس شيطانية', 'طقوس-شيطانية', '', '', '9789776709188', '', NULL, 758, 2, NULL, 100.00, NULL, '2021-03-05 23:33:40', '2021-03-05 23:33:40'),
(1188, 'الصحوة', 'الصحوة', '', '', '9789776709195', '', NULL, 669, 2, NULL, 100.00, NULL, '2021-03-05 23:33:40', '2021-03-05 23:33:40'),
(1189, 'المادة السوداء', 'المادة-السوداء', 'http://books.google.com/books/content?id=yRWaDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=yRWaDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789773137465', 'هل أنت سعيد في حياتك؟.. \"لا يخبرك أحد أن كل شيء على وشك أن يتغير، أن يُستلَب. لا يوجد أي تنبيه بالاقتراب، ولا أي مؤشر بأنك تقف على شفا الهاوية. ولعل هذا هو ما يجعل المأساة مأساوية إلى هذا الحد. ليس فقط ما يحدث؛ بل كيف يحدث: لكمة مفاجئة تأتيك من حيث لا تدري، عندما تكون هي آخر ما تتوقعه. لا وقت لتجفل أو لتستعد\". بليك كراوتش- المادة السوداء \"رواية بارعة الحبكة، حكاية عاصفة وحميمية، غريبة على نحو يُذهل العقل، وعميقة الإنسانية في الوقت نفسه. قصة خيال علمي مثيرة ومدهشة بلا هوادة عن الاختيارات، والطرق التي لم نسلكها، وإلى أي مدى يمكن أن نذهب لنطالب بالحياة التي كنا نحلم بها\" نيويورك تايمز بوك ريفيو \"خليط يعصف بالعقل من الخيال العلمي والإثارة وقصة الحب\" إنترتينمينت ويكلي \"ربما تكون أكثر قصة مثيرة مربكة ستقرأها خلال العام، قصة سباق حتى الخط الأخير، بانعطافتها الأخيرة الماهرة والمذهلة للعقل\" الجارديان', NULL, 759, 2, NULL, 100.00, NULL, '2021-03-05 23:33:41', '2021-03-05 23:33:41'),
(1190, 'تأثير مانديلا', 'تأثير-مانديلا', 'http://books.google.com/books/content?id=3yn5DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=3yn5DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776709485', 'ذكريات من عالم مواز', NULL, 760, 2, NULL, 100.00, NULL, '2021-03-05 23:33:42', '2021-03-05 23:33:42'),
(1191, 'حياة جديدة', 'حياة-جديدة', 'http://books.google.com/books/content?id=e_-fCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=e_-fCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467002', 'نبذة: «نحن نُعطيك «حياة جديدة» بسعر مُغرٍ. الاختيار لك وحدك. أوقف شيخوختك.. واستمتع مرة أخرى بحرية الشباب.. وبالسعادة الأبدية». لم يكن الملياردير العجوز فايز أبو اليزيد يتصور أن برنامج «حياة جديدة»، الذي أعلنت عنه شركة الرعاية الطبية الدولية، والذي يوفر لمن يشترك فيه الشبابَ الدائم، سيوقعه في هذا الكابوس الذي لا يبدو أنه سيستطيع الفكاك من براثنه. فجأة يجد فايز نفسه في جسده الشاب الجديد، يطارده مجهولون يحاولون قتله بأي طريقة، بل تلاحقه الشرطة نفسها بلا هوادة، وتريد الإيقاع به. وتبدأ خيوط الحقيقة المُرعبة في التكشف له... لقد تعرَّض لخديعة لا يعلم إن كان سيستطيع الخروج منها حيًّا أم لا. وفي مكان غامض، تجمع الأقدار فايز أبو اليزيد بالدكتورة عصمت زين الدين، أستاذة الطب والجراحة، وآخرين ممن اشتركوا في برنامج «حياة جديدة»، ليحاولوا استعادة حياتهم مرة أخرى. في جو من التشويق المثير، على إيقاع أحداث متسارعة، تصور رواية محمد سليمان عبد المالك الأشهر الوجه الآخر من رغبة الإنسانية المحمومة في الشباب الدائم ولهاثها المستمر وراء الجمال والخلود.', NULL, 761, 2, NULL, 100.00, NULL, '2021-03-05 23:33:43', '2021-03-05 23:33:43');
