(1192, 'سيدات القمر', 'سيدات-القمر', 'http://books.google.com/books/content?id=PaU4AQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api', 'http://books.google.com/books/content?id=PaU4AQAAIAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '9789953891552', 'تدور الرواية حول ثيمات عمانية شديدة الخصوصية والحميمية، فعلى امتداد زمني يمتد لأكثر من مائة عام، يتنقل السرد بين عائلات وأفراد متفاوتين في همومهم الشخصية والجماعية، وفي انتماءاتهم ومكانتهم في المجتمع. الرواية تعنى بتوظيف التاريخ العماني، وترصد التحولات السريعة للمجتمع الحديث، وتحاول الاقتراب من القضايا الحساسة كالطبقية والهوية، وذلك من خلال شخصيات متعددة، وباعتماد ضمائر سرد مختلفة. يجمع شخصيات الرواية فضاءان مكانيان: الأصل وهو قرية \"العوافي\"، ومكان لاحق انتقلت إليه بعض العائلات فيما بعد وهو مسقط. المكانان يتراوحان، في الرواية، كما تتراوح الأزمنة: من منتصف ثلاثينيات القرن الماضي حتى الألفية الجديدة. شخصيات الرواية لها رؤى متباينة في الحياة والحب والعدالة والحرية.', NULL, 762, 2, NULL, 100.00, NULL, '2021-03-05 23:33:43', '2021-03-05 23:33:43'),
