(1195, 'Al- ́aguz al-ladi kana yaqra\' al-riwayyat al-garamiya', 'Al--́aguz-al-ladi-kana-yaqra\'-al-riwayyat-al-garamiya', '', '', '9789953893297', '', NULL, 765, 2, NULL, 100.00, NULL, '2021-03-05 23:33:43', '2021-03-05 23:33:43'),
(1196, 'رحلة الدم', 'رحلة-الدم', 'http://books.google.com/books/content?id=S2syDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=S2syDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467569', 'يعود إبراهيم عيسى بعد أربع سنوات من صدور «مولانا» (القائمة القصيرة للجائزة العالمية للرواية العربية – البوكر 2013) ليتناول المسكوت عنه في تاريخنا الإسلامي. ففي سرد مبهر وأحداث مشوقة إلى أقصى درجة يربط ببراعة بين صراعات المسلمين الأوائل بعد وفاة الرسول وفتح مصر واغتيال عثمان بن عفان وعلي بن أبي طالب. إن إبراهيم عيسى يخلق لنا – ولأول مرة – صورة أقرب ما تكون للحقيقة عن هذه السنوات المهمة والتي غيرت وجه العالم للأبد. سيُذهل القارئ عندما يعرف أن جميع شخصيات هذه الرواية حقيقية، وأن كل أحداثها تستند على وقائع وردت في المراجع التاريخية المعتمدة. وهي الجزء الأول من سلسلة «القتلة الأوائل».', NULL, 766, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1197, 'صنايعية مصر', 'صنايعية-مصر', 'http://books.google.com/books/content?id=n9fIDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=n9fIDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467637', 'هناك أشخاص ساهموا في رسم ملامح هذا البلد وتاريخ حياة سكانه، دون أن يحصلوا على نصيبهم من الضوء والمحبة والاعتراف بالفضل. في هذا الكتاب ما تيسر من سيرة بعضهم. فصول ممتعة تعرفنا على أكثر من 30 شخصية أثرت في حياة المصريين، من مخترع كولونيا 555 وسجائر كليوباترا وشوكولاتة كورونا إلى مهندس برج القاهرة وصاحب فكرة هدم خط بارليف بالمياه.', NULL, 767, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1198, 'إذاعة الأغاني', 'إذاعة-الأغاني', 'http://books.google.com/books/content?id=NG5lCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=NG5lCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467392', 'بينما تجري الحياة.. ثمة أغنية ما تدور في الخلفية بينما تدور أغنية ما.. ثمة حياة تجري في الخلفية. هذا الكتاب أجمل وأعمق كتاب لعمر طاهر حتى الآن، به كل ما يتميز به أسلوبه من سلاسة وذكاء وحس ساخر وزاد عليه هذه المرة فهم وإحساس عميق بالنفس البشرية وتعاطف إنساني مع ما نمر به من مواقف في حياتنا. يبوح عمر طاهر في هذا الكتاب العذب بمواقف من حياته بينما تصاحبنا أغاني تضع بصمتها على اللحظة. هذا الكتاب أجمل وأعمق كتاب لعمر طاهر حتى الآن، به كل ما يتميز به أسلوبه من سلاسة وذكاء وحس ساخر وزاد عليه هذه المرة فهم وإحساس عميق بالنفس البشرية وتعاطف إنساني مع ما نمر به من مواقف في حياتنا. يبوح عمر طاهر في هذا الكتاب العذب بمواقف من حياته بينما تصاحبنا أغاني تضع بصمتها على اللحظة.', NULL, 767, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1199, 'نظرية بِرما', 'نظرية-بِرما', 'http://books.google.com/books/content?id=136xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=136xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743007', '«برما» شخصية لا أحد يعرف طريقها سوى عمر طاهر، الذي أجرى معه حوارات تمتلئ بالفلسفة الشعبية الساخرة التي جعلت هذه الشخصية أكثر شهرة وجماهيرية من مؤلفها. يضم هذا الكتاب عملين بطولة برما هما: «برما يقابل ريا وسكينة»، و«الكلاب لا تأكل الشيكولاتة».', NULL, 767, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1200, 'جر ناعم', 'جر-ناعم', 'http://books.google.com/books/content?id=6VCVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6VCVDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467972', 'هذا الكتاب: 1- لن تستطيع أن تسميه مجموعة قصصية، فهو يحتوي على مجموعة من القصائد. 2- لن تستطيع أن تسميه ديوان شعر، فهو يحتوي على مقاطع من السيرة الذاتية. 3- لن تستطيع أن تسميه سيرة ذاتية، فهو مليء بقصص من الخيال. 4- أنت لست مضطرًا إلى تسميته، بل لست مضطرًا للاحتفاظ به بين يديك. يمكنك الآن أن تعيد الكتاب إلى مكانه وتنصرف، ولكن تأكد أولًا من عدم وجود المؤلف بالقرب منك، فمشهد مثل هذا ربما يحزنه كثيرًا.', NULL, 767, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1201, 'أثر النبي', 'أثر-النبي', 'http://books.google.com/books/content?id=BDMxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=BDMxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467743', 'طبعة جديدة أنيقة لواحد من أجمل كتب عمر طاهر وأكثرها مبيعًا. قصص قصيرة من وحي السيرة النبوية يحكي فيها عمر طاهر بأسلوبه الممتع والمؤثر عن 12 رجلًا وامرأةً كانوا حول الرسول عليه السلام.', NULL, 767, 2, NULL, 100.00, NULL, '2021-03-05 23:33:44', '2021-03-05 23:33:44'),
(1202, 'في العشق الإلهي', 'في-العشق-الإلهي', 'http://books.google.com/books/content?id=hPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=hPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743311', 'ألهمت كلمات الرومي، ذلك الشاعر والمتصوف الفارسي، الملايين في العالم منذ القرن الثالث عشر وحتى اليوم. في هذا الكتاب قصائد مختارة، تكشف لنا جوهر رؤى الصوفية في الحب، والحكمة الإلهية، وطبيعة الإنسانية، والعلاقة بالذات الإلهية، والبهجة التي تأتي من أن نكون على قيد الحياة، فنتذوق من خلالها تجربة النشوة التي لا تنفصل عن الحب البشري والإلهي. قصائد في الحب، والغضب، والحزن، والفرح، نستمتع بها في ترجمة جديدة وجميلة لخالد فاروق. «المكتبة الصوفية الصغيرة» سلسلة تضم عددًا من كتب التصوف الأساسية والمهمة، صغيرة الحجم، سهلة اللغة، بسيطة العبارة، تهم كل من يجذبه الحكمة والزهد والتصوف ولكنه لا يريد المجلدات الكبيرة والشروح المعقدة. أغلفتها وتنسيقها الداخلي جذابان ويجمعان بين التراث والتصميم المعاصر في أناقة وبساطة. حجم الكتب صغير ليسهل وضعها في حقيبة اليد أو الجيب.', NULL, 768, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1203, 'لن نصنع الفلك', 'لن-نصنع-الفلك', '', '', '9789776743229', '', NULL, 769, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1204, 'قهوة نامه', 'قهوة-نامه', '', '', '9789948352082', '', NULL, 770, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1205, 'الوعد', 'الوعد', 'http://books.google.com/books/content?id=TMdJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=TMdJDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467767', '· من أهم الروايات العالمية · تحولت لعدة أفلام سينمائية · «فاتنة» - الواشنطن بوست · «يُحرِّف تقاليد روايات الإثارة النفسية النمطية... ليس كتابًا لأي شخص يحب النهايات المريحة» - الجارديان · «دس السيد «دورنمات» في روايته القصيرة بعض الأسئلة الأخلاقية المحيرة» - أتلانتك منثلي تُقتل فتاةٌ صغيرة في بلدة في سويسرا، فيَعِد المخبر والدة الضحية بأنه سوف يعثر على الجاني. وبعد أن يقرر أن الرجل الخطأ قد اعتُقل، ينصب فخًّا للقاتل الحقيقي، إلا أن المنعطفات القاسية في أحداث الرواية تجعل المخبر يدفع ثمن وعده غاليًا. تُظهر ترجمة سمير جريس البديعة قدرة الكاتب السويسري الأشهر، «فريدريش دورنمات»، الفريدة في صياغة الحوارات، وعبقريته في التوقيت والتشويق وصوغ نهاية تقشعر لها الأبدان. تُرجمت الرواية إلى أكثر من 15 لغة، واقتُبست للمسرح عدة مرَّات، كما تحوَّلت إلى أفلام في كلٍّ من إيطاليا والمجر وبريطانيا وألمانيا، وكان آخر تصوير سينمائي لها في الولايات المتحدة عام 2001، بإخراج «شون بن»، وبطولة «جاك نيكولسون».', NULL, 771, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1206, 'كنت حمار.. وأشياء أخرى', 'كنت-حمار..-وأشياء-أخرى', 'http://books.google.com/books/content?id=A87bDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=A87bDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467842', 'يقول الإعلامي الساخر هشام منصور في أول كتاب له: «وأنا طفل صغير كان حلمي إني أكتب كتاب أحكي فيه قصص زي اللي باقراها، بس وقتها ما كانش عندي أي حاجة أحكيها غير قصص سلسلة ملف المستقبل ورجل المستحيل وأفلام الكارتون اللي شفتها. لما كبرت، اكتشفت إن حياتي ما كانتش بعيدة أوي عن الأفلام دي، وطلعت أكبر فيلم كارتون فيها. ده أول كتاب ليَّ في حياتي، أتمنى عزيزي القارئ إنك تتقبله قبول ميريام فارس في مدرسة طبري الحجاز بنين، أو قبول ميريام فارس بصفة عامة، ويكون حلو كده وخفيف على قلبك، وتستفيد منه أي حاجة.»', NULL, 772, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1207, 'ترتيبات عشوائية', 'ترتيبات-عشوائية', 'http://books.google.com/books/content?id=NFjBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=NFjBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743045', '· الرواية السابقة للمؤلفة حاصلة على جائزة ساويرس لشباب الكُتَّاب عام 2014 نبذة عزيزي يوسف، الحب كلمة مخيفة، ربما مبتذلة كذلك؟ لا أعرف، ولكنني كنت أحكي لصديقنا المشترك الصغير أنني أشعر بكثير من الامتنان لأنني تعرَّفت إلى الحب من قبل، بل وأمضيت ثمانية أشهر أرتع في خباياه ولحظاته الذهبية التي هي ليست من هذا العالم. أنا شخص محظوظ جدًّا، ففي يومٍ ما وقفت أمام المرآة، وقلت لنفسي ها هي ذي السعادة، لا تبحثي عنها لأنها هنا، هذا هو الحب يتجلى واقفًا واضحًا مبتسمًا يلوِّح بيده ويقول لي: «استمتعي، فلن أظل هنا كثيرًا». أصحو من النوم وأحاول أن أستحضر تفاصيل الحلم، ولكن لا يبقى منه في ذاكرتي سوى ابتسامة صافية على وجهك، وآثار حضن قوي على كتفي، وإحساس عام بالسعادة، وببعض الجهد أستطيع استحضار رائحة لا أعرف من أين أتيت بها، لا أعرف أصلًا إن كنا نستطيع تمييز الروائح في الأحلام، أم أنه العقل الباطن يلعب ألعابه من جديد؟', NULL, 773, 2, NULL, 100.00, NULL, '2021-03-05 23:33:45', '2021-03-05 23:33:45'),
(1208, 'كتاب الصدق', 'كتاب-الصدق', 'http://books.google.com/books/content?id=jPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=jPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743267', '«كتاب الصدق - وهو الوحيد الذي بقي من آثار الخرَّاز - كان من الكتب التي يتوارثها الصوفية، ويحيطونها بالكتمان، ويضنون بها على غير أهلها، لأنها ذخيرة نفيسة، لا يصح أن تُبتذل للعامة، وكأنها لؤلؤة مكنونة، لا يُستساغ أن تقتحمها أعين الدهماء. والواقع، أنه مختصر في غاية النفاسة، يرسم في دقة وفي وضوح الطريق إلى الله». - الشيخ عبد الحليم محمود *** كتاب بسيط في كلماته، عميق في معانيه، للزاهد الكبير شيخ الصوفية الإمام العارف أبي سعيد أحمد بن عيسى البغدادي الخرَّاز، المتوفَّى عام 277هـ. قال عنه المرتعش: «الخلق كلهم عيال على أبي سعيد الخرَّاز إذا تكلم هو في شيء من الحقائق»، وقال عنه ابن الطرسوسي: «أبو سعيد الخرَّاز قمر الصوفية». «المكتبة الصوفية الصغيرة» سلسلة تضم عددًا من كتب التصوف الأساسية والمهمة، صغيرة الحجم، سهلة اللغة، بسيطة العبارة، تهم كل من يجذبه الحكمة والزهد والتصوف ولكنه لا يريد المجلدات الكبيرة والشروح المعقدة. أغلفتها وتنسيقها الداخلي جذابان ويجمعان بين التراث والتصميم المعاصر في أناقة وبساطة. حجم الكتب صغير ليسهل وضعها في حقيبة اليد أو الجيب.', NULL, 774, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1209, 'نهج الحكمة', 'نهج-الحكمة', 'http://books.google.com/books/content?id=kvgIEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=kvgIEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743304', 'على مرِّ العصور، عَدَّ الناسُ علي بن أبي طالب؛ ابن عم النبي محمد ﷺ، وزوج ابنته فاطمة الزهراء، وأحد العشرة المبشرين بالجنة، ورابع الخلفاء الراشدين، مِن أكثر الناس علمًا وفقهًا ودرايةً. وقد اشتهر بالعدل والفصاحة والحكمة، فكان قاضيًا عادلًا، وخطيبًا مُفوَّهًا؛ تقطر كلماته بلاغةً وأدبًا وبيانًا، وقد جمع العلماء ما أُثر عنه من أشعار جميلة، ورسائل بليغة، وخطب مؤثرة، ومواعظ مفيدة. يجمع هذا الكتاب الثمين مختارات من أجمل أقواله وحِكمه المأثورة. «المكتبة التراثية الصغيرة» سلسلة تضم عددًا من كتب التراث الأساسية والمهمة، صغيرة الحجم، سهلة اللغة، بسيطة العبارة، تهم القارئ العام. أغلفتها وتنسيقها الداخلي جذابان ويجمعان بين التراث والتصميم المعاصر في أناقة وبساطة. حجم الكتب صغير ليسهل وضعها في حقيبة اليد أو الجيب.', NULL, 775, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1210, 'هو أنت', 'هو-أنت', 'http://books.google.com/books/content?id=ZdMDEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=ZdMDEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743120', '«اختياراتك لحياتك هي فعلًا صحيحة ولكن هناك اختيارات أخرى صحيحة أيضًا... بدائل قد تكون أنسب بحسب الوقت والظروف... فهل ستختارين أن تكملي طريقك بنفس الاختيارات الآمنة التي سكنتي إليها وتعودتي آلامها أم سوف تختارين اختيارات أخرى بها قدر من المغامرة؟» في هذا الجزء الثالث والأخير من «ثلاثية روح» تقف روح عند مفترق طرق، وأصبح لزامًا عليها الاختيار بين ثلاث طرق وثلاث مغامرات متباينة. فأيها ستختار؟ وماذا سيحدث لها في رحلتها؟ وأي تجارب روحية جديدة عليها أن تمر بها؟', NULL, 776, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1211, 'خواطر سطحية سخيفة عن الحياة والبشر', 'خواطر-سطحية-سخيفة-عن-الحياة-والبشر', 'http://books.google.com/books/content?id=BujWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=BujWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743205', 'يقول د. أحمد خالد توفيق في تقديم هذا الكتاب الممتع: «أعتقد أن هذا كتيب مُسلٍّ... لا تتوقع معجزة فكرية، أو كتاب النبي لجبران، أو خواطر ظَفِر بها كاهن من الشامان جلس يتأمل فوق جبل فوجي، أو سطور البهاجافادجيتا. هي مجرد خواطر مسلية تسللت إلى وعيي عبر ثقوب الحياة اليومية، وبعضها ظَل هناك. وكما هي العادة تتنوع هذه الخواطر بشدة: بعضها كتبته وأنا في الصف الثانوي وبعضها كتبته أمس، وبعضها عاطفي وبعضها سياسي، بعضها موجز رشيق وبعضها طويل ممل كلَيْلة سوداء، بعضها ساخر يجعلك تبتسم وبعضها قد يدفعك للانتحار.»', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1212, 'في ممر الفئران', 'في-ممر-الفئران', 'http://books.google.com/books/content?id=niSeDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=niSeDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467552', 'رواية «دعني أنتحِ بك جانبًا لأخبرك بسر لا يعرفه سوانا. احترس! لا ترفع صوتك.. عندما نحلم، فإن وعينا يسافر لبعد آخر ليمارس حياة أخرى ويلقى أناسًا آخرين، ويعرف وجوهًا أخرى. «فرويد» لم يقل هذا، لكن دعني أخبرك أنها الحقيقة. بل هي الحقيقة الوحيدة...» وقال الله: «فليكن نور» فكان نور. كتب د. أحمد خالد توفيق من قبل عن عالم كابوسي، يمتزج فيه معنى الظلام بمعاني الجهل والقهر والتخبط. ولكنه اليوم يقدم لنا رواية ديستوبية مثيرة عن عالم لم يعد النور فيه من حقوق الإنسان الطبيعية، وحيث يتخبط الناس مكفوفين في ممر الفئران، وهم يجهلون أن هناك نورًا خلقه الله، وأنه كان للجميع قبل أن تحتكره فئة محظوظة. ربما كان الخلاص ممكنًا، ولربما هو أمل زائف. سنعرف عندما نعرف... يعتبر أحمد خالد توفيق أحد أهم الأدباء العرب في مجال الرعب والإثارة والخيال العلمي، وأكثرهم تقديرًا وشعبية ومبيعًا.', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1213, 'الهول', 'الهول', 'http://books.google.com/books/content?id=WQCgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=WQCgCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467064', 'نبذة: سوف نفتح هذه المجموعة القصصية ونحن مفعمون بالأسئلة، ونتركها مفعمين بالخوف: ما مهنة ذلك الرجل الغامض في تلك المسابقة التلفزيونية؟ الموقع الغامض الذي يعرض على الناس منظر جثتك الممزقة. شارع المشاط الهادئ المسالم الذي يكتم سكانه سرًّا مرعبًا. العلاج الشنيع الذي يقدمه الطبيب الأرمني والذي يعيد لك الحواس وربما الأطراف المبتورة. «زوزانكا» تحاول معرفة ما يوجد في قبو أسرة زوجها. الكائن القادم من جانب النجوم لينشر الهول في الأرض. إنها رحلة طويلة مرهقة عبر سراديب الرعب وأقبيته، بينما صراخ الموتى يصم أذنيك.', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1214, 'حروب الرحماء', 'حروب-الرحماء', 'http://books.google.com/books/content?id=EK1xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=EK1xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467996', 'رحلة الدم لم تنتهِ إذن. بل إن الدم أكثر وأغزر. لم تكن أبدًا فتنة، بل أعمق وأخطر. انسَ كل ما كنت تعرفه عن الفتنة الكبرى، فأنت تدنو من الحقيقة الآن في سردٍ أقرب إلى الواقع وأكثر تشويقًا مع هذه الرواية التي يستكمل بها إبراهيم عيسى مسيرة «القتلة الأوائل»، والتي بدأها في «رحلة الدم» (جائزة نجيب محفوظ في الرواية 2018)، ليتناول السنوات اللغز في تاريخنا الإسلامي. ونؤكد للقارئ مرَّة أخرى أن جميع شخصيات هذه الرواية المبهرة حقيقية، وأن كل أحداثها تستند إلى وقائع وردت في المراجع التاريخية المعتمدة.', NULL, 766, 2, NULL, 100.00, NULL, '2021-03-05 23:33:46', '2021-03-05 23:33:46'),
(1215, 'كنت شابا في الثمانينيات', 'كنت-شابا-في-الثمانينيات', 'http://books.google.com/books/content?id=Iq_bDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Iq_bDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743038', 'يُقدم لنا الناقد المرموق محمود عبد الشكور، بأسلوبه الممتع، سيرة ثقافية واجتماعية لمصر في ثمانينيات القرن الماضي، وذلك من خلال عينيه. شابٌّ يبدأ حياته الجامعية واستقلاله عن عائلته، فينتقل إلى العاصمة، وينغمس بكل جوارحه في الثقافة بمختلف أشكالها من أفلام وكتب وموسيقى وغيرها. نقرأ عن الحياة في المدينة الجامعية، وبداياته الصحفية الأولى، وانتشار الجماعات الإسلامية، وأحداث الأمن المركزي، ومأساة بليغ حمدي، وظهور الأغنية الشبابية الجديدة ورموزها، واختطاف طائرة مصرية وسفينة إيطالية، وأحداث أخرى مثيرة نسيها كثيرون، وربما يقرأ عنها آخرون لأول مرَّة. يُعد هذا الكتاب استكمالًا لما بدأه ناقدنا في كتابه الناجح «كنت صبيًّا في السبعينيات»، بعيدًا عن التأريخ الأكاديمي الجاف، ليجعل القارئ يعيش داخل عقل ومشاعر شاب طموح يتطلع إلى المستقبل في مصر وقتها. كتاب لا غنى عنه في التأريخ الاجتماعي لمصر يربط بذكاء بين الخاص والعام.', NULL, 777, 2, NULL, 100.00, NULL, '2021-03-05 23:33:47', '2021-03-05 23:33:47'),
(1216, 'حكاية الجارية', 'حكاية-الجارية', '', '', '9789948352068', '', NULL, 189, 2, NULL, 100.00, NULL, '2021-03-05 23:33:47', '2021-03-05 23:33:47'),
(1217, 'بهجة الحياة البسيطة', 'بهجة-الحياة-البسيطة', 'http://books.google.com/books/content?id=pPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=pPgIEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743397', '«بهجة الحياة البسيطة» كتاب جدير بأن يكون في كل منزل، وهدية مثالية لأي شخص تحبه يريد أن يبسط حياته. يعلمنا أسلوبًا ممتعًا وسهلًا للتخلص من الكراكيب، ولتنظيم أي مكان نعيش ونعمل فيه. هل تنظر أحيانًا في أرجاء منزلك إلى أشياء اشتريتها، وورثتها، ومُنِحت إياها، فتشعر بأنها تضغط عليك بدلًا من أن تشعرك بالسعادة الغامرة؟ هل تتمنى في بعض الأحيان أن تهب عاصفة قوية فتأخذ معها كراكيب منزلك؟ افتح هذا الكتاب، وستكون في طريقك إلى حياة أكثر بساطة وهدوءًا. بدلًا من اتباع المناهج الصارمة أو المتطرفة أو القاسية الموجودة في كتب التنظيم الأخرى، تقدم «فرانسين جاي» خطوات بسيطة تُشكِّل عادات جديدة، ما يمهد الطريق لتحقيق نجاح مستديم. تَصلُح طريقتها السهلة لأي مكان: من درج واحد إلى خزانة إلى غرفة إلى منزل بأكمله. وأكثر من ذلك: يمكن استخدام أسلوبها في أثناء الانتقال من منزل إلى آخر، أو الزواج، أو إنجاب الأطفال.', NULL, 778, 2, NULL, 100.00, NULL, '2021-03-05 23:33:47', '2021-03-05 23:33:47'),
(1218, 'المولودة', 'المولودة', 'http://books.google.com/books/content?id=pMtJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=pMtJDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467934', 'وُلِدَت لأب مصري يهودي وأم إيطالية مسيحية، تقابلا في مصر في عشرينيات القرن الماضي، فتزوجا وعاشا فيها. وُلِدَت وعاشت في القاهرة، انضمت إلى الحركة الشيوعية والعمل السري، دخلت السجن، أحبَّت صحفيًّا ومناضلًا مصريًّا وتزوجا، عملت كصحفية تناصر قضايا المرأة، وفي خلال ذلك دعمت زوجها - خصوصًا عندما تعرض لملاحقة السلطة وللعزلة - وأصبحت أمًّا فربت ابنتيها وحفيديها. ولكن حياة «نائلة كامل»، المولودة «ماري إيلي روزنتال»، وشخصيتها، تتحديان أي تصنيف مبسط تقدمه هذه المحطات المختزلة. ننتقل في هذا الكتاب الممتع إلى مصر أخرى لم تعد موجودة الآن، بأحوالها وناسها، ونعود مع ماري إلى سنوات السجن، ورفقاء الكفاح، واختيارات صعبة، ومواقف عصيبة، ونكتشف كيف ربت ابنتيها نادية ودينا، وكيف خاضت علاقاتها بعائلات أمها وأبيها وزوجها وحفيديها في أجواء فرز على أسس الدين والعرق والجنس. كتاب استثنائي عن حياة فريدة لإنسانة مصرية ملهمة.', NULL, 779, 2, NULL, 100.00, NULL, '2021-03-05 23:33:47', '2021-03-05 23:33:47'),
(1219, 'حرائق صغيرة في كل مكان', 'حرائق-صغيرة-في-كل-مكان', 'http://books.google.com/books/content?id=mefWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=mefWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743151', '· حازت لقب «أفضل كتاب في العام» في عدد كبير من الصحف والمواقع · تتحول حاليًا إلى مسلسل أمريكي مديح · «ذكية، وحكيمة، وحنون. إنها أعجوبة» - «بولا هوكنز»، مؤلفة رواية «فتاة القطار» · «أن أقول إنني أحب هذا الكتاب، قولٌ يبخسه حقه. إنه لغز نفسي عميق حول قوة الأمومة، وفورة الحب في سن المراهقة، وخطورة الكمال. لقد جعلني أذرف الدموع» - «ريس وِذِرسبون» · «أنا أحب «حرائق صغيرة في كل مكان». ربما هي أفضل رواية قرأتُها هذا العام» - «جون جرين»، مؤلف رواية «ما تخبئه لنا النجوم» · «قرأتُ «حرائق صغيرة في كل مكان» في جلسة واحدة وأنا أحبس أنفاسي» - «جودي بيكو» نبذة رواية محكمة، تتتبع المصائر المتشابكة لأفراد عائلة «ريتشاردسون» المثالية، والأم والابنة الغامضتين اللتين قلبتا حياتهم رأسًا على عقب. تأتي «مِيا وارِن» مع ابنتها المراهقة «بيرل» إلى شايكِر هايتس، الضاحية الهادئة في كليفلاند، وتؤجر منزلًا من عائلة «ريتشاردسون»، ثم تبدأ «مِيا» العمل في منزل عائلة «ريتشاردسون» لتساعد الأم «إيلينا»، فينجذب أطفال عائلة «ريتشاردسون» الأربعة إلى «مِيا» وابنتها. لكن «مِيا» تحمل معها ماضيًا غامضًا، وتجاهلًا للقواعد، مما يُهدِّد بقلب حياة هذا المجتمع السكاني المخطط بعناية. يحاول زوجان من أصدقاء عائلة «ريتشاردسون» القدامى تبني طفلة صينية-أمريكية، فتندلع معركة للحصول على حق الحضانة، مما يقسِّم البلدة بشكل درامي، ويضع «مِيا» و«إيلينا» وجهًا لوجه. وتصر «إيلينا» على البحث في ماضي «مِيا» لشكها فيها وفي دوافعها، لكن هوسها يؤدي إلى خسائر مدمِّرة وغير متوقعة. تكشف «حرائق صغيرة في كل مكان» وطأة الأسرار، وطبيعة الفن والهوية، والجاذبية العاتية للأمومة، وخطورة الاعتقاد بأن اتباع القواعد يمكن أن يجنبنا الكوارث. ترجمت سها السباعي هذه الرواية ترجمة أمينة وبارعة، ونقلت روح وثقافة النص الأمريكي بدقة إلى اللغة العربية.', NULL, 780, 2, NULL, 100.00, NULL, '2021-03-05 23:33:47', '2021-03-05 23:33:47'),
(1220, 'انا و الرومي', 'انا-و-الرومي', 'http://books.google.com/books/content?id=4SeBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=4SeBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789953978734', '', NULL, 781, 2, NULL, 100.00, NULL, '2021-03-05 23:33:48', '2021-03-05 23:33:48'),
(1221, 'حكايات من دفتر الوطن', 'حكايات-من-دفتر-الوطن', 'http://books.google.com/books/content?id=n-fWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=n-fWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743199', '· حكايات ممتعة من تاريخ مصر · المؤلف من أهم المؤرخين المصريين نبذة من حكايات زمن الجواري، مرورًا بالموت على تل العقارب، ومغامرات عبد الله أفندي بالمر، والبطريرك في المنفى، وجلاد دنشواي، إلى أن رفع عبد الحكم العلم، يحتوي هذا الكتاب الممتع على ثلاث عشرة حكاية مثيرة، قد يتعجب من أحداثها كثير من القُرَّاء، ليس فيها سطر واحد من وحي الخيال، أو عبارة واحدة لا تستند إلى مرجع أو مصدر، سواء كان وثيقة، أو صحيفة، أو مذكرات، أو دراسات وأبحاثًا. كان هدف الصحفي والمؤرخ الكبير صلاح عيسى أن يصبح هذا الكتاب أقرب ما يكون إلى صورة للوطن، تغري المُحبين بالقراءة في تاريخه، وبالهيام في عشقه، كما أغرته. روى عن الوطن في مفهومه الأكبر والأوسع مدًى، وحكى عن مصر، وعن غيرها من أقطار الأمة العربية، التي كانت - ولا تزال - «في الدم والقربى ذوي رحم، وفي التاريخ والأحزان إخوان». استطاع أن ينقل القارئ، من خلال هذه الحكايات، إلى الزمن الذي جرت فيه وقائعها، بكل ملامحه، وشخوصه، ومبانيه، وحوادثه، وصحفه، وفنونه، فيعشقه، مثل كاتبنا الكبير، لأنه ماضي الوطن الذي لا نملك إلا أن نُحبه، حاضرًا وماضيًا ومستقبلًا.', NULL, 782, 2, NULL, 100.00, NULL, '2021-03-05 23:33:48', '2021-03-05 23:33:48'),
(1222, 'مليون نافذة', 'مليون-نافذة', 'http://books.google.com/books/content?id=TYCxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=TYCxDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743014', '· من أهم المؤلفين العالميين · مرشح لجائزة نوبل في الأدب · أول عمل له باللغة العربية مديح · «يُجبر القارئُ على التشكيك في العلاقة بين الخيال والواقع، والعالمين المرئي وغير المرئي، والتساؤل عن العلاقة بين المؤلف كراوٍ والقارئ كشريك في الخطاب الأدبي» - «ورلد ليترتشر توداي» · «قراءة استثنائية وآسرة بشكلٍ مستمر، من البداية إلى النهاية» - «ميدويست بوك ريفيو» · «عبقري على مستوى «بيكيت»» - «تيجو كول»، مؤلف رواية «مدينة مفتوحة» · «كتاب ذو بناء مُعقَّد ونطاق فكري واسع، لقد وجدت نفسي منبهرًا بأصالة «مُرْنين»» - «جيمز ماكنمارا»، «نيويورك تايمز» نبذة «مليون نافذة» تأمُّل مبهر في الكتابة الإبداعية بقلم أحد أهم كُتَّاب أستراليا، الذي يُقدِّم هنا بحثًا رائعًا ومُربكًا في أمجاد كتابة الرواية ومزالقها، مع التركيز على أهمية الثقة وحتمية الخيانة، في الكتابة كما في الحياة. تستكشف الخيوطُ المتداخلة لهذا العمل العلاقات المشحونة بين المؤلف والقارئ، والطفل والوالد، والصديق وصديقته، والزوج وزوجته. هذه ليست رواية للقارئ العادي، بل للقارئ المدقِّق الذي يحب تأمُّل مصائر الشخصيات الروائية، ومنطقية تسلسل الأحداث، ويهتم بكل ما هو أعمق من الحكاية البسيطة التي يقدمها العمل الروائي عادة. هي أيضًا رواية ممتعة لكل من يهتم بالكتابة، حيث تفتح له بابًا لفهم أسباب اختيار كبار الكُتَّاب لمسارٍ بعينه لإحدى شخصياتهم. تُصنَّف «مليون نافذة» كرواية «ميتا-فيكشن»، وهو تصنيف للروايات التي يشرح مؤلفوها دوافع شخصياتهم، ويناقشون منطقية الأحداث التي اختلقوها، كل هذا في نَصِّ الرواية نفسه، مما يجعل هذا النوع مميزًا ومثيرًا لتفكير القارئ وتأملاته. نُقدِّم للقارئ هنا أول أعمال «مُرْنين» بالعربية، وقد ترجمها عن الإنجليزية محمد عبد النبي ببراعة وأمانة.', NULL, 783, 2, NULL, 100.00, NULL, '2021-03-05 23:33:48', '2021-03-05 23:33:48'),
(1223, 'الأمريكي الهادئ', 'الأمريكي-الهادئ', 'http://books.google.com/books/content?id=EljBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=EljBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743069', '· من أهم المؤلفين العالميين · أشهر أعمال المؤلف · تحولت لفيلمين سينمائيين ناجحين مديح «رواية رائعة، مبنية بأستاذية، عن الحب والفوضى» - «زادي سميث»، «الجارديان» «كاتب عظيم تحدث ببراعة إلى جيل كامل» - «أليك جينيس» «إنجاز رائع!» - «الساترداي ريفيو» «لا يوجد كاتب جاد في هذا القرن استطاع أن يغزو الخيال العام ويُشكله أكثر من «جراهام جرين»» - «التايم» «واحد من أفضل الكُتاب بأي لغة» - «الواشنطن بوست» نبذة «لم أعرف قط رجلًا كان لديه دوافع أفضل لكل المشاكل التي سببها»، هكذا يصف الراوي، «فاولر»، المبعوث الأمريكي «ألدين بايل»، المسمى «الأمريكي الهادئ». «بايل» شاب مثالي أرسلته واشنطن في مهمة غامضة إلى فيتنام، حيث يحارب الجيش الفرنسي الفيتناميين. وبينما تؤدي سياسات «بايل» حسنة النية إلى إراقة الدماء، يجد «فاولر»، المراسل البريطاني المحنك والساخر، أنه من المستحيل أن يقف ويراقب، لكن دوافعه للتدخل مشكوك فيها، سواء بالنسبة إلى الشرطة أو إلى نفسه. على الرغم من انتقاد رواية «جراهام جرين»، «المعقدة والمليئة بالمؤامرات والمكائد المضادة»، بأنها معادية لأمريكا، فإنها ستُثبت، في غضون سنوات قليلة بعد إصدارها، صوابها في إدانتها للتدخل الأمريكي في فيتنام. تحولت هذه الرواية المثيرة للجدل، والتي تدور حول الحب والبراءة والأخلاق، إلى فيلمين سينمائيين ناجحين. ترجم شوقي جلال ومحمود ماجد هذه الرواية بدقة وبراعة، واستطاعا نقل أسلوب جرين السلس والتلغرافي بذكاء إلى اللغة العربية.', NULL, 784, 2, NULL, 100.00, NULL, '2021-03-05 23:33:48', '2021-03-05 23:33:48'),
(1224, 'أربطة', 'أربطة', 'http://books.google.com/books/content?id=2lfBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=2lfBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743052', 'من أهم المؤلفين العالميين أول عمل له باللغة العربية «جائزة ذا بريدج للكتاب» لأفضل رواية 2015 قائمة أفضل كتب العام – «الصنداي تايمز» قائمة أفضل كتب العام – «كيركوس رفيو» قائمة كتب العام المتميزة – «النيويورك تايمز» «إنجاز غير عادي» - «الصنداي تايمز» ««أربطة» تشبه الأحاجي؛ رواية معمارية، مبنية بدهاء» - «النيويوركر» «دراسة بارعة عن مرور الزمن» - «ناشنال بوست» «حكاية مُحكمة عن مجزرة منزلية» - الملحق الأدبي لـ«التايمز» نبذة تعرَّضت علاقة «فاندا» و«ألدو» الزوجية، على غرار كثير من العلاقات المماثلة، للمِحن، والتآكل، وثقل الروتين. وعلى الرغم من ذلك فإنها استمرت سليمة - كما قد يبدو للوهلة الأولى. لكن شرخًا ظهر منذ زمن بعيد، ومع مرور الوقت أصبحت العلاقة تشبه إناء متشققًا قد يتحطم من أقل لمسة. وربما تحطم بالفعل، حتى إن لم يعترف أحد بذلك. «أربطة» رواية أخاذة وصادمة عن الحب، والعائلة، والنتائج الحتمية لأفعالنا. ترجمتها أماني فوزي حبشي ببراعة وسلاسة، لتكون أول أعمال «دومينيكو ستارنونه» - أحد أهم كُتَّاب إيطاليا اليوم - التي تُنشر بالعربية.', NULL, 785, 2, NULL, 100.00, NULL, '2021-03-05 23:33:49', '2021-03-05 23:33:49'),
(1225, 'الطريق إلى السعادة', 'الطريق-إلى-السعادة', 'http://books.google.com/books/content?id=qQKgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qQKgCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467255', 'المؤلف أحد أهم الأطباء النفسيين في العالم العربي كتباه السابقان «تشريح الشخصية المصرية» و«ثقوب في الضمير: نظرة على أحوالنا» من الأكثر مبيعًا في المجال نفسه. نبذة الدكتور أحمد عكاشه، أحد أهم الأطباء النفسيين في العالم العربي، يُقدم لنا في هذا الكتاب المهم آخر ما توصل إليه العلم عن السعادة. وبأسلوبه الممتع والبعيد عن التعقيد يُسلط الضوء على العلاقة المتكاملة بين الصحة الجسدية والراحة النفسية وجودة الحياة الشخصية والاجتماعية، ويوضح لنا العناصر المكونة للسعادة النفسية وسُبل الوصول إلى تحقق الذات والإنجاز والسعادة في الحياة. كتاب لا غنى عنه. من أهم الموضوعات المتناولة: مفهوم السعادة مفرحات النفوس الربانية حلاوة الأمل جودة الحياة الصحة النفسية المزاج وجهاز المناعة النوم والأحلام التغلب على تعاسة المشاكل الجنسية من خلال الموسيقى الإيمان والصحة النفسية', NULL, 786, 2, NULL, 100.00, NULL, '2021-03-05 23:33:49', '2021-03-05 23:33:49'),
(1226, 'الاعتداء', 'الاعتداء', 'http://books.google.com/books/content?id=bL42DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=bL42DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467712', 'في أواخر الحرب العالمية الثانية، وبينما هولندا ما زالت محتلة، تقتل مجموعة من المقاومين شرطيًّا عميلًا، وتنتهي الجثة لسبب غامض أمام منزل عائلة «ستينفايك»، فيحرق الألمان المنزل ولا ينجو من العائلة إلا «أنطون»، ابن الاثني عشر عامًا. بعد ذلك بسنوات، يصبح «أنطون» طبيبًا يعيش حياة هادئة ويتعمد النسيان، إلا أن مصادفات الحياة وأزماتها ستعطيه خيوطًا متفرقة تسمح له بإكمال صورة الحدث وإدراك عبثية الأقدار. قصة تحبس الأنفاس، مشوقة مثل رواية بوليسية، ترسم ببراعة مذهلة التداخل الدقيق بين القدر والمصادفات، والقوة والضعف، والبراءة والذنب. نالت رواية «الاعتداء» جائزة «ديبسيه برايز» في هولندا، وتحولت إلى فيلم سينمائي نال «أوسكار» أفضل فيلم أجنبي، وجائزة «جولدن جلوب» لأفضل فيلم بلغة أجنبية، وجائزة أفضل فيلم في «مهرجان سياتل الدولي للسينما» عام 1986.', NULL, 787, 2, NULL, 100.00, NULL, '2021-03-05 23:33:49', '2021-03-05 23:33:49'),
(1227, 'ما لا يمكن اصلاحه', 'ما-لا-يمكن-اصلاحه', '', '', '9789776743212', '', NULL, 788, 2, NULL, 100.00, NULL, '2021-03-05 23:33:49', '2021-03-05 23:33:49'),
(1228, 'روح', 'روح', 'http://books.google.com/books/content?id=3LSbCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=3LSbCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467385', 'عندما تتعرف رشا على روح وأصدقائها: المغني الصوفي براء، الكاتب نور وزوجته المغربية حياة، تنفتح أمامها طاقات الارتقاء الصوفي والسمو الروحي... ولكنها أيضا تعيش مع روح عذاب تجربة حب مستحيل مع مرشدها نور في صراع مزلزل بين ما يريده المرء وحاله. فما مصيرهما؟ هل سيجتمعان في هذا العالم أم يظل قدرهما أن يلتم شملهما في عالم البرزخ... عالم النور والأرواح؟ رواية رومانسية صوفية بقلم عذب رقيق.', NULL, 776, 2, NULL, 100.00, NULL, '2021-03-05 23:33:49', '2021-03-05 23:33:49'),
(1229, 'أرض البشر', 'أرض-البشر', 'http://books.google.com/books/content?id=CK1xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=CK1xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467828', 'بأسلوب أدبي بديع، وبروح فلسفية، يُصوِّر لنا مؤلف «الأمير الصغير» عظمة الطيران وإثارته وأخطاره وعزلته. منذ عام 1926 قاد «سانت اكزوبيري» طائرات البريد الجوي عبر صحراء شمال أفريقيا. ومن هذه التجربة الفريدة، التي قابل فيها العرب الرُّحل، استمد موضوع كتابه: «أرض البشر». إنها سيرة ذاتية ممتعة وعميقة، حول تعرُّف المرء على نفسه من خلال تصرفاته أمام ما يصادفه من تحديات، تصل إلى ذروتها عندما يحكي لنا «سانت اكزوبيري» عن نجاته بأعجوبة بعد تحطم طائرته في الصحراء. شهادة حياة مثيرة ومبهرة، ترجمها لنا مصطفى كامل فودة بأمانة وجمال.', NULL, 789, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1230, 'جبل الرمل', 'جبل-الرمل', 'http://books.google.com/books/content?id=hefWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=hefWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743182', '· سيرة ذاتية لواحدة من أهم مصورات العالم العربي · عاشت حياة حافلة بين مصر ولبنان وأمريكا والجزائر مديح · «بمشاهد إنسانية مؤثرة وتفاصيل دقيقة معبرة تشبه لقطاتها الفوتوغرافية تصور لنا رندا شعث ببساطة متناهية حياة الاغتراب الفلسطيني الأليم في بيروت أو غزة أو الجزائر أو القاهرة، والتي نكتشف بعد قراءتها أنها قصة الاغتراب العربي في أقطارنا جميعًا.» – محمد سلماوي · «كتابة عذبة ورحلة مثيرة في الجغرافيا والتاريخ لوطن «كله من خليجه إلى محيطه تعيس للغاية»» – صنع الله إبراهيم · «سيرة ذاتية مصورة مفعمة بالحنين وآلام الفقدان المتواصل» – محمود الورداني · «كتاب رندا شعث وليمة لمحبي الناس والحياة» – يسري نصر الله نبذة سيرة عاطفية مؤثرة عن العائلة والزواج والعمل أثناء حقبة مضطربة في العالم العربي. تقول رندا شعث في هذا الكتاب: «كتابتي وصوَري، بل حياتي كلها، كانت لها علاقة وثيقة بمحاولتي اليائسة أن أكون داخل المكان تمامًا. أظن أنها عقدة الإنسان المهدَّد دائمًا بالطرد: من البلد، من المكان، وحتى من قلوب الناس...» شكَّلت أعمال رندا شعث المميزة، التصوير الفوتوغرافي في العالم العربي في الأعوام الثلاثين الماضية، وقد حدَّدت كيف نتذكر عديدًا من الشخصيات الثقافية والمدن العربية والأحداث السياسية المهمة. ولدت رندا شعث لأب فلسطيني تخصص في الاقتصاد والإدارة، وشغل مناصب سياسية مهمة، وأم مصرية وفرت لأولادها الثلاثة عائلة ممتدة وذات جذور قوية. تنقلت بين مصر، والولايات المتحدة الأمريكية، ولبنان، والجزائر، ومارست التصوير مهنة وفنًّا، وسجَّلت من خلاله أهم ما ميَّز العقود المنصرمة في منطقتنا. كتابها الفريد هذا، هو سيرة حياة مليئة بشخصيات لا تُنسى، وحكايات دافئة وصريحة، وذكريات تلمس كل قارئ، مطعمة بصور جميلة التقطتها عين حساسة ومبدعة.', NULL, 790, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1231, 'ويسترن يونيون', 'ويسترن-يونيون', '', '', '9789776743113', '', NULL, 791, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1232, 'هي وهو', 'هي-وهو', 'http://books.google.com/books/content?id=jVDCDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=jVDCDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789938941203', 'ربما تكون باريس هي مدينة الحب ولكن هناك من يرفض الاعتراف بذلك ميّا ممثلة شهيرة، ولكنها في الحياة الواقعية متعبة وبحاجة إلى استراحة لأنها اكتشفت أن زوجها الممثل النجم الذي هو أيضًا شريكها في بطولة فيلمها الأخير، غير مخلص لها... تذهب ميّا لتختبئ في باريس، وتغير تسريحة شعرها، وتعمل نادلة في مطعم صديقتها. أما بول فهو كاتب أمريكي يعيش في باريس ويجتهد لاستعادة شعلة الموهبة التي كتب بها روايته الأولى.. بتدبير سري من صديقه عن طريق أحد المواقع الالكترونية المخصصة بالمواعدة يلتقي بول ميا و يدخلان في علاقة معقدة . لكن على الرغم من الظروف غير الملائمة فإن القدر يخبئ لهما مصيرًا مختلفًا...', NULL, 792, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1233, '154 طريقة لقول أفتقدك', '154-طريقة-لقول-أفتقدك', 'http://books.google.com/books/content?id=rlfBDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=rlfBDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743021', '· يحتوي على رسوم · طباعة فاخرة مناسبة للهدايا رسائل قصيرة من امرأة عاشقة للرجل الذي تفتقده، مصحوبة برسوم جميلة، في زمن كادت تختفي فيه الرومانسية. «يهمس الرجال بينهم عن سحر المرأة التي تتتبع القمر. يكتبون لها الأغاني، ويتلون الأشعار على أعتابها. ثم يبحثون مع طلوع الشمس عن امرأة تتتبع الواقع وأخباره، والطحين وأسعاره، وتنظر بِوَله إلى بيت دافئ وطفل صغير.. لأنك لست مثلهم.. أفتقدك.»', NULL, 793, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1234, 'الأمير الصغير', 'الأمير-الصغير', 'http://books.google.com/books/content?id=rX-xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=rX-xDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467811', '· من أهم الكتب الكلاسيكية العالمية · أكثر الكتب ترجمةً في تاريخ الأدب العالمي · من أفضل خمسة كتب في القرن العشرين وفق تصنيف جريدة «لو موند» · يحتوي على الرسوم الأصلية للمؤلف · ترجمة جديدة متميزة · طبعة خاصة تصدر بمناسبة الذكرى الـ75 لوفاة المؤلف نبذة يتعرض طيار لحادث فيسقط مع طائرته في الصحراء، وفي الصباح يستيقظ على طفل جميل يطلب منه: «من فضلك، ارسم لي حَمَلًا!». وبعد هول المفاجأة، يُدرك الطيار أنه عندما يصعب فهم الأحداث فلا خيار يتبقى للمرء سوى الخضوع للحياة وألغازها، فيُخرج من جيبه ورقة وقلمًا... وهكذا تبدأ هذه الحكاية الفاتنة التي تدور حول ما هو مُهم حقًّا في الحياة. نادرةٌ هي القصص التي عرفت هذا الانتشار الواسع وحازت إعجاب الصغار والكبار، مثل «الأمير الصغير»؛ فقد تُرجمَت إلى أكثر من 300 لغة ولهجة محلية، ويُباع منها في العالم نحو مليوني نسخة سنويًّا. نُقدِّم «الأمير الصغير» هنا بترجمة جميلة للكاتب محمد سلماوي، وبالرسوم الرائعة للمؤلف، في طبعة جديرة بالاقتناء ستأسر قلوب القُرَّاء من كل الأعمار.', NULL, 789, 2, NULL, 100.00, NULL, '2021-03-05 23:33:50', '2021-03-05 23:33:50'),
(1235, 'رجال ريا وسكينة', 'رجال-ريا-وسكينة', 'http://books.google.com/books/content?id=Fl8wDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=Fl8wDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467248', '· طبعة جديدة فاخرة لأحد أكثر الكتب التاريخية مبيعًا · أهم كتاب يتناول هذه العصابة الشهيرة · السيرة الوحيدة التي تستند إلى الوثائق والأرشيفات، مسرودة بأسلوب شيق وممتع يتضمن الكتاب صور فوتوغرافية كثيرة نادرة للشخصيات والأماكن والوقائع تحولت ريا وسكينة منذ القبض عليهما عام 1921 إلى أسطورة في الخيال الشعبي والجمعي للمصريين، وكنموذج مُخيف ومُرعب للشر المجرد. ولم يحاول أي من المؤرخين أو علماء الاجتماع طوال كل هذه الأعوام تقصي حقيقة هذه الجرائم، أو دراسة الدوافع وراء ارتكابها، حتى قدَّم لنا صلاح عيسى هذه السيرة الاجتماعية السياسية غير المسبوقة. ويستند كاتبنا الكبير إلى الملفات القضائية، والوثائق التاريخية، والأرشيفات الصحفية، وعدد كبير من المراجع المعروفة وغير المعروفة ليرسم لنا - ولأول مرة - صورة حقيقية وحية عن هذه الشخصيات المثيرة وأوضاع مصر السياسية والاجتماعية والاقتصادية في ذلك العصر. وبالإضافة لأسلوب صلاح عيسى الشيق والممتع يمتلئ الكتاب أيضًا بعشرات الصور الفوتوغرافية للأشخاص والأماكن والوقائع؛ فيعطي المؤلف التاريخ حقه بإخلاصه للحقائق الموثقة، ويعطي القارئ حقه في الاستمتاع باكتشاف هذا التاريخ، وبمعايشة أجوائه وشخصياته.', NULL, 782, 2, NULL, 100.00, NULL, '2021-03-05 23:33:51', '2021-03-05 23:33:51'),
(1236, 'كل الشهور يوليو', 'كل-الشهور-يوليو', 'http://books.google.com/books/content?id=edMDEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=edMDEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743298', 'خرج الملك فاروق من البحر يضرب الماء غضبًا، جفَّف بلله وارتدى نظارته السوداء وقد أخفى حمرة عينيه، وهو يسمع رئيس البوليس الملكي يخبره بأن هناك تمرُّدًا من قوات للجيش في القاهرة. ركب الملك سيارة الشاطئ يقودها بنفسه، ودخل إلى مكتبه في قصر المنتزه، استدعى قائد الجيش، واتصل برئيس الأركان وأمره بالقبض على قائمة من الضباط، ثم صرخ وهو يملي الأسماء: «وأول واحد تجيبوه من بيته هو محمد نجيب!». بدأت قوات البحرية الملكية تُحكم سيطرتها على الإسكندرية، بينما انتشرت قوات الجيش بأوامر قائده في شوارع القاهرة، وانقض البوليس الحربي على كل الضباط المطلوب القبض عليهم. تم ترحيل اللواء نجيب إلى السجن الحربي مع مجموعة من الضباط الذين أطلقوا على أنفسهم «الضباط الأحرار». في صباح ٢٣ يوليو ١٩٥٢، أذاع الملك فاروق بصوته بيانًا من الراديو يعلن عن إجهاض تمرُّد عسكري والقبض على كل المشاركين في المؤامرة. لكنَّ شيئًا من هذا كله لم يحدث. بل إن ما جرى كان العكس تمامًا. إبراهيم عيسى في روايته «كل الشهور يوليو» يُعيد بناء الحقيقة من بين ركام الأكاذيب وزحام الأسرار، وينقذ التاريخ من العواطف، في رواية الصراع والخداع والحب والكراهية والصدفة والغباء والولاء والخيانة والخبل والأمل، وخطة الفشل التي حققت نجاحًا ساحقًا. حاول أن تنسى كل ما تعرفه لتتعرف الآن على الحقيقة.', NULL, 766, 2, NULL, 100.00, NULL, '2021-03-05 23:33:51', '2021-03-05 23:33:51'),
(1237, 'النظرة الأخيرة', 'النظرة-الأخيرة', 'http://books.google.com/books/content?id=MdMDEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=MdMDEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743403', '«خالد حكالي بعد ما اتجوزنا بكذا سنة إنه أخد قرار جوازه مني في اللحظة دي، لحظة ما قلتله بمنتهى الثقة بنفسي إني قبلت عرضه الوحيد اللي ما توقعهوش أبدًا. قالي: «شُفت فيكِ كل حاجة كنت بادوَّر عليها في كل ست قابلتها في حياتي». كان بيقولي: «إنتِ ست بسيطة، لكن دايمًا أنيقة وجميلة ومهندمة، جميلة الملامح والخُلق بس مش مغرورة، ذكية وشاطرة لكن مش بتحاولي تثبتي ذكائك لحد غير نفسك، واثقة في نفسك وقوية بس طيبة وكريمة، صغيرة بس مش عيلة، لذيذة وطموحة بس مش هايفة». هذه الرواية عن قصة حب، لكنها ليست قصة الحب التي تتوقعها. عن المؤلفة دينا طاهر متخصصة في مجال تنسيق الزهور وتجهيز الأفراح والمناسبات العامة، وهذه هي روايتها الأولى.', NULL, 794, 2, NULL, 100.00, NULL, '2021-03-05 23:33:51', '2021-03-05 23:33:51'),
(1238, 'مولانا', 'مولانا', 'http://books.google.com/books/content?id=YgOgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=YgOgCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778507805', 'القائمة القصيرة للجائزة العالمية للرواية العربية 2013 رواية جريئة توضح كيف يساء استخدام الدين من أكثر الكتب مبيعًا «من الوجهة الفنية والفكرية، رواية الموسم الإبداعي... شهادة دامغة على العصر» المصري اليوم «عمل ملحمي، في مصاف «قصة مدينتين» للإنجليزي «تشارلز ديكنز»، أو «الحرب والسلام» للروسي «تولستوي»، أو رائعة «باسترناك»، «دكتور زيفاجو»... كما أنها استمرار موفق لمدرسة الروائي العظيم، وأمير الرواية العربية، نجيب محفوظ... إنها تحكي تراجيديا مصر المُباركية بتكثيف مُنقطع النظير فى دقته الاجتماعية وتشويقه الروائي. لذلك تستحق جائزة الدولة فى الأدب... فهل هناك من يسمعون أو من يقرأون!؟» الوطن «كتاب يأخذك إلى عالم سفلي ترى منه الدنيا على شاشة التلفزيون وما وراءها من أسرار... سخرية حادة على طول. لا ترحم أحدًا» الجمهورية أونلاين «تنقل القارئ إلى تفاصيل وعلاقات مثيرة ومدهشة وتنكشف في النهاية عن مفاجآت ووقائع تدخل في دائرة المسكوت عنه وتقتحم الخطوط الحمراء في دهاليز الفساد السياسي والسلطة المستبدة» عُمان «يشرِّح إبراهيم عيسى بجرأة شديدة ظواهر بالجملة في المجتمع، يدخل إلى حقول ألغام، و«أعشاش دبابير» قد لا يرضى عنها البعض، وينتقد بواقعية مفرطة ما حدث، وما زال يحدث... يعمد إلى سهام السخرية وخفة الدم، حتى في أحلك اللحظات، وأشدها عتمة» الإمارات اليوم ««مولانا» التلفزيوني بطل زماننا» الحياة', NULL, 766, 2, NULL, 100.00, NULL, '2021-03-05 23:33:52', '2021-03-05 23:33:52'),
(1239, 'لك وحدك', 'لك-وحدك', 'http://books.google.com/books/content?id=dMdJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=dMdJDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467897', '· الجزء الثاني من الرواية الناجحة «روح» · رواية رومانسية صوفية بقلم عذب رقيق · لكل محبي نور عبد المجيد وأحلام مستغانمي و«قواعد العشق الأربعين» نبذة: «أما نور فكان يجلس في مقابلتها في القاعة، ينظر إليها بإعجاب، ولا يحرك عينيه عنها، ولا يشغله أيٌّ من الطقوس المقامة. كان يراها لأول مرَّة بردائها الأخضر، متألقة وسعيدة، تتمايل بجسدها الضئيل مع الأغنيات في رقة وهدوء، وكلما تمايلت تمايل قلبه معها يمينًا ويسارًا، إلى أن تمايلت مرَّة وسقط عنها شالها الحريري الأبيض المطرز بخيوط الفضة اللامعة. لم تشعر روح بسقوط الشال، كانت منسجمة تمامًا مع الموسيقى والأغاني، وتصفق بإيقاع خاص بها وحدها كأنها في عالم آخر. اقترب نور منها والتقط شالها الأبيض من الأرض...». ما بين قونيا والقاهرة ولندن والمغرب تتحرك مصائر روح التي ودَّعت حياتها ووطنها لتنفذ الرؤيا التي أمرتها بهجر حبيبها، ونور الذي يسعى إلى الارتقاء الروحي بينما يزداد شوقه إلى روح، وبراء الذي يقابل مَن قد تكون حب حياته، وحياة التي تحاول مرَّة أخرى ترتيب حياتها وزواجها. فهل سترتاح هذه النفوس؟ رواية رومانسية صوفية بقلم عذب رقيق.', NULL, 776, 2, NULL, 100.00, NULL, '2021-03-05 23:33:52', '2021-03-05 23:33:52'),
(1240, 'عناق عند جسر بروكلين', 'عناق-عند-جسر-بروكلين', 'http://books.google.com/books/content?id=JQrTDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=JQrTDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776467613', 'هذه رواية بديعة، جميلة، لروائي كبير ترسخ اسمه بسرعة في الاعوام الأخيرة ... تشبه اللحن الذي يتكرر علي مراحل في بناء سيمفوني كبير جمال الغيطاني، الأخبار عند منتصف الليل، أي بعد نصف ساعة بالضبط، ستبلغ سلمى الحادية والعشرين. نظرَت في ساعتها مرة أخرى ولامت نفسها على تأخُّرها؛ لا بد أن جدَّها غاضب جدًّا. لو لم تخطئ في الرصيف لما فاتها قطار الثالثة والنصف، ولَوَصلت إلى نيويورك في موعدها، وحضرت حفلة عيد ميلادها التي يُعِدُّها لها جدُّها منذ أسبوعين. لقد دعا كثيرين، تقريبًا كل من له صلة بها في أمريكا', NULL, 795, 2, NULL, 100.00, NULL, '2021-03-05 23:33:52', '2021-03-05 23:33:52'),
(1241, 'حلم', 'حلم', 'http://books.google.com/books/content?id=2ufWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=2ufWDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776743090', '· من أهم المؤلفين العالميين · تحولت لفيلم شهير من تمثيل توم كروز ونيكول كيدمان مديح «لا تُنسى» - «ببليشرز ويكلي» «أروع ما رواه «شنيتسلر»» - «النيويوركر» «تساءلتُ متعجبًا مرَّات كثيرة: من أين لكَ بهذه المعارف السرية أو تلك، معارف لم أصل إليها إلا بعد أبحاث مضنية؟ وفي النهاية أصبحتُ أحسد الأديب الذي كنتُ أنظر إليه دومًا بإعجاب، وتَولَّد لديَّ انطباع بأنك عبر الحدس - بل عبر الوعي الدقيق بالذات في حقيقة الأمر - عرفتَ كل ما اكتشفتُه أنا عن البشر عبر العمل الشاق» - «زيجموند فرويد» «قرأنا نوفيلا «حُلم» مبهورَين، طالعها كلٌّ منا مأخوذ الأنفاس، من دون توقف. نرسل إليك تحياتنا مع بالغ الإعجاب» - «توماس مان وزوجته» نبذة تحكي هذه النوفيلا المذهلة، الجميلة والقاسية في آنٍ، كيف أن اعترافًا بسيطًا بين زوج وزوجته، بنزوة جنسية عابرة، قادهما إلى عالمَين داخليَّين خاصَّين جدًّا ومتنافسَين، مليئين بأحلام الانتقام، وكاد يؤدي بهما إلى الانفصال. «حُلم» نوفيلا نفسية عن الخيانة الزوجية، وخرق المحظور، والانحلال الأخلاقي، تدور أحداثها في فيينا في بدايات القرن العشرين، لكنها تمس مناطق مدفونة من النفس البشرية في كل زمان ومكان. نالت شهرة واسعة، وتُرجمت إلى عدة لغات، واقتُبست للمسرح والتلفزيون والراديو والسينما، وهي الأساس الأدبي لآخر أفلام «ستانلي كوبريك»، «Eyes Wide Shut» («عيون مغلقة على اتساعها»). نُقدِّمها هنا في ترجمة متميزة لسمير جريس، الذي نقل، بأمانة وسلاسة منقطعتَي النظير، لغة «أرتور شنيتسلر» الألمانية-النمساوية الرصينة، ليستمتع القارئ العربي بهذا النص المدهش في تجربة قراءة عربية أقرب ما تكون إلى الاستمتاع بالأصل.«كتاب ذو بناء مُعقَّد ونطاق فكري واسع، لقد وجدت نفسي منبهرًا بأصالة «مُرْنين»» - «جيمز ماكنمارا»، «نيويورك تايمز»', NULL, 796, 2, NULL, 100.00, NULL, '2021-03-05 23:33:53', '2021-03-05 23:33:53'),
(1242, 'أولي أجنحة', 'أولي-أجنحة', '', '', '9789778534979', '', NULL, 797, 2, NULL, 100.00, NULL, '2021-03-05 23:33:53', '2021-03-05 23:33:53'),
