(1245, 'أين المفر', 'أين-المفر', 'http://books.google.com/books/content?id=GQ5SDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=GQ5SDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200492', 'لو أنّ لها أن ترسم صورة مبسّطة عن حياتها، منذ وعت بها، لقالت إنّها سلسلة من الصّدمات. كلّ صدمة ترسم لها مسارا مغايرا وتبعث في وجودها معاني كانت في غفلة عنها. كان عليها أن تفتّش عن الصّدمة التّالية لتجد طريقها. كانت تمشي متلفّتة منتبهة لأبسط الأحداث، تبحث عن بوادر الصّدمة فيها.. وتتساءل: هل تصلح هذه بذرة لزوبعة تهزّ أركان حياتها الرّتيبة؟ وكلّما هيّئ لها أنّ الصّدمة آتية، تشبّثت بها وقالت ها هي ذي! لكنّها سرعان ما تشيح عنها حين تجدها عقيما من دوافع التّغيير. مَثلها في ذلك كمثل صيّاد يصطاد السّمكات ثمّ يلقي بها في البحر، يترقّب سمكة أكبر. حتّى وقفت ذات يوم وقالت: هذه صدمتي، هذه أكبر!', NULL, 799, 2, NULL, 100.00, NULL, '2021-03-05 23:33:56', '2021-03-05 23:33:56'),
(1246, 'غربة الياسمين', 'غربة-الياسمين', 'http://books.google.com/books/content?id=QtsmDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=QtsmDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789776376632', 'حين تحدّثتا عن موضوع السّفر لأوّل مرّة، تكلّمت أمّها فاطمة بشيء من الفلسفة. حدّثتها عن نبات الياسمين الذي أعطتها اسمه. مثل الياسمين، ربّتها على القناعة والاكتفاء بالقليل. فهو نبات لا يحتاج إلى الكثير من العناية. تكفيه دفعة واحدة من السّماد في ربيع كلّ عام، وتربة رطبة دون فيض من السقيا. جميع أنواع الياسمين تفضل النّموّ في مكان مشمس، لكنّها تتحمّل وجود شيء من الظلّ. وشمس تونس كانت مواتية لنضجها وتكوين شخصيّتها، وقد أصبحت جاهزة لتحمّل شيء من ظلالأوروبا ذات المناخ البارد. مثل الياسمين الأبيض المتوسّطي، كانت رقيقة في مظهرها، لكنّ شخصيّتها قويّة وثابتة، مثل رائحة الياسمين النفّاذة والفريدة التي تبثّ إحساسا بالدّفء لا تملكه الورود الأخرى. لم تتكلّم عن دلالة الياسمين العاطفيّة التي بحثت ياسمين عنها مذ اهتمّت بمدلولات الزهور في بداية مراهقتها. عرفت أنّ إهداء زهر الياسمين لامرأة يعني “لماذا لا تحبّين أبدًا؟”. والدها أهداها هي، ياسمين، إلى والدتها. كانت آخر عطاياه لها حين تخلّى عن حضانتها إثر الطّلاق. وهي “لم تحبّ بعده أبدًا”. كانت جديرة بتقبّل زهرة الياسمين. تفتقد أمها كل يوم أكثر من اليوم الماضي. مع مرور الوقت تزداد يقينًا من ضياعها بدونها. كانت تعلم أن الغربة ليست تجربة سهلة، ومع ذلك وافقت على سفرها. علّمتها كيف تكون ياسمينة حقيقيّة. لكن لعلّها غفلت عن حقيقة مرّة. زهرة الياسمين تذبل بسرعة حين تغادر تربتها وتنسّق في شكل “مشموم” جميل.', NULL, 799, 2, NULL, 100.00, NULL, '2021-03-05 23:33:57', '2021-03-05 23:33:57'),
(1247, 'أرني أنظر إليك', 'أرني-أنظر-إليك', 'http://books.google.com/books/content?id=qovPDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qovPDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200645', 'تضطرب أنفاسك، وتيمِّم بصرك شطر الجبال الشَّامخة قبالتك. يجفُّ لعابك وينعقد لسانك. كم مضى عليك من دهور مذ خاطبته آخر مرَّة؟ لقد ظلَّ قرارك الأخير بعبادة خالقك على طريقتك معلَّقا. كم مرَّت بك من ليالٍ عجافٍ لم تفلح فيها في مناجاته رغم محاولاتك؟ هل نسيت كيف تكون خلوة العبد بربِّه؟ أم أنَّك لا تعرف سبيلا غير الطُّرق القديمة التي نفرتها؟ لقد كنت يوما حيَّ بن يقظان على جزيرة مهجورة، فهل يسعك هذه اللَّيلة أن تكون موسى؟ تهمس بصوت خافت لا يسمعه غيرك، رغم السُّكون المخيِّم حولك، لكنَّك تدرك يقينا أنَّه يحصي حركاتك وسكناتك، ولا يفوته شيء من خلجاتك. تخرج حروفك مرتبكة باهتة، مثل زفرة طويلة متعبة: يا ربُّ، يا إلهي.. يا خالقي.. أيًّا كان اسمك.. أرني أنظر إليك!', NULL, 799, 2, NULL, 100.00, NULL, '2021-03-05 23:33:58', '2021-03-05 23:33:58'),
(1248, 'حتى اللحظة الأخيرة', 'حتى-اللحظة-الأخيرة', '', '', '9789776555266', '', NULL, 800, 2, NULL, 100.00, NULL, '2021-03-05 23:33:58', '2021-03-05 23:33:58'),
(1249, 'الآن نفتح الصندوق 3', 'الآن-نفتح-الصندوق-3', 'http://books.google.com/books/content?id=qYYtDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qYYtDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200317', 'قبل أن نغلق الصندوق .. يبدو ان الدكتور \"محفوظ\" يرحمه الله كان ثرثارًا، فقد فتحنا الصندوق للمرة الثانية وأخرجنا حشدًا من الأوراق من داخله، وكلها قصاصات تحكي عن تجاربه الغريبة مع عالم الرعب أو عالم الماورائيات. برغم هذا ظلت قصاصات عدة في مكانها هنا وهناك .. أظرف مغلقة .. أوراق مطوية.. قصص كاملة كتبت بخط دقيق جدًا على ظهر أوراق تقويم.. كراس لولبي ممزق.. آلخ إن الخوف من الصندوق المغلق أو الحيرة بصدد محتواه قديمان جدًا في وجدان البشر، ولسوف تجده في ألف ليلة وليلة وشكسبيروقصص الأطفال وكل شيء.. إنه الغيب مجردًا .. نحن محظوظون لأننا نعرف يقينًا أن الصندوق يحوي قصاصات ورقية.. لن نجد جثة كما في ألف ليلة وليلة، ولن نجد عقربًا أو ثعبانًا أو سبيكة مشعة أو غازًا سامًا أو لعنة قديمة.. بعض القصص قد يكون ممتعًا، وبعضها مخيف، وبعضها طريف، وبعضها ممل كالجحيم.. الاحتمال الأخير خطر علينا وعلى د.مخفوظ طبعًا، لكن ما أكثر الملل في هذا العالم على كل حال!.. هناك نافذة خلفية ذات صفات غريبة.. هناك كلب يؤدي النداء بأسمه إلى كارثة.. هناك مقابلة عمل غريبة جدًا، هناك حالة متقدمة من الأرق.. هناك بقع حبر ورأس من رءوس التسانتسا المصغرة.. هناك أغنية أطفال شريرة .. الآن وقد عرفنا قواعد اللعبة، هاتوا شمعة ولننزل للقبو ونفتح الصندوق .. هذه هي الورقة الأولى.. هل ترى الحروف؟ .. ماذا تقول؟ ..', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:58', '2021-03-05 23:33:58'),
(1250, 'ESP', 'ESP', 'http://books.google.com/books/content?id=5YMtDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=5YMtDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200256', 'اسمى (هند الشافعي) .. لدي موهبة تجعلني قادرة على إيجاد الحقيقة في أغرب الحوادث و أكثرها غموضاً .. هكذا استطعت أن أزيح الستار عن قصص حيرت الكثيرين وحيرت رجال الشرطة. هناك أسماء كثيرة لموهبتي تلك، فهي حزمة كاملة من القدرات التي يطلق عليها العامة اسم (الحاسة السادسة)، بينما أفضل أنا أن أطلق عليها اسم الإدراك الفائق للحواس أو E.S.P. ...', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:58', '2021-03-05 23:33:58'),
(1251, 'شاي بالنعناع', 'شاي-بالنعناع', 'http://books.google.com/books/content?id=BYctDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=BYctDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200201', 'إذا استطعت أن تحتفظ بعقلك بينما كل من حولك قد فقدوا عقولهم.. ويلومونك على ذلك .. إذا استطعت أن تثق بنفسك بينما الناس تشك فيك وبرغم هذا تسمح لهم بأن يشكّوا .. إذا استطعت الانتظار فلا تتعب فإذا ما خدعك الآخرون لا تلجأ للكذب .. إذا كرهك الناس فلم تدع الكراهية تتغلب عليك .. وبرغم هذا لا تبدو راضيًا عن نفسك ، أو تتكلم بحكمة أكثر من اللازم .. إذا استطعت التعامل مع الجماهير، وبرغم هذا تحتفظ بفضائلك .. وإذا مشيت مع الملوك وبرغم هذا لا تفقد فهمك للناس.. إذا لم يستطع خصومك ولا أصدقاؤك أن يؤذوك .. إذا كنت تهتم بالناس جميعًا، لكن لا تهتم بأحد أكثر من اللازم .. فلك الأرض وكل ما فيها .. وما هو أهم.. ستكون رجلاً يا بني !', NULL, 801, 2, NULL, 100.00, NULL, '2021-03-05 23:33:59', '2021-03-05 23:33:59'),
(1252, 'الغث من القول', 'الغث-من-القول', 'http://books.google.com/books/content?id=6YYtDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=6YYtDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200195', 'أتذكر راجفًا القصة التي حكاها لي أحد المصريين عن صديق له، ذهب إلى بيروت للهو في أعوام الحرب الأهلية المنحوسة. ركب سيارة نقل عام فكان من حظه الأسود أن استوقفتها في شارع جانبي مجموعة من الشباب الملثمين المدججين بالسلاح .. راحوا ينزلون ركاب السيارة واحدًا واحدًا فيسألونه عن ديانته ويفحصون أوراقه، والمشكلة هي أن باقي ركاب السيارة لا يعرفون الإجابة .. هذا يتركونه ينصرف، وهذا يأخذونه على جنب إلى جوار الجدار فيذبحونه بالسونكي كالدجاجة .. كان هذا كمين (إعدام حسب الهوية) من الكمائن التي انتشرت في لبنان وقتها. قل لي بربك ما هي الإجابة الصحيحة ؟.. ما هي الإجابة الصحيحة ؟.. بسرعة !.. هل الصواب أن تكون مسلمًا في هذه اللحظات أم مسيحيًا ؟.. لم يعرف صاحبنا الإجابة قط لأن دوره جاء .. وعندما وقف وسط الجثث المذبوحة لمن سبقوه، وعندما طلبوا منه أوراقه ظهرت دورية من الشرطة؛ ففر المعتدون ونجا بمعجزة شبه سينمائية.. عاد المصري على الفور إلى وطنه، ويحكي صديقي أنه ظل أعوامًا يجلس في غرفة خافتة الإضاءة يحملق في الجدار ولا يتكلم .. لقد احترق جهازه العصبي ولا تثريب عليه', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:59', '2021-03-05 23:33:59'),
(1253, 'فقاقيع', 'فقاقيع', 'http://books.google.com/books/content?id=-bFUDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=-bFUDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200331', 'هذه مقالات ساخرة قصيرة لا تبغى سوى جعلك تبتسم بعدها تنفجر كالفقاقيع وتبلل أرنبة أنفك لثوان. لهذا نقدم جائزة لأى شخص يتذكر مقالاً واحداً من هذا الكتاب بعد ثلاث دقائق من قرائه.', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:59', '2021-03-05 23:33:59'),
(1254, 'قوس قزح', 'قوس-قزح', 'http://books.google.com/books/content?id=DhKLDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=DhKLDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200614', 'سبع قصص رعب بسبعة ألوان للطيف !', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:33:59', '2021-03-05 23:33:59'),
(1255, 'قهوة باليورانيوم', 'قهوة-باليورانيوم', 'http://books.google.com/books/content?id=O4ktDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=O4ktDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200218', 'لقد أقنعت نفسي منذ زمن أنه لا توجد كائنات على كواكب أخرى وأننا وحيدون معزولون تمامًا .. هذا يريحني وقد بنيت حياتي على هذا وكففت عن قراءة الأخبار السخيفة عن دوائر المحاصيل واختطاف الفتيات إلى المريخ، وظهور طبق طائر فوق أسبانيا. أؤمن أن البشرية تقدمت وهذا سوف يجعلها تلقي بقصص الأطفال التي تزين أغلفتها رسوم أطباق طائرة من النافذة وتتفرغ لشأنها الخاص. فقط لو نزل طبق طائر في شارعنا وخرج منه رجال خضر لهم هوائي واختطفوني لكوكبهم، عندها سأعرف أنني كنت مخطئًا لكن على الأقل لن أكون هنا لأعتذر!', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:00', '2021-03-05 23:34:00'),
(1256, 'لا مكان للملل', 'لا-مكان-للملل', 'http://books.google.com/books/content?id=0hGLDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=0hGLDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200638', 'مجموعة من المقالات عن أحداث سياسية وحياتية', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:00', '2021-03-05 23:34:00'),
(1257, 'الحافة', 'الحافة', 'http://books.google.com/books/content?id=3q5UDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=3q5UDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200324', 'اليوم نتحدث عن الحافة. الحافة الفاصلة بين ما هو خيال وما هو حقيقة.. بين ما هو أسطورة وما هو حقيقة علمية.. الكثير من الأشخاص والأشياء تقف على الحافة، ولقد اقتربنا في كتاب سابق من الأساطير التي تقف على الحافة حتى ليحسبها الناس حقيقة لا شك فيها، لكننا اليوم نفعل العكس فنتحدث عن الحقائق التي تبدو للناس أساطير أو خرافات. كم من مرة سمعت عبارة (غريب لكنه حقيقي)؟.. مراراً.. لكن كم مرة اكتشفت أن هذا الغريب لكنه حقيقي لاحظ له من الحقيقة على الإطلاق؟.. الإنترنت تعج بهذه الحقائق الزائفة التي لا تصمد أمام أية ملكة نقد لديك. هذه مجموعة من المواضيع يربطها شيء واحد، هو أنها حقائق اقتربت من الخيال جداً. قصص لا تصدق عن أشخاص مشوهين وعن علماء قساة وعن ابتكارات بسيطة عبقرية. الديناصور الأخير، والفلاح الذي ولد بركان في حقله، وحلم الطيران لدى البشرية والحقائق العلمية خلف فن الوهم والاختراع الذي لا يعرف أحد أنه من ابتكار أديسون، والوجبة اليابانية غالية الثمن التي يجازف آكلها بحياته، والغوريلا المتكلمة. جاك السفاح وعلاقته بالماسونية، والألعاب التي صنعت مليونيرات من مبتكريها، ولغز اغتيال بونابرت.. الخ.. إنها الحافة حيث عدم التصديق أقرب للطبيعة البشرية من التصديق، وبرغم هذا يجب أن تصدق لأن هذا كله حقيقي تماماً. حرصنا في هذه المجموعة من المواضيع على أن تتنوع المصادر، لأن الإنترنت مليئة بالمعلومات ومتاحة لكل من يجيد الإنجليزية، لهذا اعتمدنا أكثر على الكتب.. وبالذات بعض الكتب والمجلات القديمة أو المنسية التي يصعب أن تجدها في مكتبتك.. إنها جولة ممتعة تمتد عبر القرون وعبر مئات الأميال ومختلف الحضارات.. والأهم أنك سوف تقرأ وأنت تصدق كل حرف تقرؤه لأنه حقيقي تماماً، سوف نقرأ معاً ونقترب أكثر من الحافة.. حافة العلم.', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:00', '2021-03-05 23:34:00'),
(1258, 'حظك اليوم', 'حظك-اليوم', 'http://books.google.com/books/content?id=7q5UDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=7q5UDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200164', 'اثنا عشر برجاً اثنتا عشرة طريقة للموت ولعنة تطاردك في كل صوب تمر بالأطوار المعتادة: في البداية أنت لا تعرف ... بعد هذا أنت لا تلاحظ ... ثم تلاحظ فلا تصدق ... ثم تصدق فلا تعرف ما ينبغى عمله يقول الغربيون أنك لا يمكن أن تكون حذراً اكثر من اللازم, وهذه القصص تطبيق عملي صادق لصحة هذه المقولة', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:01', '2021-03-05 23:34:01'),
(1259, 'قصاصات قابلة للحرق', 'قصاصات-قابلة-للحرق', 'http://books.google.com/books/content?id=xbBUDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=xbBUDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200157', 'عندما تقلب في أوراقك القديمة تجد الكثير من الهراء...كثيرا من الكلام الفارغ الذي لا رأس له ولا ذيل وبعضه ينم عن سخف أو سذاجة بالغة أو تفاؤل مضحك أو ثقة بالنفس غير مبررة أو شعور بالضعة لا داعي له مصداقا لقصيدة قديمة لنزار قباني يقول فيها : أتلو رسائلنا فتضحكني...أمثل هذا السخف قد كنا؟ عندما تقلب في أوراقك القديمة تجد الكثير من الهراء.. لكنك كذلك تجد بقايا أفكار ولمحات من خواطر فيها بعض اللحم .. عندها يخطر لك ان هذه القصاصات تصلح لشيء ما..', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:01', '2021-03-05 23:34:01'),
(1260, 'موسوعة الظلام', 'موسوعة-الظلام', 'http://books.google.com/books/content?id=yK5UDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=yK5UDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778200225', 'موسوعة الظلام .. نتحدث عن الرعب .. عن المجهول .. عن الجانب المظلم من القمر، والناحية الأخرى من الباب الموصد .. نتحدث عما ينتظرنا في زاوية المنعطف، وعن الذي يقرع جرس الباب بعد منتصف الليل .. نتحدث عن سبب عواء الكلب وانتصاب شعر القط .. نتحدث عن أسرار منسية وفنون بائدة يتداولون سرها همسًا .. نتحدث عن طقوس غامضة وقلاع مهجورة .. موسوعة الظلام .. نتحدث عن كتب كانوا يحرقون من يمتلكها، وعن أشياء لا اسم لها .. نتحدث عن هذه الأسرار الرهيبة وعن الذين كتبوا عنها أو صوروها .موسوعة الظلام هي محاولة جريئة هي ان تجمع كل هذا في موسوعة، كأنك يمكن أن تحتوي خيال الإنسان وكوابيسه في كلمات، لكننا حاولنا .. والنتيجة ما زالت بعيدة عن الكمال، لكنها تمنحك ساعات لا شك فيها من الإثارة والخيال.. نستطيع ان نعطيك هذا الوعد ونفي به!', NULL, 633, 2, NULL, 100.00, NULL, '2021-03-05 23:34:01', '2021-03-05 23:34:01'),
(1261, 'وللجاسوسية فنون', 'وللجاسوسية-فنون', 'http://books.google.com/books/content?id=PBlfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=PBlfDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778060980', 'كيف تكتشف جاسوساً ؟ الإجابة على هذا السؤال تحتاج أن تعرف أولاً من هو الجاسوس وكيف يعمل، ما هي أسرار الجاسوسية وطرق جمعهم للمعلومات، وكيف يمكن لجاسوس واحد أن يدمر بلد كاملة؟! ما هي حروب المعلومات وكيف هو مستقبل العالم؟ وماذا يفعل رجال المخابرات لمواجهة الجاسوسية ؟ كتاب ممتع ومهم وموثق بمعلومات حقيقية وشيقة عن طرق الجاسوسية في اختراق العالم وطرق كشفهم.', NULL, 802, 2, NULL, 100.00, NULL, '2021-03-05 23:34:02', '2021-03-05 23:34:02'),
(1262, 'الحلاج', 'الحلاج', '', '', '9789773136314', '', NULL, 803, 2, NULL, 100.00, NULL, '2021-03-05 23:34:02', '2021-03-05 23:34:02'),
(1263, 'للموكوس وخايب الرجا-سكة النجاح', 'للموكوس-وخايب-الرجا-سكة-النجاح', 'http://books.google.com/books/content?id=oj9PDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=oj9PDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789778520361', 'الموكوس وخايب الرجا \"خد هنا يا موكوس \" \" وراح فين بسلمته خايب الرجا \" \" يا موكوس \" يا خايب الرجا \" هذه المصطلحات المصرية الصميمة العريقة الممتدة فى جذور الثقافة والتربية المصرية والتى نعتنا بها جميعاً يوما ما سواء من اهالينا او مدرسينا او من حولنا من اصدقاء ، والتى نستعملها لوصف حالة من يخفق فى تحقيق شيئاً ما فى اى منحى من مناحى حياته او من لا يستطيع ان يحقق اى شئ فى حياته اومن لا يستطيع التعامل مع مجريات الحياة وتحدياتها ، او من نرى ان لا أمل فيه ولا رجاء منه وقد تكون انت كما كنت انا يوماً ما اعتبر نفسى \" موكوس وخايب الرجا \" كما كانوا يقولون فهذا الكتاب لك ولكل من اعتبر نفسه \" موكوس وخايب الرجا \" فى اى جانب من جوانب حياته سواء حياته الشخصية او الاجتماعية او المهنية إستعد لتكتشف سكة النجاح فى مصر ..', NULL, 804, 2, NULL, 100.00, NULL, '2021-03-05 23:34:02', '2021-03-05 23:34:02'),
(1264, 'نادر فودة 3', 'نادر-فودة-3', 'http://books.google.com/books/content?id=qo9LDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=qo9LDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777811545', '', NULL, 805, 2, NULL, 100.00, NULL, '2021-03-05 23:34:02', '2021-03-05 23:34:02'),
(1265, 'نادر فودة 2', 'نادر-فودة-2', 'http://books.google.com/books/content?id=w101DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=w101DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777811385', 'أنا نادر فودة رجعت من جديد بعد اقناع طويل من صديقى أحمد يونس علشان أكما المشوار اللى بدأته رجعت بعد ما تخطت روايتى الأولى الأربعين طبعة وكانت مفاجأة ليا رجعت بعد ما روايتى الأولى فى معرض الكتاب حضر توقيعها 12 ألف محب ليا وحطمت كل الأرقام كنت فاكر أن الوقاد هو قمة الشر كنت فاكر أنى هقدر أعيش حياتى بهدوء لكن من الواضح أن اللى زيي وزيك موضوع الراحة ده مش حليفهم فى روايتى التانية حابب أفكرك أنك ما تربطش بينهم وبين قصص الراديو نهائى حابب أقولك أن الرواية كلها بالعامية المصرية علشان هى الوحيدة اللى قدرت تعبر عنى كويس جدا مقدرش أوعدك أنك هتلاقى عندى دايما الخير بينتصر على الشر ولا أقدر أوعدك أنك هتلاقينى دايما فارس العصر لكن أقدر أوعدك كويس جدا انك هتعيش معايا هنا مغامرة … الفزع هو أبسط تعريف ليها قلل اضاءة اوضتك أسمع أشهر تراكات قصصى أو أقعد عالبحر بالليل', NULL, 805, 2, NULL, 100.00, NULL, '2021-03-05 23:34:03', '2021-03-05 23:34:03'),
(1266, 'كفر الهلع', 'كفر-الهلع', 'http://books.google.com/books/content?id=a15mDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', 'http://books.google.com/books/content?id=a15mDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '9789777811675', '', NULL, 806, 2, NULL, 100.00, NULL, '2021-03-05 23:34:03', '2021-03-05 23:34:03'),
